(9, 'E\'sener Dinkelbrot aus Goldkeimlinge (Weiling)', '4032586001016', 0, 3.39, 1, 1, NULL, 0, '92000', 'E\'sener Dinkelbrot aus Goldkeimlinge', 'Dieses Vollkornbrot ist einzigartig. Der hohe Anteil frischer Dinkel-Goldkeimlinge macht es besonders ausgewogen. Mit zwei Scheiben Härdtner E´sener Dinkelbrot decken Sie 95% Ihres Tagesbedarfs an Folsäure (Analyse vom 05. April 2011). Als Energiequelle baut der Keimling die enthaltene Phytinsäure ab und macht dadurch die daran gebundenen Nährstoffe leicht verfügbar.', 'Härdtner Spezialitäten GmbH', 'Härdtner Spezialitäten', 'GERMANY', '2189a70b-13a2-4355-9489-1c108b438c26', 'correction', '2021-09-21 02:12:19', 'System', '2023-08-15 02:09:16', 638, 292, 2, NULL, 0, 3.27, 'Weiling', 0, NULL, 0, 64, 'Frisch gekeimter DINKEL**1), Natursauerteig** (DINKELvollkornschrot**1), Wasser), Wasser, Steinsalz, Hefe* 1)Dinkel ist eine WEIZENart; *aus kontrolliert biologischem Anbau; **aus biologisch-dynamischem Anbau', '2022-06-01 00:01:32', 1020, 'BREAD_BUNS', 'PASTRY', 509.7, 15, 'VEGAN;VEGETARIAN;LACTOSEFREE', NULL, NULL),
(10, 'E\'sener Roggenbrot - Goldkeimlinge (Weiling)', '4032586000996', 0, 3.99, 1, 1, NULL, 0, '92002', 'E\'sener Roggenbrot - Goldkeimlinge', 'Dieses Vollkornbrot ist einzigartig. Der hohe Anteil frischer Goldkeimlinge macht es besonders ausgewogen. Als Energiequelle baut der Keimling die enthaltene Phytinsäure ab und macht dadurch die daran gebundenen Nährstoffe leicht verfügbar.', 'Härdtner Spezialitäten GmbH', 'Härdtner Spezialitäten', 'GERMANY', '2191f923-6d06-4c88-9406-7e4bc972efba', 'manager', '2021-08-12 11:20:48', 'System', '2023-08-15 02:09:29', 639, 313, 2, NULL, 0, 2.7, 'Weiling', 0, NULL, 0, 64, 'Frisch gekeimter ROGGEN**, Natursauerteig (ROGGENvollkornschrot**, Wasser), Wasser, Steinsalz, Hefe* *aus kontrolliert ökologischer Erzeugung **aus biodynamischer Erzeugung', '2022-06-01 00:01:17', 1020, 'BREAD_BUNS', 'PASTRY', 509.7, 15, 'VEGAN;VEGETARIAN;LACTOSEFREE', NULL, NULL),
(11, 'Knusprige Bio Kastanien-Schnitten (Weiling)', '3380380057960', 0, 3.99, 1, 1, NULL, 0, '21451', 'Knusprige Bio Kastanien-Schnitten', 'Blumenbrot - inspiriert von den Blüten des Buchweizen . Alle Sorten (insgesamt 15) sind Vegan, glutenfrei  und bis auf die Sorte Feige auch Koscher. Zur Philosophie Ekibio gehört außerdem, dass Blumenbrote ohne Hefe, Eier, Fette, Milchprodukte und Aromastoffe verarbeitet werden. Somit ist das Blumenbrot (\"Le Pain Des Fleurs\") nicht nur für Menschen mit Glutenunverträglichkeit bestens geeignet. Der Teig für das Knusperbrot wird während der Verarbeitung einige Sekunden bei einer hohen Temperatur von 300 bis 400°C getoastet. Dabei entsteht die spezielle knusprige Textur, die auch von Sorte zu Sorte variiert.', 'EKIBIO SAS', 'Blumenbrot', 'FRANCE', '0db5d978-21bf-488e-a073-d6cacd197400', 'manager', '2021-08-12 11:20:56', 'System', '2023-08-26 02:05:57', 530, 1459, 0, NULL, 0, 2.56, 'Weiling', 0, NULL, 0, 52, 'Reismehl*, Kastanienmehl* (30%), Meersalz.\n *aus kontrolliert ökologischer Erzeugung', '2023-01-16 17:18:49', 1447.88, 'BREAD_BUNS', 'PASTRY', 200, 16.5, 'VEGAN;VEGETARIAN;GLUTENFREE;KOSCHER;WITHOUT_ADDED_SUGAR', NULL, NULL),
