(59, 'Dinkel Oliven-Snacks Kräuter der Provence (Weiling)', '4006182005129', 0, 2.79, 1, 1, NULL, 0, '24040', 'Dinkel Oliven-Snacks Kräuter der Provence', 'Oliven, Kräuter der Provence und kräftiges Dinkelmehl geben diesem mediterranen Knabbergebäck seinen unvergleichlichen Geschmack. Ideal zum Aperitif oder bei Lust auf etwas Besonderes.', 'Biback Zwiebackfabrik Sommer GmbH & Co. KG', 'Sommer & Co.', 'GERMANY', 'd5c8955a-7ed0-4744-a504-d963cbaa9cab', 'correction', '2021-08-16 22:32:09', 'System', '2023-12-16 02:07:10', 35, 30, 0, NULL, 0, 1.69, 'Weiling', 0, NULL, 0, 63, 'DINKELMEHL* (63%),GERSTENMEHL*,natives Olivenöl Extra*, Oliven* (6%), Hefe, Meersalz, Kräuter der Provence*, Gewürze*. *aus kontrolliert ökologischer Erzeugung', '2023-09-07 03:47:42', 891, 'SWEETS', 'SNACKS', 160, 18, 'VEGAN;VEGETARIAN', NULL, NULL),
(60, 'Demeter Pane Picco mit Sesam und Schwarzkümmel (Weiling)', '4006182005457', 0, 2.59, 1, 1, NULL, 0, '24046', 'Demeter Pane Picco mit Sesam und Schwarzkümmel', 'Sesam, Schwarzkümmel und feine Kräuter der Provence verleihen diesem Dinkel-Brotgebäck sein nussig würziges Aroma. Durch eine lange Teigreife erhält Pane Picco einen besonders knusprigen Biss.', 'Biback Zwiebackfabrik Sommer GmbH & Co. KG', 'Sommer & Co.', 'GERMANY', 'b1e06ba2-ff16-495d-8995-a8df65e793ec', 'correction', '2021-09-10 02:20:20', 'System', '2023-12-16 02:07:03', 36, 31, 2, NULL, 0, 1.54, 'Weiling', 0, NULL, 0, 63, 'DINKELMEHL** (64%), GERSTENMEHL**, SESAM** (7%), natives Olivenöl Extra*, Meersalz, Schwarzkümmel* (0,4%), Hefe*, Kräuter der Provence*, Chili*, Koriander*, Curcuma*. *aus kontrolliert ökologischer Erzeugung **aus biodynamischer Erzeugung', '2023-09-07 03:47:35', 891, 'SWEETS', 'SNACKS', 160, 18, 'VEGAN;VEGETARIAN', NULL, NULL),
(61, 'Demeter Pane Picco ASIA (Weiling)', '4006182005587', 0, 2.69, 1, 1, NULL, 0, '24049', 'Demeter Pane Picco ASIA', 'Schwarzer Sesam, asiatische Curry-Gewürze und ein Schuss natürlich fermentierter Tamari-Sauce verleihen diesem Dinkel-Brotgebäck sein nussig exotisch-würziges Aroma. Durch eine lange Teigreife erhält Pane Picco einen besonders knusprigen Biss. Guten Appetit.', 'Biback Zwiebackfabrik Sommer GmbH & Co. KG', 'Sommer & Co.', 'GERMANY', '44d01b31-7e0a-4f3c-8213-974cc7921145', 'correction', '2021-09-10 02:20:26', 'System', '2023-11-14 02:10:39', 37, 32, 2, NULL, 0, 1.54, 'Weiling', 0, NULL, 0, 63, 'DINKELMEHL** (63%), GERSTENMEHL** , schwarzer SESAM* (7%), natives Olivenöl Extra*, Meersalz, Hefe*, Curry*, Tamari* (natürlich fermentierte SOJASOßE*), Chili*. **aus biodynamischer Erzeugung *aus kontrolliert ökologischer Erzeugung', '2023-08-11 02:13:59', 891, 'SWEETS', 'SNACKS', 160, 18, 'VEGAN;VEGETARIAN', NULL, NULL),
(62, 'Piadina Wrap Dinkelmehl und Hafer (Weiling)', '8713576000627', 0, 2.99, 1, 1, NULL, 0, '90032', 'Piadina Wrap Dinkelmehl und Hafer', 'Diese Piadine (echte italienische Wraps) werden aus Dinkel und Hafer  hergestellt. Dadurch sind Geschmack und Textur dieser Wraps echt etwas  Besonderes. Piadine sind nicht nur im Handumdrehen fertig, sie lassen sich  obendrein auf zahllose Arten verwenden, zum Beispiel als (zusammengeklappte)  Pizza, als Brötchen oder Pfannkuchen. Lecker mit Pesto, gegrilltem Gemüse und  mediterranen Delikatessen.  Probiere auch die Piadine aus Vollkornweizen und Hafer und die aus Weizen und  Hanf!', 'TerraSana Natuurvoeding BV', 'TerraSana', 'ITALY', '46092e52-78c3-4fcb-8058-458fab94e3db', 'correction', '2021-09-10 02:20:13', 'System', '2023-10-04 02:10:42', 38, 33, 0, NULL, 0, 2.43, 'Weiling', 0, NULL, 0, 107, 'DINKELauszugsmehl* 45.5%, HAFERmehl* 25.5%, Wasser, Sonnenblumenöl*, Meersalz, Erbsenprotein*, Kartoffelstärke*, WEIZENgluten*, Verdickungsmittel: Guarkernmehl* *aus kontrolliert ökologischer Erzeugung', '2022-10-15 02:05:21', 658, 'OTHER_PASTRY', 'PASTRY', 255, 28, 'VEGAN;VEGETARIAN', NULL, NULL),
(63, 'Naan mit Knoblauch und Ka (Weiling)', '8713576000849', 0, 3.59, 1, 1, NULL, 0, '90034', 'Naan mit Knoblauch und Ka', 'Naan ist ein indisches Fladenbrot. Wir machen es aus Weizen und dem \ntraditionellen Gewürz Kalonji (Schwarzkümmel). Tunke sie ein oder fülle sie mit \ndeinen Lieblingsaufstrichen, Delikatessen oder Currys.', 'TerraSana Natuurvoeding BV', 'TerraSana', 'ITALY', '9a71a7ea-bb98-436b-8900-fbbaa6250ef4', 'correction', '2021-09-10 02:20:10', 'System', '2021-10-12 02:08:30', 39, 34, NULL, NULL, 0, 0, 'Weiling', 0, NULL, 0, NULL, NULL, '2021-10-12 02:08:30', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL),
(64, 'Naan Naturell (Weiling)', '8713576000832', 0, 3.59, 1, 1, NULL, 0, '90035', 'Naan Naturell', 'Naan ist Fladenbrot aus Indien. 3-4 Minuten in den Ofen legen und mit deinen \nLieblingsaufstrichen, Dips oder natürlich Currys servieren. Auch lecker als \nPizzabasis!', 'TerraSana Natuurvoeding BV', 'TerraSana', 'ITALY', '72555504-25d5-4dd3-aa59-016acc24bb1c', 'correction', '2021-09-10 02:20:06', 'System', '2021-10-12 02:08:23', 40, 35, NULL, NULL, 0, 0, 'Weiling', 0, NULL, 0, NULL, NULL, '2021-10-12 02:08:23', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL),
(65, 'Protein-Brot (Weiling)', '8713576001983', 0, 1.99, 1, 1, NULL, 0, '90072', 'Protein-Brot', 'Dieses Protein-Brot ist wahrscheinlich das abwechslungsreichste Brot, das du  finden kannst. Hergestellt aus einer einzigartigen Basis aus Roggen,  Weizenprotein und Soja. Sowohl proteinreich (20g pro 100g) als auch  kohlenhydratarm (14g pro 100g, statt 40g bei normalem Brot). Die Struktur des  Brotes ist fest und elastisch. Ein super leckeres Mittagessen oder ein Snack  für aktive Menschen und alle, die eine Proteindiät befolgen. Köstlich mit  Erdnussmus und Bananen-, Avocado- und Chiasamen oder hausgemachtem  Schokoladenaufstrich.', 'TerraSana Natuurvoeding BV', 'TerraSana', 'GERMANY', 'dc84b9a3-a465-4faa-b804-1a0fd25d1a89', 'manager', '2021-08-12 11:28:36', 'System', '2023-01-16 17:22:06', 1514, 392, 0, NULL, 0, 2.19, 'Weiling', 0, NULL, 0, 60, 'Wasser, Vollkorn ROGGENmehl*, WEIZENeiweiß*, Leinsaat*, grobes SOJA-Mehl*, SOJAmehl*, Apfelessig*, Sonnenblumenkerne*, WEIZENkleie*, Apfelfaser*, Meersalz, Hefe* *aus kontrolliert ökologischer Erzeugung', '2022-11-09 06:01:23', 585, 'BREAD_BUNS', 'PASTRY', 255, 13, 'VEGAN;VEGETARIAN', NULL, NULL),
