(68, 'Backstabile Schoko-Tropfen zartbitter (Weiling)', '4013044100281', 0, 2.99, 1, 1, NULL, 0, '30409', 'Backstabile Schoko-Tropfen zartbitter', 'Lecker’s backstabile Schoko-Tropfen Zartbitter sind ideal zur Herstellung von Muffins und Brownies. Sie schmelzen beim Backen nicht und verleihen jedem Gebäck eine leckere, schokoladige Note!', 'LECKER`S Bio Manufaktur  GmbH', 'Lecker´s', 'GERMANY', '14545a94-5810-4f43-aca5-9b935341b7f3', 'manager', '2021-08-12 11:28:59', 'System', '2023-01-16 17:22:10', 1054, 394, 0, NULL, 0, 1.82, 'Weiling', 0, NULL, 0, 60, 'Kakaomasse*, Rohrzucker*, Emulgator SOJALECITHIN* *aus kontrolliert ökologischer Erzeugung', '2022-04-11 15:05:55', 610.5, 'BAKING_INGREDIENTS', 'PANTRY', 106, 18.5, 'VEGAN;VEGETARIAN', NULL, NULL),
(69, 'Roggen Sauerteig Extrakt, BIO (Weiling)', '4005394121023', 0, 1.49, 1, 1, NULL, 0, '31510', 'Roggen Sauerteig Extrakt, BIO', 'Die BIOVEGAN Sauerteige bringen Ihnen auf einfache Weise frisches und selbstgebackenes Brot nach Hause. Nur Hefe und Mehl dazugeben und sie sind sofort backbereit. BIOVEGAN Roggen Sauerteig Extrakt aus Bioland Roggen ist mit seinem feinen Sauerteig-Geschmack nicht zu überbieten. Zur feinen Aromatisierung von selbstgebackenem Brot. Ausreichend für 1 kg Mehl.', 'Biovegan GmbH', 'Biovegan', 'GERMANY', '242d13f3-79ca-409f-880f-13f835c7b57e', 'correction', '2021-08-16 22:35:11', 'System', '2023-07-28 02:06:58', 42, 37, 1, NULL, 0, 1.02, 'Weiling', 0, NULL, 0, 63, 'RYE WHOLE GRAIN PRODUCTS*, starter cultures. *aus kontrolliert ökologischer Erzeugung', '2022-06-01 00:02:37', 83.6, 'BREAD_BUNS', 'PASTRY', 33, 15.2, 'VEGAN;VEGETARIAN', NULL, NULL),
(70, 'Sahnesteif, BIO (Weiling)', '4005394286067', 0, 1.19, 1, 1, NULL, 0, '31527', 'Sahnesteif, BIO', 'Für Sahne und mehr... Sahnetorten, Eiskreationen oder einfach nur Sahne die nötige Festigkeit verleihen: BIOVEGAN Sahnesteif ist die ideale Wahl.', 'Biovegan GmbH', 'Biovegan', 'GERMANY', '6f56962e-eb64-4c79-a256-51bfeafb9d92', 'correction', '2021-08-16 22:35:34', 'System', '2023-06-01 02:12:47', 43, 38, 0, NULL, 0, 0.71, 'Weiling', 0, NULL, 0, 63, 'Maisstärke*, Kartoffelstärke*, Puderzucker* (97 % Rohrohrzucker*, Tapiokastärke*). *aus kontrolliert ökologischer Erzeugung', '2022-06-01 00:02:27', 18.4, 'BAKING_INGREDIENTS;SPICES_COOKING_HELP', 'PANTRY', 28, 11.5, 'VEGAN;VEGETARIAN;GLUTENFREE', NULL, NULL),
