(73, 'Bourbon-Vanille-Schote, BIO (Weiling)', '4005394287958', 0, 5.49, 1, 1, NULL, 0, '31535', 'Bourbon-Vanille-Schote, BIO', 'Bourbon-Vanille, die Königin der Gewürze, verleiht durch ihr einzigartiges Aroma zahlreichen Speisen das gewisse Etwas. Bourbon-Vanille hat eine Herkunftsgarantie aus Madagaskar, La Rèunion oder von den Komoren.', 'Biovegan GmbH', 'Biovegan', 'GERMANY', 'bcb662bf-2a4e-4cbb-9635-8c7a3f4a1a46', 'correction', '2021-08-17 01:56:54', 'System', '2023-07-28 02:05:39', 299, 80, 0, NULL, 0, 3.2, 'Weiling', 0, NULL, 0, 63, 'Bourbon vanilla pod*. *aus kontrolliert ökologischer Erzeugung', '2023-04-14 08:43:21', 154.4, 'BAKING_INGREDIENTS', 'PANTRY', 23, 19.3, 'VEGAN;VEGETARIAN;GLUTENFREE', NULL, NULL),
