(77, 'Meister Backpulver, BIO (Weiling)', '4005394286333', 0, 1.19, 1, 1, NULL, 0, '31632', 'Meister Backpulver, BIO', 'Darauf hat die Backwelt gewartet: Die  BIOVEGAN Backpulver-Revolution begeistert nicht nur Hobbybäcker. Das einzige Backpulver mit Tapioka mit noch mehr Triebkraft !\nMEISTER-BACKPULVER  IST...\n...STÄRKER! Garantiert bessere Ergebnisse \n(mehr Triebkraft, natürlichere Farbe, besserer Geschmack & Geruch).\n...FRISCHER! Gebäcke halten sich länger frisch.\n...HARMONISCHER! Gleichmäßigere und harmonischere Teigführung.\n...UNIVERSELL! Geeignet für Teige aller Art.\n...IDEAL! Gut für alle, die auf Maisstärke verzichten wollen oder müssen.', 'Biovegan GmbH', 'Biovegan', 'GERMANY', '5a64cab4-f29c-488e-83ff-d5a52e036cb7', 'correction', '2021-08-16 22:37:11', 'System', '2024-01-30 02:05:31', 45, 41, 0, NULL, 0, 0.62, 'Weiling', 0, NULL, 0, 63, 'Tapioca starch*, raising agent: sodium carbonates (E500); acidifier: potassium tartrate (22.8%)¹ (E336); lemon juice powder*, thickening agent: guar gum* (E412). *aus kontrolliert ökologischer Erzeugung', '2022-05-17 03:04:50', 55.2, 'BAKING_INGREDIENTS', 'PANTRY', 58, 11.5, 'VEGAN;VEGETARIAN;GLUTENFREE', NULL, NULL),
