(82, 'Haselnusskerne natur, gemahlen (Weiling)', '4065626113882', 0, 3.59, 1, 1, NULL, 0, '506048', 'Haselnusskerne natur, gemahlen', 'Unsere Haselnüsse, aus denen später unsere gemahlenen Haselnüsse entstehen, kommen aus Aserbaidschan. Sie sind angenehm würzig und herzhaft im Geschmack. Perfekt fürs Backen und Kochen.\n', 'Weiling GmbH', 'bioladen', 'GERMANY', '5f72ba1f-836d-4856-97f5-37d93800f2d6', 'correction', '2021-08-16 22:39:22', 'System', '2023-11-23 02:09:13', 50, 45, 0, NULL, 0, 2.18, 'Weiling', 0, NULL, 0, 60, NULL, '2022-12-01 08:23:55', 356.5, 'OTHER', 'OTHER', 103, 15.5, 'VEGAN;VEGETARIAN;RAWFOOD', NULL, NULL),
(83, 'Mandelblättchen (Weiling)', '4065626113943', 0, 3.79, 1, 1, NULL, 0, '506056', 'Mandelblättchen', 'Die Mandeln, die später zu unseren Mandelblättchen weiterverarbeitet werden, werden in Spanien angebaut. Sie haben ein mildes, angenehm süßes Aroma. Perfekt fürs Backen und Kochen.\n', 'Weiling GmbH', 'bioladen', 'GERMANY', '70b42e35-c8f8-4a72-9645-adc0ed18a682', 'correction', '2021-08-16 22:39:50', 'System', '2023-11-08 02:10:53', 51, 46, 0, NULL, 0, 2.18, 'Weiling', 0, NULL, 0, 60, NULL, '2022-09-10 00:05:54', 356.5, 'OTHER', 'OTHER', 103, 15.5, 'VEGAN;VEGETARIAN', NULL, NULL),
