(85, 'Mandeln, naturbelassen & gemahlen (Weiling)', '4065626113981', 0, 3.29, 1, 1, NULL, 0, '506060', 'Mandeln, naturbelassen & gemahlen', 'Die Mandeln, die später zu unseren gemahlenen Mandeln weiterverarbeitet werden, werden in Spanien angebaut. Sie haben ein mildes, angenehm süßes Aroma. Perfekt fürs Backen und Kochen.\n', 'Weiling GmbH', 'bioladen', 'GERMANY', '70edd702-a874-4586-b2a5-98d2d6e8f2cd', 'correction', '2021-08-16 22:40:38', 'System', '2023-11-08 02:11:01', 53, 48, 0, NULL, 0, 2.18, 'Weiling', 0, NULL, 0, 60, NULL, '2022-10-29 00:01:13', 356.5, 'OTHER', 'OTHER', 103, 15.5, 'VEGAN;VEGETARIAN;RAWFOOD', NULL, NULL),
(86, 'Pinkus Hefe Weizen 8er (Weiling)', '4023216000042', 1, 1.69, 1, 1, NULL, 0.08, '70203', 'Pinkus Hefe Weizen 8er', 'Pinkus Weizen ist ein erfrischender Biergenuss. Streng nach dem Deutschen Reinheitsgebot wird Pinkus Hefe Weizen aus 60% Bioland Weizenmalz und 40% Bioland Gerstenmalz, Hopfen und erstklassigem Brauwasser hergestellt. Es enthält keinerlei Eiweißstabilisierungsmittel. Vor dem Abfüllen wird dem Weizenbier aus Münster unvergorene Bierwürze zugesetzt, die das Bier in der Flasche noch nachgären lässt. Daher ist es ratsam, Pinkus Hefe Weizen stets gut gekühlt und mit etwas Gefühl einzuschenken. Sehr zum Wohle!', 'Brauerei Pinkus Müller GmbH & Co. KG', 'Pinkus', 'GERMANY', '978af8bc-f125-4731-a3ae-9c74145094e2', 'correction', '2021-09-08 15:57:20', 'System', '2023-01-16 17:23:41', 54, 49, 1, NULL, 8, 0.87, 'Weiling', 2, 1, 0, 63, NULL, '2022-11-29 16:45:40', 1106.95, 'BEER', 'DRINKS', 800, 26.2, 'VEGAN;VEGETARIAN', NULL, NULL),
(87, 'Pinkus Pils in der Bügelflaschen 16er (Weiling)', '4023216000073', 1, 1.79, 1, 1, NULL, 0.25, '70260', 'Pinkus Pils in der Bügelflaschen 16er', 'Das Pils aus Münsters Traditionsbrauerei. Gebraut nach dem deutschen Reinheitsgebot werden für die Herstellung von Pinkus Pils nur beste Rohstoffe verwendet: feines Bioland Gerstenbraumalz, edler Naturhopfen aus kontrolliert biologischem Anbau, erstklassiges Brauwasser und naturreine untergärige Hefe aus eigener Reinzucht. Nach altbewährter Rezeptur werden die Zutaten handwerklich verarbeitet. Die schonende Behandlung und lange Reifung bei Temperaturen knapp unter dem Gefrierpunkt machen Pinkus Pils zu einem typischen Pinkus Bier mit besonderer Note: würzig und feinherb genügt es höchsten Ansprüchen.', 'Brauerei Pinkus Müller GmbH & Co. KG', 'Pinkus', 'GERMANY', '1081301c-ebb6-4a0e-baba-9e7b3174d20a', 'correction', '2021-09-28 13:26:43', 'System', '2023-01-16 17:23:43', 55, 50, 1, NULL, 16, 0.96, 'Weiling', 2, 1, 0, 63, NULL, '2022-11-29 16:45:50', 1248.48, 'BEER', 'DRINKS', 850, 27, 'VEGAN;VEGETARIAN', NULL, NULL),
(88, 'Pinkus Special 8er (Weiling)', '4023216000028', 1, 1.59, 1, 1, NULL, 0.08, '70303', 'Pinkus Special 8er', 'Rohstoffe aus biologischem Anbau, sorgfältige Herstellung durch Meisterhand und die ungefilterte Abfüllung geben Pinkus Special den unverwechselbaren Geschmack. Es wird nach dem Deutschen Reinheitsgebot hergestellt aus Bioland Malz, Hopfen aus kontrolliertem biologischen Anbau, Hefe und erstklassigem Brauwasser. Pinkus Special wird nicht mit Eiweißstabilisierungsmitteln behandelt. Durch eine etwa dreimonatige Lagerung bei Temperaturen um 0 Grad wird Pinkus Special natur-klar und kann ungefiltert abgefüllt werden.', 'Brauerei Pinkus Müller GmbH & Co. KG', 'Pinkus', 'GERMANY', 'd06b9d25-1ae0-4694-8663-6b14bee600af', 'correction', '2021-08-17 03:11:23', 'System', '2023-01-16 17:23:47', 56, 51, 1, NULL, 0, 0.87, 'Weiling', 0, NULL, 0, 63, 'Wasser, GERSTENmalz*, Hopfen*, Hefe* *aus kontrolliert ökologischer Erzeugung', '2022-11-29 16:45:57', 1106.95, 'BEER', 'DRINKS', 800, 26.2, 'VEGAN;VEGETARIAN', NULL, NULL),
(89, 'Pinkus Alkoholfrei 24er (Weiling)', '4023216000172', 1, 1.19, 1, 1, NULL, 0.08, '70305', 'Pinkus Alkoholfrei 24er', 'Wie alle Biere aus dem Hause Pinkus Müller wird auch Pinkus Alkoholfrei ausschließlich aus biologischen Rohstoffen hergestellt. Damit bei der Herstellung kein Alkohol entsteht, wird Pinkus Alkoholfrei nach dem Verfahren der biologischen Milchsäuregärung hergestellt. Komplizierte, physikalische Prozesse zum Alkoholentzug sind aus diesem Grunde nicht notwendig. Darum Pinkus Alkoholfrei, eine Erfrischung aus Bioland Malz und biologisch angebautem Hopfen', 'Brauerei Pinkus Müller GmbH & Co. KG', 'Pinkus', 'GERMANY', '4b9580e3-7f58-49dd-b851-ac059a0c3570', 'correction', '2021-09-08 15:56:28', 'System', '2023-01-16 17:23:51', 1154, 52, 1, NULL, 24, 0.61, 'Weiling', 2, 1, 0, 63, NULL, '2022-11-29 16:45:44', 790.54, 'BEER', 'DRINKS', 600, 23.5, 'VEGAN;VEGETARIAN;ALKOHOLFREE', NULL, NULL),
(90, 'Pinkus Weizen alkoholfrei 24er (Weiling)', '4023216000264', 1, 1.09, 1, 1, NULL, 0.08, '70307', 'Pinkus Weizen alkoholfrei 24er', 'Sämtliche Zutaten für Pinkus Weizen alkoholfrei stammen aus kontrolliert biologischem Anbau. Die Bierwürze aus Bioland-Weizen und Gerstenmalz wird nach dem verfahren der gestoppten Gärung mit feiner obergäriger Hefe aus eigener Herführung versetzt. Auf diese Weise entsteht ohne nachträglichen Alkoholentzug eine natürlich erfrischende Bierspezialität.', 'Brauerei Pinkus Müller GmbH & Co. KG', 'Pinkus', 'GERMANY', 'a8b5b1bd-e2c6-4401-ae8f-7bb65b968bba', 'correction', '2021-09-08 15:56:57', 'System', '2023-01-16 17:23:55', 301, 82, 1, NULL, 24, 0.61, 'Weiling', 2, 1, 0, 63, NULL, '2022-09-10 00:01:32', 790.54, 'BEER', 'DRINKS', 600, 23.5, 'VEGAN;VEGETARIAN;ALKOHOLFREE', NULL, NULL),
(91, 'Pinkus Radler 24er (Weiling)', '4023216000301', 1, 1.19, 1, 1, NULL, 0.08, '70308', 'Pinkus Radler 24er', 'Pinkus Radler, der richtige Mix, wenn es erfrischend und spritzig sein soll. Beste Zutaten - der Saft aus Bio-Zitronen und hochwertiger Zucker aus kontrolliertem Bio-Anbau - werden mit Pinkus Bioland-Bier in guter Handarbeit zu einem ganz besonderen Radler verarbeitet.  \n\nDieses Radler trägt das Bioland-Warenzeichen! Bewusst verzichten wir auf Aromen und Zusatzstoffe, sondern bieten den reinen Genuss mit milder Süße.  \n\nSehr zum Wohle!', 'Brauerei Pinkus Müller GmbH & Co. KG', 'Pinkus', 'GERMANY', '164b69d2-bbb2-4dd0-affa-13bf01ad304c', 'correction', '2021-09-08 15:56:05', 'System', '2023-01-16 17:23:59', 57, 53, 1, NULL, 24, 0.64, 'Weiling', 2, 1, 0, 63, NULL, '2022-11-29 16:45:53', 620.889, 'BEER', 'DRINKS', 600, 23.5, 'VEGAN;VEGETARIAN', NULL, NULL),
(92, 'Frucht Pur 75% Aprikose (Weiling)', '4016249280000', 0, 3.79, 1, 1, NULL, 0, '100650', 'Frucht Pur 75% Aprikose', 'Die meisten würden diesen besonderen Aufstrich „fruchtig“ nennen – aber eigentlich wird dieses Wort dem Ganzen nicht gerecht. Denn wir haben richtig viel Frucht in unsere Gläschen gepackt. Ja, satte 75% Fruchtanteil. (Dafür haben wir weniger Zucker reingetan. Deutlich weniger als andere.) Eigentlich sollten wir dafür ein neues Wort erfinden. Wie wäre es mit FRUCHTISSIMO? Oder FRUCHTASTISCH? Was meint ihr?', 'Allos Hof-Manufaktur GmbH', 'Allos', 'GERMANY', '27a180b2-12d7-4617-b30d-563729ba8900', 'correction', '2021-08-16 22:48:11', 'System', '2024-02-03 02:10:36', 58, 54, 0, NULL, 0, 2.25, 'Weiling', 0, NULL, 0, 61, 'Aprikosen* (75%,) Agavendicksaft* (20%), Geliermittel: Pektine, Zitronensaftkonzentrat*, Festigungsmittel: Calciumcitrate. *aus ökologischem Landbau', '2023-03-10 12:44:48', 485.875, 'SPREADS_HONEY', 'PANTRY', 417, 11.5, 'VEGAN;VEGETARIAN;GLUTENFREE', NULL, NULL),
