(108, 'Lingonsylt, Preiselbeer-Konfitüre, kbA (Weiling)', '7391961111892', 0, 4.99, 1, 1, NULL, 0, '101186', 'Lingonsylt, Preiselbeer-Konfitüre, kbA', 'Lingonsylt ist eine klassische schwedischer Fruchtaufstrich aus Preiselbeeren. Durch die natürlichen Antioxidantien, die in der Preiselbeere enthalten sind, ist dieser Fruchtaufstrich auch geöffnet, gekühlt lange haltbar. Lingonsylt passt perfekt zu Braten, Käse oder einfach zu Brot oder Pfannkuchen.', 'Torfolk Gård', 'Linnéas Svenska', 'SWEDEN', 'd9a28448-f0bd-41ea-9a0f-b172ffc81d02', 'correction', '2021-08-16 22:52:26', 'System', '2023-11-29 02:10:18', 67, 63, 0, NULL, 0, 3.14, 'Weiling', 0, NULL, 0, 182, 'Waldpreiselbeeren***** 55%, Zucker* 40% *aus kontrolliert ökologischer Erzeugung *****aus bio-zertifizierter Wildsammlung', '2023-11-07 02:07:09', 466.56, 'SPREADS_HONEY', 'PANTRY', 494, 9, 'VEGAN;VEGETARIAN', NULL, NULL),
(109, 'Fiordifrutta Aprikosen Fruchtaufstrich (Weiling)', '8001505007015', 0, 4.29, 1, 1, NULL, 0, '106602', 'Fiordifrutta Aprikosen Fruchtaufstrich', 'Das Geheimnis von Fiordifrutta-Fruchtaufstrich liegt in der Auswahl der schönsten und reifsten Früchte. \nAußerdem besteht er zu 100% aus Früchten! Die natürliche Süße stammt aus reinem Apfelsaftkonzentrat, daher ist Fiordifrutta frei von zugesetztem Zucker. Da die Fruchtaufstriche von Fiordifrutta nicht aufgekocht werden, sondern schonend bei Raumtemperatur zubereitet, bleiben wichtige Inhalts- und Aromastoffe erhalten und sorgen für einen ganz besonderen Genuss.', 'Genuport Trade GmbH', 'Rigoni di Asiago S.R.L. ', 'ITALY', 'b0c6fa7d-75a2-42a0-97ea-1a9f793f2ae7', 'manager', '2021-08-12 11:34:33', 'System', '2023-07-01 00:33:12', 677, 1777, 0, NULL, 0, 2.84, 'Weiling', 0, NULL, 0, 103, 'Aprikosen* 60%, Fruchtsüße aus Apfelsaftkonzentrat*, Geliermittel: Pektin.  *aus kontrolliert ökologischer Erzeugung', '2022-05-31 00:04:59', 479.16, 'SPREADS_HONEY', 'PANTRY', 430, 11, 'VEGAN;VEGETARIAN;KOSCHER', NULL, NULL),
(110, 'Fiordifrutta Himbeeren Fruchtaufstrich (Weiling)', '8001505007022', 0, 4.29, 1, 1, NULL, 0, '106612', 'Fiordifrutta Himbeeren Fruchtaufstrich', 'Das Geheimnis von Fiordifrutta-Fruchtaufstrich liegt in der Auswahl der schönen und reifen Früchte. Außerdem besteht er zu 100% aus Früchten! Die natürliche Süße stammt aus reinem Apfelsaftkonzentrat, daher ist Fiordifrutta frei von zugesetztem Zucker. Da die Fruchtaufstriche von Fiordifrutta nicht aufgekocht werden, sondern schonend bei Raumtemperatur zubereitet, bleiben wichtige Inhalts- und Aromastoffe erhalten und sorgen für einen ganz besonderen Genuss.', 'Genuport Trade GmbH', 'Rigoni di Asiago S.R.L. ', 'ITALY', '24bf9cdd-0780-4f5d-b7ec-61f137754c5d', 'manager', '2021-08-12 11:34:41', 'System', '2023-07-01 00:33:35', 678, 1778, 0, NULL, 0, 2.84, 'Weiling', 0, NULL, 0, 103, 'Himbeeren* 60%, Fruchtsüße aus Apfelsaftkonzentrat*, Geliermittel: Pektin. *aus kontrolliert ökologischer Erzeugung', '2022-05-31 00:05:06', 479.16, 'SPREADS_HONEY', 'PANTRY', 430, 11, 'VEGAN;VEGETARIAN;KOSCHER', NULL, NULL),
(111, 'Nocciolata Nuss Nougat Aufstrich 700g (Weiling)', '8001505007466', 0, 12.99, 1, 1, NULL, 0, '106636', 'Nocciolata Nuss Nougat Aufstrich 700g', 'Nocciolata ist frei von Palmöl und nur mit Sonnenblumenöl hergestellt. Damit ist Nocciolata eine echte Alternative zu den konventionellen Nuss-Nougat-Cremes. Der hochwertige Rohrzucker und das feine Extrakt der Bourbon-Vanille machen jedes Glas zu einem ganz besonderen Genuss. Die Zutaten stammen aus biologischer Landwirtschaft und werden so schonend verarbeitet, dass ihre gesunden Nährstoffe und der nussige Geschmack bis ins Glas erhalten bleiben.', 'Genuport Trade GmbH', 'Rigoni di Asiago S.R.L. ', 'ITALY', '0b26e022-4c71-48cc-9334-de8994793937', 'manager', '2021-08-12 11:34:49', 'System', '2023-01-16 17:25:55', 1371, 1779, 0, NULL, 0, 7.86, 'Weiling', 0, NULL, 0, 103, 'Rohrzucker*, HASELNUESSE* 18,5%, Sonnenblumenöl*, MagerMILCHpulver*, fettarmes Kakaopulver* 6,5%, Kakaobutter*, Emulgator: SOJAlecithin*, Vanille-Extrakt*. Kann andere SCHALENFRUECHTE, MANDELN, WALNUESSE, PISTAZIEN enthalten. *aus kontrolliert ökologischer Erzeugung', '2023-04-14 08:43:58', 883.2, 'SPREADS_HONEY', 'PANTRY', 995, 13.8, 'VEGETARIAN;GLUTENFREE;KOSCHER', NULL, NULL),
(112, 'Nocciolata milchfrei 270g (Weiling)', '8001505004014', 0, 5.99, 1, 1, NULL, 0, '106638', 'Nocciolata milchfrei 270g', 'Nocciolata milchfrei ist frei von Milch und frei von Palmöl, mit Sonnenblumenöl hergestellt. Damit ist Nocciolata milchfrei eine echte, vegane Alternative zu den konventionellen Nuss-Nougat-Cremes. Der hochwertige Rohrzucker und das feine Extrakt der Bourbon-Vanille machen jedes Glas zu einem ganz besonderen Genuss. Die Zutaten stammen aus biologischer Landwirtschaft und werden so schonend verarbeitet, dass ihre gesunden Nährstoffe und der nussige Geschmack bis ins Glas erhalten bleiben.', 'Genuport Trade GmbH', 'Rigoni di Asiago S.R.L. ', 'ITALY', 'b2d958d1-874e-44b1-ad54-afb9ad6aa071', 'manager', '2021-08-12 11:34:56', 'System', '2023-02-10 02:06:47', 1346, 1780, 0, NULL, 0, 3.69, 'Weiling', 0, NULL, 0, 103, 'Rohrzucker*, HASELNUESSE 19,5%*, Sonnenblumenöl*, fettarmes Kakaopulver* 11%, Kakaobutter*, Emulgator: SOJAlecithin*, Vanille-Extrakt*. Kann andere SCHALENFRUECHTE, MANDELN, WALNUESSE, PISTAZIEN enthalten. *aus ökologischer Landwirtschaft. *aus kontrolliert ökologischer Erzeugung', '2023-01-16 17:26:01', 479.16, 'SPREADS_HONEY', 'PANTRY', 450, 11, 'VEGAN;VEGETARIAN;GLUTENFREE;KOSCHER', NULL, NULL),
