(115, 'Schmalz-Töpfle mit Zwiebeln und Äpfeln (Weiling)', '4016249600532', 0, 4.59, 1, 1, NULL, 0, '110790', 'Schmalz-Töpfle mit Zwiebeln und Äpfeln', 'Diese Aufstriche sind einfach besonders. Schlicht zum Dahinschmalzen. Denn sie sind wirklich tierisch lecker – und kommen dabei mit rein pflanzlichen Zutaten aus. Ungehärtete Fette, goldgelbes Sonnenblumenöl und eine raffinierte Mischung aus aromatischen Gewürzen macht aus jedem Abendbrot ein Fünf-Sterne-Dinner. Aber unsere Schmalze können noch mehr: Sie eignen sich auch ganz hervorragend zum Zubereiten deftig-herzhafter Gerichte.', 'Allos Hof-Manufaktur GmbH', 'Allos', 'GERMANY', 'c3dded2e-1816-481c-acbc-e2d41d5eea00', 'correction', '2021-08-16 22:53:41', 'System', '2024-02-03 02:10:47', 69, 64, 0, NULL, 0, 3.31, 'Weiling', 0, NULL, 0, 61, 'Pflanzliche Fette*(79%) (Palmöl*, Palmkernfett*, Kokosfett*), Sonnenblumenöl*, getrocknete Zwiebeln* (4%), Meersalz, getrocknete Äpfel* (2%). *aus ökologischem Landbau.', '2022-11-29 15:39:57', 569.633, 'SPREADS_HONEY', 'PANTRY', 432, 11.3, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
