(127, 'Hof-Gemüse Patricks Tomate Pesto (Weiling)', '4016249132347', 0, 2.99, 1, 1, NULL, 0, '111266', 'Hof-Gemüse Patricks Tomate Pesto', 'Was wird aus bis zu 70% Gemüseanteil bei einem Fettgehalt von maximal 20%? Bei uns ist die Rechnung ganz einfach: 100% vegetarischer, veganer, glutenfreier Genuss – unser Hof-Gemüse mit ganzen Gemüse-Stücken eben. Freut Euch auf eine große Vielfalt leckerer Sorten, auf denen Euch unsere Allos Mitarbeiter erzählen, warum sie speziell von ihren Sorten so begeistert sind. So einen hohen Gemüseanteil bei einem Brotaufstrich gab es vor dem Hof-Gemüse im Bio-Fachhandel übrigens noch nicht. Da sind wir schon ein bisschen stolz drauf. Aber noch stolzer sind wir darauf, dass so richtig viel Gemüse einfach super lecker schmeckt. Überzeugt Euch selbst davon.', 'Allos Hof-Manufaktur GmbH', 'Allos', 'GERMANY', '0cf7b088-0bb3-41d8-ada6-c1190640f6e5', 'correction', '2021-08-16 22:59:33', 'System', '2023-04-13 02:07:58', 80, 75, 0, NULL, 0, 1.82, 'Weiling', 0, NULL, 0, 61, 'Tomaten* (37%), Sonnenblumenöl*, Karotten* (10%), Zwiebeln* (8%), Bärlauch* (6%), Tomatenmark* (5%), Sonnenblumenkerne*, CASHEWMUS* (4%), Agavendicksaft*, Kartoffelstärke*, Zitronensaftkonzentrat*, Basilikum* (1%), getrocknete Tomaten* (1%) (Tomaten*, Salz), Knoblauchpulver* (1%), Meersalz, Oregano* (1%), Chilipulver*. *aus ökologischem Landbau.', '2022-08-10 00:04:42', 373.034, 'SPREADS_HONEY', 'PANTRY', 286, 7.4, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(128, 'aufs Brot Avocado (Weiling)', '4016249172350', 0, 2.99, 1, 1, NULL, 0, '111308', 'aufs Brot Avocado', 'Deutschland ist HOME OF THE STULLE. Und wer so leckeres Brot kann, der belegt das nicht mit irgend etwas. Da auch wir diesem Klassiker verpflichtet sind, haben wir uns in der Allos-Rezepte-Schmiede hingesetzt und ein paar würdige Aufstriche aus Rapsöl kreiert. Das Ergebnis ist so cremig, streichzart und lecker, das es sich ganz hervorragend auf dem Brot macht – aber auch zu Salaten, Pasta oder als Dip.', 'Allos Hof-Manufaktur GmbH', 'Allos', 'GERMANY', '8cc13887-42ee-4097-9beb-7eb8367c27ed', 'manager', '2021-08-12 11:37:19', 'System', '2024-02-03 02:10:13', 306, 327, 0, NULL, 0, 1.81, 'Weiling', 0, NULL, 0, 61, 'Avocado* (20%), Rapsöl*, Wasser, Tomaten*, Sonnenblumenkerne*, Zitronensaft aus Zitronensaftkonzentrat*, Zwiebeln*, Agavendicksaft*, Meersalz, Spinatpulver*, Eiweißpulver aus Sonnenblumenkernen*, Tapiokastärke*, Knoblauch*, Kurkuma*,\nweißer Pfeffer*, Säuerungsmittel: Zitronensäure, Antioxidationsmittel: Ascorbinsäure. *aus ökologischem Landbau.', '2023-06-23 11:04:12', 373.034, 'SPREADS_HONEY', 'PANTRY', 291, 7.4, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(129, 'Saatenliebe Mohn Avocado (Weiling)', '4016249238155', 0, 2.99, 1, 1, NULL, 0, '111318', 'Saatenliebe Mohn Avocado', 'Herzlich willkommen zu den vereinigten Saaten von Allos. Man kann richtig schmecken,\ndass die Pflanzen all ihre Liebe in die Samen gesteckt haben. Und wir haben noch eine\ngehörige Portion Gemüse dazu gepackt. Volle Saaten-Power trifft grandiosen Gemüse-\nGenuss. Das Ergebnis ist ausgesprochen streichzart, unfassbar lecker und bietet ein ganz besonderes Geschmacks-Erlebnis auf der Zunge. Das hat das Potenzial zum\nNationalgericht!', 'Allos Hof-Manufaktur GmbH', 'Allos', 'GERMANY', '9fa9f574-0a0b-4176-ae09-3228f8ae2887', 'manager', '2021-08-12 11:37:35', 'System', '2024-02-03 02:11:02', 307, 328, 0, NULL, 0, 1.95, 'Weiling', 0, NULL, 0, 61, 'Wasser, Avocado* (20%), Sonnenblumenöl*, gelbe Paprika*, Zitronensaft aus Zitronensaftkonzentrat*, Eiweißpulver aus Sonnenblumenkernen*, Agavendicksaft*, Tapiokastärke*, Blaumohn* (1%), Meersalz, Curcuma*, Guarkernmehl*,  weißer Pfeffer*, Säuerungsmittel: Zitronensäure, Antioxidationsmittel: Ascorbinsäure. *aus ökologischem Landbau.', '2022-11-29 16:52:15', 373.034, 'SPREADS_HONEY', 'PANTRY', 286, 7.4, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
