(131, 'Linsen-Aufstrich Gelbe Linse Grillgemüse (Weiling)', '4016249270957', 0, 3.29, 1, 1, NULL, 0, '111334', 'Linsen-Aufstrich Gelbe Linse Grillgemüse', 'Aufstrich auf’s Brot, macht Wangen rot. Ist eine alte Linsen-Weisheit und heute noch so wahr wie vor vielen tausend Jahren. Ja, Linsen stehen schon wirklich lange auf unserem Speiseplan. Und das vollkommen zurecht. Denn sie sind echtes Superfood. Super proteinreich. Super energiereich. Super lecker. Und da sie in verschiedenen Farben kommen, sind sie auch super abwechslungsreich. Perfekt aufs Brot, als Dip oder als GEHEIME ZUTAT für euer Dressing.', 'Allos Hof-Manufaktur GmbH', 'Allos', 'GERMANY', '3074f67d-1d03-4866-8c10-1f683254b112', 'manager', '2021-08-12 11:37:51', 'System', '2024-02-03 02:10:07', 81, 330, 0, NULL, 0, 1.95, 'Weiling', 0, NULL, 0, 61, 'Gegrillte Paprika* (17%), gelbe Linsen* getrocknet\n(12%), rote Paprika*, Tomaten*, gegrillte Auberginen* (10%),\nZitronensaft aus Zitronensaftkonzentrat*, Sonnenblumenöl*,\nTomatenmark* zweifach konzentriert, Balsamessig*\n(Weißweinessig*, Traubenmostkonzentrat*),\nBasilikum*, Meersalz, Paprikapulver*, Knoblauchpulver*,\nZwiebelpulver*, Pfeffer*, Thymian*, Oregano*. * aus ökologischem Landbau', '2023-07-25 10:27:08', 373.034, 'SPREADS_HONEY', 'PANTRY', 291, 7.4, 'VEGAN;VEGETARIAN;GLUTENFREE', NULL, NULL),
