(146, 'Jausen-Gurkerl | Bio-Einlegegemüse (Weiling)', '9120009120361', 0, 5.69, 1, 1, NULL, 0, '140400', 'Jausen-Gurkerl | Bio-Einlegegemüse', 'UNSERE BIO-LUTZ SAUERGEMÜSE-VARIATIONEN sind bio bis zur Wurzel. Denn für Sie legen wir nur das Beste ins Glas: Gemüse, Gewürze und Essig aus kontrolliert biologischem Anbau - per Hand und in feinster Manufaktur-Qualität. Das Geheimnis des würzig frischen Geschmacks liegt in der sorgsamen Verarbeitung und im vollreifen Gemüse. Bis zum optimalen Reifegrad dürfen sich diese im fruchtbaren Boden verstecken oder der Sonne entgegenrecken. Dabei entwickeln sie ihren charakteristischen Eigengeschmack, den wir mit ausgesuchten Gewürzen vollenden und durch schonende Pasteurisierung haltbar machen. So bleiben alle wertvollen Vitamine und Nährstoffe bewahrt. Geschmacksverstärker, Konservierungsmittel oder andere Zusatzstoffe haben in unseren Gemüse-Variationen dafür rein gar nichts verloren.', 'Bio-Lutz GmbH', 'Lutz', 'AUSTRIA', 'a3d1de29-05bd-4bcf-9c5c-ee2ee09a6f48', 'manager', '2021-08-12 11:39:57', 'System', '2023-11-11 02:09:11', 90, 397, 0, NULL, 0, 3.4, 'Weiling', 0, NULL, 0, 0, 'Gurken*, Wasser, Weingeistessig*, Zucker*, Zwiebel*, Senfsaat*, Speisesalz, Dille*, Gewürzextrakt*, Gewürze* *aus kontrolliert ökologischer Erzeugung', '2023-04-14 08:44:17', 976.272, 'CONVENIENCE_PRESERVES', 'PANTRY', 870, 13.2, 'VEGAN;VEGETARIAN', NULL, NULL),
