(165, 'Sushi Ingwer (Weiling)', '8713576173390', 0, 3.99, 1, 1, NULL, 0, '730276', 'Sushi Ingwer', 'Diese hauchdünnen Scheiben eingelegten Ingwers können zusammen mit Wasabi und  Sojasauce als Beilage zu Sushi verwendet werden. Japaner essen zwischen den  Snacks Sushi-Ingwer, weil Ingwer die Aromen neutralisiert. Sushi-Ingwer  schmeckt auch hervorragend zu einem Salat, einem vegetarischen Burger-Sandwich  oder in Frühlingsrollen. Wir verwenden erstklassigen Bio-Ingwer aus dem  Paradies Fidschi: Inseln mit einem der saubersten Böden der Welt.', 'TerraSana Natuurvoeding BV', 'TerraSana', 'FIJI', 'c0eb7d61-2ea1-41cf-93f3-e608181ecb72', 'manager', '2021-08-12 11:42:51', 'System', '2023-09-29 02:10:06', 312, 415, 0, NULL, 0, 2.64, 'Weiling', 0, NULL, 0, 569, 'Ingwer*, Rohrzucker*, Essig*, Wasser, Salz, Zitronensäure *aus kontrolliert ökologischer Erzeugung', '2022-11-29 17:00:28', 338, 'CONVENIENCE_PRESERVES', 'PANTRY', 351, 8, 'VEGAN;VEGETARIAN;GLUTENFREE', NULL, NULL),
(166, 'Kokosmilch mit 60 % Kokosnussanteil (Weiling)', '4035626111263', 0, 1.79, 1, 1, NULL, 0, '146000', 'Kokosmilch mit 60 % Kokosnussanteil', 'Die Verarbeitung der Kokosnüsse erfolgt auf Sri Lanka noch traditionell von Hand. Zuerst werden die Kokosnüsse nach der Ernte von ihrer dicken grünen Faserhülle befreit. Um an das weiße Fruchtfleisch zu kommen, wird die harte Schale aufgeschlagen und die dünne braune Haut mit einem Messer sauber abgeschält – dabei ist jeder Schritt aufwendige Handarbeit. Anschließend wird das weiße Kokosfleisch in einer Kokosmühle zu Kokosmilch verarbeitet. Der Kokosnussanteil beträgt bei diesem Produkt 60%.', 'Weiling GmbH', 'bioladen', 'SRI_LANKA', '6ffae17a-338c-4825-a6c3-789dacb36295', 'manager', '2021-08-12 11:42:58', 'System', '2023-10-14 02:10:34', 104, 416, 0, NULL, 0, 0.99, 'Weiling', 0, NULL, 0, 1016, 'Kokosnuss (60%)*, Wasser *aus kontrolliert ökologischer Erzeugung', '2022-05-23 15:09:21', 348.75, 'CONVENIENCE_PRESERVES', 'PANTRY', 256.5, 7.5, 'VEGAN;VEGETARIAN', NULL, NULL),
(167, 'Ananasstücke im eigenen Saft (Weiling)', '4035626111324', 0, 3.79, 1, 1, NULL, 0, '146006', 'Ananasstücke im eigenen Saft', 'Das Klima im Westen Sri Lankas bietet optimale Bedingungen für den Anbau tropischer Früchte. Für unsere bioladen*Ananasstücke werden die sonnenreifen Exoten direkt nach der Ernte in lokalen Betrieben verarbeitet – alles in sorgfältiger Handarbeit. Die Früchte sind im eigenen Saft eingelegt (naturtrüb).', 'Weiling GmbH', 'bioladen', 'SRI_LANKA', 'f18dcda7-6d8a-4521-862d-ea4b81e420c2', 'manager', '2021-08-12 11:43:15', 'System', '2023-01-16 17:29:59', 105, 417, 0, NULL, 0, 2.3, 'Weiling', 0, NULL, 0, 1016, 'Ananas* Ananassaft* *aus kontrolliert ökologischer Erzeugung', '2022-05-23 15:06:49', 635.216, 'CONVENIENCE_PRESERVES', 'PANTRY', 558.03, 11.6, 'VEGAN;VEGETARIAN', NULL, NULL),
(168, 'Mangostücke im Mehrfruchtsaft (Weiling)', '4035626111683', 0, 3.99, 1, 1, NULL, 0, '146012', 'Mangostücke im Mehrfruchtsaft', 'Das Klima im Westen Sri Lankas bietet optimale Bedingungen für den Anbau tropischer Früchte. Für unsere bioladen*Mangostücke werden die sonnenreifen Exoten direkt nach der Ernte in lokalen Betrieben verarbeitet – alles in sorgfältiger Handarbeit. Die Früchte sind in Mehrfurchtsaft eingelegt (naturtrüb).', 'Weiling GmbH', 'bioladen', 'SRI_LANKA', '7aff2dbe-3d3c-4a52-8513-1b46e87ed142', 'manager', '2021-08-12 11:43:24', 'System', '2023-07-31 00:03:01', 106, 418, 0, NULL, 0, 2.36, 'Weiling', 0, NULL, 0, 1016, 'Mango*, Ananassaft*, Mangosaft*, Passionsfruchtsaft* *aus kontrolliert ökologischer Erzeugung', '2022-05-23 16:41:11', 635.216, 'CONVENIENCE_PRESERVES', 'PANTRY', 558.03, 11.6, 'VEGAN;VEGETARIAN', NULL, NULL),
(169, 'Tropischer Fruchtmix in Ananassaft (Weiling)', '4035626111706', 0, 3.79, 1, 1, NULL, 0, '146014', 'Tropischer Fruchtmix in Ananassaft', 'Das Klima im Westen Sri Lankas bietet optimale Bedingungen für den Anbau tropischer Früchte. Für unseren bioladen*Tropischen Fruchtmix werden die sonnenreifen Exoten direkt nach der Ernte in lokalen Betrieben verarbeitet – alles in sorgfältiger Handarbeit. Die Früchte sind in Ananassaft eingelegt (naturtrüb).', 'Weiling GmbH', 'bioladen', 'SRI_LANKA', '73de440c-df92-408d-8dcf-b62368e272c6', 'manager', '2021-08-12 11:43:33', 'System', '2023-01-16 17:30:05', 107, 419, 0, NULL, 0, 2.36, 'Weiling', 0, NULL, 0, 1016, 'Ananassaft*, Ananas*, Papaya*, Mango* *aus kontrolliert ökologischer Erzeugung', '2022-05-23 16:46:25', 635.216, 'CONVENIENCE_PRESERVES', 'PANTRY', 558.03, 11.6, 'VEGAN;VEGETARIAN', NULL, NULL),
(170, 'Mangopüree (Weiling)', '4035626113083', 0, 3.99, 1, 1, NULL, 0, '146020', 'Mangopüree', 'Das Klima im Westen Sri Lankas bietet optimale Bedingungen für den Anbau tropischer Früchte. Für unser bioladen*Mangopüree werden die sonnenreifen Exoten direkt nach der Ernte in lokalen Betrieben verarbeitet – alles in sorgfältiger Handarbeit. ', 'Weiling GmbH', 'bioladen', 'SRI_LANKA', '55c2fe06-6ab4-4ba1-bfff-b1221cb34dee', 'manager', '2021-08-12 11:43:43', 'System', '2023-10-14 02:09:45', 108, 420, 0, NULL, 0, 2.49, 'Weiling', 0, NULL, 0, 1016, 'Mango* (99,5 %), Acerolafruchtpulver* *aus kontrolliert ökologischer Erzeugung', '2022-05-23 16:41:06', 485.875, 'CONVENIENCE_PRESERVES', 'PANTRY', 581.3, 11.5, 'VEGAN;VEGETARIAN', NULL, NULL),
(171, 'Grüne Oliven entsteint aus Griechenland (Weiling)', '5200104102005', 0, 3.99, 1, 1, NULL, 0, '151508', 'Grüne Oliven entsteint aus Griechenland', 'Die Oliven stammen von einem Familienbetrieb aus Zentral-Griechenland, der von Vater und seinen zwei Söhnen bewirtschaftet wird.\nVerarbeitet und entsteint werden die Oliven in Kalamata.', 'EPíKOUROS  Organic Products Ltd', 'EPIKOUROS', 'GREECE', '771164b9-facf-4414-b5a2-c36f2113c04b', 'manager', '2021-08-12 11:43:52', 'System', '2023-12-09 03:29:06', 109, 421, 0, NULL, 0, 2.56, 'Weiling', 0, NULL, 0, 80, 'Grüne Oliven*, Wasser, Meersalz, Zitronensaft* *aus kontrolliert ökologischer Erzeugung', '2022-12-01 08:27:38', 518.364, 'CONVENIENCE_PRESERVES', 'PANTRY', 505, 11.9, 'VEGAN;VEGETARIAN', NULL, NULL),
