(174, 'Bärlauch-Pesto vegan (Weiling)', '4000915106718', 0, 3.39, 1, 1, NULL, 0, '150733', 'Bärlauch-Pesto vegan', 'Das vegane Bärlauch-Pesto von bio-verde ist eine würzige Sauce aus frischem Bärlauch.  Im Bärlauch befinden sich gesundheitsfördernde Stoffe wie Ätherisches Öl. Hauptwirkstoff ist das typisch nach Knoblauch riechende Allicin, das für eine Reihe von physiologischen Vorteilen verantwortlich ist', 'Isana Naturfeinkost GmbH & Co. Produktions- und Handels KG', 'bio-verde', 'GERMANY', '3f516b68-71b9-4d77-8ab2-50093d39a88c', 'manager', '2021-08-12 11:44:18', 'System', '2023-09-24 02:07:32', 111, 424, 0, NULL, 0, 2.09, 'Weiling', 0, NULL, 0, 64, 'Sonnenblumenöl*, Bärlauch***** (34%), CASHEWKERNE*, Kartoffelflocken*, Olivenöl*, Meersalz, konzentrierter Zitronensaft* *****aus bio-zertifizierter Wildsammlung *aus kontrolliert ökologischer Erzeugung', '2023-03-30 18:08:02', 282.663, 'CONVENIENCE_PRESERVES', 'PANTRY', 200, 8.7, 'VEGAN;VEGETARIAN', NULL, NULL),
(175, 'Tomaten-Pesto vegan (Weiling)', '4000915106725', 0, 3.49, 1, 1, NULL, 0, '150734', 'Tomaten-Pesto vegan', 'Das vegane bio-verde Tomaten-Pesto ist eine würzige Sauce aus frischen Kräutern und sonnengetrockneten Tomaten. ', 'Isana Naturfeinkost GmbH & Co. Produktions- und Handels KG', 'bio-verde', 'GERMANY', 'a6e35b2a-0f6d-47c8-99a6-7e7814de8ea5', 'manager', '2021-08-12 11:44:26', 'System', '2023-09-24 02:10:34', 112, 425, 0, NULL, 0, 2.09, 'Weiling', 0, NULL, 0, 64, 'Sonnenblumenöl*, getrocknete Tomaten* (34%), Basilikum*, Meersalz, CASHEWKERNE*, Olivenöl*, Zitronensaftkonzentrat* *aus kontrolliert ökologischer Erzeugung', '2023-02-02 09:40:47', 282.663, 'CONVENIENCE_PRESERVES;OIL_VINEGAR_SAUCES', 'PANTRY', 200, 8.7, 'VEGAN;VEGETARIAN', NULL, NULL),
(176, 'Basilikum-Pesto vegan (Weiling)', '4000915106749', 0, 3.39, 1, 1, NULL, 0, '150736', 'Basilikum-Pesto vegan', 'Das vegane bio-verde Basilikum-Pesto ist eine würzige Sauce aus frischem Basilikum. ', 'Isana Naturfeinkost GmbH & Co. Produktions- und Handels KG', 'bio-verde', 'GERMANY', 'e7fd181d-69a9-448d-99ee-2980ffbf2c9f', 'manager', '2021-08-12 11:44:34', 'System', '2023-09-24 02:12:34', 113, 426, 0, NULL, 0, 2.09, 'Weiling', 0, NULL, 0, 64, 'Sonnenblumenöl*, Basilikum* (37%), CASHEWKERNE* (5%), Knoblauch*, Kartoffelflocken*, Olivenöl*, Meersalz, konzentrierter Zitronensaft* *aus kontrolliert ökologischer Erzeugung', '2023-05-02 14:07:02', 282.663, 'CONVENIENCE_PRESERVES', 'PANTRY', 200, 8.7, 'VEGAN;VEGETARIAN', NULL, NULL),
(177, 'Dolmades gefüllte Weinblätter mit Reis (Weiling)', '4000915020656', 0, 4.59, 1, 1, NULL, 0, '151222', 'Dolmades gefüllte Weinblätter mit Reis', 'Die bio-verde Spezialität Dolmades sind Weinblätter, die mit Reis gefüllt sind. Dolmades sind in einer praktischen Dose im Trockensortiment zu finden. So kann diese Spezialität zusätzlich ausser Haus, zum Beispiel bei einem Picknick oder mittags im Büro, genossen werden.', 'Isana Naturfeinkost GmbH & Co. Produktions- und Handels KG', 'bio-verde', 'BULGARIA', 'ea3cd37c-9b16-41ae-8025-1300ff4b8a98', 'manager', '2021-08-12 11:44:44', 'System', '2023-01-16 17:30:37', 114, 427, 0, NULL, 0, 2.67, 'Weiling', 0, NULL, 0, 21, 'Reis* (57%), Wasser, Weinblätter* (10%), Sonnenblumenöl*, Zwiebeln*, Gewürze* (Dill*, Minze*, Pfeffer*), Säuerungsmittel: Zitronensäure*, Meersalz *aus kontrolliert ökologischer Erzeugung', '2022-06-06 10:00:42', 300, 'CONVENIENCE_PRESERVES', 'PANTRY', 200, 10, 'VEGAN;VEGETARIAN', NULL, NULL),
(178, 'Frikassee vom Huhn (Weiling)', '4250096906304', 0, 7.99, 1, 1, NULL, 0, '153002', 'Frikassee vom Huhn', 'Die Bio-Hühnerbrühe und das Bio-Hühner-Frikassee enthalten extra viel frisches Bio-Hühnchenfleisch. Deshalb schmecken unsere Bio-Fertiggerichte wie selbst gekocht. Mit gutem Gewissen können Sie diese Speisen servieren, wenn die Zeit einmal knapp ist. Sie werden erstaunt sein. Lassen Sie sich von der Qualität unserer Bio-Saucen und Bio-Fertiggerichte überzeugen!', 'Kiebitzhof', NULL, 'Gütersloh, Nordrhein-Westfalen', '1798d164-a200-418b-9605-addffe9a0ec6', 'correction', '2021-10-05 12:16:07', 'System', '2024-01-31 02:07:24', 688, 2283, NULL, NULL, 0, 6.2, 'Weiling', 2, 0, 0, 63, NULL, '2022-05-24 10:51:58', 840.5, 'CONVENIENCE_PRESERVES', 'PANTRY', 665, 12.5, NULL, NULL, NULL),
(179, 'Hühnerbrühe (Weiling)', '4250096906281', 0, 5.99, 1, 1, NULL, 0, '153004', 'Hühnerbrühe', 'Die Bio-Hühnerbrühe und das Bio-Hühner-Frikassee enthalten extra viel frisches Bio-Hühnchenfleisch. Deshalb schmecken unsere Bio-Fertiggerichte wie selbst gekocht. Mit gutem Gewissen können Sie diese Speisen servieren, wenn die Zeit einmal knapp ist. Sie werden erstaunt sein. Lassen Sie sich von der Qualität unserer Bio-Fonds und Bio-Fertiggerichte überzeugen!', 'Kiebitzhof', NULL, 'Gütersloh, Nordrhein-Westfalen', 'c6b7ae99-b8a5-4489-865d-d23f2cef1c5d', 'correction', '2021-10-05 12:16:26', 'System', '2024-01-31 02:07:40', 1534, 2284, NULL, NULL, 0, 4.75, 'Weiling', 2, 0, 0, 63, NULL, '2022-04-11 15:29:57', 840.5, 'SPICES_COOKING_HELP', 'PANTRY', 661, 12.5, 'PALMOILFREE;WITHOUT_ADDED_SUGAR', NULL, NULL);
