(180, 'MANI Kalamata Oliven in Lake, entkernt, NL Fair (Weiling)', '5202423200103', 0, 5.69, 1, 1, NULL, 0, '155026', 'MANI Kalamata Oliven in Lake, entkernt, NL Fair', 'Diese erlesenen Kalamata Bio Oliven werden auf traditionelle Art zubereitet, entkernt und in frische Meersalz-Lake eingelegt.\n\nDie berühmte Kalamata Olive zeichnet sich durch ihren milden, saftigen Geschmack aus. Ihr typisches, fruchtiges Aroma ist so einzigartig, dass es blind erschmeckt werden kann. Eine wahre Köstlichkeit, pur als Vorspeise, in Salaten und auch in der warmen Küche.\n\nMani Bläuel Oliven werden schonend geerntet und auf natürliche Weise, ohne die Zugabe von Konservierungsstoffen, entbittert.', 'Bläuel Greek Organic Products', 'MANI®', 'GREECE', 'e7561be7-d375-4137-88f7-38cf2c9225ac', 'manager', '2021-08-12 11:45:11', 'System', '2023-09-30 00:03:56', 115, 428, 3, 10, 0, 3.45, 'Weiling', 0, NULL, 0, 80, 'Kalamata Oliven*º, Wasser, Meersalz, Milchsäure.\nºNaturland Fair zertifiziert (100%) *aus kontrolliert ökologischer Erzeugung', '2022-11-29 16:29:56', 522.512, 'CONVENIENCE_PRESERVES', 'PANTRY', 520, 11.3, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE;RAWFOOD', NULL, NULL),
(181, 'MANI Kapern in Olivenöl, bio (Weiling)', '5202423201124', 0, 5.49, 1, 1, NULL, 0, '155038', 'MANI Kapern in Olivenöl, bio', 'Die geschmackvollen, fruchtigen Bio-Kapern werden in MANI Bio-Olivenöl nativ extra eingelegt. \nWegen ihres aromatischen Geschmacks eignen sie sich ideal als milde Vorspeise, als Pizzabelag oder zum Verfeinern von Soßen.', 'Bläuel Greek Organic Products', 'MANI®', 'GREECE', '9c0ebc77-d984-4788-9f5c-0212db6adc1c', 'manager', '2021-08-12 11:45:26', 'System', '2023-11-08 02:07:42', 116, 429, 0, NULL, 0, 3.35, 'Weiling', 0, NULL, 0, 80, 'Kapern* (65%) (Herkunft: Marokko), natives Olivenöl extra* (34,5%), Meersalz, Weinessig*, Zitronensäure *aus kontrolliert ökologischer Erzeugung', '2023-03-10 12:46:07', 388.416, 'CONVENIENCE_PRESERVES', 'PANTRY', 370, 8.4, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(182, 'MANI Getrocknete Tomaten in Olivenöl, bio (Weiling)', '5202423180047', 0, 5.59, 1, 1, NULL, 0, '155039', 'MANI Getrocknete Tomaten in Olivenöl, bio', 'Die Tomaten werden in extra nativem MANI Olivenöl eingelegt und mit Basilikum abgerundet. Herrlich aromatisch, saftig und mild-würzig haben die getrockneten Tomaten pur als Vorspeise, in Salaten oder klein geschnitten in Pasta-Saucen oder auch im Rührei einen angenehmen Biss und stets die perfekte Konsistenz. Auch das Öl ist vielseitig einsetzbar und eine wunderbare Ergänzung zu jedem Dressing, auf der Pizza oder in Pasta-Saucen. Mit den getrockneten Tomaten von Mani Bläuel holen Sie sich den frischen Geschmack von Sommer und Sonne direkt in ihre Küche. Ohne Konservierungsstoffe. Natürlich ungefärbt und nicht künstlich behandelt.', 'Bläuel Greek Organic Products', 'MANI®', 'GREECE', '02003666-7e85-4f8e-9dec-2ddd97855664', 'manager', '2021-08-12 11:45:35', 'System', '2023-09-30 00:03:52', 313, 430, 0, NULL, 0, 3.35, 'Weiling', 0, NULL, 0, 80, 'Sonnengetrocknete Tomaten* (48%), natives Olivenöl extra*( 51%), Basilikum*, Zitrone*, Essig*, Meersalz *aus kontrolliert ökologischer Erzeugung', '2023-07-25 09:52:57', 388.416, 'CONVENIENCE_PRESERVES', 'PANTRY', 370, 8.4, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(183, 'Halbgetrocknete Tomaten in Olivenöl (Weiling)', '8018759000105', 0, 5.99, 1, 1, NULL, 0, '158032', 'Halbgetrocknete Tomaten in Olivenöl', 'Naturland Fair zertifiziert. Nur besonders süße und saftige LaSelva Tomaten werden direkt nach der Ernte auf dem Hof verarbeitet, leicht getrocknet und in nativem Olivenöl extra eingelegt. Der typische Geschmack kommt in den \"Pomodori semisecchi\" intensiv zum Ausdruck, der Biss bleibt schön saftig und weich.', 'LaSelva', 'LaSelva', 'ITALY', '6a32ea69-e0ad-442a-9fcc-e9927bb3b9b7', 'manager', '2021-08-12 11:46:01', 'System', '2023-12-04 10:00:53', 117, 431, 3, 10, 0, 3.97, 'Weiling', 0, NULL, 0, 102, 'Halbgetrocknete Tomaten*° 56%, natives Olivenöl extra* 42%, Meersalz. *aus kontrolliert ökologischer Erzeugung', '2022-12-17 12:18:54', 386.054, 'CONVENIENCE_PRESERVES', 'PANTRY', 328, 8.6, 'VEGAN;VEGETARIAN', NULL, NULL),
