(188, 'Heller Thunfisch naturell (Weiling)', '4026968015807', 0, 3.69, 1, 1, NULL, 0, '160148', 'Heller Thunfisch naturell', 'Fontaine Heller Thunfisch wird nach den Richtlinien der Nachhaltigkeit einzeln mit der Angelrute aus dem Wasser gezogen. Nach dem Handangelfang folgen die verantwortungsvolle Verarbeitung und die Verfeinerung mit besten Bio-Zutaten. Diese Vollkonserve enthält neben dem Thunfisch ausschließlich Wasser und Meersalz.', 'Fontaine Nahrungsmittel GmbH', 'Fontaine', 'SPAIN', '58379fdf-d616-4793-8065-491b851dbfa2', 'manager', '2021-08-12 11:46:53', 'System', '2023-11-28 02:06:49', 314, 432, NULL, NULL, 0, 2.22, 'Weiling', 0, NULL, 0, NULL, 'THUNFISCH-FILET (Thunnus albacares)\n75 %, Wasser, Meersalz *aus kontrolliert ökologischer Erzeugung', '2022-11-29 16:22:08', 214.5, 'CONVENIENCE_PRESERVES', 'PANTRY', 145, 11, NULL, NULL, NULL),
(189, 'Makrelenfilets o. Haut in Bio-Tomaten-Curry-Creme (Weiling)', '4026968016606', 0, 2.99, 1, 1, NULL, 0, '160154', 'Makrelenfilets o. Haut in Bio-Tomaten-Curry-Creme', 'Der von uns verwendete Trachurus murphyi stammt aus dem Gebiet vor der chilenischen Küste (FAO 87) und ist ausnahmslos MSC™-zertifiziert. Um ihren frischen Geschmack zu konservieren, werden die empfindlichen Fische entweder schockgefrostet oder in Becken mit Eiswasser an Land gebracht. Zum Teil widmen sich die Fischer bereits auf dem Schiff der Verarbeitung des Fangs. Fontaine Makrelenprodukte zeichnen sich auch durch eine Verfeinerung mit besten Bio-Zutaten aus.', 'Fontaine Nahrungsmittel GmbH', 'Fontaine', 'LATVIA', '19a2bc2e-e8d9-4536-be43-cc3fc1137ddc', 'manager', '2021-08-12 11:47:04', 'System', '2023-11-01 08:00:33', 118, 433, NULL, NULL, 0, 1.78, 'Weiling', 0, NULL, 0, 60, 'SCHILDMAKRELENFILETS ohne Haut\n(Trachurus murphyi) 60%, Tomatenmark*\n(8%), Sonnenblumenöl*,\nWasser, Vollrohrzucker*, Curry* (1,7%),\nBranntweinessig*, Zitronensaft*, Meersalz,\nVerdickungsmittel: Guarkernmehl* *aus kontrolliert ökologischer Erzeugung', '2023-08-25 02:06:13', 214.5, 'CONVENIENCE_PRESERVES', 'PANTRY', 140, 11, NULL, NULL, NULL),
(190, 'Heringsfilets in Bio-Tomatencreme m. Tomatenstück. (Weiling)', '4026968005709', 0, 3.69, 1, 1, NULL, 0, '160160', 'Heringsfilets in Bio-Tomatencreme m. Tomatenstück.', 'Für den Atlantischen Hering ist der Norden des FAO Fanggebiets 27 ein idealer Lebensraum. Die dort praktizierte Fischerei mit Ringwadennetzen und pelagischen Schleppnetzen ist vom Marine Stewardship Council (MSC™) als nachhaltig anerkannt. Fontaine Heringsprodukte zeichnen sich durch eine verantwortungsvolle Verarbeitung und Verfeinerung mit besten Bio-Zutaten aus.', 'Fontaine Nahrungsmittel GmbH', 'Fontaine', 'GERMANY', '6a3b7423-6ff9-4a87-8235-2fef22303a81', 'manager', '2021-08-12 11:47:20', 'System', '2023-09-07 03:44:37', 119, 434, NULL, NULL, 0, 2.22, 'Weiling', 0, NULL, 0, 60, 'HERINGSFILETS (Clupea Harengus)\n(60%), Tomatenmark* (22%), Sonnenblumenöl*, Tomatenstücke* (5%), Wasser, \nRohrohrzucker*, Meersalz, Branntweinessig*, \nGewürze*, Verdickungsmittel: Guarkernmehl*, Zitronensaftkonzentrat*. *aus kontrolliert ökologischer Erzeugung', '2022-11-29 16:22:13', 405, 'CONVENIENCE_PRESERVES', 'PANTRY', 235, 15, NULL, NULL, NULL),
(191, 'Heller Thunfisch in Bio-Olivenöl (Weiling)', '4026968015708', 0, 3.69, 1, 1, NULL, 0, '160184', 'Heller Thunfisch in Bio-Olivenöl', 'Fontaine Heller Thunfisch wird nach den Richtlinien der Nachhaltigkeit einzeln mit der Angelrute aus dem Wasser gezogen. Nach dem Handangelfang folgen die verantwortungsvolle Verarbeitung und die Verfeinerung mit besten Bio-Zutaten. Diese Vollkonserve enthält neben dem Thunfisch ausschließlich Meersalz  und mildes spanisches Bio-Olivenöl extra vergine.', 'Fontaine Nahrungsmittel GmbH', 'Fontaine', 'SPAIN', 'ac7702e8-c913-4ed6-bdfc-1dff23e0ef07', 'manager', '2021-08-12 11:47:27', 'System', '2023-10-03 02:07:19', 120, 435, NULL, NULL, 0, 2.26, 'Weiling', 0, NULL, 0, 60, 'THUNFISCH-FILET (Thunnus albacares)\n75 %, Olivenöl* 24 %, Meersalz *aus kontrolliert ökologischer Erzeugung', '2022-11-29 16:22:05', 214.5, 'CONVENIENCE_PRESERVES', 'PANTRY', 145, 11, NULL, NULL, NULL),
(192, 'Puten-Leberwurst mit Sonnenblumenöl (Weiling)', '4031829261507', 0, 1.79, 1, 1, NULL, 0, '160949', 'Puten-Leberwurst mit Sonnenblumenöl', 'Die Ökoland Feine Puten-Leberwurst wird aus reinem Bio-Putenfleisch und Putenleber in Gourmet-Qualität hergestellt. Mit Sonnenblumenöl erhält sie die besonders feine und streichfähige Konsistenz. In der kleinen Portionsdose lässt sich die Wurst handlich bevorraten und ist für Flexitarier- oder Single-Haushalte perfekt geeignet.\nOhne Zusatzstoffe und ohne Zugabe von Aromen und Zucker hergestellt.', 'Ökoland GmbH Nord', 'ÖKOLAND', 'GERMANY', 'b1af6b77-349d-4b54-89a7-d730c8bd10ff', 'manager', '2021-08-12 11:47:35', 'System', '2023-12-12 02:06:53', 121, 436, 4, NULL, 0, 0.99, 'Weiling', 0, NULL, 0, 63, '72% Putenfleisch*, 18% Putenleber*, 7% Sonnenblumenöl*, Speisesalz, Röstzwiebeln*, Gewürze* (Pfeffer*, Ingwer*, Kardamom*, Macis*). *aus kontrolliert ökologischer Erzeugung', '2022-12-17 12:21:11', 81.5149, 'CONVENIENCE_PRESERVES', 'PANTRY', 52.5, 6.3, 'GLUTENFREE;LACTOSEFREE;PALMOILFREE;WITHOUT_ADDED_SUGAR', NULL, NULL),
(193, 'Bockwürstchen in zarter Eigenhaut  (Weiling)', '4031829230770', 0, 4.69, 1, 1, NULL, 0, '162083', 'Bockwürstchen in zarter Eigenhaut ', 'Die Verarbeitung des hochwertigen Bio-Fleisches und der geschmackvollen Bio-Gewürze erfolgt nach strengen Qualitätsrichtlinien. Auf Zusatzstoffe wie z.B. Nitritpökelsalz oder Phosphate verzichten wir aus Überzeugung. Die Würstchen sind in Eigenhaut, dies bedeutet, dass die Wurstmasse zu Beginn in einen Cellulosedarm gefüllt wird. Im Verlauf der Produktion mit dem Brühen und Räuchern bildet sich an der Oberfläche eine Eiweißschicht, der Darm wird vor dem Abfüllen in das Glas entfernt und fertig ist das Würstchen in zarter EIgenhaut.  \nLaktosefrei, Glutenfrei. ', 'Ökoland GmbH Nord', 'ÖKOLAND', 'GERMANY', 'af5a9d81-afbc-4828-ad30-27d1199db58a', 'manager', '2021-08-12 11:47:51', 'System', '2023-12-12 02:06:47', 122, 437, 0, NULL, 0, 2.86, 'Weiling', 0, NULL, 0, 63, '83% Schweinefleisch*, Trinkwasser, Meersalz, Gewürze* (Pfeffer*, Ingwer*, Knoblauch*, Koriander*, Kümmel*), Dextrose*, Buchenholzrauch *aus kontrolliert ökologischer Erzeugung', '2023-01-02 08:41:58', 710.5, 'CONVENIENCE_PRESERVES', 'PANTRY', 569.6, 14.5, 'GLUTENFREE;LACTOSEFREE;PALMOILFREE', NULL, NULL),
(194, 'Vegetarische Würstchen mit Weizen- und Eieiweiß (Weiling)', '4031829230855', 0, 4.29, 1, 1, NULL, 0, '162086', 'Vegetarische Würstchen mit Weizen- und Eieiweiß', 'Die vegetarischen Würstchen von Ökoland sind eine hervorragende Alternative für alle, die auf Fleisch verzichten möchten. Die Würstchen werden aus hochwertigem Weizen-Eiweiß hergestellt und eignen sich sehr gut als Einlage für Eintöpfe. Diese vegetarischen Würstchen können auch besonders gut gegrillt oder in der Pfanne gebraten werden, der Geschmack wird dadurch intensiver.', 'Ökoland GmbH Nord', 'ÖKOLAND', 'GERMANY', 'd14e1190-c67c-4d47-bd8f-23d71dfac2cb', 'manager', '2021-08-12 11:47:59', 'System', '2023-12-12 02:07:13', 315, 438, 0, NULL, 0, 2.86, 'Weiling', 0, NULL, 0, 63, 'Trinkwasser, Sonnenblumenöl*, Zwiebeln*, 7,8% WEIZENEIWEISS*, 5,5% EIEIWEIß*, Gewürze* (Ingwer*, Knoblauch*, Koriander*, Kümmel*, Pfeffer*, Muskat*, Curcuma*), Meersalz, Tomatenmark*, WEIZENVOLLKORN* geschrotet, Verdickungsmittel: Guarkernmehl*; Paprika*, Porree*, Dextrose*, Steinsalz, Maltodextrin*, Karotten*, Maisstärke*, Kräuter* (Liebstöckel*, Petersilie*), Buchenholzrauch. *aus kontrolliert ökologischer Erzeugung', '2022-10-10 00:05:58', 558.025, 'CONVENIENCE_PRESERVES', 'PANTRY', 569.6, 14.5, 'VEGETARIAN;PALMOILFREE', NULL, NULL),
(195, 'Biologische Miesmuscheln in Bio-Marinade (Weiling)', '8412439285064', 0, 3.99, 1, 1, NULL, 0, '160232', 'Biologische Miesmuscheln in Bio-Marinade', 'Für die ,Pan do Mar Produkte geht der Begriff des ,nachhaltigen Fischfangs weit über die herkömmliche Bedeutung hinaus. Wir verstehen darunter nicht nur die Fangart, Fangkontrolle und durchgängige Dokumentation, sondern wir sehen auch eine soziale Komponente, die in anderen Nachhaltigkeitssystemen nie angesprochen wird: die Förderung der traditionellen Kleinfischerei (Küstenfischerei).', 'Conservas Antonio Pérez Lafuente, S.A.', 'Pan do Mar', 'SPAIN', '8d7e824e-f76b-4eff-a927-ed8d4b0e7cfb', 'manager', '2021-08-12 11:48:14', 'System', '2023-10-10 00:02:51', 1345, 1463, 0, NULL, 0, 2.92, 'Weiling', 0, NULL, 0, 172, 'MIESMUSCHELFLEISCH*** (74%), Olivenöl extra nativ* (14%), Apfelessig* (9%), Paprika*, Zwiebel*, Knoblauch*, Meersalz *aus kontrolliert ökologischer Erzeugung ***aus anerkannt ökologischer Aquakultur', '2022-11-07 10:03:20', 224.4, 'CONVENIENCE_PRESERVES', 'PANTRY', 155, 11, NULL, NULL, NULL),
(196, 'Sardellenfilets in Bio-Olivenöl (Weiling)', '8412439287006', 0, 3.99, 1, 1, NULL, 0, '160247', 'Sardellenfilets in Bio-Olivenöl', 'Für die ,,Pan do Mar´-Produkte geht der Begriff des ,,nachhaltigen Fischfangs´ weit über die herkömmliche Bedeutung hinaus. Wir verstehen darunter nicht nur die Fangart, Fangkontrolle und durchgängige Dokumentation, sondern wir sehen auch eine soziale Komponente, die in anderen Nachhaltigkeitssystemen nie angesprochen wird: die Förderung der traditionellen Kleinfischerei (Küstenfischerei).', 'Conservas Antonio Pérez Lafuente, S.A.', 'Pan do Mar', 'SPAIN', '94c8a61a-1541-4023-ba26-a57d5896c9c5', 'manager', '2021-08-12 11:48:23', 'System', '2023-10-10 00:02:40', 1074, 1464, NULL, NULL, 0, 2.91, 'Weiling', 0, NULL, 0, 172, 'SARDELLENFILETS****  [Sardellen (60%) (Engraulis encrasicolus), Salz] , Olivenöl nativ extra*(40%) *aus kontrolliert ökologischer Erzeugung ****aus Wildfang', '2022-08-31 00:01:13', 106.08, 'CONVENIENCE_PRESERVES', 'PANTRY', 69, 10.2, 'GLUTENFREE', NULL, NULL),
(197, 'Bruderhahn an Zitrone (Weiling)', '4035626114127', 0, 9.79, 1, 1, NULL, 0, '160800', 'Bruderhahn an Zitrone', 'Das Fleisch der Bruderhähne für dieses bioladen*Produkt stammt von der Fleischmanufaktur Bauckhof. Die Fleischmanufaktur Bauckhof ist eine der ältesten Demeter-Betriebe, die seit Generationen für beste Bio-Qualität steht. Neben der Bruderhahn-Initiative, die die Fleischmanufaktur Bauckhof ins Leben gerufen hat, kann sie ebenfalls eine vorbildliche Tierhaltung aufweisen. Dafür wurde der Fleischmanufaktur Bauckhof bereits beim Bundeswettbewerb ökologischer Landbau der Förderpreis für „Artgerechte Tierhaltung, Tierzucht“ verliehen.Ebenfalls wichtig für die Fleischmanufaktur Bauckhof ist der ganzheitliche Wertekreis – es werden nur so viele Tiere gehalten, wie das Land versorgen kann und gedüngt wird mit hofeigenem Mist oder biodynamischen Präparaten aus dem eigenen Betrieb. Mehr erfahren Sie auf unserer Internetseite: bioladen.de/fleischmanufaktur-bauckhof', 'Weiling GmbH', 'bioladen', 'GERMANY', '7319b6cf-df41-40c7-8250-e421cb1d18b7', 'manager', '2021-08-12 11:48:31', 'System', '2023-10-16 10:02:12', 123, 439, 2, NULL, 0, 1.86, 'Weiling', 0, NULL, 0, 69, 'Junghahnkeulenfleisch** vom Bruderhahn (50%), Hühnerfond** (Trinkwasser, Hähnchenkarkassen**, Möhren**, SELLERIE**, Petersilienwurzel**, Meersalz), Zitronensaft** (4%), BUTTER**, WEIZENMEHL**, Ahornsirup*, Zuckerrübensirup*, Steinsalz, Schnittlauch*, Rohrohrzucker**, Pfeffer* *aus kontrolliert ökologischer Erzeugung **aus biodynamischer Erzeugung', '2022-10-01 00:00:41', 671.925, 'CONVENIENCE_PRESERVES', 'PANTRY', 620, 9.3, NULL, NULL, NULL),
(198, 'Bruderhahn an Tomate (Weiling)', '4035626114141', 0, 9.49, 1, 1, NULL, 0, '160801', 'Bruderhahn an Tomate', 'Das Fleisch der Bruderhähne für dieses bioladen*Produkt stammt von der Fleischmanufaktur Bauckhof. Die Fleischmanufaktur Bauckhof ist eine der ältesten Demeter-Betriebe, die seit Generationen für beste Bio-Qualität steht. Neben der Bruderhahn-Initiative, die die Fleischmanufaktur Bauckhof ins Leben gerufen hat, kann sie ebenfalls eine vorbildliche Tierhaltung aufweisen. Dafür wurde der Fleischmanufaktur Bauckhof bereits beim Bundeswettbewerb ökologischer Landbau der Förderpreis für „Artgerechte Tierhaltung, Tierzucht“ verliehen.Ebenfalls wichtig für die Fleischmanufaktur Bauckhof ist der ganzheitliche Wertekreis – es werden nur so viele Tiere gehalten, wie das Land versorgen kann und gedüngt wird mit hofeigenem Mist oder biodynamischen Präparaten aus dem eigenen Betrieb. Mehr erfahren Sie auf unserer Internetseite: bioladen.de/fleischmanufaktur-bauckhof', 'Weiling GmbH', 'bioladen', 'GERMANY', '8c43f6a0-26fa-4e4a-9d7c-c13c80b695ac', 'manager', '2021-08-12 11:48:40', 'System', '2023-10-16 10:02:14', 316, 440, 2, NULL, 0, 1.86, 'Weiling', 0, NULL, 0, 69, 'Junghahnkeulenfleisch** (49%) vom Bruderhahn, Hühnerfond** (19,5%, Trinkwasser, Hähnchenkarkassen**, Möhren**, SELLERIE**, Petersilienwurzel**, Meersalz), Tomaten** (20%), Zwiebeln**, BUTTER**, WEIZENMEHL**, Steinsalz, Rohrohrzucker**, Rosmarin*, Pfeffer* *aus kontrolliert ökologischer Erzeugung **aus biodynamischer Erzeugung', '2022-10-01 00:00:50', 671.925, 'CONVENIENCE_PRESERVES', 'PANTRY', 620, 9.3, NULL, NULL, NULL),
