(200, 'Haferflocken, Kleinblatt, Bioland (Weiling)', '4022381020398', 0, 1.79, 1, 1, NULL, 0, '170790', 'Haferflocken, Kleinblatt, Bioland', 'Die feine Müsli-Grundlage zum günstigen Preis', 'Spielberger GmbH', 'Burgermühle', 'Deutschland', '16d9d95c-0e94-4e48-a210-23a555177afd', 'manager', '2021-08-12 11:48:55', 'System', '2023-11-29 02:06:53', 318, 441, 1, NULL, 0, 0.98, 'Weiling', 0, NULL, 0, 64, 'HAFERflocken Kleinblatt* *aus kontrolliert ökologischer Erzeugung', '2022-11-29 16:20:45', 1386, 'MUISLI_FLAKES_NUTS', 'PANTRY', 510, 22, 'VEGAN;VEGETARIAN', NULL, NULL),
(201, 'Haferflocken, Großblatt, Bioland (Weiling)', '4022381020350', 0, 1.49, 1, 1, NULL, 0, '170792', 'Haferflocken, Großblatt, Bioland', 'die kräftige Müsli-Grundlage zum günstigen Preis', 'Spielberger GmbH', 'Burgermühle', 'Deutschland', 'dd97f191-dd85-4e73-abde-619daa533187', 'manager', '2021-08-12 11:49:04', 'System', '2023-11-29 02:10:27', 124, 442, 1, NULL, 0, 0.98, 'Weiling', 0, NULL, 0, 64, 'HAFERflocken Großblatt* *aus kontrolliert ökologischer Erzeugung', '2022-04-11 15:50:51', 1386, 'MUISLI_FLAKES_NUTS', 'PANTRY', 510, 22, 'VEGAN;VEGETARIAN', NULL, NULL),
(202, 'Dinkelflocken Kleinblatt, demeter (Weiling)', '4022381001892', 0, 2.99, 1, 1, NULL, 0, '170712', 'Dinkelflocken Kleinblatt, demeter', 'Unsere Dinkelflocken stellen wir mit größter Sorgfalt in unserer eigenen Flockenmühle her. Dort wird das ganze Korn zuerst zerkleinert, gedämpft und anschließend zu einer feinen Flocke gewalzt. So bleiben alle Inhaltsstoffe des vollen Getreidekorns erhalten. Bei Kleinblattflocken ergibt ein Getreidekorn durch das Zerkleinern mehrere Flocken, welche feiner sind als Großblattflocken. Dinkel schmeckt fein nussig und ist reich an Ballaststoffen, Vitaminen, Mineralstoffen und hochwertigem Eiweiß - ein echtes heimisches Superfood. Mit dem Beginn der Biobewegung wurde Dinkel als unverfälschtes Urgetreide wiederentdeckt. Bis zum Mittelalter galt er als das wichtigste Brotgetreide. Erst mit der Intensivierung der Landwirtschaft und dem verstärkten Einsatz von Kunstdünger geriet das Getreide in Vergessenheit. Das hatte einen ganz einfachen Grund: Dinkel reagiert – anders als Weizen – auf die Gabe von Stickstoffdünger kaum mit einer Erhöhung des Ertrags. Im Bioanbau werden dagegen die positiven Eigenschaften des Getreides geschätzt. Neben dem fein nussigen Geschmack und der besseren Verträglichkeit, zeichnet sich Dinkel dadurch aus, dass er auch in niederschlagsreicheren Gebieten und höheren Lagen gut gedeiht. Geschützt durch feste Spelzen sind die Körner außerdem weniger anfällig für Pilzerkrankungen.', 'Spielberger GmbH', 'Spielberger Mühle', 'Deutschland', 'e237a414-7c73-4f16-bb83-a871498dc5da', 'manager', '2021-08-12 11:49:12', 'System', '2024-01-26 02:08:24', 125, 443, 2, NULL, 0, 1.82, 'Weiling', 0, NULL, 0, 64, 'DINKELflocken** (eine Ur-Weizenart) **aus biodynamischer Erzeugung', '2022-11-29 16:03:28', 1386, 'MUISLI_FLAKES_NUTS', 'PANTRY', 514.4, 22, 'VEGAN;VEGETARIAN', NULL, NULL),
(204, 'Buchweizenflocken, kbA (Weiling)', '4022381010962', 0, 4.49, 1, 1, NULL, 0, '170734', 'Buchweizenflocken, kbA', 'Für unsere Buchweizenflocken wird das ganze Korn in unserer eigenen Flockenmühle zuerst gedämpft und anschließend zu einer schönen Flocke gewalzt. So bleiben alle Inhaltsstoffe des vollen Korns erhalten.', 'Spielberger GmbH', 'Spielberger Mühle', 'Deutschland', '3be14f79-f061-4997-858b-cccff7518ff6', 'manager', '2021-08-12 11:49:30', 'System', '2024-01-19 02:06:34', 127, 444, 0, NULL, 0, 3.12, 'Weiling', 0, NULL, 0, 64, 'Buchweizenflocken* *aus kontrolliert ökologischer Erzeugung', '2022-10-10 00:13:53', 1386, 'MUISLI_FLAKES_NUTS', 'PANTRY', 514.4, 22, 'VEGAN;VEGETARIAN', NULL, NULL),
(205, '5-Korn-Flocken Zartblatt, demeter (Weiling)', '4022381020268', 0, 2.39, 1, 1, NULL, 0, '170753', '5-Korn-Flocken Zartblatt, demeter', 'Für unsere 5-Korn-Flocken werden Hafer-, Dinkel-, Gerste-, Roggen-, und Hirseflocken gemischt. In unserer eignen Flockenmühle wird dafür jeweils das ganze Korn zerkleinert, gedämpft und anschließend zu einer besonders zarten Flocke gewalzt. So bleiben alle Inhaltsstoffe des vollen Getreidekorns erhalten.', 'Spielberger GmbH', 'Spielberger Mühle', 'Deutschland', '996bd5b7-b33f-42cd-b4ab-37aa817d2983', 'manager', '2021-08-12 11:49:38', 'System', '2024-01-10 02:06:03', 128, 445, 2, NULL, 0, 1.56, 'Weiling', 0, NULL, 0, 64, 'HAFERflocken** Zartblatt, DINKELflocken** Zartblatt (eine Ur-Weizenart), GERSTENflocken**, ROGGENflocken**, Hirseflocken** **aus biodynamischer Erzeugung', '2022-10-10 00:13:49', 1386, 'MUISLI_FLAKES_NUTS', 'PANTRY', 389.4, 22, 'VEGAN;VEGETARIAN', NULL, NULL),
(206, 'Glutenfreie Haferflocken Kleinblatt, demeter (Weiling)', '4022381027595', 0, 2.99, 1, 1, NULL, 0, '179009', 'Glutenfreie Haferflocken Kleinblatt, demeter', 'Unsere glutenfreien Haferflocken werden vom Anbau bis zum Verkauf im Laden sorgfältig getrennt von allen glutenhaltigen Produkten gehalten und mehrmals analysiert. Damit der Glutengehalt verlässlich unter 20 ppm (20 mg/kg) Gluten liegt, muss bereits der Landwirt bei der Anbauplanung, bei der Ernte, der Lagerung und dem Transport Verunreinigungen vermeiden. In unserer Mühle achten wir auf streng getrennte Warenströme. Erst wenn auch die letzte Analyse die Glutenfreiheit bestätigt, verlassen die Produkte unser Haus. Für eine ökologische und sichere Verpackungslösung für die glutenfreien Produkte setzen wir auf Pergaminpapier. Dieses ist sehr dicht und besitzt eine Fettbarriere. Bei unseren Beuteln für die glutenfreien Produkte verwenden wir einen kompletten Innenbeutel aus diesem Papier. Er bietet ausreichend Schutz vor nachträglicher Verunreinigung. Weil er aus 100% Papier besteht, kann er problemlos über das Altpapier entsorgt werden. Für unsere glutenfreien Haferflocken wird das ganze Korn gedarrt, zerkleinert, gedämpft und anschließend zu feinen Flocken gewalzt. So bleiben alle Inhaltsstoffe des vollen Getreidekorns erhalten. Bei Kleinblattflocken ergibt ein Getreidekorn durch das Zerkleinern mehrere Flocken, welche feiner sind als Großblattflocken. Hafer ist ein wahres heimisches Superfood, denn er bietet eine Menge Vitamine und Mineralstoffe wie B-Vitamine, Vitamin E, Kalium, Eisen und Zink. Zudem punktet das Getreide mit einem hohen Eiweißgehalt und sättigenden Ballaststoffen. Besonders reich ist Hafer an dem Ballaststoff Beta-Glucan. Dieser macht ihn besonders gesund, denn Beta-Glucan wirkt sich positiv auf den Cholesterin- und Blutzuckerspiegel aus.', 'Spielberger GmbH', 'Spielberger Mühle', 'GERMANY', '4232658f-9393-43b7-985d-e6ef4c383989', 'manager', '2021-08-12 11:49:46', 'System', '2024-02-02 02:07:59', 129, 446, 2, NULL, 0, 1.81, 'Weiling', 0, NULL, 0, 64, 'HAFERflocken Kleinblatt, glutenfrei** **aus biodynamischer Erzeugung', '2022-12-01 08:23:08', 977.5, 'MUISLI_FLAKES_NUTS', 'PANTRY', 492, 23, 'VEGAN;VEGETARIAN;GLUTENFREE', NULL, NULL),
(207, 'Hafer Porridgeflocken Klassik, demeter (Weiling)', '4022381029216', 0, 1.99, 1, 1, NULL, 0, '179088', 'Hafer Porridgeflocken Klassik, demeter', 'Haferbrei wird in unterschiedlichen Variationen in vielen Ländern und Kulturen gerne gegessen. Ursprünglich stammt Porridge aber aus Schottland. In den rauen Highlands war ein wärmendes Porridge zum Frühstück genau das Richtige und wurde in Arbeiterfamilien als sättigende Mahlzeit auch zum Mittag- oder Abendessen serviert. Es war dabei üblich dem Porridge selbst nur eine Prise Salz hinzuzufügen – sonst nichts. Der Hafer wurde in Wasser gekocht und dabei mit einem Holzstab, dem sogenannten Spurtle, gerührt bis ein sämig-kerniges Porridge erreicht war. Auf dem Tisch standen dann kalte Milch, Sahne oder Buttermilch bereit. Darin konnte nach Belieben der Löffel mit Porridge eingetaucht werden. Im Gegensatz zu ihren englischen Nachbarn süßten die Schotten ihren Haferbrei nicht – nur für Kinder wurde etwas brauner Zucker hinzugefügt. Auch heute wird Porridge in Schottland üblicherweise pur serviert. Dazu gibt es separate Zutaten zum Süßen und Verfeinern wie Ahornsirup, Sahne, Marmelade, Kompott, frische Früchte oder auch – echt schottisch – etwas Whisky. Neben den süßen Varianten, servieren die Schotten ihr Porridge gerne auch herzhaft. Durch die vielfältigen Möglichkeiten ist für jeden Geschmack etwas dabei.\nMit unseren Hafer Porridgeflocken Klassik kommen Sie in den Genuss von echtem, traditionellem Porridge – ohne Zusatzstoffe, Süßungsmittel, Aromen oder sonstigen Schnickschnack. Aber dafür richtig lecker. Unsere ausgesuchte Mischung aus Großblatt, Kleinblatt, Zartblatt und fein vermahlenen Haferflocken ergibt ein sämig-kerniges Porridge – ganz nach schottischer Tradition. ', 'Spielberger GmbH', 'Spielberger Mühle', 'Deutschland', 'd7240c12-99b5-4875-b183-042ab449f72e', 'manager', '2021-08-12 11:49:54', 'System', '2023-11-29 02:10:12', 319, 447, 2, NULL, 0, 1.43, 'Weiling', 0, NULL, 0, 64, 'HAFERflocken Zartblatt**, HAFERflocken\nKleinblatt**, HAFER-Vollkornmehl**, HAFERflocken\nGroßblatt** **aus biodynamischer Erzeugung', '2022-06-06 10:11:48', 1386, 'MUISLI_FLAKES_NUTS', 'PANTRY', 439.4, 22, 'VEGAN;VEGETARIAN', NULL, NULL),
(208, 'Hafer Flapjack Schokolade (Weiling)', '4016249184902', 0, 1.99, 1, 1, NULL, 0, '189970', 'Hafer Flapjack Schokolade', 'Gegen den Hunger zwischendurch haben wir was. Und zwar unsere hervorragenden\nFlapjacks. Wie alle unsere Riegel kommen auch die aus bestem Hause – dem Allos-Hof in\nDrebber im wünderschönen Niedersachsen. Zu dem ebenso leckeren wie\nballaststoffreichen Hafer gesellen sich noch beste Früchte, knackig Nüsse und edler\nKakao. Man muss sich manchmal wundern, dass so viel guter Geschmack überhaupt in so\neinen kleinen Riegel passt.', 'Allos Hof-Manufaktur GmbH', 'Allos', 'GERMANY', 'a65627ad-4b95-42cd-b732-e64ea3a4ce41', 'correction', '2021-09-17 15:10:26', 'System', '2023-06-26 10:03:34', 320, 281, 0, NULL, 0, 1.27, 'Weiling', 2, 1, 0, 60, NULL, '2022-05-24 12:05:27', 130, 'SWEETS', 'SNACKS', 51, 13, 'VEGAN;VEGETARIAN', NULL, NULL),
