(212, 'Bio-Früchteriegel Apfel-Banane (Weiling)', '7640161879010', 0, 0.99, 1, 1, NULL, 0, '448030', 'Bio-Früchteriegel Apfel-Banane', 'Ob Zwieback, Keks, Früchteriegel, Tee oder Beikostöl. Sorgsam ausgesuchte Zutaten und ernährungsphysiologisch ausgewogene Rezepturen sorgen für Freude und Abwechslung in der Beikostphase.', 'Holle baby food AG', 'Holle ', 'GERMANY', '944433d6-f892-494f-8a4b-7b555b888f6b', 'manager', '2021-08-12 11:50:41', 'System', '2024-02-07 02:09:25', 131, 448, 0, NULL, 0, 0.62, 'Weiling', 0, NULL, 0, 61, 'Apfelsaftkonzentrat*44%, Bananen* getrocknet 31%, HAFERflocken* 11%, Reismehl*, DINKEL-Oblate*¹ 6 % (DINKELmehl*¹,\nKartoffelstärke*), Sonnenblumenöl*. *aus biologischer Landwirtschaft. Kann Spuren von SOJA, MILCH, SESAM, MANDELN, HASEL-, WAL- und KASCHUNÜSSEN enthalten. ¹eine Weizenart', '2023-01-16 17:33:36', 52, 'BABY_FOOD', 'BABY', 25.8, 13, 'VEGAN;VEGETARIAN;LACTOSEFREE', NULL, NULL),
(213, 'Riegel - Müsli (Weiling)', '4260311980309', 0, 0.99, 1, 1, NULL, 0, '449871', 'Riegel - Müsli', 'Knuspriges Getreide mit knackigen Haselnüssen und geröstetem Sesam, abgerundet mit köstlichem Honig - ein Genuss, der natürlich besser schmeckt. Versprochen!', 'MOGLi Naturkost GmbH', 'Mogli', 'GERMANY', '0de91072-478f-44a5-b085-5ef5b8137f74', 'manager', '2021-08-12 11:50:52', 'System', '2023-09-08 02:17:01', 1563, 449, 0, NULL, 0, 0.58, 'Weiling', 0, NULL, 0, 61, 'HAFERFLOCKEN* 24 %, Cornflakes*, Agavendicksaft*, Reissirup*, Honig* 6 %, HASELNÜSSE* geröstet 6 %, Palmfett*, Reiscrispies mit Kakao* (Reisgrieß*, WEIZENMEHL*, fettarmes Kakaopulver* , Meersalz), SESAM* geröstet 5 %, Reismehl* *aus kontrolliert ökologischer Erzeugung', '2023-04-04 10:31:46', 56.7, 'SWEETS', 'SNACKS', 26, 13.5, 'VEGETARIAN;LACTOSEFREE', NULL, NULL),
(214, 'Kokosriegel in Zartbitterschokolade (24%) (Weiling)', '4085900004507', 0, 1.19, 1, 1, NULL, 0, '189966', 'Kokosriegel in Zartbitterschokolade (24%)', 'Bio-Kakao-Erdmandel-Fruchtriegel für den angenehmen Genuss.', 'vitana Gesunde Ernährung GmbH', 'vitana Gesunde Ernährung', 'GERMANY', '1b1ba4e5-cc39-4ad5-8c46-c31327d81d4b', 'manager', '2021-08-12 11:51:00', 'System', '2023-05-18 02:12:25', 1511, 1465, 0, NULL, 0, 0.71, 'Weiling', 0, NULL, 0, 60, 'Kokosraspeln* 33%, Reissirup*, Rohrohrzucker*, Kakaomasse*, glutenfreier WEIZENSIRUP*, Kakaobutter*, Reismehl*, Bourbon-Vanilleschoten* gemahlen.  \n*aus ökologischem Landbau, DE-ÖKO-001\nKakao: 55% mindestens in der Zartbitter-Schokolade.  Kann Spuren von SCHALENFRÜCHTEN, MILCH und SOJA enthalten. *aus kontrolliert ökologischer Erzeugung', '2022-08-10 00:06:29', 49, 'SWEETS', 'SNACKS', 41, 14, 'VEGETARIAN', NULL, NULL),
(215, 'Guarkernmehl, glutenfrei (Weiling)', '4020943232197', 1, 4.99, 1, 1, NULL, 0, '200215', 'Guarkernmehl, glutenfrei', 'Cet agent épaississant végétal est obtenu à partir de petites graines de guar d\'environ 5 mm. Sa particularité : il ne nécessite pas forcément de cuisson. Il est donc parfait aussi bien pour les desserts, les soupes froides et les dips que pour les sauces, les soupes et les gratins.', 'Arche Naturprodukte GmbH', 'Arche Naturküche', 'INDIA', '4659bea8-20d2-4c3a-b9bc-4b3ec8778866', 'manager', '2021-08-12 11:51:08', 'System', '2023-07-01 00:04:56', 132, 450, 0, NULL, 0, 2.82, 'Weiling', 0, NULL, 0, 60, 'épaississant : farine de graines de guar*\n\n *issu de l\'agriculture biologique', '2022-11-10 02:04:46', 421.875, 'BAKING_INGREDIENTS;SPICES_COOKING_HELP', 'PANTRY', 146, 7.5, 'VEGAN;VEGETARIAN;GLUTENFREE', NULL, NULL),
(216, 'Apfelpektin, glutenfrei (Weiling)', '4020943232692', 0, 2.79, 1, 1, NULL, 0, '200225', 'Apfelpektin, glutenfrei', 'La pectine de pomme ARCHE a un pouvoir gélifiant rapide et permet d\'obtenir une consistance élastique. Elle est riche en fibres et faible en calories. La pectine de pomme ARCHE permet de préparer des pâtes à tartiner aux fruits sans sucre ou à teneur réduite en sucre. La pectine de pomme est fabriquée à partir de marc de pommes. La pectine non amidée (E440i) est autorisée pour la fabrication de pâtes à tartiner aux fruits biologiques selon le label biologique de l\'UE. À ce jour, la pectine n\'existe pas en qualité biologique, car les matières premières ne sont pas disponibles en quantité et qualité suffisante. Pour 1, 3 kg de fruits', 'Arche Naturprodukte GmbH', 'Arche Naturküche', 'GERMANY', 'edda107e-2430-403b-8705-033056d54bcf', 'manager', '2021-08-12 11:51:16', 'System', '2023-06-03 02:05:41', 133, 451, NULL, NULL, 0, 1.68, 'Weiling', 0, NULL, 0, NULL, 'gélifiant : pectine de pomme* *la pectine de pomme d\'ARCHE n\'est pas amidée et elle est donc autorisée pour la fabrication de produits biologiques. La pectine n\'est pas encore disponible en qualité biologique.', '2022-12-17 12:11:43', 63.7, 'BAKING_INGREDIENTS;SPICES_COOKING_HELP', 'PANTRY', 27.8, 13, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(217, 'Tapioka Stärke (Weiling)', '4020943232715', 0, 3.49, 1, 1, NULL, 0, NULL, 'Tapioka Stärke', 'Le tapioca est une fécule fine au goût neutre fabriquée à partir de racines de manioc. Cette fécule est l\'agent liant parfait pour les soupes et les sauces. Elle leur donne non seulement la consistance optimale, mais aussi un léger éclat caractéristique de la bonne cuisine asiatique. Cette fécule très facile à utiliser permet également de réussir en un tournemain les pâtisseries fines et sans gluten et les desserts. Très pratique dans sa boîte refermable !', 'Arche Naturprodukte GmbH', 'Arche Naturküche', 'VARIOUS', '9d400a35-7838-4407-9828-279f8335a391', 'manager', '2021-08-12 11:51:24', 'System', '2023-06-03 02:05:37', 134, 452, 0, NULL, 0, 2.1, 'Weiling', 0, NULL, 0, 60, 'fécule de tapioca*\n\n *aus kontrolliert ökologischer Erzeugung', '2022-11-10 11:18:58', 691.875, 'BAKING_INGREDIENTS;SPICES_COOKING_HELP', 'PANTRY', 233.8, 12.3, 'VEGAN;VEGETARIAN;GLUTENFREE', NULL, NULL),
