(220, 'Kartoffelmehl (Stärke) glutenfrei Bio (Weiling)', '4015637821276', 0, 2.29, 1, 1, NULL, 0, '200272', 'Kartoffelmehl (Stärke) glutenfrei Bio', 'Ohne Verwendung von genmodifizierten Organismen oder genmodifizierten Rohmaterialien, ohne Verwendung von Konservierungsstoffen und Zusätzen. Rückstandsanalyse der einzelnen Zusätze.', 'Bauck GmbH', 'Bauckhof', 'GERMANY', 'f6e9adfc-1bae-4810-bc41-c0975eb60fff', 'manager', '2021-08-12 11:51:49', 'System', '2023-09-26 02:37:43', 323, 455, 0, NULL, 0, 1.31, 'Weiling', 0, NULL, 0, 64, 'Kartoffelstärke* *aus kontrolliert ökologischer Erzeugung', '2022-12-30 14:35:44', 836, 'BAKING_INGREDIENTS', 'PANTRY', 280, 16, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(221, 'Gelierzucker 3:1, BIO (Weiling)', '4005394285404', 0, 4.99, 1, 1, NULL, 0, '31634', 'Gelierzucker 3:1, BIO', 'BIOVEGAN 3:1 Gelierzucker für klassische Fruchtaufstriche aus 3 Teilen Frucht und 1 Teil Zucker. Eine Packung Gelierzucker geliert 1,5 kg Früchte. Für Fruchtaufstriche oder Gelees mit langer Haltbarkeit. Besonders feiner Rohrohrzucker sorgt für die optimale Löslichkeit und einen ausgewogenen Geschmack. Probieren Sie selbst.', 'Biovegan GmbH', 'Biovegan', 'GERMANY', 'a9a14f8a-e9bb-4d4a-874c-bf62bb04e884', 'manager', '2021-08-12 11:51:58', 'System', '2023-07-01 00:20:29', 136, 456, 0, NULL, 0, 3.05, 'Weiling', 0, NULL, 0, 63, 'Rohrohrzucker*, Geliermittel: Pektine.\n *aus kontrolliert ökologischer Erzeugung', '2023-03-07 02:12:23', 560, 'BAKING_INGREDIENTS;SPICES_COOKING_HELP', 'PANTRY', 510, 16, 'VEGAN;VEGETARIAN;GLUTENFREE', NULL, NULL),
