(223, 'Gelierzucker 2:1, BIO (Weiling)', '4005394158005', 0, 3.19, 1, 1, NULL, 0, '200722', 'Gelierzucker 2:1, BIO', 'BIOVEGAN Gelierzucker 2:1 für klassische Fruchtaufstriche aus 2 Teilen Frucht und 1 Teil Zucker. Eine Packung Gelierzucker geliert 1 kg Früchte. Für Fruchtaufstriche oder Gelees mit langer Haltbarkeit. Besonders feiner Rohrohrzucker sorgt für die optimale Löslichkeit und einen ausgewogenen Geschmack. Probieren Sie selbst.', 'Biovegan GmbH', 'Biovegan', 'GERMANY', '7bf5918a-a183-453a-8796-3c8ddb3c19dc', 'manager', '2021-08-12 11:52:20', 'System', '2023-08-11 02:05:46', 138, 458, 0, NULL, 0, 1.95, 'Weiling', 0, NULL, 0, 63, 'Rohrohrzucker*, Geliermittel: Pektine. *aus kontrolliert ökologischer Erzeugung', '2023-05-02 14:07:42', 420, 'BAKING_INGREDIENTS;SPICES_COOKING_HELP', 'PANTRY', 506, 12, 'VEGAN;VEGETARIAN;GLUTENFREE', NULL, NULL),
(224, 'Gelierzucker ohne Kochen, BIO (Weiling)', '4005394154700', 0, 1.79, 1, 1, NULL, 0, '200725', 'Gelierzucker ohne Kochen, BIO', 'Mit dem BIOVEGAN Gelierzucker ohne Kochen gelingen frische Fruchtaufstriche in Rohkostqualität. Der natürliche Fruchtgeschmack und die Vitamine bleiben erhalten. Einfach, schnell und lecker! Eine Tüte geliert 250 g Früchte und ergibt ca. 350 ml fertigen Fruchtaufstrich.', 'Biovegan GmbH', 'Biovegan', 'GERMANY', '80f69fb6-1e5b-4300-a64d-c477c7b961d3', 'manager', '2021-08-12 11:52:28', 'System', '2023-07-01 00:01:51', 139, 459, 0, NULL, 0, 1.2, 'Weiling', 0, NULL, 0, 63, 'Rohrohrzucker*, Geliermittel: Pektine, Zitronenpulver*. *aus kontrolliert ökologischer Erzeugung', '2023-03-25 02:06:35', 273, 'BAKING_INGREDIENTS;SPICES_COOKING_HELP', 'PANTRY', 119, 13, 'VEGAN;VEGETARIAN;GLUTENFREE', NULL, NULL),
(225, 'Saucenbinder hell, BIO (Weiling)', '4005394285954', 0, 1.99, 1, 1, NULL, 0, '200735', 'Saucenbinder hell, BIO', 'Saucenbinder hell, BIO\nWenn‘s richtig gut werden soll, dann muss es Saucenbinder hell von BIOVEGAN sein. Das Beste, was Deinem Essen passieren kann! Einfach, schnell und geschmacksneutral.', 'Biovegan GmbH', 'Biovegan', 'GERMANY', '149d16aa-7c38-4441-b07e-d260e28e2077', 'manager', '2021-08-12 11:52:37', 'System', '2023-06-01 02:11:32', 324, 460, 0, NULL, 0, 1.04, 'Weiling', 0, NULL, 0, 63, 'Vollkornreismehl*, Kartoffelstärke*, Maisstärke*. *aus kontrolliert ökologischer Erzeugung', '2022-12-17 12:11:12', 273, 'CONVENIENCE_PRESERVES;SPICES_COOKING_HELP', 'PANTRY', 106, 13, 'VEGAN;VEGETARIAN;GLUTENFREE', NULL, NULL),
(226, 'Ei-Ersatz 100% pflanzlich, BIO (Weiling)', '4005394287897', 0, 1.99, 1, 1, NULL, 0, '200758', 'Ei-Ersatz 100% pflanzlich, BIO', 'Ei-Ersatz, 100% pflanzlich, BIO\nPflanzlicher Ei-Ersatz findet in süßen Gebäcken wie Waffeln, Pfannkuchen, Pancakes und Rührkuchen Anwendung. Oder in herzhaften Gerichten wie Kartoffel- und Gemüsepuffer, Aufläufen oder zum Panieren. Zur Zubereitung von Rühr- oder Spiegelei nicht geeignet.', 'Biovegan GmbH', 'Biovegan', 'GERMANY', 'f4c52c4b-0c6f-476f-9220-4afbd6f60cac', 'manager', '2021-08-12 11:52:48', 'System', '2023-07-28 02:05:51', 140, 461, 0, NULL, 0, 0.91, 'Weiling', 0, NULL, 0, 63, 'SWEET LUPIN FLOUR*, thickener: locust bean gum* (E410), corn flour*, linseed protein*, sunflower protein*. *aus kontrolliert ökologischer Erzeugung', '2022-05-24 10:37:50', 73.6, 'BAKING_INGREDIENTS;SPICES_COOKING_HELP', 'PANTRY', 22, 11.5, 'VEGAN;VEGETARIAN;GLUTENFREE', NULL, NULL),
