(235, 'Grünkern, kbA (Weiling)', '4022381033053', 0, 3.99, 1, 1, NULL, 0, '244033', 'Grünkern, kbA', 'Für Grünkern wird Dinkel vor der Vollreife geerntet und über Buchenrauch gedarrt. Das verleiht dem Getreide einen herzhaften, würzig-nussigen Geschmack.', 'Spielberger GmbH', 'Spielberger Mühle', 'Deutschland', '93d5540e-1fbd-433b-8e2b-d00dadfecd90', 'manager', '2021-08-12 11:54:11', 'System', '2022-04-22 02:08:04', 144, 467, 0, NULL, 0, 0, 'Weiling', 0, NULL, 0, NULL, NULL, '2022-04-22 02:08:04', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL),
(236, 'Goldhirse, demeter (Weiling)', '4022381113205', 0, 3.29, 1, 1, NULL, 0, '244040', 'Goldhirse, demeter', 'Goldhirse hat einen leicht nussigen Geschmack. Sie ist in der Vollwertküche sehr beliebt, denn sie enthält viele wertvolle Inhaltsstoffe und ist leicht verdaulich.', 'Spielberger GmbH', 'Spielberger Mühle', 'Österreich, Ungarn', 'eb5dccbb-9660-4556-94c5-d50df35573ef', 'manager', '2021-08-12 11:54:19', 'System', '2024-01-17 02:06:56', 145, 468, 2, NULL, 0, 2.08, 'Weiling', 0, NULL, 0, 64, 'Hirse** **aus biodynamischer Erzeugung', '2022-10-10 00:04:47', 760, 'PASTA_CEREALS_LEGUMES', 'PANTRY', 508.2, 19, 'VEGAN;VEGETARIAN;RAWFOOD', NULL, NULL),
(237, 'Dinkel-Bulgur, demeter (Weiling)', '4022381182201', 0, 3.99, 1, 1, NULL, 0, '244046', 'Dinkel-Bulgur, demeter', 'Für Dinkel-Bulgur wird das ganze Dinkel-Korn schonend durch Wasser und Wärme aufgeschlossen. Durch diesen Vorgang wird das Getreide für den menschlichen Organismus besonders verträglich und wertvoll. Der anschließende Darrvorgang bewirkt, dass das Getreide seinen urtypischen Geschmack voll entfalten kann, bevor es dann in der Mühle grob gebrochen wird', 'Spielberger GmbH', 'Spielberger Mühle', 'Deutschland', 'f72f184d-9bee-4e5b-892f-5ec3839ba5b8', 'manager', '2021-08-12 11:54:27', 'System', '2024-01-17 02:07:00', 146, 469, 2, NULL, 0, 2.49, 'Weiling', 0, NULL, 0, 64, 'DINKEL** (eine Ur-Weizenart) **aus biodynamischer Erzeugung', '2022-04-11 14:38:25', 760, 'PASTA_CEREALS_LEGUMES', 'PANTRY', 508.2, 19, 'VEGAN;VEGETARIAN', NULL, NULL),
(238, 'Couscous, demeter (Weiling)', '4022381415200', 0, 3.79, 1, 1, NULL, 0, '244048', 'Couscous, demeter', 'Couscous wird in einem traditionellen Verfahren aus Hartweizengrieß mit\nWasserdampf hergestellt. Durch diesen Aufschluss mit Wärme und Wasser ist Couscous gut verträglich und eignet sich für die schnelle Küche als Beilage, für Salate oder Süßspeisen.', 'Spielberger GmbH', 'Spielberger Mühle', 'Italien', '6f9e5b1d-74c3-470e-aff2-1918b15d749d', 'manager', '2021-08-12 11:54:35', 'System', '2024-01-18 02:06:57', 147, 470, 2, NULL, 0, 2.3, 'Weiling', 0, NULL, 0, 64, 'HARTWEIZEN** **aus biodynamischer Erzeugung', '2022-10-10 00:04:43', 760, 'PASTA_CEREALS_LEGUMES', 'PANTRY', 508.2, 19, 'VEGAN;VEGETARIAN', NULL, NULL),
(239, 'Gerstengraupen, demeter (Weiling)', '4022381321204', 0, 2.39, 1, 1, NULL, 0, '244072', 'Gerstengraupen, demeter', 'Für Gerstengraupen wird das Gerstenkorn mechanisch zu der typischen Graupenform geschliffen. Der leicht säuerliche Geschmack der Gerstengraupen passt zu deftigen Suppen und Eintöpfen, aber auch zu süßen Aufläufen.', 'Spielberger GmbH', 'Spielberger Mühle', 'Deutschland', 'f97d433e-5961-486d-8e9c-5194529324d4', 'manager', '2021-08-12 11:54:43', 'System', '2024-01-17 02:07:03', 148, 471, 2, NULL, 0, 1.41, 'Weiling', 0, NULL, 0, 64, 'GERSTEngraupen** **aus biodynamischer Erzeugung', '2023-03-30 19:46:13', 760, 'PASTA_CEREALS_LEGUMES', 'PANTRY', 508.2, 19, 'VEGAN;VEGETARIAN;RAWFOOD', NULL, NULL),
(240, 'Grünkernschrot, demeter (Weiling)', '4022381021845', 0, 4.49, 1, 1, NULL, 0, '244076', 'Grünkernschrot, demeter', 'Für Grünkern wird Dinkel über Buchenrauch gedarrt. Das verleiht dem Getreide einen herzhaften, würzig-nussigen Geschmack. Anschließend wird das Korn grob geschrotet. ', 'Spielberger GmbH', 'Spielberger Mühle', 'Deutschland', '20b8dd7b-df54-44a8-9162-87207c5f19f6', 'manager', '2021-08-12 11:54:51', 'System', '2024-01-17 02:06:48', 149, 472, 2, NULL, 0, 2.8, 'Weiling', 0, NULL, 0, 64, 'GRÜNKERNschrot** (eine Ur-Weizenart) **aus biodynamischer Erzeugung', '2022-10-31 00:01:05', 760, 'PASTA_CEREALS_LEGUMES', 'PANTRY', 508.2, 19, 'VEGAN;VEGETARIAN', NULL, NULL),
(241, '6-Korn-Mischung, demeter (Weiling)', '4022381021869', 0, 1.69, 1, 1, NULL, 0, '244082', '6-Korn-Mischung, demeter', 'Die 6-Korn-Mischung ist eine ausgewogene Mischung der wichtigesten Getreidearten. ', 'Spielberger GmbH', 'Spielberger Mühle', 'Deutschland', 'a475ce51-9c9a-4a43-b11f-891ee5d38001', 'manager', '2021-08-12 11:55:00', 'System', '2024-01-17 02:06:50', 327, 473, 2, NULL, 0, 1.21, 'Weiling', 0, NULL, 0, 64, 'WEIZEN**, ROGGEN**, DINKEL** (eine Ur-Weizenart), HAFER**, NACKTGERSTE**, Hirse** **aus biodynamischer Erzeugung', '2022-04-11 14:38:39', 760, 'PASTA_CEREALS_LEGUMES', 'PANTRY', 508.2, 19, 'VEGAN;VEGETARIAN', NULL, NULL),
(242, 'Sushireis (Weiling)', '8713576275636', 0, 3.49, 1, 1, NULL, 0, '240004', 'Sushireis', 'Dieser Bio-Sushi-Reis hat ein großes, rundes Korn. Der Geschmack ist etwas  süßer als bei weißen Basmati. Die klebrige Struktur macht diesen Reis perfekt  für Sushi. Den Reis mit einem Schuss Genmai Su und Mirin würzen. Natürlich  kannst du Sushi-Reis auch als Basis für ein Dessert, eine Poké-Bowl, eine Nasi  oder einen anderen Reissnack verwenden. Mische nach der Zubereitung  Umeboshi-Stücken dazu, um deinem Gericht zusätzlichen Geschmack zu verleihen.  Probiere auch braune oder weiße Basmati oder braunen Reis.', 'TerraSana Natuurvoeding BV', 'TerraSana', 'ITALY', 'cd079314-da9c-4f06-aba6-ccdbe76ba3e6', 'manager', '2021-08-12 11:55:07', 'System', '2023-07-01 00:38:12', 328, 474, 0, NULL, 0, 2.33, 'Weiling', 0, NULL, 0, 120, 'Sushireis* *aus kontrolliert ökologischer Erzeugung', '2022-10-15 02:05:59', 581.825, 'PASTA_CEREALS_LEGUMES', 'PANTRY', 402, 18.5, 'VEGAN;VEGETARIAN;GLUTENFREE', NULL, NULL),
(243, 'Popcornmais, im Pfandglas (Weiling)', '4035661163302', 0, 3.99, 1, 1, NULL, 0.15, '240886', 'Popcornmais, im Pfandglas', 'Der bioladen*Popcornmais im Mehrwegglas. Der Popcornmais eignet sich hervorragend für die Herstellung von frischgemachtem Popcorn.', 'Weiling GmbH', 'bioladen', 'GERMANY', '65bc45f8-29d4-4b4c-bebc-122c0462323e', 'manager', '2021-08-12 11:55:15', 'System', '2023-10-14 02:12:47', 329, 475, 0, NULL, 0, 2.49, 'Weiling', 0, NULL, 0, 62, 'Mais* *aus kontrolliert ökologischer Erzeugung', '2022-05-31 00:01:13', 731.909, 'PASTA_CEREALS_LEGUMES', 'PANTRY', 701, 12.6, 'VEGAN;VEGETARIAN', NULL, NULL),
