(261, 'Pizzateig Backmischung, BIO (Weiling)', '4005394285824', 0, 3.79, 1, 1, NULL, 0, '251047', 'Pizzateig Backmischung, BIO', 'Pizzateig Backmischung  mit 11 % gekeimter Hirse-Saat, BIO\nDie Biovegan Pizzateig Backmischung mit gekeimter Hirse-Saat in bester und geprüfter Vollwert-Qualität ist nicht nur vegan und glutenfrei, sondern kommt dazu auch komplett ohne zugesetzten Zucker aus – eine echte Innovation für einen bewussten Lebensstil und für richtig gute Pizza. Durch Karottenfasern und Chiasamen erhält sie ihren einzigartigen Geschmack. Natürlich, bio, vegan und glutenfrei. ', 'Biovegan GmbH', 'Biovegan', 'GERMANY', '24e815af-7954-447b-8d59-1d96aebcd694', 'manager', '2021-08-12 11:58:03', 'System', '2023-06-01 02:11:18', 550, 492, 0, NULL, 0, 2.3, 'Weiling', 0, NULL, 0, 63, 'Reisvollkornmehl*, Kartoffelstärke*, Reismehl*, Hirsevollkornmehl gekeimt*, Backpulver*¹ (Tapiokastärke*, Backtriebmittel: Natriumcarbonate; Säuerungsmittel: Kaliumtartarte²; Zitronensaftpulver*, Verdickungsmittel: Guarkernmehl*), Trockenhefe*, Quinoa-Sauerteigpulver* (94 % Quinoa-Mahlprodukte*, Reis-Mahlprodukte*), Leinprotein*, Salz, Chiasamenmehl* (Salvia hispanica), Leinsamenmehl*, Flohsamenschalen*, Karottenfasern*, Verdickungsmittel: Johannisbrotkernmehl*, Guarkernmehl*. *aus kontrolliert ökologischer Erzeugung', '2022-05-17 03:02:55', 892.5, 'OTHER_PASTRY', 'PASTRY', 305, 17.5, 'VEGAN;VEGETARIAN;GLUTENFREE', NULL, NULL),
