(264, 'SonnenblumenHACK Pur (Weiling)', '4260072176591', 0, 3.99, 1, 1, NULL, 0, '250792', 'SonnenblumenHACK Pur', 'Die sunflowerHACK Produkte sind eine absolute Weltneuheit - Fleischersatz aus Sonnenblumenkernen. Eine echte Alternative zu Soja. Alle unsere Produkte werden in Bio-Qualität in Europa fair hergestellt. Sie sind vegan und kommen ganz ohne künstliche Zusatzstoffe aus und sind frei von Laktose und Gluten.', 'SunflowerFamily GmbH', 'SunflowerFamily', 'GERMANY', 'f2930a60-53b9-436a-ba2b-49244329815a', 'manager', '2021-08-12 11:58:28', 'System', '2024-01-18 02:07:36', 150, 493, 0, NULL, 0, 2.52, 'Weiling', 0, NULL, 0, 64, 'Sonnenblumenprotein *aus kontrolliert ökologischer Erzeugung', '2022-09-02 02:34:51', 965.7, 'CONVENIENCE_PRESERVES;SPICES_COOKING_HELP', 'PANTRY', 106, 18.5, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(265, 'Weizenmehl Type 405 demeter (Weiling)', '4022381001847', 0, 2.79, 1, 1, NULL, 0, '250452', 'Weizenmehl Type 405 demeter', 'Für unser Weizenmehl 405 verwenden wir besten demeter-Weizen. In unserer eigenen Mühle wird das Getreide in mehreren Schritten mit größter Sorgfalt und Fingerspitzengefühl zu diesem besonders hellen Mehl vermahlen.  \n\nDu fragst Dich, was den Unterschied zwischen einer Industriemühle und einem Handwerksbetrieb wie der Spielberger Mühle ausmacht? Es sind allem voran die Menschen, die hier mit großer Sorgfalt arbeiten. Denn unsere Mühle ist kein computergesteuerter, lebensmitteltechnologischer Prozessautomat – ohne die Menschen kann die Mühle nicht mahlen. Natürlich wird dabei auch gepumpt, gefördert, gebürstet, geschrotet und gemahlen. Mit Maschinen und Lärm und genau gesteuerten Abläufen. Aber in unseren Handwerksmühlen läuft das nicht automatisiert und standardisiert. Die Müller:innen arbeiten mit handwerklichem Geschick und mit viel Fingerspitzengefühl um diesen aufwändigen, komplexen Prozess der Müllerei zu steuern. Um Mehl von erstklassiger Qualität zu erhalten, verwenden sie dabei alle Sinne: An den Vibrationen im Gebäude spüren die Müller:innen, ob die Mühle richtig läuft. Sie hören jede noch so kleine Abweichung vom Soll. Mit Händen, Augen und Nase prüfen sie die Qualität. Sie fühlen und sehen ob das Mehl die richtige Struktur hat. Am aromatischen Duft erkennen sie, ob die Arbeit gelungen ist.', 'Spielberger GmbH', 'Spielberger Mühle', 'GERMANY', '9018adee-1f67-404d-a479-b38fb134199e', 'manager', '2021-08-12 11:58:36', 'System', '2024-02-14 02:07:48', 151, 494, 2, NULL, 0, 1.67, 'Weiling', 0, NULL, 0, 64, 'WEIZENmehl Type 405** **aus biodynamischer Erzeugung', '2023-02-02 09:18:14', 1386, 'BAKING_INGREDIENTS;PASTA_CEREALS_LEGUMES', 'PANTRY', 1014.4, 22, 'VEGAN;VEGETARIAN;RAWFOOD', NULL, NULL),
(266, 'Hartweizengrieß, demeter (Weiling)', '4022381219204', 0, 2.29, 1, 1, NULL, 0, '250462', 'Hartweizengrieß, demeter', 'Hartweizen ist eine besondere Weizenart mit einem sehr harten Korn. Er wird vor allem in Italien angebaut und dort traditionell für Pasta verwendet. Unser Hartweizengrieß hat eine schöne Gelbfärbung und eine hohe Kochfestigkeit.', 'Spielberger GmbH', 'Spielberger Mühle', 'Deutschland', 'b4613610-0c25-46b5-8c42-c629e7583d84', 'manager', '2021-08-12 11:58:45', 'System', '2024-01-19 02:06:54', 152, 495, 2, NULL, 0, 1.4, 'Weiling', 0, NULL, 0, 64, 'HARTWEIZENgrieß** **aus biodynamischer Erzeugung', '2022-10-10 00:01:21', 760, 'PASTA_CEREALS_LEGUMES', 'PANTRY', 508.2, 19, 'VEGAN;VEGETARIAN;RAWFOOD', NULL, NULL),
(267, 'Polenta (Maisgrieß), demeter glutenfrei (Weiling)', '4022381237208', 0, 2.99, 1, 1, NULL, 0, '250581', 'Polenta (Maisgrieß), demeter glutenfrei', 'Polenta ist eine italienische Spezialität aus Mais, die auch in anderen mediterranen Ländern sehr beliebt ist. Hergestellt wird sie aus einer Maissorte, die unsere Partnerlandwirte in Italien und Österreich anbauen. Das Korn wird dort auch zu diesem Maisgrieß vermahlen.', 'Spielberger GmbH', 'Spielberger Mühle', 'Deutschland', '20eed08f-a445-4b9b-898f-692032e287a9', 'manager', '2021-08-12 11:59:02', 'System', '2023-12-02 02:07:08', 153, 496, 2, NULL, 0, 1.86, 'Weiling', 0, NULL, 0, 64, 'Maisgrieß** **aus biodynamischer Erzeugung', '2022-09-30 00:00:34', 760, 'PASTA_CEREALS_LEGUMES', 'PANTRY', 510, 19, 'VEGAN;VEGETARIAN;GLUTENFREE;RAWFOOD', NULL, NULL),
(268, 'Dinkelgrieß, demeter (Weiling)', '4022381232203', 0, 2.89, 1, 1, NULL, 0, '250801', 'Dinkelgrieß, demeter', 'Dinkelgrieß wird bei der Vermahlung des Dinkelkorns abgesiebt. Unser Dinkelgrieß ist ein vollwertiges Produkt, da er Teile der wertvollen Schale und des Keimlings enthält.', 'Spielberger GmbH', 'Spielberger Mühle', 'Deutschland', 'ddd3f374-0422-46ad-afdf-d233fa055c21', 'manager', '2021-08-12 11:59:11', 'System', '2024-01-18 02:07:01', 154, 497, 2, NULL, 0, 1.75, 'Weiling', 0, NULL, 0, 64, 'DINKELgrieß** (eine Ur-Weizenart) **aus biodynamischer Erzeugung', '2022-04-30 00:00:37', 760, 'PASTA_CEREALS_LEGUMES', 'PANTRY', 508.2, 19, 'VEGAN;VEGETARIAN;RAWFOOD', NULL, NULL),
(269, 'Maismehl glutenfrei, demeter (Weiling)', '4022381236201', 0, 2.99, 1, 1, NULL, 0, '250805', 'Maismehl glutenfrei, demeter', 'Maismehl ist vor allem in der mexikanischen Küche bekannt, wo es z.B. für die typischen Tortillas verwendet wird. Der Mais für unser Maismehl wird von Partnerlandwirte in Italien und Österreich angebaut. Das Korn wird dort zu diesem Mehl vermahlen.\nMaismehl ist eine wichtige Zutat in der glutenfreien Küche. Zusammen mit Stärke und einem Bindemittel stellt es eine Alternative zu sonstigen Backmehlen dar.', 'Spielberger GmbH', 'Spielberger Mühle', 'AUSTRIA', '43846443-c723-474d-9280-af7ad382db45', 'manager', '2021-08-12 11:59:19', 'System', '2023-12-02 02:07:22', 155, 498, 2, NULL, 0, 1.86, 'Weiling', 0, NULL, 0, 64, 'Maismehl** **aus biodynamischer Erzeugung', '2023-11-22 02:06:43', 760, 'BAKING_INGREDIENTS', 'PANTRY', 510, 19, 'VEGAN;VEGETARIAN;GLUTENFREE;RAWFOOD', NULL, NULL),
(270, 'Biofix Brokkoli-Gratin (Weiling)', '4260133141018', 0, 1.99, 1, 1, NULL, 0, '260656', 'Biofix Brokkoli-Gratin', 'Würzig, schmatzig und ausgewogen mit viel mineralstoffreichem Brokkoli plus Nudeln, Sahne und Käse. Die einfache Vorbereitung und die Zubereitung im Backofen erlauben noch eine kleine Pause vor einem genussvollen Mahl.', 'Beltane Naturkost GmbH', 'Beltane', 'GERMANY', '5ddef472-f9b6-41f4-8223-bae00abb2fa9', 'manager', '2021-08-12 11:59:28', 'System', '2023-01-16 17:38:16', 156, 499, 0, NULL, 0, 1.17, 'Weiling', 0, NULL, 0, 63, 'Würzmischung 1 zum Anbraten: \nSteinsalz, Pfeffer*, Koriander*, Roh-Rohrzucker*, Kümmel*, Knoblauch*, Kurkuma*, Majoran*, Lorbeer*\nWürzmischung 2 zum Garen: \nSteinsalz, Reismehl*, Kartoffelstärke*, Zwiebeln*, Tomaten*, SELLERIE*, Paprika*, Petersilie*, Pfeffer*, Schnittlauch*, Liebstöckel*, SENF*, Sojasauce* (SOJABOHNEN*, Maltodextrin*, Salz), Sonnenblumenöl*, Muskatnuss*, Trennmittel: Siliciumdioxid *aus kontrolliert ökologischer Erzeugung', '2022-11-29 15:50:23', 259.875, 'CONVENIENCE_PRESERVES;SPICES_COOKING_HELP', 'PANTRY', 40, 16.5, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE;PALMOILFREE', NULL, NULL),
(271, 'Biofix Chili con Carne (Weiling)', '4260133141049', 0, 1.99, 1, 1, NULL, 0, '260662', 'Biofix Chili con Carne', 'Hausrezept versus Beltane biofix Chili con Carne! Das ist ein spannender Versuch. Super schnell und kräftig würzig, dafür kann Beltane schon mal stehen. Sicher ist der Schärfegrad beweglich zu betrachten, da kann wer will noch nachlegen.', 'Beltane Naturkost GmbH', 'Beltane', 'GERMANY', 'b29ca3e0-d5e6-4421-bcbf-5a91feee8767', 'manager', '2021-08-12 11:59:37', 'System', '2023-01-16 17:38:24', 157, 500, 0, NULL, 0, 1.17, 'Weiling', 0, NULL, 0, 63, 'Würzmischung 1 zum Anbraten: \nSteinsalz, Koriander*, Knoblauch*, Kümmel*, Kreuzkümmel*, Oregano*, Bohnenkraut*, Chili*, Lorbeer*\nWürzmischung 2 zum Garen: \nRoh-Rohrzucker*, Paprika*, Zwiebeln*, Steinsalz, Reismehl*, Kartoffelstärke*, Pfeffer*, Petersilie*, Kurkuma*, Sonnenblumenöl* *aus kontrolliert ökologischer Erzeugung', '2022-11-29 15:50:26', 259.875, 'CONVENIENCE_PRESERVES;SPICES_COOKING_HELP', 'PANTRY', 45, 16.5, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE;PALMOILFREE', NULL, NULL),
(272, 'Biofix Paprika Hähnchen (Weiling)', '4260133141063', 0, 1.99, 1, 1, NULL, 0, '260666', 'Biofix Paprika Hähnchen', 'Dieses mild würziges Gulasch mit Paprika und Rahm aus der traditionellen ungarischen Küche schmeckt der ganzen Familie. Die cremige Sauce passt bestens zu den beliebten Beilagen. So steht das Essen fast schneller auf dem Tisch als dieser gedeckt werden kann.', 'Beltane Naturkost GmbH', 'Beltane', 'GERMANY', '517a92a5-a802-4120-8a44-0d47195fa57c', 'manager', '2021-08-12 11:59:45', 'System', '2023-01-16 17:38:31', 158, 501, 0, NULL, 0, 1.17, 'Weiling', 0, NULL, 0, 63, 'Würzmischung 1 zum Anbraten: \nSteinsalz, Knoblauch*, Koriander*, Paprika*, Pfeffer*, Kümmel*, Muskatblüte*, Lorbeer*, Chili*, Zimt*\nWürzmischung 2 zum Garen: \nReismehl*, Kartoffelstärke*, Zwiebeln*, Steinsalz, Paprika*, Roh-Rohrzucker*, SELLERIE*, Petersilie*, Pfeffer*, Sonnenblumenöl* *aus kontrolliert ökologischer Erzeugung', '2022-11-29 15:50:38', 259.875, 'CONVENIENCE_PRESERVES;SPICES_COOKING_HELP', 'PANTRY', 36, 16.5, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE;PALMOILFREE', NULL, NULL),
(273, 'Biofix Gyros (Weiling)', '4260133141100', 0, 1.99, 1, 1, NULL, 0, '260674', 'Biofix Gyros', 'Die griechische Küche hat einen internationalen Star: Gyros. Mit Beltane Biofix Gros gelingt der griechische Klassiker im Schnelldurchlauf in der Pfanne. Paprika und Zwiebeln ergänzen das knusprig gebratene Geflügel perfekt und bringen eine frische Note mit. Mit einem Joghurt-Zitronen Dipp und Fladenbrot – ein griechisches Gedicht.', 'Beltane Naturkost GmbH', 'Beltane', 'GERMANY', '12fa9ad1-d99d-49ac-b64b-394265c6c81d', 'manager', '2021-08-12 11:59:54', 'System', '2023-01-16 17:38:39', 159, 502, 0, NULL, 0, 1.17, 'Weiling', 0, NULL, 0, 63, 'Würzmischung 1 zum Anbraten: \nKnoblauch*, Steinsalz, Koriander*, Oregano*, Paprika*, Kreuzkümmel*, Pfeffer*, Thymian*, Lorbeer*, Chili*, Zimt*\nWürzmischung 2 zum Garen: \nSteinsalz, Tomaten*, Zwiebeln*, Reismehl*, Kartoffelstärke*, Paprika*, SELLERIE*, Roh-Rohrzucker*, Karotten*, Pfeffer*, Majoran*, Petersilie*, Sonnenblumenöl*, Säuerungsmittel: Zitronensäure, Trennmittel: Siliciumdioxid *aus kontrolliert ökologischer Erzeugung', '2022-11-29 15:50:31', 259.875, 'CONVENIENCE_PRESERVES;SPICES_COOKING_HELP', 'PANTRY', 34, 16.5, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE;PALMOILFREE', NULL, NULL),
(274, 'Biofix Spaghetti Bolognese (Weiling)', '4260133141131', 0, 1.99, 1, 1, NULL, 0, '260680', 'Biofix Spaghetti Bolognese', 'Pasta geht immer – und immer schnell. Praktischerweise köchelt die Sauce auf dem Herd maximal so lang wie die Pasta im Salzwasser. Beim Anbraten von Hackfleisch oder Sojaschnetzel mit Beltane Biofix Spaghetti Bolognese duftet die Küche von der ersten Minute an nach Italien. Und so schmeckt es auch – nach Kräuter, Tomate und einfach lecker.', 'Beltane Naturkost GmbH', 'Beltane', 'GERMANY', '578e1e3a-f1fb-49b0-a554-e5935494fcd4', 'manager', '2021-08-12 12:00:03', 'System', '2023-01-16 17:38:47', 160, 503, 0, NULL, 0, 1.17, 'Weiling', 0, NULL, 0, 63, 'Würzmischung 1 zum Anbraten: \nSteinsalz, Knoblauch*, Koriander*, Oregano*, Bohnenkraut*, Rosmarin*, Zimt*\nWürzmischung 2 zum Garen: \nSteinsalz, Reismehl*, Roh-Rohrzucker*, Zwiebeln*, Kartoffelstärke*, Paprika*, SELLERIE*, Karotten*, Pfeffer*, Basilikum*, Liebstöckel*, Salbei*, Majoran*, Sonnenblumenöl*, Trennmittel: Siliciumdioxid *aus kontrolliert ökologischer Erzeugung', '2022-11-29 15:50:42', 259.875, 'CONVENIENCE_PRESERVES;SPICES_COOKING_HELP', 'PANTRY', 44, 16.5, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE;PALMOILFREE', NULL, NULL),
(275, 'Biofix Lachsgratin (Weiling)', '4260133141162', 0, 1.99, 1, 1, NULL, 0, '260682', 'Biofix Lachsgratin', 'Ausgewogen und erfrischend leicht kommt das Lachsfilet mit fruchtigem Gemüse nach kurzer Zeit aus dem Ofen. Die eine Würzmischung ist für den Fisch, die andere fürs Gemüse. Die Filets werden vor dem Garen gewürzt, das Gemüse umschmeichelt eine frische Sahnesauce. Sospielt Beltane Biofix Lachsgratin perfekt im Duo.', 'Beltane Naturkost GmbH', 'Beltane', 'GERMANY', 'e82f5d21-14cb-4a81-ab9b-fdf539cead42', 'manager', '2021-08-12 12:00:11', 'System', '2023-01-16 17:38:55', 161, 504, 0, NULL, 0, 1.17, 'Weiling', 0, NULL, 0, 63, 'Würzmischung 1 zum Anbraten: \nSteinsalz, Koriander*, Knoblauch*, Pfeffer*, Roh-Rohrzucker*, Rosmarin*, Kümmel*, Säuerungsmittel: Zitronensäure, Kurkuma*, Lorbeer*, Thymian*\nWürzmischung 2 zum Garen: \nSteinsalz, Reismehl*, Kartoffelstärke*, Tomaten*, Zwiebeln*, SELLERIE*, Paprika*, Karotten*, Sojasauce* (SOJABOHNEN*, Maltodextrin*, Salz), Schnittlauch*, Petersilie*, Liebstöckel*, Kurkuma*, Majoran*, Dill*, Muskatnuss*, Sonnenblumenöl*, Trennmittel: Siliciumdioxid, Zitronenöl* *aus kontrolliert ökologischer Erzeugung', '2022-11-29 15:50:34', 259.875, 'CONVENIENCE_PRESERVES;SPICES_COOKING_HELP', 'PANTRY', 35, 16.5, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE;PALMOILFREE', NULL, NULL),
(276, 'Biofix Gulasch (Weiling)', '4260133141148', 0, 1.79, 1, 1, NULL, 0, '260696', 'Biofix Gulasch', 'Welches Fleisch bei einem Original-Gulasch in den Topf gehört? Da nehmen es die Ungarn nicht so genau. Von Schwein über Rind bis hin zu Lamm ist alles möglich. In einer Hinsicht solltest du bei der Zubereitung allerdings keine Kompromisse eingehen: bei der landestypischen Würze. Zwiebeln, Paprika, Knoblauch, Koriander, Chili, Nelken und Muskatblüte dürfen keinesfalls fehlen. Mit seinem Biofix für Gulasch gibt dir Beltane genau diese und noch viel mehr Kräuter und Gewürze fein aufeinander abgestimmt an die Hand und liefert damit die Garantie für ein gelungenes Schmorgericht. Gesund, lecker und einfach in der Zubereitung – mit 100% natürlichen Zutaten.', 'Beltane Naturkost GmbH', 'Beltane', 'GERMANY', '27af2057-a654-4f4b-91e8-f5170c47983b', 'manager', '2021-08-12 12:00:19', 'System', '2022-04-11 14:55:50', 162, 505, 0, NULL, 0, 1.12, 'Weiling', 0, NULL, 0, NULL, NULL, '2022-04-11 14:55:50', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL),
(277, 'Aglio e Olio  Mediterrane Küche (Weiling)', '4012346169002', 0, 3.29, 1, 1, NULL, 0, '260548', 'Aglio e Olio  Mediterrane Küche', 'Aglio e olio. Knoblauch und Öl. Damit sind die wichtigsten Zutaten für den italienischen Klassiker auch schon genannt. Wir steuern noch Tomate und mediterrane Kräuter wie Basilikum und Thymian bei. Sie benötigen nur Spaghetti und gutes Öl –  für italienisches Flair sorgt diese Gewürzmischung ganz allein.', 'Ulrich Walter GmbH', 'LEBENSBAUM', 'Diepholz, Niedersachsen', '026356fa-4f17-4818-9254-1372c5ec1df3', 'correction', '2021-09-08 18:03:49', 'System', '2023-01-16 17:38:57', 164, 138, 0, NULL, 0, 1.88, 'Weiling', 2, 1, 0, 60, NULL, '2022-12-19 23:59:05', 269.5, 'SPICES_COOKING_HELP', 'PANTRY', 43, 14, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(278, 'Thai-Küche (Weiling)', '4012346168906', 0, 3.29, 1, 1, NULL, 0, '260552', 'Thai-Küche', 'Mit dieser Mischung wird es typisch Thai. Gekonnt verbindet unsere Thai Küche die charakteristischen Aromen der südostasiatischen Kochtradition: Chili, Ingwer und Galgant sorgen für angenehme Schärfe, Zitronengras und Limette bringen herrliche Frische. Khõ hai dja! Oder: Guten Appetit!', 'Ulrich Walter GmbH', 'LEBENSBAUM', 'Diepholz, Niedersachsen', '4a4d22f4-8d49-465f-9063-7386448e43f5', 'correction', '2021-09-08 18:33:28', 'System', '2023-01-16 17:38:59', 165, 185, 0, NULL, 0, 1.88, 'Weiling', 2, 1, 0, 60, NULL, '2022-11-29 15:35:47', 269.5, 'SPICES_COOKING_HELP', 'PANTRY', 53, 14, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(279, 'Gartenkräuter (Weiling)', '4012346155203', 0, 3.29, 1, 1, NULL, 0, '260553', 'Gartenkräuter', 'Kräftig-würzig und wunderbar vielfältig: Würzen Sie Suppen, Soßen und Salate, als hätten Sie sich in einem bunten Kräutergarten nach Herzenslust bedient!', 'Ulrich Walter GmbH', 'LEBENSBAUM', 'Diepholz, Niedersachsen', '27ce33cc-2e59-45bf-889d-49f66a9b213b', 'correction', '2021-09-08 18:08:37', 'System', '2023-01-16 17:39:02', 166, 150, 0, NULL, 0, 1.88, 'Weiling', 2, 1, 0, 60, NULL, '2022-11-29 15:12:57', 269.5, 'SPICES_COOKING_HELP', 'PANTRY', 33, 14, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(280, 'Grill- und Pfannengewürz (Weiling)', '4012346158907', 0, 3.29, 1, 1, NULL, 0, '260554', 'Grill- und Pfannengewürz', 'Das Grill- und Pfannengewürz schmeckt würzig, pikant. Würzen oder marinieren Sie Fleisch, Fisch, Tofu und Gemüse mit dieser Gewürzmischung.', 'Ulrich Walter GmbH', 'LEBENSBAUM', 'Diepholz, Niedersachsen', '4c1defe4-71d6-4e74-84c2-c14a0224f574', 'correction', '2021-09-08 18:09:34', 'System', '2023-01-16 17:39:04', 167, 152, 0, NULL, 0, 1.88, 'Weiling', 2, 1, 0, 60, NULL, '2022-11-29 16:18:31', 269.5, 'SPICES_COOKING_HELP', 'PANTRY', 53, 14, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(281, 'Italienische Küche (Weiling)', '4012346153209', 0, 3.29, 1, 1, NULL, 0, '260555', 'Italienische Küche', 'Feinwürziger Geschmack mit pikanter Chili- und leichter Knoblauchnote: Öffnen Sie die Packung und schwelgen Sie im Duft des letzten Urlaubs.', 'Ulrich Walter GmbH', 'LEBENSBAUM', 'Diepholz, Niedersachsen', '559f2229-9f3c-4103-813d-dcc313332b74', 'correction', '2021-09-08 18:10:51', 'System', '2023-01-16 17:39:06', 168, 154, 0, NULL, 0, 1.88, 'Weiling', 2, 1, 0, 60, NULL, '2022-11-29 15:23:29', 269.5, 'SPICES_COOKING_HELP', 'PANTRY', 38, 14, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(282, 'Kräuter der Provence (Weiling)', '4012346155302', 0, 2.99, 1, 1, NULL, 0, '260556', 'Kräuter der Provence', 'Kräftiger, herb würziger Geschmack, bei dem Rosmarin und Thymian den Ton angeben: Lassen Sie sich vom südfranzösischen Flair dieser Mischung verzaubern.', 'Ulrich Walter GmbH', 'LEBENSBAUM', 'Diepholz, Niedersachsen', '9e8a1de6-d6cf-4364-ad17-49c6a5b3340f', 'correction', '2021-09-08 18:11:58', 'System', '2023-01-16 17:39:09', 169, 157, 0, NULL, 0, 1.76, 'Weiling', 2, 1, 0, 60, NULL, '2022-11-29 15:12:30', 269.5, 'SPICES_COOKING_HELP', 'PANTRY', 33, 14, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(283, 'Pizzagewürz (Weiling)', '4012346159201', 0, 3.29, 1, 1, NULL, 0, '260573', 'Pizzagewürz', 'Das Pizzagewürz vereint mediterrane Kräuter und aromatisches Gemüse. Passend für die Lieblingspizza - und Pasta- wie Tomatengerichte.', 'Ulrich Walter GmbH', 'LEBENSBAUM', 'Diepholz, Niedersachsen', '9edaf786-9b6c-4660-9f9f-5fd6fa855b94', 'correction', '2021-09-08 18:26:22', 'System', '2023-01-16 17:39:11', 170, 171, 0, NULL, 0, 1.88, 'Weiling', 2, 1, 0, 60, NULL, '2022-11-29 15:29:59', 269.5, 'SPICES_COOKING_HELP', 'PANTRY', 33, 14, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(284, 'Salatgewürz (Weiling)', '4012346153308', 0, 2.99, 1, 1, NULL, 0, '260584', 'Salatgewürz', 'Unser Salatgewürz schmeckt aromatisch-frisch und hat eine feine Dillnote. Die sommerliche Gartenmischung wird durch süße Pastinaken raffiniert ergänzt. Mit Essig und Öl oder Joghurt kreieren Sie Dressings und Dips in wenigen Minuten.', 'Ulrich Walter GmbH', 'LEBENSBAUM', 'Diepholz, Niedersachsen', 'ccdf9950-5a91-47db-ae29-84e092c91767', 'correction', '2021-09-08 18:29:51', 'System', '2023-01-16 17:39:13', 171, 179, 0, NULL, 0, 1.76, 'Weiling', 2, 1, 0, 60, NULL, '2022-11-29 15:31:19', 269.5, 'SPICES_COOKING_HELP', 'PANTRY', 43, 14, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(285, 'Tomaten-Gewürzsalz (Weiling)', '4012346160504', 0, 3.29, 1, 1, NULL, 0, '260594', 'Tomaten-Gewürzsalz', 'Süße Zwiebel, fruchtige Paprika, duftender Bärlauch – in unserem groben Tomaten-Gewürzsalz haben Sie alle beisammen. Ob Frühstückspause oder Abendbrot – auch eine schlichte Mahlzeit verdient große Würze.', 'Ulrich Walter GmbH', 'LEBENSBAUM', 'Diepholz, Niedersachsen', 'dd2722d7-c014-48f5-bfd9-640ce9cb46c4', 'correction', '2021-09-08 18:14:14', 'System', '2024-02-14 02:11:08', 172, 160, 2, NULL, 0, 1.88, 'Weiling', 2, 1, 0, 60, NULL, '2022-11-29 15:36:19', 363, 'SPICES_COOKING_HELP', 'PANTRY', 197.2, 12, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(286, 'Curry klassisch (Weiling)', '4012346159706', 0, 3.49, 1, 1, NULL, 0, '269004', 'Curry klassisch', 'Der würzige Geschmack des Curry klassisch mit seiner sanften Schärfe passt gut zu dunklem Fleisch und klassischer Currywurst.', 'Ulrich Walter GmbH', 'LEBENSBAUM', 'Diepholz, Niedersachsen', '86a17f78-f417-4fce-ad05-5f301230340c', 'correction', '2021-09-08 18:05:48', 'System', '2023-01-16 17:39:18', 173, 143, 0, NULL, 0, 2.05, 'Weiling', 2, 1, 0, 60, NULL, '2022-04-11 14:56:33', 269.5, 'SPICES_COOKING_HELP', 'PANTRY', 53, 14, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(287, 'Brotgewürz, gemahlen (Weiling)', '4012346154404', 0, 2.79, 1, 1, NULL, 0, '390124', 'Brotgewürz, gemahlen', 'Die süß-pikante Mischung Brotgewürz verleiht auch Weißkohlgerichten eine raffinierte Note. Sie verbreitet ihren würzigen Duft schon beim Backen. Dosierungstipp für Brote: 1 geh. TL auf 500 g Mehl.', 'Ulrich Walter GmbH', 'LEBENSBAUM', 'Diepholz, Niedersachsen', '75c1b9c7-be22-4dfc-954e-1f827612ad6d', 'correction', '2021-09-08 18:04:12', 'System', '2023-01-16 17:39:19', 174, 139, 0, NULL, 0, 1.58, 'Weiling', 2, 1, 0, 60, NULL, '2022-11-29 15:16:06', 269.5, 'SPICES_COOKING_HELP', 'PANTRY', 53, 14, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(288, 'Café de Paris (Weiling)', '4012346166902', 0, 3.79, 1, 1, NULL, 0, '390136', 'Café de Paris', 'Die raffiniert abgeschmeckte Butter ist stets das i-Tüpfelchen auf dem Steak. Mit ihrer fruchtigen Note begleitet die Gewürzmischung ebenso gekonnt Fisch, Geflügel, Gemüse oder Gratins.', 'Ulrich Walter GmbH', 'LEBENSBAUM', 'Diepholz, Niedersachsen', '3ab62d81-30d2-4e20-a384-e9b2485bd1ce', 'correction', '2021-09-08 18:07:24', 'System', '2023-01-16 17:39:21', 175, 147, 0, NULL, 0, 2.17, 'Weiling', 2, 1, 0, 60, NULL, '2022-11-29 15:16:35', 269.5, 'SPICES_COOKING_HELP', 'PANTRY', 53, 14, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(289, 'Zwiebeln rot & weiß (Weiling)', '4012346165608', 0, 3.29, 1, 1, NULL, 0, '390138', 'Zwiebeln rot & weiß', 'Mit unseren roten und weißen Zwiebeln verleihen Sie herzhaften Gerichten köstliche Röstaromen. Fein geschnitten, schonend getrocknet und mit einer fruchtigen Süße geben sie auch Dips oder Kräuterbutter – nicht nur optisch – den letzten Schliff.', 'Ulrich Walter GmbH', 'LEBENSBAUM', 'Diepholz, Niedersachsen', 'd9607e50-edb9-4429-ab62-1b80383af6b3', 'correction', '2021-09-08 18:36:52', 'System', '2023-01-16 17:39:23', 176, 189, 0, NULL, 0, 1.88, 'Weiling', 2, 1, 0, 60, NULL, '2022-11-29 15:40:08', 269.5, 'SPICES_COOKING_HELP', 'PANTRY', 58, 14, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE;PALMOILFREE', NULL, NULL),
(290, 'Geschnetzeltes (Weiling)', '4012346174808', 0, 1.59, 1, 1, NULL, 0, '390142', 'Geschnetzeltes', 'Für Geschnetzeltes mit Champignons. Hausmannskost, zubereitet in wenigen Minuten. Mit dieser fein abgestimmten Würzmischung mit Bärlauch, Liebstock und Muskat sind Sie nur wenige Handgriffe vom Klassiker unter den Pfannengerichten entfernt. Rote Röstzwiebel und Limette runden den cremigen Geschmack gekonnt ab.', 'Ulrich Walter GmbH', 'LEBENSBAUM', 'Diepholz, Niedersachsen', '4906eba0-8f5c-48be-9973-3d976700015b', 'correction', '2021-09-08 18:01:42', 'System', '2023-12-14 02:15:09', 177, 133, 0, NULL, 0, 0.89, 'Weiling', 2, 1, 0, 60, NULL, '2022-11-29 15:20:59', 82.5, 'CONVENIENCE_PRESERVES;SPICES_COOKING_HELP', 'PANTRY', 31.7, 16.5, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(291, 'Lasagne (Weiling)', '4012346174600', 0, 1.59, 1, 1, NULL, 0, '390146', 'Lasagne', 'Für Lasagne im Handumdrehen. Lasagne  wenn es schnell \ngehen soll? Ja, warum denn nicht? Mit unserer Würzmischung rund um Basilikum, Rosmarin und Thymian, raffiniert abgeschmeckt mit Muskat, gelingt Ihnen dieser Klassiker schnell und köstlich. Sie benötigen nur noch wenige Zutaten, den Rest übernimmt der Backofen.', 'Ulrich Walter GmbH', 'LEBENSBAUM', 'Diepholz, Niedersachsen', '37580101-76f5-4308-91f9-2187354495df', 'correction', '2021-09-08 18:02:13', 'System', '2024-02-15 02:10:50', 178, 134, 0, NULL, 0, 0.89, 'Weiling', 2, 1, 0, 60, NULL, '2022-11-29 15:27:00', 82.5, 'CONVENIENCE_PRESERVES;SPICES_COOKING_HELP', 'PANTRY', 51, 16.5, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(292, 'Nudelauflauf (Weiling)', '4012346174709', 0, 1.59, 1, 1, NULL, 0, '390148', 'Nudelauflauf', 'Für Auflauf mit Nudeln und Erbsen. Was Sie für dieses  Lieblingsessen brauchen, haben Sie wahrscheinlich bereits zu Hause. Unsere Würzmischung verbindet Ihre Zutaten mit fruchtiger Tomate, aromatischen Kräutern und gerösteten roten Zwiebeln. So gelingt ein raffinierter Auflauf im Handumdrehen.', 'Ulrich Walter GmbH', 'LEBENSBAUM', 'Diepholz, Niedersachsen', '19e0f45c-1ab1-421c-8141-913a009cbeed', 'correction', '2021-09-08 18:02:40', 'System', '2024-02-15 02:08:55', 179, 135, 0, NULL, 0, 0.89, 'Weiling', 2, 1, 0, 60, NULL, '2022-11-29 15:28:39', 82.5, 'CONVENIENCE_PRESERVES;SPICES_COOKING_HELP', 'PANTRY', 43.7, 16.5, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(293, 'Ofenkartoffeln (Weiling)', '4012346174303', 0, 1.59, 1, 1, NULL, 0, '390150', 'Ofenkartoffeln', 'Unsere Ofenkartoffeln sind so einfach wie lecker. Kartoffeln schneiden, mit etwas Öl und unserer Würzmischung in den Ofen schieben, abwarten, fertig. Für die wenigen Handgriffe wird man mit goldgelben, würzigen Ofenkartoffeln mit feiner Rosmarinnote belohnt.', 'Ulrich Walter GmbH', 'LEBENSBAUM', 'Diepholz, Niedersachsen', '2853f694-e6c3-4a28-8eab-7bea0c913057', 'correction', '2021-09-08 18:03:03', 'System', '2024-02-15 02:09:53', 180, 136, 0, NULL, 0, 0.89, 'Weiling', 2, 1, 0, 60, NULL, '2022-11-29 15:28:49', 82.5, 'CONVENIENCE_PRESERVES;SPICES_COOKING_HELP', 'PANTRY', 18.7, 16.5, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(294, 'BIO Pfifferlinge á 20 g (Weiling)', '4260261492044', 0, 4.99, 1, 1, NULL, 0, '260220', 'BIO Pfifferlinge á 20 g', 'Der vielseitige Pfifferling – auch Eierschwamm oder Rehling genannt - ist bereits seit Jahrhunderten einer der beliebtesten Speisepilze überhaupt. Aufgrund seines aromatischen, würzigen Geschmacks passt er hervorragend zu Wildgerichten sowie zahlreichen Beilagen, Soßen- und Suppenkompositionen. Pfifferlinge sind reich an Vitaminen und Mineralstoffen. Besonders hervorzuheben ist hierbei der hohe Gehalt an lebensnotwendigem Eisen (57,6 mg/100 g Trockenmasse Pilz) sowie an Magnesium (135 mg/100 g Trockenmasse Pilz). Der gelb-orange gefärbte Pfifferling ist in Europa zwar weit verbreitet, in den letzten Jahrzehnten ist er jedoch immer seltener zu finden und ist daher in einigen Ländern bereits als gefährdet eingestuft.', 'Pilze Wohlrab GmbH & Co. KG', 'Pilze Wohlrab', 'BOSNIA_AND_HERZEGOVINA', '287a2033-a19c-4a99-844f-9c25c63e7d4d', 'manager', '2021-08-12 12:03:49', 'System', '2022-04-11 14:00:28', 1156, 1466, 0, NULL, 0, 2.99, 'Weiling', 0, NULL, 0, NULL, NULL, '2022-11-29 16:45:15', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL);
