(295, 'BIO Steinpilze á 20 g (Weiling)', '4260261492013', 0, 4.99, 1, 1, NULL, 0, '260224', 'BIO Steinpilze á 20 g', 'Der Steinpilz – auch Fichtensteinpilz, Herrenpilz oder Edelpilz genannt - ist ein überaus begehrter und beliebter Speisepilz und wird nicht ohne Grund als „König der Pilze“ bezeichnet. Er verfügt über ein ganz besonderes Pilzaroma, einen leicht nussartigen Geschmack und ein angenehm bissfestes Fleisch. Steinpilze enthalten unter anderem B-Vitamine (Thiamin, Riboflavin, Pantothensäure, Folsäure), Niacin, Vitamin C und die wertvollen Mineralstoffe Kalium, Phosphor, Zink, Eisen und Calcium. \nSteinpilze sind Mykorrhizapilze und können nicht gezüchtet werden und die Verfügbarkeit frischer Steinpilze variiert sehr stark. Hier sind getrocknete Steinpilze eine echte Alternative. Der Steinpilz behält auch nach dem Trocknen sein einzigartiges Aroma sowie seine helle Farbe. Die Pilze von Pilze Wohlrab werden von erfahrenen Pilzsammlern in streng kontrollierten Wäldern gesammelt. Die Pilze werden in Scheiben geschnitten und schonend luftgetrocknet. Nach dem Trocknen werden die Pilze ein weiteres Mal von Hand verlesen, um eine bestmögliche Qualität sicherzustellen. Die Steinpilze von Pilze Wohlrab sind ökologisch erzeugt sowie Bio-zertifiziert und tragen das Bio-Siegel (Öko-Kontrollstelle: DE-ÖKO-006).', 'Pilze Wohlrab GmbH & Co. KG', 'Pilze Wohlrab', 'BOSNIA_AND_HERZEGOVINA', 'b0bfc492-80eb-4528-8eb9-d48d70c0e50f', 'manager', '2021-08-12 12:03:58', 'System', '2023-09-30 00:00:12', 980, 1467, 0, NULL, 0, 2.99, 'Weiling', 0, NULL, 0, NULL, NULL, '2022-11-29 16:59:47', NULL, 'OTHER', NULL, NULL, NULL, NULL, NULL, NULL),
