(309, 'Gourmet Kaffee, entkoffeiniert, gemahlen (Weiling)', '4012346454702', 0, 6.99, 1, 1, NULL, 0, '350123', 'Gourmet Kaffee, entkoffeiniert, gemahlen', 'Sanft und mit vollem Aroma - für unseren entkoffeinierten Gourmet Kaffee verwenden wir ausschließlich Bio-Arabica-Bohnen aus dem peruanischen Hochland. In Höhenlagen von über 1.000 Metern, natürlich geschützt unter Schattenbäumen, reift der Kaffee langsam heran und entwickelt so sein einzigartiges Aroma. Vor Ort wählen wir die erlesenen Qualitäten aus und überzeugen uns von der exzellenten Arbeit unserer Lieferanten.', 'Ulrich Walter GmbH', 'LEBENSBAUM', 'Bio-Arabica-Bohnen aus dem peruanischen Hochland', '64aea459-5fe6-4724-8dd5-eaedf1cbddf0', 'correction', '2021-10-02 02:07:42', 'System', '2023-06-26 10:08:16', 189, 221, NULL, NULL, 0, 5.07, 'Weiling', 2, 1, 0, 60, NULL, '2022-09-10 00:04:56', 1064.25, 'COFFEE', 'COFFEE_TEA_COCOA', 257, 21.5, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
