(314, 'Kakao, alkalisiert (Weiling)', '4024297467489', 0, 2.69, 1, 1, NULL, 0, '350320', 'Kakao, alkalisiert', 'Dieser Kakao besitzt im Vergleich zu stark entöltem Kakao (11 % Kakaobutter) einen höheren Kakaobutteranteil (21 % Kakaobutter) und hat dadurch einen besonders runden, vollmundigen Geschmack. Das Pulver löst sich sowohl in warmer als auch in kalter Milch wunderbar auf.', 'Naturata AG', 'NATURATA', 'GERMANY', '29dd5608-4964-48c8-9f87-4795ff75095a', 'manager', '2021-08-12 12:07:20', 'System', '2024-01-19 02:06:07', 1542, 521, 0, 1, 0, 1.62, 'Weiling', 0, NULL, 0, 60, 'Kakaopulver*, Säureregulator: Kaliumcarbonat. *aus kontrolliert biologischem Anbau.', '2023-05-23 09:42:30', 462.4, 'BAKING_INGREDIENTS', 'PANTRY', 141, 13.6, 'VEGAN;VEGETARIAN', NULL, NULL),
(315, 'Getreidekaffee zum Filtern (Weiling)', '4024297440420', 0, 5.49, 1, 1, NULL, 0, '350551', 'Getreidekaffee zum Filtern', 'Kräftiges Aroma ganz ohne Koffein: Wer auf Koffein verzichten will, für den ist der Naturata Getreidekaffee genau das Richtige. Da er kein Koffein und deutlich weniger Gerbstoffe enthält als Bohnenkaffee, kann er zu jeder Tageszeit genossen werden. Die hochwertig abgestimmte Rezeptur sorgt für einen vollmundigen Geschmack. Der besondere Kick im Getreidekaffee: Die leichte Süße von Feigen rundet die Komposition harmonisch ab. Ein köstliches Getränk für genussvolle Momente!', 'Naturata AG', 'NATURATA', 'SWITZERLAND', 'ee911b38-3a47-484a-9621-957455589521', 'manager', '2021-08-12 12:07:30', 'System', '2023-12-17 03:12:49', 194, 522, 2, NULL, 0, 3.74, 'Weiling', 0, NULL, 0, 297, 'ROGGEN**, Zichorien**, GERSTE**, Eicheln*, Feigen** *aus kontrolliert ökologischer Erzeugung **aus biodynamischer Erzeugung', '2022-04-11 15:51:43', 1500, 'COCOA_COFFEE_ALTERNATIVES', 'COFFEE_TEA_COCOA', 505, 25, 'VEGAN;VEGETARIAN', NULL, NULL),
