(318, 'Espresso ganze Bohne (Weiling)', '4035626103589', 0, 15.99, 1, 1, NULL, 0, '350257', 'Espresso ganze Bohne', 'Ausgewählte Arabica- und Robusta-Kaffeebohnen aus biologischem Anbau sind die Basis für den köstlichen bioladen*Espresso - ganze Bohne. Eine Röstung italienischer Art mit aromatischem Charakter. Erleben Sie einen einzigartigen Espresso-Moment mit satter Crema und edlem Duft frisch gemahlener Bohnen. Alle bioladen*Kaffees zeichnen sich durch 100% Bio-Anbau, strengste Qualitätskontrollen und faire Partnerschaften aus. (60% Arabica und 40% Robusta)', 'Weiling GmbH', 'bioladen', 'GERMANY', 'adb76106-d9e9-4f48-ac85-378ca0f27f5b', 'manager', '2021-08-12 12:08:05', 'System', '2023-12-16 02:06:40', 197, 525, 0, NULL, 0, 13.37, 'Weiling', 0, NULL, 0, 60, NULL, '2022-11-10 00:03:45', 3328, 'COFFEE', 'COFFEE_TEA_COCOA', 1016, 32, 'VEGAN;VEGETARIAN', NULL, NULL),
