(321, 'Bio-Müsli Babymüsli (Weiling)', '7640104951261', 0, 3.69, 1, 1, NULL, 0, '374250', 'Bio-Müsli Babymüsli', 'Babys allererstes Müslis bietet Vielfalt zum Frühstück mit verschiedenen Getreide- und Fruchtsorten in 100% Bioqualität. Für eine abwechslungsreiche Ernährung von Anfang an.\n\nVerwendbar als Getreide-Milchbrei, milchfreier Brei, Brei mit Obst.', 'Holle baby food AG', 'Holle ', 'GERMANY', 'c020a7aa-5a94-4595-bcc3-b4e4baddda99', 'manager', '2021-08-12 12:08:41', 'System', '2024-02-07 02:10:37', 200, 528, 2, NULL, 0, 2.42, 'Weiling', 0, NULL, 0, 60, 'WEIZENVOLLKORNFLOCKEN** 82 %, HAFERVOLLKORNFLOCKEN**\n8 %, Bananenfruchtpulver*\n5,5 %, Himbeerflocken* 2,5 % (Himbeerpüree*, WEIZENMEHL*),\nApfelstücke* 2 %, Thiamin (Vitamin B1,\nvitaminiert laut Gesetz) * aus biologischer Landwirtschaft ** Demeter (aus biodynamischer Landwirtschaft) Kann Spuren von SOJA enthalten.', '2022-10-22 02:05:55', 1500, 'BABY_FOOD', 'BABY', 295, 20, 'LACTOSEFREE', NULL, NULL),
(322, 'Bio-Vollkorngetreidebrei Hirse (Weiling)', '7640161872448', 0, 3.49, 1, 1, NULL, 0, '374275', 'Bio-Vollkorngetreidebrei Hirse', 'Einer unserer Top-Seller unter dem Getreidebreien!\n\nDie Natur hat Hirse geschaffen: ein glutenfreies Getreide, ideal für erste Babybreie. Am Anfang der Beikost ist Babys Verdauung noch etwas empfindlich. Glutenfreie Breie sind für den Einstieg in die Getreidewelt ideal. Indem löffelweise glutenhaltiges Getreide zugefügt wird, kann Baby nach und nach ganz pur schmecken lernen.\n\nVerwendbar als Getreide-Milchbrei, milchfreier Brei und Getreide-Obst-Brei.', 'Holle Europe GmbH', 'Holle ', 'GERMANY', '858a2a84-f6da-4890-9f66-129da9771ad6', 'manager', '2021-08-12 12:08:51', 'System', '2024-02-07 02:09:18', 201, 529, 0, NULL, 0, 2.29, 'Weiling', 0, NULL, 0, 60, 'Hirsevollkornmehl* 100 %, Thiamin (Vitamin B1, vitaminiert laut Gesetz) *aus biologischer Landwirtschaft Kann Spuren von SENF enthalten.', '2023-11-24 02:06:05', 1500, 'BABY_FOOD', 'BABY', 295, 20, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
