(330, 'Brokkoli mit Reis (Weiling)', '7640104954910', 0, 1.49, 1, 1, NULL, 0, '374319', 'Brokkoli mit Reis', 'Das Babygläschen Brokkoli mit Reis eignet sich besonders für die weitere Beikosteinführung und zur Zubereitung der ersten Menüs, um neue Zutaten kennen zu lernen. Der Gemüsebrei ist fein püriert und nur beste Bio- und Demeter-Zutaten aus streng kontrolliertem Anbau werden für die Holle Gläschen verwendet.', 'Holle baby food AG', 'Holle ', 'GERMANY', 'b5d2477a-9437-4d86-8fb0-21d1e6bdae65', 'manager', '2021-08-12 12:10:04', 'System', '2024-02-07 02:10:26', 209, 537, 2, NULL, 0, 0.77, 'Weiling', 0, NULL, 0, 61, 'Brokkoli** 50%, Wasser, Reisgrieß* 6% *aus biologischer Landwirtschaft, **Demeter (aus biodynamischer Landwirtschaft, demeter-Gesamtanteil 89 %)', '2022-10-22 02:05:32', 295.869, 'BABY_FOOD', 'BABY', 310.7, 9.8, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
