(332, 'Birne pur (Weiling)', '7640104956235', 0, 1.19, 1, 1, NULL, 0, '374325', 'Birne pur', 'Hier steckt Frucht drin. 100 % pure Früchte für ein pures Geschmackerlebnis. Das feine Püree des Babygläschens schmeckt super als Nachspeise oder als eine Zwischenmahlzeit.', 'Holle baby food AG', 'Holle ', 'GERMANY', 'cc8ce3f7-78e2-4e12-a82d-37a99743f070', 'manager', '2021-08-12 12:10:22', 'System', '2024-02-07 02:10:41', 211, 538, 2, NULL, 0, 0.67, 'Weiling', 0, NULL, 0, 61, 'Birne** 100 % ** Demeter (aus biodynamischer Landwirtschaft)', '2022-10-22 02:06:02', 214.354, 'BABY_FOOD', 'BABY', 212, 7.1, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(333, 'Hühnchenfleisch (Weiling)', '7640104952695', 0, 1.99, 1, 1, NULL, 0, '374333', 'Hühnchenfleisch', 'Das allererste Fleisch. Das Babygläschen ist ideal für die Zubereitung des ersten Gemüsebreies mit Fleisch. Das feine Püree des Holle Gläschens lässt sich einfach in den Brei unterrühren. Von den Fachgesellschaften für Kinderernährung wird mind.  5 mal die Woche Fleisch für den Gemüse-Kartoffel-Fleisch-Brei empfohlen.', 'Holle baby food AG', 'Holle ', 'GERMANY', 'eefdf5e5-ea57-47fe-9b64-ebae8f8419c4', 'manager', '2021-08-12 12:10:30', 'System', '2024-02-07 02:11:16', 212, 539, 0, NULL, 0, 1.25, 'Weiling', 0, NULL, 0, 61, 'Wasser, Hühnerfleisch* 40 %, Stärke*. *aus biologischer Landwirtschaft.', '2022-10-22 02:06:24', 214.354, 'BABY_FOOD', 'BABY', 212, 7.1, 'GLUTENFREE;LACTOSEFREE', NULL, NULL),
(334, 'Karotten, Kartoffeln & Rind (Weiling)', '7640104957256', 0, 1.59, 1, 1, NULL, 0, '374380', 'Karotten, Kartoffeln & Rind', 'Von A wie Apfel bis Z wie Zucchini. Ausgewogen, vielseitig und abwechslungsreich beginnt das Beikostalter mit den Holle Gläschen.', 'Holle baby food AG', 'Holle ', 'GERMANY', '99948c0d-f7c1-469a-a78b-5bf9256b67db', 'manager', '2021-08-12 12:10:39', 'System', '2022-10-22 02:05:08', 213, 540, 2, NULL, 0, 0.97, 'Weiling', 0, NULL, 0, NULL, 'Karotte** 42 %, Kartoffel** 24 %, Wasser,\nRindfleisch** 8 %. **Demeter (aus biodynamischer Landwirtschaft).', '2022-10-22 02:05:08', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL),
(335, 'Spinat mit Kartoffeln (Weiling)', '7640104957478', 0, 1.29, 1, 1, NULL, 0, '374386', 'Spinat mit Kartoffeln', 'Das Babygläschen Spinat mit Kartoffeln eignet sich besonders für die weitere Beikosteinführung und zur Zubereitung der ersten Menüs, um neue Zutaten kennen zu lernen. Der pure Gemüsebrei ist fein püriert und nur beste Bio- und Demeter-Zutaten aus streng kontrolliertem Anbau werden für die Holle Gläschen verwendet.', 'Holle baby food AG', 'Holle ', 'GERMANY', '3465e79c-ce23-4f0d-b334-87c34cee43a5', 'manager', '2021-08-12 12:10:47', 'System', '2024-02-07 02:08:07', 214, 541, 0, NULL, 0, 0.72, 'Weiling', 0, NULL, 0, 61, 'Wasser, Spinat** 23 %, Kartoffeln** 15 %,\nReisgrieß* *aus biologischer Landwirtschaft, **Demeter (aus biodynamischer Landwirtschaft)', '2022-10-22 02:04:00', 295.869, 'BABY_FOOD', 'BABY', 310, 9.8, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(336, 'Spaghetti Bolognese (Weiling)', '7640104957393', 0, 1.99, 1, 1, NULL, 0, '374402', 'Spaghetti Bolognese', 'Von A wie Apfel bis Z wie Zucchini. Ausgewogen, vielseitig und abwechslungsreich beginnt das Beikostalter mit den Holle Gläschen.', 'Holle baby food AG', 'Holle', 'GERMANY', '5c2b4b06-2ecf-4394-85c6-9b55f2dff7fb', 'manager', '2021-08-12 12:10:55', 'manager', '2023-02-27 11:11:41', 215, 542, NULL, NULL, 0, 1.15, 'Weiling', 0, NULL, 0, NULL, 'Wasser, Gemüse 36,7%: (Tomatenmark** 18,7%, Karotte**16%, Lauch** 2%), Rindfleisch** 8%, Reisgrieß*3,5%, WEIZENSPAGHETTI* 3,3% *aus biologischer Landwirtschaft, **Demeter (aus biodynamischer Landwirtschaft, demeter-Gesamtanteil 86,8 %). Kann Spuren von Ei enthalten.', '2023-02-27 11:11:41', 415.152, 'CONVENIENCE_PRESERVES;BABY_FOOD', 'PANTRY;BABY', NULL, 10.8, NULL, NULL, NULL),
(337, 'Red Bee - Pouchy Apfel, Erdbeere (Weiling)', '7640161877009', 0, 1.29, 1, 1, NULL, 0, '374622', 'Red Bee - Pouchy Apfel, Erdbeere', 'Hier steckt Frucht drin. Die abwechslungsreichen aber einfach gehaltenen Rezepturen der Quetschies bieten ein pures Geschmackserlebnis aus\n100% Fruchtpüree. Ideal als Nachtisch, zur Zubereitung von Beikost oder für zwischendurch und unterwegs. Die Quetschies werden schonend hergestellt, wodurch der natürliche Geschmack erhalten bleibt.', 'Holle baby food AG', 'Holle ', 'ITALY', '978e321b-56be-4862-baeb-294367ec55d0', 'manager', '2021-08-12 12:11:15', 'System', '2024-02-07 02:09:42', 216, 543, 2, NULL, 0, 0.75, 'Weiling', 0, NULL, 0, 107, 'Apfel** 90%, Erdbeere** 10%. **Demeter (aus biodynamischer Landwirtschaft)', '2022-11-29 16:47:16', 393.75, 'BABY_FOOD', 'BABY', 107, 15, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(338, 'Panda Peach (Weiling)', '7640161877085', 0, 1.29, 1, 1, NULL, 0, '374626', 'Panda Peach', 'Eine super Kombination aus Getreide und Früchten. Die abwechslungsreichen aber einfach gehaltenen Rezepturen der Quetschies bieten ein pures Geschmackserlebnis aus wertvollem Getreide und feinem Fruchtpüree. Ideal als Nachtisch, zur Zubereitung von Beikost oder für Zwischendurch und unterwegs. Die Quetschies werden schonend hergestellt, wodurch der natürliche Geschmack erhalten bleibt.', 'Holle baby food AG', 'Holle ', 'ITALY', 'acc327da-7caf-449e-b224-5c25aa2e2d61', 'manager', '2021-08-12 12:11:23', 'System', '2024-02-07 02:10:06', 217, 544, 2, NULL, 0, 0.75, 'Weiling', 0, NULL, 0, 107, 'Pfirsich** 40%, Banane** 33%, Aprikose** 25%, DINKELWEIZEN** 2% **Demeter (aus biodynamischer Landwirtschaft)', '2022-11-29 16:47:13', 393.75, 'BABY_FOOD', 'BABY', 107, 15, 'VEGAN;VEGETARIAN;LACTOSEFREE', NULL, NULL),
(339, 'Apple Ant - Pouchy Apfel & Banane mit Birne (Weiling)', '7640161877238', 0, 1.29, 1, 1, NULL, 0, '374630', 'Apple Ant - Pouchy Apfel & Banane mit Birne', 'Hier steckt Frucht drin. Die abwechslungsreichen aber einfach gehaltenen Rezepturen der Quetschies bieten ein pures Geschmackserlebnis aus \n100% Fruchtpüree. Ideal als Nachtisch, zur Zubereitung von Beikost oder für zwischendurch und unterwegs. Die Quetschies werden schonend hergestellt, wodurch der natürliche Geschmack erhalten bleibt.', 'Holle baby food AG', 'Holle ', 'ITALY', 'd1758f1d-74ce-4558-b7b9-1aca0e4eabe9', 'manager', '2021-08-12 12:11:32', 'System', '2024-02-07 02:10:46', 218, 545, 2, NULL, 0, 0.75, 'Weiling', 0, NULL, 0, 107, 'Apfel** 60%, Banane** 20%, Birne** 20% **Demeter (aus biodynamischer Landwirtschaft)', '2023-01-30 15:33:27', 393.75, 'CONVENIENCE_PRESERVES;SWEETS;BABY_FOOD', 'PANTRY;SNACKS;BABY', 107, 15, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(340, 'Byodo Premium Meersalz, feinkörnig (Weiling)', '4018462160374', 0, 2.29, 1, 1, NULL, 0, '261404', 'Byodo Premium Meersalz, feinkörnig', 'Das feinkörnige Premium Meersalz von Byodo ist absolut rein und wird aus den Salzgärten in Australien und Bonaire gewonnen - fern ab von Industrie. Das Salz ist qualitativ sehr hochwertig, da die Abbauregionen vollständig von industriellen oder verschmutzenden Aktivitäten abgeschottet sind und größtenteils in Naturschutzgebieten liegen. Damit eignet es sich toll zum Kochen & Würzen. Das reinweiße Salz ist frei von Rieselhilfsstoffen und sonstigen Zusätzen wie z.B. Jod.', 'Byodo Naturkost GmbH', 'Byodo', 'AUSTRALIA', '15b934ff-f3e5-46a5-b61f-ac5000313964', 'manager', '2021-08-12 12:11:42', 'System', '2023-11-23 02:07:16', 219, 546, NULL, NULL, 0, 1.47, 'Weiling', 0, NULL, 0, NULL, 'Meersalz feinkörnig', '2022-11-29 15:44:44', 1080, 'SPICES_COOKING_HELP', 'PANTRY', 1005, 20, 'VEGAN;VEGETARIAN;RAWFOOD;KOSCHER;HALAL;WITHOUT_ADDED_SUGAR', NULL, NULL),
(341, 'Kräutersalz (Weiling)', '4012346147109', 0, 4.29, 1, 1, NULL, 0, '260560', 'Kräutersalz', 'Unser Kräutersalz ist seit über 20 Jahren ein milder Alleskönner - von Frühstücksei bis Möhrensuppe. Eine bunte Vielfalt von 12 Kräutern und Gemüsen leistet hier ihren unverzichtbaren Beitrag zur herzhaften Küche.', 'Ulrich Walter GmbH', 'LEBENSBAUM', 'Diepholz, Niedersachsen', '6d1daaa9-c5d1-4d0c-a99e-1f753cf62011', 'correction', '2021-09-08 18:03:25', 'System', '2023-01-16 17:43:35', 220, 137, 2, NULL, 0, 2.47, 'Weiling', 2, 1, 0, 60, NULL, '2022-11-29 15:26:29', 528, 'SPICES_COOKING_HELP', 'PANTRY', 504, 11, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(342, 'Anis, gemahlen (Weiling)', '4012346128603', 0, 1.49, 1, 1, NULL, 0, '390106', 'Anis, gemahlen', 'Würzig-süß sind die Früchte der Anispflanze. Der weiße Doldenblütler stammt ursprünglich aus dem Mittelmeerraum. Seine kleinen braunen Samen entfalten ein intensives Aroma mit Lakritznote - besonders geeignet zum Veredeln von Kompott, Fischgerichten und würzigem Brotteig. Seit über 3.500 Jahren ist Anis bereits in Europa bekannt und beliebt. Und schon Pythagoras schätzte nicht nur Philosophie und rechtwinklige Dreiecke, sondern auch mit Anis gewürztes Brot.', 'Ulrich Walter GmbH', 'LEBENSBAUM', 'Diepholz, Niedersachsen', '3841b6a5-cd59-429c-b411-24c0d7221e3a', 'correction', '2021-09-08 18:16:37', 'System', '2023-12-14 02:20:44', 221, 164, 0, NULL, 0, 0.89, 'Weiling', 2, 1, 0, 60, NULL, '2022-09-10 00:01:56', 42, 'SPICES_COOKING_HELP', 'PANTRY', 10.2, 10.5, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(343, 'Kardamom, gemahlen (Weiling)', '4012346128702', 0, 1.79, 1, 1, NULL, 0, '390108', 'Kardamom, gemahlen', 'Süß und aromatisch schmecken Kardamomsamen. Sie wachsen in grünen Kapseln, die kurz vor der Reife von Hand geerntet werden. Mit Kardamom geben Sie Brot und Kuchen ein ganz besonderes Aroma. \nDavon ist auch ganz Skandinavien überzeugt. Vor allem die Finnen und Schweden können sich süßes Gebäck ohne Kardamom kaum vorstellen. Aber auch Liköre oder Lebkuchen ergänzt er gut mit seinem würzigen Geschmack.', 'Ulrich Walter GmbH', 'LEBENSBAUM', 'Diepholz, Niedersachsen', '3ea3c37b-6564-4fe2-a081-8be0dd1607da', 'correction', '2021-09-08 18:16:13', 'System', '2023-12-14 02:23:25', 222, 163, 0, NULL, 0, 1.17, 'Weiling', 2, 1, 0, 60, NULL, '2022-04-11 14:34:38', 42, 'SPICES_COOKING_HELP', 'PANTRY', 10.2, 10.5, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(344, 'Sternanis, ganz (Weiling)', '4012346157801', 0, 2.99, 1, 1, NULL, 0, '390109', 'Sternanis, ganz', 'Sternanis hat einen kräftigen Anisgeschmack – perfekt fürs Weihnachtsgebäck oder zu herzhaften Soßen. Das Aroma steckt vor allem in den Samenschalen. Für ein milderes Aroma dürfen Sie sich ruhig einen Zacken abbrechen.', 'Ulrich Walter GmbH', 'LEBENSBAUM', 'Diepholz, Niedersachsen', '168f81aa-7f58-438a-971d-ad50c16feff7', 'correction', '2021-09-08 18:30:13', 'System', '2023-01-16 17:43:40', 223, 180, 0, NULL, 0, 1.76, 'Weiling', 2, 1, 0, 60, NULL, '2022-04-11 14:34:40', 269.5, 'SPICES_COOKING_HELP', 'PANTRY', 21, 14, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(345, 'Nelken, gemahlen (Weiling)', '4012346128801', 0, 1.59, 1, 1, NULL, 0, '390110', 'Nelken, gemahlen', 'Der Geschmack von Nelken verbindet Süßes mit Pfeffrigem. Dadurch passen sie ebenso zu Kompott und Gebäck wie zu Herzhaftem. Egal für welches Gericht Sie sich entscheiden, nur sparsam verwendet, bringen Nelken wahren Genuss.\nBekannt sind die würzigen Nelken in Europa bereits seit dem Mittelalter. Sie kamen mit Handelsschiffen von exotischen Inseln. Damals wie heute steckt in den kleinen unscheinbaren Blütenknospen viel Arbeit – von hohen ausladenden Bäumen werden sie geerntet und sorgfältig per Hand verlesen.', 'Ulrich Walter GmbH', 'LEBENSBAUM', 'Diepholz, Niedersachsen', '95c66855-19e4-4f6a-9db6-c918e3018412', 'correction', '2021-09-08 18:15:47', 'System', '2023-12-14 02:20:54', 224, 162, 0, NULL, 0, 0.89, 'Weiling', 2, 1, 0, 60, NULL, '2022-11-29 15:28:21', 42, 'SPICES_COOKING_HELP', 'PANTRY', 10.2, 10.5, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(346, 'Bärlauch (Weiling)', '4012346153506', 0, 2.49, 1, 1, NULL, 0, '390116', 'Bärlauch', 'In europäischen Wäldern heimisch, kann Bärlauch im Frühjahr große, duftende Teppiche bilden. Genießen Sie dieses Frühlingsgefühl das ganze Jahr. Das milde Knoblaucharoma des Bärlauchs passt gut zu Dips, Suppen und Soßen.', 'Ulrich Walter GmbH', 'LEBENSBAUM', 'Diepholz, Niedersachsen', 'e601b887-ea29-4dbb-83ad-9f775b627a2e', 'correction', '2021-09-08 18:04:35', 'System', '2023-01-16 17:43:45', 225, 140, 0, NULL, 0, 1.35, 'Weiling', 2, 1, 0, 60, NULL, '2022-11-29 15:14:37', 269.5, 'SPICES_COOKING_HELP', 'PANTRY', 18, 14, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(347, 'Piment, gemahlen (Weiling)', '4012346157702', 0, 2.79, 1, 1, NULL, 0, '390122', 'Piment, gemahlen', 'Piment wird auch Nelkenpfeffer genannt, weil es nach Nelken und Pfeffer schmeckt. Das Gewürz verfeinert Chutneys, pikante Süßspeisen und Weihnachtsgebäck. Auch Ihrer herzhaften Kürbissuppe können Sie mit Piment eine besondere Note verleihen.', 'Ulrich Walter GmbH', 'LEBENSBAUM', 'Diepholz, Niedersachsen', '4844666d-6a72-418b-a2d7-0a9a707eb254', 'correction', '2021-09-08 18:29:07', 'System', '2023-01-16 17:43:46', 226, 177, 0, NULL, 0, 1.58, 'Weiling', 2, 1, 0, 60, NULL, '2022-11-29 15:29:52', 269.5, 'SPICES_COOKING_HELP', 'PANTRY', 43, 14, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(348, 'Schwarzkümmel, ganz (Weiling)', '4012346156903', 0, 2.79, 1, 1, NULL, 0, '390126', 'Schwarzkümmel, ganz', 'Schwarzkümmel, auch Nigella genannt, schmeckt aromatisch und leicht pfeffrig. In der Türkei wird Schwarzkümmel für Fladenbrote verwendet, in Nordindien würzt er Gemüsecurrys. Rösten Sie ihn kurz an, dann entfaltet er sein würziges Aroma.', 'Ulrich Walter GmbH', 'LEBENSBAUM', 'GERMANY', 'bad36c31-0f53-4878-a9b0-7458e30bc8c2', 'manager', '2021-08-12 12:12:55', 'System', '2023-01-16 17:43:48', 227, 547, 2, NULL, 0, 1.58, 'Weiling', 0, NULL, 0, 60, 'Schwarzkümmel** **aus biodynamischer Erzeugung', '2022-11-29 15:33:42', 269.5, 'SPICES_COOKING_HELP', 'PANTRY', 53, 14, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(349, 'Basilikum (Weiling)', '4012346154503', 0, 2.49, 1, 1, NULL, 0, '390404', 'Basilikum', 'Basilikum hat einen süß-würzigen Geschmack, der aus der italienischen Küche nicht mehr wegzudenken ist. Was wäre eine Tomatensoße ohne Basilikum? Verwenden Sie es auch zu herzhaftem Omelette oder Pilzgerichten - aber bitte immer erst gegen Ende der Garzeit dazugeben, weil Basilikum sonst an Aroma verliert.', 'Ulrich Walter GmbH', 'LEBENSBAUM', 'Diepholz, Niedersachsen', '82a6c212-31d5-4ec8-ba89-2a5649bf5bc5', 'correction', '2021-09-08 18:04:59', 'System', '2023-01-16 17:43:49', 228, 141, 2, NULL, 0, 1.35, 'Weiling', 2, 1, 0, 60, NULL, '2022-11-29 15:15:08', 269.5, 'SPICES_COOKING_HELP', 'PANTRY', 18, 14, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(350, 'Bohnenkraut (Weiling)', '4012346154602', 0, 2.79, 1, 1, NULL, 0, '390705', 'Bohnenkraut', 'Schon der Name legt nahe, dass sich das aromatisch duftende Bohnenkraut als Begleiter von Hülsenfrüchten empfiehlt. Aber es kann mehr! Runden Sie mit seiner pfeffrigen Schärfe, die sich beim Kochen abmildert, auch Suppen, Fisch- und Fleischgerichte köstlich ab.', 'Ulrich Walter GmbH', 'LEBENSBAUM', 'Diepholz, Niedersachsen', '7731af55-2b08-4507-9246-a4e733adda3c', 'correction', '2021-09-08 18:05:24', 'System', '2023-01-16 17:43:52', 229, 142, 0, NULL, 0, 1.64, 'Weiling', 2, 1, 0, 60, NULL, '2022-11-29 15:15:43', 269.5, 'SPICES_COOKING_HELP', 'PANTRY', 28, 14, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(351, 'Cayennepfeffer, gemahlen (Weiling)', '4012346157009', 0, 3.49, 1, 1, NULL, 0, '391106', 'Cayennepfeffer, gemahlen', 'Cayennepfeffer besteht aus fein gemahlenen Chilis. Er verfügt über eine intensive Schärfe, mit der Sie jedes Gericht anfeuern können. Doch aufgepasst - schon eine kleine Messerspitze würzt Bohnen, Fleisch und Pastasoßen intensiv.', 'Ulrich Walter GmbH', 'LEBENSBAUM', 'Diepholz, Niedersachsen', '283bc24b-43f0-4d06-9b8e-e07920bfa9e5', 'correction', '2021-09-08 18:06:32', 'System', '2023-01-16 17:43:54', 230, 145, 0, NULL, 0, 1.94, 'Weiling', 2, 1, 0, 60, NULL, '2022-11-29 15:16:48', 269.5, 'SPICES_COOKING_HELP', 'PANTRY', 53, 14, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(352, 'Dillspitzen (Weiling)', '4012346154701', 0, 2.79, 1, 1, NULL, 0, '391126', 'Dillspitzen', 'Unsere zarten Dillspitzen schmecken besonders frisch-aromatisch. Seit Jahrhunderten ist Dill in ganz Mitteleuropa beliebt und aus Fischgerichten oder Großmutters Gurkensalat nicht mehr wegzudenken. Setzen Sie diese Tradition fort.', 'Ulrich Walter GmbH', 'LEBENSBAUM', 'Diepholz, Niedersachsen', '2008cee5-f628-456b-9a8f-312cfc22cb92', 'correction', '2021-09-08 18:07:49', 'System', '2023-01-16 17:43:55', 231, 148, 0, NULL, 0, 1.58, 'Weiling', 2, 1, 0, 60, NULL, '2022-11-29 15:18:13', 269.5, 'SPICES_COOKING_HELP', 'PANTRY', 18, 14, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(353, 'Ingwer, gemahlen (Weiling)', '4012346156507', 0, 2.59, 1, 1, NULL, 0, '391205', 'Ingwer, gemahlen', 'Ingwer hat einen wärmend scharfen Geschmack mit leicht fruchtiger Note. Die Wurzelknolle der tropischen Staude ist ein weltweit beliebtes Gewürz. Verfeinern Sie spritzig frische und winterlich wärmende Gerichte mit diesem außergewöhnlichen Gewürz.', 'Ulrich Walter GmbH', 'LEBENSBAUM', 'Diepholz, Niedersachsen', 'e079956d-e47c-4d53-8cee-ec8aaa6b088b', 'correction', '2021-09-08 18:10:27', 'System', '2023-01-16 17:43:57', 232, 153, 0, NULL, 0, 1.47, 'Weiling', 2, 1, 0, 60, NULL, '2022-11-29 15:22:56', 269.5, 'SPICES_COOKING_HELP', 'PANTRY', 43, 14, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(354, 'Estragon (Weiling)', '4012346153407', 0, 2.99, 1, 1, NULL, 0, '391207', 'Estragon', 'Estragon hat einen süßlich-aromatischen Geschmack mit feiner Anisnote. Der Klassiker der französischen Haute Cuisine verfeinert cremige Soßen wie Sauce béarnaise sowie Fisch- und Geflügelgerichte.', 'Ulrich Walter GmbH', 'LEBENSBAUM', 'Diepholz, Niedersachsen', '974b692f-b15c-4a26-9f98-15e4478b3abf', 'correction', '2021-09-08 18:08:14', 'System', '2023-01-16 17:43:59', 234, 149, 2, NULL, 0, 1.65, 'Weiling', 2, 1, 0, 60, NULL, '2022-09-10 00:03:02', 269.5, 'SPICES_COOKING_HELP', 'PANTRY', 18, 14, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(355, 'Kümmel, gemahlen (Weiling)', '4012346155708', 0, 1.79, 1, 1, NULL, 0, '391959', 'Kümmel, gemahlen', 'Kümmel hat ein warmes, erdiges Aroma, das hervorragend zu herzhaftem Gebäck und Sauerteigbrot passt. Deftige Kohl- und Schmorgerichte lassen sich mit etwas Kümmel raffiniert abrunden. Genießen Sie seine besondere Note aber auch in Soßen und Gemüsesuppen.', 'Ulrich Walter GmbH', 'LEBENSBAUM', 'Diepholz, Niedersachsen', '33af4e85-468c-4cea-86c8-29f6f95ef2ca', 'correction', '2021-09-08 18:12:22', 'System', '2023-01-16 17:44:01', 235, 158, 0, NULL, 0, 1, 'Weiling', 2, 1, 0, 60, NULL, '2022-11-29 15:11:51', 269.5, 'SPICES_COOKING_HELP', 'PANTRY', 43, 14, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(356, 'Kurkuma (Gelbwurz), gemahlen (Weiling)', '4012346157108', 0, 2.79, 1, 1, NULL, 0, '391964', 'Kurkuma (Gelbwurz), gemahlen', 'Das mild würzige, leicht herbe Kurkuma ist in Indien seit über 4.000 Jahren bekannt und die Hauptzutat von Currypulver. Geben Sie es  Reisgerichten, Chutneys und Soßen zeitig bei – dann entfaltet es sein warmes Aroma und sein intensives Gelb.', 'Ulrich Walter GmbH', 'LEBENSBAUM', 'Diepholz, Niedersachsen', '10eef98b-9953-4db5-adaa-a43a314a92b0', 'correction', '2021-09-08 18:16:59', 'System', '2023-07-31 00:03:16', 236, 165, 0, NULL, 0, 1.58, 'Weiling', 2, 1, 0, 60, NULL, '2022-11-29 15:26:46', 269.5, 'SPICES_COOKING_HELP', 'PANTRY', 53, 14, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(357, 'Lorbeerblätter (Weiling)', '4012346156101', 0, 2.59, 1, 1, NULL, 0, '392211', 'Lorbeerblätter', 'Lorbeerblätter entfalten ihr würziges Aroma sehr langsam. Sie krönen nicht nur Olympiasieger, sondern auch Eintöpfe und Braten, in denen sie lange mitgaren können. Verwenden Sie das edle Blatt sparsam und entfernen Sie es vor dem Servieren.', 'Ulrich Walter GmbH', 'LEBENSBAUM', 'Diepholz, Niedersachsen', '8fe73c52-a4e6-42ac-ae0e-09e6ec5d1a82', 'correction', '2021-09-08 18:17:30', 'System', '2023-01-16 17:44:06', 237, 166, 0, NULL, 0, 1.47, 'Weiling', 2, 1, 0, 60, NULL, '2022-11-29 15:27:29', 269.5, 'SPICES_COOKING_HELP', 'PANTRY', 8, 14, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(358, 'Majoran (Weiling)', '4012346153100', 0, 2.59, 1, 1, NULL, 0, '392402', 'Majoran', 'Majoran schmeckt würzig und leicht süßlich. Wurstkraut wird es mitunter genannt, weil es deftige Hausmannskost perfekt abrundet. Aber vertrauen Sie diesem wunderbaren Kraut ruhig auch ein pfiffiges  Risotto, herzhaftes Kartoffelgericht oder edles Ragout an.', 'Ulrich Walter GmbH', 'LEBENSBAUM', 'Diepholz, Niedersachsen', '27d7a0d4-b03a-4fd2-ab58-9fd379f97bb4', 'correction', '2021-09-08 18:24:00', 'System', '2023-01-16 17:44:08', 238, 167, 2, NULL, 0, 1.47, 'Weiling', 2, 1, 0, 60, NULL, '2022-11-29 15:27:40', 269.5, 'SPICES_COOKING_HELP', 'PANTRY', 15.5, 14, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(359, 'Muskatnuss, ganz (Weiling)', '4012346153704', 0, 4.19, 1, 1, NULL, 0, '392406', 'Muskatnuss, ganz', 'Muskatnuss dürfen Sie sparsam dosieren, denn sie hat einen sehr intensiven, würzig-aromatischen Geschmack. Ursprünglich nur auf wenigen indonesischen Inseln heimisch, ist Muskatnuss in der europäischen Küche heute unverzichtbar. Denken Sie nur an Kartoffelpüree oder Gemüseaufläufe.', 'Ulrich Walter GmbH', 'LEBENSBAUM', 'Diepholz, Niedersachsen', '3d3c6119-9c78-45bb-afb6-6947299f4a4b', 'correction', '2021-09-08 18:24:22', 'System', '2023-01-16 17:44:11', 239, 168, 0, NULL, 0, 2.47, 'Weiling', 2, 1, 0, 60, NULL, '2022-11-29 15:12:13', 269.5, 'SPICES_COOKING_HELP', 'PANTRY', 17, 14, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL);
