(360, 'Nelken, ganz (Weiling)', '4012346155807', 0, 2.99, 1, 1, NULL, 0, '392451', 'Nelken, ganz', 'Der Geschmack von Nelken verbindet Süßes mit Pfeffrigem. Dadurch passen sie ebenso zu Kompott und Gebäck wie zu Braten und Rotkohl. Sparsam verwendet und in ein Stück Zwiebel gesteckt, können Sie die aromatischen Knospen vor dem Servieren leicht wieder entfernen.', 'Ulrich Walter GmbH', 'LEBENSBAUM', 'Diepholz, Niedersachsen', 'b6997f85-fea5-487e-94f4-70581871ec0b', 'correction', '2021-09-08 18:24:46', 'System', '2023-01-16 17:44:13', 240, 169, 0, NULL, 0, 1.7, 'Weiling', 2, 1, 0, 60, NULL, '2022-11-29 15:28:26', 269.5, 'SPICES_COOKING_HELP', 'PANTRY', 33, 14, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(361, 'Oregano (Weiling)', '4012346153605', 0, 1.99, 1, 1, NULL, 0, '392805', 'Oregano', 'Der würzig-herbe Geschmack von Oregano passt perfekt zu Tomatensoße und Pizza. Diese Gerichte haben das Kraut weltweit bekannt gemacht. Dabei können Sie Oregano ebenso gut zu Zucchini, Grünkern und Geflügelgerichten verwenden.', 'Ulrich Walter GmbH', 'LEBENSBAUM', 'Diepholz, Niedersachsen', '8fdc6fe4-2d90-435d-8a2e-ea68f939d02a', 'correction', '2021-09-08 18:25:57', 'System', '2023-01-16 17:44:15', 241, 170, 0, NULL, 0, 1.17, 'Weiling', 2, 1, 0, 60, NULL, '2022-11-29 15:29:01', 269.5, 'SPICES_COOKING_HELP', 'PANTRY', 18, 14, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(362, 'Paprika edelsüß, gemahlen (Weiling)', '4012346157306', 0, 2.69, 1, 1, NULL, 0, '392879', 'Paprika edelsüß, gemahlen', 'Edelsüßer Paprika schmeckt fruchtig-süß und leicht pikant. Damit passt er perfekt zu Gemüse oder Geflügel und verleiht Kräuterquark und Dips ein fruchtiges i-Tüpfelchen. Genießen Sie den vollen Paprikageschmack - ohne feurige Note.', 'Ulrich Walter GmbH', 'LEBENSBAUM', 'Diepholz, Niedersachsen', '0ca34078-882e-4dc8-89b0-f990e0ae0273', 'correction', '2021-09-08 18:26:43', 'System', '2023-06-26 10:07:21', 242, 172, 0, NULL, 0, 1.64, 'Weiling', 2, 1, 0, 60, NULL, '2022-11-29 15:11:31', 269.5, 'SPICES_COOKING_HELP', 'PANTRY', 53, 14, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(363, 'Bunter Pfeffer (Weiling)', '4012346158501', 0, 3.59, 1, 1, NULL, 0, '392922', 'Bunter Pfeffer', 'Warum nur ein Pfeffer wenn man alle haben kann? Mit dieser Mischung  bringen Sie eine pikante Note auf Ihren Tisch, die Auge und Gaumen gleichermaßen erfreut.', 'Ulrich Walter GmbH', 'LEBENSBAUM', 'Diepholz, Niedersachsen', '02b1c207-d7a0-4b2e-9929-ac970a57a5cd', 'correction', '2021-09-08 18:27:55', 'System', '2023-01-16 17:44:19', 243, 174, 0, NULL, 0, 2.06, 'Weiling', 2, 1, 0, 60, NULL, '2023-04-26 13:10:21', 269.5, 'SPICES_COOKING_HELP', 'PANTRY', 53, 14, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(364, 'Schwarzer Pfeffer, gemahlen (Weiling)', '4012346153902', 0, 3.29, 1, 1, NULL, 0, '392923', 'Schwarzer Pfeffer, gemahlen', 'Dieser schwarze Pfeffer zeichnet sich durch seine aromaschonende Vermahlung aus. Von Indien kommend hat Pfeffer schon vor 2.000 Jahren Europa erreicht. Bis heute verleiht er vielen Gerichten eine pikante Grundnote.', 'Ulrich Walter GmbH', 'LEBENSBAUM', 'Diepholz, Niedersachsen', '812b4020-435b-4350-acca-4fdd241f362a', 'correction', '2021-09-08 18:28:45', 'System', '2023-06-26 10:00:10', 244, 176, 0, NULL, 0, 2.05, 'Weiling', 2, 1, 0, 60, NULL, '2022-11-29 15:33:05', 269.5, 'SPICES_COOKING_HELP', 'PANTRY', 53, 14, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(365, 'Weißer Pfeffer, gemahlen (Weiling)', '4012346157603', 0, 3.79, 1, 1, NULL, 0, '392934', 'Weißer Pfeffer, gemahlen', 'Weißer Pfeffer schmeckt aromatisch und mild scharf. Er besteht aus den hellen Kernen reifer Pfefferbeeren, die aufwändig von ihrem Fruchtfleisch befreit wurden. Runden Sie helle Soßen, Suppen, Fisch und Tofu mit weißem Pfeffer ab.', 'Ulrich Walter GmbH', 'LEBENSBAUM', 'Diepholz, Niedersachsen', '434d29ae-b475-4ef1-baeb-85a675e56dac', 'correction', '2021-09-08 18:28:21', 'System', '2023-01-16 17:44:24', 245, 175, 0, NULL, 0, 2.23, 'Weiling', 2, 1, 0, 60, NULL, '2022-11-29 15:05:34', 269.5, 'SPICES_COOKING_HELP', 'PANTRY', 53, 14, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(366, 'Petersilie (Weiling)', '4012346154909', 0, 2.49, 1, 1, NULL, 0, '392943', 'Petersilie', 'Petersilie hat einen charakteristisch frischen Geschmack. Seit der Antike ist sie in europäischen Küchen das Universalkraut für Suppen, Soßen, Gemüse- und Fischgerichte. Und sie hilft Ihnen auch, in Windeseile ein leckeres Salatdressing zu zaubern.', 'Ulrich Walter GmbH', 'LEBENSBAUM', 'Diepholz, Niedersachsen', 'cf0b2731-099b-46bf-ae0e-71d2a9a78fda', 'correction', '2021-09-08 18:27:26', 'System', '2023-01-16 17:44:25', 246, 173, 0, NULL, 0, 1.47, 'Weiling', 2, 1, 0, 60, NULL, '2022-11-29 15:29:29', 269.5, 'SPICES_COOKING_HELP', 'PANTRY', 18, 14, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(367, 'Knoblauch getrocknet (Weiling)', '4012346159409', 0, 3.79, 1, 1, NULL, 0, '392965', 'Knoblauch getrocknet', 'Mild-süß schmeckt unser Knoblauch. Die Germanen verehrten Knobi als mächtige Zauberpflanze. Weltweit finden ihm zu Ehren jährlich Festivals statt. Dabei wird vor allem Wert auf seinen köstlichen Geschmack gelegt – weniger auf die Zauberkraft.', 'Ulrich Walter GmbH', 'LEBENSBAUM', 'Diepholz, Niedersachsen', 'a056353c-ce81-4732-b01c-4fa20cca0969', 'correction', '2021-09-08 18:11:13', 'System', '2023-01-16 17:44:27', 247, 155, 0, NULL, 0, 2.17, 'Weiling', 2, 1, 0, 60, NULL, '2022-11-29 15:25:20', 269.5, 'SPICES_COOKING_HELP', 'PANTRY', 73, 14, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(368, 'Senfkörner (Weiling)', '4012346159508', 0, 1.99, 1, 1, NULL, 0, '392967', 'Senfkörner', 'Unser Senf hat einen mild-nussigen Geschmack, der erst nach einem Moment im Mund an Schärfe gewinnt.\nSeit über 3.000 Jahren als Gewürz bekannt, begeisterte Senf im Mittelalter Papst Johannes XXII so sehr, dass er seinen Neffen zum Senfbewahrer, Grand Moutardier du Pape, ernannte.', 'Ulrich Walter GmbH', 'LEBENSBAUM', 'Diepholz, Niedersachsen', 'd7381f0e-ff9c-4df5-8237-a0a03535f984', 'correction', '2021-09-08 18:33:04', 'System', '2023-01-16 17:44:28', 248, 184, 0, NULL, 0, 1.17, 'Weiling', 2, 1, 0, 60, NULL, '2022-09-10 00:01:11', 269.5, 'SPICES_COOKING_HELP', 'PANTRY', 83, 14, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(369, 'Rosmarin (Weiling)', '4012346155005', 0, 2.79, 1, 1, NULL, 0, '393205', 'Rosmarin', 'Die Mittelmeerküche ist ohne den kräftig-aromatischen Rosmarin mit seiner wunderbar herben Note kaum vorstellbar.  Und auch die Kombination von Kartoffeln und Rosmarin ist in aller Munde.', 'Ulrich Walter GmbH', 'LEBENSBAUM', 'Diepholz, Niedersachsen', 'ee85c75e-95b6-43b0-bc8c-d38360d9588c', 'correction', '2021-09-08 18:29:28', 'System', '2023-01-16 17:44:30', 249, 178, 0, NULL, 0, 1.58, 'Weiling', 2, 1, 0, 60, NULL, '2022-11-29 15:31:02', 269.5, 'SPICES_COOKING_HELP', 'PANTRY', 33, 14, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(370, 'Salbei Tüte (Weiling)', '4012346153001', 0, 2.69, 1, 1, NULL, 0, '393407', 'Salbei Tüte', 'Die flaumigen Blätter unseres Salbeis haben einen kräftig-würzigen Geschmack, der perfekt mit Gnocchi, Ravioli oder weißen Bohnen harmoniert. Aber auch ein Pilzomelett mit Salbeiblättern sollten Sie unbedingt einmal probieren!', 'Ulrich Walter GmbH', 'LEBENSBAUM', 'GERMANY', '0d50316c-389b-4c95-80da-e9a56dc78c16', 'manager', '2021-08-12 12:16:19', 'System', '2023-01-16 17:44:31', 250, 1782, 0, NULL, 0, 1.48, 'Weiling', 0, NULL, 0, 60, 'Salbei* *aus kontrolliert ökologischer Erzeugung', '2022-11-29 15:31:26', 269.5, 'SPICES_COOKING_HELP', 'PANTRY', 15.5, 14, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(371, 'Thymian (Weiling)', '4012346155104', 0, 2.49, 1, 1, NULL, 0, '393806', 'Thymian', 'Der unverkennbare herb-würzige Geschmack von Thymian lässt sich vielseitig kombinieren. Er passt zu mediterranen Spezialitäten wie zur deutschen Hausmannskost. Nutzen Sie ihn beim Kochen direkt zu Beginn – so entfaltet Thymian sein Aroma optimal.', 'Ulrich Walter GmbH', 'LEBENSBAUM', 'Diepholz, Niedersachsen', 'd235661f-69f8-4610-8fbe-118b2682197c', 'correction', '2021-09-08 18:34:46', 'System', '2023-01-16 17:44:33', 251, 186, 0, NULL, 0, 1.35, 'Weiling', 2, 1, 0, 60, NULL, '2022-11-29 15:36:02', 269.5, 'SPICES_COOKING_HELP', 'PANTRY', 23, 14, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(372, 'Zimt Ceylon, gemahlen (Weiling)', '4012346154206', 0, 2.99, 1, 1, NULL, 0, '393978', 'Zimt Ceylon, gemahlen', 'Ceylon-Zimt hat einen besonders feinen, aromatisch-süßen Geschmack. Es ist die einzige Sorte vom Ceylanicum-Zimtbaum. Wählen Sie dieses Gewürz, wenn Sie sich eine dezente Zimtnote wünschen, die sich mit anderen Aromen harmonisch verbindet.', 'Ulrich Walter GmbH', 'LEBENSBAUM', 'Diepholz, Niedersachsen', '54074f59-45b2-4b3b-8946-af21f85dda0d', 'correction', '2021-09-08 18:36:08', 'System', '2023-01-16 17:44:35', 252, 187, 0, NULL, 0, 1.76, 'Weiling', 2, 1, 0, 60, NULL, '2023-02-13 23:18:05', 269.5, 'SPICES_COOKING_HELP', 'PANTRY', 53, 14, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(373, 'Zimtstangen Ceylon, ganz (Weiling)', '4012346154305', 0, 2.99, 1, 1, NULL, 0, '393981', 'Zimtstangen Ceylon, ganz', 'Diese aromatisch-süßen Ceylon-Zimtstangen kommen aus Sri Lanka. Sie bestehen aus der dünnen Innenrinde des Ceylanicum-Zimtbaums, die zu feinen Stangen zusammengerollt wird. Kochen Sie Zimtstangen von Anfang an mit – so entfaltet sich ihr volles Aroma.', 'Ulrich Walter GmbH', 'LEBENSBAUM', 'Diepholz, Niedersachsen', '464003c1-820b-424c-81ef-ad8da4081737', 'correction', '2021-09-08 18:36:31', 'System', '2023-06-26 10:02:37', 253, 188, 0, NULL, 0, 1.88, 'Weiling', 2, 1, 0, 60, NULL, '2022-04-11 14:48:22', 269.5, 'SPICES_COOKING_HELP', 'PANTRY', 9, 14, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(374, 'Chili-Flocken (Weiling)', '4012346169408', 0, 2.99, 1, 1, NULL, 0, '398032', 'Chili-Flocken', 'Sehen gut aus und machen etwas scharf: Unsere Chili-Flocken geben vielen Speisen mit ihrer intensiven, fruchtigen Schärfe und ihrem leuchtenden Rot das gewisse Etwas.', 'Ulrich Walter GmbH', 'LEBENSBAUM', 'Diepholz, Niedersachsen', '1c9f11f1-f974-4d1c-b725-274d8a210ab9', 'correction', '2021-09-08 18:06:58', 'System', '2023-01-16 17:44:39', 254, 146, 0, NULL, 0, 1.76, 'Weiling', 2, 1, 0, 60, NULL, '2022-09-10 00:04:25', 269.5, 'SPICES_COOKING_HELP', 'PANTRY', 48, 14, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE;PALMOILFREE', NULL, NULL),
(375, 'Himalaja Kristallsalz, Fein; Natur Hurtig (Weiling)', '4260040174017', 0, 4.99, 1, 1, NULL, 0, '261002', 'Himalaja Kristallsalz, Fein; Natur Hurtig', 'Dieses unbehandelte Kristallsalz ist vor ca. 500 Millionen Jahren durch die Austrocknung der Urmeere entstanden und lagert heute, geschützt vor heutigen Umwelteinflüssen, in 300 - 600 m Tiefe unter der Erde.\nEs ist vollständig naturbelassen, also nicht chemisch gereinigt und enthält noch alle wertvollen Bestandteile eines Natursalzes.\nNatur Hurtig bezieht sein Kristallsalz aus dem Salt Range im Norden Pakistans. In einer der ältesten Salzminen, am Fuße des Himalaja, wird es traditionell seit über 2000 Jahren abgebaut, von Hand aussortiert, gewaschen, sonnengetrocknet und anschließend vermahlen. In Deutschland überwachen anerkannte Institute die Qualität.\nDas feingemahlene Kristallsalz eignet sich hervorragend zum Würzen von Speisen. Der milde und vollmundige Geschmack wird in Gourmetküchen weltweit geschätzt.', 'Natur Hurtig', 'Natur Hurtig', 'GERMANY', '3d9a1eae-e691-441f-a198-a1306f9c9b52', 'manager', '2021-08-12 12:17:01', 'System', '2023-09-26 02:28:55', 797, 549, NULL, NULL, 0, 3.11, 'Weiling', 0, NULL, 0, NULL, 'Speisesalz (Himalaya Kristallsalz)', '2022-11-10 00:02:21', 1363.25, 'SPICES_COOKING_HELP', 'PANTRY', 1015, 20.5, 'VEGAN;VEGETARIAN;GLUTENFREE;RAWFOOD', NULL, NULL),
(376, 'Deutsches Steinsalz, fein (Weiling)', '4260040174079', 0, 2.69, 1, 1, NULL, 0, '261018', 'Deutsches Steinsalz, fein', 'Dieses naturbelassene Steinsalz ist vor mehr als 200 Mio. Jahren durch Austrocknung der Urmeere entstanden und lagert heute, geschützt vor Umwelteinflüssen, in 400 - 750 m Tiefe unter der Erde. Es ist vollständig naturbelassen und unbehandelt, also nicht chemisch gereinigt.\nDas Steinsalz von Natur Hurtig stammt aus einem der ältesten Salzstöcke Mitteldeutschlands. Es wird bergmännisch abgebaut, in traditionellen Mahlstühlen schonend gemahlen und sorgfältig ausgesiebt. Anerkannte Institute überwachen die Qualität. Salz ist ein essentieller Grundbaustein des Lebens und übernimmt im Organismus des Menschen lebenswichtige Aufgaben.\nDas feingemahlene Steinsalz empfiehlt sich zum Würzen von Speisen, ist jedoch auch für andere Salzanwendungen geeignet, bei denen es auf naturbelassene Qualität ankommt.', 'Natur Hurtig', 'Natur Hurtig', 'GERMANY', '315631a2-4d1b-43a1-97ef-70550a2b68a4', 'manager', '2021-08-12 12:17:09', 'System', '2023-09-26 02:28:48', 607, 550, NULL, NULL, 0, 1.58, 'Weiling', 0, NULL, 0, NULL, NULL, '2023-05-09 17:43:17', 1363.25, 'SPICES_COOKING_HELP', 'PANTRY', 1015, 20.5, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE;RAWFOOD', NULL, NULL),
