(379, 'Kräutersalz in der Streudose (Weiling)', '4035626100427', 0, 2.49, 1, 1, NULL, 0, '262003', 'Kräutersalz in der Streudose', 'Das bioladen*Kräutersalz wird ohne Rieselhilfen oder sonstige Zusatzstoffe hergestellt und hat einen Anteil an Kräutern und Gemüsen von 15%.', 'Weiling GmbH', 'bioladen', 'GERMANY', '40e350ae-efd0-483d-9ac3-15d55c2284f3', 'manager', '2021-08-12 12:17:35', 'System', '2023-10-14 02:08:57', 256, 553, 0, NULL, 0, 1.43, 'Weiling', 0, NULL, 0, 67, 'Atlantik-Meersalz (85%, unraffiniert), Majoran*, Oregano* (2%), Bohnenkraut* (1,5%), Liebstöckel* (Wurzel & Blätter) , Quendel*, Lorbeer*, Koriander*, Brennnessel*, Petersilie*, Knoblauch*, Zwiebel*, Salbei*, SELLERIE*, Thymian* *aus kontrolliert ökologischer Erzeugung', '2022-07-31 00:02:29', 306.181, 'SPICES_COOKING_HELP', 'PANTRY', 142.353, 10.9, 'VEGAN;VEGETARIAN', NULL, NULL),
(380, 'Kräutersalz im Nachfüllbeutel (Weiling)', '4035626100595', 0, 4.99, 1, 1, NULL, 0, '262005', 'Kräutersalz im Nachfüllbeutel', 'Das bioladen*Kräutersalz wird ohne Rieselhilfen oder sonstige Zusatzstoffe hergestellt und hat einen Anteil an Krätuern und Gemüsen von 15%.', 'Weiling GmbH', 'bioladen', 'GERMANY', '323abfc3-ea55-4aeb-8b61-877b9d6c5362', 'manager', '2021-08-12 12:17:43', 'System', '2023-07-01 00:26:02', 257, 554, 0, NULL, 0, 2.92, 'Weiling', 0, NULL, 0, 67, 'Atlantik-Meersalz (85%, unraffiniert), Majoran*, Oregano* (2%), Bohnenkraut* (1,5%), Liebstöckel* (Wurzel & Blätter),  Quendel*, Lorbeer*, Koriander*, Brennnessel*, Petersilie*, Knoblauch*, Zwiebel*, Salbei*, SELLERIE*, Thymian* *aus kontrolliert ökologischer Erzeugung', '2022-07-12 14:20:43', 552.5, 'SPICES_COOKING_HELP', 'PANTRY', 504.35, 13, 'VEGAN;VEGETARIAN', NULL, NULL),
(381, 'Süße Träume Tee (Weiling)', '4016249183516', 0, 3.49, 1, 1, NULL, 0, '411510', 'Süße Träume Tee', 'So gut wie Schäfchen zählen. Nur leckerer. Wir haben süße Träume einfach in kleine Beutelchen verpackt: Eine entspannte Tee-Mischung aus Kamille und Salbei verfeinert mit Lavendel und Baldrian machen aus jeder Nacht eine gute Nacht. Aufgießen und Träume genießen.', 'Allos Hof-Manufaktur GmbH', 'Allos', 'UNITED_KINGDOM', 'e8a2fe2c-a645-485a-ae4c-86ef005adc13', 'manager', '2021-08-12 12:17:52', 'System', '2023-12-30 02:07:03', 258, 555, 0, NULL, 0, 2.39, 'Weiling', 0, NULL, 0, 190, 'Kamille* (33%), Salbei* (27%), Zitronenmelisse* (24%),\nZitronengras*, Zitronenverbene*, Baldrianwurzel* (2%), Lavendel* (1,5%). *aus ökologischem Landbau.', '2022-08-10 00:07:26', 795.2, 'TEA', 'COFFEE_TEA_COCOA', 73, 14.2, 'VEGAN;VEGETARIAN', NULL, NULL),
(382, 'Sommer Minze Tee (Weiling)', '4016249183578', 0, 3.49, 1, 1, NULL, 0, '411524', 'Sommer Minze Tee', 'Mit diesem Tee kann man jeden Tag Sonne tanken. Die süße Milde der Holunderblüte und die Frische der Minze lässt eine leichte Sommerbrise um die Nase wehen. Einfach Augen schließen und einen großen Schluck Sommer genießen.', 'Allos Hof-Manufaktur GmbH', 'Allos', 'UNITED_KINGDOM', 'd3761274-7ea6-4027-bc35-31226f09de24', 'manager', '2021-08-12 12:18:00', 'System', '2023-12-30 02:06:39', 259, 556, 0, NULL, 0, 2.26, 'Weiling', 0, NULL, 0, 190, 'Pfefferminze* (24%), Grüne Minze* (24%), Zitronengras* (15%),\nHolunderblüte* (12%), Zitronenverbene* (10%), Süßholzwurzel*, weißer Hibiskus*, Zitronenschale* (1%).\n\nEnthält Süßholz - bei hohem Blutdruck sollte ein übermäßiger\nVerzehr dieses Erzeugnisses vermieden werden. *aus ökologischem Landbau.', '2022-08-10 00:07:36', 795.2, 'TEA', 'COFFEE_TEA_COCOA', 73, 14.2, 'VEGAN;VEGETARIAN', NULL, NULL),
(383, 'Mein Chai Tee (Weiling)', '4016249183936', 0, 3.49, 1, 1, NULL, 0, '411536', 'Mein Chai Tee', 'Mein Chai - Sinnlichkeit in einer Tasse Tee.\n\nSüß trifft auf würzig und erfüllt dich mit wohliger Wärme. Die Tasse Tee für eine Reise ins Innere.', 'Allos Hof-Manufaktur GmbH', 'Allos', 'UNITED_KINGDOM', 'f81ed6ef-b491-46ee-8f96-01119cedc96d', 'manager', '2021-08-12 12:18:12', 'System', '2022-04-11 15:04:22', 260, 557, NULL, NULL, 0, 2.09, 'Weiling', 0, NULL, 0, NULL, NULL, '2022-04-11 15:04:22', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL),
(384, 'English Breakfast Tee (Weiling)', '4016249183950', 0, 3.49, 1, 1, NULL, 0, '411542', 'English Breakfast Tee', 'English Breakfast - Get up the Birtish way!\n\nEine starker Schwarztee, intensiv, dunkel und ein wenig rau wie die Küsten Englands. Für einen kräftigen Start in den Tag. Let\'s get it on.', 'Allos Hof-Manufaktur GmbH', 'Allos', 'UNITED_KINGDOM', 'b6388f64-a99a-4331-987d-f5349aadcef7', 'manager', '2021-08-12 12:18:21', 'System', '2021-11-11 12:22:48', 261, 558, NULL, NULL, 0, 0, 'Weiling', 0, NULL, 0, NULL, NULL, '2021-11-11 12:22:48', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL),
(385, '3 Fenchel Tee (Weiling)', '4016249183905', 0, 3.49, 1, 1, NULL, 0, '411544', '3 Fenchel Tee', 'Bio-Kräutertee mit süßem Fenchel aus 2 Anbauregionen & wildem Fenchel\nVersüßt jeden Tag. Diese bitter-süße Geschmacks-Sinfonie aus 3 Fenchel zaubert ein Lächeln ins Gesicht', 'Allos Hof-Manufaktur GmbH', 'Allos', 'UNITED_KINGDOM', 'ca9b7fde-6cbc-4db1-ab97-b5ff08b7939e', 'manager', '2021-08-12 12:18:29', 'System', '2023-12-02 02:09:44', 262, 559, 0, NULL, 0, 2.39, 'Weiling', 0, NULL, 0, 190, 'Türkischer süßer Fenchel* (50%), Ägyptischer süßer Fenchel* (30%), Wilder/Bitterer Fenchel* (20%). *aus ökologischem Landbau.', '2022-08-10 00:07:21', 795.2, 'TEA', 'COFFEE_TEA_COCOA', 83, 14.2, 'VEGAN;VEGETARIAN', NULL, NULL),
(386, 'Abendtraum® (Weiling)', '4012346000107', 0, 2.99, 1, 1, NULL, 0, '410103', 'Abendtraum®', 'Würziger Hopfen, duftender Lavendel und eine deutliche\nSalbeinote – diese kräftige Kräutermischung begleitet\nSie genussvoll in den Abend. Atmen Sie tief ein und lassen Sie den Tag hinter sich. Ein  Tee wie ein Spaziergang kurz vor Sonnenuntergang.', 'Ulrich Walter GmbH', 'LEBENSBAUM', 'Diepholz, Niedersachsen', 'babdc5dd-cba6-4ad0-89b2-c6a912553a3c', 'correction', '2021-09-08 19:04:10', 'System', '2023-11-14 02:10:28', 263, 214, 0, NULL, 0, 1.64, 'Weiling', 2, 1, 0, 60, NULL, '2022-12-19 23:43:31', 485.76, 'TEA', 'COFFEE_TEA_COCOA', 54.1, 16, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(387, 'Fencheltee TB (Weiling)', '4012346000404', 0, 1.99, 1, 1, NULL, 0, '410205', 'Fencheltee TB', 'Fenchel gehört zu den besonders milden Kräutertees. \nEr entfaltet sofort nach dem Aufgießen seinen aromatischen Duft. Passt zu jeder Stimmung und tut gut. Kurzum: ein Tee für alle Lebenslagen.', 'Ulrich Walter GmbH', 'LEBENSBAUM', 'GERMANY', '3cfd9c7d-88e9-49e5-b3fa-8b7123ff5d9f', 'manager', '2021-08-12 12:18:47', 'System', '2023-11-14 02:10:25', 264, 1783, 0, NULL, 0, 1.17, 'Weiling', 0, NULL, 0, 60, 'Fenchel* *aus kontrolliert ökologischer Erzeugung', '2022-04-11 15:04:22', 485.76, 'TEA', 'COFFEE_TEA_COCOA', 74, 16, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(388, 'Fencheltee (Weiling)', '4012346537108', 0, 4.29, 1, 1, NULL, 0, '410207', 'Fencheltee', 'Mild und dennoch unverwechselbar aromatisch schmeckt unser klassischer Fencheltee - ein Solist, der keine weiteren Zutaten braucht. Ursprünglich in Südeuropa zu Hause, ist er heute bis in den hohen Norden bekannt und beliebt. Er tut in jedem Alter, zu jeder Uhrzeit und in jeder Stimmungslage gut. Kurzum: ein typischer Wohlfühltee.', 'Ulrich Walter GmbH', 'LEBENSBAUM', 'Diepholz, Niedersachsen', '3025cb20-489e-4404-a428-453285e3e996', 'correction', '2021-09-08 18:57:33', 'System', '2023-12-14 02:22:24', 265, 203, 0, NULL, 0, 2.47, 'Weiling', 2, 1, 0, 60, NULL, '2022-11-29 15:19:39', 760, 'TEA', 'COFFEE_TEA_COCOA', 155, 19, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(389, 'Blütenkuss (Weiling)', '4012346282800', 0, 2.99, 1, 1, NULL, 0, '410237', 'Blütenkuss', 'Unser Blütenkuss ist weich und blumig-frisch. Holunder- und Lindenblüten vereinen sich mit einem Hauch Vanille zu einem außergewöhlichen Tee. Die Lindenblüten dürfen in dieser Mischung nicht fehlen, denn unter Linden wird seit jeher gern getanzt und geküsst. Beginnen Sie Ihren Tag mit einem sanften Blütenkuss auf den Lippen und lassen Sie sich von unserem besonderen Tee verzaubern.', 'Ulrich Walter GmbH', 'LEBENSBAUM', 'Diepholz, Niedersachsen', 'fde55463-820d-437b-bf95-42d12fb1797e', 'correction', '2021-09-08 19:02:38', 'System', '2023-01-16 17:45:39', 266, 213, 0, NULL, 0, 1.76, 'Weiling', 2, 1, 0, 60, NULL, '2022-04-11 15:05:29', 485.76, 'TEA', 'COFFEE_TEA_COCOA', 54.1, 16, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(390, 'Hagebutte mit Hibiskus (Weiling)', '4012346000602', 0, 2.79, 1, 1, NULL, 0, '410300', 'Hagebutte mit Hibiskus', 'Das frische Aroma von Hibiskusblüten verbindet sich mit der fruchtigen Hagebutte zu einem klassischen Erfrischungstee. \nDas schöne Rot dieses Tees erinnert an seine blumige Herkunft. Auch kalt sehr lecker.', 'Ulrich Walter GmbH', 'LEBENSBAUM', 'Diepholz, Niedersachsen', 'cbdfe03d-938e-45b0-883a-e5edd82722ec', 'correction', '2021-09-08 19:02:14', 'System', '2024-01-27 02:07:08', 267, 212, 0, NULL, 0, 1.58, 'Weiling', 2, 1, 0, 60, NULL, '2022-11-29 15:22:22', 485.76, 'TEA', 'COFFEE_TEA_COCOA', 71.7, 16, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(391, 'Hagebutte (Weiling)', '4012346260006', 0, 3.99, 1, 1, NULL, 0, '410302', 'Hagebutte', 'Die Hagebutten in unserem milden Tee schmecken angenehm fruchtig und säurearm - fast so wie frisch gepflückt. Aufgegossen schimmern sie rötlich gelb in Ihrer Tasse. Nachdem die wilden Rosen weiß oder zartrosa geblüht haben, speichern sie die Kraft des Sommers in ihren Früchten, die bis in den späten Herbst hinein geerntet werden. Unsere Hagebutten sind handgepflückt und besonders aromatisch.', 'Ulrich Walter GmbH', 'LEBENSBAUM', 'GERMANY', '0180cb21-0e19-4fcc-9f6a-b6cb6bde358f', 'manager', '2021-08-12 12:19:25', 'System', '2024-02-15 02:10:16', 268, 561, 0, NULL, 0, 2.35, 'Weiling', 0, NULL, 0, 60, 'Hagebutte* *aus kontrolliert ökologischer Erzeugung', '2022-11-29 15:22:26', 760, 'TEA', 'COFFEE_TEA_COCOA', 104.5, 19, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(392, 'Darjeeling Ambootia (Weiling)', '4012346528212', 0, 31.99, 1, 1, NULL, 0, '410362', 'Darjeeling Ambootia', 'Blumig wie ein typischer Darjeeling und frisch, wie es sich für einen grünen Tee gehört, schmeckt unser Grüntee Darjeeling Ambootia. Kennzeichnend ist die leicht grüne Tassenfarbe.', 'Ulrich Walter GmbH', 'LEBENSBAUM', 'GERMANY', 'bde46550-158b-48a0-9037-e28c2d57bdf5', 'manager', '2021-08-12 12:19:32', 'System', '2024-02-14 02:11:01', 269, 562, 0, NULL, 0, 26.66, 'Weiling', 0, NULL, 0, 60, 'Grüntee* *aus kontrolliert ökologischer Erzeugung', '2022-09-10 00:04:42', 4528.8, 'TEA', 'COFFEE_TEA_COCOA', 1036.1, 37, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(393, 'Darjeeling Schwarztee Ambootia (Weiling)', '4012346527406', 0, 31.9, 1, 1, NULL, 0, '410364', 'Darjeeling Schwarztee Ambootia', 'Kein anderer Tee erreicht das unverwechselbare Aroma eines Darjeelings. Einmal probiert, werden Sie seinen feinherben, blumigen Geschmack und die hellbraune Tassenfarbe immer wiedererkennen.', 'Ulrich Walter GmbH', 'LEBENSBAUM', 'GERMANY', 'f8ec9009-f7c6-476a-b4b9-5c4799554ada', 'manager', '2021-08-12 12:19:41', 'System', '2024-02-15 02:10:31', 270, 1784, 0, NULL, 0, 26.66, 'Weiling', 0, NULL, 0, 60, 'Darjeeling Ambootia, Blatt\nSchwarztee* *aus kontrolliert ökologischer Erzeugung', '2022-09-10 00:04:51', 4528.8, 'TEA', 'COFFEE_TEA_COCOA', 1035.6, 37, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(394, 'Schwarztee Indien Gold, Broken (Weiling)', '4012346529202', 0, 7.29, 1, 1, NULL, 0, '410368', 'Schwarztee Indien Gold, Broken', 'Kräftig, herb und ein wenig malzig - so lässt sich der Charakter unseres Indien Gold beschreiben. Die gut ausbalancierte Mischung indischer Schwarztees leuchtet in der Tasse mahagoni-braun. Aus Indien kommen Tees von ganz unterschiedlichem Charakter. Gehen Sie mit unserer Teemischung auf eine geschmackvolle Entdeckungsreise, die Sie von den steilen Bergen im Norden bis zu den sanften Hügeln am Indischen Ozean führt.', 'Ulrich Walter GmbH', 'LEBENSBAUM', 'GERMANY', '69c07a2f-b18e-4fed-afc3-729b40ea5643', 'manager', '2021-08-12 12:19:49', 'System', '2024-02-14 02:09:57', 271, 564, 0, NULL, 0, 4.29, 'Weiling', 0, NULL, 0, 60, 'Indien Gold, Broken, Schwarztee* *aus kontrolliert ökologischer Erzeugung', '2022-11-29 15:34:19', 1328.25, 'TEA', 'COFFEE_TEA_COCOA', 269.8, 23, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(395, 'Stilltee (Weiling)', '4012346535203', 0, 2.79, 1, 1, NULL, 0, '410566', 'Stilltee', 'Harmonisch und ausgewogen. Diese bewährte Kombination aus Zutaten wie Anis und Kümmel ist eine Wohltat. Melisse, Fenchel und Lavendel helfen Ihnen, die innere Balance zu finden und fördern das entspannte Stillen. Seit 1979 vertrauen wir dem natürlichen Reichtum der Natur, schließlich trinkt Ihr Kind mit: Wir verwenden nur reine Bio-Zutaten, behutsam gewachsen und streng kontrolliert. Heute für Sie und Ihr Kind, morgen für eine lebenswerte Zukunft.', 'Ulrich Walter GmbH', 'LEBENSBAUM', 'Diepholz, Niedersachsen', 'd7b63d2c-750e-4d78-8b82-cfece15a5e08', 'correction', '2021-09-08 18:56:12', 'System', '2023-01-16 17:46:03', 272, 199, 0, NULL, 0, 1.64, 'Weiling', 2, 1, 0, 60, NULL, '2022-11-29 15:35:19', 485.76, 'TEA', 'COFFEE_TEA_COCOA', 54.1, 16, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(396, 'Schwangerschaftstee (Weiling)', '4012346535104', 0, 2.79, 1, 1, NULL, 0, '410576', 'Schwangerschaftstee', 'Harmonisch frisch - feinste Kräuter wie Minze, Brennnessel und Lavendel entfalten eine sanft ausgleichende Wirkung. Aromatisches Zitronengras gibt dieser Traditionsmischung eine angenehm spritzige Note. Seit 1979 vertrauen wir dem natürlichen Reichtum der Natur, schließlich trinkt Ihr Kind mit: Wir verwenden nur reine Bio-Zutaten, behutsam gewachsen und streng kontrolliert. Heute für Sie und Ihr Kind, morgen für eine lebenswerte Zukunft.', 'Ulrich Walter GmbH', 'LEBENSBAUM', 'Diepholz, Niedersachsen', 'b4529d74-b61b-451b-b51e-ee35d26d5928', 'correction', '2021-09-08 18:56:33', 'System', '2023-01-16 17:46:05', 273, 200, 0, NULL, 0, 1.64, 'Weiling', 2, 1, 0, 60, NULL, '2022-11-29 15:32:40', 485.76, 'TEA', 'COFFEE_TEA_COCOA', 54.1, 16, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(397, 'Kamille (Weiling)', '4012346277608', 0, 1.99, 1, 1, NULL, 0, '410605', 'Kamille', 'Die Blüten der echten Kamille entfalten beim Aufguss ihr blumig-mildes Aroma. Entdecken Sie, wie universell ein Kamillentee ist und genießen Sie das ganze Jahr einen Hauch von Sommerfrische. Wir empfehlen: immer vorrätig haben.', 'Ulrich Walter GmbH', 'LEBENSBAUM', 'Diepholz, Niedersachsen', 'd505be9f-7020-436a-8e77-3fde13593988', 'correction', '2021-09-08 19:01:44', 'System', '2023-01-16 17:46:06', 274, 211, 0, NULL, 0, 1.17, 'Weiling', 2, 1, 0, 60, NULL, '2022-04-11 15:49:37', 485.76, 'TEA', 'COFFEE_TEA_COCOA', 54.1, 16, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(398, 'Kamillentee (Weiling)', '4012346222004', 0, 5.39, 1, 1, NULL, 0, '410606', 'Kamillentee', 'Die Blüten der echten Kamille entfalten beim Aufguss ihr blumig-mildes Aroma.\nKamille ist eine der ältesten und beliebtesten Kulturpflanzen und in fast jedem Haushalt zu finden. Bei aller Bekanntheit ist sie bescheiden geblieben und wächst wild bevorzugt am Weg- oder Feldrand. Entdecken Sie, wie mild unser Kamillentee ist und genießen Sie das ganze Jahr einen Hauch von Sommerfrische. Wir empfehlen: immer vorrätig haben.', 'Ulrich Walter GmbH', 'LEBENSBAUM', 'GERMANY', '8a5144be-7f60-434a-a6dd-668b0b07731e', 'manager', '2021-08-12 12:20:23', 'System', '2023-12-14 02:19:16', 275, 1785, 0, NULL, 0, 3.06, 'Weiling', 0, NULL, 0, 60, 'Kamille* *aus kontrolliert ökologischer Erzeugung', '2022-11-29 15:24:26', 1443.75, 'TEA', 'COFFEE_TEA_COCOA', 86, 25, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(399, 'Mate-Tee (Weiling)', '4012346216003', 0, 4.49, 1, 1, NULL, 0, '410730', 'Mate-Tee', 'Unser Matetee verleiht Schwung und schmeckt dabei kräftig und wunderbar würzig. Der Aufguss aus den Blättern des Mate-Baums war lange nur in Südamerika bekannt, inzwischen ist Mate aber auch hierzulande beliebt.\nDas argentinische Nationalgetränk wird traditionell, selbst von „Gauchos“ hoch zu Ross, aus einem ausgehöhlten Flaschenkürbis getrunken. Aber auch in europäischen Tassen lässt sich der Tee aus dem Urwald des Paraná-Beckens genießen - egal ob zum Frühstück oder um dem Nachmittagstief zu trotzen.', 'Ulrich Walter GmbH', 'LEBENSBAUM', 'Diepholz, Niedersachsen', '5fbfc14b-9583-4407-873e-23884d3ef119', 'correction', '2021-09-08 18:56:53', 'System', '2023-12-14 02:21:56', 276, 201, 0, NULL, 0, 2.64, 'Weiling', 2, 1, 0, 60, NULL, '2022-11-29 15:28:08', 760, 'TEA', 'COFFEE_TEA_COCOA', 104.5, 19, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(400, 'Ostfriesen Tee, Broken (Weiling)', '4012346525907', 0, 10.49, 1, 1, NULL, 0, '410940', 'Ostfriesen Tee, Broken', 'Malzig und würzig mögen Ostfriesen ihr Nationalgetränk mit tiefroter Tassenfarbe. Deshalb ist die Grundlage unseres Ostfriesen Tees eine Mischung kräftiger Tees von ausgewählten Plantagen.\nNirgendwo in Deutschland wird so viel Tee getrunken wie in Ostfriesland. Kein Wunder: Viermal am Tag ist dort „Teetied“. Zu einer ostfriesischen Teezeremonie gehören traditionell Kluntjes, Sahne und Zeit zum Klönen.', 'Ulrich Walter GmbH', 'LEBENSBAUM', 'Diepholz, Niedersachsen', 'f0f28f85-5493-42a8-8fc0-a96f21998058', 'correction', '2021-09-08 18:58:57', 'System', '2024-02-14 02:10:14', 277, 207, 0, NULL, 0, 6.17, 'Weiling', 2, 1, 0, 60, NULL, '2022-11-29 15:29:14', 1443.75, 'TEA', 'COFFEE_TEA_COCOA', 256.6, 25, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(401, 'Pfefferminztee lose 60g (Weiling)', '4012346538105', 0, 3.99, 1, 1, NULL, 0, '411106', 'Pfefferminztee lose 60g', 'Unsere besonders aromatische Pfefferminze hat eine angenehm kräftige Geschmacksnote. Pfefferminze wird rund um den Globus als Kulturpflanze geschätzt und als Tee gereicht. Das pflanzeneigene Menthol entfaltet in afrikanischen Teegläsern wie in norddeutschen Tassen seinen frischen Geschmack. Ein Tee, der Ihre Lebensgeister weckt.', 'Ulrich Walter GmbH', 'LEBENSBAUM', 'Diepholz, Niedersachsen', '407de63e-aceb-4386-96e1-32f871ef6f3f', 'correction', '2021-09-08 18:58:36', 'System', '2023-12-14 02:22:29', 278, 206, 0, NULL, 0, 2.35, 'Weiling', 2, 1, 0, 60, NULL, '2022-11-10 10:51:04', 1443.75, 'TEA', 'COFFEE_TEA_COCOA', 66.6, 25, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(402, 'Pfefferminztee TB (Weiling)', '4012346278001', 0, 1.99, 1, 1, NULL, 0, '411126', 'Pfefferminztee TB', 'Pfefferminze wird rund um den Globus als Kulturpflanze geschätzt und als Tee gereicht. Das pflanzeneigene Menthol entfaltet in afrikanischen Teegläsern wie in norddeutschen Tassen seinen frischen Geschmack. Ein Tee, der Ihre Lebensgeister weckt.', 'Ulrich Walter GmbH', 'LEBENSBAUM', 'Diepholz, Niedersachsen', 'c21b4b62-1b90-4768-bedc-9ea307a9fcca', 'manager', '2021-08-12 12:20:58', 'manager', '2023-01-25 15:34:11', 279, 346, 2, NULL, 0, 1.17, 'Weiling', 2, 1, 0, 60, NULL, '2023-01-25 15:34:11', 485.76, 'TEA', 'COFFEE_TEA_COCOA', 54.1, 16, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(403, 'Assam (Weiling)', '4012346001500', 0, 2.79, 1, 1, NULL, 0, '411216', 'Assam', 'Typisch Assam-Tee: sein würzig-malziger, wunderbar reichhaltiger Geschmack. \nEbenso reichhaltig präsentiert - sich die Natur der gleichnami gen Provinz. Indiens ältestes Tee-Anbaugebiet erstreckt sich über eine Hochebene an den Ufern des Brahmaputra. Hier wächst Tee von höchster Qualität – für Sie sorgfältig von Hand geerntet und im ganzen Blatt veredelt.', 'Ulrich Walter GmbH', 'LEBENSBAUM', 'Diepholz, Niedersachsen', 'a46020eb-a73b-4af3-ac2e-eb9f985dacb4', 'correction', '2021-09-08 19:09:40', 'System', '2024-01-26 02:10:01', 280, 220, 0, NULL, 0, 1.64, 'Weiling', 2, 1, 0, 60, NULL, '2022-11-29 15:14:23', 485.76, 'TEA', 'COFFEE_TEA_COCOA', 64, 16, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(404, 'Rooibos (Weiling)', '4012346210001', 0, 2.99, 1, 1, NULL, 0, '411290', 'Rooibos', 'Mild, aromatisch, und aus der Sonne Südafrikas – das zeichnet Rooibos-Tee aus. In den Cedar-Bergen nördlich von Kapstadt gedeiht der bis zu zwei Meter hohe Rooibos-Strauch, der längst Liebhaber auf allen Kontinenten gefunden hat. Durch Fermentierung erhält das südafrikanische Nationalgetränk seinen aromatischen Geschmack.', 'Ulrich Walter GmbH', 'LEBENSBAUM', 'Diepholz, Niedersachsen', 'a0a8dfc6-2a66-46b0-8f76-98124497641d', 'correction', '2021-09-08 19:08:20', 'System', '2023-01-16 17:46:20', 281, 218, 0, NULL, 0, 1.76, 'Weiling', 2, 1, 0, 60, NULL, '2022-11-29 15:30:54', 485.76, 'TEA', 'COFFEE_TEA_COCOA', 54.1, 16, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(405, 'China Chun Mee, Blatt (Weiling)', '4012346529004', 0, 9.79, 1, 1, NULL, 0, '411332', 'China Chun Mee, Blatt', 'Frisch und ausgewogen herb - so schmeckt unser Grüntee Chun Mee aus China. Ein wohlschmeckender Klassiker von hellgrüner Tassenfarbe. In China wird Tee seit Jahrtausenden kultiviert und überwiegend grün getrunken. Auch die ersten Tees, die Europa im 17. Jahrhundert erreichten, waren grün und unfermentiert. Erst später setzte sich hier der Schwarztee durch. Genießen Sie eine Tasse dieses ursprünglichen Grüntees.', 'Ulrich Walter GmbH', 'LEBENSBAUM', 'Diepholz, Niedersachsen', '9b1428b5-7785-4d38-b653-59ca16b73bf2', 'correction', '2021-09-08 18:58:15', 'System', '2023-12-14 02:19:23', 282, 205, 0, NULL, 0, 5.76, 'Weiling', 2, 1, 0, 60, NULL, '2022-04-11 15:08:45', 1328.25, 'TEA', 'COFFEE_TEA_COCOA', 221.2, 23, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(406, 'Darjeeling, Blatt (Weiling)', '4012346520063', 0, 6.79, 1, 1, NULL, 0, '411350', 'Darjeeling, Blatt', 'Kein anderer Tee erreicht das unverwechselbare Aroma eines Darjeeling. Einmal probiert und Sie werden seinen feinherben, blumigen Geschmack und die hellbraune Tassenfarbe sofort wiedererkennen. Unseren Darjeeling-Tee aus biologisch-dynamischem Anbau beziehen wir direkt aus dem Teegarten Ambootia. Hier, an den abgelegenen Südhängen des Himalaya, werden die Teeblätter sorgfältig von Hand gepflückt und danach traditionell veredelt. Ein Hochgenuss - nicht nur geografisch gesehen.', 'Ulrich Walter GmbH', 'LEBENSBAUM', 'GERMANY', '5f716851-02b6-4686-8781-d9485f1ded6a', 'manager', '2021-08-12 12:21:35', 'System', '2023-12-14 02:23:36', 283, 566, 2, NULL, 0, 3.98, 'Weiling', 0, NULL, 0, 60, 'Darjeeling, Blatt, Schwarztee** **aus biodynamischer Erzeugung', '2022-04-11 15:14:45', 476, 'TEA', 'COFFEE_TEA_COCOA', 109, 17, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(407, 'Jasmin, Blatt (Weiling)', '4012346536507', 0, 5.39, 1, 1, NULL, 0, '411361', 'Jasmin, Blatt', 'Durch wohlriechende frische Jasminblüten erhalten die Blätter dieses Grüntees eine betörend duftige Note. Unser Jasmin-Tee ist rein und zart im Geschmack und hat eine hellgelbe Tassenfarbe. Von Hochzeiten der beiden Zutaten spricht man in China, wenn sich frisch gepflückte Jasminblüten mit den noch feuchten Teeblättern verbinden. Das schichtenweise Auftragen und spätere Absammeln der Blüten ist Handarbeit - so will es die Tradition.', 'Ulrich Walter GmbH', 'LEBENSBAUM', 'GERMANY', 'cc5e9151-d8b3-4d70-bdd7-57714a8bbfbb', 'manager', '2021-08-12 12:21:53', 'System', '2023-02-04 02:05:35', 758, 567, 0, NULL, 0, 3.12, 'Weiling', 0, NULL, 0, 60, 'Jasmin Grüntee* *aus kontrolliert ökologischer Erzeugung', '2022-11-29 15:23:58', 532, 'TEA', 'COFFEE_TEA_COCOA', 95.3, 19, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(408, 'Ingwer-Zitrone (Weiling)', '4012346525105', 0, 2.79, 1, 1, NULL, 0, '411364', 'Ingwer-Zitrone', 'In dieser Mischung verbinden sich die Aromen des Grünen Tees mit der exotischen Schärfe des Ingwers und einer spritzigen Zitronennote zu einem belebenden Erfrischungsgetränk. Eine unwiderstehliche Kombination, finden wir.', 'Ulrich Walter GmbH', 'LEBENSBAUM', 'Diepholz, Niedersachsen', '2ed410b3-7066-4203-84e8-e74bfa574ff3', 'correction', '2021-09-08 19:07:57', 'System', '2023-11-10 02:11:32', 757, 217, 0, NULL, 0, 1.58, 'Weiling', 2, 1, 0, 60, NULL, '2022-11-29 15:22:45', 485.76, 'TEA', 'COFFEE_TEA_COCOA', 64, 16, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(409, 'Schwarztee Darjeeling TB (Weiling)', '4012346001463', 0, 3.29, 1, 1, NULL, 0, NULL, 'Schwarztee Darjeeling TB', 'Als unverwechselbar vollmundig und blumig lässt sich dieser Schwarztee beschreiben. Im renommierten Tee Anbaugebiet Darjeeling wird er nach biologisch-dynamischen Regeln kultiviert. Beste Voraussetzungen für diesen hervorragenden Klassiker.', 'Ulrich Walter GmbH', 'LEBENSBAUM', 'Diepholz, Niedersachsen', '31d39766-064f-4812-b95b-f560b851fa6f', 'manager', '2021-08-12 12:22:16', 'System', '2023-10-31 00:02:24', 1042, 1786, 2, NULL, 0, 1.94, 'Weiling', 2, 1, 0, 60, NULL, '2022-11-15 09:39:33', 485.76, 'TEA', 'COFFEE_TEA_COCOA', 64, 16, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(410, 'Earl Grey Classic (Weiling)', '4012346523804', 0, 6.29, 1, 1, NULL, 0, '411382', 'Earl Grey Classic', 'Unverwechselbar zitronig duftet und schmeckt unser Earl Grey Classic, der rotbraun in Ihrer Tasse leuchtet. Genießen Sie unsere besondere Mischung kräftiger Schwarztees, veredelt mit natürlichem ätherischem Öl der Bergamotte-Frucht. Wir geben unserem Earl Grey noch etwas ätherisches Öl aus der Zitronenschale hinzu - und unterstreichen so seinen spritzigen Charakter. Die Briten haben diesen erfrischenden Tee bekannt gemacht und trinken ihn zu jeder Tageszeit.', 'Ulrich Walter GmbH', 'LEBENSBAUM', 'GERMANY', '1186b2b7-764d-44cf-b403-dba1f129438e', 'manager', '2021-08-12 12:22:25', 'System', '2023-04-19 02:10:07', 284, 569, 0, NULL, 0, 3.7, 'Weiling', 0, NULL, 0, 60, 'Schwarztee*, ätherisches Öl aus Bergamotte*, ätherisches Öl aus Zitronenschale* *aus kontrolliert ökologischer Erzeugung', '2022-11-29 15:18:27', 616, 'TEA', 'COFFEE_TEA_COCOA', 104.3, 22, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(411, 'Ceylon Royal Silver, Weißer Tee (Weiling)', '4012346519906', 0, 2.99, 1, 1, NULL, 0, '411383', 'Ceylon Royal Silver, Weißer Tee', 'Samtig-duftige Aromen und eine zarte helle Tassenfarbe zeichnen unseren Ceylon Royal Silver aus. Weißer Tee aus Sri Lanka zählt zu den edelsten Teesorten überhaupt und wird zurecht auch Kaiser unter den Tees genannt. Um diese kostbare Spezialität herzustellen, werden die zarten Blätter und Knospen der Teesträucher behutsam von Hand gepflückt solange sie noch ihren silbrig-weißen Flaum tragen. Ein edler Tee, der Liebhaber auf der ganzen Welt gefunden hat.', 'Ulrich Walter GmbH', 'LEBENSBAUM', 'Diepholz, Niedersachsen', '6fc4d94e-010b-48a4-a5fd-c1e2c18fb24d', 'correction', '2021-09-08 19:07:08', 'System', '2023-01-16 17:46:46', 285, 215, 0, NULL, 0, 1.76, 'Weiling', 2, 1, 0, 60, NULL, '2022-12-19 23:44:20', 485.76, 'TEA', 'COFFEE_TEA_COCOA', 51.6, 16, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(412, 'Basenkräuter alt (Weiling)', '4012346538204', 0, 3.99, 1, 1, NULL, 0, '412122', 'Basenkräuter alt', 'Fünf abgestimmte Wildkräuter von Brennnessel bis Himbeerblatt verbinden sich mit Grünem Haferkraut und Zitronengras zu einer leichten Kräuterteemischung. \nZusammen bilden die Kräuter und Blüten ein feines Geschmackserlebnis - für kurze Auszeiten oder zwischendurch.', 'Ulrich Walter GmbH', 'LEBENSBAUM', 'Diepholz, Niedersachsen', '3de25b05-dbf8-4cc4-b4a6-20e09eba0710', 'correction', '2021-09-08 18:57:53', 'System', '2023-04-29 02:11:36', 286, 204, 0, NULL, 0, 2.35, 'Weiling', 2, 1, 0, 60, NULL, '2023-04-04 20:18:15', 871.25, 'TEA', 'COFFEE_TEA_COCOA', 61, 20.5, 'VEGAN;VEGETARIAN;LACTOSEFREE', NULL, NULL),
(413, 'Basenkräuter TB (Weiling)', '4012346261508', 0, 2.79, 1, 1, NULL, 0, '412125', 'Basenkräuter TB', 'Fünf abgestimmte Wildkräuter von Brennnessel bis Himbeerblatt verbinden sich mit Grünem Haferkraut und Zitronengras zu einer leichten Kräuterteemischung. Zusammen bilden die Kräuter und Blüten ein feines Geschmackserlebnis - für kurze Auszeiten oder zwischendurch', 'Ulrich Walter GmbH', 'LEBENSBAUM', 'GERMANY', 'a4563a68-de2e-48d4-9698-1572acd196ec', 'manager', '2021-08-12 12:22:51', 'System', '2023-11-15 02:09:52', 287, 1787, 0, NULL, 0, 1.64, 'Weiling', 0, NULL, 0, 60, 'Brennnessel* (26%), GRÜNES HAFERKRAUT*, WALNUSSBLATT*, Himbeerblatt*, Zitronengras*, Fenchel*, Schafgarbe*, Koriander*, Lindenblüte* (4 %), Löwenzahnkraut* (3 %), Salbei*,  Brombeerblatt*, Ysop*, Ringelblume* *aus kontrolliert ökologischer Erzeugung', '2023-03-21 11:51:31', 485.76, 'TEA', 'COFFEE_TEA_COCOA', 54.1, 16, 'VEGAN;VEGETARIAN;LACTOSEFREE', NULL, NULL),
(414, 'Mate-Orange (Weiling)', '4012346288901', 0, 2.99, 1, 1, NULL, 0, '412127', 'Mate-Orange', 'Der rauchige Geschmack von Mate trifft auf die süße Frische von Orangen. Mate, das Nationalgetränk Argentiniens, hat seinen Namen vom ausgehöhlten Kürbis, aus dem er traditionell getrunken wird. Zusammen mit Orange ist er eine süße, würzige Erfrischung – eine beflügelnde Kombination. Aus Kürbis oder Tasse, heiß oder kalt, diese Kombination macht Lust auf Abenteuer.', 'Ulrich Walter GmbH', 'LEBENSBAUM', 'Diepholz, Niedersachsen', '882eda96-b372-4b82-aec2-13742f31eee6', 'correction', '2021-09-08 18:55:52', 'System', '2023-01-16 17:46:52', 288, 198, 0, NULL, 0, 1.76, 'Weiling', 2, 1, 0, 60, NULL, '2022-12-19 23:44:51', 485.76, 'TEA', 'COFFEE_TEA_COCOA', 64, 16, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
