(419, 'Sanddorn-Cranberry (Weiling)', '4012346210209', 0, 3.49, 1, 1, NULL, 0, '412180', 'Sanddorn-Cranberry', 'Besonders aromatische Beeren bestimmen den Charakter unseres leuchtend rot schimmernden Sanddorn-Cranberry. \nEr wird von süßem Brombeerblatt sanft abgerundet und hat eine feine Fruchtsäure. Genießen sie dieses fruchtige Geschmackserlebnis – Tasse für Tasse.', 'Ulrich Walter GmbH', 'LEBENSBAUM', 'Diepholz, Niedersachsen', '60b803bf-9910-4762-a662-712566f53743', 'correction', '2021-09-08 18:55:29', 'System', '2023-11-15 02:09:41', 1567, 197, 0, NULL, 0, 2.06, 'Weiling', 2, 1, 0, 60, NULL, '2023-01-16 17:47:01', 485.76, 'TEA', 'COFFEE_TEA_COCOA', 74, 16, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(420, 'Typisch Chai (Weiling)', '4012346204604', 0, 3.99, 1, 1, NULL, 0, '412194', 'Typisch Chai', 'Wie ein Bummel über einen Basar: Tauchen Sie ein in warme Aromen, exotische Gewürze und sonnige Fruchtnoten. Dieser typisch indische Chai zaubert im Handumdrehen Fernweh in Ihre Tasse und verwöhnt Ihre Sinne. Nehmen\nSie sich ein wenig Zeit und genießen Sie die feine Komposition mit Zimt, Kardamom und Orange.', 'Ulrich Walter GmbH', 'LEBENSBAUM', 'GERMANY', '39d8f21c-ada0-4932-9294-4802f3da60d8', 'manager', '2021-08-12 12:23:53', 'System', '2023-08-08 02:06:47', 293, 571, 0, NULL, 0, 2.35, 'Weiling', 0, NULL, 0, 60, 'Orange*, Zichorienwurzel*, Ingwer*, Zimt* (15%), Koriander*, Kardamom*, Piment*, Pfeffer*, Gewürznelke*, Sternanis* *aus kontrolliert ökologischer Erzeugung', '2022-11-29 15:36:29', 585, 'TEA', 'COFFEE_TEA_COCOA', 64.6, 12, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(421, 'Earl Grey (Weiling)', '4012346204901', 0, 3.99, 1, 1, NULL, 0, '412200', 'Earl Grey', 'Unverwechselbar zitronig duftet und schmeckt unser Earl Grey. Genießen Sie diese besondere Mischung kräftiger Schwarztees, veredelt mit\ndem natürlichen ätherischen Öl der Bergamotte. Wir geben unserem Earl Grey noch etwas ätherisches Öl von der Zitrone hinzu – und unterstreichen so seinen spritzigen Charakter.', 'Ulrich Walter GmbH', 'LEBENSBAUM', 'Diepholz, Niedersachsen', 'bd940612-e808-48f3-8f9f-4d01e9bdcf62', 'correction', '2021-09-08 18:53:41', 'System', '2023-12-30 02:06:05', 294, 192, 0, NULL, 0, 2.35, 'Weiling', 2, 1, 0, 60, NULL, '2022-11-29 15:18:31', 585, 'TEA', 'COFFEE_TEA_COCOA', 64.6, 12, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL);
