(422, 'Jasmin & Grün (Weiling)', '4012346206202', 0, 3.99, 1, 1, NULL, 0, '412204', 'Jasmin & Grün', 'Durch frische Jasminblüten erhalten die Blätter dieses Grüntees eine besonders wohlduftende Note und ein außergewöhnlich\nfeines Aroma. Von einer Hochzeit der beiden\nZutaten spricht man in China, wenn sich frisch gepflückte Jasminblüten mit den noch feuchten Teeblättern verbinden. Das schichtenweise Auftragen und spätere Absammeln der\nBlüten ist Handarbeit – so will es die Tradition.', 'Ulrich Walter GmbH', 'LEBENSBAUM', 'Diepholz, Niedersachsen', 'a967607c-532c-4348-9015-d8193a4219ff', 'correction', '2021-09-08 18:53:01', 'System', '2024-02-15 02:08:00', 862, 190, 0, NULL, 0, 2.35, 'Weiling', 2, 1, 0, 60, NULL, '2022-11-29 15:24:01', 585, 'TEA', 'COFFEE_TEA_COCOA', 54.6, 12, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(423, 'Welten & Bummler (Weiling)', '4012346203607', 0, 4.59, 1, 1, NULL, 0, '412224', 'Welten & Bummler', 'Weltenbummler: reist überall hin. Will alles selber sehen. Immer wenig Platz im Rucksack. 15 Sorten, 20 Teebeutel, 1 Schachtel - viel Geschmack auf kleinstem Raum. Passt immer.\n\nDie Welt schmeckt an jedem Ort ein wenig anders. Lebensbaum Einkäufer wissen das. Voll Wanderlust suchen sie nah und fern nach besten Zutaten. Und nach Inspiration. Zum Beispiel für Tee.', 'Ulrich Walter GmbH', 'LEBENSBAUM', 'Diepholz, Niedersachsen', '6683e61f-6bc5-4393-b36b-09d66621a3e4', 'correction', '2021-09-08 18:53:22', 'System', '2023-01-16 17:47:08', 887, 191, 0, NULL, 0, 2.64, 'Weiling', 2, 1, 0, 60, NULL, '2022-09-10 00:01:40', 585, 'TEA', 'COFFEE_TEA_COCOA', 61.6, 12, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(424, 'Fenchel-Anis-Kümmel (Weiling)', '4012346277004', 0, 2.99, 1, 1, NULL, 0, '412228', 'Fenchel-Anis-Kümmel', 'Würziger Kümmel trifft auf aromatischen Fenchel und süßlichen Anis. Diese ausgewogene Mischung passt zu jeder Tageszeit. \n\nDas Trio aus Fenchel, Anis und Kümmel ist ein echter Klassiker unter den Kräuterteemischungen. Entdecken Sie, wie herrlich die drei harmonieren und Tasse für Tasse wohlschmeckenden Genuss mit sich bringen. Beliebt bei Groß und Klein.\"', 'Ulrich Walter GmbH', 'LEBENSBAUM', 'Diepholz, Niedersachsen', 'd93c88f1-76d7-46f9-aa2b-fbe334a363db', 'correction', '2021-09-08 19:01:23', 'System', '2023-11-10 02:11:30', 673, 210, 0, NULL, 0, 1.7, 'Weiling', 2, 1, 0, 60, NULL, '2023-02-01 11:18:43', 485.76, 'TEA', 'COFFEE_TEA_COCOA', 74, 16, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(425, 'Salbei (Weiling)', '4012346541709', 0, 3.49, 1, 1, NULL, 0, '412270', 'Salbei', 'Salbei ist ein vielseitiges Kraut– mit unverwechselbarem Geschmack. \nDank seiner ätherischen Öle verströmt Salbei ein kraftvolles, leicht herbes Aroma. Für alle Liebhaber einer kräftig-würzigen Tasse.', 'Ulrich Walter GmbH', 'LEBENSBAUM', 'GERMANY', '098972c5-1c80-43cd-804d-aa3b79f890ce', 'manager', '2021-08-12 12:24:42', 'System', '2023-03-25 02:08:27', 1566, 572, 0, NULL, 0, 2.05, 'Weiling', 0, NULL, 0, 60, 'Salbei* *aus kontrolliert ökologischer Erzeugung', '2022-04-11 14:30:55', 871.25, 'TEA', 'COFFEE_TEA_COCOA', 59.4, 20.5, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(426, 'Ingwer TB (Weiling)', '4012346542508', 0, 2.99, 1, 1, NULL, 0, '412272', 'Ingwer TB', 'Von Konfuzius gelobt, im antiken Rom geschätzt, im Mittelalter berühmt: Hinter dem Ingwer liegt eine lange, äußerst erfolgreiche Karriere als traditioneller Kräutertee. \n\nAuch geschmacklich wollen wir die exotische Knolle heute nicht mehr missen. Ihre angenehme, fruchtig-frische Schärfe kommt – ganz pur – in diesem Tee hervorragend zur Geltung. Lehnen Sie sich zurück und genießen Sie die kraftvolle Wärme.', 'Ulrich Walter GmbH', 'LEBENSBAUM', 'GERMANY', '723db974-8e19-4e93-9973-7b03216bf674', 'manager', '2021-08-12 12:24:53', 'System', '2023-11-10 02:11:20', 1540, 1788, 0, NULL, 0, 1.76, 'Weiling', 0, NULL, 0, 60, 'Ingwer* *aus kontrolliert ökologischer Erzeugung', '2022-11-29 15:23:07', 485.76, 'TEA', 'COFFEE_TEA_COCOA', 54.1, 16, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
