(432, 'Ingwer Kurkuma Tee, Doppelkammerbeutel (Weiling)', '9004145025714', 0, 3.99, 1, 1, NULL, 0, '417502', 'Ingwer Kurkuma Tee, Doppelkammerbeutel', NULL, 'Sonnentor Kräuterhandelsges. mbH', 'Sonnentor', 'VARIOUS', 'cf742224-942e-4a0a-b757-76c057cf7282', 'manager', '2021-08-12 12:26:03', 'System', '2023-12-15 02:31:37', 848, 579, 0, NULL, 0, 2.46, 'Weiling', 0, NULL, 0, 28, 'Ingwerstücke* 49 % , Kurkuma* 30 % , Galgant* , Fenchel* , Pfeffer schwarz* *aus kontrolliert ökologischer Erzeugung', '2022-11-29 15:23:01', 672, 'TEA', 'COFFEE_TEA_COCOA', 66.6, 12, 'VEGAN;VEGETARIAN', NULL, NULL),
(433, 'Hochzeitstee, Doppelkammerbeutel (Weiling)', '9004145025752', 0, 4.99, 1, 1, NULL, 0, '417510', 'Hochzeitstee, Doppelkammerbeutel', 'Mit dem Hochzeitstee ist dir Glück im Spiel und in der Liebe gewiss. Seite an Seite sind die zwei Teemischungen ein liebevolles Mitbringsel für das Brautpaar. Einzeln verwendet werden Herzdame und Herzkönig spielerisch einfach zum Gastgeschenk und Tischkärtchen. Nutze dafür die freien Textfelder und setze so dem schönsten Tag deines Lebens die Krone auf!', 'Sonnentor Kräuterhandelsges. mbH', 'Sonnentor', 'CZECH_REPUBLIC', '47b4d07b-e37f-4c4f-9361-1d193c370590', 'manager', '2021-08-12 12:26:14', 'System', '2023-01-16 17:48:46', 802, 580, 0, NULL, 0, 2.94, 'Weiling', 0, NULL, 0, 28, '1. Packung DAME je 9 Aufgussbeutel: Lindenblüten*, Zitronenverbene*, Zitronengras*, Brennnessel*, Holunderblüten*, Kamille*, Rosenblüten* 5 %, Rosmarin*, Orangenblüten*.  2. Packung KÖNIG je 9 Aufgussbeutel: Zitronenmelisse*, Tulsi Basilikum*, Granatapfel*, Lindenblüten*, Holunderblüten*, Rosmarin*, Lavendel* 5 %. *aus kontrolliert ökologischer Erzeugung', '2022-04-11 14:18:35', 683.2, 'TEA', 'COFFEE_TEA_COCOA', 82.2, 12.2, 'VEGAN;VEGETARIAN', NULL, NULL),
(434, 'ErfrischungsTee, Doppelkammerbeutel (Weiling)', '9004145025660', 0, 3.79, 1, 1, NULL, 0, '417556', 'ErfrischungsTee, Doppelkammerbeutel', 'Ein intensiv-zitroniger Duft steigt einem schon beim Öffnen der Packung in die Nase. Eine würzige Mischung, die mit jedem Aroma an das Aroma von Zitronendrops erinnert und großartig zu fruchtigen Joghurtdesserts und Sorbets, aber auch zu Salaten passt. An warmen Tagen kann er ausgezeichnet als Eistee zubereitet werden. Erfrisch dich jetzt!', 'Sonnentor Kräuterhandelsges. mbH', 'Sonnentor', 'CZECH_REPUBLIC', 'c090fde3-da7b-4b20-9e87-6d2a9476d0c3', 'manager', '2021-08-12 12:26:25', 'System', '2023-12-15 02:31:19', 667, 581, 0, NULL, 0, 2.23, 'Weiling', 0, NULL, 0, 28, 'Zitronengras* , Zitronenmelisse* , Zitronenverbene* , Rosenblüten* *aus kontrolliert ökologischer Erzeugung', '2022-04-11 14:17:37', 672, 'TEA', 'COFFEE_TEA_COCOA', 55.8, 12, 'VEGAN;VEGETARIAN', NULL, NULL),
(435, 'Yogi Tea® Himalaya Bio (Weiling)', '4012824400061', 0, 3.69, 1, 1, NULL, 0, '410489', 'Yogi Tea® Himalaya Bio', 'Yogi Tea® Himalaya ist eine Komposition aus belebendem Ingwer und warmem Zimt mit süßen Fenchelgewürzen. Diese milde, ausgewogene Teemischung atmet die heilige Kraft von den Höhen des Himalaya. Sie stärkt und erfrischt uns und ist uns ein willkommenes Geschenk, den Stress der Tage gelassener anzunehmen. Ayurveda lehrt, dass es unser Geburtsrecht ist, glücklich zu sein. Unsere ayurvedischen Teemischungen weben und wirken daran, uns in diesem natürlichen Zustand der Leichtigkeit des Seins zu halten.', 'YOGI TEA GmbH', 'YOGI TEA', 'ITALY', 'dc9f1c31-9d0b-4c7d-b63e-de2db1f431b0', 'manager', '2021-08-12 12:26:34', 'System', '2023-05-23 02:06:35', 863, 582, 0, NULL, 0, 2.09, 'Weiling', 0, NULL, 0, 102, 'Ingwer* (39%), Fenchel* (34%), Zimt* (20%), Anis*, Koriander*, Zimtöl*, Ingweröl*, Süßholz*. *aus kontrolliert ökologischer Erzeugung', '2023-03-21 10:03:06', 585, 'TEA', 'COFFEE_TEA_COCOA', 69, 12, 'VEGAN;VEGETARIAN', NULL, NULL),
(436, 'Yogi Tea® Schoko Bio (Weiling)', '4012824400115', 0, 3.69, 1, 1, NULL, 0, '410513', 'Yogi Tea® Schoko Bio', 'Lecker, würzig, wohlig.\n\nBestehend aus Chai-Gewürzen und leckeren Kakaoschalen ist unser YOGI TEA® Schoko schon seit Jahren Kult. Die Kakaoschalen verströmen ein wundervolles Schokoladen-Aroma und verbinden sich mit den traditionellen YOGI TEA®-Gewürzen zu einer geradezu paradiesischen Teemischung. Am besten leicht gesüßt und mit einem Schuss Milch* genießen.\n\n*egal, ob mit einem Schuss Kuhmilch oder einer veganen Milchvariante.', 'YOGI TEA GmbH', 'YOGI TEA', 'ITALY', 'b5c2510f-f99e-49fd-9fef-ecf07721eb2b', 'manager', '2021-08-12 12:26:45', 'System', '2023-01-16 17:49:15', 858, 583, 0, NULL, 0, 2.09, 'Weiling', 0, NULL, 0, 62, 'Kakaoschalen* (56%), Zimt* (15%), Süßholz* (14%), Karob*, GERSTENMALZ*, fettarmes Kakaopulver* (2%), Kardamom*, Ingwer*, Nelken*, Ingweröl*, schwarzer Pfeffer*, Vanilleextrakt*, Zimtöl*, Vanilleschoten*. *aus kontrolliert ökologischer Erzeugung', '2023-03-21 10:02:50', 585, 'TEA', 'COFFEE_TEA_COCOA', 72, 12, 'VEGAN;VEGETARIAN', NULL, NULL),
(437, 'Yogi Tea® Classic Bio - Gewürztee (Weiling)', '4012824400016', 0, 3.69, 1, 1, NULL, 0, '412913', 'Yogi Tea® Classic Bio - Gewürztee', 'Exotisch, wärmend, inspirierend.\nGewürztee mit einer würzigen Mischung aus Zimt, Ingwer, Kardamom, Nelken und Pfeffer.\n100% natürliche Zutaten, 100% Bio.\nTeebeutel 100% kompostierbar, recyclebare Verpackung.\nMit der Anleitung für eine inspirierende Yoga-Übung auf jeder Packung.\nMit motivierenden Weisheiten an jedem Teebeutel.\n\nDer Gewürz-Tee Yogi Tea® Classic Bio ist eine  wunderbare Mischung aus süßem Zimt, Kardamom, würzigem Ingwer, Nelken und Pfeffer und inspirierte Generationen von Yogis sowie die Marke YOGI TEA® und legte den Grundstein für die Vielfalt unserer ayurvedischen Teemischungen. Am besten gesüßt und mit Milch oder einer veganen Milchvariante genießen.\n\n Der Tee, mit dem die Geschichte von YOGI TEA® begann.', 'YOGI TEA GmbH', 'YOGI TEA', 'ITALY', 'db568e76-93cc-4aa8-8a3d-c06c7a3fc5df', 'manager', '2021-08-12 12:26:55', 'System', '2023-08-16 02:08:42', 866, 584, 0, NULL, 0, 2.09, 'Weiling', 0, NULL, 0, 102, 'Zimt* (52%), Kardamom* (16%), Ingwer* (17%), Nelken*, schwarzer Pfeffer*, Zimtöl*. *aus kontrolliert ökologischer Erzeugung', '2023-03-21 10:03:26', 585, 'TEA', 'COFFEE_TEA_COCOA', 72, 12, 'VEGAN;VEGETARIAN', NULL, NULL),
(438, 'Yogi Tea® Rose Bio (Weiling)', '4012824400764', 0, 3.69, 1, 1, NULL, 0, '412931', 'Yogi Tea® Rose Bio', 'Leicht, duftend, betörend.\n\nDem lieblichen Rosenduft vermag kein Gedanke zu widerstehen. Schmecken, abheben, Rosenblüten-schwelgen - mit mildem Hibiskus, Kamillen-, Holunder- und Sonnenblumenblättern die unerträgliche Leichtigkeit des Seins genießen.', 'YOGI TEA GmbH', 'YOGI TEA', 'ITALY', '758dc668-3977-47e9-8ece-d74747a6ba6a', 'manager', '2021-08-12 12:27:04', 'System', '2023-01-16 17:49:25', 859, 585, 0, NULL, 0, 2.09, 'Weiling', 0, NULL, 0, 62, 'Hibiskus* (23%), Kamillenblüten*, Holunderblüten*, Lindenblüten*, Rosenblüten* (5%), Zimt*, Lavendelblüten* (3%), Schafgarbe*, Ingwer*, schwarzer Pfeffer*, Fenchel*, Kurkuma* (Gelbwurz), Geranienöl*, Sonnenblumenblütenblätter*, Luzerne*, Spitzwegerich*, Kardamom*, Nelken*, getrocknetes Kombuchagetränk* *aus kontrolliert ökologischer Erzeugung', '2023-03-21 10:02:43', 585, 'TEA', 'COFFEE_TEA_COCOA', 69, 12, 'VEGAN;VEGETARIAN', NULL, NULL),
(439, 'Yogi Tea® Classic Chai Bio (Weiling)', '4012824529250', 0, 4.19, 1, 1, NULL, 0, '412955', 'Yogi Tea® Classic Chai Bio', 'Die Power und Wärme Indiens.\n\nYOGI TEA® Classic Chai ist der Tee mit dem alles begann – Yogi Bhajan servierte ihn 1969 nach den Yoga-Stunden seinen Schülern. In diesem Tee ist die geballte Kraft exotischer Gewürze versammelt: Sanfter, süßer Zimt, spritzig inspirierender Ingwer, süßer Kardamom, Nelken und Pfeffer. Wärmend und entspannend, lecker, würzig, wunderbar. Am besten gesüßt und mit Milch* genießen.\n\n*egal, ob mit einem Schuss Kuhmilch oder einer veganen Milchvariante.', 'YOGI TEA GmbH', 'YOGI TEA', 'ITALY', '413b8ddf-9cdc-4143-bffd-043fa5c67daf', 'manager', '2021-08-12 12:27:14', 'System', '2023-01-16 17:49:30', 868, 586, 0, NULL, 0, 2.52, 'Weiling', 0, NULL, 0, 62, 'Zimt*(55%), Kardamom*, Ingwer*, Nelken*, schwarzer Pfeffer*. *aus kontrolliert ökologischer Erzeugung', '2022-11-02 00:01:05', 523.125, 'TEA', 'COFFEE_TEA_COCOA', 110, 15.5, 'VEGAN;VEGETARIAN', NULL, NULL),
(440, 'Yogi Tea® Ingwer Zitrone Bio (Weiling)', '4012824401303', 0, 3.69, 1, 1, NULL, 0, '415081', 'Yogi Tea® Ingwer Zitrone Bio', 'Belebend, vitalisierend, inspirierend.\n\nDer scharfe Geschmack von Ingwer wärmt auf, regt die Lebensgeister an. Der säuerliche Geschmack der Zitrone erfrischt den Geist, schafft ein Gefühl der Leichtigkeit. Kleine Beigaben von Zitronengras, Minze, Süßholz und schwarzem Pfeffer geben dem Tee etwas „Biss“ und eine leichte, frische Süße. Im Sommer kühl, im Winter herzerwärmend, immer köstlich.', 'YOGI TEA GmbH', 'YOGI TEA', 'ITALY', '4c6cf81d-ab25-4f7a-a6bc-4d981f08390e', 'manager', '2021-08-12 12:27:24', 'System', '2023-01-16 17:49:35', 861, 587, 0, NULL, 0, 2.09, 'Weiling', 0, NULL, 0, 62, 'Ingwer* (43%), Süßholz*, Zitronengras*, schwarzer Pfeffer*(5%), Zitronenschalen* (4%), Pfefferminze* (4%), Zitrusextrakt* (3%), Hibiskus*, getrockneter Zitronensaft* (2%). *aus kontrolliert ökologischer Erzeugung', '2023-03-21 10:02:58', 585, 'TEA', 'COFFEE_TEA_COCOA', 65, 12, 'VEGAN;VEGETARIAN', NULL, NULL),
(441, 'Yogi Tea® Halswärmer, Bio - Kräutertee (Weiling)', '4012824401396', 0, 3.69, 1, 1, NULL, 0, '415101', 'Yogi Tea® Halswärmer, Bio - Kräutertee', 'Süß, fürsorglich und sanft.\nKräutertee mit Süßholz, Orangenschalen, Fenchel, Thymian und Ingwer.\n100% natürliche Zutaten, 100% Bio\nTeebeutel 100% kompostierbar, recyclebare Verpackung\nMit der Anleitung für eine inspirierende Yoga-Übung auf jeder Packung\nMit motivierenden Weisheiten an jedem Teebeutel\n\nDer Kräuter-Tee Yogi Tea® Halswärmer Bio ist süß, warm und umhüllend. Dieser Teegenuss wärmt den Hals. Denn er wird viel beansprucht. Wir schmeicheln ihm mit diesem sanften, leicht fruchtigen, süßen Kräutertee. Angenehm verfeinert durch die Zugabe von Orangenschalen, Fenchel, Thymian, Süßholz und Ingwer.', 'YOGI TEA GmbH', 'YOGI TEA', 'ITALY', '54e329ee-1d97-46bf-8418-aa2fb32e7291', 'manager', '2021-08-12 12:27:33', 'System', '2023-01-16 17:49:40', 2185, 588, 0, NULL, 0, 2.09, 'Weiling', 0, NULL, 0, 102, 'Süßholz* (32%), Fenchel* (23%), Zimt*, Orangenschalen*(8%), Ingwer*(4%), Thymian* (4%), Königskerze*, Orangenöl*, Zitrusextrakt*, Kardamom*, schwarzer Pfeffer*, Nelken*, Gelbwurz* (Kurkuma). *aus kontrolliert ökologischer Erzeugung', '2023-03-21 10:03:21', 585, 'TEA', 'COFFEE_TEA_COCOA', 67, 12, 'VEGAN;VEGETARIAN', NULL, NULL),
(442, 'Halva (Weiling)', '4016249003531', 0, 2.99, 1, 1, NULL, 0, '442815', 'Halva', 'Alles Bio, alles vom Feinsten, Allos Bio-Originale. Ihr wollt noch mehr davon? Schaut doch einmal hier rein und entdeckt ganz besondere Spezialitäten von Allos zum Genießen und Beschnuppern. Probiert unser Halva mit seinem nussig-aromatischen Geschmack und der natürlichen Honigsüße oder die fruchtig-aromatischen Blütenpollen.', 'Allos Hof-Manufaktur GmbH', 'Allos', 'GREECE', '483aa988-21c2-4bd5-bc3e-8e416d537403', 'correction', '2021-09-17 14:59:54', 'System', '2023-12-30 02:06:19', 778, 277, 0, NULL, 0, 2.07, 'Weiling', 0, NULL, 0, 1003, 'SESAM* gemahlen (52%), Honig* (48%). *aus ökologischem Landbau', '2022-11-10 10:52:49', 203.159, 'SPREADS_HONEY', 'PANTRY', 90, 12.1, 'VEGETARIAN;GLUTENFREE', NULL, NULL),
(443, 'Sesam-Mandel Riegel (Weiling)', '4016249008376', 0, 1.19, 1, 1, NULL, 0, '442830', 'Sesam-Mandel Riegel', 'Im Sesam-Mandel Riegel von Allos steckt eine geballte Landung Energie. Drei Zutaten  - mehr braucht es nicht für einen leckeren und energiespendenden Riegel: gerösteter Sesam, Honig und Mandeln. Im handlichen Riegelformat - einfach köstlich!', 'Allos Hof-Manufaktur GmbH', 'Allos', 'GREECE', '9a4b0e64-a0dd-45b6-84e4-8e25c268d3ec', 'correction', '2021-09-17 15:00:17', 'System', '2023-01-16 17:49:47', 1035, 278, 0, NULL, 0, 0.67, 'Weiling', 2, 1, 0, 1003, NULL, '2022-11-29 16:56:45', 68.328, 'SWEETS', 'SNACKS', 35, 14.6, 'VEGETARIAN', NULL, NULL),
(444, 'Sesam Riegel (Weiling)', '4016249003524', 0, 1.19, 1, 1, NULL, 0, '442832', 'Sesam Riegel', 'Nur aus Honig und Sesam besteht diese orientalische Köstlichkeit.  Zusammen mit dem feinen Bienenhonig fügt er sich zu einem knusprig süßen Snack zusammen.', 'Allos Hof-Manufaktur GmbH', 'Allos', 'GREECE', '9cd7106d-91b2-43c9-a72a-5172cbac5632', 'correction', '2021-09-17 15:00:39', 'System', '2023-01-16 17:49:51', 1572, 279, 0, NULL, 0, 0.67, 'Weiling', 2, 1, 0, 1003, NULL, '2022-11-29 16:56:43', 68.328, 'SWEETS', 'SNACKS', 31, 14.6, 'VEGETARIAN', NULL, NULL),
