(454, 'Bio Chocolat Noir Salty Almonds NL (Weiling)', '4013320024041', 0, 2.69, 1, 1, NULL, 0, '442812', 'Bio Chocolat Noir Salty Almonds NL', 'Kakaomasse nur aus Bohnen aus São Tomé\n; ohne Emulgatoren, dafür schonendes und sorgfältiges Conchieren der Schokoladenmasse.\n; Kakaobutter als einzig eingesetztes Fett, keine Fremdfette\n; Direktimport der hochwertigen Zutaten, Unterstützung mehrerer Handelspartner\n; Mit gesalzenen Bio-Mandeln\n; Innenwickel aus überwiegend nachwachsenden Rohstoffen', 'GEPA mbH', 'GEPA - The Fair Trade Company', 'GERMANY', '3db31829-afa8-4b00-991c-abec5380c3c1', 'manager', '2021-08-12 12:29:53', 'System', '2023-07-01 00:01:03', 528, 591, 3, NULL, 0, 1.64, 'Weiling', 0, NULL, 0, 67, 'Kakaomasse°*, Kakaobutter°*, Vollrohrzucker°*, gesalzende MANDELN (Mandeln* 96%,\nSalz, Glucosesirup*, Rohrohrzucker*, Verdickungsmittel: Gummi Arabicum*) 10%; \n° = aus fairem Handel *aus kontrolliert ökologischer Erzeugung', '2022-05-24 10:06:54', 120.12, 'SWEETS', 'SNACKS', 90, 15.6, 'VEGAN;VEGETARIAN;PALMOILFREE', NULL, NULL),
