(456, 'Natural crunch chips salted (Weiling)', '8718781200336', 0, 2.69, 1, 1, NULL, 0, '442000', 'Natural crunch chips salted', 'Diese leckeren Kartoffelchips sind im Kessel gebacken und deshalb besonders knusperig. Mit Meersalz verfeinert gehören sie zu den Klassikern unter den Kartoffelchips. Der echte Geschmack der reinen Zutaten, dafür steht GoPure! Produziert werden diese leckeren Chips von Yellow Chips aus dem niederländischen Emmeloord. Im Jahr 2013 von drei begeisterten Lebensmittelprofis gegründet, bieten die „Chipsmacher“ ein abwechslungsreiches Sortiment von Kartoffel- und Gemüsechips. Natürlich sind alle Produkte – so wie der Name es sagt – pur: biologisch und vegan, frei von Allergen und zugefügtem Zucker und Hefe. GoPure – straight from the land.', 'Yellow Chips B.V.', 'GoPure', 'NETHERLANDS', 'ba947eb3-87c2-45c4-b0de-6b94d3ed9bf7', 'manager', '2021-08-12 12:30:37', 'System', '2023-02-21 02:11:16', 1260, 593, 0, NULL, 0, 1.65, 'Weiling', 0, NULL, 0, 120, 'Kartoffeln*, Sonnenblumenöl*, Meersalz. vor Wärme geschützt und trocken lagern. Unter Schutzatmosphäre verpackt.   *aus kontrolliert ökologischer Erzeugung', '2022-06-06 10:08:31', 2895, 'SWEETS;SALTY', 'SNACKS', 131, 30, 'VEGAN;VEGETARIAN', NULL, NULL),
(457, 'Natural crunch chips black pepper & sea salt (Weiling)', '8718781200350', 0, 2.79, 1, 1, NULL, 0, '442002', 'Natural crunch chips black pepper & sea salt', 'Leckere Kartoffelchips mit Pfeffer und einem Hauch Salz. Im Kessel gebacken und deshalb besonders knusperig. Der echte Geschmack der reinen Zutaten, dafür steht GoPure! Produziert werden diese leckeren Chips von Yellow Chips aus dem niederländischen Emmeloord. Im Jahr 2013 von drei begeisterten Lebensmittelprofis gegründet, bieten die „Chipsmacher“ ein abwechslungsreiches Sortiment von Kartoffel- und Gemüsechips. Natürlich sind alle Produkte – so wie der Name es sagt – pur: biologisch und vegan, frei von Allergen und zugefügtem Zucker und Hefe. GoPure – straight from the land.', 'Yellow Chips B.V.', 'GoPure', 'NETHERLANDS', 'b3c8265f-8110-4dbd-a86f-d02c823f95e4', 'manager', '2021-08-12 12:30:48', 'System', '2023-02-21 02:11:11', 1261, 594, 0, NULL, 0, 1.71, 'Weiling', 0, NULL, 0, 120, 'Kartoffelchips Meersalz & schwarzer Pfeffer Zutaten: Kartoffeln*, Sonnenblumenöl*, Maismehl*, schwarzem Pfeffer (1%)*, Meersalz (1%). vor Wärme geschützt und trocken lagern. Unter Schutzatmosphäre verpackt.  *aus kontrolliert ökologischer Erzeugung', '2022-11-29 15:33:01', 2895, 'SWEETS;SALTY', 'SNACKS', 131, 30, 'VEGAN;VEGETARIAN', NULL, NULL),
(458, 'Vegetable chips mixed varieties (Weiling)', '8718781200312', 0, 2.99, 1, 1, NULL, 0, '442004', 'Vegetable chips mixed varieties', 'Die biologischen Gemüsechips haben einfach ‚alles‘: Knusprigkeit, unterschiedliche Aromen und verschiedene Texturen. Karotte, Rote Bete, Pastinake und Süßkartoffel werden im Kessel in 100% Sonnenblumenöl gebacken und mit etwas Salz verfeinert. \nDer echte Geschmack der reinen Zutaten, dafür steht GoPure! Produziert werden diese leckeren Chips von Yellow Chips aus dem niederländischen Emmeloord. Im Jahr 2013 von drei begeisterten Lebensmittelprofis gegründet, bieten die „Chipsmacher“ ein abwechslungsreiches Sortiment von Kartoffel- und Gemüsechips. Natürlich sind alle Produkte – so wie der Name es sagt – pur: biologisch und vegan, frei von Allergen und zugefügtem Zucker und Hefe. GoPure – straight from the land.', 'Yellow Chips B.V.', 'GoPure', 'NETHERLANDS', '2ae9bdf6-2d71-4fa9-b040-3c7f2b784b21', 'manager', '2021-08-12 12:30:59', 'manager', '2023-02-02 09:32:23', 719, 595, 0, NULL, 0, 1.85, 'Weiling', 0, NULL, 0, 120, 'Gemüse 64% (rote Bete*, Pastinake*, Karotte*, Süßkartoffel*) in veränderlichen Anteilen, Sonnenblumenöl*, Meersalz. vor Wärme geschützt und trocken lagern. Unter Schutzatmosphäre verpackt.   *aus kontrolliert ökologischer Erzeugung', '2023-02-02 09:32:23', 2509, 'SALTY;SWEETS', 'SNACKS', 95, 26, 'VEGAN;VEGETARIAN;GLUTENFREE', NULL, NULL),
