(475, 'Lakritzschlange Süß (Weiling)', '8713576162042', 0, 1.59, 1, 1, NULL, 0, '441721', 'Lakritzschlange Süß', 'Die biologischen Lakritzschlangen sind lecker und echt toll zu essen. Die  Schlange ist sage und schreibe 65 cm lang, du kannst sie also buchstäblich  lange genießen. Sie schmeckt herrlich süß und hat eine weiche, aber feste  Struktur. Die Lakritzschlangen sind mit der besonderen schwarzen  Zuckerrohrmelasse und Süßholzwurzelextrakt aus Süditalien gesüßt. Ein  biologischer, veganer Snack, der das Lakritzessen zu einem wahren Vergnügen  werden lässt!  Probiere auch einmal die Salzlakritzschlangen!', 'TerraSana Natuurvoeding BV', 'TerraSana', 'FINLAND', 'f6f385e7-7c72-4601-bc54-7fde9d95ceb3', 'manager', '2021-08-12 12:34:51', 'System', '2023-01-16 17:52:29', 970, 610, 0, NULL, 0, 0.93, 'Weiling', 0, NULL, 0, 35, 'schwarze Zuckerrohrmelasse*, WEIZENmehl*, Zuckerrübensirup*, Maissirup*, Süßholzwurzelextrakt* 2%, Salz, Anisöl* *aus kontrolliert ökologischer Erzeugung', '2023-05-09 17:44:04', 212.8, 'SWEETS', 'SNACKS', 58, 76, 'VEGAN;VEGETARIAN', NULL, NULL),
(476, 'Wheel (Weiling)', '8713576163001', 0, 1.89, 1, 1, NULL, 0, '441746', 'Wheel', 'Diese zu Schnecken aufgerollten Lakritzschnüre sind ein echter Klassiker. Ob  erwachsen oder noch Kind, jeder liebt sie. Man kann sie auseinanderdrehen, mit  dem Mund auseinanderziehen oder einfach schön durchbeißen. Die Struktur dieser  biologischen Lakritze ist fest, der Geschmack voll und leicht süß. WHEELS  werden mit der besonderen schwarzen Zuckerrohrmelasse und hochwertigem  Süßholzwurzelextrakt aus Süditalien gesüßt. Ein leckerer biologischer, veganer  Snack, den man alleine oder zusammen genießen kann.  Probiere auch einmal die anderen 14 Lakritzsorten aus!', 'TerraSana Natuurvoeding BV', 'TerraSana', 'ITALY', '7b726967-20e7-4e1e-865c-b9c75a05c52f', 'manager', '2021-08-12 12:35:00', 'System', '2023-10-04 02:11:01', 1582, 611, 0, NULL, 0, 1.19, 'Weiling', 0, NULL, 0, 1644, 'schwarze Zuckerrohrmelasse*, WEIZENmehl*, Glukosesirup*, Süßholzwurzelextrakt* 3%, Salz, natürliche Aromastoffe: Anisextrakt*, Sonnenblumenöl*, Glasur: Karnaubawachs* *aus kontrolliert ökologischer Erzeugung', '2022-10-15 02:05:34', 440, 'SWEETS', 'SNACKS', 108, 20, 'VEGAN;VEGETARIAN', NULL, NULL),
(477, 'Tortilla naturel (Weiling)', '5400313040307', 0, 1.59, 1, 1, NULL, 0, '441842', 'Tortilla naturel', 'Trafo Tortilla Chips naturell sind ein leckerer Snack auf Maisbasis mit Salz verfeinert', 'FZ Organic Food B.V.', 'Trafo', 'BELGIUM', '64b94d68-2dbb-4d04-a421-f6652e6ed6f4', 'manager', '2021-08-12 12:35:10', 'System', '2023-10-10 00:03:31', 941, 612, 0, NULL, 0, 0.92, 'Weiling', 0, NULL, 0, 3, 'Zutaten: Mais*, Sonnenblumenöl*, Meersalz *aus kontrolliert ökologischer Erzeugung', '2023-05-23 09:43:06', 1020, 'SALTY', 'SNACKS', 80, 17, 'VEGETARIAN;HALAL', NULL, NULL),
(478, 'Tortilla chili   (Weiling)', '5400313040314', 0, 1.69, 1, 1, NULL, 0, '441844', 'Tortilla chili', 'Trafo Tortilla Chips Chili sind eine leckere Knabberei auf Maisbasis  mit einer  feurig-scharfen Chili-Note', 'FZ Organic Food B.V.', 'Trafo', 'BELGIUM', '8ee7bcc0-6e03-4927-a6d5-7f75ef6d3ba3', 'manager', '2021-08-12 12:35:19', 'manager', '2023-02-27 11:32:07', 942, 613, NULL, NULL, 0, 0.97, 'Weiling', 0, NULL, 0, NULL, NULL, '2023-05-09 17:44:35', 892.5, 'SALTY', 'SNACKS', NULL, 17.5, NULL, NULL, NULL),
(479, 'Feine Bitter Pfefferminz Schokolade (Weiling)', '4044889001051', 0, 2.49, 1, 1, NULL, 0, '444651', 'Feine Bitter Pfefferminz Schokolade', 'Tafel Pfefferminz Schokolade\nAllerfeinste Bitter Schokolade mit cremiger Pfefferminz-Füllung.\nKühl, edelbitter und erfrischend. Ein echter Klassiker.', 'EcoFinia GmbH', 'Vivani', 'Herford, NRW', '75256287-5a84-4a3f-b062-47aea1aaed3d', 'correction', '2021-09-17 11:19:06', 'System', '2023-01-16 17:52:36', 1423, 249, 0, NULL, 0, 1.49, 'Weiling', 2, 1, 0, 67, NULL, '2022-07-12 14:20:22', 132.99, 'SWEETS', 'SNACKS', 113, 15.5, 'VEGETARIAN;KOSCHER', NULL, NULL),
(480, 'Cappuccino Vollmilch & Weiße (Weiling)', '4044889001075', 0, 2.29, 1, 1, NULL, 0, '444653', 'Cappuccino Vollmilch & Weiße', 'Zartschmelzende Schokolade in einer Zwei-Schichten-Komposition: cremige weiße Schokolade und Vollmilch Schokolade, verfeinert mit bestem Espresso.', 'EcoFinia GmbH', 'Vivani', 'Herford, NRW', '7a434a1f-37a5-45b5-8179-303cbfb3a441', 'correction', '2021-09-17 11:20:14', 'System', '2023-01-16 17:52:40', 1422, 250, 0, NULL, 0, 1.31, 'Weiling', 2, 1, 0, 67, NULL, '2022-07-12 14:20:16', 132.99, 'SWEETS', 'SNACKS', 106, 15.5, 'VEGETARIAN;KOSCHER', NULL, NULL),
(481, 'Feine Bitter Marzipan Amaretto (Weiling)', '4044889002171', 0, 2.49, 1, 1, NULL, 0, '444679', 'Feine Bitter Marzipan Amaretto', 'Damit lässt sich jede Jahreszeit wunderbar versüßen: Cremige Marzipanfüllung, fein abgestimmt durch eine elegante Amaretto-Note, jedes Segment umhüllt von zarter Bitter Schokolade.', 'EcoFinia GmbH', 'Vivani', 'Herford, NRW', '5d15f37d-ff3c-44b8-bd02-d33d61cff969', 'manager', '2021-08-12 12:35:55', 'System', '2023-01-16 17:52:43', 841, 614, 0, NULL, 0, 1.49, 'Weiling', 2, 1, 0, 67, NULL, '2022-11-15 09:10:34', 132.99, 'SWEETS', 'SNACKS', 113, 15.5, 'VEGETARIAN;KOSCHER', NULL, NULL);
