(484, 'Creamy Caramel Schokoriegel (Weiling)', '4044889002515', 0, 1.29, 1, 1, NULL, 0, '444772', 'Creamy Caramel Schokoriegel', 'Vollmilch Schokoladenriegel mit wunderbar cremiger Karamel-Füllung abgerundet mit einer Prise Salz.', 'EcoFinia GmbH', 'Vivani', 'Herford, NRW', '8e86bb2e-da72-42a9-91b8-553e61e83065', 'correction', '2021-09-17 11:21:09', 'System', '2023-09-26 02:23:59', 2075, 252, 0, NULL, 0, 0.68, 'Weiling', 2, 1, 0, 67, NULL, '2022-07-12 14:21:24', 50.96, 'SWEETS', 'SNACKS', 42, 13, 'VEGETARIAN;KOSCHER', NULL, NULL),
