(486, 'Gebrannte Mandeln im Pfandglas (Weiling)', '4035661162848', 0, 5.99, 1, 1, NULL, 0.15, '440048', 'Gebrannte Mandeln im Pfandglas', 'Knackig geröstete Mandeln aus Spanien mit einer dünnen Zuckerschicht karamellisiert. Ein Klassiker unter den Knabbernüssen. Eine Besonderheit dabei ist, dass die Mandeln in liebevoller Handarbeit durch den Hersteller Ravellis sowohl geröstet als auch veredelt werden. (Klassisch gebrannt und im Mehrwegglas.)', 'Weiling GmbH', 'bioladen', 'GERMANY', '138e5c58-8e80-484b-a510-6db9da86ae30', 'manager', '2021-08-12 12:36:54', 'System', '2023-10-14 02:07:37', 466, 616, 0, NULL, 0, 3.72, 'Weiling', 0, NULL, 0, 62, 'MANDELKERNE* geröstet (71 %), Rohrohrzucker* *aus kontrolliert ökologischer Erzeugung', '2022-04-11 14:05:38', 509.6, 'SWEETS', 'SNACKS', 305, 10.4, 'VEGAN;VEGETARIAN', NULL, NULL),
(487, 'Pistazien geröstet & gesalzen im Pfandglas (Weiling)', '4035661162879', 0, 6.99, 1, 1, NULL, 0.15, '440054', 'Pistazien geröstet & gesalzen im Pfandglas', 'Die süßlichen und sehr aromatischen Pistazien sind geröstet und gesalzen. Sie sind optimal zum Snacken, finden aber auch in vielen Gerichten ihre Verwendung. (Es handelt sich um geröstete und gesalzene Ware im Mehrwegglas.)\n', 'Weiling GmbH', 'bioladen', 'GERMANY', 'd7d82322-18fc-416e-8d96-e3728b419c8a', 'manager', '2021-08-12 12:37:20', 'System', '2023-10-14 02:14:01', 471, 617, 0, NULL, 0, 4.36, 'Weiling', 0, NULL, 0, 62, 'PISTAZIEN (98%)*, Meersalz (2%) *aus kontrolliert ökologischer Erzeugung', '2022-05-17 03:15:51', 509.6, 'SALTY', 'SNACKS', 305, 10.4, 'VEGAN;VEGETARIAN', NULL, NULL),
(488, 'Geröstete Erdnüsse mit Salz im Pfandglas (Weiling)', '4035661162886', 0, 3.99, 1, 1, NULL, 0.15, '440056', 'Geröstete Erdnüsse mit Salz im Pfandglas', 'Die bioladen*Erdnüsse kommen aus unserem bioladen*Fair Projekt aus Burkina Faso. Mit dem Kauf gehen pro Glas 5 Cent in dieses Projekt. Sie wollen mehr zum Projekt erfahren, dann schauen Sie auf bioladen.de/qr/burkinafaso. Die Erdnüsse werden knackig geröstet und gesalzen. (Im Mehrwegglas.)', 'Weiling GmbH', 'bioladen', 'GERMANY', '3d1ab99d-b5a0-4bc5-87e1-0f3ba3ef8231', 'manager', '2021-08-12 12:37:29', 'System', '2023-10-14 02:08:53', 469, 618, 0, NULL, 0, 2.49, 'Weiling', 0, NULL, 0, 62, 'ERDNUSSKERNE* (95 %), Sonnenblumenöl*, Steinsalz *aus kontrolliert ökologischer Erzeugung', '2022-07-31 00:00:18', 509.6, 'SALTY', 'SNACKS', 315, 10.4, 'VEGAN;VEGETARIAN', NULL, NULL),
(489, 'Geröstete Cashews mit Salz im Pfandglas (Weiling)', '4035661162893', 0, 5.49, 1, 1, NULL, 0.15, '440058', 'Geröstete Cashews mit Salz im Pfandglas', 'Die bioladen*Cashewkerne kommen aus unserem bioladen*Fair Projekt aus Burkina Faso. Mit dem Kauf gehen pro Glas 5 Cent in dieses Projekt. Sie wollen mehr zum Projekt erfahren, dann schauen Sie auf bioladen.de/qr/burkinafaso. Die Herstellung der Cashews ist reine Handarbeit. Im Geschmack sind sie mild nussig. Sie sind geröstet und gesalzen und sind optimal zum Knabbern. (Im Mehrwegglas.)', 'Weiling GmbH', 'bioladen', 'GERMANY', 'c2008409-2651-42b5-9f57-68035114e078', 'manager', '2021-08-12 12:37:37', 'System', '2023-10-14 02:13:18', 1489, 619, 0, NULL, 0, 3.43, 'Weiling', 0, NULL, 0, 62, 'CASHEWKERNE geröstet* (95%), Sonnenblumenöl*, Steinsalz *aus kontrolliert ökologischer Erzeugung', '2022-04-11 14:05:22', 509.6, 'SALTY', 'SNACKS', 315, 10.4, 'VEGAN;VEGETARIAN', NULL, NULL),
(490, 'Geröstete Mandeln mit Salz im Pfandglas (Weiling)', '4035661162916', 0, 6.49, 1, 1, NULL, 0.15, '440062', 'Geröstete Mandeln mit Salz im Pfandglas', 'Die Mandeln werden in Spanien angebaut. Sie haben ein mildes, angenehm süßes Aroma. Sie sind geröstet und gesalzen und eignen sich optimal zum Knabbern. (Im Mehrwegglas.)', 'Weiling GmbH', 'bioladen', 'GERMANY', '3c9cbab9-b452-40a4-83d3-df363966c429', 'manager', '2021-08-12 12:37:56', 'System', '2023-10-14 02:08:52', 470, 620, 0, NULL, 0, 4.05, 'Weiling', 0, NULL, 0, 62, 'MANDELKERNE geröstet* (98,5%), Steinsalz *aus kontrolliert ökologischer Erzeugung', '2022-05-31 00:00:18', 509.6, 'SALTY', 'SNACKS', 315, 10.4, 'VEGAN;VEGETARIAN', NULL, NULL),
(491, 'Lupinensauce (Weiling)', '4010238700005', 0, 4.19, 1, 1, NULL, 0, '450700', 'Lupinensauce', NULL, 'Purvegan GmbH', 'Alberts', 'GERMANY', '3249addb-b0e1-4983-9058-59b5112c132f', 'manager', '2021-08-12 12:38:06', 'System', '2023-12-17 02:49:33', 1549, 621, 0, NULL, 0, 2.49, 'Weiling', 0, NULL, 0, 60, 'Wasser, SÜSSLUPINEN*, Meersalz *aus kontrolliert ökologischer Erzeugung', '2022-12-02 13:14:51', 255.78, 'OIL_VINEGAR_SAUCES', 'PANTRY', 200, 14.5, 'VEGAN;VEGETARIAN;WITHOUT_ADDED_SUGAR', NULL, NULL),
(492, 'Shoyu (Weiling)', '4020943137812', 0, 4.79, 1, 1, NULL, 0, '450505', 'Shoyu', 'Ein echter Würzprofi aus Japan! Die natürlich fermentierte Sojasauce aus Sojabohnen und Weizen wird traditionell in einer japanischen Manufaktur gefertigt. ARCHE Shoyu ist ein mild-würziges, vielseitiges Würzmittel für die asiatische und europäische Küche:  zum Würzen und Verfeinern von Gemüsegerichten, Suppen, in Dressings und Dips bis hin zum Nachwürzen bei Tisch. Damit der volle Geschmack erhalten bleibt, das natürlich gebraute Bio Shoyu erst am Ende der Garzeit zugeben. Tipp: In Rezepten kann ARCHE Bio Shoyu überall statt heller Sojasauce verwendet werden! Und wenn Sie es weniger salzig mögen, probieren Sie unser Shoyu salzreduziert! Hinweis: Durch den Fermentationsprozess enthalten Sojasaucen von Natur aus Alkohol.', 'Arche Naturprodukte GmbH', 'Arche Naturküche', 'JAPAN', '72e0d714-7638-44c3-9b2f-553de0214774', 'manager', '2021-08-12 12:38:15', 'System', '2023-11-29 02:06:28', 1025, 622, 0, NULL, 0, 2.99, 'Weiling', 0, NULL, 0, 64, 'Wasser, SOJABOHNEN* (19 %), WEIZEN*, Meersalz, Aspergillus oryzae * aus ökologischem Landbau ', '2022-11-29 16:57:08', 467.972, 'OIL_VINEGAR_SAUCES', 'PANTRY', 425, 19, 'VEGAN;VEGETARIAN', NULL, NULL),
(493, 'Shiro Miso, glutenfrei (Weiling)', '4020943134095', 0, 9.29, 1, 1, NULL, 0, '450519', 'Shiro Miso, glutenfrei', 'Ce miso, à base de riz décortiqué et de graines de soja, est un condiment doux et onctueux, sans gluten, sucré et salé à la fois. Il parfumera soupes, purées, assaisonnements, sauces et légumes fins. Délicieux aussi dans les gratins, ou tout simplement sur du pain. L\'emballage est doté d\'un bouchon à vis pratique. Sans gluten et pasteurisé.', 'Arche Naturprodukte GmbH', 'Arche Naturküche', 'JAPAN', '7ddf9001-5dcf-4491-824f-044a5546b7d9', 'manager', '2021-08-12 12:38:33', 'System', '2023-07-01 00:14:51', 1027, 623, 0, NULL, 0, 6.19, 'Weiling', 0, NULL, 0, 668, 'riz* (42%), eau, graines de SOJA* (21%), sel de mer, Aspergillus oryzae\n *issu de l\'agriculture biologique', '2022-12-02 13:17:08', 606.375, 'SPICES_COOKING_HELP', 'PANTRY', 328, 16.5, 'VEGAN;VEGETARIAN;GLUTENFREE', NULL, NULL),
(494, 'Rice Paper, Reispapier, glutenfrei (Weiling)', '4020943132497', 0, 4.29, 1, 1, NULL, 0, '450546', 'Rice Paper, Reispapier, glutenfrei', 'Frühlingsrollen sind das beliebteste asiatische Fingerfood überhaupt - mit Arche Bio Reispapier ist es einfach und schnell zubereitet.  Mit 18 cm Durchmesser haben die Reispapierblätter die optimale Größe für feines Finger-Food. Der Fantasie sind keine Grenzen gesetzt - vegan, Bio, vegetarische, glutenfrei, alles ist möglich!  Typische Füllungen für die leichte Spezialität sind Gemüse wie Möhren, Weißkohl, Sprossen oder auch Reisnudeln wie Arche Bio Bifun. Probieren Sie die Rollen kalt als Sommerrolle oder Glücksrolle und gebraten als Frühlingsrolle. Köstlich dazu schmecken die traditionellen Arche Soja- oder asiatischen Dipsaucen.', 'Arche Naturprodukte GmbH', 'Arche Naturküche', 'VIETNAM', 'e1136b70-92cd-41eb-b59d-5275d82c38c2', 'manager', '2021-08-12 12:38:47', 'System', '2023-07-29 02:04:42', 1111, 624, 0, NULL, 0, 2.44, 'Weiling', 0, NULL, 0, 71, 'Reis*, Meersalz * aus ökologischem Landbau ', '2022-12-02 13:05:39', 573.3, 'CONVENIENCE_PRESERVES;PASTA_CEREALS_LEGUMES', 'PANTRY', 175, 21, 'VEGAN;VEGETARIAN;GLUTENFREE', NULL, NULL),
(495, 'Sushi Nori Bio - 7 Blätter (Weiling)', '8713576008906', 1, 6.49, 1, 1, NULL, 0, '450121', 'Sushi Nori Bio - 7 Blätter', 'Sushi Nori ist in der Hauptsache für die Herstellung von Sushi-Rollen gedacht. \r\nDas Einrollen von Reis ist jedoch nicht die einzige Möglichkeit. Du kannst sie \r\nauch für vietnamesische (Sommerrollen), mediterrane (mit Hummus) oder eine \r\nkohlenhydratarme Version (mit zerdrückter Avocado, Sprossen und anderem \r\nfrischen Grün) verwenden. Dieses Sushi Nori ist aus kontrolliert biologischem \r\nAnbau, was etwas ganz Besonderes ist. Video: So ernten wir in Japan \r\nMeeresalgen. Auch in einer praktischen 50-Blatt-Vorratspackung erhältlich. \r\nWillst du mit eigenen Augen sehen, wo unsere Meeresalgen geerntet werden? Sieh \r\ndir dieses Video an.', 'TerraSana Natuurvoeding BV', 'TerraSana', 'SOUTH_KOREA', '106a3118-6013-46b4-ba2f-72b7b6d7a709', 'manager', '2021-08-12 12:38:57', 'manager', '2023-02-02 10:54:31', 971, 625, NULL, NULL, 0, 3.7, 'Weiling', 0, NULL, 0, NULL, NULL, '2023-02-03 11:13:07', NULL, 'CONVENIENCE_PRESERVES', 'PANTRY', NULL, NULL, NULL, NULL, NULL),
(496, 'Wakame Bio (Weiling)', '8713576271270', 1, 12.99, 1, 1, NULL, 0, '450124', 'Wakame Bio', 'Wakame ist eine dunkelgrüne, etwas glatte Meeresalge, die herrlich zu sauer  eingelegtem Gemüse passt wie etwa sauren Gurken oder Rüben. Außerdem wird die  Wakame in Japan oft verwendet, um Salate und Suppe damit zu ergänzen. Die  Wakame wird auf Taunetze im geschützten Ise-Shima-Gebiet in Japan aufgepfropft  und später von Hand geerntet. Diese Meeresalgen sind komplett biologisch  zertifiziert. Willst du mit eigenen Augen sehen, wo unsere Meeresalgen geerntet  werden? Sieh dir dieses Video an.', 'TerraSana Natuurvoeding BV', 'TerraSana', 'JAPAN', '2a05e37c-8c00-4891-bad4-47d6bbfcd0c6', 'manager', '2021-08-12 12:39:07', 'System', '2024-01-05 02:05:45', 1580, 626, 0, NULL, 0, 8.02, 'Weiling', 0, NULL, 0, 120, 'Wakame* *aus kontrolliert ökologischer Erzeugung', '2022-11-29 17:06:51', 1768, 'CONVENIENCE_PRESERVES', 'PANTRY', 71, 26, 'VEGAN;VEGETARIAN;GLUTENFREE', NULL, NULL),
(497, 'Tamari strong Premium (Weiling)', '8713576271225', 0, 20.99, 1, 1, NULL, 0, '450157', 'Tamari strong Premium', 'Tamari ist eine kräftige, glutenfreie japanische Sojasauce, die aus Sojabohnen  und Koji (einem einzigartigen japanischen Edel-Schimmelpilz) hergestellt wird.  Unsere Tamari wird auf traditionelle Weise von echten japanischen Fachleuten  hergestellt und benötigt eine Fermentationszeit von sage und schreibe  18Monaten. Dies geschieht in 100 Jahre alten Zedernholzfässern. Der Geschmack  der Tamari ist herrlich komplex und enthält alle fünf Geschmäcker: Salzig,  Sauer, Süß, Bitter und Umami. Mit dieser japanischen Sojasauce bringst du  wirklich jedes Gericht auf ein höheres Niveau: (Miso-)Suppen, Nudelgerichte,  Marinaden, Sushi und auch Eintopfgerichte! Willst du einmal mit eigenen Augen  sehen, wie unsere Tamari in Japan hergestellt wird?Sieh dir dieses Video an.  Auch erhältlich in 125ml, 250ml und 500ml.', 'TerraSana Natuurvoeding BV', 'TerraSana', 'JAPAN', 'aba8fd61-8f85-45ef-97ed-705c6112747c', 'manager', '2021-08-12 12:39:15', 'System', '2023-11-29 02:11:55', 961, 627, 0, NULL, 0, 12.68, 'Weiling', 0, NULL, 0, 120, 'SOJAbohnen*, Wasser, Meersalz, Shochu gesalzen* (Wasser, Reis*, Salz, Koji-Ferment), Koji-Ferment *aus kontrolliert ökologischer Erzeugung', '2023-06-20 09:13:13', 1914.63, 'OIL_VINEGAR_SAUCES', 'PANTRY', 1456, 26.5, 'VEGAN;VEGETARIAN;GLUTENFREE', NULL, NULL),
(498, 'Dinkel Poppies Honig (Weiling)', '4016249006785', 0, 5.29, 1, 1, NULL, 0, '440007', 'Dinkel Poppies Honig', 'Wir bei Allos wollen es dir leicht machen, dich natürlich zu ernähren. Angefangen hat alles auf einem kleinen Hof in Niedersachsen. Hier produzieren wir auch heute noch und suchen immer weiter nach neuen Wegen, u leckere Produkte herzustellen, die nicht nur dir schmecken, sondern auch unserem Planeten.\nDas alles tun wir, damit du sagst:\nAllos - natürlich gut für mich.', 'Allos Hof-Manufaktur GmbH', 'Allos', 'GERMANY', 'e7d8f3c2-d020-41f8-afc6-82cca941a376', 'correction', '2021-09-17 14:59:27', 'System', '2023-12-13 02:10:08', 617, 276, 0, NULL, 0, 3.2, 'Weiling', 2, 1, 0, 60, NULL, '2023-03-02 15:45:55', 2142, 'MUISLI_FLAKES_NUTS', 'PANTRY', 316, 25.5, 'VEGETARIAN', NULL, NULL),
(499, 'Amaranth Crunchy Pur (Weiling)', '4016249009236', 0, 4.39, 1, 1, NULL, 0, '480118', 'Amaranth Crunchy Pur', 'Wir machen ja nicht gerne viel Lärm um unsere Produkte. Aber bei unseren leckeren\nCrunchys ist das nicht so leicht. Denn diesen Genuss kann man einfach nicht überhören.\nMit ganz viel Geschmack, 100% Vollkorn, jeder Menge Ballaststoffe aber keinem Tropfen\nPalmöl sind sie die Cerealien der Wahl für alle, die es schon am Morgen gerne krachen\nlassen. Tja, der Crunch-Faktor macht eben den Unterschied.', 'Allos Hof-Manufaktur GmbH', 'Allos', 'GERMANY', 'cfaaedbc-2918-4e4e-9794-cef076c87da1', 'manager', '2021-08-12 12:39:34', 'System', '2023-06-26 10:08:21', 359, 628, 0, NULL, 0, 2.9, 'Weiling', 0, NULL, 0, 60, 'HAFERVOLLKORNFLOCKEN*, Amaranthcornflakes* (11%) (Mais* gemahlen, Amaranthvollkorn* gemahlen (29%), Honig (5%), Glukosesirup*, Meersalz),  Agavendicksaft* (9%) , Reissirup*, Amaranthvollkorn* gemahlen und gepoppt (6%),  Reiscrispies* (Reis* gemahlen), Kartoffelstärke*, Sonnenblumenöl*, Leinsaat*, DINKELVOLLKORNMEHL*, Honig* (2%), SESAM*, Meersalz, Antioxidationsmittel: stark tocopherolhaltige Extrakte. *aus ökologischem Anbau.', '2022-05-23 14:44:44', 2100, 'MUISLI_FLAKES_NUTS', 'PANTRY', 410, 25, 'VEGETARIAN', NULL, NULL),
