(503, 'Hof Müsli Bircher (Weiling)', '4016249131883', 0, 5.49, 1, 1, NULL, 0, '480926', 'Hof Müsli Bircher', 'Seit mehr als 40 Jahren sorgen wir mit einer gehörigen Portion Pionier-Geist für ausgewogenen Frühstücksgenuss. Dass es da Klassiker gibt, die sich seit vielen Jahren großer Beliebtheit erfreuen und auch heute noch ganz unverändert auf dem Allos Hof hergestellt werden, ist doch klar. Hier sind unsere bewährten Klassiker zum pur genießen: Eine leckere Auswahl an puren, ungesüßten Müslis mit vollwertigem oder – durch ihre Würzung – ganz eigenem Charakter. Mit Getreidevollkornflocken, Saaten, Nüssen, wertvollem Amaranth oder anderen sorgfältig ausgewählten Rohstoffen in bester Bio-Qualität. Lasst es Euch schmecken.', 'Allos Hof-Manufaktur GmbH', 'Allos', 'GERMANY', 'e4d513d2-61a7-434f-8192-8ff865d77309', 'manager', '2021-08-12 12:40:15', 'System', '2023-11-25 02:12:48', 803, 1789, 0, NULL, 0, 3.78, 'Weiling', 0, NULL, 0, 60, 'HAFERVOLLKORNFLOCKEN* (66%), Rosinen* (16%), Amaranthvollkorn*  gepoppt und gemahlen (12%), Apfelstücke*  getrocknet (3%), HASELNÜSSE* geröstet (2%), MANDELN* gehackt und geröstet (1%), Sonnenblumenöl*. *aus ökologischem Landbau.', '2022-11-29 16:23:07', 2234.86, 'MUISLI_FLAKES_NUTS', 'PANTRY', 660, 24.7, 'VEGAN;VEGETARIAN', NULL, NULL),
(504, 'Amaranth Basis Müsli (Weiling)', '4016249164089', 0, 4.29, 1, 1, NULL, 0, '481110', 'Amaranth Basis Müsli', 'Zugegeben! Amaranth, das Superkorn der Inkas, ist schon uralt. Viel älter als wir. Aber wir haben es 1982 als Erste nach Deutschland gebracht. Reich an Ballaststoffen, Magnesium, Eisen und Proteinen. Als Frühstücksexperten finden wir es ideal für unsere Müslis und Breie. Die Rezepturen enthalten 20% frisch gepoppten Amaranth. Dazu – je nach Sorte – Beeren, Nüsse und weitere leckere, vollwertige Zutaten. Genau richtig, um schnell und langanhaltend Energie zu tanken: für die Schule, das Studium und den Job.', 'Allos Hof-Manufaktur GmbH', 'Allos', 'GERMANY', '1b28de56-5c82-492f-96fe-31f6acd52d26', 'manager', '2021-08-12 12:40:24', 'System', '2023-11-25 02:13:10', 357, 631, 0, NULL, 0, 2.9, 'Weiling', 0, NULL, 0, 60, 'HAFERVOLLKORNFLOCKEN*, Amaranthvollkorn* gepoppt (20%), Hirsevollkornflocken*, Honig* (5%), Leinsaat*, SESAM*, DINKELVOLLKORN* (eine WEIZENart) gepoppt, Amaranthcornflakes* (Mais* gemahlen, Amaranth* gemahlen, Honig*, Glukosesirup*, Meersalz), Buchweizen*, Palmöl*, Agavendicksaft*, Apfelsaftkonzentrat*. *aus ökologischem Landbau.', '2022-11-29 15:43:37', 1508, 'MUISLI_FLAKES_NUTS', 'PANTRY', 384, 20, 'VEGETARIAN', NULL, NULL),
(505, 'Das Ungesüßte Beeren-Müsli (Weiling)', '4016249198275', 0, 4.99, 1, 1, NULL, 0, '481153', 'Das Ungesüßte Beeren-Müsli', 'Es kommt nicht oft vor, dass man etwas weglassen kann, ohne dass einem etwas fehlt.\nWir haben das Gefühl, bei unseren ungesüßten Müslis ist uns das gelungen. Was denkt\nihr? Ohne zugesetzten Zucker lassen sie nichts vermissen, was man von einem richtig\nguten Müsli erwartet: 100% Bio, absolut lecker, wirklich ballaststoffreich, voller\nVollkornflocken. Dem haben wir nichts hinzuzufügen – außer: Guten Appetit!', 'Allos Hof-Manufaktur GmbH', 'Allos', 'GERMANY', '20dd9dcc-6105-4b68-a5dd-68f3a00f0370', 'correction', '2021-09-17 15:12:20', 'System', '2023-06-09 02:07:07', 1439, 284, 0, NULL, 0, 3, 'Weiling', 2, 1, 0, 60, NULL, '2023-02-28 10:31:00', 1658.8, 'MUISLI_FLAKES_NUTS', 'PANTRY', 509, 22, 'VEGAN;VEGETARIAN', NULL, NULL),
