(508, 'Der Ungesüsste 3-Korn-Brei (Weiling)', '4016249236908', 0, 4.99, 1, 1, NULL, 0, '481160', 'Der Ungesüsste 3-Korn-Brei', 'Wer gerne morgens mit einer warmem Mahlzeit in den Tag startet, für den haben wir hier\neinen heißen Tipp: unsere leckeren Porridges mit ballaststoffreichen Vollkornflocken und\nschmackhaften Früchten – raffiniert garniert mit tollen Gewürzen und köstlichem\nAmaranth. So eine Frühstücksbowl lässt sich natürlich auch noch hervorragend nach Lust\nund Laune verfeinern, mit allem was man sonst noch so mag. Bei so viel Sorgfalt und\nLiebe wird einem auch gleich noch ganz warm ums Herz.', 'Allos Hof-Manufaktur GmbH', 'Allos', 'GERMANY', '07b428bf-82d5-4f43-bb96-0a96e6d155d1', 'correction', '2021-09-17 15:13:50', 'System', '2023-11-25 02:10:39', 606, 287, 0, NULL, 0, 3, 'Weiling', 2, 1, 0, 60, NULL, '2023-02-28 10:31:15', 1841.4, 'MUISLI_FLAKES_NUTS', 'PANTRY', 509, 22, 'VEGAN;VEGETARIAN', NULL, NULL),
