(510, 'Entdecker Müsli Schoko (Weiling)', '4016249277413', 0, 5.99, 1, 1, NULL, 0, '481172', 'Entdecker Müsli Schoko', 'Langeweile beim Frühstück? Nicht mit der Allos Hof-Bande und ihren neuen Entdecker-Müslis!\nNatürlich leckeres Müsli, das Spaß macht: Die Allos Entdecker-Müslis sind speziell für die Bedürfnisse von Kindern entwickelt. Spannende Formen, bunte Farben sowie kleine Rätsel auf der Packung sorgen für die extra Portion Spaß am Frühstückstisch. Als Bio-Pionier wissen wir, wie wichtig eine gesunde und vollwertige Ernährung für Kinder ist und welche Nährwerte ideal sind.', 'Allos Hof-Manufaktur GmbH', 'Allos', 'GERMANY', '7ff682e6-e3f5-461f-a4e8-d851b43ab8ee', 'manager', '2021-08-12 12:41:24', 'System', '2022-04-11 15:40:03', 660, 632, 0, NULL, 0, 3.75, 'Weiling', 0, NULL, 0, NULL, NULL, '2022-04-11 15:40:03', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL),
