(514, 'Cornflakes Original  (Weiling)', '4021234402336', 0, 3.79, 1, 1, NULL, 0, '480360', 'Cornflakes Original ', 'Goldgelbe Bio-Cornflakes - traditionell gewalzt, und nicht extrudiert!\nDas traditionelle Verfahren zur Herstellung von Cornflakes ist das Walzen. Diese Methode ist etwas teurer, aber dafür viel schonender.\nDie Maiskörner werden geschnitten und mit Maissirup und Meersalz aufgekocht. Bei dieser Prozedur wird die Stärke aufgeschlossen, also für uns verdaubar gemacht. Die Stärkestruktur des Maiskorns wird dabei aber erhalten, unser Organismus baut die gewalzten Flakes langsamer ab. Deshalb machen sie länger satt. Nach dem Kochprozeß werden die Cornflakes sanft geröstet, damit sie schön knusprig schmecken.  ', 'Barnhouse Naturprodukte GmbH', 'Barnhouse ', 'SWITZERLAND', '52e71877-915a-4095-b3a2-d2d4269b5c8b', 'manager', '2021-08-12 12:42:04', 'System', '2023-09-07 03:07:51', 577, 636, 0, NULL, 0, 2.31, 'Weiling', 0, NULL, 0, 297, 'Mais* 91%, Maissirup* 6%, Meersalz, Emulgator: Sonnenblumenlecithin*   *aus biologischer Landwirtschaft', '2023-06-09 09:32:10', 3830.4, 'MUISLI_FLAKES_NUTS', 'PANTRY', 434, 28, 'VEGAN;VEGETARIAN;PALMOILFREE', NULL, NULL),
