(516, 'Krunchy Amaranth Dinkel-Nuss 375g (Weiling)', '4021234101215', 0, 3.99, 1, 1, NULL, 0, '480410', 'Krunchy Amaranth Dinkel-Nuss 375g', 'Vollkorn-Dinkelflocken, gepuffter Amaranth sowie geröstete Cashews und Mandeln vereinen wir zu einem köstlichen Knusper-Frühstück. Die alternative Süße mit Agaven- und Reissirup rundet die Rezeptur mit einem Tick Fruchtigkeit ab. MIt 100% regionalem Hafer unserer Partner-Landwirte. Ohne Palmöl.\nAmaranth liefert diesem Krunchy nicht nur wertvolle Inhaltsstoffe, sondern unterstreicht mit seinem fein-nussigen Geschmack auch das Aroma der Cashewkerne und gehobelten Mandeln. So kann der Tag beginnen...', 'Barnhouse Naturprodukte GmbH', 'Barnhouse ', 'GERMANY', '32d32b59-1477-4c45-8dbb-810426085793', 'manager', '2021-08-12 12:42:23', 'System', '2023-06-26 10:02:16', 1307, 638, 0, NULL, 0, 2.99, 'Weiling', 0, NULL, 0, 64, 'Dinkelvollkornflocken* (WEIZENART) 50%, Agavensirup*, Reissirup*, Sonnenblumenöl*, Reisextrudat* (Reismehl*, GERSTENMALZMEHL*, Meersalz), Kokosraspel*, MANDELN* 4,5%, CASHEWKERNE* 4,5%, Dinkelvollkornmehl* (WEIZENART), Amaranth* gepufft 2,6%   *aus biologischer Landwirtschaft', '2022-09-10 00:06:45', 1201.75, 'MUISLI_FLAKES_NUTS', 'PANTRY', 379.1, 19, 'VEGAN;VEGETARIAN;PALMOILFREE', NULL, NULL),
