(528, 'Dinkel-Früchte-Müsli, demeter (Weiling)', '4022381017053', 0, 4.79, 1, 1, NULL, 0, '486027', 'Dinkel-Früchte-Müsli, demeter', 'Wenn Ihr Bauchgefühl sich für ein Müsli entscheidet, dann ist es gut. Und wenn dank der guten Zutaten Körper, Seele und Verstand in Harmonie sind, schmeckt es sicher noch besser. Unser Dinkel-Früchte-Müsli ist ein klassisches Frühstücks-Müsli mit einem hohen 45 %-Anteil vollreifer Trockenfrüchte. Und mit viel Dinkel pur als Kraftquelle, auch für empfindliche Menschen gut verträglich. \nDazu trägt auch die anthroposophische Ernährungslehre bei. Sie bringt kosmische Einflüsse mit irdischen Gegebenheiten in Verbindung. Jeder unserer Planeten steht danach in besonderer Beziehung zu einem Wochentag – und zu jeweils einer der Getreidearten unserer Müslis. Energie und Wirkung der jeweiligen Getreideart wird in dieser Konstellation besonders erlebbar.', 'Spielberger GmbH', 'Spielberger Mühle', 'Dinkel aus Deutschland', '524c180e-49b9-46ef-b651-69d17dfed88e', 'manager', '2021-08-12 12:44:13', 'System', '2023-11-29 02:08:04', 615, 650, 2, NULL, 0, 2.99, 'Weiling', 0, NULL, 0, 64, 'Trockenfrüchte 45% [Sultaninen (Sultaninen**, Sonnenblumenöl*), Aprikosen getrocknet, gehackt**, Datteln getrocknet, gehackt**, Feigen getrocknet, gehackt**, Äpfel getrocknet, gehackt**, Bananenchips (getrocknete Bananen*, Kokosnussöl*, Rohrohrzucker*, Honig*)], DINKELFLOCKEN Kleinblatt** 20%, DINKELFLOCKEN Großblatt** 15%, DINKELFLAKES 10% (DINKEL**, Meersalz), DINKEL geschliffen und gepoppt* 5%, Sonnenblumenkerne geröstet**, Reismehl** *aus kontrolliert ökologischer Erzeugung **aus biodynamischer Erzeugung', '2022-04-11 14:43:45', 1386, 'MUISLI_FLAKES_NUTS', 'PANTRY', 516, 22, 'VEGETARIAN', NULL, NULL),
(529, 'Erdnusskerne, roh, geschält, EG Bio, MMP-gr, 325g (Weiling)', '0805627032041', 0, 4.59, 1, 1, NULL, 0, '506200', 'Erdnusskerne, roh, geschält, EG Bio, MMP-gr, 325g', 'Unsere rohen Erdnüsse enthalten 25% Eiweiß und sind deshalb eine ausgezeichnete Proteinquelle. Naturbelassen, ungesalzen und ohne Zusätze kommen die Nüsschen in unser Glas und halten sich darin richtig lange frisch. Weil Erdnüsse auch viel wertvolles Fett enthalten ist es besonders wichtig, dass sie in unserem Glas keinen Schadstoffen und Weichmachern ausgesetzt sind, mit dem das Fett reagieren könnte. \n\nKleiner Tipp: Wer die Nüsschen lieber mit mehr Geschmack mag, kann sie sich einfach selbst in der Pfanne rösten. Ein bisschen Thymian, Salz oder vielleicht sogar Karamell dazu und fertig ist der köstliche Snack für zwischendurch!  \n', 'Unverpackt Umgedacht GmbH', 'Unverpackt für alle', 'GERMANY', 'a31fabfe-1f65-4767-992f-c938c34f8577', 'manager', '2021-08-12 12:44:21', 'System', '2023-01-16 17:57:28', 666, 651, 0, NULL, 0, 2.43, 'Weiling', 0, NULL, 0, 61, NULL, '2022-09-15 02:05:02', 953.694, 'OTHER', 'OTHER', 547, 12.6, 'VEGAN;VEGETARIAN', NULL, NULL),
(530, 'Cashewkerne, Großbruch, im Pfandglas (Weiling)', '4035661162800', 0, 6.99, 1, 1, NULL, 0, '506003', 'Cashewkerne, Großbruch, im Pfandglas', 'Die bioladen*Cashewkerne kommen aus unserem bioladen*Fair Projekt aus Burkina Faso. Mit dem Kauf gehen pro Glas 10 Cent in dieses Projekt. Sie wollen mehr zum Projekt erfahren, dann schauen Sie auf bioladen.de/qr/burkinafaso. Die Herstellung der Cashews ist reine Handarbeit. Im Geschmack sind sie mild nussig und leicht süßlich. Man kann sie gut für Saucen, in Pestos, in Gebäck oder einfach als Snack verwenden. (Es handelt sich um ungeröstete und ungesalzene Ware im Mehrwegglas.)', 'Weiling GmbH', 'bioladen', 'GERMANY', '57c6962c-159f-4133-a3ff-8185fd3915d4', 'manager', '2021-08-12 12:44:34', 'System', '2023-10-14 02:07:15', 451, 652, 0, NULL, 0, 4.05, 'Weiling', 0, NULL, 0, 62, NULL, '2022-11-29 15:51:31', 953.694, 'OTHER', 'OTHER', 501, 12.6, 'VEGAN;VEGETARIAN', NULL, NULL),
