(532, 'Cashewkerne, Großbruch (Weiling)', '4035626110938', 0, 11.99, 1, 1, NULL, 0, '506006', 'Cashewkerne, Großbruch', 'Die bioladen*Cashewkerne kommen aus unserem bioladen*Fair Projekt aus Burkina Faso. Mit dem Kauf gehen pro Verpackung 10 Cent in dieses Projekt. Sie wollen mehr zum Projekt erfahren, dann schauen Sie auf bioladen.de/qr/burkinafaso. Die Herstellung ist reine Handarbeit. Im Geschmack sind sie mild-nussig und leicht süßlich. Man kann sie gut für Saucen, in Pestos, in Gebäck oder einfach als Snack verwenden. (Es handelt sich um ungeröstete und ungesalzene Ware.)', 'Weiling GmbH', 'bioladen', 'GERMANY', '897bd799-3a62-4297-8f15-fb9a528a1de0', 'manager', '2021-08-12 12:44:52', 'System', '2023-01-16 17:57:34', 1485, 654, 0, NULL, 0, 7.49, 'Weiling', 0, NULL, 0, 60, NULL, '2022-11-29 15:51:42', 1188, 'OTHER', 'OTHER', 505, 22, 'VEGAN;VEGETARIAN', NULL, NULL),
(533, 'Haselnusskerne (Weiling)', '4035626110976', 0, 8.99, 1, 1, NULL, 0, '506010', 'Haselnusskerne', 'Unsere Haselnüsse werden in der Türkei und Aserbaidschan angebaut. Sie sind angenehm würzig und herzhaft im Geschmack. Gut machen sie sich in Backwaren oder zum Rohverzehr.  (Es handelt sich bei der Ware um ganze Nüsse)\n', 'Weiling GmbH', 'bioladen', 'GERMANY', '15267c62-33d9-495a-a2d2-c64bdb31d3b5', 'manager', '2021-08-12 12:45:01', 'System', '2023-01-16 17:57:36', 1490, 655, 0, NULL, 0, 6.24, 'Weiling', 0, NULL, 0, 60, NULL, '2022-09-10 00:05:51', 1134, 'OTHER', 'OTHER', 505, 21, 'VEGAN;VEGETARIAN;RAWFOOD', NULL, NULL),
(534, 'Kokoschips (Weiling)', '4035626110990', 0, 2.69, 1, 1, NULL, 0, '506012', 'Kokoschips', 'Die Herkunft der Kokoschips sind je nach Verfügbarkeit die Philippinen oder Sri Lanka. Sie haben das typische Kokosaroma und passen somit perfekt zum Müsli oder zum Backen. (Es handelt sich um ungesüßte Ware.)\n', 'Weiling GmbH', 'bioladen', 'GERMANY', 'e8ca8aaa-cb6b-4097-9729-a93726402be0', 'manager', '2021-08-12 12:45:10', 'System', '2023-11-08 02:12:57', 483, 656, 0, NULL, 0, 1.68, 'Weiling', 0, NULL, 0, 60, NULL, '2022-11-29 15:53:25', 1296, 'CONVENIENCE_PRESERVES;MUISLI_FLAKES_NUTS;OTHER', 'PANTRY;OTHER', 205, 24, 'VEGAN;VEGETARIAN', NULL, NULL);
