(535, 'Kokosraspel (Weiling)', '4035626111027', 0, 2.99, 1, 1, NULL, 0, '506014', 'Kokosraspel', 'Die Herkunft der Kokosraspel sind je nach Verfügbarkeit die Philippinen oder Sri Lanka. Sie haben das typische Kokosaroma und passen somit perfekt zum Müsli oder zum Backen. (Es handelt sich um ungesüßte Ware.)', 'Weiling GmbH', 'bioladen', 'GERMANY', 'e0aed3cc-0305-45bc-829d-bdd642248e94', 'manager', '2021-08-12 12:45:19', 'System', '2023-07-07 02:04:23', 488, 657, 0, NULL, 0, 1.74, 'Weiling', 0, NULL, 0, 60, NULL, '2022-09-10 00:05:47', 1080, 'CONVENIENCE_PRESERVES;MUISLI_FLAKES_NUTS;OTHER', 'PANTRY;OTHER', 255, 20, 'VEGAN;VEGETARIAN', NULL, NULL),
(536, 'Mandeln (Weiling)', '4035626111041', 0, 6.99, 1, 1, NULL, 0, '506016', 'Mandeln', 'Die Mandeln werden in Spanien angebaut. Sie haben ein mildes, angenehm süßes Aroma. Sie können zum Beispiel roh oder in Backwaren verzehrt werden. (Es handelt sich um ungeschälte Ware.)\n', 'Weiling GmbH', 'bioladen', 'GERMANY', '878fa01f-d17e-4618-ab40-430905e073ec', 'correction', '2021-08-20 10:35:21', 'System', '2023-01-16 17:57:41', 1498, 658, 0, NULL, 0, 4.36, 'Weiling', 0, NULL, 0, 60, NULL, '2022-05-17 03:15:10', 556.875, 'OTHER', 'OTHER', 253, 16.5, 'VEGAN;VEGETARIAN;RAWFOOD', NULL, NULL),
(537, 'Paranusskerne, im Pfandglas (Weiling)', '4035661162923', 0, 5.69, 1, 1, NULL, 0, '506019', 'Paranusskerne, im Pfandglas', 'Die auch Butternuss genannte Paranuss wird in Bolivien angebaut. Sie ist fest und leicht salzig im Geschmack. Verwenden kann man sie perfekt in Backwaren, Salaten oder in Süßspeisen, wie zum Beispiel Pudding. (Es handelt sich um ungeröstete und ungesalzene Ware im Mehrwegglas.)\n', 'Weiling GmbH', 'bioladen', 'GERMANY', '9c23c7d9-26a9-408f-9682-3b81097a96b5', 'manager', '2021-08-12 12:45:55', 'System', '2023-10-14 02:11:55', 498, 659, 0, NULL, 0, 3.43, 'Weiling', 0, NULL, 0, 62, NULL, '2022-05-24 10:03:52', 509.6, 'OTHER', 'OTHER', 335, 10.4, 'VEGAN;VEGETARIAN', NULL, NULL),
(538, 'Macadamianüsse (Weiling)', '4035626111089', 0, 4.59, 1, 1, NULL, 0, '506020', 'Macadamianüsse', 'Die sehr knusprigen Macadamianüsse kommen aus Kenia. Sie sind sehr lecker um sie roh zu verzehren, aber auch in Backwaren oder in Eiscreme passen sie hervorragend. (Es handelt sich um ungeröstete und ungesalzene Ware.)\n\n', 'Weiling GmbH', 'bioladen', 'GERMANY', 'fdc87a3f-92d8-4f69-af0b-d21e1905ef33', 'manager', '2021-08-12 12:46:04', 'System', '2023-11-08 02:13:04', 491, 660, 0, NULL, 0, 3.11, 'Weiling', 0, NULL, 0, 60, NULL, '2022-08-31 00:02:44', 489.375, 'OTHER', 'OTHER', 103, 14.5, 'VEGAN;VEGETARIAN;RAWFOOD', NULL, NULL),
(539, 'Walnusskerne gehackt 2-4 mm (Weiling)', '4035626116107', 0, 2.99, 1, 1, NULL, 0, '506025', 'Walnusskerne gehackt 2-4 mm', 'Unsere Walnüsse, aus denen später unsere gehackten Walnüsse entstehen, kommen aus Moldawien. Sie sind angenehm herb-nussig mit einer leicht bitteren Note im Geschmack. Perfekt fürs Backen und Kochen.', 'Weiling GmbH', 'bioladen', 'GERMANY', '3f3a4f16-726f-4010-9b23-2da54541c278', 'manager', '2021-08-12 12:46:23', 'System', '2023-03-04 02:06:53', 1502, 661, 0, NULL, 0, 1.68, 'Weiling', 0, NULL, 0, 60, NULL, '2022-11-07 10:07:58', 356.5, 'OTHER', 'OTHER', 103, 15.5, 'VEGAN;VEGETARIAN', NULL, NULL),
(540, 'Walnussbruch (Weiling)', '4065626114438', 0, 4.49, 1, 1, NULL, 0, '506027', 'Walnussbruch', 'Die Walnüsse kommen aus Moldawien. Im Geschmack sind sie herb-nussig mit leicht bitterem Ton. Sie können perfekt für Backwaren verwendet werden.\n', 'Weiling GmbH', 'bioladen', 'GERMANY', '7f0382af-7f78-445d-bf30-fc0d9ae44ac9', 'manager', '2021-08-12 12:46:31', 'System', '2023-01-16 17:57:48', 524, 662, 0, NULL, 0, 2.8, 'Weiling', 0, NULL, 0, 72, NULL, '2022-11-29 15:55:10', 556.875, 'OTHER', 'OTHER', 205, 16.5, 'VEGAN;VEGETARIAN', NULL, NULL),
(541, 'Studentenfutter (Weiling)', '4035626111164', 0, 3.99, 1, 1, NULL, 0, '506028', 'Studentenfutter', 'Eine perfekte Mischung aus Nuss und Frucht. Die knackigen etwas herzhafteren Nüsse harmonieren perfekt in der Kombination mit den weicheren und süßlichen Trockenfrüchten. (Mischung aus 47% Nüssen und 53% Trockenfrüchten)', 'Weiling GmbH', 'bioladen', 'GERMANY', '9eaa1172-05cd-4098-b07e-7226a05e7c6a', 'manager', '2021-08-12 12:46:41', 'System', '2023-01-16 17:57:50', 508, 663, 0, NULL, 0, 2.49, 'Weiling', 0, NULL, 0, 60, 'Weinbeeren* geölt (Weinbeeren*, Sonnenblumenöl*), Sultaninen* geölt (Sultaninen* Sonnenblumenöl*), CASHEWKERNE*, HASELNUSSKERNE*, MANDELN*, WALNUSSKERNE* halbe *aus kontrolliert ökologischer Erzeugung', '2022-05-17 03:15:33', 590.625, 'MUISLI_FLAKES_NUTS', 'PANTRY', 253, 17.5, 'VEGAN;VEGETARIAN', NULL, NULL),
(542, 'Kerniger Nuss-Mix (Weiling)', '4035626111188', 0, 4.99, 1, 1, NULL, 0, '506030', 'Kerniger Nuss-Mix', 'Ein toller Nuss-Mix bei dem die etwas süßlichen und milderen Nüsse wie Cashewkerne, Mandeln und Paranusskerne auf die etwas aromatisch herberen Nüssen wie Haselnusskerne und Walnusskerne treffen.\n', 'Weiling GmbH', 'bioladen', 'GERMANY', '1da06390-d6ae-4900-99cb-b24ceb5f9aec', 'manager', '2021-08-12 12:46:50', 'System', '2023-08-16 02:08:29', 481, 664, 0, NULL, 0, 3.1, 'Weiling', 0, NULL, 0, 72, 'CASHEWKERNE*, HASELNUSSKERNE*, HASELNUSSKERNE geröstet*, MANDELN*, PARANUSSKERNE*, WALNUSSKERNE* halbe *aus kontrolliert ökologischer Erzeugung', '2022-11-29 15:53:31', 523.125, 'MUISLI_FLAKES_NUTS', 'PANTRY', 204, 15.5, 'VEGAN;VEGETARIAN', NULL, NULL),
(543, 'Pinienkerne (Weiling)', '4035626112246', 0, 8.49, 1, 1, NULL, 0, '506044', 'Pinienkerne', 'Die kleinen im Geschmack mandelartig, aromatisch schmeckenden Pinienkerne passen geschmacklich perfekt zu Salaten, in Pestos oder einfach in der Gemüsepfanne. (Es handelt sich um geschälte Ware.)\n', 'Weiling GmbH', 'bioladen', 'GERMANY', '34b0ac2d-a3c6-4f57-b879-ca172fd627d8', 'manager', '2021-08-12 12:46:59', 'System', '2023-10-14 02:08:44', 503, 665, 0, NULL, 0, 5.3, 'Weiling', 0, NULL, 0, 60, NULL, '2022-05-17 03:14:24', 243, 'OTHER', 'OTHER', 52, 13.5, 'VEGAN;VEGETARIAN;RAWFOOD', NULL, NULL),
(544, 'Walnusskerne, Hälften, im Pfandglas (Weiling)', '4035661162961', 0, 5.99, 1, 1, NULL, 0.15, '506063', 'Walnusskerne, Hälften, im Pfandglas', 'Die Walnüsse kommen aus Moldawien. Im Geschmack sind sie herb-nussig mit leicht bitterem Ton. Sie können perfekt für Backwaren verwendet werden. (Es handelt sich bei der Ware um Hälften im Mehrwegglas.)\n', 'Weiling GmbH', 'bioladen', 'GERMANY', 'b2b4a133-2589-4a86-99f1-b41546e63702', 'manager', '2021-08-12 12:47:08', 'System', '2023-11-08 02:11:58', 525, 666, 0, NULL, 0, 3.74, 'Weiling', 0, NULL, 0, 62, NULL, '2022-05-23 16:46:52', 953.694, 'OTHER', 'OTHER', 421, 12.6, 'VEGAN;VEGETARIAN', NULL, NULL),
(545, 'Pekannusskerne, Hälften (Weiling)', '4035626113687', 0, 4.99, 1, 1, NULL, 0, '506075', 'Pekannusskerne, Hälften', 'Die Herkunft der Pekannüsse ist Peru und USA. Im  Geschmack sind sie butterig-nussig, leicht süßlich. Sie passen gut in Backwaren, in Müslis oder zum Rohverzehr. (Es handelt sich um ungeröstete und ungesalzene Ware.)\n', 'Weiling GmbH', 'bioladen', 'GERMANY', 'f03ed897-77d2-425d-aabb-678f9a173eda', 'manager', '2021-08-12 12:47:25', 'System', '2023-10-14 02:08:26', 499, 667, 0, NULL, 0, 2.99, 'Weiling', 0, NULL, 0, 72, NULL, '2022-10-10 00:10:39', 455.625, 'OTHER', 'OTHER', 104, 13.5, 'VEGAN;VEGETARIAN;RAWFOOD', NULL, NULL),
(546, 'Peanut Butter creamy (Weiling)', '4016249006884', 0, 3.99, 1, 1, NULL, 0, '510060', 'Peanut Butter creamy', 'Nach traditionellem Rezept zubereitet, mit frisch gerösteten Erdnüssen, keinerlei Zuckerzusätzen und einer Prise Meersalz. Die Allos Peanut Butter gibt es creamy oder crunchy, mit einem sehr hohen Erdnussanteil. Ein echter Klassiker in unserem Sortiment und ein leckerer Brotaufstrich, der auch ideal für die Verfeinerung von Dressings sowie warmen und kalten Saucen ist.', 'Allos Hof-Manufaktur GmbH', 'Allos', 'UNITED_KINGDOM', '91ca01a9-dac1-484c-bbcc-97bb22702d39', 'manager', '2021-08-12 12:47:35', 'System', '2023-01-16 17:57:58', 1158, 668, 0, NULL, 0, 2.58, 'Weiling', 0, NULL, 0, 190, 'geröstete ERDNÜSSE* (91%), Palmöl*, Meersalz. * aus kontrolliert ökologischem Landbau.', '2022-10-19 02:06:16', 443.904, 'SPREADS_HONEY', 'PANTRY', 420, 9.6, 'VEGAN;VEGETARIAN', NULL, NULL),
(547, 'Kürbiskernmus mit Steinsalz alt (Weiling)', '8713576100273', 0, 4.99, 1, 1, NULL, 0, '511124', 'Kürbiskernmus mit Steinsalz alt', 'Hast du gerne etwas Gesundes auf deinem Brot, möchtest aber etwas anderes als  beispielweise Erdnussmus? Dieses geröstete Kürbiskernmus streicht sich  wunderbar und schmeckt köstlich. Du kannst es als Dip, Aufstrich oder als Basis  für eine Sauce und ein Dressing verwenden. Das Beste an diesem  Bio-Kürbiskernmus ist, dass es geschmacklich sowohl zu herzhaften als auch zu  süßen Gerichten passt. Genauso vielseitig wie Erdnussmus! Wir machen dieses  Kürbiskernmus in unserem Hause mit viel Liebe. Das schmeckst du. Probiere auch  unsere anderen Nussmuse!', 'TerraSana Natuurvoeding BV', 'TerraSana', 'NETHERLANDS', '8b599cfd-23be-4111-8ed4-f231f2afef4a', 'manager', '2021-08-12 12:47:43', 'System', '2024-01-28 02:06:00', 1312, 669, 0, NULL, 0, 3.13, 'Weiling', 0, NULL, 0, 120, 'Kürbiskerne geröstet*, Steinsalz *aus kontrolliert ökologischer Erzeugung', '2023-01-25 11:51:27', 441, 'SPREADS_HONEY', 'PANTRY', 420, 9, 'VEGAN;VEGETARIAN;GLUTENFREE', NULL, NULL),
(548, 'Erdnussmus 250ml (Weiling)', '4035626112536', 0, 3.99, 1, 1, NULL, 0, '515600', 'Erdnussmus 250ml', 'Die Erdnüsse für dieses Mus werden geröstet und anschließend extra fein vermahlen. Für eine tolle Konsistenz. Ideal zum Backen, für Desserts oder zu Verwendung in der asiatischen Küche.\n', 'Weiling GmbH', 'bioladen', 'NETHERLANDS', 'a78ece6d-befc-456c-a1a8-8cbbd2e8dc2f', 'manager', '2021-08-12 12:47:52', 'System', '2023-10-14 02:12:19', 460, 670, 0, NULL, 0, 2.34, 'Weiling', 0, NULL, 0, 120, 'geröstete ERDNÜSSE* *aus kontrolliert ökologischer Erzeugung', '2023-07-25 10:28:16', 441, 'SPREADS_HONEY', 'PANTRY', 420, 9, 'VEGAN;VEGETARIAN', NULL, NULL),
(549, 'Erdnussmus Crunchy (Weiling)', '4035661162251', 0, 3.79, 1, 1, NULL, 0, '515601', 'Erdnussmus Crunchy', 'Die Erdnüsse für dieses Erdnussmus Crunchy werden geröstet, anschließend fein vermahlen und in einem extra Arbeitsschritt werden die lecker knackig gerösteten Erdnussstückchen zugeführt. Nicht nur für eine leckere Brotzeit geeignet, auch fürs Backen und Kochen ist es eine hochwertige und leckere Zutat –  besonders in der asiatischen Küche.', 'Weiling GmbH', 'bioladen', 'NETHERLANDS', '4f78c196-b583-413e-8d18-d888fa708df8', 'manager', '2021-08-12 12:48:01', 'System', '2023-10-14 02:09:16', 461, 671, 0, NULL, 0, 2.31, 'Weiling', 0, NULL, 0, 120, 'geröstete ERDNÜSSE* *aus kontrolliert ökologischer Erzeugung', '2023-04-01 15:24:59', 441, 'SPREADS_HONEY', 'PANTRY', 420, 9, 'VEGAN;VEGETARIAN', NULL, NULL),
(550, 'Cashewmus (Weiling)', '4035626112574', 0, 6.79, 1, 1, NULL, 0, '515604', 'Cashewmus', 'Cremig-geschmeidig, feine Röstaromen sorgen für einen herzhaften Karamellgeschmack. Sehr lecker als Brotaufstrich.\n\n', 'Weiling GmbH', 'bioladen', 'NETHERLANDS', 'bfb20386-ac42-45d1-86e2-c274f7d857ca', 'manager', '2021-08-12 12:48:10', 'System', '2023-10-14 02:13:08', 1488, 672, 0, NULL, 0, 4.05, 'Weiling', 0, NULL, 0, 120, 'geröstete CASHEWNÜSSE* *aus kontrolliert ökologischer Erzeugung', '2023-01-26 18:41:42', 441, 'SPREADS_HONEY', 'PANTRY', 420, 9, 'VEGAN;VEGETARIAN', NULL, NULL),
(551, 'Haselnussmus 250ml (Weiling)', '4035626112628', 0, 6.99, 1, 1, NULL, 0, '515608', 'Haselnussmus 250ml', 'Typisch für Haselnüsse ist ein hoher natürlicher Ölgehalt, der dem Mus seine besonders geschmeidige Konsistenz verleiht. Es lässt sich dadurch sehr gut verarbeiten und eignet sich iedeal zum Kochen und Backen. Das Haselnussmus ist leicht herb mit kräftigem Röstaroma, da die Schalen mit vermahlen sind.\n', 'Weiling GmbH', 'bioladen', 'NETHERLANDS', '44fcf7f3-7606-4d6e-99a3-c0651851fa1e', 'manager', '2021-08-12 12:48:20', 'System', '2023-10-14 02:09:01', 473, 673, 0, NULL, 0, 4.36, 'Weiling', 0, NULL, 0, 120, 'geröstete HASELNÜSSE* *aus kontrolliert ökologischer Erzeugung', '2022-09-09 18:45:46', 441, 'SPREADS_HONEY', 'PANTRY', 420, 9, 'VEGAN;VEGETARIAN', NULL, NULL),
(552, 'Mandelmus weiß 250ml (Weiling)', '4035626112666', 0, 9.29, 1, 1, NULL, 0, '515612', 'Mandelmus weiß 250ml', 'Cremig-fein, von Natur aus leicht süßlich. Ungeröstet und ohne Samenschale vermahlen.\n', 'Weiling GmbH', 'bioladen', 'NETHERLANDS', 'db0da5d8-440c-4355-be2a-88a537a1ca73', 'manager', '2021-08-12 12:48:28', 'System', '2023-10-14 02:14:22', 1496, 674, 0, NULL, 0, 5.61, 'Weiling', 0, NULL, 0, 120, 'blanchierte MANDELN* *aus kontrolliert ökologischer Erzeugung', '2023-05-05 09:29:01', 441, 'SPREADS_HONEY', 'PANTRY', 420, 9, 'VEGAN;VEGETARIAN', NULL, NULL),
(553, 'Mandelmus 250ml (Weiling)', '4035626112697', 0, 7.99, 1, 1, NULL, 0, '515616', 'Mandelmus 250ml', 'Süßlich-herb; mit Samenschalen vermahlen. Eignet sich hervorragend für verschiedenste Rezeptideen.\n', 'Weiling GmbH', 'bioladen', 'NETHERLANDS', 'c793e90e-54e4-4d13-9b1d-9d5136ae619d', 'correction', '2021-08-20 10:30:22', 'System', '2023-10-14 02:13:24', 1497, 675, 0, NULL, 0, 5.02, 'Weiling', 0, NULL, 0, 120, 'geröstete MANDELN* *aus kontrolliert ökologischer Erzeugung', '2022-11-29 16:38:13', 441, 'SPREADS_HONEY', 'PANTRY', 420, 9, 'VEGAN;VEGETARIAN', NULL, NULL),
(554, 'Tahin 250ml (Weiling)', '4065626114025', 0, 3.99, 1, 1, NULL, 0, '515624', 'Tahin 250ml', 'Sesam wird schonend gemahlen, so entsteht das Sesammus (Tahin). Probieren Sie doch mal den Süßkartoffel-Sesam-Aufstrich. Das Rezept finden Sie auf www.bioladen.de.\n', 'Weiling GmbH', 'bioladen', 'NETHERLANDS', '5781c221-a78f-41c4-bc89-8d2b1e3c60a9', 'manager', '2021-08-12 12:48:56', 'System', '2023-10-16 10:01:25', 510, 676, 0, NULL, 0, 2.49, 'Weiling', 0, NULL, 0, 120, 'geröstete geschälte SESAMSAMEN*, geröstete ungeschälte SESAMSAMEN* *aus kontrolliert ökologischer Erzeugung', '2023-04-28 09:32:16', 441, 'SPREADS_HONEY', 'PANTRY', 420, 9, 'VEGAN;VEGETARIAN', NULL, NULL),
(555, 'Kokosmus 200ml (Weiling)', '4065626113325', 0, 3.79, 1, 1, NULL, 0, '525194', 'Kokosmus 200ml', 'Kokosnüsse aus Sri Lanka werden fein vermahlen, so entsteht unser 100% Kokosmus. Vielseitig einsetzbar in der kreativen Küche, verleiht es vielen Gerichten die aromatische Kokosnuss-Note.\n', 'Weiling GmbH', 'bioladen', 'SRI_LANKA', '0fc33213-b4e2-46fb-8649-510e75f48c6f', 'manager', '2021-08-12 12:49:05', 'System', '2023-10-14 02:07:21', 485, 677, 0, NULL, 0, 2.05, 'Weiling', 0, NULL, 0, 1016, 'Kokosnüsse* *aus kontrolliert ökologischer Erzeugung', '2022-11-29 16:33:08', 380.25, 'SPREADS_HONEY', 'PANTRY', 366.83, 9, 'VEGAN;VEGETARIAN', NULL, NULL),
(556, 'Distelöl nativ, high linoleic (Weiling)', '3445020007290', 0, 9.99, 1, 1, NULL, 0, '525007', 'Distelöl nativ, high linoleic', 'Distelöl ist der ideale Begleiter der täglichen Vollwerternährung: milder Geschmack und hoher Anteil an mehrfach ungesättigten Fettsäuren.', 'Ölmühle Moog GmbH', 'BIO PLANÈTE', 'FRANCE', '17ddb931-bb23-4f70-9df7-993a9a83af12', 'manager', '2021-08-12 12:49:16', 'System', '2024-01-18 02:05:48', 632, 678, 0, NULL, 0, 5.64, 'Weiling', 0, NULL, 0, 52, NULL, '2022-11-03 00:00:36', 1161.88, 'OIL_VINEGAR_SAUCES', 'PANTRY', 764, 27.5, 'VEGAN;VEGETARIAN;RAWFOOD', NULL, NULL),
(557, 'Sesamöl geröstet (Weiling)', '3445020006699', 0, 4.49, 1, 1, NULL, 0, '525012', 'Sesamöl geröstet', 'Traditionell verwendet in der feinen asiatischen Küche verleiht es auch einheimischen Gerichten mit nur wenigen Tropfen einen nussigen, fernöstlichen Geschmack. Sein herrliches Aroma entfaltet der Sesam durch leichtes Rösten.', 'BIO PLANÈTE Ölmühle Moog SAS', 'BIO PLANÈTE', 'FRANCE', '2a8d1ad1-76f5-48fb-8199-938add44e70e', 'manager', '2021-08-12 12:49:25', 'System', '2023-07-01 00:11:58', 1033, 679, 0, NULL, 0, 2.81, 'Weiling', 0, NULL, 0, 52, NULL, '2022-11-10 00:02:33', 278.712, 'OIL_VINEGAR_SAUCES', 'PANTRY', 257, 15.8, 'VEGAN;VEGETARIAN', NULL, NULL),
(558, 'Rapsöl nativ (Weiling)', '3445020296700', 0, 5.49, 1, 1, NULL, 0, '525014', 'Rapsöl nativ', 'Erste kalte Pressung. \nReich an Omega-3-Fettsäuren.', 'Huilerie Moog SAS', 'BIO PLANÈTE', 'EUROPEAN_UNION', '5e6b3d4e-8935-4d3c-8c95-6d694896ee57', 'manager', '2021-08-12 12:49:35', 'System', '2024-02-08 02:06:14', 1124, 680, 0, NULL, 0, 3.37, 'Weiling', 0, NULL, 0, 52, NULL, '2024-02-03 02:06:29', 1161.88, 'OIL_VINEGAR_SAUCES', 'PANTRY', 764, 27.5, 'VEGAN;VEGETARIAN;RAWFOOD;PALMOILFREE', NULL, NULL),
(559, 'Leinöl nativ (3D-Filtration) (Weiling)', '3445020295901', 0, 6.19, 1, 1, NULL, 0, '525016', 'Leinöl nativ (3D-Filtration)', 'Erste kalte Pressung. Reich an Omega-3-Fettsäuren. Durch unser 3D-Filtrationsverfahren wird die Bitterkeit auf natürliche Weise aus dem Öl entfernt. Mild-nussig im Geschmack passt es ausgezeichnet zu Quark. Unter Schutzatmosphäre (Stickstoff) in eine Lichtschutzflasche abgefüllt.', 'Ölmühle Moog GmbH', 'BIO PLANÈTE', 'FRANCE', '4a46b7e8-8fd3-452f-bb43-c25e1e83de72', 'manager', '2021-08-12 12:49:44', 'System', '2024-02-14 02:05:58', 1324, 681, 0, NULL, 0, 3.76, 'Weiling', 0, NULL, 0, 52, NULL, '2024-02-01 02:06:17', 616.512, 'OIL_VINEGAR_SAUCES', 'PANTRY', 460, 22.8, 'VEGAN;VEGETARIAN;RAWFOOD;PALMOILFREE', NULL, NULL),
(560, 'Olivenöl mittel fruchtig nativ extra (Weiling)', '3445020220705', 0, 9.19, 1, 1, NULL, 0, '525018', 'Olivenöl mittel fruchtig nativ extra', 'Erste Güteklasse – direkt aus Oliven ausschließlich mit mechanischen Verfahren gewonnen. Sein fruchtiges Aroma verleiht Speisen eine angenehme mediterrane Note.', 'BIO PLANÈTE Ölmühle Moog SAS', 'BIO PLANÈTE', 'SPAIN', '154b54a9-9af2-4294-9ffb-eb2aa166884f', 'manager', '2021-08-12 12:49:53', 'System', '2023-12-17 02:51:53', 1172, 682, 0, NULL, 0, 5.51, 'Weiling', 0, NULL, 0, 52, NULL, '2023-07-25 09:51:43', 1161.88, 'OIL_VINEGAR_SAUCES', 'PANTRY', 764, 27.5, 'VEGAN;VEGETARIAN;RAWFOOD', NULL, NULL),
(561, 'Olivenöl fruchtig nativ extra (Weiling)', '3445020222709', 0, 9.19, 1, 1, NULL, 0, '525022', 'Olivenöl fruchtig nativ extra', 'aus der europäischen Union\nErste Güteklasse - direkt aus Oliven ausschließlich mit mechanischen Verfahren gewonnen.', 'Huilerie Moog SAS', 'BIO PLANÈTE', 'aus der europäischen Union', '02596600-887e-4c50-b111-1b2190c2621e', 'manager', '2021-08-12 12:50:11', 'System', '2024-02-08 02:05:14', 1178, 683, 0, NULL, 0, 5.51, 'Weiling', 0, NULL, 0, 52, NULL, '2024-02-07 02:05:19', 1161.88, 'OIL_VINEGAR_SAUCES', 'PANTRY', 764, 27.5, 'VEGAN;VEGETARIAN;RAWFOOD;PALMOILFREE', NULL, NULL),
(562, 'Olivenöl mild nativ extra (Weiling)', '3445020223706', 0, 7.99, 1, 1, NULL, 0, '525024', 'Olivenöl mild nativ extra', 'Mischung von Olivenölen aus der Europäischen Union und aus Drittländern\nErste Güteklasse - direkt aus Oliven ausschließlich mit mechanischen Verfahren gewonnen.', 'Huilerie Moog SAS', 'BIO PLANÈTE', 'Mischung aus Oliven aus der Europäischen Union und aus Drittländern', '55fa7a25-80fb-4f54-bfca-19e20d2805b0', 'manager', '2021-08-12 12:50:24', 'System', '2024-02-08 02:05:53', 1176, 684, 0, NULL, 0, 4.86, 'Weiling', 0, NULL, 0, 52, NULL, '2024-02-07 02:05:40', 1161.88, 'OIL_VINEGAR_SAUCES', 'PANTRY', 764, 27.5, 'VEGAN;VEGETARIAN;RAWFOOD;PALMOILFREE', NULL, NULL),
(563, 'O\'citron Olivenöl & Zitrone (Weiling)', '3445020225908', 0, 6.49, 1, 1, NULL, 0, '525030', 'O\'citron Olivenöl & Zitrone', 'Dieses Feinschmeckeröl wird durch das gemeinsame Pressen erntefrischer Bio-Oliven und bester Bio-Zitronen gewonnen. Mit seiner frischen Note passt es hervorragend zu Meeresfrüchten, Fisch, Gemüse, Salat oder Früchten.', 'Ölmühle Moog GmbH', 'BIO PLANÈTE', 'PORTUGAL', '5b281be6-ea3d-43c1-af77-b2b0507f618c', 'manager', '2021-08-12 12:50:41', 'System', '2024-02-08 02:05:55', 1170, 685, 0, NULL, 0, 3.89, 'Weiling', 0, NULL, 0, 63, 'Olivenöl* (99 %), Auszug aus Zitronen* (1 %) *aus kontrolliert ökologischer Erzeugung', '2024-02-06 02:05:47', 527.951, 'OIL_VINEGAR_SAUCES', 'PANTRY', 513, 23.9, 'VEGAN;VEGETARIAN;RAWFOOD;PALMOILFREE', NULL, NULL),
(564, 'Walnussöl nativ (Weiling)', '3445020290951', 0, 6.99, 1, 1, NULL, 0, '525036', 'Walnussöl nativ', 'Walnussöl ist aus der feinen Küche nicht wegzudenken. Es eröffnet besonders dem kreativen Koch ein großes Variationsspektrum. Greifen Sie ab und zu einmal zum Walnussöl. Selbst einfachste Gerichte erhalten durch Walnussöl das besondere Etwas.', 'BIO PLANÈTE Ölmühle Moog SAS', 'BIO PLANÈTE', 'FRANCE', 'bfa9eb36-ef66-4057-8866-b012fa74937b', 'manager', '2021-08-12 12:50:49', 'System', '2023-04-07 02:06:19', 904, 686, 0, NULL, 0, 4.1, 'Weiling', 0, NULL, 0, 52, NULL, '2022-07-12 14:06:58', 278.712, 'OIL_VINEGAR_SAUCES', 'PANTRY', 264, 15.8, 'VEGAN;VEGETARIAN;RAWFOOD', NULL, NULL),
(565, 'Kürbiskernöl geröstet (Weiling)', '3445020202909', 0, 12.99, 1, 1, NULL, 0, '525050', 'Kürbiskernöl geröstet', 'Die Samenhüllen der Kerne enthalten viel Chlorophyll und Carotin, das verleiht dem Öl eine dunkel leuchtende rot-grüne Farbe. Kürbiskernöl hat einen ausgeprägten Eigengeschmack und ein herrlich fruchtiges, leicht herbes Aroma.', 'BIO PLANÈTE Ölmühle Moog SAS', 'BIO PLANÈTE', 'FRANCE', '3658cb4b-5b14-4335-ab7a-01e3f6e16075', 'manager', '2021-08-12 12:50:59', 'System', '2023-12-17 02:52:48', 1313, 687, 0, NULL, 0, 8.2, 'Weiling', 0, NULL, 0, 52, NULL, '2022-07-12 14:08:16', 616.512, 'OIL_VINEGAR_SAUCES', 'PANTRY', 486, 22.8, 'VEGAN;VEGETARIAN', NULL, NULL),
(566, 'Walnussöl geröstet (Weiling)', '3445020291958', 0, 6.99, 1, 1, NULL, 0, '525056', 'Walnussöl geröstet', 'Mit dem Klassiker der feinen französischen Küche verleihen Sie Ihren Speisen eine besonders edle, nussige Note.', 'BIO PLANÈTE Ölmühle Moog SAS', 'BIO PLANÈTE', 'FRANCE', '4e6bb868-1ba4-4ad5-b62b-c7a43e7ecfe4', 'manager', '2021-08-12 12:51:16', 'System', '2023-04-07 02:05:35', 905, 688, 0, NULL, 0, 4.44, 'Weiling', 0, NULL, 0, 52, NULL, '2022-07-12 14:08:15', 278.712, 'OIL_VINEGAR_SAUCES', 'PANTRY', 269, 15.8, 'VEGAN;VEGETARIAN', NULL, NULL),
(567, 'O\'range Olivenöl & Orange (Weiling)', '3445020226905', 0, 6.49, 1, 1, NULL, 0, '525104', 'O\'range Olivenöl & Orange', 'Die BIO PLANÈTE-Spezialität O’range verwöhnt die Gaumen von Kennern und Genießern mit einer natürlichen, fruchtig-frischen Note – das Resultat eines sensiblen und anspruchsvollen Herstellungsprozesses.', 'BIO PLANÈTE Ölmühle Moog SAS', 'BIO PLANÈTE', 'FRANCE', 'ce9dbe0b-46c3-491f-a38e-f29b91eaa2bb', 'manager', '2021-08-12 12:51:25', 'System', '2023-12-17 02:56:51', 1169, 689, 0, NULL, 0, 3.89, 'Weiling', 0, NULL, 0, 52, 'Olivenöl* (99 %), Auszüge aus Orangen* (1 %) *aus kontrolliert ökologischer Erzeugung', '2023-03-30 19:52:24', 527.951, 'OIL_VINEGAR_SAUCES', 'PANTRY', 500, 23.9, 'VEGAN;VEGETARIAN;RAWFOOD', NULL, NULL),
(568, 'Omega Orange Leinöl-Mixtur (Weiling)', '3445020001878', 0, 7.99, 1, 1, NULL, 0, '525110', 'Omega Orange Leinöl-Mixtur', 'Omega Orange ergänzt im Rahmen einer abwechslungsreichen und ausgewogenen Ernährung sowie einer gesunden Lebensweise die Gesundheitsvorsorge.', 'Ölmühle Moog GmbH', 'BIO PLANÈTE', 'GERMANY', '429b0d03-2a26-4121-8681-5e64190a1826', 'manager', '2021-08-12 12:51:35', 'System', '2023-12-17 02:52:54', 1166, 690, 0, NULL, 0, 4.39, 'Weiling', 0, NULL, 0, 63, 'Leinöl* (80 %), Granatapfelkernöl* (12 %), Blütenpollen* (5 %), ätherisches Orangenöl* (3 %) *aus kontrolliert ökologischer Erzeugung', '2022-11-10 11:06:48', 336.15, 'OIL_VINEGAR_SAUCES', 'PANTRY', 270, 16.6, 'VEGETARIAN', NULL, NULL),
(569, 'Omega Green Leinöl-Mixtur (Weiling)', '3445020001892', 0, 7.49, 1, 1, NULL, 0, '525112', 'Omega Green Leinöl-Mixtur', 'Omega Green ergänzt im Rahmen einer abwechslungsreichen und ausgewogenen Ernährung sowie einer gesunden Lebensweise die Gesundheitsvorsorge.', 'Ölmühle Moog GmbH', 'BIO PLANÈTE', 'GERMANY', '2ef3273f-2c93-419a-b455-c0e7cbe42111', 'manager', '2021-08-12 12:51:44', 'System', '2023-03-30 02:08:07', 1167, 691, 0, NULL, 0, 4.95, 'Weiling', 0, NULL, 0, 63, 'Leinöl* (58 %), Kürbiskernöl* (17 %), Borretschöl*, Schwarzkümmelöl (10 %)* *aus kontrolliert ökologischer Erzeugung', '2022-07-12 14:04:10', 336.15, 'OIL_VINEGAR_SAUCES', 'PANTRY', 268, 16.6, 'VEGAN;VEGETARIAN', NULL, NULL),
(570, 'Brat-Olivenöl (Weiling)', '3445020001755', 0, 8.59, 1, 1, NULL, 0, '525116', 'Brat-Olivenöl', 'Hoch erhitzbar.\nDie vielseitige Alternative zu herkömmlichen Bratölen, reich an Vitamin E. Ideal zum scharfen Anbraten, Backen und Frittieren.', 'Huilerie Moog SAS', 'BIO PLANÈTE', 'NETHERLANDS', '8f18bc8c-6900-4857-9eb1-934381e64583', 'manager', '2021-08-12 12:51:53', 'System', '2024-02-08 02:07:23', 542, 692, 0, NULL, 0, 5.18, 'Weiling', 0, NULL, 0, 52, 'Raffiniertes Olivenöl* (80%), Natives Olivenöl* (20%) *aus kontrolliert ökologischer Erzeugung', '2024-02-06 02:06:47', 1161.88, 'OIL_VINEGAR_SAUCES', 'PANTRY', 764, 27.5, 'VEGAN;VEGETARIAN;PALMOILFREE', NULL, NULL),
(571, 'Omega Pink Leinöl-Mixtur zur Nahrungsergänzung (Weiling)', '4260355580039', 0, 7.49, 1, 1, NULL, 0, '525136', 'Omega Pink Leinöl-Mixtur zur Nahrungsergänzung', 'Omega Pink ergänzt im Rahmen einer abwechslungsreichen und ausgewogenen Ernährung sowie einer gesunden Lebensweise die Gesundheitsvorsorge.', 'Ölmühle Moog GmbH', 'BIO PLANÈTE', 'GERMANY', '48b1645f-6a20-4b4a-b25a-26a95a401727', 'manager', '2021-08-12 12:52:11', 'System', '2023-12-17 02:52:59', 1165, 693, 0, NULL, 0, 4.39, 'Weiling', 0, NULL, 0, 63, 'Leinöl* (65%), Sonnenblumenöl*, Borretschöl*,\nGranatapfelkernöl*, Himbeerpulver, gefriergetrocknet* (3%), natürlicher Zimtrindenextrakt*, Kurkuma*, Pfeffer* *aus kontrolliert ökologischer Erzeugung', '2022-07-12 14:05:42', 336.15, 'OIL_VINEGAR_SAUCES', 'PANTRY', 268, 16.6, 'VEGAN;VEGETARIAN', NULL, NULL),
(572, 'Olivenöl & Chili (Weiling)', '4260355580374', 0, 6.49, 1, 1, NULL, 0, '525178', 'Olivenöl & Chili', 'Ohne Zusatz von Aromastoffen wird dieses Öl durch gleichzeitiges Pressen von Oliven und pikanten Chilischoten gewonnen. Dieses Öl mit seiner leichten Schärfe bietet eine Ausgewogenheit der Aromen, sowohl würzig als auch fruchtig, für eine originelle und kreative Küche. Ob Pizza, Arrabiata-Nudeln, gekochtes Gemüse oder Curry-Gerichte - dieses Würzöl verleiht Ihren Speisen das gewisse Etwas.', 'Ölmühle Moog GmbH', 'BIO PLANÈTE', 'PORTUGAL', '5eee6e10-d5b7-4a92-8b0b-f3f8ba150a28', 'manager', '2021-08-12 12:52:25', 'System', '2024-02-02 02:06:42', 1174, 694, 0, NULL, 0, 3.76, 'Weiling', 0, NULL, 0, 63, 'Olivenöl* (99,9 %), Auszug aus Chili* (0,1 %) *aus kontrolliert ökologischer Erzeugung', '2024-02-02 02:06:42', 278.712, 'OIL_VINEGAR_SAUCES', 'PANTRY', 257, 15.8, 'VEGAN;VEGETARIAN;RAWFOOD;PALMOILFREE', NULL, NULL),
(573, 'Olivenöl & Knoblauch (Weiling)', '4260355580350', 0, 6.49, 1, 1, NULL, 0, '525180', 'Olivenöl & Knoblauch', 'Ohne Zusatz von Aromastoffen wird dieses Öl durch gleichzeitiges Pressen von Oliven und frischem Knoblauch gewonnen. Dieses würzige Öl entwickelt einen intensiven Knoblauchgeschmack, der durch den fruchtigen Geschmack des Olivenöls unterstrichen wird und Gerichten sofort eine mediterrane Note verleiht. Schon wenige Tropfen genügen, um Salate, Marinaden, Fisch und Aioli mit dem gewissen Etwas zu verfeinern.', 'Ölmühle Moog GmbH', 'BIO PLANÈTE', 'PORTUGAL', 'b4ee9062-9da0-44db-94b1-0b11b111c099', 'manager', '2021-08-12 12:52:34', 'System', '2024-02-02 02:07:11', 1173, 695, 0, NULL, 0, 3.76, 'Weiling', 0, NULL, 0, 63, 'Olivenöl* (99,9 %), Auszüge aus Knoblauch* (0,1 %) *aus kontrolliert ökologischer Erzeugung', '2024-02-02 02:07:11', 278.712, 'OIL_VINEGAR_SAUCES', 'PANTRY', 257, 15.8, 'VEGAN;VEGETARIAN;RAWFOOD;PALMOILFREE', NULL, NULL),
(574, 'Omega Blue Leinöl-Mixtur zur Nahrungsergänzung (Weiling)', '3445020001915', 0, 7.49, 1, 1, NULL, 0, '525228', 'Omega Blue Leinöl-Mixtur zur Nahrungsergänzung', 'Omega Blue ist kein Ersatz für eine ausgewogene und abwechslungsreiche Ernährung. Die empfohlene tägliche Verzehrmenge von 25 ml (= 2-3 EL) Omega Blue darf nicht überschritten werden.', 'Ölmühle Moog GmbH', 'BIO PLANÈTE', 'GERMANY', '12737ab3-bb03-4730-8cd6-c797cc73a637', 'manager', '2021-08-12 12:52:44', 'System', '2023-12-17 02:51:40', 1168, 696, 0, NULL, 0, 4.39, 'Weiling', 0, NULL, 0, 63, 'Leinöl* (62 %), mild geröstetes WALNUSSÖL (20 %*, Sonnenblumenöl*, WEIZENKEIMÖL* (6 %), DHA-reiches Öl aus der Mikroalge Schizochytrium sp. (3 %) *aus kontrolliert ökologischer Erzeugung', '2022-07-12 14:03:25', 336.15, 'OTHER_DRUGSTORE_ARTICLES', 'DRUGSTORE', 268, 16.6, 'VEGAN;VEGETARIAN', NULL, NULL),
(575, 'Omega Red Leinöl-Mixtur (Weiling)', '4260355583337', 0, 7.49, 1, 1, NULL, 0, '525230', 'Omega Red Leinöl-Mixtur', 'Die Leinöl Mixtur Omega Red\nverwöhnt mit einem außergewöhnlich\nfruchtigen Aroma und\nsorgt zudem für den täglichen\nVitamin C- und Omega-3-Kick.\n\nOmega Red ergänzt im Rahmen einer abwechslungsreichen und ausgewogenen Ernährung sowie einer gesunden Lebensweise die Gesundheitsvorsorge.', 'Ölmühle Moog GmbH', 'BIO PLANÈTE', 'GERMANY', '80bab87c-6f99-459c-8c86-6c5d2200d16c', 'manager', '2021-08-12 12:52:53', 'System', '2023-12-17 02:54:40', 1164, 697, 0, NULL, 0, 4.39, 'Weiling', 0, NULL, 0, 63, 'Leinöl 69%,\nSonnenblumenöl, Kokosöl,\nSanddornfruchtfleischöl 3%,\nMangopulver 2%, Acerolapulver\n1% (Acerola 80%,\nMaltodextrin), Erdbeerpulver\n0,8%, Extrakt aus\nZitronenmyrte *aus kontrolliert ökologischer Erzeugung', '2022-07-12 14:03:39', 336.15, 'OIL_VINEGAR_SAUCES', 'PANTRY', 268, 16.6, 'VEGAN;VEGETARIAN;PALMOILFREE', NULL, NULL),
(576, 'Hanföl nativ aus deutscher Herkunft (Weiling)', '4260355580992', 0, 6.79, 1, 1, NULL, 0, '526018', 'Hanföl nativ aus deutscher Herkunft', 'Während die Nachfrage nach Bio-Produkten hierzulande kontinuierlich steigt, stagniert das Wachstum der ökologischen Anbaufläche in Deutschland. Um den Bedarf zu decken, werden Bio-Produkte daher zum großen Teil aus dem Ausland importiert, obwohl der Anbau vieler Rohstoffe auch bei uns machbar wäre.\nDie BIO PLANÈTE Serie »Aus gutem Grund« ist eine Initiative für die Stärkung und Erweiterung der ökologischen Landwirtschaft in Deutschland, die über das übliche Maß an Transparenz hinausgeht. Sie umfasst Bio-Produkte aus deutscher Herkunft, für die die Bauern einen Preis bekommen, der die Kultivierung dieser Ölsaaten für sie langfristig attraktiv macht und somit einen Schritt in Richtung mehr Bio-Landwirtschaft in Deutschland bedeutet. Denn nur eine biologische Bewirtschaftung der Ackerflächen ist eine moderne Landwirtschaft und ein zukunftsfähiges Modell.', 'Ölmühle Moog GmbH', 'BIO PLANÈTE', 'GERMANY', '24440fef-3444-4a52-a85b-286faa10a63b', 'manager', '2021-08-12 12:53:03', 'System', '2023-04-07 02:06:16', 784, 698, 0, NULL, 0, 3.96, 'Weiling', 0, NULL, 0, 63, NULL, '2022-09-01 02:11:19', 278.712, 'OIL_VINEGAR_SAUCES', 'PANTRY', 258, 15.8, 'VEGAN;VEGETARIAN;RAWFOOD', NULL, NULL),
(577, 'Schwarzkümmelöl nativ (Weiling)', '4260355584082', 0, 15.99, 1, 1, NULL, 0, '526024', 'Schwarzkümmelöl nativ', 'Erste kalte Pressung.\nReich an mehrfach ungesättigten Fettsäuren.\nDas scharfwürzige Öl aus Schwarzkümmelsaat (Nigella sativa) ist in orientalischen Gerichten und Salatdressings durch seinen einzigartigen Geschmack und den hohen Anteil an mehrfach ungesättigten Fettsäuren sehr beliebt.', 'Ölmühle Moog GmbH', 'BIO PLANÈTE', 'GERMANY', '788b7c2c-5985-4664-8f51-d6c507cfd20c', 'manager', '2021-08-12 12:53:12', 'System', '2024-02-08 02:07:03', 1389, 699, 0, NULL, 0, 10.06, 'Weiling', 0, NULL, 0, 63, NULL, '2022-11-10 00:05:00', 616.512, 'OIL_VINEGAR_SAUCES', 'PANTRY', 478, 22.8, 'VEGAN;VEGETARIAN;RAWFOOD;PALMOILFREE', NULL, NULL),
(578, 'Byodo Mandelöl, nativ (Weiling)', '4018462409527', 0, 8.99, 1, 1, NULL, 0, '520038', 'Byodo Mandelöl, nativ', 'Mit seiner leichten süßlichen Milde ist das Byodo-Mandelöl ein wahrer Genuss. Dieses kostbare Genuss-Öl wird sorgsam aus feinsten italienischen Mandeln kaltgepresst und im Anschluss sanft gefiltert. Somit bleiben die wertvollen ungesättigten Fettsäuren im Öl erhalten. Es eignet sich wunderbar zum Verfeinern von Süßspeisen, kann aber auch als pflegendes und herrlich duftendes Körperöl verwendet werden.', 'Byodo Naturkost GmbH', 'Byodo', 'ITALY', '589974c8-6b07-428b-be20-828f2cadc1e0', 'manager', '2021-08-12 12:53:23', 'System', '2023-08-29 02:07:28', 1460, 700, 0, NULL, 0, 5.91, 'Weiling', 0, NULL, 0, 102, NULL, '2022-06-06 10:03:55', 277.35, 'OIL_VINEGAR_SAUCES', 'PANTRY', 256.81, 15, 'VEGAN;VEGETARIAN;RAWFOOD;KOSCHER;HALAL;WITHOUT_ADDED_SUGAR', NULL, NULL),
(579, 'Kakaobutter, Rohkostqualität (Weiling)', '4038507005422', 1, 2.99, 1, 1, NULL, 0, '525170', 'Kakaobutter, Rohkostqualität', 'Govindas Kakaobutter wird ohne Hitzezufuhr aus Rohkakao gewonnen. So behält sie ihre wertvollen Geschmacksstoffe wie die Natur sie uns geschenkt hat. Dabei besticht unsere naturbelassene Kakaobutter mit ihrem feinen Aroma, dem zarten Schokoladengeruch und höchster Qualität.\n\nKakaobutter findet in der veganen Küche vielfältige Anwendung - dabei wird sie nicht nur für Desserts oder Kuchen eingesetzt sondern auch für köstliche, zartschmelzende Pralinen und selbstgemachte Schokolade. Erst die Kakaobutter macht Schokolade zu dem beliebten zart schmelzenden Genuss. Auch Smoothies und Eiscremes lassen sich wunderbar mit Kakaobutter verfeinern. \n\nDurch den niedrigen Schmelzpunkt kann Kakaobutter auch als Kosmetikum eingesetzt werden. Kakaobutter eignet sich wunderbar als Pflegemittel für sensible Haut, da sie ohne jegliche Zusätze auskommt und dennoch pflegende Eigenschaften insbesondere auf trockene, rissige Haut hat.', 'Govinda Natur GmbH', 'Govinda', 'GERMANY', '606658a6-1df6-4ccc-bc05-016c3812e9d4', 'manager', '2021-08-12 12:53:33', 'System', '2023-12-12 02:09:15', 1258, 701, 0, NULL, 0, 6, 'Weiling', 0, NULL, 0, 67, '100 % Kakaobutter* *aus kontrolliert ökologischer Erzeugung', '2022-06-23 05:03:58', 607.5, 'BAKING_INGREDIENTS', 'PANTRY', 220, 27, 'VEGAN;VEGETARIAN;RAWFOOD', NULL, NULL),
(580, 'Kl. Mühle Raps-Kernöl BUTTERGESCHMACK 500ml (Weiling)', '4260014352502', 0, 7.99, 1, 1, NULL, 0, '524017', 'Kl. Mühle Raps-Kernöl BUTTERGESCHMACK 500ml', 'Geschmacklich wie Butter, aber rein pflanzlich: Für ernährungsbewusste Genießer ist dieses Bio Raps-Kernöl eine vegane und laktosefreie Alternative zu echter Butter.', 'Teutoburger Ölmühle GmbH', 'Die kleine Mühle', 'GERMANY', '5254f6f3-44b6-49c3-b3ab-72537682a3ee', 'correction', '2021-09-08 17:56:00', 'System', '2022-07-12 14:02:52', 1126, 132, 0, NULL, 0, 5.25, 'Weiling', 2, 1, 0, NULL, NULL, '2022-07-12 14:02:52', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL),
(581, 'Kokosöl nativ (Weiling)', '4065626113349', 0, 3.39, 1, 1, NULL, 0, '525196', 'Kokosöl nativ', 'Auf Sri Lanka erfolgt die Verarbeitung der Kokosnüsse noch traditionell in aufwendiger Handarbeit: vom Entfernen der dicken grünen Faserhülle, über das Aufschlagen der harten Schale, bis hin zum Abschälen der dünnen braunen Haut. Das native bioladen*Kokosöl wird schonend aus dem geraspelten und getrockneten Kokosfleisch gepresst (erste Kaltpressung) und verleiht Speisen einen feinen Kokosgeschmack. Bei Raumtemperatur bis 25°C fest. Wird durch leichtes Erwärmen im Wasserbad flüssig. Ideal zum Braten und Backen.\n', 'Weiling GmbH', 'bioladen', 'SRI_LANKA', 'd9e49228-0caf-4956-a509-d370d0bcd199', 'manager', '2021-08-12 12:53:53', 'System', '2023-10-14 02:14:15', 486, 702, 0, NULL, 0, 2.05, 'Weiling', 0, NULL, 0, 1016, NULL, '2023-07-28 10:20:56', 380.25, 'OIL_VINEGAR_SAUCES', 'PANTRY', 350.83, 9, 'VEGAN;VEGETARIAN', NULL, NULL),
(582, 'Natives Olivenöl extra (Weiling)', '4035661162503', 0, 10.99, 1, 1, NULL, 0, '525221', 'Natives Olivenöl extra', 'Das bioladen*Olivenöl nativ extra wird aus aromatischen Oliven hergestellt und in der praktischen 1-L-Flasche abgefüllt – eine optimale Familiengröße.', 'Weiling GmbH', 'bioladen', 'FRANCE', 'ee3d5bee-dd52-4766-8073-21648d6695a3', 'manager', '2021-08-12 12:54:10', 'System', '2023-11-08 02:10:47', 497, 703, 0, NULL, 0, 7.45, 'Weiling', 0, NULL, 0, 52, NULL, '2022-10-05 17:20:48', 2073.58, 'OIL_VINEGAR_SAUCES', 'PANTRY', 1435, 28.7, 'VEGAN;VEGETARIAN;RAWFOOD', NULL, NULL),
(583, 'Sonnenblumenöl nativ (Weiling)', '4035661162466', 0, 7.99, 1, 1, NULL, 0, '525223', 'Sonnenblumenöl nativ', 'Das bioladen*Sonnenblumenöl nativ ist in der praktischen 1-l-Familiengrösse erhältlich.', 'Weiling GmbH', 'bioladen', 'FRANCE', 'eb514e87-f779-4df0-a64c-4c4a2426791a', 'manager', '2021-08-12 12:54:20', 'System', '2023-11-08 02:12:25', 506, 704, 0, NULL, 0, 3.8, 'Weiling', 0, NULL, 0, 52, NULL, '2023-06-02 11:00:20', 2073.58, 'OIL_VINEGAR_SAUCES', 'PANTRY', 1435, 28.7, 'VEGAN;VEGETARIAN;RAWFOOD', NULL, NULL),
(584, 'Bratöl (Weiling)', '4035661162480', 0, 8.49, 1, 1, NULL, 0, '525225', 'Bratöl', 'Das bioladen*Bratöl in der praktischen 1-L-Familiengrösse kann bis zu max. 210 °C erhitzt werden und ist auch zum Frittieren geeignet. ', 'Weiling GmbH', 'bioladen', 'FRANCE', '91ece902-c899-44d6-a3a5-8a9b6baa5cf5', 'manager', '2021-08-12 12:54:29', 'System', '2023-11-08 02:09:41', 1484, 705, 0, NULL, 0, 5.15, 'Weiling', 0, NULL, 0, 52, 'ölsäurereiches Sonnenblumenöl* *aus kontrolliert ökologischer Erzeugung', '2023-04-01 15:22:03', 2073.58, 'OIL_VINEGAR_SAUCES', 'PANTRY', 1435, 28.7, 'VEGAN;VEGETARIAN', NULL, NULL),
(585, 'Bratöl Olive (Weiling)', '4035661162527', 0, 10.99, 1, 1, NULL, 0, '525229', 'Bratöl Olive', 'Das bioladen*Bratöl Olive wird direkt aus Oliven gewonnes Öl hergestellt. Es ist bis maximal bis 210 °C erhitzbar und ist somit optimal zum Braten geeignet. In der praktischen 1-l-Flasche erhältlich – eine optimale Familiengröße.', 'Weiling GmbH', 'bioladen', 'FRANCE', 'a2d21343-e33c-4041-8812-63acde1b31b0', 'manager', '2021-08-12 12:54:38', 'System', '2023-11-08 02:12:44', 450, 706, 0, NULL, 0, 7.45, 'Weiling', 0, NULL, 0, 52, 'raffiniertes Olivenöl* (80 %), natives Olivenöl (20 %)* *aus kontrolliert ökologischer Erzeugung', '2022-06-06 10:02:24', 2073.58, 'OIL_VINEGAR_SAUCES', 'PANTRY', 1435, 28.7, 'VEGAN;VEGETARIAN', NULL, NULL),
