(587, 'Salat Kern Mix (Weiling)', '4019339433096', 0, 3.59, 1, 1, NULL, 0, NULL, 'Salat Kern Mix', 'Unser Salatkernmix ist eine ausgewogene Mischung aus erlesenen Ölsaaten kombiniert mit mild nussigen Cashewkernen.\r\nDiese aromatische Kombination glänzt als Topping für Ihren Salat aber durch eine Vielfalt an Verwendungsmöglichkeiten auch noch weit darüber hinaus. Den Salat Kern-Mix in einer Pfanne ohne Öl kurz anrösten und direkt über den Salat streuen.', 'Midsona Deutschland GmbH', 'Davert', 'Ascheberg, NRW', NULL, 'correction', '2021-09-17 14:31:07', 'System', '2023-06-26 10:00:58', 1081, NULL, 0, NULL, 0, 2.23, 'Weiling', 1, 1, 0, NULL, 'Sonnenblumenkerne*, dunkelgrüne Kürbiskerne*, Cashewkerne*\r\n*aus kontrolliert ökologischer Erzeugung', '2023-02-27 14:28:37', 544.95, 'MUISLI_FLAKES_NUTS', 'PANTRY', NULL, 17.3, 'VEGAN;VEGETARIAN;HALAL', NULL, NULL),
(588, 'Bio-Hanf-Protein-Pulver (Weiling)', '4038507003275', 0, 12.99, 1, 1, NULL, 0, '530268', 'Bio-Hanf-Protein-Pulver', 'Hanf-Proteinpulver wird aus dem Presskuchen der Hanfölherstellung gewonnen. Dadurch enthält es nur noch wenig Fett – dieses enthält jedoch wertvolle ungesättigte Fettsäuren. Somit ist es eine erstklassige Quelle für pflanzliches Protein.', 'Govinda Natur GmbH', 'Govinda', 'LITHUANIA', '0033db40-c0f9-436b-88d6-5d4addd7361f', 'manager', '2021-08-12 12:55:09', 'System', '2023-12-12 02:09:11', 783, 707, 0, NULL, 0, 7.9, 'Weiling', 0, NULL, 0, 60, '100% Ölreduziertes Hanfsamenmehl* *aus kontrolliert ökologischer Erzeugung', '2022-04-11 15:01:51', 1350, 'BAKING_INGREDIENTS', 'PANTRY', 456, 13.5, 'VEGAN;VEGETARIAN;GLUTENFREE;RAWFOOD', NULL, NULL),
(589, 'Sesam, ungeschält, demeter (Weiling)', '4022381027816', 0, 4.49, 1, 1, NULL, 0, '530521', 'Sesam, ungeschält, demeter', NULL, 'Spielberger GmbH', 'Spielberger Mühle', 'Sekem-Farm in Ägypten', 'd4fa110a-a002-4d52-8658-145dc66a7435', 'manager', '2021-08-12 12:55:18', 'System', '2023-12-02 02:07:55', 1034, 708, 2, NULL, 0, 2.8, 'Weiling', 0, NULL, 0, 64, 'SESAM** **aus biodynamischer Erzeugung', '2022-06-06 10:14:49', 760, 'PASTA_CEREALS_LEGUMES;MUISLI_FLAKES_NUTS', 'PANTRY', 410, 19, 'VEGAN;VEGETARIAN;RAWFOOD', NULL, NULL),
(590, 'Gomasio (Weiling)', '8713576008869', 0, 2.59, 1, 1, NULL, 0, '530523', 'Gomasio', 'Gomasio ist für die Japaner wie das Salz bei Tisch für Europäer. Eine leckere  Prise gerösteter und leicht zerstoßener braunerSesam mit Meersalz. Du kannst  dieses erschwingliche Topping wirklich auf oder in allem verwenden: von  Marinaden bis (Miso-) Suppen und ganz toll eignet es sich für alles in der  schnellen Küche. Probiere auch Furikake (mit schwarzem und weißem Sesam und  Meeresalgen).', 'TerraSana Natuurvoeding BV', 'TerraSana', 'NETHERLANDS', '1ac383cc-6345-4f01-a0c3-97be51c72a79', 'manager', '2021-08-12 12:55:27', 'System', '2023-11-08 02:09:01', 734, 709, 0, NULL, 0, 1.49, 'Weiling', 0, NULL, 0, 120, 'SESAMsamen gemahlen und geröstet* 95%, Meersalz *aus kontrolliert ökologischer Erzeugung', '2022-11-03 16:10:49', 455.7, 'SPICES_COOKING_HELP', 'PANTRY', 270, 9.3, 'VEGAN;VEGETARIAN;GLUTENFREE', NULL, NULL),
(591, 'Kürbiskerne, natur, im Pfandglas (Weiling)', '4035661163180', 0, 3.99, 1, 1, NULL, 0.15, '530600', 'Kürbiskerne, natur, im Pfandglas', 'Die naturbelassenen bioladen*Kürbiskerne im Mehrwegglas kommen aus Österreich. Der heimatnahe Anbau ist eine Besonderheit, denn vorwiegend wird dieses Produkt in fernen Ländern angebaut und daher bezogen. Die Kürbiskerne eignen sich als Topping für Salate und Suppen, können für Müslis oder zum Backen verwendet werden.', 'Weiling GmbH', 'bioladen', 'GERMANY', '316cefc3-daef-49d6-a3ab-0788f4181446', 'correction', '2021-08-20 10:16:42', 'System', '2023-10-14 02:08:38', 489, 710, 0, NULL, 0, 2.49, 'Weiling', 0, NULL, 0, 62, NULL, '2022-04-11 15:46:41', 509.6, 'PASTA_CEREALS_LEGUMES;MUISLI_FLAKES_NUTS', 'PANTRY', 335, 10.4, 'VEGAN;VEGETARIAN', NULL, NULL),
(592, 'Sonnenblumenkerne, im Pfandglas (Weiling)', '4035661163203', 0, 2.79, 1, 1, NULL, 0.15, '530604', 'Sonnenblumenkerne, im Pfandglas', 'Die bioladen*Sonnenblumenkerne im Mehrwegglas kommen aus Österreich. Der heimatnahe Anbau ist eine Besonderheit, denn vorwiegend wird dieses Produkt in fernen Ländern angebaut und daher bezogen. Die Sonnenblumenkerne eignen sich als Topping für Salate und Suppen, können für Müslis oder zum Backen verwendet werden.', 'Weiling GmbH', 'bioladen', 'GERMANY', '400a5309-257f-4f6a-b1aa-500c910355c6', 'manager', '2021-08-12 12:55:53', 'System', '2023-10-14 02:08:54', 505, 711, 0, NULL, 0, 1.59, 'Weiling', 0, NULL, 0, 62, 'Sonnenblumenkerne* *aus kontrolliert ökologischer Erzeugung', '2022-04-11 15:46:44', 509.6, 'PASTA_CEREALS_LEGUMES;MUISLI_FLAKES_NUTS', 'PANTRY', 330, 10.4, 'VEGAN;VEGETARIAN', NULL, NULL),
(593, 'Blaumohn, im Pfandglas (Weiling)', '4035661163265', 0, 3.99, 1, 1, NULL, 0.15, '530616', 'Blaumohn, im Pfandglas', 'Der bioladen*Blaumohn im Mehrwegglas kommt aus Österreich. Der heimatnahe Anbau ist eine Besonderheit, denn vorwiegend wird dieses Produkt in fernen Ländern angebaut und daher bezogen. Der Blaumohn eignet sich hervorragend als Backzutat für Mohnbrötchen und Mohnkuchen. ', 'Weiling GmbH', 'bioladen', 'GERMANY', 'f9462423-8d45-4820-8f12-82d3733ce5fa', 'manager', '2021-08-12 12:56:11', 'System', '2023-10-14 02:15:14', 449, 712, 0, NULL, 0, 1.86, 'Weiling', 0, NULL, 0, 62, NULL, '2022-04-11 15:46:21', 509.6, 'PASTA_CEREALS_LEGUMES;MUISLI_FLAKES_NUTS', 'PANTRY', 330, 10.4, 'VEGAN;VEGETARIAN', NULL, NULL),
(594, 'Adelholzener Mineralwasser Classic  (Weiling)', '4005906002123', 1, 0.69, 1, 1, NULL, 0.08, '570612', 'Adelholzener Mineralwasser Classic ', '   ', 'Adelholzener Alpenquellen GmbH', 'Adelholzener', 'GERMANY', 'd68f9eac-d0f9-4b4e-a284-39a527f8fce4', 'correction', '2021-08-19 16:08:00', 'System', '2023-01-16 18:02:59', 347, 713, NULL, NULL, 0, 0.35, 'Weiling', 0, NULL, 0, NULL, 'natürliches Mineralwasser\nQuellname: Adelholzener AlpenQuell Quellort: Bergen\nAuszug aus der Analyse des SGS Institutes Fresenius von 27.03.2019, bestätigt durch laufende Kontrollanalysen.\n1 Liter enthält:\nKationen\nNatrium 13,3 mg\nKalium 1,1 mg\nMagnesium 32 mg\nCalcium 70,9 mg\nAnionen\nFluorid 0,16 mg\nChlorid 21 mg\nNitrat < 0,3 mg\nSulfat 28 mg\nHydrogencarbonat 345 mg', '2022-05-23 14:42:03', 952.56, 'WATER', 'DRINKS', 547, 24, NULL, NULL, NULL),
(595, 'Landpark Bio-Quelle Medium (Weiling)', '4017943110013', 1, 0.79, 1, 1, NULL, 0.15, '571040', 'Landpark Bio-Quelle Medium', 'Landpark Bio-Mineralwasser entspringt in Dorsten aus einer bio-reinen Naturquelle in über 100 Metern Tiefe. Seine schonende Abfüllung erfolgt direkt am Brunnen. Es ist besonders kochsalzarm. Landpark Bio-Mineralwasser ist für die Zubereitung von Säuglingsnahrung geeignet. Die grüne Mehrweg-Glasflasche bewahrt seine hervorragende Qualität. Das Familienunternehmen Johann Spielmann GmbH engagiert sich in fünfter Generation für die Zukunft und den Schutz des Mineralwassers. Für die Zubereitung von Säuglingsnahrung geeignet.', 'Heil- und Mineralbrunnen ', 'Landpark Bio-Quelle', 'GERMANY', '590449fb-cbb8-4fd6-b38a-939fdd449bee', 'correction', '2021-09-12 14:04:29', 'System', '2023-03-15 02:06:54', 1317, 714, NULL, NULL, 12, 0.41, 'Weiling', 0, NULL, 0, NULL, 'Natürliches Mineralwasser mit Kohlensäure versetzt\n\nKationen mg/l\n\nNatrium: 4,8\nKalium: 2,4\nMagnesium: 4,9\nCalcium: 75,8\n\nAnionen:\n\nFluorid: 0,13\nChlorid: 45\nSulfat: 36\nHydrogencarbonat: 157\nNitrit: <0,005\nNitrat: 0,4', '2022-12-17 12:13:55', 1725.34, 'WATER', 'DRINKS', 1310, 29.1, NULL, NULL, NULL),
