(597, 'Landpark Bio-Quelle Lemon (Weiling)', '4017943110051', 1, 0.79, 1, 1, NULL, 0.15, '571044', 'Landpark Bio-Quelle Lemon', 'Landpark Bio-Mineralwasser entspringt in Dorsten aus einer bio-reinen Naturquelle in über 100 Metern Tiefe. Seine schonende Abfüllung erfolgt direkt am Brunnen. Es ist besonders kochsalzarm. Landpark Bio-Mineralwasser ist für die Zubereitung von Säuglingsnahrung geeignet. Die grüne Mehrweg-Glasflasche bewahrt seine hervorragende Qualität. Das Familienunternehmen Johann Spielmann GmbH engagiert sich in fünfter Generation für die Zukunft und den Schutz des Mineralwassers. Für die Zubereitung von Säuglingsnahrung geeignet.', 'Heil- und Mineralbrunnen ', 'Landpark Bio-Quelle', 'GERMANY', 'c1bf71bc-9784-443e-92e6-c234bfdaac78', 'correction', '2021-09-12 14:04:07', 'System', '2024-02-02 02:14:15', 1316, 716, 0, NULL, 12, 0.41, 'Weiling', 0, NULL, 0, 60, 'Natürliches Mineralwasser, Kohlensäure, natürliches \nZitronenextrakt* *aus kontrolliert ökologischer Erzeugung', '2023-01-30 15:16:30', 1725.34, 'WATER', 'DRINKS', 1310, 29.1, 'VEGAN;VEGETARIAN', NULL, NULL),
(598, 'Reis Kokos Drink Ungesüßt (Weiling)', '4016249143701', 1, 3.49, 1, 1, NULL, 0, '598602', 'Reis Kokos Drink Ungesüßt', 'Wer gern Smoothies und asiatische oder indische Gerichte mag, wird sich über den Allos Reis Kokos Drink freuen: Der fruchtig-nussige Geschmack passt super zu Currys oder Wok-Spezialitäten – aber auch Gebäck verleiht er ein exotisches Aroma. Der Allos Reis Kokos Drink ist reich an ungesättigte Fettsäuren, Magnesium und Kalium.', 'Allos Hof-Manufaktur GmbH', 'Allos', 'ITALY', '1744764a-8fe5-4a1a-a066-002b09c75712', 'manager', '2021-08-12 12:56:56', 'System', '2023-11-25 02:08:31', 1115, 717, 0, NULL, 0, 2, 'Weiling', 0, NULL, 0, 103, 'Wasser, Reis* (17%), \nKokosnuss* (2,4%), natürliches \nKokosnuss-Aroma*, Meersalz, \nStabilisator: Guarkernmehl*. *aus ökologischem Landbau.', '2022-11-29 16:49:53', 1078.27, 'PRESERVED_MILK_DRINKS', 'FRESH;PANTRY', 1083, 20.8, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
