(601, 'Barista Drink (Weiling)', '4016249207014', 1, 2.99, 1, 1, NULL, 0, '598616', 'Barista Drink', 'Aus der Bohne für die Bohne ist dieser Soja Drink der perfekte Partner für deinen Kaffee, Cappuccino, heiße Schoki, Matcha und andere Heißgetränke.\nDabei ist er mehr als nur ein Schaumschläger – denn er hält was er verspricht. Cremig, schaumig, lecker.', 'Allos Hof-Manufaktur GmbH', 'Allos', 'ITALY', '0beca716-fa32-4283-aec9-697faf888fa9', 'manager', '2021-08-12 12:57:23', 'System', '2023-10-13 02:26:16', 385, 718, 0, NULL, 0, 1.62, 'Weiling', 0, NULL, 0, 103, 'Wasser, SOJA* (5,3%), Meersalz. *aus ökologischem Landbau.', '2023-02-10 09:08:29', 1078.27, 'PRESERVED_MILK_DRINKS', 'FRESH;PANTRY', 1043, 20.8, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
