(603, 'Hafer Mandel Drink Ungesüßt (Weiling)', '4016249143527', 1, 3.49, 1, 1, NULL, 0, '598620', 'Hafer Mandel Drink Ungesüßt', 'Manche sind lebenshungrig. Wir sind außerdem auch noch lebensdurstig. Und dafür ist unser Drink Hafer Mandel genau das Richtige. Gemacht aus europäischen Mandeln und leckerem Hafer aus Norditalien schmeckt er zu allem, ohne eine Kuh dafür belästigen zu müssen.', 'Allos Hof-Manufaktur GmbH', 'Allos', 'ITALY', '422bff5b-4c7c-43a8-b06f-f11396b0fe73', 'manager', '2021-08-12 12:57:40', 'System', '2023-10-13 02:34:31', 770, 720, 0, NULL, 0, 2, 'Weiling', 0, NULL, 0, 103, 'Wasser, HAFER* (9%), MANDELN* (3%),  Sonnenblumenöl* kaltgepresst, Meersalz. *aus ökologischem Landbau.', '2022-11-29 16:20:05', 1078.27, 'PRESERVED_MILK_DRINKS', 'FRESH;PANTRY', 1053, 20.8, 'VEGAN;VEGETARIAN;LACTOSEFREE', NULL, NULL),
(604, 'Reis Haselnuss Drink ungesüßt (Weiling)', '4016249218218', 1, 3.69, 1, 1, NULL, 0, '598626', 'Reis Haselnuss Drink ungesüßt', 'Tierisch durstig? Dagegen haben wir etwas! Wenn du beim Kochen und Backen, zum Müsli oder Kaffee auf Milch verzichten möchtest, sind unsere Pflanzendrinks genau das Richtige für dich. Hier findest du leckere Drinks auf Basis von Dinkel, Hafer, Kokos, Mandel, Reis oder Soja. Die idealen Protein- und Kalziumlieferanten für einen nachhaltigen Lifestyle. Übrigens: Alle unsere pflanzlichen Drinks kommen im umweltschonenden Getränkekarton.', 'Allos Hof-Manufaktur GmbH', 'Allos', 'ITALY', 'b2af8f31-288f-4f10-83de-3d55b0e33d8b', 'manager', '2021-08-12 12:58:00', 'System', '2023-11-25 02:10:16', 788, 721, 0, NULL, 0, 2.02, 'Weiling', 0, NULL, 0, 103, 'Wasser, Reis* (17%), HASELNÜSSE* (3%), Meersalz. *aus ökologischem Landbau.', '2023-02-07 10:41:45', 1078.27, 'PRESERVED_MILK_DRINKS', 'FRESH;PANTRY', 1083, 20.8, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(605, 'Hafer Barista Drink (Weiling)', '4016249218225', 1, 3.29, 1, 1, NULL, 0, '598628', 'Hafer Barista Drink', 'Im Leben sind es manchmal die kleinen Dinge, die den Unterschied machen. Wie z. B. unsere biodivers angebauten Haferkörner. Von denen sind besonders viele in unserem Drink – satte 16%. Das finden wir zu 100% lecker. Und zu 100% Bio sind die Drinks sowieso. Das ist nun wirklich keine Milchmädchenrechnung.', 'Allos Hof-Manufaktur GmbH', 'Allos', 'ITALY', NULL, 'manager', '2021-08-12 12:58:10', 'manager', '2023-06-29 12:49:20', 764, 722, 0, NULL, 0, 1.62, 'Weiling', 0, NULL, 0, 103, 'Wasser, HAFER* (16%), Inulin* (1%), Sonnenblumenöl* kaltgepresst, Erbsenprotein*, Meersalz. *aus ökologischem Landau.', '2023-06-29 12:49:20', 1078.27, 'PRESERVED_MILK_DRINKS', 'FRESH;PANTRY', 1073, 20.8, 'VEGAN;VEGETARIAN;LACTOSEFREE', NULL, NULL),
(606, 'now Black Cola (Bio) 0,33 l (Weiling)', '4012852204204', 1, 1.39, 1, 1, NULL, 0.08, '592716', 'now Black Cola (Bio) 0,33 l', 'Authentischer Cola-Geschmack – anregend, aufregend, köstlich. Mit der natürlichen Kraft der Guarana-Frucht.', 'Neumarkter Lammsbräu', 'now', 'GERMANY', '8e41c947-a62e-4ff0-96f5-c0334c4ba0b2', 'correction', '2021-08-19 16:01:19', 'System', '2023-11-15 02:09:54', 1373, 723, 3, 10, 0, 0.72, 'Weiling', 0, NULL, 0, 60, 'Natürliches Mineralwasser mit Kohlensäure versetzt, Zucker*, Zitronensaft aus Zitronensaftkonzentrat*, karamellisierter Zucker*, Guaranaextrakt*, Gewürzextrakt* *aus ökologischem Anbau', '2023-04-26 13:14:27', 1102.5, 'LEMONADE', 'DRINKS', 680, 22.5, 'VEGAN;VEGETARIAN', NULL, NULL),
(607, 'now Sunny Orange (Bio) 0,33 l (Weiling)', '4012852204242', 1, 1.39, 1, 1, NULL, 0.08, '592724', 'now Sunny Orange (Bio) 0,33 l', 'Fruchtiger Geschmack nach sonnengereiften Orangen mit einer spritzigen Zitronen-Note.', 'Neumarkter Lammsbräu', 'now', 'GERMANY', '702170b7-2f4a-4e14-8c9b-97eff62d5f67', 'correction', '2021-08-19 16:08:36', 'System', '2023-01-16 18:04:13', 1374, 724, 3, NULL, 0, 0.72, 'Weiling', 0, NULL, 0, 60, 'Natürliches Mineralwasser mit Kohlensäure versetzt, Orangensaft aus Orangensaftkonzentrat* 17%, Zucker*, Zitronensaft aus Zitronensaftkonzentrat*, Orangenextrakt* *aus ökologischem Anbau', '2023-04-14 09:18:19', 1102.5, 'LEMONADE', 'DRINKS', 680, 22.5, 'VEGAN;VEGETARIAN', NULL, NULL),
