(610, 'Provamel Bio Sojadrink Schokolade (Weiling)', '5411188125389', 1, 1.19, 1, 1, NULL, 0, '598114', 'Provamel Bio Sojadrink Schokolade', 'Mmmhhh Schokolade! Für alle, die Lust auf etwas richtig Schokoladiges haben, ist der Provamel Bio Sojadrink Schokolade genau richtig: Mit biologischem Kakaopulver verfeinert ist er ein wahres Kakao-Vergnügen, das sowohl pur als auch im Müsli unvergleichlich lecker schmeckt. In der 250 ml-Variante eignet sich der Drink bestens als kleine Schokoladen-Belohnung für zwischendurch!', 'Alpro Comm. VA / SCA', 'Provamel', 'BELGIUM', 'ea88afce-8c3d-4026-84a2-b701eafb3d67', 'manager', '2021-08-12 12:58:55', 'System', '2022-04-11 14:19:47', 1009, 726, 0, NULL, 0, 0.59, 'Weiling', 0, NULL, 0, NULL, NULL, '2022-04-11 14:19:47', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL),
(611, 'Limettensaft aus sonnengereiften FRÜCHTEN (Weiling)', '4015533014260', 1, 2.49, 1, 1, NULL, 0.15, '590124', 'Limettensaft aus sonnengereiften FRÜCHTEN', 'Spritziger Saft aus sonnengereiften Bio-Limetten, die direkt nach der Ernte noch im Ursprungsland frisch gepresst werden. Purer Direktsaft in erstklassiger Qualität aus der Naturkostsafterei  – naturbelassen und frei von jeglichen Zusätzen.', 'Voelkel GmbH', 'Voelkel', 'GERMANY', '21ce209d-eba8-43d4-a82d-a30a529de3d6', 'manager', '2021-08-12 12:59:07', 'System', '2023-01-16 18:04:21', 1326, 727, 0, NULL, 0, 1.35, 'Weiling', 0, NULL, 0, 64, 'Limettensaft* *aus kontrolliert ökologischer Erzeugung', '2022-11-29 16:36:13', 544.5, 'JUICE', 'DRINKS', 420, 18, 'VEGAN;VEGETARIAN', NULL, NULL),
(612, 'Ingwersaft aus Peru (Weiling)', '4015533030895', 1, 4.69, 1, 1, NULL, 0.15, '590127', 'Ingwersaft aus Peru', 'Familientradition seit 1936\nSeit vier Generationen glauben wir als Demeter- und Bio-Pionier an ein Leben im Einklang mit der Natur. Ihre Vielfalt schenkt uns die Früchte und Inspiration für unsere köstlichen Säfte. Mit unserer gemeinwohlorientierten Stiftung setzen wir uns deshalb für ihren Erhalt und eine enkeltaugliche Landwirtschaft ein.', 'Voelkel GmbH', 'Voelkel', 'GERMANY', '17263345-38e4-4f1a-b950-5acd3becd19e', 'manager', '2021-08-12 12:59:15', 'System', '2023-10-16 10:06:47', 853, 728, 2, NULL, 0, 2.73, 'Weiling', 0, NULL, 0, 64, 'Ingwersaft** 95%, Zitronensaft** **aus biodynamischer Erzeugung', '2022-10-15 02:06:49', 544.5, 'JUICE', 'DRINKS', 417, 18, 'VEGAN;VEGETARIAN', NULL, NULL),
(613, 'BioZisch Bitter Lemon (Weiling)', '4015533100680', 1, 2.19, 1, 1, NULL, 0.15, '590300', 'BioZisch Bitter Lemon', 'Die fruchtige Kraft aus sonnengereiften Zitrusfrüchten hellt auch trübe Tage wieder auf. Ganze Limettenfrüchte, Bergamotten- und Grapefruitsaft werden zu einer prickelnden Komposition vereint. Ein köstlicher Durstlöscher, der von Sommer und Süden träumen lässt.', 'Voelkel GmbH', 'Voelkel', 'GERMANY', '30235512-f08a-473a-8de5-1d5da44179fc', 'manager', '2021-08-12 12:59:24', 'System', '2024-01-17 02:08:40', 405, 729, 0, NULL, 0, 1.53, 'Weiling', 0, NULL, 0, 64, 'Natürliches Mineralwasser, Limettenauszug* 24% (natürliches Mineralwasser, Limetten* 2,8%),Grapefruitsaft*, Bergamottensaft*,  Rohrohrzucker*, \nTraubensüße*, Zitronensaftkonzentrat*,  Quellkohlensäure *aus kontrolliert ökologischer Erzeugung', '2022-10-15 02:06:55', 1740.02, 'LEMONADE', 'DRINKS', 1178, 28.6, 'VEGAN;VEGETARIAN', NULL, NULL),
(614, 'BioZisch Natur Orange (Weiling)', '4015533100291', 1, 2.79, 1, 1, NULL, 0.15, '590302', 'BioZisch Natur Orange', 'Alle, die Limonade lieben, werden begeistert sein! Natürlicher Orangen- und Zitronensaft bringen mehr Spaß ins Glas. Mit Orangenöl verfeinert für einen besonders intensiven Geschmack.', 'Voelkel GmbH', 'Voelkel', 'GERMANY', 'd35363f1-52e6-4f7f-a8ea-e53e8039745a', 'correction', '2021-09-29 15:31:34', 'System', '2024-01-17 02:10:03', 408, 302, 0, NULL, 0, 1.53, 'Weiling', 0, NULL, 0, 64, 'Natürliches Mineralwasser, Orangensaft* 6,7%, Rohrohrzucker*, Orangenfruchtmark* 2,0%, Zitronensaftkonzentrat*, Traubensüße*, Orangenöl*, Quellkohlensäure *aus kontrolliert ökologischer Erzeugung', '2023-01-02 08:35:45', 1740.02, 'LEMONADE', 'DRINKS', 1173, 28.6, 'VEGAN;VEGETARIAN', NULL, NULL),
(615, 'BioZisch Rosenblüte (Weiling)', '4015533015786', 1, 2.59, 1, 1, NULL, 0, '590306', 'BioZisch Rosenblüte', 'BioZisch Rosenblüte ist pure Erfrischung und feiner Genuss. Das besonders angenehme Aroma der Rosenblüte gibt viel Geschmack auf natürliche Weise. Kalt getrunken - passend zu jeder Jahreszeit.', 'Voelkel GmbH', 'Voelkel', 'GERMANY', '8e56ce02-efab-4020-958d-7c6baedf4277', 'manager', '2021-08-12 12:59:42', 'System', '2024-01-17 02:09:31', 410, 730, 0, NULL, 0, 1.53, 'Weiling', 0, NULL, 0, 64, 'Natürliches Mineralwasser, BIO Aufguss aus Rosenblüten 4,6% (natürliches Mineralwasser, Rohrohrzucker*, Rosenblüten* 0,28%,  Zitronensaftkonzentrat*), Rohrohrzucker*, Traubensüße*, Zitronensaftkonzentrat*, Aroniasaft*, Quellkohlensäure. *aus kontrolliert ökologischer Erzeugung', '2022-10-28 02:05:32', 1740.02, 'LEMONADE', 'DRINKS', 1180, 28.6, 'VEGAN;VEGETARIAN', NULL, NULL),
(616, 'BioZisch Holunderblüte (Weiling)', '4015533010576', 1, 2.99, 1, 1, NULL, 0.15, '590307', 'BioZisch Holunderblüte', 'Für alle, die sich nicht mit halben Sachen zufrieden geben. Drei bewährte Wellness-Zutaten vereint in einem Erfrischungsgetränk: Die Holunderblüte, frisch gebrühter Grüner Tee und naturtrüber Apfelessig.', 'Voelkel GmbH', 'Voelkel', 'GERMANY', '5b7787dc-6fad-4c23-9d62-99a4cdb38ab8', 'manager', '2021-08-12 12:59:52', 'System', '2024-01-17 02:08:58', 407, 731, 0, NULL, 0, 1.53, 'Weiling', 0, NULL, 0, 64, 'Natürliches Mineralwasser, Holunderblütenextrakt* (natürliches Mineralwasser, Traubensüße*, Holunderblüten* 7 %, Zitronensaftkonzentrat*), Rohrohrzucker*, Traubensaft*, Zitronensaft*, Traubensüße*, Grüner Tee- Aufguss  (natürliches Mineralwasser, Grüner Tee*), Apfelessig*, Quellkohlensäure. *aus kontrolliert ökologischer Erzeugung', '2022-11-29 15:50:07', 1740.02, 'LEMONADE', 'DRINKS', 1175, 28.6, 'VEGAN;VEGETARIAN', NULL, NULL),
(617, 'BioZisch Blutorange (Weiling)', '4015533014499', 1, 2.59, 1, 1, NULL, 0, '590308', 'BioZisch Blutorange', 'Intensives BioZisch-Vergnügen für die ganze Familie mit dem fruchtigen, leicht-herben Direktsaft sonnenverwöhnter Blutorangen.', 'Voelkel GmbH', 'Voelkel', 'GERMANY', '5f833654-95ec-4a1f-9853-1f1e98baa970', 'manager', '2021-08-12 13:00:00', 'System', '2024-01-17 02:09:07', 406, 732, 0, NULL, 0, 1.53, 'Weiling', 0, NULL, 0, 64, 'Natürliches Mineralwasser, Blutorangensaft*\n7%, Rohrohrzucker*, Zitronensaft*, Blutorangenfruchtmark*\n1%, Traubensüße*, Heidelbeersaft*, Orangenöl*,\nQuellkohlensäure. *aus kontrolliert ökologischer Erzeugung', '2022-10-15 02:07:04', 1740.02, 'LEMONADE', 'DRINKS', 1180, 28.6, 'VEGAN;VEGETARIAN', NULL, NULL),
(618, 'BioZisch Zitrone (Weiling)', '4015533012358', 1, 2.19, 1, 1, NULL, 0.15, '590316', 'BioZisch Zitrone', 'Das prickelnde Zitronengetränk bringt mehr Pepp ins Glas und löscht auch den größten Bio-Durst. Eiskalt serviert und als \"kühle Blonde\" zum Mischen und Mixen. Ob fürs Radler oder Wasser - da kann niemand widerstehen.', 'Voelkel GmbH', 'Voelkel', 'GERMANY', 'ac17c483-0c62-48d3-8313-f75568263ef6', 'manager', '2021-08-12 13:00:09', 'System', '2024-01-17 02:09:42', 411, 733, 0, NULL, 0, 1.53, 'Weiling', 0, NULL, 0, 64, 'Aufguss aus Lemongras* (natürliches Mineralwasser, Lemongras*), Zitronensaft* 6 %, Rohrohrzucker*, Traubensüße*, Zitronenöl*, Quellkohlensäure *aus kontrolliert ökologischer Erzeugung', '2022-10-15 02:07:12', 1740.02, 'LEMONADE', 'DRINKS', 1175, 28.6, 'VEGAN;VEGETARIAN', NULL, NULL),
(619, 'Bio Family Mango Nektar mit 29 % Fruchtgehalt (Weiling)', '4015533012402', 1, 3.29, 1, 1, NULL, 0.15, '590336', 'Bio Family Mango Nektar mit 29 % Fruchtgehalt', 'Wir zeigen Engagement:\n… regional, national und international. Denn nicht nur die Arbeits-, sondern auch die Lebensbedingungen in den Anbauländern sind uns wichtig. Seit mehr als 15 Jahren unterstützen wir zum Beispiel Projekte der Kinderhilfsorganisation Plan International zur Förderung der Chancengleichheit von Mädchen und Jungen weltweit.', 'Voelkel GmbH', 'Voelkel', 'GERMANY', '607423e3-1ea1-4e32-a738-5ab7f538e5ad', 'correction', '2021-09-12 12:37:16', 'System', '2024-02-02 02:13:53', 919, 240, 0, NULL, 0, 2.23, 'Weiling', 0, NULL, 0, 64, 'Natürliches Mineralwasser, Mangomark*¹ 25 %, Rohrohrzucker*¹, Zitronensaft* 3%, Maracujasaft* 1,5%, Traubensüße*. *aus kontrolliert ökologischer Erzeugung', '2022-10-15 02:07:04', 2486.7, 'LEMONADE;JUICE', 'DRINKS', 1640, 30.7, 'VEGAN;VEGETARIAN', NULL, NULL),
(620, 'Shot Ingwer & Kurkuma (Weiling)', '4015533037429', 1, 4.59, 1, 1, NULL, 0, '590794', 'Shot Ingwer & Kurkuma', '6 Shots in einer Flasche: Unser Shot Ingwer & Kurkuma kickt mit reichlich natürlichem Vitamin C aus der Acerola-Kirsche und dem Geschmack von aromatisch-scharfem Ingwer, sonnenverwöhnten Orangen und würzigem Kurkuma. Hergestellt aus besten Demeter Zutaten.', 'Voelkel GmbH', 'Voelkel', 'GERMANY', '8160b827-0c4d-4cf0-b756-294351b9d79e', 'manager', '2021-08-12 13:00:45', 'System', '2023-10-31 00:02:47', 1026, 734, 2, NULL, 0, 2.48, 'Weiling', 0, NULL, 0, 64, 'Orangensaft** 74%, Acerolamark* 10%, Ingwersaft** 10%, Kurkumasaft** 5%, Zitronensaft**, Pfeffer* 0,01%. *aus kontrolliert ökologischer Erzeugung **aus biodynamischer Erzeugung', '2022-12-29 11:03:53', 605.52, 'LEMONADE;JUICE', 'DRINKS', 535.8, 18, 'VEGAN;VEGETARIAN', NULL, NULL),
(621, 'Shot Ingwer & Beeren mit  Vitamin C aus Acerola (Weiling)', '4015533043628', 1, 4.59, 1, 1, NULL, 0, '590796', 'Shot Ingwer & Beeren mit  Vitamin C aus Acerola', '6 Shots in einer Flasche: Unser Shot Ingwer & Beeren kickt mit reichlich natürlichem Vitamin C aus der Acerola-Kirsche und dem Geschmack von aromatisch-scharfem Ingwer und fruchtigen Beeren. Hergestellt aus besten Demeter-Zutaten.', 'Voelkel GmbH', 'Voelkel', 'GERMANY', 'c7320bcb-5d8d-4066-83db-4d46342e5c86', 'manager', '2021-08-12 13:00:54', 'System', '2023-06-30 02:07:15', 1573, 735, 2, NULL, 0, 2.48, 'Weiling', 0, NULL, 0, 64, 'Apfelsaft** 50%, Traubensaft** 20%, Ingwersaft** 10% (Ingwer**, Zitronensaft**), Acerolamark* 10%, Himbeersaft** 5%, Aroniasaft** 5%, Cayennepfeffer* 0,01%. *aus kontrolliert ökologischer Erzeugung **aus biodynamischer Erzeugung', '2023-02-01 11:21:04', 605.52, 'LEMONADE;JUICE', 'DRINKS', 538.7, 18, 'VEGAN;VEGETARIAN', NULL, NULL),
(623, 'Feldfrische Möhre - 100% Direktsaft (Weiling)', '4015533000348', 1, 3.29, 1, 1, NULL, 0.15, '590965', 'Feldfrische Möhre - 100% Direktsaft', 'Harmonisch rund, leicht buttrig und angenehm süß: Der hochwertige Direktsaft ist reich an natürlichem Vitamin A und wird aus samenfesten, direkt nach der Ernte gepressten Demeter-Möhren werterhaltend hergestellt. Für die einzigartige, feldfrische Qualität mit mehrfach ausgezeichnetem Geschmack füllt die Naturkostsafterei diesen besonderen Gemüse-Genuss ohne Tanklagerung direkt in die Flasche. Ein beliebter Klassiker, der beispielhaft für wertvolle Lebensmittel aus gesunden Strukturen und eine enkeltaugliche Landwirtschaft steht.', 'Voelkel GmbH', 'Voelkel', 'GERMANY', '5d4d45fa-3d6f-4d98-89ee-35555d6ba7d7', 'manager', '2021-08-12 13:01:12', 'System', '2024-01-17 02:09:04', 1353, 737, 2, NULL, 0, 1.82, 'Weiling', 0, NULL, 0, 64, 'Möhrensaft** 99,5 %, Zitronensaft** **aus biodynamischer Erzeugung', '2022-10-15 02:07:01', 1740.02, 'JUICE', 'DRINKS', 1176, 28.6, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(624, 'Feldfrische Rote Bete -100% Direktsaft (Weiling)', '4015533000379', 1, 3.49, 1, 1, NULL, 0.15, '591205', 'Feldfrische Rote Bete -100% Direktsaft', 'Gemüse aus samenfestem Saatgut: \nWir unterstützen die unabhängige Saatgutforschung  und ZüchterInnen wie Christina Henatsch. Aus gutem Grund, denn sie entwickeln nachbaufähige Gemüsesorten und erhalten ihr Saatgut als Kulturgut. Je mächtiger Saatgutkonzerne werden, desto wichtiger wird unser Einsatz für Nahrungsmittel aus gesunden Strukturen. Für unsere Gemüsesäfte verarbeiten wir nur samenfestes Gemüse aus fairer, ökologischer Erzeugung.', 'Voelkel GmbH', 'Voelkel', 'GERMANY', '027889ad-a5da-4fd4-a644-a91d8a111a69', 'manager', '2021-08-12 13:01:22', 'System', '2024-01-18 02:08:31', 1095, 738, 2, NULL, 0, 1.82, 'Weiling', 0, NULL, 0, 64, 'Rote Bete-Saft** 98,8 %, Acerolakirschmark* 0,7%, Zitronensaft**. *aus kontrolliert ökologischer Erzeugung **aus biodynamischer Erzeugung', '2022-11-29 16:51:16', 1740.02, 'JUICE', 'DRINKS', 1178, 28.6, 'VEGAN;VEGETARIAN', NULL, NULL),
(625, 'Kombucha Original (Weiling)', '4015533033056', 1, 2.39, 1, 1, NULL, 0.25, '591342', 'Kombucha Original', 'Leicht prickelnd, angenehm herb und kalorienarm – unsere fermentierte Teespezialität ist die perfekte Alternative zu Limonade. Hergestellt nach Original Voelkel Rezeptur mit einer Vielfalt aus Kräutern, Blüten und Blättern.', 'Voelkel GmbH', 'Voelkel', 'GERMANY', 'b4ede344-612f-4730-99df-547a94489723', 'manager', '2021-08-12 13:01:31', 'System', '2024-01-17 02:09:48', 1297, 739, 0, NULL, 0, 1.19, 'Weiling', 0, NULL, 0, 64, 'Fermentierter Auszug aus Tee und Kräutern 99,5% (natürliches Mineralwasser, Rohrohrzucker*, Grüner Tee*, Schwarzer Tee*, Mateblätter*, Lindenblüten*, Zitronenverbene*, Kornblumenblüten*, Zitronenmelisse*, Nanaminze*, Brennnesselkraut*, Holunderblüten*, Himbeerblätter*, Ringelblumenblüten*, Brombeerblätter*, Süßholzwurzel*, Waldmeister*, Kombucha- Kultur), Quellkohlensäure. *aus kontrolliert ökologischer Erzeugung', '2022-12-03 10:23:10', 729.316, 'LEMONADE;OTHER_DRINKS', 'DRINKS', 557, 19.6, 'VEGAN;VEGETARIAN', NULL, NULL),
(626, 'Sauerkraut Milchsauer fermentiert (Weiling)', '4015533000409', 1, 3.29, 1, 1, NULL, 0.15, '591405', 'Sauerkraut Milchsauer fermentiert', 'In unserem kalorienarmen Sauerkrautsaft steckt nur das Beste aus samenfestem, milchsauer fermentiertem Weißkohl, verfeinert mit einer Prise Meersalz. Durch die schonende Verarbeitung bleiben die wertvollen Inhaltsstoffe, darunter Folsäure, weitgehend erhalten. Dies macht unseren Sauerkrautsaft zum beliebten Begleiter für eine bewusste Ernährung. Auch zum Saftfasten eignet er sich ideal.', 'Voelkel GmbH', 'Voelkel', 'GERMANY', 'cb3aac0c-de94-4f34-b1c3-ce0b0365ee90', 'manager', '2021-08-12 13:01:40', 'System', '2024-02-02 02:14:01', 1069, 740, 2, NULL, 0, 1.82, 'Weiling', 0, NULL, 0, 64, 'Sauerkrautsaft**¹ 99,4%, Meersalz 0,6%. **aus biodynamischer Erzeugung', '2022-10-15 02:07:17', 1740.02, 'JUICE', 'DRINKS', 1165, 28.6, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(627, 'BioZisch Rhabarber (Weiling)', '4015533017858', 1, 1.99, 1, 1, NULL, 0.15, '591467', 'BioZisch Rhabarber', 'Rhabarber, bekannt aus den heimischen Gärten, erfreut sich immer größer werdender Beliebtheit. Frischer Rhabarber wird in unserem Hause zu Saft gepresst und bildet die Grundlage für diesen prickelnden Durstlöscher.', 'Voelkel GmbH', 'Voelkel', 'GERMANY', '08a5aa8d-cbe5-4a3b-a424-744bacb5a1b9', 'manager', '2021-08-12 13:01:49', 'System', '2024-01-18 02:08:33', 409, 741, 0, NULL, 0, 1.53, 'Weiling', 0, NULL, 0, 64, 'Natürliches Mineralwasser, Rhabarbersaft*\n19%, Rohrohrzucker*, Traubensüße*,\nAroniasaft*, Zitronensaftkonzentrat*, Quellkohlensäure *aus kontrolliert ökologischer Erzeugung', '2022-10-15 02:06:45', 1740.02, 'LEMONADE', 'DRINKS', 1172, 28.6, 'VEGAN;VEGETARIAN', NULL, NULL),
(628, 'Ananas Kokos Cocktail (Weiling)', '4015533022753', 1, 3.49, 1, 1, NULL, 0, '591488', 'Ananas Kokos Cocktail', 'Wir zeigen Engagement\n\nSeit vier Generationen glauben wir als Demeter- und Bio-Pionier an ein Leben im Einklang mit der Natur. Ihre Vielfalt schenkt uns die Früchte und Inspiration für unsere köstlichen Säfte. Mit unserer gemeinwohlorientierten Stiftung setzen wir uns deshalb für ihren Erhalt und eine enkeltaugliche Landwirtschaft ein.', 'Voelkel GmbH', 'Voelkel', 'GERMANY', 'e2a2a57a-8762-4b95-a132-d78d68374849', 'manager', '2021-08-12 13:01:58', 'System', '2024-01-17 02:10:14', 365, 742, 0, NULL, 0, 2.23, 'Weiling', 0, NULL, 0, 64, 'Natürliches Mineralwasser, Ananassaft* 28%, Orangensaft* 20%, Traubensüße*, Bananenmark*, Kokosmilchpulver* 0,6% (Kokosmilch*, Maltodextrin*), Zitronensaft*, natürliches Kokosaroma* 0,05%, Verdickungsmittel: Pektin. *aus kontrolliert ökologischer Erzeugung', '2022-10-15 02:07:21', 1740.02, 'JUICE', 'DRINKS', 1184, 28.6, 'VEGAN;VEGETARIAN', NULL, NULL),
(629, 'Zitronensaft  aus sonnengereiften FRÜCHTEN (Weiling)', '4015533004643', 1, 1.99, 1, 1, NULL, 0.15, '591721', 'Zitronensaft  aus sonnengereiften FRÜCHTEN', 'Im milden Klima Südeuropas wachsen die saftigen Demeter-Zitronen für diesen hochwertigen Direktsaft heran. Noch im Ursprungsland frisch gepresst und in unserer Naturkostsafterei schonend verarbeitet, bleibt ihr intensives Aroma erhalten und bringt so, Schluck für Schluck, eine Portion Sommerurlaub zu uns nach Hause.', 'Voelkel GmbH', 'Voelkel', 'GERMANY', 'd5bcf8b6-6497-475d-909a-b00ece2f0519', 'manager', '2021-08-12 13:02:10', 'System', '2023-01-16 18:04:55', 824, 743, 2, NULL, 0, 1.05, 'Weiling', 0, NULL, 0, 64, 'Zitronensaft** **aus biodynamischer Erzeugung', '2022-11-06 02:03:48', 544.5, 'JUICE', 'DRINKS', 422, 18, 'VEGAN;VEGETARIAN', NULL, NULL),
