(635, 'Hafer Barista glutenfrei (Weiling)', '4015533043703', 1, 2.99, 1, 1, NULL, 0.15, '595744', 'Hafer Barista glutenfrei', 'Ob Kaffeespezialität, Kakao oder einfach Pur: Mit unserem Hafer Barista gelingt dir der vegane Schaumgenuss! Einfach auf max. 60^C erhitzen und dabei mit einem Schäumer aufschlagen. Dank der umweltfreundlichen Mehrwegflasche sparst du bei dieser pflanzlichen Alternative Müll und schließt den Ressourcenkreislauf!', 'Voelkel GmbH', 'Voelkel', 'GERMANY', '98452775-029c-472f-81c5-9000787e1ef2', 'correction', '2021-09-13 15:10:44', 'System', '2024-01-18 02:08:59', 772, 244, 0, NULL, 0, 1.59, 'Weiling', 0, NULL, 0, 64, 'Wasser, Hafer*¹ 10%, Rapsöl*, Ur-Steinsalz. *aus kontrolliert ökologischer Erzeugung', '2023-04-10 20:08:51', 1697.55, 'PRESERVED_MILK_DRINKS', 'FRESH;PANTRY', 1223, 27.2, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(636, 'Hafer Drink mit calciumreichem Rotalgenpulver (Weiling)', '4015533043963', 1, 2.79, 1, 1, NULL, 0.15, '595746', 'Hafer Drink mit calciumreichem Rotalgenpulver', 'Gut für Zähne und Knochen\n3 Für den Erhalt normaler Knochen und Zähne sowie normaler Muskelfunktion ist Calcium ein wichtiger Baustein: Dank Rotalgenpulver liefert\ndieser Pflanzendrink ebenso viel Calcium wie Kuhmilch und ist perfekt für Veganer*innen. \nEine abwechslungsreiche, ausgewogene Ernährung und eine gesunde Lebensweise sind wichtig für dein Wohlbefinden.', 'Voelkel GmbH', 'Voelkel', 'GERMANY', 'e8c49b16-0d66-4cec-a97e-41542a039424', 'correction', '2021-08-24 19:38:06', 'System', '2024-01-18 02:09:07', 1526, 749, 0, NULL, 6, 1.54, 'Weiling', 0, NULL, 0, 64, 'Natürliches Mineralwasser, Vollkorn-Hafer*¹ 12%, Sonnenblumenöl*, Rotalgenpulver Lithothamnium Calcareum* 0,4%, Ur-Steinsalz. *aus kontrolliert ökologischer Erzeugung', '2023-08-11 11:50:09', 1697.55, 'PRESERVED_MILK_DRINKS;OTHER_DRINKS', 'FRESH;PANTRY;DRINKS', 1230, 27.2, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
