(642, 'Byodo Delikatess Mayonnaise 80% Fett (Weiling)', '4018462158005', 0, 3.99, 1, 1, NULL, 0, '600070', 'Byodo Delikatess Mayonnaise 80% Fett', 'Die klassische Bio-Mayonnaise von Byodo wird mit Eiern von freilaufenden Bio-Hühnern hergestellt. Sie ist wunderbar cremig und  schmeckt angenehm mild und darf an keinem Grill-Tisch fehlen! Sie verfeinert aber auch wunderbar Kartoffelsalate und ist ein cremig-köstlicher Genuss bei jeder ausgiebigen Brotzeit. Als klassische Mayonnaise hat die Creme einen Fettgehalt von 80%.', 'Byodo Naturkost GmbH', 'Byodo', 'GERMANY', 'f3a0945b-0615-403a-b6e6-67b40130c0ea', 'manager', '2021-08-12 13:04:16', 'System', '2023-12-17 03:08:37', 595, 755, 0, NULL, 0, 2.33, 'Weiling', 0, NULL, 0, 67, 'Sonnenblumenöl*, EIGELB* 7,1 %, Wasser, Branntweinessig*, Zucker*, SENF* (Wasser, SENFSAAT*, Branntweinessig*, Steinsalz, Gewürze*, Gewürzextrakt*), Meersalz, Zitronensaftkonzentrat* *aus kontrolliert ökologischer Erzeugung', '2023-08-01 12:04:40', 489.301, 'OIL_VINEGAR_SAUCES', 'PANTRY', 381.85, 10.9, 'VEGETARIAN;HALAL;GLUTENFREE', NULL, NULL),
