(644, 'Byodo Tomaten Ketchup ohne Kristallzucker (Weiling)', '4018462157305', 0, 4.19, 1, 1, NULL, 0, '600078', 'Byodo Tomaten Ketchup ohne Kristallzucker', 'Sonnenverwöhnte italienische Bio-Tomaten finden ihren Weg in den fruchtigen Byodo Ketchup ohne Kristallzucker. Ganze 80 % Tomaten-Anteil sorgen für besonders intensiv-fruchtigen Tomaten-Geschmack. Zart dosierter Agavendicksaft verleiht dem Ketchup eine leichte Süße, er kommt aber dennoch mit deutlich weniger Zucker aus als herkömmliche Bio Ketchups. \n', 'Byodo Naturkost GmbH', 'Byodo', 'GERMANY', '4b938ec0-b934-4934-80c6-8042cdf1d982', 'manager', '2021-08-12 13:04:35', 'System', '2023-12-17 03:06:57', 950, 757, 0, NULL, 0, 2.49, 'Weiling', 0, NULL, 0, 67, 'Tomatenmark* (80%, einfach konzentriert), Agavendicksaft* (14%), Branntweinessig*, Steinsalz, Maisstärke*, Gewürze* *aus kontrolliert ökologischer Erzeugung', '2023-07-28 10:12:52', 1233.79, 'OIL_VINEGAR_SAUCES', 'PANTRY', 834.6, 23.8, 'VEGAN;VEGETARIAN;GLUTENFREE;KOSCHER;HALAL', NULL, NULL),
(645, 'Byodo Gewürz Ketchup (Weiling)', '4018462157510', 0, 3.99, 1, 1, NULL, 0, '600082', 'Byodo Gewürz Ketchup', NULL, 'Byodo Naturkost GmbH', 'Byodo', 'GERMANY', 'bc9170b0-f9fa-440d-a897-7a00712ece32', 'manager', '2021-08-12 13:04:44', 'System', '2023-12-17 03:08:02', 726, 758, 0, NULL, 0, 2.47, 'Weiling', 0, NULL, 0, 67, 'Wasser, Tomatenmark* (22% einfach konzentriert), Rohrohrzucker*, Branntweinessig*, Maisstärke*, Steinsalz, Gewürze* (1,5%) (enthält SENF und SELLERIE), Verdickungsmittel: Guarkernmehl*, Karamellzucker* *aus kontrolliert ökologischer Erzeugung', '2022-11-29 16:16:24', 1233.79, 'OIL_VINEGAR_SAUCES', 'PANTRY', 843.6, 23.8, 'VEGAN;VEGETARIAN;GLUTENFREE;KOSCHER;HALAL', NULL, NULL),
(646, 'Himbeer Vinaigr., 240 ml (Weiling)', '4018462417355', 0, 4.29, 1, 1, NULL, 0, '600164', 'Himbeer Vinaigr., 240 ml', 'Die Byodo Himbeer Vinaigrette zählt zu den besonders feinen Variationen unter den Essig-Öl-Dressings. Kurz schütteln und schon ist die köstliche Komposition aus 100% Bio-Zutaten aus landwirtschaftlichem Anbau genussfertig. Fruchtige Himbeeren und feinster Bio-Honig geben der Bio-Salatsauce eine natürliche Süße. Etwas Senf verleiht ihr eine leicht würzige Note. Gegensätze ziehen sich an: Die Himbeer Vinaigrette von Byodo passt zu herben Salaten wie Chicoree und Endiviensalaten und sorgt für ein genussvolles Geschmackserlebnis. Zudem ist sie glutenfrei.', 'Byodo Naturkost GmbH', 'Byodo', 'FRANCE', '267a5897-ddc0-4d65-b688-3d91a5bb7e04', 'manager', '2021-08-12 13:04:53', 'System', '2023-01-16 18:06:26', 800, 759, 0, NULL, 0, 2.49, 'Weiling', 0, NULL, 0, 67, 'Rapsöl* (50 %), Wasser, Himbeerpüree* (8,5 %), Branntweinessig* (8 %), Honig*, SENF* (Wasser, SENFSAAT*, Branntweinessig*, Meersalz), Meersalz *aus kontrolliert ökologischer Erzeugung', '2022-11-29 16:22:38', 592.176, 'OIL_VINEGAR_SAUCES', 'PANTRY', 475, 21.9, 'VEGETARIAN;KOSCHER;HALAL', NULL, NULL),
(647, 'Bioland Gartenkräuter Vinaigrette 250 ml  (Weiling)', '4260221611218', 0, 3.99, 1, 1, NULL, 0, '607004', 'Bioland Gartenkräuter Vinaigrette 250 ml ', 'Emils Gartenkräuter Vinaigrette & Dip (Bioland) in der 250 ml Flasche\r\n\r\n9 Kräuter kombiniert mit bayrischem Senf, Öl und Weißweinessig. Passt besonders gut zu: Salatmischungen mit säuerlichen und herben Noten, Kopfsalat, Batavia- und Lollo Salate, Frisée und Baby Leafs. Aber auch zu Herzhaftem wie Kartoffeln, Bratlingen und kaltem Braten.\r\n\r\nBIOLAND, Vegan**, Unpasteurisiert, Glutenfrei nach DZG, Lactosefrei, null Zusatzstoffe.\r\n\r\n** Garantiert gelatinefrei: 100% vegane Essige & veganes Etikettenpapier: 100% kaseinfrei.\r\nBesonderheiten:\r\nVegan, Unpasteurisiert, Glutenfrei nach DZG, Lactosefrei, null Zusatzstoffe. Bioland zertifiziert.\r\n\r\nHerstellung:\r\nMit Liebe und in Handarbeit hergestellt in Deutschland.', 'wageswiese GmbH', 'Emils Biomanufaktur', 'GERMANY', '6a1c2351-7fc5-49c6-8ee5-de9d3ac5fd00', 'manager', '2021-08-12 13:05:07', 'System', '2021-11-11 12:28:14', 658, 760, 1, NULL, 0, 0, 'Weiling', 0, NULL, 0, NULL, NULL, '2021-11-11 12:28:14', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL),
(648, 'Bioland Sauce Hollandaise - rein pflanzlich 125g (Weiling)', '4260221613519', 0, 2.99, 1, 1, NULL, 0, '607052', 'Bioland Sauce Hollandaise - rein pflanzlich 125g', 'Emils Hollandaise-rein pflanzlich (Bioland) im 125g Glas\n\nEi-freie ohne Butter; vegan. \nSchmeckt hervorragend zu Spargel, Brokkoli, Artischoke \n\nBesonderheiten:\nUnpasteurisiert, Vegan, Glutenfrei, Lactosefrei, null Zusatzstoffe, Bioland zertifiziert', 'wageswiese GmbH', 'Emils Biomanufaktur', 'GERMANY', 'be0ea0a6-27d2-4c15-a415-d50917624cb7', 'manager', '2021-08-12 13:05:17', 'System', '2024-02-06 02:11:33', 1070, 761, 1, NULL, 0, 1.9, 'Weiling', 0, NULL, 0, 63, 'Rapsöl* kalt gepresst, Apfelsaft* aus Apfelsaftkonzentrat*, MANDELN*, Weißweinessig*, Rapsöl* kalt gepresst mit Zitronenöl (aus Rapsöl* kalt gepresst, Zitronenöl), SENF* (aus Wasser, SENFSAAT*, Apfelessig*, Meersalz), Meersalz, Zwiebel*, weißer Pfeffer*, Muskatblüte*, Nelke* *aus kontrolliert ökologischer Erzeugung', '2022-11-02 00:00:19', 309.434, 'OIL_VINEGAR_SAUCES;CONVENIENCE_PRESERVES;SPICES_COOKING_HELP', 'PANTRY', 281.67, 7.6, 'VEGAN;VEGETARIAN;WITHOUT_ADDED_SUGAR', NULL, NULL),
(649, 'Burger- und Sandwichcreme (Weiling)', '4260221613212', 0, 3.49, 1, 1, NULL, 0, '607062', 'Burger- und Sandwichcreme', 'Emils Burger & Sandwichcreme (Bioland), rein pflanzlich.\n\nSupercremige Sauce, die alles bringt was Patties, Buns & Co. nicht bringen können: den genialen Kick aus veganer Mayo, Ketchup, Senf - abgerundet mit feinem Aceto Balsamico und geräuchertem Paprika.\n\nFür deinen Burger gemacht, zu Pommes eine Wucht, auf dem Sandwich eine echte Überraschung, zum Gemüse ein würziger Dip. Knallrot-orange und voll überraschender Nuancen.\n\nBesonderheiten:\nUnpasteurisiert, Vegan, Glutenfrei, Lactosefrei, null Zusatzstoffe. Bioland zertifiziert.\n\nHerstellung;\nMit Liebe und in Handarbeit hergestellt in Deutschland.', 'wageswiese GmbH', 'Emils Biomanufaktur', 'GERMANY', 'fb69d299-894d-45f0-9229-c79dc0790c26', 'manager', '2021-08-12 13:05:26', 'System', '2024-02-06 02:11:46', 1075, 762, 1, NULL, 0, 1.9, 'Weiling', 0, NULL, 0, 63, 'Rapskernöl* kaltgepresst, Wasser, Aceto Balsamico di Modena IGP* (konzentrierter Traubenmost*, Weinessig*), sonnengetrocknete Tomaten* (Tomaten*, Salz, Apfelessig*), Apfelsaftkonzentrat*, MANDELN*, Weißweinessig*, Paprika* geräuchert über Buchenholz, SENFSAAT*, Thymian*, Cayennepfeffer* *aus kontrolliert ökologischer Erzeugung', '2022-11-10 00:00:34', 309.434, 'OIL_VINEGAR_SAUCES', 'PANTRY', 285, 7.6, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE;WITHOUT_ADDED_SUGAR', NULL, NULL),
