(653, 'Tomatenmark, zweifach konzentriert 28-30 %, Tube (Weiling)', '4024297013945', 0, 2.39, 1, 1, NULL, 0, '600930', 'Tomatenmark, zweifach konzentriert 28-30 %, Tube', 'Die biologisch angebauten Tomaten stammen aus Italien und werden dort verarbeitet und in die Tube gefüllt.', 'Naturata AG', 'NATURATA', 'ITALY', '260364eb-c90f-407f-8526-c08af420bea0', 'manager', '2021-08-12 13:06:05', 'System', '2024-02-15 02:06:38', 948, 766, 0, NULL, 0, 1.5, 'Weiling', 0, NULL, 0, 103, 'Tomaten* zweifach konzentriert, 28-30 % Trockenmasse *aus kontrolliert ökologischer Erzeugung', '2023-10-19 02:06:09', 481.74, 'CONVENIENCE_PRESERVES', 'PANTRY', 214, 21, 'VEGAN;VEGETARIAN;PALMOILFREE', NULL, NULL),
(654, 'Hot Chili Sauce (Weiling)', '4024297018018', 0, 3.99, 1, 1, NULL, 0, '601036', 'Hot Chili Sauce', 'Die höllisch scharfe Hot Chili Sauce hat den Schärfegrad 4 (von 4) und ist damit Ideal geeignet für Leute, denen es nicht scharf genug sein kann. Besonders passend ist die Sauce für asiatische Gerichte sowie zum Grillen und Würzen verschiedener Speisen. Agavendicksaft und Apfelsaftkonzentrat verleihen der Sauce ihre leicht süße Note. Als Verdickungsmittel setzen wir Johannisbrotkernmehl und Guarkernmehl ein.', 'Naturata AG', 'NATURATA', 'GERMANY', '66a33be7-1a68-4395-8c66-0c583158d3f8', 'manager', '2021-08-12 13:06:14', 'System', '2023-10-12 02:06:05', 814, 767, 0, NULL, 0, 2.44, 'Weiling', 0, NULL, 0, 67, 'Wasser, Agavendicksaft*, Apfelsaftkonzentrat*, Branntweinessig*, rote Chili* 4 %, Tomatenmark*,\nIngwer*, Tapiokastärke*, Meersalz, Verdickungsmittel (Guarkernmehl*, Johannisbrotkernmehl*), Chili gemahlen* 0,5 %, Knoblauch*, Paprikaflocken* *aus kontrolliert ökologischer Erzeugung', '2022-07-12 14:16:47', 680.4, 'OIL_VINEGAR_SAUCES', 'PANTRY', 483, 18.9, 'VEGAN;VEGETARIAN;GLUTENFREE;PALMOILFREE', NULL, NULL),
(655, 'Honig Senf Sauce (Weiling)', '4024297018094', 0, 3.99, 1, 1, NULL, 0, '601044', 'Honig Senf Sauce', 'Süßlich, mit ausgeprägter Senfnote und super cremig: So sieht sie aus, die perfekte Honig Senf Sauce! Ob als Dip oder im Salatdressing: Die leckere, milde Sauce (Schärfegrad 0) ist vielseitig einsetzbar. Der köstliche Mix aus Blütenhonig, Agavendicksaft und Senf passt zu fast allem, besonders gut aber zu Meeresfrüchten und Fisch, Geflügel, Gemüse, Fondue und Raclette. Ideal auch, um Sandwiches oder die guten alten belegten Brote aufzupeppen.', 'Naturata AG', 'NATURATA', 'GERMANY', '915acdb8-5a2d-42fa-8f47-9352393c6af2', 'manager', '2021-08-12 13:06:23', 'System', '2023-10-12 02:06:07', 812, 768, 0, NULL, 0, 2.44, 'Weiling', 0, NULL, 0, 67, 'Wasser, Sonnenblumenöl*, Agavendicksaft*, Blütenhonig* 6,7 %, Branntweinessig*, Dijon SENF* 5,3 % (Wasser, Branntweinessig*, braune SENFSAAT*, Meersalz), Maisstärke*, braune SENFSAAT* 2,7 %, Meersalz, Karottensaftkonzentrat*, Sonnenblumenprotein*, Zwiebeln*, Paprika edelsüß*, Verdickungsmittel (Guarkernmehl*, Johannisbrotkernmehl*), weißer Pfeffer*, Knoblauch*, Koriander* *aus kontrolliert ökologischer Erzeugung', '2022-12-01 08:26:23', 680.4, 'OIL_VINEGAR_SAUCES', 'PANTRY', 473, 18.9, 'VEGETARIAN;GLUTENFREE;PALMOILFREE', NULL, NULL),
(656, 'Delikatess Mayonnaise in der Tube (Weiling)', '4024297006305', 0, 3.59, 1, 1, NULL, 0, '603001', 'Delikatess Mayonnaise in der Tube', 'Die feine Naturata Delikatess-Mayonnaise wird aus hochwertigen Demeter-Zutaten besonders schonend in der Schweiz hergestellt. Die ausgewogene Rezeptur sorgt für den typischen Mayonnaisen-Geschmack.', 'Naturata AG', 'NATURATA', 'SWITZERLAND', '59beea74-d741-4f7a-8abd-12485ab414fb', 'manager', '2021-08-12 13:06:32', 'System', '2023-11-02 02:06:10', 596, 769, 2, NULL, 0, 2.24, 'Weiling', 0, NULL, 0, 298, 'Sonnenblumenöl** 80 %, EIGELB** 6 %, SENF** (Wasser, SENFKÖRNER**, Branntweinessig*, Meersalz, Roh-Rohrzucker**, Curcuma*), Wasser, Branntweinessig*, Zitronensaft**, Meersalz, Roh-Rohrzucker** *aus kontrolliert ökologischer Erzeugung **aus biodynamischer Erzeugung', '2022-11-29 15:07:13', 572, 'OIL_VINEGAR_SAUCES', 'PANTRY', 193, 22, 'VEGETARIAN', NULL, NULL),
(657, 'Vegane Salatcreme ohne Ei in der Tube (Weiling)', '4024297006220', 0, 2.99, 1, 1, NULL, 0, '603002', 'Vegane Salatcreme ohne Ei in der Tube', 'Die vegane Salatcreme von Naturata enthält kein Ei. Als Emulgator dient hier stattdessen Sonnenblumenprotein. Zudem enthält sie weniger Öl und ist damit fett- und kalorienärmer als die Mayonnaise von Naturata. Johannisbrotkernmehl und Guarkernmehl sorgen für die richtige Konsistenz der Creme.', 'Naturata AG', 'NATURATA', 'SWITZERLAND', '52baf322-5d15-4610-b76a-166946b0517d', 'manager', '2021-08-12 13:06:43', 'System', '2023-11-02 02:06:07', 928, 770, 2, NULL, 0, 1.87, 'Weiling', 0, NULL, 0, 298, 'Sonnenblumenöl (55 %)**, Wasser, SENF (Wasser, SENFKÖRNER**, Branntweinessig*, Meersalz, Roh-Rohrzucker**, Curcuma*), Branntweinessig*, Roh-Rohrzucker**, Maisstärke*, Zitronensaft**, Sonnenblumeneiweiß*, Meersalz, Verdickungsmittel:\nJohannisbrotkernmehl*, Guarkernmehl* *aus kontrolliert ökologischer Erzeugung **aus biodynamischer Erzeugung', '2022-09-10 00:06:13', 572, 'OIL_VINEGAR_SAUCES', 'PANTRY', 197, 22, 'VEGAN;VEGETARIAN', NULL, NULL);
