(658, 'Vegane Remoulade ohne Ei in der Tube (Weiling)', '4024297014843', 0, 3.49, 1, 1, NULL, 0, '603005', 'Vegane Remoulade ohne Ei in der Tube', 'Der feine Geschmack der Naturata veganen Remoulade wird geprägt durch Gurken, Zwiebeln und frische Kräuter. Der besonders hohe Gurkenanteil lässt die vegane Remoulade frisch und leicht schmecken. Die vegane Remoulade wird ohne Ei hergestellt und ist daher für Veganer oder Menschen mit Ei-Unverträglichkeit bestens geeignet.', 'Naturata AG', 'NATURATA', 'SWITZERLAND', 'd16ed1a6-a986-48ac-9195-e30fadbf6045', 'manager', '2021-08-12 13:06:56', 'System', '2024-01-18 02:06:50', 1113, 771, 2, NULL, 0, 2.12, 'Weiling', 0, NULL, 0, 298, 'Sonnenblumenöl**, Gurken **, Wasser, SENF (Wasser, SENFKÖRNER**, Branntweinessig*, Meersalz, Roh-Rohrzucker**, Curcuma*), Branntweinessig*, Maisstärke*, Roh-Rohrzucker**, Sonnenblumeneiweiß*, Zwiebeln*, Meersalz, Zitronensaft**, Knoblauch*, Schnittlauch*, Verdickungsmittel: Johannisbrotkernmehl*, Guarkernmehl*. *aus kontrolliert biologischem Anbau.**aus biodynamischer Erzeugung (Demeter).', '2023-05-26 10:03:43', 572, 'OIL_VINEGAR_SAUCES', 'PANTRY', 197, 22, 'VEGAN;VEGETARIAN', NULL, NULL),
(659, 'Dijon Senf in der Tube (Weiling)', '4024297011606', 0, 1.99, 1, 1, NULL, 0, '603009', 'Dijon Senf in der Tube', 'Die Senfsaat für den Naturata Dijon Senf stammt von biodynamisch wirtschaftenden Landwirten vorwiegend aus Österreich. Durch seine intensive Schärfe ist der Naturata Dijon-Senf bestens zum Würzen geeignet.', 'Naturata AG', 'NATURATA', 'SWITZERLAND', '63583d8e-964e-479a-b102-562c574b7b77', 'manager', '2021-08-12 13:07:06', 'System', '2024-02-15 02:07:05', 608, 772, 2, NULL, 0, 1.24, 'Weiling', 0, NULL, 0, 298, 'Wasser, SENFSAAT braun**, Branntweinessig*, Meersalz *aus kontrolliert ökologischer Erzeugung **aus biodynamischer Erzeugung', '2022-12-02 13:55:43', 267.9, 'OIL_VINEGAR_SAUCES', 'PANTRY', 110, 19, 'VEGAN;VEGETARIAN;RAWFOOD', NULL, NULL),
(660, 'Vegane Aioli in der Tube (Weiling)', '4024297019930', 0, 3.49, 1, 1, NULL, 0, '603028', 'Vegane Aioli in der Tube', 'Die vegane Aioli von Naturata enthält kein Ei. Als Emulgator dient hier stattdessen Sonnenblumenprotein. Zudem enthält sie weniger Öl und ist damit fett- und kalorienärmer als die Mayonnaise von Naturata. Johannisbrotkernmehl und Guarkernmehl sorgen für die richtige Konsistenz der Creme.', 'Naturata AG', 'NATURATA', 'SWITZERLAND', '32e50074-4676-4a61-aa05-dc3717d5371c', 'manager', '2021-08-12 13:07:15', 'System', '2024-02-14 02:06:52', 934, 773, 2, NULL, 0, 2.12, 'Weiling', 0, NULL, 0, 298, 'Sonnenblumenöl**, Wasser, Branntweinessig*, Roh-Rohrzucker**, SENF** (Wasser, SENFSAAT**, Branntweinessig*, Meersalz, Roh-Rohrzucker**, Curcuma*), Knoblauch* 1,7 %, Meersalz, Sonnenblumenprotein*, Maisstärke*, Zitronensaft**, Verdickungsmittel (Guarkernmehl*, Johannisbrotkernmehl*), Curcuma* **aus biodynamischer Erzeugung', '2022-09-10 00:06:26', 572, 'OIL_VINEGAR_SAUCES', 'PANTRY', 202, 22, 'VEGAN;VEGETARIAN', NULL, NULL),
(661, 'Dunkle Sauce feinkörnig (Weiling)', '4000345046660', 0, 1.99, 1, 1, NULL, 0, '604016', 'Dunkle Sauce feinkörnig', 'Dunkle Sauce feinkörnig\nDer Saucen-Klassiker für alle herzhaften Gerichte, für 2 x 1/4 l\n\n-  Glutenfrei\n-  Lactosefrei\n-  Palmölfrei\n-  Vegan\n-  Vegetarisch', 'Hügli Nahrungsmittel GmbH', 'Natur Compagnie', 'GERMANY', 'a4448091-c6f4-48cd-98b2-15eba6611d9f', 'manager', '2021-08-12 13:07:33', 'System', '2022-04-11 14:35:31', 634, 1986, 0, NULL, 0, 1.07, 'Weiling', 0, NULL, 0, NULL, NULL, '2022-04-11 14:35:31', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL),
(662, 'Jägersauce feinkörnig (Weiling)', '4000345046677', 0, 1.99, 1, 1, NULL, 0, '604018', 'Jägersauce feinkörnig', 'Jägersauce feinkörnig\nTraditionell mit feinen Pilzen und Zwiebeln, \nfür 2 x 1/4 l\n\n-  Palmölfrei\n-  Vegetarisch', 'Hügli Nahrungsmittel GmbH', 'Natur Compagnie', 'GERMANY', '4c793b67-466e-4ac7-a0ff-800535ee7949', 'manager', '2021-08-12 13:07:42', 'System', '2022-04-11 14:35:34', 860, 1987, 0, NULL, 0, 1.09, 'Weiling', 0, NULL, 0, NULL, NULL, '2022-04-11 14:35:34', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL),
(663, 'Aioli Sauce (Weiling)', '4260360271687', 0, 3.79, 1, 1, NULL, 0, '600674', 'Aioli Sauce', NULL, 'nur puur bio GmbH', 'Nur Puur', 'NETHERLANDS', '76e8dba9-597a-468a-ac85-6dd714b96e87', 'manager', '2021-08-12 13:07:51', 'System', '2023-12-09 03:42:37', 353, 774, 0, NULL, 0, 2.38, 'Weiling', 0, NULL, 0, 120, 'Sonnenblumenöl*, Weizensirup* (glutenfrei), EIgelb*, Wasser*, Knoblauch* 3,5%, Branntweinessig*, SENFsaat* gelb, Säuerungsmittel (Zitronensäure), Meersalz, Agavendicksaft*, Pfeffer* (schwarz), Schnittlauch*, Fenchelsaat*, Koriander*. *aus kontrolliert ökologischer Erzeugung', '2022-11-29 15:42:12', 474.804, 'OIL_VINEGAR_SAUCES', 'PANTRY', 396, 10.9, 'VEGETARIAN', NULL, NULL),
(664, 'Würzsauce Sambal Oelek, Sanchon (Weiling)', '4030917005405', 0, 2.99, 1, 1, NULL, 0, '600084', 'Würzsauce Sambal Oelek, Sanchon', 'Sie kommen aus Indonesien und sie sind scharf. Ihr Hauptbestandteil ist Chili und ein kleiner Klecks genügt. Sambals von Sanchon machen Fleischgerichte feuriger. Sie geben Gemüse den nötigen Biss und sie verleihen Reisgerichten Pep.', 'Petersilchen GmbH', 'Sanchon', 'GERMANY', '31514113-376a-4607-8a0f-4183a633cb54', 'correction', '2021-09-08 17:44:32', 'System', '2023-07-04 02:15:28', 870, 117, 0, NULL, 0, 1.95, 'Weiling', 1, 1, 0, 67, NULL, '2022-07-12 14:29:41', 259.92, 'OIL_VINEGAR_SAUCES', 'PANTRY', 232, 8, 'VEGAN;VEGETARIAN;GLUTENFREE;PALMOILFREE', NULL, NULL),
(665, 'Erdnusssauce Saté, Sanchon, Glutenfrei (Weiling)', '4030917011208', 0, 3.79, 1, 1, NULL, 0, '600092', 'Erdnusssauce Saté, Sanchon, Glutenfrei', 'Die Erdnusssauce Saté ist eine köstliche und verzehrfertige Erdnusssauce. Sie passt gut zu Spießen und anderen gegarten Fleischsorten, zu Tofu, zu einer knackigen Gemüsepfanne oder einfach zu Reis. Die Erndnusssauce Saté hat ihren Ursprung in Indonesien und ist mittlerweile im ganzen asiatischen Raum eine der beliebtesten Saucen überhaupt. Weit verbreitet ist Saté Sauce auch in Thailand. Dort gibt es sie in jedem Restaurant, auf jedem Nachtmarkt und in jeder Garküche.', 'Petersilchen GmbH', 'Sanchon', 'GERMANY', '12396449-1e43-49e8-9fbb-f81a942208aa', 'correction', '2021-09-08 17:46:26', 'System', '2023-07-04 02:14:36', 1517, 122, 0, NULL, 0, 2.25, 'Weiling', 1, 1, 0, 67, NULL, '2023-08-04 10:30:53', 578, 'OIL_VINEGAR_SAUCES', 'PANTRY', 560, 12.5, 'VEGAN;VEGETARIAN;GLUTENFREE;PALMOILFREE', NULL, NULL),
(666, 'Asiasauce Thai Chili, Sanchon, Glutenfrei (Weiling)', '4030917005603', 0, 3.29, 1, 1, NULL, 0, '600094', 'Asiasauce Thai Chili, Sanchon, Glutenfrei', 'Sanchon Asiasaucen schmecken süß und pikant zugleich. Zum Dippen für Frühlingsrollen, Fleisch und Gemüse. Zu gegrilltem Fisch, zu Fingerfood oder einfach so.', 'Petersilchen GmbH', 'Sanchon', 'GERMANY', '40d52fdf-c312-448d-9ae9-0b599b141b5f', 'correction', '2021-09-08 17:49:13', 'System', '2023-07-04 02:15:50', 1480, 129, 0, NULL, 0, 1.95, 'Weiling', 1, 1, 0, 67, NULL, '2023-05-05 09:30:55', 514.25, 'OIL_VINEGAR_SAUCES', 'PANTRY', 458, 17, 'VEGAN;VEGETARIAN;GLUTENFREE;PALMOILFREE', NULL, NULL),
(667, 'Grillsauce Barbecue, Sanchon (Weiling)', '4030917007904', 0, 3.29, 1, 1, NULL, 0, '600096', 'Grillsauce Barbecue, Sanchon', 'Unsere Grill- und Würzsauce Barbecue schmeckt fruchtig-süß und natürlich rauchig. Mit vollem Geschmack, ganz ohne Schnickschnack, denn die frischen Zwiebeln räuchern wir selbstverständlich in liebevoller Handarbeit. Einzigartig lecker zum Würzen oder Marinieren von Grillgut.', 'Petersilchen GmbH', 'Sanchon', 'GERMANY', 'b05aebc4-7a35-4905-b6d9-652636e276a5', 'correction', '2021-09-08 17:48:26', 'System', '2023-09-26 02:32:40', 745, 127, 0, NULL, 0, 1.95, 'Weiling', 1, 1, 0, 67, NULL, '2023-05-05 09:31:10', 514.25, 'OIL_VINEGAR_SAUCES', 'PANTRY', 456, 17, 'VEGAN;VEGETARIAN;PALMOILFREE;GLUTENFREE', NULL, NULL),
(668, 'Grillsauce Höllenfeuer, Sanchon (Weiling)', '4030917002800', 0, 3.29, 1, 1, NULL, 0, '600098', 'Grillsauce Höllenfeuer, Sanchon', 'Grillsauce Höllenfeuer ist eine extra-scharfe Würzsauce. Habanero Chili verleihen dieser Sauce einen unverwechselbaren, fruchtigen und angenehm scharfen Geschmack.', 'Petersilchen GmbH', 'Sanchon', 'GERMANY', 'db40b56b-a018-4fb9-90fe-fd259bef19b2', 'correction', '2021-09-08 17:48:51', 'System', '2023-07-04 02:17:18', 746, 128, 0, NULL, 0, 1.95, 'Weiling', 1, 1, 0, 67, NULL, '2023-06-13 08:56:03', 514.25, 'OIL_VINEGAR_SAUCES', 'PANTRY', 453, 17, 'VEGAN;VEGETARIAN;PALMOILFREE', NULL, NULL),
(669, 'Grillsauce Mexican Salsa, Sanchon, Glutenfrei (Weiling)', '4030917016203', 0, 3.29, 1, 1, NULL, 0, '600100', 'Grillsauce Mexican Salsa, Sanchon, Glutenfrei', 'Grillsauce Mexican Salsa ist eine klassische, pikante Würzsauce. Durch die landestypischen Jalapeno Chilis erhält die Grillsauce Mexican Salsa ihren unverwechselbaren mexikanischen Geschmack. Sie eignet sich hervorragend zum Würzen von Grillgut.', 'Petersilchen GmbH', 'Sanchon', 'GERMANY', '563773b8-3181-4aac-b045-6169aec6250e', 'correction', '2021-09-08 17:47:41', 'System', '2023-07-04 02:16:08', 1520, 125, 0, NULL, 0, 1.95, 'Weiling', 1, 1, 0, 67, NULL, '2023-05-05 09:31:49', 514.25, 'OIL_VINEGAR_SAUCES', 'PANTRY', 453, 17, 'VEGAN;VEGETARIAN;GLUTENFREE;PALMOILFREE', NULL, NULL),
(670, 'Grillsauce Cajun Island, Sanchon (Weiling)', '4030917016401', 0, 2.99, 1, 1, NULL, 0, '600102', 'Grillsauce Cajun Island, Sanchon', 'Die Grillsauce Cajun Island ist eine beliebte Würzsauce aus der creolischen Küche. Durch die Kombination von Senf und Gewürzgurken erhält sie ihren unverwechselbaren, feinsauren Geschmack. Sie eignet sich hervorragend zum Würzen von Grillgut.', 'Petersilchen GmbH', 'Sanchon', 'GERMANY', '0407ab2f-a640-45b6-8db2-9322b89e9fa3', 'correction', '2021-09-08 17:49:33', 'System', '2023-07-04 02:14:22', 1519, 130, 0, NULL, 0, 1.95, 'Weiling', 1, 1, 0, 67, NULL, '2022-07-12 14:29:06', 514.25, 'OIL_VINEGAR_SAUCES', 'PANTRY', 435, 17, 'VEGAN;VEGETARIAN;GLUTENFREE;PALMOILFREE', NULL, NULL),
(671, 'Würzsauce Worcestershire, Sanchon, Glutenfrei (Weiling)', '4030917003203', 0, 3.99, 1, 1, NULL, 0, '600106', 'Würzsauce Worcestershire, Sanchon, Glutenfrei', 'Die Würzsauce Worcestershire ist eine Würzsauce nach traditioneller Rezeptur, ohne künstliche Aroma- oder Farbstoffe. Wertvolle, ausgesuchte Zutaten aus kontrolliert biologischem Anbau reifen in Eichenfässern zu vollem Aroma.', 'Petersilchen GmbH', 'Sanchon', 'GERMANY', '3b592152-2b23-4fe6-aec3-002a79bac9d5', 'correction', '2021-09-08 17:46:55', 'System', '2023-07-04 02:15:40', 869, 123, 0, NULL, 0, 2.38, 'Weiling', 1, 1, 0, 67, NULL, '2022-11-29 17:10:06', 407.808, 'OIL_VINEGAR_SAUCES', 'PANTRY', 355, 17.7, 'VEGAN;VEGETARIAN;GLUTENFREE;PALMOILFREE', NULL, NULL),
(672, 'Grillsauce Louisiana, Sanchon (Weiling)', '4030917035501', 0, 3.29, 1, 1, NULL, 0, '600124', 'Grillsauce Louisiana, Sanchon', 'Die Grillsauce Lousiana ist eine typische Sauce zum Würzen von Grillgut und Burger. Feine Gewürze verleihen dieser Sauce den angenehm pikanten Geschmack. Sie eignet sich auch hervorragend als Tischgewürz und gibt vielen Gerichten das gewisse Etwas.', 'Petersilchen GmbH', 'Sanchon', 'GERMANY', 'a73fb31e-2d25-4758-b895-e6387b1cba7b', 'correction', '2021-09-08 17:48:03', 'System', '2023-07-04 02:16:42', 748, 126, 0, NULL, 0, 1.95, 'Weiling', 1, 1, 0, 67, NULL, '2023-05-05 09:31:28', 514.25, 'OIL_VINEGAR_SAUCES', 'PANTRY', 455, 17, 'VEGAN;VEGETARIAN;GLUTENFREE;PALMOILFREE', NULL, NULL),
(673, 'Grillsauce Indian Summer, Sanchon, Glutenfrei (Weiling)', '4030917036102', 0, 3.29, 1, 1, NULL, 0, '600126', 'Grillsauce Indian Summer, Sanchon, Glutenfrei', 'Sanchon Grillsauce Indian Summer ist eine besonders fruchtig-pikante Würzsauce mit Ananas und Mango, abgerundet durch eine feine Currynote. Ideal zu Grillkäse, Hühnchen und zu vegetarischen Spezialitäten.', 'Petersilchen GmbH', 'Sanchon', 'GERMANY', '6090e35b-f470-43d2-9cb8-7ed546b90d30', 'correction', '2021-09-08 17:47:18', 'System', '2023-07-04 02:16:13', 747, 124, 0, NULL, 0, 1.95, 'Weiling', 1, 1, 0, 67, NULL, '2023-05-05 09:32:18', 514.25, 'OIL_VINEGAR_SAUCES', 'PANTRY', 437, 17, 'VEGAN;VEGETARIAN;GLUTENFREE;PALMOILFREE', NULL, NULL),
(674, 'Würzsauce Mojo Rojo, Sanchon (Weiling)', '4030917014407', 0, 2.99, 1, 1, NULL, 0, '604030', 'Würzsauce Mojo Rojo, Sanchon', 'Mojos gehören zu den bekanntesten Spezialitäten der\nkanarischen Inseln und werden kalt als Dip oder Sauce zu Kartoffeln, Brot, Fleisch oder Fisch gereicht.', 'Petersilchen GmbH', 'Sanchon', 'GERMANY', '4055bdee-67b1-49cd-b200-43655216b595', 'correction', '2021-09-23 02:14:09', 'System', '2023-07-31 00:00:50', 872, 116, NULL, NULL, 0, 1.95, 'Weiling', 1, 1, 0, 67, NULL, '2022-04-11 14:34:42', 259.92, 'OIL_VINEGAR_SAUCES', 'PANTRY', 232, 8, 'VEGAN;VEGETARIAN;GLUTENFREE;PALMOILFREE', NULL, NULL),
