(676, 'Tomatensauce Basilico (Weiling)', '4035626102568', 0, 2.59, 1, 1, NULL, 0, '602000', 'Tomatensauce Basilico', 'Die Tomaten für die bioladen*Produkte werden von Bio-Bauern in Italien unter besten klimatischen Bedingungen angebaut.\nAuf ihren ökologisch bewirtschafteten Feldern reifen die „pomodori“ zu sonnenverwöhnten aromatischen Früchten heran. Nach original italienischen Rezepten werden die Tomaten von einem Familienbetrieb in der Region Latium zu etwas ganz Besonderem verfeinert –\nunseren Tomatensaucen. (Mit feiner Basilikumnote.)\n', 'Weiling GmbH', 'bioladen', 'ITALY', 'afb4c22e-ed42-41d7-bc06-6ad51fac0c71', 'correction', '2021-08-17 04:49:54', 'System', '2023-12-12 02:08:25', 516, 775, 0, NULL, 0, 1.56, 'Weiling', 0, NULL, 0, 103, 'Tomaten* (92%), natives Olivenöl* extra, Zwiebeln*, Basilikum* (1,3%), Rohrohrzucker*, Meersalz, Knoblauch*, Sonnenblumenöl* *aus kontrolliert ökologischer Erzeugung', '2023-05-26 10:03:18', 442.572, 'CONVENIENCE_PRESERVES', 'PANTRY', 525.2, 11.5, 'VEGAN;VEGETARIAN', NULL, NULL),
