(678, 'Tomaten-Passata, fein (Weiling)', '4035626101004', 0, 2.19, 1, 1, NULL, 0, '602006', 'Tomaten-Passata, fein', 'Die Tomaten für die bioladen*Produkte werden von Bio-Bauern in Italien unter besten klimatischen Bedingungen angebaut. Auf ihren ökologisch bewirtschafteten Feldern reifen die „pomodori“ zu sonnenverwöhnten aromatischen Früchten heran. Von einem Familienbetrieb in der Region Latium werden die Tomaten weiterverarbeitet – zu unseren Basisprodukten.', 'Weiling GmbH', 'bioladen', 'ITALY', '6b6f4f51-63bb-4787-bcb0-a9c99d622502', 'manager', '2021-08-12 13:10:17', 'System', '2023-01-16 18:08:20', 513, 777, 0, NULL, 0, 1.24, 'Weiling', 0, NULL, 0, 103, 'Tomaten* *aus kontrolliert ökologischer Erzeugung', '2023-06-13 08:56:22', 1181.25, 'CONVENIENCE_PRESERVES', 'PANTRY', 996.15, 21, 'VEGAN;VEGETARIAN', NULL, NULL),
