(692, 'Kokosblütenzucker (Weiling)', '4260096393240', 0, 4.19, 1, 1, NULL, 0, '611238', 'Kokosblütenzucker', 'Kokosblütenzucker ist ein einmaliges, hochwertiges Naturprodukt. Beim schonenden Eindicken von Kokosblütensirup entstehen feine und zarte Kristalle, die einen besonderen, an Karamell erinnernden Geschmack haben. In der asiatischen Küche gehört er zu den wichtigstennatürlichen Süßungsmitteln und wird gerne zum Abrunden von exotischen Köstlichkeiten, Dressings und Wok-Gerichten verwendet. Kokospalmen können über 100 Jahre alt werden. Sie gedeihen am besten im natürlichen Verbund mit vielen anderen tropischen Pflanzen und bilden ein nachhaltiges, vielschichtiges und diverses Ökosystem. In allen gängigen Rezepten kann der normale Haushaltszucker durch Kokosblütenzucker ersetzt werden. Aufgrund seines intensiven Eigengeschmacks ist ein sparsamer Einsatz möglich.', 'Sonnentracht GmbH', 'Agava', 'PHILIPPINES', 'fbcd54b7-3016-474e-b9b0-7ef6d567bb39', 'manager', '2021-08-12 13:12:42', 'System', '2023-10-31 00:03:07', 1296, 791, 0, NULL, 0, 2.49, 'Weiling', 0, NULL, 0, 60, 'Kokosblütenzucker* 100%.  *aus kontrolliert ökologischer Erzeugung', '2023-06-02 10:39:44', 810, 'BAKING_INGREDIENTS;SPICES_COOKING_HELP', 'PANTRY', 281.7, 14.4, 'VEGAN;VEGETARIAN', NULL, NULL),
(693, 'Apfeldicksaft (Weiling)', '4260096393165', 1, 4.59, 1, 1, NULL, 0, '611246', 'Apfeldicksaft', 'Eine mild-fruchtige Süße, schonend eingedickt aus dem Saft sonnengereifter Äpfel aus der Türkei.\nIdeal zum Süßen und zur Herstellung von Fruchtschorlen und Erfrischungsgetränken. Von Natur aus reich an Fructose und daher sparsam in der Anwendung. \n', 'Sonnentracht GmbH', 'Agava', 'GERMANY', '9efad778-d9df-4939-93d8-eda7b559ef59', 'manager', '2021-08-12 13:12:51', 'System', '2023-10-31 00:03:10', 366, 792, 0, NULL, 0, 2.5, 'Weiling', 0, NULL, 0, 60, 'Apfeldicksaft* 95%, Agave*.\n *aus kontrolliert ökologischer Erzeugung', '2023-06-23 11:05:26', 434, 'BAKING_INGREDIENTS;SPREADS_HONEY;SPICES_COOKING_HELP', 'PANTRY', 394, 15.5, 'VEGAN;VEGETARIAN', NULL, NULL),
(694, 'Agavendicksaft (Weiling)', '4016249015732', 0, 10.49, 1, 1, NULL, 0, '610052', 'Agavendicksaft', 'Allos Agavendicksaft ist durch seine hervorragende und zugleich unaufdringliche Süßungseigenschaft die optimale Alternative zu Rohr- und Rübenzucker. Er hat von Natur aus einen hohen Anteil an Fruchtzucker und zeichnet sich durch eine hohe Süßkraft aus. Der goldgelbe Saft lässt sich leicht dosieren und vielseitig einsetzen.\nMit seinem feinaromatischen Geschmack eignet sich der Allos Agavendicksaft ideal zum Süßen von Desserts, Müslis, Fruchtzubereitungen, Getränken und feinen Backwaren.', 'Allos Hof-Manufaktur GmbH', 'Allos', 'NETHERLANDS', '9ee456e0-64ee-4407-bf1e-931ed31c97de', 'manager', '2021-08-12 13:13:11', 'System', '2023-11-25 02:11:19', 351, 793, 0, NULL, 0, 6.9, 'Weiling', 0, NULL, 0, 120, 'Agavendicksaft* *aus ökologischem Anbau.', '2022-11-29 15:41:54', 765.9, 'BAKING_INGREDIENTS;SPICES_COOKING_HELP', 'PANTRY', 731, 18.5, 'VEGAN;VEGETARIAN;PALMOILFREE', NULL, NULL),
