(697, 'Zimt-Zucker (Weiling)', '4012346160603', 0, 2.99, 1, 1, NULL, 0, '610602', 'Zimt-Zucker', 'Zimt und Zucker – mehr braucht es eigentlich nicht, um süße Speisen im Handumdrehen zu vollenden und Kindheitserinnerungen wachzurufen. Unsere Mischung eignet sich auch für heiße Getränke.', 'Ulrich Walter GmbH', 'LEBENSBAUM', 'GERMANY', '1901dadc-24d2-4443-ad33-3e31c4e1fbc4', 'manager', '2021-08-12 13:13:46', 'System', '2023-12-14 02:12:11', 830, 796, 2, NULL, 0, 1.44, 'Weiling', 0, NULL, 0, 60, 'Rohrohrzucker**, Zimt* (5%)* **aus biodynamischer Erzeugung *aus kontrolliert ökologischer Erzeugung', '2023-02-02 08:29:02', 363, 'BAKING_INGREDIENTS;SPICES_COOKING_HELP', 'PANTRY', 222.2, 12, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(698, 'Puderzucker aus Rohrohrzucker (Weiling)', '4024297340454', 0, 1.99, 1, 1, NULL, 0, '610141', 'Puderzucker aus Rohrohrzucker', 'Der Rohrohrzucker, welcher zu Puderzucker weiterverarbeitet wird, stammt von biologisch bewirtschafteten Zuckerplantagen. Die Weiterverarbeitung findet in einer speziellen Zuckermühle in Deutschland statt. Dort wird er sehr fein vermahlen, wodurch die helle Farbe entsteht.', 'Naturata AG', 'NATURATA', 'GERMANY', 'd5174ad1-3fb9-4a74-b06f-9141b4a8ea6d', 'manager', '2021-08-12 13:13:55', 'System', '2023-10-31 00:01:00', 1134, 797, 0, NULL, 0, 1.37, 'Weiling', 0, NULL, 0, 60, 'Rohrohrzucker* *aus kontrolliert ökologischer Erzeugung', '2022-12-17 12:12:14', 561, 'BAKING_INGREDIENTS;SPICES_COOKING_HELP', 'PANTRY', 229, 16.5, 'VEGAN;VEGETARIAN;PALMOILFREE', NULL, NULL),
(699, 'Würfelzucker aus Rohrohrzucker (Weiling)', '4024297340485', 0, 3.99, 1, 1, NULL, 0, '610523', 'Würfelzucker aus Rohrohrzucker', 'Der Naturata Würfelzucker ist aus Rohrohrzucker und ist mit einer Sollbruchstelle versehen, damit die Würfel noch einmal geteilt werden können.', 'Naturata AG', 'NATURATA', 'SWITZERLAND', 'd5454623-8d87-4d52-8b5b-ab76769d1d8e', 'manager', '2021-08-12 13:14:04', 'System', '2023-10-29 02:05:52', 966, 798, 2, NULL, 0, 2.93, 'Weiling', 0, NULL, 0, 298, 'Rohrohrzucker** **aus biodynamischer Erzeugung', '2022-11-29 17:00:48', 546.25, 'BAKING_INGREDIENTS;SPICES_COOKING_HELP', 'PANTRY', 530, 11.5, 'VEGAN;VEGETARIAN', NULL, NULL),
(700, 'Rübenzucker, bioland (Weiling)', '4022381032834', 0, 3.99, 1, 1, NULL, 0, '610520', 'Rübenzucker, bioland', 'Gewonnen aus deutschen Zuckerrüben ist dieser Zucker ein ideales, regionales Süßungsmittel. Die tief wurzelnde Zuckerrübe kommt auch mit trockenen Sommern gut zurecht und lockert den Boden auf. Die Pflanzen binden im Jahr rund 36 Tonnen CO2 pro Hektar. In der Fruchtfolge deutscher Biobauern spielen sie deshalb eine wichtige Rolle.', 'Spielberger GmbH', 'Burgermühle', 'GERMANY', '4b517ce5-e0c6-44e8-a46e-f25f8c4f64f7', 'manager', '2021-08-12 13:14:14', 'System', '2023-11-29 02:07:58', 1092, 799, 1, NULL, 0, 2.54, 'Weiling', 0, NULL, 0, 64, 'Rübenzucker* *aus kontrolliert ökologischer Erzeugung', '2022-04-11 14:09:20', 1764, 'BAKING_INGREDIENTS;SPICES_COOKING_HELP', 'PANTRY', 1008.2, 21, 'VEGAN;VEGETARIAN', NULL, NULL),
(701, 'Ahornsirup Grad A (Weiling)', '4035626112000', 0, 7.29, 1, 1, NULL, 0, '613004', 'Ahornsirup Grad A', 'Ahornsirup ist der eingekochte Saft des Zuckerahorns. Geerntet wird nur wenige Wochen im Frühjahr. Dazu werden die Stämme angebohrt ohne den Baum zu schädigen - und der Saft abgezapft. Die unterschiedlichen Grade bestimmen die Geschmacksqualität und sind abhängig vom Erntezeitpunkt. Zu Anfang ist der Saft heller mit einem fein-milden Aroma (Grad A), zum Ende wird er von Natur aus dunkler und kräftiger im Geschmack. (Aus Kanada. Mild im Geschmack.)', 'Weiling GmbH', 'bioladen', 'GERMANY', '9729dbb8-562c-4695-aa5b-542973dc72c6', 'manager', '2021-08-12 13:14:22', 'System', '2023-10-31 00:01:40', 444, 800, 0, NULL, 0, 4.35, 'Weiling', 0, NULL, 0, 209, NULL, '2023-01-30 15:24:17', 605.556, 'BAKING_INGREDIENTS;SPREADS_HONEY;SPICES_COOKING_HELP', 'PANTRY', 569.38, 16.2, 'VEGAN;VEGETARIAN', NULL, NULL),
(702, 'Hühnerbouillon hf (Weiling)', '4016512050323', 0, 3.99, 1, 1, NULL, 0, '620090', 'Hühnerbouillon hf', 'Mit 29% Hühnerfleisch und -fett aus kontrolliert biologischer Landwirtschaft und ohne Hefeextrakt - für einen natürlichen Geschmack nach Huhn.', 'Hügli Nahrungsmittel GmbH', 'Erntesegen', 'SWITZERLAND', '9f1af6bd-1873-46ff-803c-8e1962bb2784', 'manager', '2021-08-12 13:14:33', 'System', '2023-12-10 02:23:00', 819, 1983, 0, NULL, 0, 2.37, 'Weiling', 0, NULL, 0, 297, 'Steinsalz, 25 % Hühnerfleischpulver*, Maisstärke*, 4,2% Hühnerfett*, Curcuma*, Petersilie*, Pfeffer*, Macis*, Muskatnussschale*, Rosmarin*. *aus kontrolliert ökologischer Erzeugung', '2022-11-29 16:24:12', 432.817, 'SPICES_COOKING_HELP', 'PANTRY', 152, 7.7, 'PALMOILFREE', NULL, NULL),
(703, 'Rinderfond (Weiling)', '4250096906007', 0, 4.19, 1, 1, NULL, 0, '153006', 'Rinderfond', 'Würzig mit feinen Kräutern.', 'Wertkreis Gütersloh gGmbH', 'Kiebitzhof', 'Gütersloh, NRW', '53c6ecfa-bf53-40f6-8dbf-0d41a922fdf8', 'correction', '2021-10-05 12:16:49', 'System', '2024-01-31 02:07:32', 1106, 2285, 1, NULL, 0, 2.6, 'Weiling', 2, 1, 0, 63, 'Fond aus Wasser, Rindfleisch*, Porree, SELLERIE*, Möhren*, Meersalz, Petersilienwurzel*, Kräuter*, Gewürze*, Pfeffer*\r\nenthält folgende allergene Zutaten: Sellerie\r\n*aus kontrolliert ökologischer Erzeugung', '2022-11-20 20:12:19', 840.5, 'SPICES_COOKING_HELP', 'PANTRY', 645, 12.5, 'WITHOUT_ADDED_SUGAR', NULL, NULL),
(704, 'Hühnerfond (Weiling)', '4250096906328', 0, 4.29, 1, 1, NULL, 0, '153008', 'Hühnerfond', 'Mild-würzig, mit erlesenen Kräutern verfeinert.', 'Wertkreis Gütersloh gGmbH', 'Kiebitzhof', 'Gütersloh, NRW', 'd4bf89bc-0e38-4166-b1ff-a8956b859384', 'correction', '2021-10-05 12:17:16', 'System', '2024-01-31 02:07:48', 825, 2286, 1, NULL, 0, 2.6, 'Weiling', 2, 0, 0, 63, 'Fond aus: Wasser, Suppenhühner*, Möhren*, Porree*, SELLERIE*,Meersalz, Petersilienwurzel*, Liebstock*\r\nenthält folgende allergene Zutaten: Sellerie\r\n*aus kontrolliert ökologischer Erzeugung', '2023-01-02 08:39:52', 840.5, 'CONVENIENCE_PRESERVES', 'PANTRY', 645, 12.5, 'WITHOUT_ADDED_SUGAR', NULL, NULL),
(705, 'Gemüsefond (Weiling)', '4250096906311', 0, 4.29, 1, 1, NULL, 0, '153010', 'Gemüsefond', 'Bestes aus Bioland Gemüse und feinen Gewürzen, zum Verfeinern von Suppen und Saucen.\nNatürliches Aroma durch Verzicht auf Geschmacksverstärker und Zusatzstoffe. Vegan, laktosefrei und glutenfrei.', 'Wertkreis Gütersloh gGmbH', 'Kiebitzhof', 'Gütersloh, NRW', '02de5c9e-2fc6-4eda-8001-92189d6710a8', 'correction', '2021-10-05 12:17:39', 'System', '2024-01-31 02:07:15', 720, 2287, 1, NULL, 0, 2.6, 'Weiling', 2, 1, 0, 63, 'Wasser, Porree*, Möhren*, SELLERIE*, Zwiebeln*, Meersalz, Petersilienwurzel*, Liebstock*, Rohrohrzucker*, Pfeffer*, Kräuter*\r\nenthält folgende allergene Zutaten: Sellerie\r\n*aus kontrolliert ökologischer Erzeugung', '2022-11-29 16:15:45', 840.5, 'CONVENIENCE_PRESERVES', 'PANTRY', 645, 12.5, 'VEGAN;VEGETARIAN', NULL, NULL),
(706, 'Gemüsebrühe hefefrei 200 g (Weiling)', '4024297000990', 0, 4.69, 1, 1, NULL, 0, '620542', 'Gemüsebrühe hefefrei 200 g', 'Naturata bietet mit den Gemüsebrühen hefefrei eine Alternative für alle, die Hefe nicht mögen oder aus ideellen Gründen keine zugesetzte Hefe in Lebensmitteln möchten. Auch für Hefeallergiker ist diese Brühe bestens geeignet. Gemüsebrühe hefefrei besticht durch einen feinen Geschmack nach Gemüse und Muskatnuss.', 'Naturata AG', 'NATURATA', 'SWITZERLAND', '067af2fe-185a-4f8b-a3cf-245a37e0d66a', 'manager', '2021-08-12 13:15:10', 'System', '2023-11-02 02:05:47', 717, 801, 0, NULL, 0, 2.81, 'Weiling', 0, NULL, 0, 297, 'Meersalz, Maisstärke*, Gemüse 9 % (Zwiebel*, SELLERIE*, Lauch*, Karotte*, Petersilie*, Pastinake*) Liebstöckel*, Muskat*, Sonnenblumenöl*, Pfeffer*, Curcuma* *aus kontrolliert ökologischer Erzeugung', '2023-05-09 17:46:49', 539, 'SPICES_COOKING_HELP', 'PANTRY', 390, 11, 'VEGAN;VEGETARIAN;GLUTENFREE', NULL, NULL),
(707, 'Frühlingssuppe (Weiling)', '4000345046479', 0, 1.49, 1, 1, NULL, 0, '624031', 'Frühlingssuppe', 'Frühlingssuppe\nGehaltvoll und lecker - wie hausgemacht, \nfür 1/2 l = 2 Teller\n\n-  Lactosefrei\n-  Palmölfrei\n-  Vegan\n-  Vegetarisch', 'Hügli Nahrungsmittel GmbH', 'Natur Compagnie', 'SWITZERLAND', 'e54255b2-3927-42e3-ac76-16940ca44cf1', 'manager', '2021-08-12 13:15:19', 'System', '2023-12-09 03:53:14', 704, 1998, 0, NULL, 0, 0.85, 'Weiling', 0, NULL, 0, 297, 'Teigwaren* (66%) (HARTWEIZENGRIEß*), Meersalz,  Karotten* (7,1%), Maisstärke*, Zwiebeln* (4,2%), Hefeextrakt*, Hefepulver*, Sonnenblumenöl*, Lauch* (1%), Petersilie*, SELLERIE* (0,8%), Curcuma*, Karottensaftkonzentrat*, Liebstöckelblätter*,Kürbis*, Liebstöckelwurzel*, Knoblauch*, Fenchelsamen*. *aus kontrolliert ökologischer Erzeugung', '2022-04-11 15:48:35', 195.2, 'CONVENIENCE_PRESERVES', 'PANTRY', 42, 16, 'VEGAN;VEGETARIAN;PALMOILFREE', NULL, NULL),
