(709, 'Buchstabensuppe (Weiling)', '4000345046615', 0, 1.49, 1, 1, NULL, 0, '624067', 'Buchstabensuppe', 'Buchstaben Suppe\nDer Suppenklassiker für Groß und Klein, \nfür 1/2 l = 2 Teller\n\n-  Lactosefrei\n-  Palmölfrei\n-  Vegan\n-  Vegetarisch', 'Hügli Nahrungsmittel GmbH', 'Natur Compagnie', 'SWITZERLAND', 'ab6188de-7f4c-4ca5-8acc-dc92af199004', 'manager', '2021-08-12 13:15:36', 'System', '2023-12-09 03:53:09', 553, 1996, 0, NULL, 0, 0.85, 'Weiling', 0, NULL, 0, 297, 'Teigwaren* (72%) (HARTWEIZENGRIEß*), Meersalz, Reismehl*, Stärke*, Karotten*, Hefeextrakt*, Sonnenblumenöl*, Zwiebeln*, Lauch*, SELLERIE*, Petersilie*, Karottensaftkonzentrat*, Curcuma*, Kürbis*, Liebstöckelwurzel*, Liebstöckelblätter*, Knoblauch*, Fenchelsamen*. *aus kontrolliert ökologischer Erzeugung', '2022-04-11 15:47:51', 195.2, 'CONVENIENCE_PRESERVES', 'PANTRY', 55, 16, 'VEGAN;VEGETARIAN;PALMOILFREE', NULL, NULL),
(710, 'Rote Linsensuppe vegetarisch (Weiling)', '4031829232231', 0, 3.29, 1, 1, NULL, 0, '600851', 'Rote Linsensuppe vegetarisch', 'Linsen gehören zu den ältesten kultivierten Hülsenfruchtarten, sie stammen ursprünglich aus Vorderasien und liefern wertvolles Eiweiß. Die Rote Linsensuppe überzeugt durch eine feine, leicht stückige Konsistenz. Die roten Linsen geben zusammen mit der Gewürzmischung und der Kokosnote einen ausgewogenen, leicht fruchtigen und exotischen Geschmack. Das Produkt ergänzt die vegetarische Suppenauswahl mit besonderem Geschmackserlebnis in bewährter Ökoland-Qualität.', 'Ökoland GmbH Nord', 'ÖKOLAND', 'GERMANY', 'c0bdcce8-e001-49df-9e5e-15ccaf8cfc48', 'manager', '2021-08-12 13:15:45', 'System', '2023-03-01 02:04:57', 1094, 802, 0, NULL, 0, 1.99, 'Weiling', 0, NULL, 0, 63, 'Trinkwasser, Tomaten*, 9,0% rote Linsen* (Trockeneinwaage), 6,7% Kokosmilch* (Kokosnussextrakt*, Trinkwasser), Zwiebeln*, Tomatenmark*, Karotten*, Sonnenblumenöl*, Steinsalz, Maisstärke*, Rohrohrzucker*, Verdickungsmittel: Guarkernmehl*, Meersalz, Kräuter* (Liebstöckel*, Petersilie*, Rosmarin*), Gewürze* (Macis*, Curcuma*, SENFSAAT*, Anis*, Kümmel*, Muskat*, Bockshornsaat*, Zimt*, Pfeffer*, Knoblauch*, Ingwer*, Kardamom*, Koriander*, Chili*, Kreuzkümmel*), Zitronenschalenpulver*. *aus kontrolliert ökologischer Erzeugung', '2022-04-11 14:21:49', 586.19, 'CONVENIENCE_PRESERVES', 'PANTRY', 452.1, 11, 'VEGETARIAN;PALMOILFREE', NULL, NULL),
(711, 'Ravioli  (Weiling)', '4031829232705', 0, 3.99, 1, 1, NULL, 0, '620825', 'Ravioli ', 'Italiens gefüllte Teigtaschen sind ein echter Klassiker, schon seit dem Mittelalter in aller Munde. Unsere Ökoland Ravioli haben eine besonders delikate Füllung aus bestem Schweinefleisch, fein abgeschmeckt mit aromatischen Kräutern. Zusammen mit der feinen und fruchtigen Tomatensauce bekommt das traditionelle Lieblingsgericht seinen wunderbaren Geschmack. Beliebt bei Groß und Klein – kinderleicht und schnell zubereitet, wie bei Mamma!', 'Ökoland GmbH Nord', 'ÖKOLAND', 'GERMANY', '2ceb2d5f-4f73-4db1-8995-94eb5b7d53cf', 'manager', '2021-08-12 13:16:02', 'System', '2023-09-23 02:07:07', 1119, 803, 0, NULL, 0, 2.53, 'Weiling', 0, NULL, 0, 63, 'Trinkwasser, 18% Ravioli* (HARTWEIZENGRIEß*, 12% Schweinefleisch*, HAFERFLOCKEN*, Sonnenblumenöl*, Meersalz) (Trockeneinwaage), Tomatenmark*, Rohrohrzucker*, Tomatenpulver*, Steinsalz, Maisstärke*, WEIZENMEHL*, Sonnenblumenöl*, Zwiebeln*, Karotten*, Gewürze* (Macis*, Curcuma*, Pfeffer*, Knoblauch*), Kräuter* (Liebstöckel*, Petersilie*, Rosmarin*, Oregano*), Verdickungsmittel: Guarkernmehl* *aus kontrolliert ökologischer Erzeugung', '2022-11-29 16:49:30', 586.19, 'CONVENIENCE_PRESERVES', 'PANTRY', 452.39, 11, 'PALMOILFREE', NULL, NULL),
(712, 'Chili con Carne mit Rind- und Schweinefleisch (Weiling)', '4031829232804', 0, 4.79, 1, 1, NULL, 0, '620830', 'Chili con Carne mit Rind- und Schweinefleisch', 'Christoph Kolumbus hat die scharfen Chili-Schoten vor langer Zeit nach Europa gebracht – heute sorgt das Gewürz für die besondere Note eines echten Küchen-Klassikers: Chili con Carne. Unser Ökoland Chili con Carne nach mexikanischer Tradition wird aus vielen leckeren Kidneybohnen und besten Fleischstücken von Rind und Schwein bereitet. Bestes Fleisch heißt auch, dass unsere Bio-Bauern konsequent für eine artgerechte Haltung und gesunde Fütterung der Tiere sorgen. Eine Komposition aus feinem Gemüse rundet die kräftige, herzhafte Mahlzeit ab.', 'Ökoland GmbH Nord', 'ÖKOLAND', 'GERMANY', '19670a29-50d4-43c2-a042-769ab861edd1', 'manager', '2021-08-12 13:16:12', 'System', '2023-03-25 02:04:39', 1510, 804, 0, NULL, 0, 2.99, 'Weiling', 0, NULL, 0, 63, 'Trinkwasser, 32% Kidneybohnen*, 11% Fleisch* gegart (Rindfleisch*, Schweinefleisch*), Paprika*, Zwiebeln*, Mais*, Tomatenmark*, WEIZENMEHL*, Karotten*, Sonnenblumenöl*, Steinsalz, Maltodextrin*, Maisstärke*, Gewürze* (Paprika*, Muskat*, Curcuma*, Knoblauch*, Pfeffer*, Chili*), Kräuter* (Liebstöckel*, Oregano*, Basilikum*, Rosmarin*, Thymian*, Petersilie*), Meersalz, Rohrohrzucker*. *aus kontrolliert ökologischer Erzeugung', '2022-11-29 15:59:58', 586.19, 'CONVENIENCE_PRESERVES', 'PANTRY', 452.39, 11, 'PALMOILFREE', NULL, NULL),
(713, 'Kartoffel-Cremesuppe vegetarisch (Weiling)', '4031829232002', 0, 2.79, 1, 1, NULL, 0, '620850', 'Kartoffel-Cremesuppe vegetarisch', 'Die als „Gold der Inkas“ bekannte Kartoffel wurde in den südamerikanischen Anden bereits vor über 3.000 Jahren angebaut. In der guten deutschen Küche hat die Kartoffel seit Mitte des 17. Jahrhunderts ihren festen Platz gefunden. Als eines der beliebtesten Lebensmittel findet sich die Kartoffel auf fast allen Speisekarten der Welt. Unsere Ökoland Kartoffel Cremesuppe wird nach einem traditionellen Rezept gekocht und mit frischer Sahne und ausgewählten Kräutern verfeinert. ', 'Ökoland GmbH Nord', 'ÖKOLAND', 'GERMANY', 'de9127ec-447e-4954-b2be-f67f1041fd75', 'manager', '2021-08-12 13:16:21', 'System', '2023-07-01 00:16:23', 1262, 805, 0, NULL, 0, 1.86, 'Weiling', 0, NULL, 0, 63, 'Trinkwasser, 30% Kartoffeln*, Karotten*, Zwiebeln*, 3,8% SAHNE*, SELLERIE*, VOLLMILCHPULVER*, Reismehl*, Maisstärke*, Steinsalz, Meersalz, Gewürze* (Macis*, Curcuma*, Pfeffer*), Kräuter* (Liebstöckel*, Petersilie*, Rosmarin*, Majoran*, Oregano*), Sonnenblumenöl*. *aus kontrolliert ökologischer Erzeugung', '2022-11-29 16:30:27', 586.19, 'CONVENIENCE_PRESERVES', 'PANTRY', 452.39, 11, 'VEGETARIAN;PALMOILFREE;WITHOUT_ADDED_SUGAR', NULL, NULL);
