(714, 'Tomatensuppe - mit Balsamessig aus Modena (Weiling)', '8018759001843', 0, 2.19, 1, 1, NULL, 0, '622500', 'Tomatensuppe - mit Balsamessig aus Modena', '100% Tomaten aus Italien. Eine samtig-weiche Suppe mit dem unverwechselbaren Geschmack unserer vollreifen Tomaten. Leicht verfeinert mit Traubensaft und Balsam Essig aus Modena steht sie zum Genießen bereit.', 'LaSelva', 'LaSelva', 'ITALY', '3f59f17f-b85b-4710-ae81-75654b34d1b4', 'manager', '2021-08-12 13:16:33', 'manager', '2023-02-27 11:29:22', 947, 806, NULL, NULL, 0, 1.21, 'Weiling', 0, NULL, 0, NULL, NULL, '2023-02-27 11:29:22', 840.5, 'CONVENIENCE_PRESERVES', 'PANTRY', NULL, 12.5, NULL, NULL, NULL),
(715, 'Gemüsebrühe roh, hefefrei (Weiling)', '4260623220032', 0, 7.99, 1, 1, NULL, 0, '620506', 'Gemüsebrühe roh, hefefrei', 'SweMa Frische Gemüsebrühe mit 73% rohem Gemüse, Steinsalz, Gewürze. Sonst nichts!\n\nEine gesunde, natürliche und besonders leckere\nAlternative zu Brühwürfeln, Brühpulvern und\nallem, was Sie bisher kennen! Geeignet auch\nzum Marinieren, für Dressings, zum Würzen und\nzu vielem mehr!\n\nZubereitungsempfehlung:\nEinen gehäuften TL (13 g) mit 500 ml\nkochendem Wasser aufgießen.\nFür einen kräftigeren Geschmack kurz in Öl anbraten.\n\nZutaten: 73 % rohes Bio-Gemüse  (Pastinake, SELLERIE, Karotte, Lauch, Zwiebel, Petersilie, getrocknete Tomate), Steinsalz (ohne Rieselhilfe), Bio-Gewürze.\n\nZusatzstoffe, auch die im BIO-Bereich zugelassenen, verwenden wir nicht! Regionalität und Natürlichkeit bedeutet für uns mehr als nur ein Trend. Die Achtung für Lebensmittel und deren Erzeuger spielt in unseren jungen Unternehmen eine der wichtigsten Rollen.\n\nWas unterscheidet uns von anderen Gemüsebrühen\n- Unser Produkt ist nicht getrocknet, wir verwenden rohes, frisches Gemüse, Salz und Gewürze\n- der Gemüseanteil beträgt 73 %\n- Wir verwenden keinerlei Zusatzstoffe, auch keine im BIO-Bereich zugelassenen\n- Wir verzichten auf die Verwendung aller Bestandteile, welche nicht in eine Gemüsebrühe gehören (Maltodextrin, Maisstärke, zugesetzter Zucker, Hefeextrakt uvm.)\n- keine zugesetzten Fette oder Öle \n- selbstverständlich in bester Bio Qualität\n- das Suppengrün im Glas\n\nInformation zum Mindesthaltbarkeitsdatum: Nach der Herstellung ist die Gemüsepaste mindestens 9 Monate haltbar. Wir empfehlen die ungeöffneten Gläser im Trockenregal oder im Trockenlager zu lagern. Für geöffnete Gläser empfehlen wir die Lagerung im Kühlschrank. Die Kühllagerung dient ausschließlich der Farbstabilisierung. Nach 9 Monaten verändert sich aufgrund dessen, dass wir keine Antioxidationsmittel verwenden, leicht die Farbe durch den Abbau vom Chlorophyll (Grüne Farbe im Gemüse), was unbedenklich für die Verzehrbarkeit ist. Das deutsche Lebensmittelrecht gibt allerding vor, dass das Mindesthaltbarkeitsdatum erreicht ist sobald sich u.a. die Qualitätsbeschreibenden Merkmale (z.B. Farbe) verändern. Die von uns angegebenen 9 Monate beziehen sich daher nur auf die Farbveränderung, nicht auf die eigentliche Haltbarkeit. Die Gemüsebrühe kann aufgrund des zugegebenen Salzes mikrobiologisch nicht verderben und kann daher auch weit nach dem Ablauf des MHD\'s verwendet werden.\n\nwww.swema-lebensmittel.de', 'SweMa GmbH', 'SweMa', 'GERMANY', 'd2607827-a09a-4c88-b8cf-61955790e4fd', 'manager', '2021-08-12 13:16:43', 'System', '2023-10-31 00:01:36', 1100, 807, 0, NULL, 0, 5.03, 'Weiling', 0, NULL, 0, 63, '73 % rohes Gemüse in veränderlichen Gewichtsanteilen (Pastinake*, SELLERIE*, Karotte*, Lauch*, Zwiebel*, Petersilie*, getrocknete Tomate*), Steinsalz, Gewürze* *aus kontrolliert ökologischer Erzeugung', '2022-10-29 00:00:58', 500.94, 'SPICES_COOKING_HELP', 'PANTRY', 524, 11.5, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE;RAWFOOD;WITHOUT_ADDED_SUGAR', NULL, NULL),
(716, 'BIO-KRAFTWÜZE MEDITERRAN (Weiling)', '4260623220209', 0, 5.99, 1, 1, NULL, 0, '620508', 'BIO-KRAFTWÜZE MEDITERRAN', 'Frische Gemüsebrühe mediterran - 210g Glas, rohes Bio-Gemüse, Steinsalz, Gewürze. Sonst nichts!\n\nDie ideale Basis für die mediterrane Küche. Passt zu Antipasti, Nudel-, Reis- und Gemüsegerichten, aber auch zu Fisch und Fleisch.\n\nZubereitungsempfehlung:\n1½ TL (18 g) mit 500 ml kochendem Wasser aufgießen.\nTipp: Für einen kräftigeren Geschmack kurz in Öl anbraten.\n\nZutaten: 69% rohes Bio-Gemüse in veränderlichen Gewichtsanteilen (Karotte, Zwiebel, Pastinake, getrocknete Tomate), Steinsalz, Bio-Gewürze (Paprika, Rosmarin, Fenchel,  Knoblauch, Thymian, Oregano, Kerbel, Estragon, Bohnenkraut).\n\nZusatzstoffe, auch die im BIO-Bereich zugelassenen, verwenden wir nicht! Regionalität und Natürlichkeit bedeutet für uns mehr als nur ein Trend. Die Achtung für Lebensmittel und deren Erzeuger spielt in unserem jungen Unternehmen eine wichtigste Rolle.\n\nWas unterscheidet uns von anderen Herstellern\n- Unser Produkt ist nicht getrocknet, wir verwenden rohes, frisches Gemüse\n- der Anteil vom rohem Gemüse beträgt 69 %\n- Wir verwenden keinerlei Zusatzstoffe, auch keine im BIO-Bereich zugelassenen\n- Wir verzichten auf die Verwendung aller Bestandteile, welche nicht in ein Lebensmittel gehören (Maltodextrin, Maisstärke, zugesetzter Zucker, Hefeextrakt uvm.)\n- keine zugesetzten Fette oder Öle \n- selbstverständlich in bester Bio Qualität\n\n\nInformation zum Mindesthaltbarkeitsdatum: Nach der Herstellung ist die Gemüsebrühe mindestens 9 Monate haltbar. Wir empfehlen die ungeöffneten Gläser im Trockenregal oder im Trockenlager zu lagern. Für geöffnete Gläser empfehlen wir die Lagerung im Kühlschrank. Die Kühllagerung dient ausschließlich der Farbstabilisierung und Verlängerung der Frische. Nach 9 Monaten verändert sich aufgrund dessen, dass wir keine Antioxidationsmittel verwenden, leicht die Farbe, was unbedenklich für die Verzehrbarkeit ist. Das deutsche Lebensmittelrecht gibt allerdings vor, dass das Mindesthaltbarkeitsdatum erreicht ist sobald sich u.a. die qualitätsbeschreibenden Merkmale (z.B. Farbe) verändern. Die von uns angegebenen 9 Monate beziehen sich daher nur auf die Farbveränderung, nicht auf die eigentliche Haltbarkeit. Die Gemüsebrühe kann aufgrund des zugegebenen Salzes mikrobiologisch nicht verderben und kann daher auch weit nach dem Ablauf des MHD\'s verwendet werden.\n\nwww.swema-lebensmittel.de', 'SweMa GmbH', 'SweMa', 'GERMANY', 'b3d49bb2-f597-419c-96d2-2db750e59481', 'correction', '2021-08-23 15:03:17', 'System', '2023-10-31 00:01:30', 1099, 808, 0, NULL, 0, 4.15, 'Weiling', 0, NULL, 0, 63, '69% rohes Gemüse in veränderlichen Gewichtsanteilen (Karotte*, Zwiebel*, Pastinake*, getrocknete Tomate*), Steinsalz, Gewürze (Paprika*, Rosmarin*, Fenchel*,  Knoblauch*, Thymian*, Oregano*, Kerbel*, Estragon*, Bohnenkraut*). *aus kontrolliert ökologischer Erzeugung', '2022-10-31 00:01:17', 273.696, 'SPICES_COOKING_HELP', 'PANTRY', 352, 8, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE;RAWFOOD;WITHOUT_ADDED_SUGAR', NULL, NULL),
