(721, 'Glasnudeln (Weiling)', '4020943132459', 0, 3.99, 1, 1, NULL, 0, '649074', 'Glasnudeln', 'Vermicelles – uniques et biologiques ! Ces vermicelles quasiment translucides, une spécialité de nouilles asiatiques, sont très populaires et se prêtent à de multiples usages : dans les soupes et les sauces, frits, sautés, dans les salades et bien sûr dans les délicieux rouleaux de printemps. Les vermicelles ARCHE sans gluten sont fabriqués en amidon de pois pur biologique.', 'Arche Naturprodukte GmbH', 'Arche Naturküche', 'CHINA', 'cb096bb7-18c3-48c4-bc09-0cba00e3e344', 'manager', '2021-08-12 13:17:50', 'System', '2023-05-11 02:06:20', 727, 812, 0, NULL, 0, 2.42, 'Weiling', 0, NULL, 0, 511, 'amidon de pois*  *issu de l\'agriculture biologique ', '2023-01-16 18:11:18', 1100, 'PASTA_CEREALS_LEGUMES', 'PANTRY', 230, 22, 'VEGAN;VEGETARIAN;GLUTENFREE', NULL, NULL),
(722, 'Byodo Lasagne, semola (Weiling)', '4018462142813', 0, 2.79, 1, 1, NULL, 0, '645017', 'Byodo Lasagne, semola', '\"Die kulinarische Hochburg Emilia Romagna ist neben original Parmaschinken, Parmigiano Reggiano und feinem Aceto aus Modena, auch die Heimat der herrlichen Lasagne. Die dünnen und langsam getrockneten Teigplatten werden dort „al forno“ genossen und backen, im Wechsel mit Ragout und Béchamel-Sauce geschichtet, in einer feuerfesten Form und garniert mit reichlich Parmesan und Butterflocken bissfest gar. \n\nFür die Byodo Genießerpasta werden mehrere ausgesuchte Sorten Hartweizengrieß aus Italien verwendet. Diese werden in ein perfekt abgestimmtes, gut gehütetes Mischungsverhältnis gebracht. Das Geheimnis der wunderbar gelben Pasta von Byodo liegt auch in einer langsamen Vermahlung des Getreides. Dadurch wirkt weniger Wärme als üblich auf das Korn ein und der herrliche Geschmack und feine Duft bleiben erhalten. Vermengt mit kristallklarem Wasser und langsam getrocknet wird daraus ein wahrer Genuss. Nach traditioneller Handwerkskunst werden die feinen Lasagneblätter gewalzt und geschnitten. All dies sorgt für besonders gute Kocheigenschaften und den perfekten \"al dente\"-Biss.\n', 'Byodo Naturkost GmbH', 'Byodo', 'ITALY', '60116d3a-317b-4c3e-b593-1be98615ce3f', 'manager', '2021-08-12 13:17:59', 'System', '2024-02-15 02:06:22', 1322, 813, 0, NULL, 0, 1.55, 'Weiling', 0, NULL, 0, 105, 'HARTWEIZENGRIESS* *aus kontrolliert ökologischer Erzeugung', '2022-11-29 16:35:38', 649.8, 'PASTA_CEREALS_LEGUMES', 'PANTRY', 272, 19, 'VEGAN;VEGETARIAN;KOSCHER;HALAL;WITHOUT_ADDED_SUGAR', NULL, NULL),
(723, 'Byodo Tagliatelle, semola, grün (Nester) (Weiling)', '4018462143100', 0, 2.99, 1, 1, NULL, 0, '645052', 'Byodo Tagliatelle, semola, grün (Nester)', '\"Die kunstvolle Hochzeitsfrisur einer reichen Herzogin soll zur Schöpfung der kreativ aufgewickelten Tagliatelle geführt haben. Die feinen Bandnudeln werden seit dem 15. Jahrhundert in ihrer Heimat Emilia-Romagna traditionell geschnitten, daher auch der Name, der sich vom Italienischen „tagliare“ ableitet, was „schneiden“ bedeutet. \n\nFür die Byodo Genießerpasta werden mehrere ausgesuchte Sorten Hartweizengrieß aus Italien verwendet. Diese werden in ein perfekt abgestimmtes, gut gehütetes Mischungsverhältnis gebracht. Das Geheimnis der wunderbar gelben Pasta von Byodo liegt auch in einer langsamen Vermahlung des Getreides. Dadurch wirkt weniger Wärme als üblich auf das Korn ein und der herrliche Geschmack und feine Duft bleiben erhalten. Vermengt mit kristallklarem Wasser und langsam getrocknet wird daraus ein wahrer Genuss. Nach traditioneller Handwerkskunst werden die feinen Tagliatelle gewalzt und geschnitten. All dies sorgt für besonders gute Kocheigenschaften und den perfekten \"al dente\"-Biss.\"\n', 'Byodo Naturkost GmbH', 'Byodo', 'ITALY', 'cdf40f4e-5eba-4cdb-b9d5-e5552fa953e4', 'manager', '2021-08-12 13:18:08', 'System', '2023-12-17 03:08:15', 963, 814, 0, NULL, 0, 1.55, 'Weiling', 0, NULL, 0, 105, 'HARTWEIZENGRIESS*, Spinatpulver* (2 %) *aus kontrolliert ökologischer Erzeugung', '2022-06-06 10:02:35', 1928.5, 'PASTA_CEREALS_LEGUMES', 'PANTRY', 287.46, 29, 'VEGAN;VEGETARIAN;KOSCHER;HALAL;WITHOUT_ADDED_SUGAR', NULL, NULL),
