(726, 'Byodo Vollkornreis-Teff Fusilli (Weiling)', '4018462148204', 0, 3.99, 1, 1, NULL, 0, '645096', 'Byodo Vollkornreis-Teff Fusilli', 'Das Superfood Teff gibt den glutenfreien Fusilli von Byodo den fein-nussigen Geschmack. Die kraftvolle, kleine Zwerghirse gilt als das eiweißreichste Getreide der Welt und ist auch sonst ein echtes Powerkorn, da es viel Eisen, Magnesium und Kalzium mit sich bringt. Durch die Kombination mit feinem Bio-Vollkornreis erhalten die glutenfreien Bio-Nudeln ihre schöne gold-braune Farbe und einen herrlichen Biss.', 'Byodo Naturkost GmbH', 'Byodo', 'ITALY', 'ac10283e-ecc4-4d5d-b232-44c02e1a8f37', 'manager', '2021-08-12 13:18:36', 'System', '2024-01-09 02:05:36', 706, 817, 0, NULL, 0, 2.48, 'Weiling', 0, NULL, 0, 67, 'Vollkornreismehl*, Teffmehl* *aus kontrolliert ökologischer Erzeugung', '2022-05-24 10:56:35', 1584, 'PASTA_CEREALS_LEGUMES', 'PANTRY', 256.5, 22, 'VEGAN;VEGETARIAN;GLUTENFREE;KOSCHER;HALAL;WITHOUT_ADDED_SUGAR', NULL, NULL),
(727, 'Byodo Rote Linsen Volanti (Weiling)', '4018462148303', 0, 3.99, 1, 1, NULL, 0, '645098', 'Byodo Rote Linsen Volanti', 'Rund, rot und revolutionär lecker schmecken die Volanti aus roten Bio-Linsen im Byodo Sortiment. Neben wertvollem. pflanzlichen Eiweiß enthalten die feinen, glutenfreien Bio-Nudeln auch jede Menge Ballaststoffe und sättigen auf köstliche Art langanhaltend. Pro Portion rechnet man nur 50 - 60g  der leuchtend roten Nudeln.\nDie ansprechende Volanti-Form (fliegende Untertasse) sorgt dafür, dass sich Sauce besonders köstlich im Rand verfängt - für ein wunderbar sauciges Geschmack-Erlebnis.', 'Byodo Naturkost GmbH', 'Byodo', 'ITALY', 'e9f22fde-3770-4690-b464-7648e786a581', 'manager', '2021-08-12 13:18:45', 'System', '2023-08-18 02:05:50', 915, 818, 0, NULL, 0, 2.48, 'Weiling', 0, NULL, 0, 105, 'Mehl aus roten Linsen* *aus kontrolliert ökologischer Erzeugung', '2022-12-17 12:14:20', 1224, 'PASTA_CEREALS_LEGUMES', 'PANTRY', 256.5, 17, 'VEGAN;VEGETARIAN;GLUTENFREE;KOSCHER;HALAL;WITHOUT_ADDED_SUGAR', NULL, NULL),
(728, 'Byodo Reis Mais Lasagne (Weiling)', '4018462148402', 0, 3.29, 1, 1, NULL, 0, '645100', 'Byodo Reis Mais Lasagne', 'Mit der Mais-Reis Lasagne von Byodo steht genussvolles Schlemmen auf dem Programm. Die schlanken Bio-Nudelplatten werden traditionell gewalzt und anschließend langsam getrocknet. In ausreichend Flüssigkeit kochen sie direkt in der Sauce wunderbar gar und geben jeder Lasagne-Zubereitung eine herrliche, dezent nach Mais schmeckende Note.\nDie glutenfreie Kombination von feinem Bio-Mais und Reis ist zudem reich an Mineralstoffen wie Eisen. Mit diesem Wissen schmeckt der Lasagnen-Genuss gleich noch besser!', 'Byodo Naturkost GmbH', 'Byodo', 'ITALY', 'ed07e8b7-ddf4-4518-abbe-76ad6883dac2', 'manager', '2021-08-12 13:18:54', 'System', '2023-12-17 03:08:33', 1323, 819, 0, NULL, 0, 1.99, 'Weiling', 0, NULL, 0, 105, 'Maismehl* (55%), Reismehl* (45%) *aus kontrolliert ökologischer Erzeugung', '2022-11-29 16:35:46', 649.8, 'PASTA_CEREALS_LEGUMES', 'PANTRY', 272, 19, 'VEGAN;VEGETARIAN;GLUTENFREE;KOSCHER;HALAL;WITHOUT_ADDED_SUGAR', NULL, NULL),
