(733, 'Goodels - die gute Nudel \"Kichererbse\" Spirelli (Weiling)', '4038507008959', 0, 3.99, 1, 1, NULL, 0, '649033', 'Goodels - die gute Nudel \"Kichererbse\" Spirelli', '„Goodels Kichererbse“ werden aus dem feinen Mehl der bereits seit Jahrtausenden kultivierten Kichererbse und goldgelber Leinsaat hergestellt. Sie enthalten von Natur aus viel wertvolles pflanzliches Protein sowie Ballaststoffe und zeichnen sich durch den milden, zart nussigen Geschmack aus.', 'Govinda Natur GmbH', 'Govinda', 'GERMANY', 'ef79f6a6-7b7c-4f7c-8c41-d0ce17e20cff', 'manager', '2021-08-12 13:19:39', 'System', '2023-09-07 03:47:14', 736, 824, 0, NULL, 0, 2.37, 'Weiling', 0, NULL, 0, 60, '80 % Kichererbsen*, goldgelbe Leinsaat* *aus kontrolliert ökologischer Erzeugung', '2022-11-29 16:17:09', 1386, 'PASTA_CEREALS_LEGUMES', 'PANTRY', 255, 21, 'VEGAN;VEGETARIAN', NULL, NULL),
(734, 'Goodels - die gute Nudel \"Mungbohne-Leinsaat\"\" (Weiling)', '4038507008973', 0, 4.29, 1, 1, NULL, 0, '649035', 'Goodels - die gute Nudel \"Mungbohne-Leinsaat\"\"', 'Goodels „Mungbohne“ bestehen aus feinstem Mungbohnenmehl und goldgelber Leinsaat. Mit der grünen Farbe, dem vollmundigen Geschmack und dem wertvollen pflanzlichen Protein sind sie optisch, kulinarisch und ernährungsphysiologisch eine Bereicherung jeder Mahlzeit!', 'Govinda Natur GmbH', 'Govinda', 'GERMANY', '7d0930c6-acfe-4fb1-83a8-c30bbfb86540', 'manager', '2021-08-12 13:19:50', 'System', '2023-09-26 02:42:19', 737, 825, 0, NULL, 0, 2.58, 'Weiling', 0, NULL, 0, 132, '90% Mungbohnenmehl*, goldgelbe Leinsaat* *aus kontrolliert ökologischer Erzeugung', '2022-11-29 16:17:21', 1386, 'PASTA_CEREALS_LEGUMES', 'PANTRY', 255, 21, 'VEGAN;VEGETARIAN;RAWFOOD', NULL, NULL),
(735, 'Goodels - die gute Nudel \"Buchweizen-Leinsaat\" (Weiling)', '4038507008089', 0, 3.99, 1, 1, NULL, 0, '649038', 'Goodels - die gute Nudel \"Buchweizen-Leinsaat\"', '„Goodels Buchweizen“ haben nur zwei wertvolle Zutaten: bester Buchweizen und goldgelbe Leinsaat. Die Nudeln zeichnen sich durch einen edlen, nussigen  Geschmack und wertvolle Kohlenhydrate aus. Durch die schnelle Zubereitung und die wertvollen Inhaltsstoffe eine Bereicherung in der Küche!', 'Govinda Natur GmbH', 'Govinda', 'GERMANY', 'aeca5ce9-77b0-44e5-9f53-8c7a1423ac3c', 'manager', '2021-08-12 13:19:59', 'System', '2023-09-26 02:42:27', 735, 826, 0, NULL, 0, 2.35, 'Weiling', 0, NULL, 0, 132, '75 % Buchweizen*, goldgelbe Leinsaat* *aus kontrolliert ökologischer Erzeugung', '2022-04-11 15:00:29', 1386, 'PASTA_CEREALS_LEGUMES', 'PANTRY', 255, 21, 'VEGAN;VEGETARIAN;RAWFOOD', NULL, NULL),
(736, 'Goodel Rote Linse-Leinsaat (Weiling)', '4038507008614', 0, 3.99, 1, 1, NULL, 0, '649044', 'Goodel Rote Linse-Leinsaat', '„Goodels rote Linse-Leinsaat“ werden aus feinstem rotem Linsenmehl und goldgelber Leinsaat hergestellt. Von Natur aus glutenfrei und reich an wertvollem pflanzlichem Protein. Mit dem fein würzigen, vollmundigen Geschmack bringen sie Abwechslung auf den Tisch und sind in kürzester Zeit zubereitet.\nFür die perfekte Konsistenz ist es wichtig, die Nudeln kurz mit kaltem Wasser abzuschrecken.\n\nTrotz der Rohkostqualität, sollten die Goodels nach Packungsanweisung gekocht werden.', 'Govinda Natur GmbH', 'Govinda', 'GERMANY', 'bb86886b-e973-49e7-b6e2-df2f7560a9c7', 'manager', '2021-08-12 13:20:09', 'System', '2023-09-27 02:06:32', 738, 827, 0, NULL, 0, 2.37, 'Weiling', 0, NULL, 0, 132, 'rote Linsen* (90%), goldgelbe Leinsaat* *aus kontrolliert ökologischer Erzeugung', '2022-11-29 16:17:32', 1386, 'PASTA_CEREALS_LEGUMES', 'PANTRY', 255, 21, 'VEGAN;VEGETARIAN;RAWFOOD', NULL, NULL),
