(741, 'Spaghetti, Dinkel hell (Weiling)', '4024297061625', 0, 3.49, 1, 1, NULL, 0, '644147', 'Spaghetti, Dinkel hell', 'Dinkel-Spaghetti für den fein nussigen Pastagenuss in nachhaltiger Papierverpackung. \nDie mit wasserbasierten Farben bedruckte Verpackung besteht aus FSC zertifiziertem Papier aus nachhaltig bewirtschafteten Wäldern. Nach der Entsorgung im Altpapier kann die Verpackung recycelt werden.', 'Naturata AG', 'NATURATA', 'GERMANY', '478d36f9-57e1-4b57-b319-b44ecc765c4a', 'manager', '2021-08-12 13:20:56', 'System', '2024-01-02 16:00:18', 990, 832, 2, NULL, 0, 2.2, 'Weiling', 0, NULL, 0, 63, 'DINKELMEHL Type 812** (eine WEIZENART) **aus biodynamischer Erzeugung', '2023-04-01 15:22:34', 270, 'PASTA_CEREALS_LEGUMES', 'PANTRY', 506, 30, 'VEGAN;VEGETARIAN', NULL, NULL),
