(746, 'Bauernspätzle, hell, demeter (Weiling)', '4022381471206', 0, 2.79, 1, 1, NULL, 0, '644229', 'Bauernspätzle, hell, demeter', 'Genießen Sie dieses echte Mühlenerzeugnis. Nachhaltigkeit, Transparenz, Fairness und die besondere Demeter-Qualität sind die Grundlagen unserer Tätigkeit.\nMit unseren Partner-Landwirten in Italien verbindet uns unser gemeinsames Anliegen, die Förderung der biodynamischen Landwirtschaft.\n\nUnser Tipp aus der Küche: Mit etwas Nudelwasser werden Soßen sämiger. Das schmeckt!\n\nKochzeit: 12–15 Minuten.', 'Spielberger GmbH', 'Spielberger Mühle', 'GERMANY', '3a915835-54a9-4ef5-86d3-5c34db5fbbb5', 'manager', '2021-08-12 13:21:42', 'System', '2024-02-13 02:05:55', 1045, 837, 2, NULL, 0, 1.69, 'Weiling', 0, NULL, 0, 64, 'HARTWEIZENgrieß** **aus biodynamischer Erzeugung', '2022-12-01 08:24:15', 1960, 'PASTA_CEREALS_LEGUMES', 'PANTRY', 512, 24.5, 'VEGAN;VEGETARIAN', NULL, NULL),
(747, 'Breite Bandnudeln, demeter (Weiling)', '4022381013826', 0, 2.99, 1, 1, NULL, 0, '644266', 'Breite Bandnudeln, demeter', 'Der Hartweizengrieß für diese Nudeln stammt von einem Demeter-Gut in Italien, mit dem die Spielberger-Mühle seit über 20 Jahren zusammenarbeitet.', 'Spielberger GmbH', 'Spielberger Mühle', 'GERMANY', 'c7935036-243c-4990-a77e-cd54569e051e', 'manager', '2021-08-12 13:21:51', 'System', '2023-01-16 18:13:20', 546, 838, 2, NULL, 0, 1.82, 'Weiling', 0, NULL, 0, 60, 'HARTWEIZENgrieß** **aus biodynamischer Erzeugung', '2022-11-29 15:57:07', 2268, 'PASTA_CEREALS_LEGUMES', 'PANTRY', 511.4, 27, 'VEGAN;VEGETARIAN', NULL, NULL),
(748, 'Spaghetti (Weiling)', '4035626113397', 0, 1.49, 1, 1, NULL, 0, '642030', 'Spaghetti', 'Original italienisch genießen: Die bioladen*Pasta wird aus 100 % italienischem Hartweizengrieß nach traditionellem Verfahren in der Lombardei hergestellt. A.S.T.R.A. Bio, unser Pasta-Produzent aus Casteldidone arbeitet eng mit der Kooperative IRIS zusammen– Bio-Pionier in Italien seit 1978. Dort arbeiten alle mit großer Überzeugung und Sorgfalt für beste Produktqualität. Zur Herstellung werden Bronzeformen verwendet. Sie verleihen den Nudeln eine raue Oberfläche, die Saucen besonders gut aufnehmen kann. Durch die schonende Trocknung behält die Pasta ihre Kochfestigkeit und gelingt immer perfekt al dente. Eine besondere Qualität, die man schmeckt!', 'Weiling GmbH', 'bioladen', 'ITALY', 'd5268008-14b3-440c-9de7-7c4a8741652d', 'manager', '2021-08-12 13:22:45', 'System', '2023-01-16 18:13:24', 507, 839, 0, NULL, 0, 0.9, 'Weiling', 0, NULL, 0, 102, 'HARTWEIZENGRIEß* *aus kontrolliert ökologischer Erzeugung', '2022-11-29 15:54:31', 562.5, 'PASTA_CEREALS_LEGUMES', 'PANTRY', 504, 30, 'VEGAN;VEGETARIAN', NULL, NULL),
