(754, 'Vogelglück Klassiker 500 g (Weiling)', '4018874050102', 0, 3.49, 1, 1, NULL, 0, '653504', 'Vogelglück Klassiker 500 g', 'Ergänzungsfutter für eine angemessene ganzjährige Zufütterung von Gartenvögeln. Reich an natürlich gesunden Fett- und Eiweißquellen. Die reine Sonnenblumenkerne-Körner-Nuss-Mischung aus einheimischen Bio-Zutaten bringt ihre Gartenvögel gut über den Winter und über das ganze Jahr.', 'ARIES Umweltprodukte', 'Aries', 'GERMANY', '1be83571-f7ca-4c66-a0d3-14e45d29d6a6', 'correction', '2021-08-21 11:53:37', 'System', '2023-10-13 02:22:36', 916, 845, 1, NULL, 0, 1.8, 'Weiling', 0, NULL, 0, 63, 'Sonnenblumenkerne*, Weizen*, Gerste*, Haselnüsse* *aus kontrolliert ökologischer Erzeugung', '2022-10-19 02:04:55', 1569.75, 'ANIMAL_FOOD', 'DRUGSTORE', 530, 23, NULL, NULL, NULL),
(755, 'Bio Katze Schale Bröckchen Huhn & Rind (Weiling)', '8714265090226', 0, 1.49, 1, 1, NULL, 0, '651001', 'Bio Katze Schale Bröckchen Huhn & Rind', 'Getreidefreie Bröckchen mit Bio-Huhn und -Rind, verfeinert mit Thymian und Petersilie. Das Bio-Nassfutter ist eine vollwertige, nahrhafte und sehr schmackhafte Mahlzeit für Ihre Katze. Reines Bio-Futter und somit ohne Zusatz von chemische Duft-, Farb- und Geschmacksstoffe, Pestizide und genetisch modifizierten Organismen, für das die am schnellsten aufnehmbaren Proteine ausgewählt wurden. So bekommt Ihre Katze genau das, was sie braucht.\nDie kleinen Stücke sind leicht zu essen. Die Aromen des Fleisches wurden in von der Sauce aufgenommen, wodurch das Nassfutter noch besser schmeckt.\n\nYarrah empfiehlt Nassfutter für jede Katze. Nassfutter ist reich an Feuchtigkeit und hilft Ihrer Katze dabei, ausreichend hydriert zu bleiben. Besonders ältere Katzen und Katzen, die wenig trinken, profitieren von einer täglichen Portion Nassfutter.', 'Yarrah Organic Petfood B.V.', 'Yarrah Organic Petfood', 'NETHERLANDS', 'dd3d7d1e-a81a-4a01-96bd-92084935bbb5', 'manager', '2021-08-12 13:23:52', 'System', '2024-02-10 02:05:55', 1506, 846, 0, NULL, 0, 0.86, 'Weiling', 0, NULL, 0, 120, '55% Brühe* (Wasser, Tapiokastärke, Mineralstoffe, 0,1% getrocknete Thymian*, entspricht 1,1%\nThymian*, 0,1% getrocknete Petersilie*, entspricht 0,7% Petersilie*, Liebstöckel*, Hühnermehl*), 45% Brocken (58% Huhn: Hühnerfleisch*, Hühnerkarkasse*, 22% Rind*: Rinderlunge*, Rinderleber*, Wasser, Kartoffelstärke*, Sojaproteinpulver*, Mineralstoffe). *= biologisch. *aus kontrolliert ökologischer Erzeugung', '2023-07-04 09:15:34', 178.2, 'ANIMAL_FOOD', 'DRUGSTORE', 105, 9, NULL, NULL, NULL),
(756, 'Yarrah Bio MSC Katzenfutter Adult Huhn - 800g (Weiling)', '8714265000010', 0, 9.99, 1, 1, NULL, 0, '651010', 'Yarrah Bio MSC Katzenfutter Adult Huhn - 800g', 'Knuspriges Trockenfutter mit Bio-Huhn und Erbsen für ausgewachsene Katzen. Das Bio-Katzenfutter ist eine vollwertige, nahrhafte und sehr schmackhafte Mahlzeit für Ihre Katze. Reines Bio-Futter und somit ohne Zusatz von chemische Duft-, Farb- und Geschmacksstoffe, Pestizide und genetisch modifizierten Organismen, für das die am schnellsten aufnehmbaren Proteine ausgewählt wurden. So bekommt Ihre Katze genau das, was sie braucht.', 'Yarrah Organic Petfood B.V.', 'Yarrah Organic Petfood', 'NETHERLANDS', 'c9747bf0-c4ba-46ff-bc25-3d6369fa9b21', 'manager', '2021-08-12 13:24:01', 'System', '2023-10-31 00:02:15', 1269, 847, 0, NULL, 0, 5.51, 'Weiling', 0, NULL, 0, 120, 'Huhn getrocknet* (20,5%), Weizen*, Mais*, Reisprotein*, Sojabohnen*, Hühnerfett*, gelbe Erbsen*, grüne Erbsen*, Sonnenblumenkernschalen*, Bierhefe, Sojaflocken*, Mineralstoffe, MSC Fischöl¹.\n* = aus kontrolliert biologischem Anbau.\n¹Aus einer MSC-zertifizierten nachhaltigen Fischerei. www.msc.org/de ; www.msc.org/ch.\n97,4% der landwirtschaftlichen Rohstoffe stammen aus ökologischer Landwirtschaft. *aus kontrolliert ökologischer Erzeugung', '2022-10-31 00:01:48', 3256, 'ANIMAL_FOOD', 'DRUGSTORE', 820, 27.5, NULL, NULL, NULL),
(757, 'Bio Katze Dose Bröckchen Huhn (Weiling)', '8714265071362', 0, 3.49, 1, 1, NULL, 0, '651012', 'Bio Katze Dose Bröckchen Huhn', 'Leckere Bröckchen mit Bio-Huhn, ergänzt mit Brennnessel und Tomate aus kontrolliert biologischem Anbau. Das Bio-Nassfutter ist eine vollwertige, nahrhafte und sehr schmackhafte Mahlzeit für Ihre Katze. \nDie kleinen Stücke sind leicht zu essen. Die Aromen des Fleisches wurden in die Sauce aufgenommen, wodurch das Nassfutter noch besser schmeckt.\n\nYarrah empfiehlt Nassfutter für jede Katze. Nassfutter ist reich an Feuchtigkeit und hilft Ihrer Katze dabei, ausreichend hydriert zu bleiben. Besonders ältere Katzen und Katzen, die wenig trinken, profitieren von einer täglichen Portion Nassfutter.', 'Yarrah Organic Petfood B.V.', 'Yarrah Organic Petfood', 'NETHERLANDS', '72ae09be-abfd-4b34-a8fe-112bbf748ec5', 'manager', '2021-08-12 13:24:11', 'System', '2023-10-13 02:16:15', 1507, 848, 0, NULL, 0, 2.06, 'Weiling', 0, NULL, 0, 120, '35% Fleisch* und tierische Nebenerzeugnisse* (Huhn* 31%), Getreide* (Weizen* 6%), Mineralstoffe, Pflanzliche Nebenerzeugnisse* (Brennnessel* 0.2%, Tomate*0.2%). \n* = biologisch. *aus kontrolliert ökologischer Erzeugung', '2022-12-19 08:01:40', 618.75, 'ANIMAL_FOOD', 'DRUGSTORE', 456, 11, NULL, NULL, NULL),
(758, 'Bio MSC Hund Trockenfutter Erwachsene Huhn (Weiling)', '8714265000232', 0, 19.99, 1, 1, NULL, 0, '651013', 'Bio MSC Hund Trockenfutter Erwachsene Huhn', 'Trockenfutter mit Bio-Huhn, MSC-Fisch, Bio-Erbsen und Baobab. Das Bio-Hundefutter ist eine vollwertige, nahrhafte und sehr schmackhafte Mahlzeit für Ihren Hund. Reines Bio-Futter und somit ohne Zusatz von chemische Duft-, Farb- und Geschmacksstoffe, Pestizide und GVO, wobei die am besten resorbierbaren Proteine ausgewählt wurden. So bekommt Ihr Hund genau das, was er braucht.', 'Yarrah Organic Petfood B.V.', 'Yarrah Organic Petfood', 'NETHERLANDS', '0087af20-6105-4938-a734-4eb8a633c064', 'manager', '2021-08-12 13:24:21', 'System', '2023-10-28 02:05:38', 844, 849, 0, NULL, 0, 11.72, 'Weiling', 0, NULL, 0, 120, 'Huhn getrocknet* (18%), Hafer*, Mais*, Weizen*, Hühnerfett*, Reisprotein*, Sojaflocken*, Erbsen*, MSC Hering getrocknet¹, Baobab*, hydrolysierte leber*, Mineralstoffe, Sonnenblumenkernschalen*, Bierhefe,  MSC Fischöl¹.\n* = aus kontrolliert biologischem Anbau.\n¹Aus einer MSC-zertifizierten nachhaltigen Fischerei. www.msc.org/de; www.msc.org/ch.\n96,9% der landwirtschaftlichen Rohstoffe stammen aus ökologischer Landwirtschaft. *aus kontrolliert ökologischer Erzeugung', '2022-10-20 02:04:21', 8112, 'ANIMAL_FOOD', 'DRUGSTORE', 2035, 39, NULL, NULL, NULL),
(759, 'Bio Hund Schale Bröckchen Huhn & Gemüse (Weiling)', '8714265090721', 0, 1.99, 1, 1, NULL, 0, '651025', 'Bio Hund Schale Bröckchen Huhn & Gemüse', 'Getreidefreie Bröckchen mit Bio-Huhn, ergänzt mit Erbsen, Karotten und Chicorée aus kontrolliert biologischem Anbau. Das Bio-Nassfutter ist eine vollwertige, nahrhafte und sehr schmackhafte Mahlzeit für Ihren Hund. Reines Bio-Futter und somit ohne Zusatz von chemische Duft-, Farb- und Geschmacksstoffe, Pestizide und GVO, wobei die am besten resorbierbaren Proteine ausgewählt wurden. So bekommt Ihr Hund genau das, was er braucht.\n\nDie Stücke in Soße sind leicht zu essen. Die Aromen des Fleisches wurden in die Sauce aufgenommen, wodurch das Nassfutter noch besser schmeckt. Nassfutter ist reich an Feuchtigkeit und hilft Ihrem Hund, hydratisiert zu bleiben.', 'Yarrah Organic Petfood B.V.', 'Yarrah Organic Petfood', 'NETHERLANDS', 'cb6c11d5-4134-4250-aa96-64b2a16419b0', 'manager', '2021-08-12 13:24:30', 'System', '2023-10-13 02:16:41', 1538, 850, 0, NULL, 0, 1.1, 'Weiling', 0, NULL, 0, 120, '55% Brühe* (Wasser, 3% getrockneten Erbsen* und Karotten* entspricht 15% \nErbsen* und Karotten*, Tapiokastärke, Mineralstoffe, Liebstöckel*, Hühnermehl*), 45% Brocken (80% Hühn: Hühnerfleisch*, Hühnerkarkasse*, Hühnerleber*, Wasser, Kartoelstärke*, Sojaproteinpulver*, Mineralstoe, 0,2% getrockneter Zichorie* entspricht 0,9% Zichorie*). *= Biologisch *aus kontrolliert ökologischer Erzeugung', '2022-10-20 02:04:55', 265.226, 'ANIMAL_FOOD', 'DRUGSTORE', 157, 10.1, NULL, NULL, NULL),
