(761, 'Bio Hund Snack Kekse groß vegan (Weiling)', '8714265070709', 0, 6.49, 1, 1, NULL, 0, '651060', 'Bio Hund Snack Kekse groß vegan', 'Köstliche vegetarische / vegane Hundeleckerlies. Ideal für Hunde, die Schwierigkeiten mit der Verdauung tierischer Proteine haben oder wenn Sie Ihren Hund kein oder weniger Fleisch servieren möchten. Die Hundeleckerlies enthalten kein Fleisch oder tierische Nebenprodukte und werden ohne chemische Duft-, Farb- und Geschmacksstoffe, Pestizide und genetisch modifizierten Organismen hergestellt.', 'Yarrah Organic Petfood B.V.', 'Yarrah Organic Petfood', 'NETHERLANDS', 'd69f3c42-959b-4ac8-9f70-037f0c5631b0', 'manager', '2021-08-12 13:24:58', 'System', '2023-10-26 02:06:27', 929, 852, 0, NULL, 0, 3.87, 'Weiling', 0, NULL, 0, 120, 'Vollkornweizen*, Maismehl*, Glukosesirup (aus Mais)*, Haferfasern*, Sonnenblumenöl*, Calciumcarbonat, Natriumchlorid. * = Biologisch. *aus kontrolliert ökologischer Erzeugung', '2022-10-20 02:05:02', 1781.25, 'ANIMAL_FOOD', 'DRUGSTORE', 505, 19, 'VEGAN;VEGETARIAN', NULL, NULL);
