(762, 'Gefriergetrocknete Bio-Erdbeeren (Weiling)', '3770000858334', 0, 3.59, 1, 1, NULL, 0, '670010', 'Gefriergetrocknete Bio-Erdbeeren', 'Diese Tüte enthält 120g frische Erdbeeren, bei niedrigen Temperaturen dehydriert, damit sie knusprig werden, während Geschmack und Nährstoffe erhalten bleiben.', 'Colibri ', 'Organica', 'EUROPEAN_UNION', '2d0d1321-f458-44e2-a1a3-7c32432d9637', 'manager', '2021-08-12 13:25:07', 'System', '2023-01-16 18:14:29', 1516, 853, 0, NULL, 0, 2.14, 'Weiling', 0, NULL, 0, 120, 'Gefriergetrocknete Erdbeeren* (100%) *aus kontrolliert ökologischer Erzeugung', '2023-03-16 23:01:55', 576, 'CONVENIENCE_PRESERVES;MUISLI_FLAKES_NUTS', 'PANTRY', 17, 16, 'VEGAN;VEGETARIAN', NULL, NULL),
(763, 'Feigen getrocknet (Weiling)', '4035626110617', 0, 3.79, 1, 1, NULL, 0, '676002', 'Feigen getrocknet', 'Unsere bioladen*Feigen sind weder geschwefelt noch mit Konservierungsstoffen behandelt. Sie sind getrocknet und schmecken süß-saftig mit einer leichten Honignote. Sie eignen sich hervorragend zum Snacken für zwischendurch aber auch in Müslis, zum Backen und zum Kochen.\n', 'Weiling GmbH', 'bioladen', 'GERMANY', '1a1a0447-638a-4590-99bb-78146cd25872', 'manager', '2021-08-12 13:25:20', 'System', '2023-09-30 00:02:35', 462, 854, 0, NULL, 0, 2.8, 'Weiling', 0, NULL, 0, 60, NULL, '2022-05-17 03:14:09', 590.625, 'CONVENIENCE_PRESERVES;MUISLI_FLAKES_NUTS', 'PANTRY', 253, 17.5, 'VEGAN;VEGETARIAN', NULL, NULL),
(764, 'Sultaninen (Weiling)', '4035626110655', 0, 3.49, 1, 1, NULL, 0, '676006', 'Sultaninen', 'Unsere bioladen*Sultaninen werden nicht geschwefelt, sie sind sonnengetrocknet und geölt. Aufgrund ihres süß-saftigen Geschmacks finden sie in vielen Gerichten ihre Verwendung oder einfach als Snack für zwischendurch.\n', 'Weiling GmbH', 'bioladen', 'GERMANY', '4b4df7ee-d0d6-48c7-98c5-b78cbb8a1813', 'manager', '2021-08-12 13:25:29', 'System', '2023-01-16 18:14:35', 509, 855, 0, NULL, 0, 2.18, 'Weiling', 0, NULL, 0, 60, 'Sultaninen (99,6%)*, Sonnenblumenöl* *aus kontrolliert ökologischer Erzeugung', '2022-05-24 10:04:37', 1134, 'CONVENIENCE_PRESERVES;MUISLI_FLAKES_NUTS', 'PANTRY', 505, 21, 'VEGAN;VEGETARIAN', NULL, NULL),
(765, 'Apfelringe getrocknet (Weiling)', '4035626110693', 0, 4.69, 1, 1, NULL, 0, '676010', 'Apfelringe getrocknet', 'Getrocknete Äpfel schmecken süßer als frische Äpfel. Sie eignen sich hervorragend zum Naschen für zwischendurch aber auch in Müslis oder zum Backen.\n', 'Weiling GmbH', 'bioladen', 'GERMANY', 'a236e8e1-4002-4e79-bd3c-569f0e25ed6a', 'manager', '2021-08-12 13:25:38', 'manager', '2023-01-30 15:31:44', 445, 856, 0, NULL, 0, 2.8, 'Weiling', 0, NULL, 0, 60, NULL, '2023-01-30 15:31:44', 1134, 'MUISLI_FLAKES_NUTS;CONVENIENCE_PRESERVES', 'PANTRY', 130, 21, 'VEGAN;VEGETARIAN', NULL, NULL),
(766, 'Datteln entsteint, 200g (Weiling)', '4035626110754', 0, 2.99, 1, 1, NULL, 0, '676016', 'Datteln entsteint, 200g', 'Die Süße und der honigartiger Geschmack unserer bioladen*Datteln wertet viele Gerichte auf. Auch fürs Backen oder für Müslis eignen sich Datteln hervorragend. \n', 'Weiling GmbH', 'bioladen', 'GERMANY', '7c0adef4-6232-40fd-be5c-619fbe33cba5', 'manager', '2021-08-12 13:25:51', 'System', '2024-01-06 02:05:45', 458, 857, 0, NULL, 0, 1.52, 'Weiling', 0, NULL, 0, 60, NULL, '2023-02-14 11:49:44', 556.875, 'CONVENIENCE_PRESERVES;MUISLI_FLAKES_NUTS', 'PANTRY', 203, 16.5, 'VEGAN;VEGETARIAN', NULL, NULL),
(767, 'Ingwerstäbchen kandiert (Weiling)', '4035626111478', 0, 3.49, 1, 1, NULL, 0, '676030', 'Ingwerstäbchen kandiert', 'Kandiert und in Rohrohrzucker gewendet, wird die Ingwerwurzel zum ganz besonderen Snack für zwischendurch. Mit ihrem süßlich-scharfen Geschmack eignen sich die Stäbchen auch als raffinierte Zutat zum Kochen und Backen.\n', 'Weiling GmbH', 'bioladen', 'GERMANY', 'e99c2171-8e65-4de7-a1bc-7cbed6ba9fb0', 'manager', '2021-08-12 13:26:29', 'System', '2023-01-16 18:14:40', 476, 858, 0, NULL, 0, 0, 'Weiling', 0, NULL, 0, 60, 'Rohrohrzucker*, Ingwer (27%)*  *aus kontrolliert ökologischer Erzeugung', '2022-05-17 03:16:01', 489.375, 'SWEETS', 'SNACKS', 117.5, 14.5, 'VEGAN;VEGETARIAN', NULL, NULL),
(768, 'Tomaten getrocknet (Weiling)', '4035626110853', 0, 2.59, 1, 1, NULL, 0, '676031', 'Tomaten getrocknet', 'Die sonnengetrockneten Tomaten finden in vielen Gerichten Verwendung, Schauen Sie doch mal auf www.weiling.de und lassen sich inspirieren. (Hälften, gesalzen und sonnengetrocknet)\n', 'Weiling GmbH', 'bioladen', 'GERMANY', '166fd293-4b67-47fc-8645-a5a12501f6a5', 'manager', '2021-08-12 13:26:38', 'System', '2023-11-15 02:09:27', 511, 859, 0, NULL, 0, 1.55, 'Weiling', 0, NULL, 0, 60, 'Tomaten (90%)*, Meersalz *aus kontrolliert ökologischer Erzeugung', '2022-05-17 03:14:40', 918, 'CONVENIENCE_PRESERVES', 'PANTRY', 106, 17, 'VEGAN;VEGETARIAN', NULL, NULL),
(769, 'Ingwerstücke kandiert (Weiling)', '4035626114080', 0, 4.99, 1, 1, NULL, 0, '676035', 'Ingwerstücke kandiert', 'In Ingwersirup kandiert und in Puderzucker gewendet, wird die Ingwerwurzel zum ganz besonderen Snack für zwischendurch. Mit ihrem süßlich-scharfen Geschmack eignen sich die Stücke auch als raffinierte Zutat zum Kochen und Backen.', 'Weiling GmbH', 'bioladen', 'GERMANY', 'ebf18fdd-c81b-4ac5-9e00-e24cc9c83bcb', 'manager', '2021-08-12 13:26:48', 'System', '2023-10-14 02:14:42', 477, 860, 0, NULL, 0, 3.43, 'Weiling', 0, NULL, 0, 60, 'Ingwer*, Ingwersirup*, Puderzucker* *aus kontrolliert ökologischer Erzeugung', '2022-05-19 19:22:01', 506.25, 'SWEETS', 'SNACKS', 175, 15, 'VEGAN;VEGETARIAN', NULL, NULL),
