(771, 'Bananenchips geröstet & gesüßt (Weiling)', '4065626114926', 0, 4.59, 1, 1, NULL, 0, '676090', 'Bananenchips geröstet & gesüßt', 'Unsere bioladen*Bananenchips sind geröstet und gesüßt. Sie eignen sich perfekt zum Naschen für zwischendurch und in Müslis.\n', 'Weiling GmbH', 'bioladen', 'GERMANY', '7caccff7-96fc-4857-9c49-a96b9839c77c', 'manager', '2021-08-12 13:27:06', 'System', '2023-10-14 02:11:13', 447, 862, 0, NULL, 0, 2.8, 'Weiling', 0, NULL, 0, 60, 'Bananen* (68%), Kokosnussöl*, Rohrohrzucker*,  Honig* *aus kontrolliert ökologischer Erzeugung', '2023-01-16 18:14:50', 1584, 'CONVENIENCE_PRESERVES;MUISLI_FLAKES_NUTS', 'PANTRY', 405, 22, 'VEGETARIAN', NULL, NULL),
(772, 'Soja Cuisine (Weiling)', '4016249162450', 0, 1.69, 1, 1, NULL, 0, '690321', 'Soja Cuisine', 'Wir bei Allos wollen es dir leicht machen, dich natürlich zu ernähren. Deshalb stellen wir leckere Produkte her, die nicht nur dir schmecken, sondern auch unserem Planeten. Das alles tun wir, damit du sagst: Allos – natürlich gut für mich.', 'Allos Hof-Manufaktur GmbH', 'Allos', 'ITALY', 'f43cffe0-abc2-40f4-a5a0-ae4f53bb3643', 'manager', '2021-08-12 13:27:15', 'System', '2023-11-29 02:12:39', 1013, 863, 0, NULL, 0, 1, 'Weiling', 0, NULL, 0, 103, 'SOJAextrakt* (Wasser, SOJABOHNEN* (7%), Sonnenblumenöl* kaltgepresst, Reissirup*, Reisstärke*, Verdickungsmittel: Guarkernmehl*, Emulgator: Sonnenblumenlecithine*, Meersalz. *aus ökologischem Landbau.', '2023-02-13 23:24:45', 252.72, 'PRESERVED_MILK_DRINKS', 'FRESH;PANTRY', 216, 11.7, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(773, 'Hafer Cuisine (Weiling)', '4016249207007', 0, 1.29, 1, 1, NULL, 0, '690325', 'Hafer Cuisine', 'Wir bei Allos wollen es dir leicht machen, dich natürlich zu ernähren. Deshalb stellen wir leckere Produkte her, die nicht nur dir schmecken, sondern auch unserem Planeten. Das alles tun wir, damit du sagst: Allos – natürlich gut für mich.', 'Allos Hof-Manufaktur GmbH', 'Allos', 'ITALY', '2ec6eb04-d22b-4d15-895d-bb4809d3ba39', 'manager', '2021-08-12 13:27:24', 'System', '2023-11-29 02:14:00', 765, 864, 0, NULL, 0, 1, 'Weiling', 0, NULL, 0, 102, 'Wasser, HAFER* (8%), kaltgepresstes Sonnenblumenöl*, Verdickungsmittel: Guarkernmehl, Meersalz. *aus ökologischem Landbau.', '2022-08-10 00:08:38', 252.72, 'PRESERVED_MILK_DRINKS', 'FRESH;PANTRY', 218, 11.7, 'VEGAN;VEGETARIAN;LACTOSEFREE', NULL, NULL),
(774, 'Gratin Cuisine (Weiling)', '4016249218201', 0, 1.49, 1, 1, NULL, 0, '690330', 'Gratin Cuisine', 'Mit der neuen Allos Gratin Cuisine gibt es jetzt eine lecker abgeschmeckte, hochwertige Alternative zu Sahne aus Reis, einer Prise Meersalz - verfeinert mit Muskatnuss. Ideal für alle Aufläufe, Gratins oder vegetarische Lasagne – perfekt geeignet zum Überbacken als Käseersatz. \nFettarme Alternative zu Sahne mit nur 4% Fett .', 'Allos Hof-Manufaktur GmbH', 'Allos', 'ITALY', '28a5c8a7-3f4e-49ef-8dd3-4bb02bc476d8', 'manager', '2021-08-12 13:27:33', 'System', '2022-05-28 02:04:32', 742, 865, 0, NULL, 0, 0, 'Weiling', 0, NULL, 0, NULL, NULL, '2022-05-28 02:04:32', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL),
(775, 'Vanille Sauce mit Bourbon-Vanille, BIO (Weiling)', '4005394286272', 0, 2.29, 1, 1, NULL, 0, '695549', 'Vanille Sauce mit Bourbon-Vanille, BIO', 'Vanille Sauce mit Bourbon-Vanille. Die Vanille Sauce kann zu Desserts, Apfelstrudel, Eis und frischen Früchten serviert werden. Sie ist warm und kalt genießbar.', 'Biovegan GmbH', 'Biovegan', 'GERMANY', '1473e4b8-d4bf-48b5-b79b-13724fc6fec6', 'manager', '2021-08-12 13:27:43', 'System', '2023-07-01 00:03:48', 994, 866, 0, NULL, 0, 1.52, 'Weiling', 0, NULL, 0, 63, 'Maisstärke*, Bourbon-Vanille*¹ (2,7 %), Salz. *aus kontrolliert ökologischer Erzeugung', '2022-06-01 00:00:55', 46, 'BAKING_INGREDIENTS;CONVENIENCE_PRESERVES', 'PANTRY', 40, 11.5, 'VEGAN;VEGETARIAN;GLUTENFREE', NULL, NULL),
