(778, 'Provamel Bio Soja Dessert Vanille (Weiling)', '5411188080183', 0, 1.89, 1, 1, NULL, 0, '690026', 'Provamel Bio Soja Dessert Vanille', 'Spontan Besuch bekommen? Wer sich für ein leckeres Dessert oder eine Nascherei am Nachmittag nicht lange in die Küche stellen möchte, kann einfach ein Provamel Bio Soja Dessert mit Bio-Vanille-Extrakt aus Madagaskar servieren! Mit seiner samtig-cremigen Konsistenz schmeichelt das vollmundig-vanillige Dessert nicht nur dem Gaumen, sondern auch den Gästen. Der Dessert-Klassiker ist ebenfalls zum Backen bestens geeignet.', 'Alpro Comm. VA / SCA', 'Provamel', 'BELGIUM', 'e78c1771-8409-4e8f-a68b-90b0d94b7d21', 'manager', '2021-08-12 13:28:12', 'System', '2022-06-21 02:04:40', 1011, 869, 0, NULL, 0, 1.66, 'Weiling', 0, NULL, 0, NULL, NULL, '2022-06-21 02:04:40', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL),
(779, 'Provamel Bio Soja Dessert Schokolade (Weiling)', '5411188080190', 0, 1.89, 1, 1, NULL, 0, '690028', 'Provamel Bio Soja Dessert Schokolade', 'Vorsicht Suchtgefahr: Das cremig-leckere Provamel Bio Soja Dessert Schokolade ist so schokoladig, dass man eventuell nicht genug davon bekommen kann! Deckel auf, Löffel rein und vollen Schokofaktor genießen. Am besten immer ausreichend Vorrat zu Hause haben, für den Fall, dass die Schoko-Lust mal spontan vorbeischaut. Auch zum Backen oder als Basis für Dessert-Kreationen hervorragend verwendbar.', 'Alpro Comm. VA / SCA', 'Provamel', 'BELGIUM', '0c7cd966-5566-407c-a051-72730a5d964e', 'manager', '2021-08-12 13:28:21', 'System', '2023-07-01 00:14:44', 1012, 870, 0, NULL, 0, 1.71, 'Weiling', 0, NULL, 0, NULL, NULL, '2022-04-11 14:31:04', NULL, 'OTHER', NULL, NULL, NULL, NULL, NULL, NULL),
(780, 'Würzhefeflocken (Weiling)', '4260028360814', 0, 4.99, 1, 1, NULL, 0, '730401', 'Würzhefeflocken', 'Bioreal Bio-Würzhefeflocken haben eine natürliche, mild-aromatische Note, die den Eigengeschmack von Gerichten angenehm abrundet.', 'Agrano GmbH & Co. KG', 'Bioreal', 'GERMANY', '8c3a5595-3f4e-4814-b621-925180c35c92', 'manager', '2021-08-12 13:28:30', 'System', '2023-09-25 02:26:33', 873, 871, 0, NULL, 0, 3.05, 'Weiling', 0, NULL, 0, 62, 'Melassehefe* (69%), Reismehl* (30%), Meersalz *aus kontrolliert ökologischer Erzeugung', '2023-03-22 02:05:12', 704, 'SPICES_COOKING_HELP', 'PANTRY', 130.3, 16, 'VEGAN;VEGETARIAN;PALMOILFREE', NULL, NULL),
(781, 'Byodo Kräuteressig, 5% Säure, 0,5 l (Weiling)', '4018462441602', 0, 3.59, 1, 1, NULL, 0, '730108', 'Byodo Kräuteressig, 5% Säure, 0,5 l', 'Klar in der Farbe aber absolut voll und vielfältig im Geschmack ist der Byodo Kräuteressig (5% Säure). Feine Auszüge frischer Bio-Kräuter geben dem leckeren Bio-Essig die intensive Kräuternote, die ihn absolut unverzichtbar zu Rohkost & Salaten wie z.B. Kartoffelsalat macht.  Für diesen feinen Essig wird Branntwein langsam zu Essig vergoren und mit unserer speziellen Kräuterkombination ausgewogen mild abgeschmeckt wird. Heraus kommt ein ausgewogener Küchenstar, der mit seinem runden, milden Geschmack vielerlei Gerichte veredelt.\n\nWie alle Byodo Essige ist er absolut naturbelassen und nicht erhitzt. So bleiben wertvolle Enzyme und Geschmacksstoffe auf köstliche Art und Weise erhalten. Trübungen oder Ablagerungen am Flaschenboden sowie mögliche Flockenbildung bedeuten keinen Qualitätsverlust. Ganz im Gegenteil! Sie weisen auf die natürliche Herstellungsweise dieses biologischen Produktes hin. Sogenannte \"Essigmuttern\" können einfach abgesiebt und der Essig ganz normal weiter verwendet werden. ', 'Byodo Naturkost GmbH', 'Byodo', 'GERMANY', '80a4be54-132b-40b4-9bc0-9e9cc4a36620', 'manager', '2021-08-12 13:28:43', 'System', '2024-01-03 02:05:50', 1305, 872, 0, NULL, 0, 2.15, 'Weiling', 0, NULL, 0, 67, 'Branntweinessig* , Kräuterauszüge* *aus kontrolliert ökologischer Erzeugung', '2023-06-13 09:07:10', 1325.78, 'OIL_VINEGAR_SAUCES', 'PANTRY', 822.7, 26.3, 'VEGAN;VEGETARIAN;HALAL;WITHOUT_ADDED_SUGAR', NULL, NULL),
(782, 'Byodo Aceto Balsamico di Modena IGP, 6 % Säure (Weiling)', '4018462416006', 0, 5.69, 1, 1, NULL, 0, '730110', 'Byodo Aceto Balsamico di Modena IGP, 6 % Säure', 'Der Aceto Balsamico di Modena IGP (6% Säure) von Byodo stammt aus dem Herzen der nord-italienischen Essigproduktion - Modena & der Reggio Emilia. Der tief-dunkle Balsamessig ist durch sein spezielles Byodo Mischungsverhältnis von feinem Bio-Rotweinessig und konzentriertem Traubenmost besonders ausgewogen und harmonisch im Geschmack. Ein herrlich vollmundiger, temperamentvoller Genuss!\n\nDer Klassiker unter den italienischen Balsamessigen trägt den Namenszusatz IGP (geschützte geografische Angabe). Wie alle Byodo Essige wird der Byodo Aceto Balsamico di Modena IGP durch natürliche Vergärung gewonnen und ist nicht erhitzt. Für natürlichen Balsamessig-Genuss vom Feinsten!', 'Byodo Naturkost GmbH', 'Byodo', 'ITALY', 'db10d590-45a2-47be-8106-ccba0fb8381d', 'manager', '2021-08-12 13:28:53', 'System', '2023-03-22 02:04:32', 346, 873, 0, NULL, 0, 3.35, 'Weiling', 0, NULL, 0, 105, 'Rotweinessig*, konzentrierter Traubenmost* *aus kontrolliert ökologischer Erzeugung', '2022-11-29 15:41:37', 821.632, 'OIL_VINEGAR_SAUCES', 'PANTRY', 949, 26.2, 'VEGAN;VEGETARIAN;HALAL', NULL, NULL),
(783, 'Byodo Rotweinessig, 6% Säure (Weiling)', '4018462441008', 0, 3.49, 1, 1, NULL, 0, '730125', 'Byodo Rotweinessig, 6% Säure', 'Der Byodo Rotweinessig (6% Säure) ist intensiv-rot in der Farbe und wunderbar kräftig im Geschmack. Feiner österreichischer oder italienischer Tafelwein werden dafür bei angenehm warmen Temperaturen langsam zu Essig vergoren. Dieses Verfahren nennt man die kontinuierliche Essigvergärung. Vor der Abfüllung in die Flasche wird dieser feine Bio-Essig mit intensivem Geschmack nur noch gefiltert. Er passt ideal zu kräftigen Salaten und eignet sich bestens zum Marinieren.\n\nWie alle Byodo Essige ist er absolut naturbelassen und weder erhitzt, noch geschwefelt. So bleiben wertvolle Enzyme und Geschmacksstoffe auf köstliche Art und Weise erhalten. Trübungen oder Ablagerungen am Flaschenboden sowie mögliche Flockenbildung bedeuten keinen Qualitätsverlust. Ganz im Gegenteil! Sie weisen auf die natürliche Herstellungsweise dieses biologischen Produktes hin. Sogenannte \"Essigmuttern\" können einfach abgesiebt und der Essig ganz normal weiter verwendet werden. ', 'Byodo Naturkost GmbH', 'Byodo', 'ITALY', 'fac7a841-2f54-4a0a-86e1-46d81303111c', 'manager', '2021-08-12 13:29:03', 'System', '2024-02-08 02:08:11', 1093, 874, 0, NULL, 0, 2.15, 'Weiling', 0, NULL, 0, 102, NULL, '2024-02-08 02:08:11', 1325.78, 'OIL_VINEGAR_SAUCES', 'PANTRY', 822.7, 26.3, 'VEGAN;VEGETARIAN;RAWFOOD;HALAL;WITHOUT_ADDED_SUGAR', NULL, NULL),
(784, 'Byodo Weißweinessig, 6% Säure (Weiling)', '4018462441206', 0, 3.49, 1, 1, NULL, 0, '730127', 'Byodo Weißweinessig, 6% Säure', 'Der Bio-Weißweinessig (6% Säure) von Byodo schmeckt harmonisch-intensiv und hat eine nahezu klare Farbe. Feiner österreichischer oder italienischer Tafelwein werden dafür bei angenehm warmen Temperaturen langsam zu Essig vergoren. Dieses Verfahren nennt man die kontinuierliche Essigvergärung. Vor der Abfüllung wird der naturbelassene Bio-Essig nur noch gefiltert. Mit seinem intensiven Geschmack passt er wunderbar zu kräftigen Salaten, eignet sich aber aber zum Einlegen von Gemüse ganz hervorragend.', 'Byodo Naturkost GmbH', 'Byodo', 'ITALY', '6838670a-2332-46ec-87d5-75542c1bd687', 'manager', '2021-08-12 13:29:12', 'System', '2023-12-17 03:07:19', 892, 875, 0, NULL, 0, 2.15, 'Weiling', 0, NULL, 0, 102, NULL, '2023-11-22 02:05:54', 1325.78, 'OIL_VINEGAR_SAUCES', 'PANTRY', 822.7, 26.3, 'VEGAN;VEGETARIAN;RAWFOOD;HALAL;WITHOUT_ADDED_SUGAR', NULL, NULL),
(785, 'Byodo Mittelscharfer Senf in der Tube (Weiling)', '4018462161722', 0, 2.19, 1, 1, NULL, 0, '730152', 'Byodo Mittelscharfer Senf in der Tube', 'Der Byodo Mittelscharfer Senf verführt mit seiner Cremigkeit, feinen Schärfe und dem würzigen Geschmack. Er ist ein Allround-Talent in der Küche - finden sich in ihm doch nur beste Bio-Zutaten. Die geheime Gewürzmischung und deutsche Senfsaat machen ihn unvergleichlich köstlich! \n\nDer mittelscharfe Bio-Senf von Byodo schmeckt nicht nur zu Wurst und Käse, sondern verfeinert Dressings, Suppen sowie Fisch- und Fleischgerichte. Dank der praktischen Tube aus 100% recyceltem Aluminium* lässt er sich einfach portionieren.\n\n*Die Tuben bestehen ohne Deckel aus 100% recyceltem Aluminium.', 'Byodo Naturkost GmbH', 'Byodo', 'GERMANY', '75b9f3ac-e8a0-4ae5-876b-3963f61fb140', 'manager', '2021-08-12 13:29:22', 'System', '2023-12-17 03:07:30', 1555, 876, 0, NULL, 0, 1.33, 'Weiling', 0, NULL, 0, 67, 'Wasser, SENFSAAT*, Branntweinessig*, Steinsalz, Gewürze*, Gewürzextrakt*. *aus kontrolliert ökologischer Erzeugung', '2023-05-30 10:37:16', 171, 'OIL_VINEGAR_SAUCES', 'PANTRY', 117, 19, 'VEGAN;VEGETARIAN;KOSCHER;HALAL;WITHOUT_ADDED_SUGAR;GLUTENFREE', NULL, NULL),
(786, 'Byodo Bieressig, 5% Säure (Weiling)', '4018462441107', 0, 4.29, 1, 1, NULL, 0, '730210', 'Byodo Bieressig, 5% Säure', 'Für den würzig-malzigen Byodo Bieressig wird hochwertiges Bio-Bier bei warmen Temperaturen zu feinem Essig vergoren. Diese Verfahren nennt man die kontinuierliche Essigvergärung. Da der Bieressig wie alle Byodo Essige nicht erhitzt wird, bleiben wertvolle Enzyme erhalten.\nDank des verwendeten Bio-Biers hat der Essig einen würzigen und frischen Geschmack und wunderbaren Geruch. Der gold-gelbe Bio-Essig passt damit hervorragend in die bayerische Küche und gibt klassischem Kartoffelsalat und Saucen eine leckere Note.', 'Byodo Naturkost GmbH', 'Byodo', 'GERMANY', 'cbfcfaf6-4fe0-476d-a56c-a72610ee9ee1', 'manager', '2021-08-12 13:29:31', 'System', '2023-12-17 03:08:10', 401, 877, 0, NULL, 0, 2.49, 'Weiling', 0, NULL, 0, 67, NULL, '2022-11-29 15:49:27', 1325.78, 'OIL_VINEGAR_SAUCES', 'PANTRY', 826.7, 26.3, 'VEGAN;VEGETARIAN;RAWFOOD;KOSCHER;HALAL;WITHOUT_ADDED_SUGAR', NULL, NULL),
(787, 'Condimento Bianco (Weiling)', '4024297000167', 0, 4.39, 1, 1, NULL, 0, '730622', 'Condimento Bianco', 'Der Condimento Bianco ist die helle Variante des Aceto Balsamico di Modena. Überall, wo die dunkle Farbe eines Acetos störend sein könnte, wird gern der Condimento Bianco verwendet.', 'Naturata AG', 'NATURATA', 'ITALY', '8c7f454b-332c-4c84-a9cc-ca14c85f5dcc', 'manager', '2021-08-12 13:29:40', 'System', '2024-02-15 02:07:11', 383, 878, 0, NULL, 0, 3.03, 'Weiling', 0, NULL, 0, 105, 'Weißweinessig*, Traubenmostkonzentrat* *aus kontrolliert ökologischer Erzeugung', '2022-05-23 15:01:25', 801.625, 'OIL_VINEGAR_SAUCES', 'PANTRY', 918, 26.5, 'VEGAN;VEGETARIAN', NULL, NULL),
(788, 'Crema con Aceto Balsamico di Modena IGP (Weiling)', '4024297010449', 0, 5.99, 1, 1, NULL, 0, '730627', 'Crema con Aceto Balsamico di Modena IGP', 'Die Herstellung des berühmten Aceto Balsamico hat in der italienischen Provinz Modena eine jahrhundertealte Tradition. Der \"König unter den Essigen\" wird nach einem traditionellen Verfahren hergestellt und muss viele Jahre reifen. Ausgesuchte Zutaten und sorgfältige Herstellung lassen diese Essigspezialität zu einem echten Highlight in der heimischen Küche werden.', 'Naturata AG', 'NATURATA', 'ITALY', '75feb18c-ddc5-4c13-ad24-64dafc3a4cb3', 'manager', '2021-08-12 13:29:49', 'System', '2023-11-02 02:06:20', 581, 879, 2, NULL, 0, 3.68, 'Weiling', 0, NULL, 0, 102, 'Aceto Balsamico di Modena IGP** 60 % (Traubenmost**, Rotweinessig**), Traubenmost gekocht**, Maisstärke* *aus kontrolliert ökologischer Erzeugung **aus biodynamischer Erzeugung', '2023-05-09 17:50:05', 264, 'OIL_VINEGAR_SAUCES', 'PANTRY', 210, 16.5, 'VEGAN;VEGETARIAN', NULL, NULL),
(789, 'Wok Noodles (Weiling)', '4000345243601', 0, 2.29, 1, 1, NULL, 0, '734048', 'Wok Noodles', 'Express  Wok Noodles - Asia Style\n\nIdeal für asiatische Wok-Gerichte, traditionelle Fleisch- oder Gemüsepfannen oder als Suppeneinlage.\nEinfach und schnell in der Zubereitung, ausgezeichnet im Geschmack.\n\n-  Hefefrei\n-  Vegan\n-  Vegetarisch', 'Hügli Nahrungsmittel GmbH', 'Natur Compagnie', 'GERMANY', '73bcd271-d465-4ca8-969a-494fbfdcd012', 'manager', '2021-08-12 13:29:59', 'System', '2023-12-09 03:53:03', 875, 1995, 0, NULL, 0, 1.29, 'Weiling', 0, NULL, 0, 63, 'Teigwaren aus  100% HARTWEIZENGRIEß*. *aus kontrolliert ökologischer Erzeugung', '2023-04-28 11:01:49', 1400, 'PASTA_CEREALS_LEGUMES', 'PANTRY', 255, 28, 'VEGAN;VEGETARIAN', NULL, NULL),
(790, 'Mirin Bio (Weiling)', '8713576173260', 1, 7.99, 1, 1, NULL, 0, '730268', 'Mirin Bio', 'Mirin ist ein Würzmittel, das in der japanischen Küche oft verwendet wird. Die  sirupartige Textur des Mirin verleiht Gerichten einen schönen Glanz, und der  Geschmack ist süß, voll und rund, mit einem Hauch von Umami. Wir bezeichnen  Mirin auch als „jedermanns Freund“, denn der süße Geschmack überspielt Fleisch-  und Fischgerüche und vereint Aromen in einem Gericht oft auf eine fantastische  Art. Herrlich in Kombination mit anderen japanischen Würzmitteln, wie zum  Beispiel Shoyu, Tamari und Sesamöl. Mirin hat einen Alkoholgehalt von 14% und  wird auch als Kochwein bezeichnet. Willst du einmal mit eigenen Augen sehen,  wie unsere Mirinin Japan hergestellt wird?Sieh dir dieses Video an.', 'TerraSana Natuurvoeding BV', 'TerraSana', 'JAPAN', 'dcab9923-b266-43f0-a490-d0628775d753', 'manager', '2021-08-12 13:30:10', 'System', '2023-11-02 16:00:37', 1552, 880, 0, NULL, 0, 4.2, 'Weiling', 0, NULL, 0, 120, 'süßer Reis*, Shochu* (Wasser, Reis*, Koji-Ferment), Reis*, Koji-Ferment *aus kontrolliert ökologischer Erzeugung', '2022-10-15 02:06:09', 645.888, 'OIL_VINEGAR_SAUCES;WINE_CHAMPAGNE', 'PANTRY;DRINKS', 431, 19.2, 'VEGAN;VEGETARIAN;GLUTENFREE', NULL, NULL),
(791, 'Genmai Su (Weiling)', '8713576173253', 0, 4.59, 1, 1, NULL, 0, '730270', 'Genmai Su', 'Ungesüßter Sushi-Essig wird auch Genmai Su bzw. Reisessig genannt. Du kannst  damit nicht nur Sushi-Reis abschmecken, sondern auch herrliche Dressings  machen, Wokgerichte abschmecken oder ein Zuviel an Salz in einem Gericht  überspielen. Auch lecker in Kombination mit anderen japanischen Würzmitteln wie  etwa Shoyu, Tamari und Sesamöl, oder mit den süßen Pendants Ingwersirup und  Mirin. Sushi-Essig wird auf traditionell japanische Art gebraut.', 'TerraSana Natuurvoeding BV', 'TerraSana', 'JAPAN', 'b103b96f-24b6-4206-8790-8c123e9289db', 'manager', '2021-08-12 13:30:19', 'System', '2023-11-02 16:00:33', 1518, 881, 0, NULL, 0, 2.74, 'Weiling', 0, NULL, 0, 120, 'Wasser, Naturreis*, Meersalz, Koji-Ferment *aus kontrolliert ökologischer Erzeugung', '2023-04-28 09:40:52', 645.888, 'OIL_VINEGAR_SAUCES', 'PANTRY', 431, 19.2, 'VEGAN;VEGETARIAN;GLUTENFREE', NULL, NULL),
(792, 'Apfelessig, naturtrüb, demeter (Weiling)', '4015533002656', 0, 3.19, 1, 1, NULL, 0.15, '730061', 'Apfelessig, naturtrüb, demeter', 'Aromatische Äpfel aus biologisch-dynamischem Anbau sind die Grundlage für diesen ungefilterten, nicht pasteurisierten Apfelessig. Im traditionellen Verfahren werden sie in unserer hauseigenen Mosterei schonend gepresst, fermentiert und zu fein-würzigem Essig weiter veredelt. Ein geschätztes Naturprodukt für vielfältige Genussmomente.', 'Voelkel GmbH', 'Voelkel', 'GERMANY', 'c7209b3b-3a40-4299-8118-341140206e1e', 'correction', '2021-09-29 15:30:00', 'System', '2024-02-02 02:13:58', 367, 301, 2, NULL, 0, 1.9, 'Weiling', 0, NULL, 0, 64, 'Apfelessig** **aus biodynamischer Erzeugung', '2023-01-03 10:01:16', 1697.55, 'OIL_VINEGAR_SAUCES', 'PANTRY', 1231, 27.2, 'VEGAN;VEGETARIAN', NULL, NULL),
