(801, 'Schokostreusel Zartbitter (Weiling)', '8711812840198', 0, 3.99, 1, 1, NULL, 0, '30802', 'Schokostreusel Zartbitter', 'Mit den Schokostreuseln von De Rit wird das Frühstück, das Dessert oder die Zwischenmahlzeit zum Genuss. Köstlich mit Rahmbutter auf einem dicken, selbst geschnittenen Butterbrot. Aber auch überraschend lecker zu Joghurt oder Eis. Und das ist noch nicht alles: Verwenden Sie die Schokostreusel als Dekoration für Torten oder als Zutat in Kuchen und Keksen.', 'Allos Hof-Manufaktur GmbH', 'De Rit', 'NETHERLANDS', '9d50795d-e0a8-47f7-a723-93f2b6f368e0', 'manager', '2021-08-12 14:10:38', 'System', '2023-11-11 02:13:05', 1052, 890, 0, NULL, 0, 2.65, 'Weiling', 0, NULL, 0, 60, 'Rohrzucker*, Kakaomasse*. *aus kontrolliert biologischem Anbau. Kakao:  32% mindestens.', '2022-04-11 15:15:46', 445.014, 'BAKING_INGREDIENTS', 'PANTRY', 225, 13.4, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(802, 'Natron (Weiling)', '4005394116210', 0, 0.99, 1, 1, NULL, 0, '31522', 'Natron', 'VITAVEGAN Natron ist der Universalhelfer für Küche und Haushalt. Natron neutralisiert Säuren und enthärtet mild-basisch. Zum Backen und Kochen geeignet.', 'Biovegan GmbH', 'Vitavegan', 'GERMANY', '988756bf-8018-47b7-8e63-124964495bee', 'manager', '2021-08-12 14:10:48', 'System', '2023-07-01 00:19:49', 1364, 891, NULL, NULL, 0, 0.61, 'Weiling', 0, NULL, 0, NULL, 'Natriumhydrogencarbonat (E 500 ii).', '2022-06-01 00:02:20', 18.4, 'BAKING_INGREDIENTS', 'PANTRY', 22, 11.5, 'VEGAN;VEGETARIAN;GLUTENFREE', NULL, NULL),
(803, 'Zuckerstreusel, BIO (Weiling)', '4005394116630', 0, 2.29, 1, 1, NULL, 0, '31554', 'Zuckerstreusel, BIO', 'Mit Bio-Zucker und färbenden Bio-Pflanzenauszügen hergestellt und veredelt. Die bunten Zuckerstreusel garnieren deine Süßspeisen, Gebäcke, Kuchen oder Eis auf ganz natürliche Art.', 'Biovegan GmbH', 'Biovegan', 'GERMANY', '5c35430d-8dbf-4080-96f9-348fce793b63', 'manager', '2021-08-12 14:10:57', 'System', '2023-06-01 02:12:40', 820, 892, 0, NULL, 0, 1.12, 'Weiling', 0, NULL, 0, 63, 'Zucker* (93,7 %), Glukosesirup*, pflanzliches Öl (Kokos)*, Maisstärke*, färbende Lebensmittel (Konzentrate aus Apfel, Karotte, Rettich, Spirulina)*, Emulgator: Lezithine (Sonnenblume)*; Säuerungsmittel: Ascorbinsäure. *aus kontrolliert ökologischer Erzeugung', '2022-12-17 12:25:29', 83.6, 'BAKING_INGREDIENTS', 'PANTRY', 75, 15.2, 'VEGAN;VEGETARIAN;GLUTENFREE', NULL, NULL),
(804, 'Hof-Gemüse Karstens Kürbis Ingwer (Weiling)', '4016249108496', 0, 2.99, 1, 1, NULL, 0, '111250', 'Hof-Gemüse Karstens Kürbis Ingwer', 'Was wird aus bis zu 70% Gemüseanteil bei einem Fettgehalt von maximal 20%? Bei uns ist die Rechnung ganz einfach: 100% vegetarischer, veganer, glutenfreier Genuss – unser Hof-Gemüse mit ganzen Gemüse-Stücken eben. Freut Euch auf eine große Vielfalt leckerer Sorten, auf denen Euch unsere Allos Mitarbeiter erzählen, warum sie speziell von ihren Sorten so begeistert sind. So einen hohen Gemüseanteil bei einem Brotaufstrich gab es vor dem Hof-Gemüse im Bio-Fachhandel übrigens noch nicht. Da sind wir schon ein bisschen stolz drauf. Aber noch stolzer sind wir darauf, dass so richtig viel Gemüse einfach super lecker schmeckt. Überzeugt Euch selbst davon.', 'Allos Hof-Manufaktur GmbH', 'Allos', 'GERMANY', 'df13ed2c-2180-4725-8ed3-3032a9caee6c', 'manager', '2021-08-12 14:11:40', 'System', '2023-04-13 02:08:02', 804, 893, 0, NULL, 0, 1.82, 'Weiling', 0, NULL, 0, 61, 'Kürbis* (46%), Karotten* (13%), Sonnenblumenkerne*,\nSonnenblumenöl*, Zwiebeln*( 7%), Agavendicksaft*,\nZitronensaftkonzentrat*, Orangensaftkonzentrat*,\nKartoffelstärke*, Meersalz, weißer Balsamessig* (Weißweinessig*, Traubenmostkonzentrat*), Zwiebelpulver*,\nIngwerpulver* (0,5%), Kürbiskernöl* (0,5%), Verdickungsmittel: Johannisbrotkernmehl*, Muskatnuss*, Curcuma*. *aus ökologischem Landbau.', '2022-08-10 00:05:04', 373.034, 'SPREADS_HONEY', 'PANTRY', 286, 7.4, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(805, 'Hof-Gemüse Olivers Olive Tomate (Weiling)', '4016249132354', 0, 2.99, 1, 1, NULL, 0, '111268', 'Hof-Gemüse Olivers Olive Tomate', 'Unser Gemüse ist so lecker, da wollten wir unbedingt so viel wie möglich in unseren Aufstrich unterbringen. So kam es, dass unser Hof-Gemüse-Aufstrich eine neue Kategorie im Bio-Fachmarkt begründet hat. So viel hatte vorher nämlich noch keiner verarbeitet. Ja, bis zu 70%! Je mehr Gemüse, desto mehr Geschmack. Ist ja irgendwie logisch. Und das bei einem Fettgehalt von maximal 20%. Ergibt nach unserer Rechnung satte 100% Gemüse-Genuss. (Im Kochen sind eben besser als im Rechnen.)', 'Allos Hof-Manufaktur GmbH', 'Allos', 'GERMANY', 'b9b32a23-1432-43cd-8434-17aadd9d544c', 'manager', '2021-08-12 14:11:50', 'System', '2024-02-03 02:09:12', 805, 894, 0, NULL, 0, 1.95, 'Weiling', 0, NULL, 0, 61, 'Tomaten* (45%), Sonnenblumenkerne*, grüne Oliven* (7%), Sonnenblumenöl*, Karotten* (6%), schwarze Oliven* (5%), Tomatenmark* (4%), Agavendicksaft*, natives Olivenöl* extra, Kartoffelstärke*, Rote Bete Saftkonzentrat*,\nZitronensaftkonzentrat*, Zwiebelpulver*, Meersalz,\nVerdickungsmittel: Johannisbrotkernmehl*, Chilipulver*. *aus ökologischem Landbau.', '2022-08-10 00:04:38', 373.034, 'SPREADS_HONEY', 'PANTRY', 286, 7.4, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(806, 'Pfirsiche, 550g, halbe Frucht, m. Reissirup gesüßt (Weiling)', '4260360271922', 0, 4.99, 1, 1, NULL, 0, '141148', 'Pfirsiche, 550g, halbe Frucht, m. Reissirup gesüßt', NULL, 'nur puur bio GmbH', 'Nur Puur', 'SPAIN', '40ba4fd7-67cc-4bed-8086-ce568639c533', 'manager', '2021-08-12 14:12:28', 'System', '2023-12-09 03:42:19', 1155, 895, 0, NULL, 0, 3.54, 'Weiling', 0, NULL, 0, 170, 'Pfirsiche*, Wasser, Reissirup*, Zitronensaft* *aus kontrolliert ökologischer Erzeugung', '2022-11-09 06:00:21', 867, 'CONVENIENCE_PRESERVES', 'PANTRY', 550, 12, 'VEGAN;VEGETARIAN', NULL, NULL),
(807, 'MANI Grüne Oliven in Lake, entkernt, bio, NL Fair (Weiling)', '5202423200042', 0, 5.29, 1, 1, NULL, 0, '155028', 'MANI Grüne Oliven in Lake, entkernt, bio, NL Fair', 'Diese feinen, grünen Bio Tafeloliven der Sorte Konservolia - auch bekannt als Amfissa Oliven - werden auf traditionelle Art zubereitet, entkernt und in frische Meersalzlake eingelegt. Das feste Fruchtfleisch besticht durch seinen wunderbar würzigen Geschmack. Eine wahre Köstlichkeit, pur als Vorspeise, in Salaten und auch in der warmen Küche.\n\nMani Bläuel Oliven werden schonend geerntet und auf natürliche Weise, ohne die Zugabe von Konservierungsstoffen, entbittert.', 'Bläuel Greek Organic Products', 'MANI®', 'GREECE', '58b3cad2-5e3a-453d-aeeb-9a561799535f', 'manager', '2021-08-12 14:12:46', 'System', '2023-01-16 18:17:28', 750, 896, 3, 10, 0, 3.19, 'Weiling', 0, NULL, 0, 80, 'Grüne Oliven*º , Wasser, Meersalz, Milchsäure.\nºNaturland Fair zertifiziert (100%) *aus kontrolliert ökologischer Erzeugung', '2022-09-14 02:05:43', 522.512, 'CONVENIENCE_PRESERVES', 'PANTRY', 530, 11.3, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE;RAWFOOD', NULL, NULL),
(808, 'Bratherings-Filets in Bio-Marinade (Weiling)', '4026968016507', 0, 3.99, 1, 1, NULL, 0, '160152', 'Bratherings-Filets in Bio-Marinade', 'Für den Atlantischen Hering ist der Norden des FAO Fanggebiets 27 ein idealer Lebensraum. Die dort praktizierte Fischerei mit Ringwadennetzen und pelagischen Schleppnetzen ist vom Marine Stewardship Council (MSC™) als nachhaltig anerkannt. Fontaine Heringsprodukte zeichnen sich durch eine verantwortungsvolle Verarbeitung und Verfeinerung mit besten Bio-Zutaten aus.', 'Fontaine Nahrungsmittel GmbH', 'Fontaine', 'GERMANY', 'fc37ffd5-8384-40bb-bc19-b6b7a8808de6', 'manager', '2021-08-12 14:13:16', 'System', '2023-01-16 18:17:50', 544, 897, NULL, NULL, 0, 2.84, 'Weiling', 0, NULL, 0, 60, '61,5% BRATHERINGSFILET [96,6% Heringsfilets (Clupea\nharengus), WEIZENVOLLKORNMEHL*, Dextrose*, Rapsöl*]\nWasser, Branntweinessig*, Rohrzucker*, Zwiebeln*,\nTomatenmark*, Meersalz, Rotwein*. *aus kontrolliert ökologischer Erzeugung', '2022-11-07 10:03:39', 624.75, 'CONVENIENCE_PRESERVES', 'PANTRY', 420, 21, NULL, NULL, NULL),
(809, 'Geflügelwürstchen mit Sonnenblumenöl (Weiling)', '4031829230800', 0, 4.99, 1, 1, NULL, 0, '162087', 'Geflügelwürstchen mit Sonnenblumenöl', 'Die Ökoland Geflügel-Würstchen sind aus hochwertigem Bio-Putenfleisch hergestellt, abgerundet mit geschmackvollen Gewürzen. Sie eignen sich besonders als Einlage in Eintöpfen, zu Salaten oder pur mit Senf im Brötchen. Der natürliche Buchenholzrauch gibt den Würstchen eine herzhafte Note. Hochwertiges Bio-Fleisch bedeutet, dass unsere Bio-Bauern konsequent für eine artgerechte Haltung und gesunde Fütterung der Tiere sorgen.', 'Ökoland GmbH Nord', 'ÖKOLAND', 'GERMANY', 'ef87681b-9b4d-4fdb-9b00-3496688449c8', 'manager', '2021-08-12 14:13:54', 'System', '2023-12-12 02:07:26', 716, 898, 4, NULL, 0, 3.26, 'Weiling', 0, NULL, 0, 63, '73% Putenfleisch*, Trinkwasser, 10% Sonnenblumenöl*, Putenhaut*, Meersalz, Gewürze* (Pfeffer*, Ingwer*, Knoblauch*, Koriander*, Kümmel*), Dextrose*, Schafsaitling, Buchenholzrauch.  *aus kontrolliert ökologischer Erzeugung', '2022-10-10 00:06:09', 710.5, 'CONVENIENCE_PRESERVES', 'PANTRY', 569.6, 14.5, 'GLUTENFREE;LACTOSEFREE;PALMOILFREE', NULL, NULL),
(810, 'Wiener Würstchen in Delikatess-Qualität (Weiling)', '4031829231852', 0, 5.39, 1, 1, NULL, 0, '162096', 'Wiener Würstchen in Delikatess-Qualität', 'Die Ökoland Wiener Würstchen sind aus hochwertigem Bio-Schweine- und Bio-Rindfleisch und geschmackvollen Bio-Gewürzen hergestellt. Sie schmecken pur zum Salat, mit Senf im Brötchen oder als Beilage in Suppen oder Eintöpfen. Hochwertiges Bio-Fleisch bedeutet, dass unsere Bio-Bauern konsequent für eine artgerechte Haltung und gesunde Fütterung der Tiere sorgen.', 'Ökoland GmbH Nord', 'ÖKOLAND', 'GERMANY', '3d29c43d-5ec2-40a1-9595-95b666633093', 'manager', '2021-08-12 14:14:03', 'System', '2023-12-12 02:06:03', 878, 899, 0, NULL, 0, 3.26, 'Weiling', 0, NULL, 0, 63, '83% Fleisch* (Schweinefleisch*, Rindfleisch*), Trinkwasser, Meersalz, Gewürze* (Ingwer*, Knoblauch*, Koriander*, Kümmel*), Dextrose*, Schafsaitling, Buchenholzrauch *aus kontrolliert ökologischer Erzeugung', '2023-08-01 12:04:20', 710.5, 'CONVENIENCE_PRESERVES', 'PANTRY', 569.6, 14.5, 'GLUTENFREE;LACTOSEFREE;PALMOILFREE', NULL, NULL),
(811, 'Hafer Flapjack Landfrüchte (Weiling)', '4016249184919', 0, 1.99, 1, 1, NULL, 0, '189972', 'Hafer Flapjack Landfrüchte', 'Gegen den Hunger zwischendurch haben wir was. Und zwar unsere hervorragenden\nFlapjacks. Wie alle unsere Riegel kommen auch die aus bestem Hause – dem Allos-Hof in\nDrebber im wünderschönen Niedersachsen. Zu dem ebenso leckeren wie\nballaststoffreichen Hafer gesellen sich noch beste Früchte, knackig Nüsse und edler\nKakao. Man muss sich manchmal wundern, dass so viel guter Geschmack überhaupt in so\neinen kleinen Riegel passt.', 'Allos Hof-Manufaktur GmbH', 'Allos', 'GERMANY', '57304490-6ffd-40c6-aeda-618fe927b296', 'correction', '2021-09-17 15:11:17', 'System', '2023-06-09 02:06:50', 768, 283, 0, NULL, 0, 1.15, 'Weiling', 2, 1, 0, 60, NULL, '2022-05-24 12:05:08', 130, 'SWEETS', 'SNACKS', 51, 13, 'VEGAN;VEGETARIAN', NULL, NULL),
(812, 'Basmatireis, weiß, kbA (Weiling)', '4022381025188', 0, 6.99, 1, 1, NULL, 0, '245006', 'Basmatireis, weiß, kbA', 'Duftreis aus Indien', 'Spielberger GmbH', 'Burgermühle', 'INDIA', '489934ce-302e-4613-8b7e-1ad392e0efc8', 'manager', '2021-08-12 14:14:32', 'System', '2023-01-16 18:18:16', 394, 900, 0, NULL, 0, 4.24, 'Weiling', 0, NULL, 0, 64, 'Basmatireis, poliert* *aus kontrolliert ökologischer Erzeugung', '2022-04-11 14:55:34', 1386, 'PASTA_CEREALS_LEGUMES', 'PANTRY', 1011, 22, 'VEGAN;VEGETARIAN', NULL, NULL),
(813, 'Sojamehl, vollfett geröstet, demeter (Weiling)', '4022381255226', 0, 2.29, 1, 1, NULL, 0, '250556', 'Sojamehl, vollfett geröstet, demeter', 'Für unser Sojamehl werden die Sojabohnen nach der Ernte gereinigt und anschließend geröstet. Dadurch werden natürliche Giftstoffe neutralisiert. Dieses vollfette Mehl ist sehr eiweißreich.', 'Spielberger GmbH', 'Spielberger Mühle', 'GERMANY', '98fb055d-8806-4623-bd66-f71dce28d1cd', 'manager', '2021-08-12 14:14:47', 'System', '2024-01-19 02:06:50', 1001, 901, 2, NULL, 0, 1.37, 'Weiling', 0, NULL, 0, 64, 'SOJAmehl** **aus biodynamischer Erzeugung', '2022-12-30 14:35:58', 760, 'BAKING_INGREDIENTS', 'PANTRY', 258.2, 19, 'VEGAN;VEGETARIAN', NULL, NULL),
(814, 'Dinkelbrot Vollkorn Demeter (Weiling)', '4015637821306', 0, 3.29, 1, 1, NULL, 0, '250909', 'Dinkelbrot Vollkorn Demeter', 'Ohne Verwendung von genmodifizierten Organismen oder genmodifizierten Rohmaterialien, ohne Verwendung von Konservierungsstoffen und Zusätzen.\nRückstandsanalyse der einzelnen Zusätze.', 'Bauck GmbH', 'Bauckhof', 'GERMANY', '9fbd936a-ba1b-4ef5-91b3-6d8584351b5d', 'manager', '2021-08-12 14:14:56', 'System', '2023-01-16 18:18:26', 377, 902, 2, NULL, 0, 1.91, 'Weiling', 0, NULL, 0, 64, 'DINKELvollkornmehl** 89%, ROGGENvollkornmehl**, ROGGENvollkorn Sauerteigpulver* (ROGGENvollkornmehl*), Meersalz *aus kontrolliert ökologischer Erzeugung **aus biodynamischer Erzeugung', '2022-11-07 10:00:35', 600, 'BREAD_BUNS', 'PASTRY', 509, 15, 'VEGAN;VEGETARIAN;LACTOSEFREE', NULL, NULL),
(815, 'Brathähnchen Gewürz (Weiling)', '4012346169101', 0, 4.19, 1, 1, NULL, 0, '260537', 'Brathähnchen Gewürz', 'Ob Sie’s nun Brathähnchen, Broiler oder Grillhuhn nennen, mit unserer Gewürzzubereitung wird es zum Lieblingsgericht. Schon der Duft, der aus dem Ofen strömt, wird alle um den Tisch versammeln. Wann gibt’s Essen?', 'Ulrich Walter GmbH', 'LEBENSBAUM', 'Diepholz, Niedersachsen', '45aa3985-10a7-4669-921b-5b44dcaea399', 'correction', '2021-09-08 18:14:44', 'System', '2024-02-14 02:09:49', 543, 161, 0, NULL, 0, 2.47, 'Weiling', 2, 1, 0, 60, NULL, '2022-11-29 15:15:55', 363, 'SPICES_COOKING_HELP', 'PANTRY', 157.2, 12, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE;PALMOILFREE', NULL, NULL),
(816, 'Gemüsegewürz (Weiling)', '4012346171708', 0, 3.29, 1, 1, NULL, 0, '260538', 'Gemüsegewürz', 'Herrlich aromatisch: Der milde Mix mit Paprika und Koriander steht einer knackigen Möhre ebenso gut wie zarten Bohnen. Für Gemüse, das mehr ist als nur Beilage.', 'Ulrich Walter GmbH', 'LEBENSBAUM', 'Diepholz, Niedersachsen', '20fd7b8a-6a38-43d4-b418-b92a52bdea23', 'correction', '2021-09-08 18:09:02', 'System', '2023-01-16 18:18:38', 721, 151, 0, NULL, 0, 1.88, 'Weiling', 2, 1, 0, 60, NULL, '2022-11-29 15:20:46', 269.5, 'SPICES_COOKING_HELP', 'PANTRY', 63, 14, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(817, 'Curry indisch (Weiling)', '4012346158709', 0, 3.49, 1, 1, NULL, 0, '260543', 'Curry indisch', 'Traditionell gibt Kurkuma bei Currymischungen den Ton an - so auch bei unserem Curry indisch. Verleihen Sie Soßen oder Tofu köstliche Schärfe.', 'Ulrich Walter GmbH', 'LEBENSBAUM', 'Diepholz, Niedersachsen', 'd026d66c-ff9c-463b-bf21-6071bc1dd269', 'correction', '2021-09-08 18:06:11', 'System', '2023-01-16 18:18:41', 585, 144, 0, NULL, 0, 2.05, 'Weiling', 2, 1, 0, 60, NULL, '2022-11-29 15:04:25', 269.5, 'SPICES_COOKING_HELP', 'PANTRY', 53, 14, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(818, 'Pommes-Gewürzsalz (Weiling)', '4012346160108', 0, 3.29, 1, 1, NULL, 0, '260592', 'Pommes-Gewürzsalz', 'Schön pikant und wie geschaffen für Pommes ist dieses würzige Salz. Sie werden neben einer deutlichen Paprikanote feuriges Chili und fruchtiges Kurkuma, herausschmecken.', 'Ulrich Walter GmbH', 'LEBENSBAUM', 'Diepholz, Niedersachsen', 'b7872704-db39-4097-be90-97623859ee96', 'correction', '2021-09-08 18:13:50', 'System', '2024-02-14 02:11:38', 1145, 159, 2, NULL, 0, 1.88, 'Weiling', 2, 1, 0, 60, NULL, '2022-11-29 15:30:26', 363, 'SPICES_COOKING_HELP', 'PANTRY', 247.2, 12, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(819, 'Fix Für Salat Italienische Kräuter mit Citrus (Weiling)', '4260133140288', 0, 2.79, 1, 1, NULL, 0, '260708', 'Fix Für Salat Italienische Kräuter mit Citrus', 'Gemüse, Salate und Früchte zählen zu den Schätzen der italienischen Küche. Für ihre schmackhafte Zubereitung verwenden die Italiener viel Liebe, viel Zeit und vor allem eines: viele feine Kräuter. Mit diesem Fix für Salat stehst du den Südländern in nichts nach. Basilikum, Petersilie, Schnittlauch, Knoblauch und Rosmarin ergeben gemeinsam mit einem Spritzer Zitrone die Basis einer herrlichen Vinaigrette und verleihen deinem Salat die edle Würze, die er verdient. Harmoniert ausgezeichnet mit dunklem Balsamico, Mozzarella-Käse und sommerlichen Salaten.', 'Beltane Naturkost GmbH', 'Beltane', 'GERMANY', '44fe93dd-202e-4f86-8e70-15172c278555', 'manager', '2021-08-12 14:15:51', 'System', '2022-04-11 14:46:24', 679, 903, NULL, NULL, 0, 1.53, 'Weiling', 0, NULL, 0, NULL, NULL, '2022-11-29 15:23:33', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL);
