(820, 'Beltane Fix Für Salat Sommerkräuter mit Blüten (Weiling)', '4260133140318', 0, 2.49, 1, 1, NULL, 0, '260710', 'Beltane Fix Für Salat Sommerkräuter mit Blüten', 'Hol dir den Sommer auf deinen Tisch! Mit diesem Fix für Salat aus reichlich Petersilie, Schnittlauch, Basilikum, Kerbel und Bohnenkraut verleihst du jedem Gemüse eine unwiderstehliche Leichtigkeit. Im Zusammenspiel mit zarten Kornblumenblüten entsteht eine duftend-bunte Vinaigrette, die zu jeder Jahreszeit deinen Gaumen verwöhnt.  Harmoniert ausgezeichnet mit hellem Balsamico und Sommersalaten.', 'Beltane Naturkost GmbH', 'Beltane', 'GERMANY', 'ef2e7389-b0cb-4172-997c-e6cc271bfe5d', 'manager', '2021-08-12 14:16:00', 'manager', '2023-02-06 16:17:58', 680, 904, NULL, NULL, 0, 1.53, 'Weiling', 0, NULL, 0, NULL, NULL, '2023-02-06 16:17:58', 200, 'CONVENIENCE_PRESERVES;OIL_VINEGAR_SAUCES;SPICES_COOKING_HELP', 'PANTRY', 50, 13.5, NULL, NULL, NULL),
(821, 'Bio-Folgemilch 2 aus Ziegenmilch (Weiling)', '7640161878174', 0, 14.9, 1, 1, NULL, 0, '374416', 'Bio-Folgemilch 2 aus Ziegenmilch', 'Diese Babymilch ist nach dem 6. Monat als Bestandteil einer gemischten Ernährung aus Flaschen- und Breimahlzeit geeignet.\n\nMit Ziegenmilch in biodynamischer Demeter-Qualität:\n- Ziegen muss an 365 Tagen pro Jahr ein Zugang zu Frischluft garantiert werden.*\n- Sie werden mit 100% Bio-Futter ernährt, davon mindestens die Hälfte in Demeter-Qualität direkt vom Hof oder aus der Region.\n- Ihre Hörner dürfen sie behalten: es sind ihr Sinnes- und Kommunikationsorgan.\n\n* laut EU-Öko-Verordnung', 'Holle baby food AG', 'Holle ', 'AUSTRIA', 'e75e7ea2-8970-45cc-b607-75bb99deb27f', 'manager', '2021-08-12 14:17:07', 'System', '2024-02-07 02:11:12', 685, 905, 0, NULL, 0, 10.06, 'Weiling', 0, NULL, 0, 0, 'ZIEGENVOLLMILCHPULVER*¹ 38,5 %, Maltodextrin*,\npflanzliche Öle* (Sonnenblumenöl*, Rapsöl*), LACTOSE*, Stärke*, Calciumcarbonat, Calciumhydroxid, Calciumcitrat, Algenöl², L-Cystin, Eisensulfat, Magnesiumchlorid, Vitamin C, L-Tryptophan, L-Tyrosin, Natriumcitrat, Natriumchlorid, Eisenlactat, Vitamin E,\nZinksulfat, Niacin, Pantothensäure, Kupfersulfat, Vitamin A, Vitamin B1, Vitamin B6, Folsäure, Vitamin B2, Mangansulfat, Kaliumjodid , Vitamin K, Natriumselenit, Vitamin D3, biotin, Vitamin B12,\n¹100 g Säuglingsmilchpulver werden aus 284 ml Vollmilch hergestellt,\n²enthält DHA (gesetzlich für Folgenahrung vorgeschrieben)\nDHA trägt zur normalen Entwicklung der Sehkraft\nbei Säuglingen bis zum Alter von 12 Monaten bei.\nDie positive Wirkung stellt sich bei einer täglichen\nAufnahme von 100 mg DHA ein.\nZiegenmilch enthält von Natur aus das A2-Protein * aus biologischer Landwirtschaft', '2022-10-22 02:06:20', 1500, 'BABY_FOOD', 'BABY', 459, 20, 'GLUTENFREE', NULL, NULL),
(822, 'Koriander, gemahlen (Weiling)', '4012346156309', 0, 2.59, 1, 1, NULL, 0, '391906', 'Koriander, gemahlen', 'Der würzige, leicht nussige Geschmack von gemahlenen Korianderfrüchten wird weltweit geschätzt und findet sich in vielen Gewürzmischungen. Verwenden Sie Koriander zum Abrunden herzhafter Speisen und für gebackene Leckereien.', 'Ulrich Walter GmbH', 'LEBENSBAUM', 'Diepholz, Niedersachsen', 'f1a3072c-d451-47d4-815c-d35cbc4fe0e3', 'correction', '2021-09-08 18:11:34', 'System', '2023-01-16 18:18:50', 1300, 156, 2, NULL, 0, 1.41, 'Weiling', 2, 1, 0, 60, NULL, '2022-11-29 15:26:06', 269.5, 'SPICES_COOKING_HELP', 'PANTRY', 43, 14, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(823, 'Früchtetee (Weiling)', '4012346250007', 0, 4.29, 1, 1, NULL, 0, '410275', 'Früchtetee', 'Apfel und Hibiskus bilden die fruchtige Basis unseres Früchtetees, auf der sich Orangen- und Zitronennoten entfalten. Er schmeckt wunderbar fruchtig und leuchtet in der Tasse auffallend intensiv rot. Mit dieser gut ausbalancierten frisch fruchtigen Mischung empfiehlt sich unser Früchtetee für jung und alt. Genießen Sie ihn von morgens bis abends, zu Hause oder unterwegs, zum Erfrischen oder Aufwärmen. Dieser Tee passt immer - für alle.', 'Ulrich Walter GmbH', 'LEBENSBAUM', 'Diepholz, Niedersachsen', 'ec216525-29ae-417a-9a24-59e6aff1d909', 'correction', '2021-09-08 18:57:13', 'System', '2023-12-14 02:19:43', 703, 202, 0, NULL, 0, 2.47, 'Weiling', 2, 1, 0, 60, NULL, '2022-11-29 15:19:58', 760, 'TEA', 'COFFEE_TEA_COCOA', 104.5, 19, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(824, 'Grüntee Sencha (Weiling)', '4012346533407', 0, 3.79, 1, 1, NULL, 0, '411366', 'Grüntee Sencha', 'Als kräftig mit aromatischen Noten beschreiben Teekenner unseren chinesischen Sencha. Er zeigt ein frisches Gelbgrün in der Tasse. Sencha wird nach dem Ernten schonend gedämpft und durch Walzen getrocknet. Die Blätter erhalten so ihr typisches Aussehen, das an Tannennadeln erinnert. Durch diese Form der Aufbereitung erklären sich der besondere Geschmack dieser unfermentierten Tee-Spezialität und ihre Beliebtheit - weit über Asien hinaus.', 'Ulrich Walter GmbH', 'LEBENSBAUM', 'GERMANY', 'ed29fa56-e74a-4289-995c-2310fcdbb794', 'manager', '2021-08-12 14:17:43', 'System', '2023-02-08 02:05:57', 759, 1792, 0, NULL, 0, 2.23, 'Weiling', 0, NULL, 0, 60, 'Sencha, Grüntee* *aus kontrolliert ökologischer Erzeugung', '2022-11-29 15:22:12', 532, 'TEA', 'COFFEE_TEA_COCOA', 95.3, 19, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(825, 'Sencha (Weiling)', '4012346527000', 0, 2.59, 1, 1, NULL, 0, '411368', 'Sencha', 'Weich und frisch mit aromatischen Noten, so schmeckt Sencha, der am meisten getrunkene Tee Asiens. \nSencha wird nach dem Ernten schonend gedämpft, gewalzt\nund getrocknet. Er wird traditionell für Tee-Zeremonien verwendet. Im Teebeutel verspricht er ein kurzes Abtauchen aus dem Alltag.', 'Ulrich Walter GmbH', 'LEBENSBAUM', 'Diepholz, Niedersachsen', '0226d04d-23f9-4c74-b32d-3fe617761fae', 'correction', '2021-09-08 19:07:33', 'System', '2023-11-10 02:11:38', 760, 216, 0, NULL, 0, 1.47, 'Weiling', 2, 1, 0, 60, NULL, '2022-11-29 15:22:09', 485.76, 'TEA', 'COFFEE_TEA_COCOA', 54.1, 16, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(826, 'My Balance Ingwer & Zitrone Tee (Weiling)', '4016249183592', 0, 3.49, 1, 1, NULL, 0, '411528', 'My Balance Ingwer & Zitrone Tee', 'Bringt Körper & Seele in Balance: Bei Turbulenzen im Alltag bitte noch so lange angeschnallt sitzen bleiben, bis der Allos Tee My Balance Ingwer & Zitrone durchgezogen ist. Ein Schluck. Zitronengras und Eisenkraut legen sich auf die kleinen Luftlöcher des Lebens. Langsam kommt alles wieder in Balance. Nochmal nippen – und wieder durchstarten.', 'Allos Hof-Manufaktur GmbH', 'Allos', 'UNITED_KINGDOM', '6d4137a6-3a67-4ed7-bfb3-16df8a0c5b5b', 'manager', '2021-08-12 14:18:02', 'System', '2022-09-17 02:04:43', 1359, 907, 0, NULL, 0, 2.26, 'Weiling', 0, NULL, 0, NULL, NULL, '2022-09-17 02:04:43', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL),
