(832, 'Himbeere, weiße Schokolade (Weiling)', '4024297014546', 0, 3.29, 1, 1, NULL, 0, '446518', 'Himbeere, weiße Schokolade', 'Fruchtig & cremig: Bei der Schokolade \"Himbeere\" mit gefriergetrockneten Himbeerstückchen verbinden sich die Aromen der Frucht mit den Aromen der weißen Schokolade (33 % Kakaogehalt). Ein Genuss, den Sie sich auf der Zunge zergehen lassen sollten!\n\nDas Geheimnis des feinen Schmelzes und des einzigartigen Geschmacks liegt im besonderen Herstellungsverfahren: In traditioneller Schweizer Handwerkskunst lassen die Chocolatiers durch besonders langes Conchieren feine Schokolade entstehen, die auf der Zunge zergeht. \n\nWie bei allen Naturata Schokoladen enthält die natürliche Rezeptur nur fair gehandelte Zutaten aus 100 % kontrolliert biologischem Anbau. Ohne künstliche Aromen oder Emulgatoren!', 'Naturata AG', 'NATURATA', 'SWITZERLAND', '370f19a7-3c02-4d23-927f-d2f31c625fe2', 'manager', '2021-08-12 14:20:08', 'System', '2023-12-17 03:11:35', 573, 913, 0, 1, 0, 2.06, 'Weiling', 0, NULL, 0, 298, 'Roh-Rohrzucker*, Kakaobutter*, VOLLMILCHPULVER*, MAGERMILCHPULVER*, Himbeeren* 3 %, Vanille gemahlen* *aus kontrolliert ökologischer Erzeugung', '2022-11-02 00:00:54', 94.848, 'SWEETS', 'SNACKS', 105, 15.6, 'VEGETARIAN', NULL, NULL),
(833, 'Bio-Früchteriegel Birne-Apfel (Weiling)', '7640161879058', 0, 0.99, 1, 1, NULL, 0, '448031', 'Bio-Früchteriegel Birne-Apfel', 'Ob Zwieback, Keks, Früchteriegel, Tee oder Beikostöl. Sorgsam ausgesuchte Zutaten und ernährungsphysiologisch ausgewogene Rezepturen sorgen für Freude und Abwechslung in der Beikostphase.', 'Holle baby food AG', 'Holle ', 'GERMANY', '4562cd2b-9479-4cd5-b261-bfefb4397665', 'manager', '2021-08-12 14:20:17', 'System', '2024-02-07 02:08:18', 702, 914, 0, NULL, 0, 0.62, 'Weiling', 0, NULL, 0, 61, 'Birnensaftkonzentrat*38%, HAFERflocken* 22%, Apfelpulver* 16%,Birnen* getrocknet 7%, DINKEL-Oblate*¹ 6% (DINKELmehl*¹, Kartoffelstärke*), Reismehl*, Sonnenblumenöl*,Kartoffelstärke*.\n\n¹eine WEIZENART *aus biologischer Landwirtschaft. Kann Spuren von Soja, Milch, Sesam, Mandeln, Hasel-, Wal- und Kaschunüssen enthalten.', '2022-08-09 08:00:36', 52, 'BABY_FOOD', 'BABY', 25.7, 13, 'VEGAN;VEGETARIAN', NULL, NULL),
(834, 'Meerrettichpaste Wasabi-Art (Weiling)', '4020943131391', 0, 3.99, 1, 1, NULL, 0, '450521', 'Meerrettichpaste Wasabi-Art', 'Cette pâte de raifort composée à 10 % de wasabi biologique, finement râpé et fabriqué uniquement à partir de la racine de wasabi, est le condiment adéquat pour préparer les sushis ! À déguster en accompagnement de délicieux sushis soit en appliquant une mince couche de pâte de raifort puis en roulant soit en la mélangeant à de la sauce soja pour obtenir un savoureux dip piquant. ', 'Arche Naturprodukte GmbH', 'Arche Naturküche', 'GERMANY', 'a6bd1900-0cc1-482a-8cb9-204496a30071', 'manager', '2021-08-12 14:20:45', 'System', '2023-05-16 02:05:21', 1335, 915, 0, NULL, 0, 2.55, 'Weiling', 0, NULL, 0, 64, 'eau, raifort* (21%), graines de MOUTARDE*, vinaigre d\'alcool*, vinaigre de pomme*, sel\nde mer, shoyu* (sauce de SOJA* : eau, graines de SOJA*, BLÉ*, sel de mer, Aspergillus oryzae), raifort wasabi en poudre* (3%) (raifort* (90%), wasabi* (wasabi japonica) (10%)), sirop de pommes*, huile de colza*, épices*, spiruline*, agent épaississant : gomme de guar*, huile essentielle de MOUTARDE *issu de l\'agriculture biologique', '2022-11-10 02:04:49', 180, 'SPICES_COOKING_HELP', 'PANTRY', 72, 12, 'VEGAN;VEGETARIAN', NULL, NULL),
(835, 'Cashewkerne, ganz im Pfandglas (Weiling)', '4035661162794', 0, 6.99, 1, 1, NULL, 0.15, '506001', 'Cashewkerne, ganz im Pfandglas', 'Die bioladen*Cashewkerne kommen aus unserem bioladen*Fair Projekt aus Burkina Faso. Mit dem Kauf gehen pro Glas 10 Cent in dieses Projekt. Sie wollen mehr zum Projekt erfahren, dann schauen Sie auf bioladen.de/qr/burkinafaso. Die Herstellung der Cashews ist reine Handarbeit. Im Geschmack sind sie mild nussig und leicht süßlich. Man kann sie gut für Saucen, in Pestos, in Gebäck oder einfach als Snack verwenden. (Es handelt sich um ungeröstete und ungesalzene Ware im Mehrwegglas.)\n', 'Weiling GmbH', 'bioladen', 'GERMANY', 'f4a11c3b-a1bb-4be9-a144-3a6ebbf97042', 'correction', '2021-09-17 17:55:11', 'System', '2023-10-14 02:15:08', 1487, 289, 0, NULL, 0, 4.68, 'Weiling', 0, NULL, 0, 62, NULL, '2022-10-10 00:10:50', 953.694, 'OTHER', 'OTHER', 491, 12.6, 'VEGAN;VEGETARIAN', NULL, NULL),
(836, 'bioladen Kürbiskerne 320g (Weiling)', '4035661163197', 0, 5.99, 1, 1, NULL, 0, '530602', 'bioladen Kürbiskerne 320g', 'Die bioladen*Kürbiskerne im Mehrwegglas kommen aus Österreich. Der heimatnahe Anbau ist eine Besonderheit, denn vorwiegend wird dieses Produkt in fernen Ländern angebaut und daher bezogen. Die Kürbiskerne eignen sich als Topping für Salate und Suppen, können für Müslis oder zum Backen verwendet werden.', 'Weiling GmbH', 'bioladen', 'GERMANY', '699efb85-7331-4ff9-93cb-5683cc6f52bc', 'correction', '2021-08-20 10:21:34', 'System', '2023-10-14 02:10:21', 1494, 1793, 0, NULL, 0, 4.36, 'Weiling', 0, NULL, 0, 62, 'Kürbiskerne* *aus kontrolliert ökologischer Erzeugung', '2022-07-12 14:28:52', 731.909, 'PASTA_CEREALS_LEGUMES;MUISLI_FLAKES_NUTS', 'PANTRY', 531, 12.6, 'VEGAN;VEGETARIAN', NULL, NULL),
(837, 'Leinsamen geschrotet, im Pfandglas (Weiling)', '4035661163227', 0, 2.99, 1, 1, NULL, 0.15, '530608', 'Leinsamen geschrotet, im Pfandglas', 'Die bioladen*Leinsamen geschrotet sind fein-nussig im Geschmack und können als Zutat in Brot und Backwaren sowie in pikanten Bratlingen verwendet werden. Leinsamen sind reich an Ballaststoffen, zeichnen sich durch ein hohes Quellvermögen aus und sollten mit reichlich Flüssigkeit verzehrt werden. Nur zum Kochen und Backen verwenden, nicht roh verzehren.', 'Weiling GmbH', 'bioladen', 'GERMANY', '192b9749-3d51-4dde-a9df-148478f276f5', 'manager', '2021-08-12 14:23:15', 'System', '2023-10-14 02:08:50', 490, 917, 0, NULL, 0, 1.86, 'Weiling', 0, NULL, 0, 62, NULL, '2022-04-11 15:46:43', 509.6, 'PASTA_CEREALS_LEGUMES;MUISLI_FLAKES_NUTS', 'PANTRY', 325, 10.4, 'VEGAN;VEGETARIAN', NULL, NULL),
(838, 'Bio Family Orange mit 47 % Direktsaft (Weiling)', '4015533012419', 1, 3.29, 1, 1, NULL, 0.15, '590332', 'Bio Family Orange mit 47 % Direktsaft', 'Mit 50 % Direktsaft aus sonnengereiften, biologisch angebauten Orangen erfrischt unser BioFamily Orange Kinder und Erwachsene gleichermaßen. Dank der extra-großen 1-Liter-Flasche kommt dabei die ganze Familie in den saftigen Genuss.', 'Voelkel GmbH', 'Voelkel', 'GERMANY', '4125ede7-e374-4b8c-8242-e13e34f4b27f', 'correction', '2021-09-28 02:09:13', 'System', '2024-02-02 02:13:47', 917, 245, 0, NULL, 0, 2.23, 'Weiling', 0, NULL, 0, 64, 'Orangensaft*¹ 50 %, natürliches Mineralwasser, Zitronensaft* 2%, Rohrohrzucker*¹, Traubensüße*, Orangenöl*. *aus kontrolliert ökologischer Erzeugung', '2022-10-15 02:06:59', 2486.7, 'LEMONADE;JUICE', 'DRINKS', 1629.6, 30.7, 'VEGAN;VEGETARIAN', NULL, NULL),
(839, 'BioFamily Multi A & C 100% Direktsaft (Weiling)', '4015533014055', 1, 3.29, 1, 1, NULL, 0.15, '590338', 'BioFamily Multi A & C 100% Direktsaft', 'Mit dem Besten aus 9 tropischen und heimischen Bio-Früchten und aromatischen Möhren begeistert unser BioFamily Multi Groß und Klein und sorgt für gute Laune am Frühstückstisch. In der familienfreundlichen 1-Liter-Flasche liefert diese Direktsaft-Komposition natürliche Vielfalt zum Trinken - und davon genug für alle.', 'Voelkel GmbH', 'Voelkel', 'GERMANY', '7db479c8-093d-4423-bfe7-d5de2363893e', 'correction', '2021-09-28 02:09:17', 'System', '2024-02-02 02:13:55', 918, 241, 0, NULL, 0, 2.23, 'Weiling', 0, NULL, 0, 64, 'Apfelsaft* 41%, Orangensaft* 24%, Traubensaft* 11%, Möhrensaft* 11%, Mangomark* 4%, Litschisaft*, Bananenmark* 2%, Acerolakirschmark* 2%, Guavenmark* 1%, Passionsfruchtsaft* 1% *aus kontrolliert ökologischer Erzeugung', '2022-11-03 16:05:19', 2486.7, 'LEMONADE;JUICE', 'DRINKS', 1647, 30.7, 'VEGAN;VEGETARIAN', NULL, NULL),
