(841, 'Feldfrisches Gemüse, 100 % Direktsaft (Weiling)', '4015533000416', 1, 3.49, 1, 1, NULL, 0, '590445', 'Feldfrisches Gemüse, 100 % Direktsaft', 'Das knackige Gemüse für diese Komposition aus 100 % Direktsaft wird sofort nach der Ernte in unserem Hause schonend gepresst und direkt in Flaschen abgefüllt. So bleiben die wertvollen Inhaltsstoffe, darunter Vitamin A, weitestgehend erhalten.', 'Voelkel GmbH', 'Voelkel', 'GERMANY', '9d7730d4-3ac8-41c2-ad19-4fd23be8e9bf', 'manager', '2021-08-12 14:23:56', 'System', '2024-01-31 02:08:12', 722, 919, 2, NULL, 0, 1.82, 'Weiling', 0, NULL, 0, 64, 'Möhrensaft** 58,5%, Rote Bete-Saft** 30%, SELLERIEsaft** 10%, Acerolakirschmark* 1%, Zitronensaft**. *aus kontrolliert ökologischer Erzeugung **aus biodynamischer Erzeugung', '2022-11-29 16:15:53', 1740.02, 'LEMONADE;JUICE', 'DRINKS', 1177, 28.6, 'VEGAN;VEGETARIAN', NULL, NULL),
