(843, 'Rote Trauben, 100% Direktsaft (Weiling)', '4015533000508', 1, 3.79, 1, 1, NULL, 0.15, '591685', 'Rote Trauben, 100% Direktsaft', 'Unter der Sonne Italiens reifen die roten Demeter-Trauben für diesen Direktsaft heran. Von Hand gepflückt und im Ursprungsland erntefrisch gepresst bewahren sie ihr köstliches Aroma und machen unseren Traubensaft zum mediterranen Genuss für zuhause.', 'Voelkel GmbH', 'Voelkel', 'GERMANY', '249709ee-f097-4ebc-9b14-5b870640d0c9', 'correction', '2021-09-12 20:51:53', 'System', '2024-02-02 02:13:44', 939, 242, 2, NULL, 6, 2.23, 'Weiling', 0, NULL, 0, 64, 'Roter Traubensaft**  **aus biodynamischer Erzeugung', '2022-11-10 10:22:56', 1740.02, 'JUICE', 'DRINKS', 1206, 28.6, 'VEGAN;VEGETARIAN', NULL, NULL),
(844, 'Provamel Bio Sojadrink Vanille (Weiling)', '5411188125426', 1, 1.19, 1, 1, NULL, 0, '598116', 'Provamel Bio Sojadrink Vanille', 'Fan von Vanille? Dann ist der besondere Sojadrink mit feinstem Bourbon-Vanilleextrakt ein passendes Geschmackserlebnis! Der Provamel Bio Sojadrink Vanille schmeckt nicht nur pur cremig-fein nach dem beliebten Extrakt aus der kleinen braunen Schote. Er ist auch erwärmt als leckerer Soja-Macchiato oder in Kombination mit frischen Früchten als köstlicher Shake vanillig-lecker.', 'Alpro Comm. VA / SCA', 'Provamel', 'BELGIUM', '35c9a81f-411c-42bf-a04b-03c5ee3947e8', 'manager', '2021-08-12 14:24:30', 'System', '2022-04-11 14:19:45', 1008, 921, 0, NULL, 0, 0.59, 'Weiling', 0, NULL, 0, NULL, NULL, '2022-04-11 14:19:45', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL),
(845, 'Sauce Bolognese mit Hackfleisch (Weiling)', '4031829232859', 0, 5.29, 1, 1, NULL, 0, '600380', 'Sauce Bolognese mit Hackfleisch', 'Die Sauce Bolognese hat eine lange Geschichte: Zur Zeit der Renaissance (14.–16. Jahrhundert) waren französische Schmorfleischragouts besonders in Nord- und Mittelitalien beliebt. In der Region Bologna entstand in dieser Epoche das Ragù alla Bolognese, später auch Sauce Bolognese genannt – traditioneller Begleiter von Maccaroni, Tagliatelle oder Spaghetti. Die Ökoland Sauce Bolognese schmeckt besonders gut zu Spaghetti. Man kann mit ihr natürlich auch leckere Pizza-Soße, Lasagne oder einen kräftigen Kartoffelauflauf machen. Unsere Ökoland Sauce Bolognese wird aus hochwertigem Hackfleisch, Tomaten, fein gehackten Zwiebeln, Karotten und ausgewählten Gewürzen und Kräutern zubereitet.', 'Ökoland GmbH Nord', 'ÖKOLAND', 'GERMANY', 'c831169f-0949-48c6-9e5e-ff79dce2630f', 'manager', '2021-08-12 14:24:49', 'System', '2023-01-21 02:12:12', 1071, 922, 0, NULL, 0, 3.19, 'Weiling', 0, NULL, 0, 63, 'Trinkwasser, 24% Schweinefleisch*, Tomatenmark*, Zwiebeln*, Tomaten*, Karotten*, Lauch*, Sonnenblumenöl*, WEIZENMEHL*, Meersalz*, Rohrohrzucker*, Gewürze* (Paprika*, Pfeffer*), Knoblauch*, Kräuter* (Oregano*, Basilikum*, Bohnenkraut*, Thymian*, Rosmarin*, Fenchel*) *aus kontrolliert ökologischer Erzeugung', '2022-12-02 13:56:22', 586.19, 'CONVENIENCE_PRESERVES', 'PANTRY', 452.39, 11, 'PALMOILFREE', NULL, NULL),
