(849, 'Milde Gemüsebrühe Rohkost (Weiling)', '4260623220414', 0, 4.49, 1, 1, NULL, 0, '620507', 'Milde Gemüsebrühe Rohkost', 'Frische Gemüsebrühe Mild - Bio - 210g Glas, 76% rohes Gemüse, Steinsalz, Gewürze. Sonst nichts!\n\nMild, gut verträglich, Salzreduziert und zugleich intensiv im Geschmack. Geeignet für Allergiker und Menschen mit sensiblem Magen und Unverträlichkeiten.\n\nZubereitungsempfehlung:\n1TL (13 g) mit 500 ml kochendem Wasser aufgießen.\nTipp: Für einen kräftigeren Geschmack kurz in Öl anbraten.\n\n76% rohes Bio-Gemüse in veränderlichen Gewichtsanteilen (Karotte, Pastinake, Petersilie), Steinsalz, Bio-Gewürze (Lorbeer, Kurkuma, Ingwer, Liebstöckel, Kümmel, Bockshornklee, Wacholder, Piment, Fenchel, Anis).\n\nZusatzstoffe, auch die im BIO-Bereich zugelassenen, verwenden wir nicht! Regionalität und Natürlichkeit bedeutet für uns mehr als nur ein Trend. Die Achtung für Lebensmittel und deren Erzeuger spielt in unserem jungen Unternehmen eine wichtigste Rolle.\n\nWas unterscheidet uns von anderen Herstellern\n- Unser Produkt ist nicht getrocknet, wir verwenden rohes, frisches Gemüse\n- der Anteil vom rohem Gemüse beträgt 76 %\n- Wir verwenden keinerlei Zusatzstoffe, auch keine im BIO-Bereich zugelassenen\n- Wir verzichten auf die Verwendung aller Bestandteile, welche nicht in ein Lebensmittel gehören (Maltodextrin, Maisstärke, zugesetzter Zucker, Hefeextrakt uvm.)\n- keine zugesetzten Fette oder Öle \n- selbstverständlich in bester Bio Qualität\n\n\nInformation zum Mindesthaltbarkeitsdatum: Nach der Herstellung ist die milde Gemüsebrühe mindestens 9 Monate haltbar. Wir empfehlen die ungeöffneten Gläser im Trockenregal oder im Trockenlager zu lagern. Für geöffnete Gläser empfehlen wir die Lagerung im Kühlschrank. Die Kühllagerung dient ausschließlich der Farbstabilisierung und Verlängerung der Frische. Nach 9 Monaten verändert sich aufgrund dessen, dass wir keine Antioxidationsmittel verwenden, leicht die Farbe, was unbedenklich für die Verzehrbarkeit ist. Das deutsche Lebensmittelrecht gibt allerdings vor, dass das Mindesthaltbarkeitsdatum erreicht ist sobald sich u.a. die qualitätsbeschreibenden Merkmale (z.B. Farbe) verändern. Die von uns angegebenen 9 Monate beziehen sich daher nur auf die Farbveränderung, nicht auf die eigentliche Haltbarkeit. Diemilde Gemüsebrühe kann aufgrund des zugegebenen Salzes mikrobiologisch nicht verderben und kann daher auch weit nach dem Ablauf des MHD\'s verwendet werden.\n\nwww.swema-lebensmittel.de', 'SweMa GmbH', 'SweMa', 'GERMANY', 'dbda7ec2-abf5-4f90-9a1c-0c1d1bcd10b8', 'manager', '2021-08-12 14:26:03', 'System', '2023-10-31 00:01:27', 718, 925, 0, NULL, 0, 4.15, 'Weiling', 0, NULL, 0, 63, '76% rohes Gemüse in veränderlichen Gewichtsanteilen (Karotte*, Pastinake*, Petersilie*), Steinsalz, Gewürze (Lorbeer*, Kurkuma*, Ingwer*, Liebstöckel*, Kümmel*, Bockshornklee*, Wacholder*, Piment*, Fenchel*, Anis*). *aus kontrolliert ökologischer Erzeugung', '2022-11-02 00:00:41', 273.696, 'SPICES_COOKING_HELP', 'PANTRY', 352, 8, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE;RAWFOOD;WITHOUT_ADDED_SUGAR', NULL, NULL),
(850, 'BIO-KRAFTWÜZE INDISCH (Weiling)', '4260623220308', 0, 5.99, 1, 1, NULL, 0, '620509', 'BIO-KRAFTWÜZE INDISCH', 'Frische Gemüsebrühe indisch - 210g Glas, rohes Bio-Gemüse, Steinsalz, Gewürze. Sonst nichts!\n\nDer passende Begleiter für die indische Küche. Passt perfekt zu Currys mit Fleisch oder Gemüse, aber auch zu Linsen- und Kartoffelgerichten.\n\nZubereitungsempfehlung:\n1½ TL (18 g) mit 500 ml kochendem Wasser aufgießen.\nTipp: Für einen kräftigeren Geschmack kurz in Öl anbraten.\n\nZutaten: 69% rohes Bio-Gemüse in veränderlichen Gewichtsanteilen (Karotte, Zwiebel, Pastinake), Steinsalz ohne Rieselhilfen, Bio-Gewürze (Kurkuma, Ingwer, Knoblauch, Bockshornklee,  Koriander, Cumin, Pfeffer, Chili).\n\nZusatzstoffe, auch die im BIO-Bereich zugelassenen, verwenden wir nicht! Regionalität und Natürlichkeit bedeutet für uns mehr als nur ein Trend. Die Achtung für Lebensmittel und deren Erzeuger spielt in unserem jungen Unternehmen eine wichtigste Rolle.\n\nWas unterscheidet uns von anderen Herstellern\n- Unser Produkt ist nicht getrocknet, wir verwenden rohes, frisches Gemüse\n- der Anteil vom rohem Gemüse beträgt 69 %\n- Wir verwenden keinerlei Zusatzstoffe, auch keine im BIO-Bereich zugelassenen\n- Wir verzichten auf die Verwendung aller Bestandteile, welche nicht in ein Lebensmittel gehören (Maltodextrin, Maisstärke, zugesetzter Zucker, Hefeextrakt uvm.)\n- keine zugesetzten Fette oder Öle \n- selbstverständlich in bester Bio Qualität\n\n\nInformation zum Mindesthaltbarkeitsdatum: Nach der Herstellung ist die Gemüsebrühe mindestens 9 Monate haltbar. Wir empfehlen die ungeöffneten Gläser im Trockenregal oder im Trockenlager zu lagern. Für geöffnete Gläser empfehlen wir die Lagerung im Kühlschrank. Die Kühllagerung dient ausschließlich der Farbstabilisierung und Verlängerung der Frische. Nach 9 Monaten verändert sich aufgrund dessen, dass wir keine Antioxidationsmittel verwenden, leicht die Farbe, was unbedenklich für die Verzehrbarkeit ist. Das deutsche Lebensmittelrecht gibt allerdings vor, dass das Mindesthaltbarkeitsdatum erreicht ist sobald sich u.a. die qualitätsbeschreibenden Merkmale (z.B. Farbe) verändern. Die von uns angegebenen 9 Monate beziehen sich daher nur auf die Farbveränderung, nicht auf die eigentliche Haltbarkeit. Die Gemüsebrühe kann aufgrund des zugegebenen Salzes mikrobiologisch nicht verderben und kann daher auch weit nach dem Ablauf des MHD\'s verwendet werden.\n\nwww.swema-lebensmittel.de', 'SweMa GmbH', 'SweMa', 'GERMANY', '1cb2675c-6378-46c4-8ce0-ddf6864c3909', 'manager', '2021-08-12 14:26:12', 'System', '2023-10-31 00:01:33', 1302, 926, 0, NULL, 0, 4.15, 'Weiling', 0, NULL, 0, 63, '69% rohes Gemüse in veränderlichen\nGewichtsanteilen (Karotte*, Zwiebel*, Pastinake*), Steinsalz, Gewürze (Kurkuma*, Ingwer*, Knoblauch*, Bockshornklee*,  Koriander*, Cumin*, Pfeffer*, Chili*). *aus kontrolliert ökologischer Erzeugung', '2022-10-31 00:01:20', 273.696, 'SPICES_COOKING_HELP', 'PANTRY', 352, 8, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE;RAWFOOD;WITHOUT_ADDED_SUGAR', NULL, NULL),
