(855, 'Byodo Himbeeressig, 5% Säure (Weiling)', '4018462441800', 0, 6.99, 1, 1, NULL, 0, '730105', 'Byodo Himbeeressig, 5% Säure', 'Dem Byodo Himbeeressig (5% Säure) geben reife Bio-Himbeeren den intensiv-beerigen Geschmack und die schöne, leuchtend-rote Farbe. Diese werden zu feinem Himbeerwein und Himbeerkonzentrat verarbeitet. Der Wein wird anschließend bei angenehm warmen Temperaturen langsam zu Essig vergoren. Dieses Verfahren nennt man eine kontinuierliche Essigvergärung. \nDer fertige Essig wird mit Himbeerkonzentrat abgeschmeckt und vor der Abfüllung in Flaschen nur noch gefiltert. \n\nWie alle Byodo Essige ist er absolut naturbelassen und wird nicht erhitzt. So bleiben wertvolle Enzyme und Geschmacksstoffe auf köstliche Art und Weise erhalten. Trübungen oder Ablagerungen am Flaschenboden sowie mögliche Flockenbildung bedeuten keinen Qualitätsverlust. Ganz im Gegenteil! Sie weisen auf die natürliche Herstellungsweise dieses biologischen Produktes hin. Sogenannte \"Essigmuttern\" können einfach abgesiebt und der Essig ganz normal weiter verwendet werden. ', 'Byodo Naturkost GmbH', 'Byodo', 'GERMANY', '84ef66b1-5df7-4a94-b73b-ccae9a8a50db', 'manager', '2021-08-12 14:28:06', 'System', '2023-12-17 03:07:36', 801, 931, 0, NULL, 0, 4.66, 'Weiling', 0, NULL, 0, 67, 'Himbeeressig*, Himbeerkonzentrat* *aus kontrolliert ökologischer Erzeugung', '2022-10-27 02:03:23', 1325.78, 'OIL_VINEGAR_SAUCES', 'PANTRY', 822.7, 26.3, 'VEGAN;VEGETARIAN;KOSCHER;HALAL;WITHOUT_ADDED_SUGAR', NULL, NULL),
