(863, 'Svartvinbärssylt (Weiling)', '7391961111854', 0, 4.99, 1, 1, NULL, 0, '101190', 'Svartvinbärssylt', 'Das Svartvinbärssylt ist ein Fruchtaufstrich aus Schwarzen Johannisbeeren. Oft werden Johannisbeeren zu Gelee verarbeitet, doch hier wird nicht nur der Saft verwendet sondern die gesamte Beere zu Fruchtaufstrich verarbeitet. Das ergibt ein besonders vitaminreiches und geschmackvolles Produkt.\nDer Fruchtaufstrich aus Schwarzer Johannisbeere ist ein typisch schwedisches Traditionsprodukt. Die Beeren kommen vorwiegend aus Darlarna, Mittelschweden.', 'Torfolk Gård', 'Linnéas Svenska', 'SWEDEN', '01560de1-ea55-4d52-a35d-817d71c1a097', 'manager', '2021-08-12 15:38:58', 'System', '2023-11-29 02:06:37', 1046, 938, 0, NULL, 0, 3.14, 'Weiling', 0, NULL, 0, 182, 'Schwarze Johannisbeeren* 51%, Zucker* 45,5%, Zitronensaft*, Pektine *aus kontrolliert ökologischer Erzeugung', '2023-11-07 02:07:00', 466.56, 'SPREADS_HONEY', 'PANTRY', 494, 9, 'VEGAN;VEGETARIAN', NULL, NULL),
(864, 'Haselnuss-Schokocreme 13 % (Weiling)', '4035626112451', 0, 4.69, 1, 1, NULL, 0, '104032', 'Haselnuss-Schokocreme 13 %', 'Zartschmelzende Haselnuss-Schokocreme mit 13% Haselnüssen und feinsüßem Nougatgeschmack – für echte Leckermäulchen. (Feinsüß-schokoladig mit echter Bourbon-Vanille.)\n', 'Weiling GmbH', 'bioladen', 'NETHERLANDS', '146ed6d1-3aea-473a-a552-3e7632c22461', 'manager', '2021-08-12 15:43:44', 'System', '2023-10-14 02:07:39', 789, 939, 0, NULL, 0, 2.95, 'Weiling', 0, NULL, 0, 120, 'Rohrzucker*, Sonnenblumenöl*, HASELNÜSSE* (13%), Kakaopulver* stark entölt (8,5%), MAGERMILCHPULVER*, Palmfett*, Emulgator: SOJALECITHIN*, Bourbon-Vanillepulver* *aus kontrolliert ökologischer Erzeugung', '2022-12-12 12:23:18', 642.6, 'SPREADS_HONEY', 'PANTRY', 614, 10.8, 'VEGETARIAN', NULL, NULL),
(865, 'Zitronenkuchen Backmischung (Dinkel), demeter (Weiling)', '4022381033732', 0, 4.44, 1, 1, NULL, 0, '251116', 'Zitronenkuchen Backmischung (Dinkel), demeter', 'Feines aus Dinkel. \nUnsere Backmischung für Zitronenkuchen ist ein klassicher Rührteig und perfekt für den Einstieg ins Kuchenbacken oder den schnellen Kuchen zwischendurch. Das Besondere an unserem Zitronenkuchen: In ihm steckt bestes demeter-Dinkelmehl, handwerklich hergestellt in unserer Mühle und eine leckere Glasur. \n\nUnd das Beste: Mit unseren Backmischungen vermeidest du Müll und hilfst der Natur, denn\nDu vermeidest Plastik: Kein Plastikinnenbeutel, sondern eine Verpackung aus 100% Papier.\nDu vermeidest Verpackungsmüll: Keine Faltschachtel, dadurch im Schnitt weniger als die Hälfte des Verpackungsmülls im Vergleich zu Backmischungen mit Faltschachtel. ', 'Spielberger GmbH', 'Spielberger Mühle', 'GERMANY', '98417219-b1dc-4f89-89ff-445da0cfd91d', 'manager', '2021-08-12 15:47:19', 'System', '2024-02-06 02:07:40', 378, 940, 2, NULL, 0, 2.42, 'Weiling', 0, NULL, 0, 64, 'Zutaten Kuchen: DINKELmehl Type 630** 52% (eine Ur-Weizenart), Rohrohrzucker**, Maisstärke*, Weinstein-Backpulver* (Säuerungsmittel: Monokaliumtartrat, Backtriebmittel: Natriumhydrogencarbonat, Maisstärke*), Meersalz\nZutaten Glasur: Puderzucker** *aus kontrolliert ökologischer Erzeugung **aus biodynamischer Erzeugung', '2022-04-11 15:27:49', 1520, 'OTHER_PASTRY', 'PASTRY', 505, 19, 'VEGAN;VEGETARIAN;LACTOSEFREE', NULL, NULL),
(866, 'Linsen-Aufstrich Grüne Linse Tomate Karotte (Weiling)', '4016249197742', 0, 3.29, 1, 1, NULL, 0, '111198', 'Linsen-Aufstrich Grüne Linse Tomate Karotte', 'Aufstrich auf’s Brot, macht Wangen rot. Ist eine alte Linsen-Weisheit und heute noch so wahr wie vor vielen tausend Jahren. Ja, Linsen stehen schon wirklich lange auf unserem Speiseplan. Und das vollkommen zurecht. Denn sie sind echtes Superfood. Super proteinreich. Super energiereich. Super lecker. Und da sie in verschiedenen Farben kommen, sind sie auch super abwechslungsreich. Perfekt aufs Brot, als Dip oder als GEHEIME ZUTAT für euer Dressing.', 'Allos Hof-Manufaktur GmbH', 'Allos', 'GERMANY', '1cbd5563-f3df-4012-a6a8-9a63246246bd', 'manager', '2021-08-12 16:25:28', 'System', '2024-02-03 02:09:47', 1548, 370, 0, NULL, 0, 1.95, 'Weiling', 0, NULL, 0, 61, 'Karotten* (22%), Zwiebeln*, Tomaten* (11%), Sonnenblumenöl*, Zitronensaft aus Zitronensaftkonzentrat*, grüne Linsen* (9%) getrocknet, Tomatenmark* (4%), Agavendicksaft*, Sonnenblumenkerne*, Schnittlauch*, Meersalz, Knoblauch*, Balsamessig* (Weißweinessig*, Traubenmostkonzentrat*), Kartoffelstärke*, Paprika* edelsüß; Cayenne Pfeffer*. * aus ökologischem Landbau.', '2023-06-30 09:53:07', 373.034, 'SPREADS_HONEY', 'PANTRY', 291, 7.4, 'VEGAN;VEGETARIAN;GLUTENFREE', NULL, NULL),
(867, 'Saatenliebe Kuerbiskern gegrillte Paprika (Weiling)', '4016249238131', 0, 3.29, 1, 1, NULL, 0, '111316', 'Saatenliebe Kuerbiskern gegrillte Paprika', 'Herzlich willkommen zu den vereinigten Saaten von Allos. Man kann richtig schmecken,\ndass die Pflanzen all ihre Liebe in die Samen gesteckt haben. Und wir haben noch eine\ngehörige Portion Gemüse dazu gepackt. Volle Saaten-Power trifft grandiosen Gemüse-\nGenuss. Das Ergebnis ist ausgesprochen streichzart, unfassbar lecker und bietet ein ganz besonderes Geschmacks-Erlebnis auf der Zunge. Das hat das Potenzial zum\nNationalgericht!', 'Allos Hof-Manufaktur GmbH', 'Allos', 'GERMANY', 'c2e1857a-8e2c-43e0-944f-5fdfa5e17271', 'manager', '2021-08-12 16:27:23', 'System', '2023-11-25 02:12:20', 1022, 941, 0, NULL, 0, 1.95, 'Weiling', 0, NULL, 0, 61, 'Gegrillte Paprika* (20%), Sonnenblumenöl*, Wasser, Zitronensaft aus Zitronensaftkonzentrat*, Sonnenblumenkerne*, Tomatenmark* zweifach konzentriert, Zwiebeln*, Kürbiskerne* (4%), Kürbiskernöl* (2%), Agavendicksaft*, Meersalz, Paprikaschotengrieß* (0,8%), Paprika* edelsüß, Eiweißpulver aus Sonnenblumenkernen*, Obstessig*, Knoblauchpulver*, Pfeffer*, Kreuzkümmel. *aus ökologischem Landbau.', '2023-06-09 09:21:59', 373.034, 'SPREADS_HONEY', 'PANTRY', 286, 7.4, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
