(869, 'Dinkel-Pizzateig Backmischung, demeter (Weiling)', '4022381033817', 0, 2.79, 1, 1, NULL, 0, '251098', 'Dinkel-Pizzateig Backmischung, demeter', 'Ein Klassiker aus Dinkel. \nDas besondere an unserer Backmischung für Pizzateig ist das Dinkelmehl. In der eigenen Mühle hergestellt gibt unser Dinkelmehl in demeter-Qualität jedem Pizzateig besonders guten Geschmack und sorgt für einen luftig Pizzaboden. \n\nUnd das Beste: Mit unseren Backmischungen vermeidest du Müll und hilfst der Natur, denn\nDu vermeidest Plastik: Kein Plastikinnenbeutel, sondern eine Verpackung aus 100% Papier. \nDu vermeidest Verpackungsmüll: Keine Faltschachtel, dadurch im Schnitt weniger als die Hälfte des Verpackungsmülls im Vergleich zu Backmischungen mit Faltschachtel.  ', 'Spielberger GmbH', 'Spielberger Mühle', 'GERMANY', '469031a1-1c41-4537-985e-5735c0fc060e', 'manager', '2021-08-12 16:31:36', 'System', '2023-11-29 02:07:47', 376, 942, 2, NULL, 0, 1.69, 'Weiling', 0, NULL, 0, 64, 'DINKELmehl Type 1050** 95% (eine Ur-Weizenart), Würzhefeflocken* (Melassehefe*, Reismehl*, Meersalz), Weinstein-Backpulver* (Säuerungsmittel: Monokaliumtartrat, Backtriebmittel: Natriumhydrogencarbonat, Maisstärke*), Meersalz *aus kontrolliert ökologischer Erzeugung **aus biodynamischer Erzeugung', '2022-12-17 12:10:36', 760, 'OTHER_PASTRY', 'PASTRY', 357, 19, 'VEGAN;VEGETARIAN;LACTOSEFREE', NULL, NULL),
