(871, 'Olivenöl mittel fruchtig nat e 1 l (Weiling)', '3445020220507', 0, 16.19, 1, 1, NULL, 0, '525020', 'Olivenöl mittel fruchtig nat e 1 l', 'Erste Güteklasse – direkt aus Oliven ausschließlich mit mechanischen Verfahren gewonnen. Sein fruchtiges Aroma verleiht Speisen eine angenehme mediterrane Note.', 'BIO PLANÈTE Ölmühle Moog SAS', 'BIO PLANÈTE', 'SPAIN', '8bedd0b0-5e60-416f-aa38-63e1a63346bc', 'manager', '2021-08-12 16:46:17', 'System', '2023-12-17 02:54:54', 1171, 1796, 0, NULL, 0, 9.72, 'Weiling', 0, NULL, 0, 52, NULL, '2023-07-25 09:52:01', 2073.58, 'OIL_VINEGAR_SAUCES', 'PANTRY', 1435, 28.7, 'VEGAN;VEGETARIAN;RAWFOOD', NULL, NULL),
(872, 'Olivenöl fruchtig nativ extra 1 l (Weiling)', '3445020222501', 0, 16.19, 1, 1, NULL, 0, '525023', 'Olivenöl fruchtig nativ extra 1 l', 'Erste Güteklasse – direkt aus Oliven ausschließlich mit mechanischen Verfahren gewonnen. Dieses Öl eignet sich hervorragend zur Zubereitung von herzhaften Gerichten.', 'BIO PLANÈTE Ölmühle Moog SAS', 'BIO PLANÈTE', 'SPAIN', 'f77c1a7a-a7c4-4b2d-b898-b631d730f434', 'correction', '2021-08-17 09:28:12', 'System', '2023-12-17 02:57:13', 1177, 1797, 0, NULL, 0, 9.72, 'Weiling', 0, NULL, 0, 52, NULL, '2023-07-25 09:53:11', 2073.58, 'OIL_VINEGAR_SAUCES', 'PANTRY', 1435, 28.7, 'VEGAN;VEGETARIAN;RAWFOOD', NULL, NULL),
(873, 'Olivenöl mild nativ extra 1l (Weiling)', '3445020223508', 0, 14.99, 1, 1, NULL, 0, '525026', 'Olivenöl mild nativ extra 1l', 'Erste Güteklasse – direkt aus Oliven ausschließlich mit mechanischen Verfahren gewonnen. Durch seine feine Note unterstreicht es gut den Eigengeschmack Ihrer Speisen.', 'BIO PLANÈTE Ölmühle Moog SAS', 'BIO PLANÈTE', 'FRANCE', '2d308f7a-474d-4151-a773-2fd4186a1d68', 'manager', '2021-08-12 16:49:44', 'System', '2023-12-17 02:52:47', 1175, 1798, 0, NULL, 0, 9.08, 'Weiling', 0, NULL, 0, 52, NULL, '2023-06-13 08:55:01', 2073.58, 'OIL_VINEGAR_SAUCES', 'PANTRY', 1435, 28.7, 'VEGAN;VEGETARIAN;RAWFOOD', NULL, NULL),
(874, 'Sesamöl geröstet 250 ml (Weiling)', '3445020006736', 0, 6.99, 1, 1, NULL, 0, '525055', 'Sesamöl geröstet 250 ml', 'Traditionell verwendet in der feinen asiatischen Küche verleiht es auch einheimischen Gerichten mit nur wenigen Tropfen einen nussigen, fernöstlichen Geschmack. Sein herrliches Aroma entfaltet der Sesam durch leichtes Rösten.', 'BIO PLANÈTE Ölmühle Moog SAS', 'BIO PLANÈTE', 'FRANCE', '2c16fbde-4f2f-4280-a94a-5201e40d4edf', 'manager', '2021-08-12 16:52:22', 'System', '2023-12-17 02:52:45', 1032, 1799, 0, NULL, 0, 4.39, 'Weiling', 0, NULL, 0, 52, NULL, '2022-11-28 12:29:34', 616.512, 'OIL_VINEGAR_SAUCES', 'PANTRY', 460, 22.8, 'VEGAN;VEGETARIAN', NULL, NULL),
(875, 'Brat Olivenöl 1l (Weiling)', '3445020001779', 0, 16.19, 1, 1, NULL, 0, '525118', 'Brat Olivenöl 1l', 'Das hoch erhitzbare BIO PLANÈTE Brat-Olivenöl eignet sich besonders gut für die tägliche Anwendung.', 'BIO PLANÈTE Ölmühle Moog SAS', 'BIO PLANÈTE', 'NETHERLANDS', 'c204be0e-db80-44f7-aaf7-1c5b19cc4665', 'manager', '2021-08-12 16:53:33', 'System', '2023-12-17 02:55:51', 1413, 1800, 0, NULL, 0, 9.72, 'Weiling', 0, NULL, 0, 52, 'Raffiniertes Olivenöl* (80%), Natives Olivenöl* (20%) *aus kontrolliert ökologischer Erzeugung', '2023-10-31 02:06:21', 2073.58, 'OIL_VINEGAR_SAUCES', 'PANTRY', 1435, 28.7, 'VEGAN;VEGETARIAN', NULL, NULL),
(876, 'bioladen Kokosöl nativ 500 ml (Weiling)', '4065626115329', 0, 6.79, 1, 1, NULL, 0, '525202', 'bioladen Kokosöl nativ 500 ml', 'Auf Sri Lanka erfolgt die Verarbeitung der Kokosnüsse noch traditionell in aufwendiger Handarbeit: vom Entfernen der dicken grünen Faserhülle, über das Aufschlagen der harten Schale, bis hin zum Abschälen der dünnen braunen Haut. Das native bioladen*Kokosöl wird schonend aus dem geraspelten und getrockneten Kokosfleisch gepresst (erste Kaltpressung) und verleiht Speisen einen feinen Kokosgeschmack. Bei Raumtemperatur bis 25°C fest. Wird durch leichtes Erwärmen im Wasserbad flüssig. Ideal zum Braten und Backen.\n', 'Weiling GmbH', 'bioladen', 'SRI_LANKA', '280dfd3f-f33d-4c10-b8cb-41f46fe36950', 'manager', '2021-08-12 16:55:14', 'System', '2023-10-14 02:08:16', 487, 1801, 0, NULL, 0, 4.05, 'Weiling', 0, NULL, 0, 1016, NULL, '2023-07-28 10:21:01', 903.125, 'OIL_VINEGAR_SAUCES', 'PANTRY', 820, 12.5, 'VEGAN;VEGETARIAN', NULL, NULL),
(877, 'bioladen Kokosmilch 400 ml (Weiling)', '4035626111287', 0, 2.69, 1, 1, NULL, 0, '146002', 'bioladen Kokosmilch 400 ml', 'Die Verarbeitung der Kokosnüsse erfolgt auf Sri Lanka noch traditionell von Hand. Zuerst werden die Kokosnüsse nach der Ernte von ihrer dicken grünen Faserhülle befreit. Um an das weiße Fruchtfleisch zu kommen, wird die harte Schale aufgeschlagen und die dünne braune Haut mit einem Messer sauber abgeschält – dabei ist jeder Schritt aufwendige Handarbeit. Anschließend wird das weiße Kokosfleisch in einer Kokosmühle zu Kokosmilch verarbeitet. Der Kokosnussanteil beträgt bei diesem Produkt 60%.', 'Weiling GmbH', 'bioladen', 'SRI_LANKA', '19eecc02-8a5e-4f97-8e96-20a145a1cd92', 'manager', '2021-08-12 16:57:22', 'System', '2023-07-31 00:02:54', 484, 1802, 0, NULL, 0, 1.55, 'Weiling', 0, NULL, 0, 1016, 'Kokosnuss (60%)*, Wasser *aus kontrolliert ökologischer Erzeugung', '2022-05-23 15:09:30', 624.375, 'CONVENIENCE_PRESERVES', 'PANTRY', 458.39, 11.1, 'VEGAN;VEGETARIAN', NULL, NULL),
(878, 'MANI Grüne & Kalamata Oliven al naturale, entkernt (Weiling)', '5202423201025', 0, 4.69, 1, 1, NULL, 0, '155052', 'MANI Grüne & Kalamata Oliven al naturale, entkernt', 'Das Beste aus beiden Sorten - ein Mix aus fruchtigen, Naturland Öko + Fair zertifizierten Kalamata und würzigen Konservolia Oliven. \nBauern kultivieren die Olivenbäume traditionell und ernten weitestgehend per Hand. \nDie Oliven werden natürlich entbittert und in feinem MANI Olivenöl sowie Oregano mariniert – der pure Geschmack der edlen Oliven in Rohkost-Qualität!\n\nMANI ist der Pionier für Bio-Olivenöl aus Griechenland. 1991 erhielt das Familienunternehmen für sein Olivenöl die allererste Bio-Zertifizierung Griechenlands.\n\nAls Mani-Kenner sollten Sie diese Variante unbedingt ausprobieren!', 'Bläuel Greek Organic Products', 'MANI®', 'GREECE', 'a9e935fa-116c-4065-910f-010cf021adb7', 'manager', '2021-08-12 16:59:19', 'System', '2023-09-30 00:03:48', 754, 951, 3, 10, 0, 2.88, 'Weiling', 0, NULL, 0, 80, 'Kalamata Oliven*º (50%), grüne Oliven* (49%),  natives Olivenöl extra*, Oregano*, Meersalz\nºNaturland Fair zertifiziert (99%) *aus kontrolliert ökologischer Erzeugung', '2022-11-29 16:19:10', 522.512, 'CONVENIENCE_PRESERVES', 'PANTRY', 400, 11.3, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE;RAWFOOD', NULL, NULL),
(879, 'Grüne Oliven al naturale, Koriandersam&ros.Pfeffer (Weiling)', '5202423123211', 0, 4.79, 1, 1, NULL, 0, '155062', 'Grüne Oliven al naturale, Koriandersam&ros.Pfeffer', 'Diese feinen, grünen Bio Tafeloliven der Sorte Konservolia - auch bekannt als Amfissa Oliven - werden nur in Bio Olivenöl nativ extra, Koriandersamen und rosa Pfeffer mariniert und direkt vakuumverpackt- der pure Geschmack der edlen Oliven in Rohkost-Qualität!\n\nDas feste Fruchtfleisch der grünen Olive besticht durch seinen wunderbar würzigen Geschmack.\n\nAls Mani-Kenner sollten Sie diese Variante unbedingt ausprobieren!\n\nMani Bläuel Oliven werden schonend geerntet und auf natürliche Weise, ohne Zugabe von Konservierungsstoffen, entbittert.', 'Bläuel Greek Organic Products', 'MANI®', 'GREECE', '1caedea9-c091-4711-928e-c6a170f3073b', 'manager', '2021-08-12 17:01:45', 'System', '2023-01-16 18:23:14', 752, 952, 3, 10, 0, 2.88, 'Weiling', 0, NULL, 0, 80, 'Grüne Oliven*º (96,8%), Meersalz, natives Olivenöl extra* (2%), rosa Pfeffer* (0,6%), Koriandersamen* (0,6%)\nºNaturland Fair zertifiziert (96,8%) *aus kontrolliert ökologischer Erzeugung', '2022-11-29 16:19:05', 522.512, 'CONVENIENCE_PRESERVES', 'PANTRY', 408, 11.3, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE;RAWFOOD', NULL, NULL),
(880, 'Sardinen ohne Haut u. Gräten in Bio-Sonnenblumenöl (Weiling)', '4026968005501', 0, 2.99, 1, 1, NULL, 0, '160155', 'Sardinen ohne Haut u. Gräten in Bio-Sonnenblumenöl', 'Die Schwarmfische werden auf kleinen Booten per Echolot geortet und dann mit großmaschigen Ringwadennetzen gefangen. So werden die Sardinen weniger gedrückt oder gequetscht; Jungfische können wieder nach draußen gelangen. Diese Vollkonserve enthält neben den Sardinen ausschließlich Meersalz und kaltgepresstes Bio-Sonnenblumenöl.', 'Fontaine Nahrungsmittel GmbH', 'Fontaine', 'MOROCCO', '61ea676b-e74c-48d3-a5af-b5733bf27e44', 'manager', '2021-08-12 17:03:05', 'System', '2023-09-07 03:44:27', 1073, 953, NULL, NULL, 0, 2.15, 'Weiling', 0, NULL, 0, 60, 'SARDINEN-FILETS (Sardina pilchardus)\n75 % Sonnenblumenöl* (24 %),\nMeersalz *aus kontrolliert ökologischer Erzeugung', '2022-11-07 10:03:37', 214.5, 'CONVENIENCE_PRESERVES', 'PANTRY', 145, 11, NULL, NULL, NULL),
(881, 'Pfälzer Leberwurst Gourmet-Qualität (Weiling)', '4031829231128', 0, 3.49, 1, 1, NULL, 0, '162050', 'Pfälzer Leberwurst Gourmet-Qualität', 'Ökolands Pfälzer Leberwurst ist eine besonders herzhafte Wurst-Spezialität. Sie zeichnet sich durch einen hohen Fleischanteil aus bestem Bio-Schweinefleisch mit weniger Fett aus. Die etwas grobe Struktur sowie die traditionelle Würzung mit intensiver Kräuternote macht den einzigartigen Geschmack aus. Im praktischen Zylinderglas leicht entnehmbar.', 'Ökoland GmbH Nord', 'ÖKOLAND', 'GERMANY', '23de52fd-f1ed-4311-97c8-5f754830f6c1', 'manager', '2021-08-12 17:06:12', 'System', '2023-12-12 02:05:54', 1157, 954, 1, NULL, 0, 2.53, 'Weiling', 0, NULL, 0, 60, '54% Schweinefleisch*, 24% Schweineleber*, Schweinespeck*, Zwiebeln*, Meersalz, Gewürze* (Pfeffer*, Muskatnuss*, Piment*, Nelken*, Ingwer*), Kräuter* (Majoran*, Thymian*). *aus kontrolliert ökologischer Erzeugung', '2022-04-11 14:49:05', 337.985, 'CONVENIENCE_PRESERVES', 'PANTRY', 312.1, 8.2, 'GLUTENFREE;LACTOSEFREE;PALMOILFREE;WITHOUT_ADDED_SUGAR', NULL, NULL),
