(884, 'Kaffee 100 % Arabica gemahlen, Vakuumpack (Weiling)', '4035626103541', 0, 6.49, 1, 1, NULL, 0, '350255', 'Kaffee 100 % Arabica gemahlen, Vakuumpack', 'Der bioladen*Kaffee ist eine harmonische Röstkaffeemischung aus erlesenen Arabica-Bohnen, die sich durch einen vollmundigen und kräftigen Geschmack auszeichnet.\nDie Arabica-Bohnen für diesen Kaffee stammen vorwiegend von kleinbäuerlichen Erzeugern aus Süd- und Mittelamerika. Langfristige Partnerschaften mit den Menschen vor Ort bilden die Grundlage für eine verantwortungsvolle und faire Zusammenarbeit. Der Kaffee ist filterfein gemahlen.', 'Weiling GmbH', 'bioladen', 'GERMANY', '54e78b76-eb3b-4b7f-933f-8c930a09cade', 'manager', '2021-08-12 17:13:12', 'System', '2023-10-18 02:07:29', 1491, 957, 0, NULL, 0, 6.29, 'Weiling', 0, NULL, 0, 60, NULL, '2022-11-10 00:03:43', 1173.25, 'COFFEE', 'COFFEE_TEA_COCOA', 512.5, 19, 'VEGAN;VEGETARIAN', NULL, NULL),
(885, 'Kaffee 100 % Arabica mild, gemahlen (Weiling)', '4035626113526', 0, 5.99, 1, 1, NULL, 0, '350260', 'Kaffee 100 % Arabica mild, gemahlen', 'Der bioladen*Kaffee ist eine harmonische Röstkaffeemischung aus erlesenen Arabica- und Robusta-Bohnen, die sich durch einen milden Geschmack auszeichnen.\nDie Arabica-Bohnen für diesen Kaffee stammen vorwiegend von kleinbäuerlichen Erzeugern aus Süd- und Mitelamerika. Die Robusta Bohnen kommen aus Afrika. Langfristige Partnerschaften mit den Menschen vor Ort bilden die Grundlage für eine verantwortungsvolle und faire Zusammenarbeit. Harmonische Röstkaffeemischung, filterfein gemahlen.\n', 'Weiling GmbH', 'bioladen', 'GERMANY', '050c6b3b-65d5-44fb-872d-c13491fcbd14', 'manager', '2021-08-12 17:14:40', 'System', '2023-10-18 02:07:16', 1493, 958, 0, NULL, 0, 5.7, 'Weiling', 0, NULL, 0, 60, NULL, '2022-11-10 00:03:49', 1764, 'COFFEE', 'COFFEE_TEA_COCOA', 509.2, 24.5, 'VEGAN;VEGETARIAN', NULL, NULL),
(886, 'Kaffee 100 % Arabica kräftig, gemahlen (Weiling)', '4035626114103', 0, 5.99, 1, 1, NULL, 0, '350262', 'Kaffee 100 % Arabica kräftig, gemahlen', 'Der bioladen*Kaffee ist eine harmonische Röstkaffeemischung aus erlesenen Arabica-Bohnen, die sich durch einen vollmundigen und kräftigen Geschmack auszeichnen.\nDie Arabica-Bohnen für diesen Kaffee stammen vorwiegend von kleinbäuerlichen Erzeugern aus Süd- und Mittelamerika. Langfristige Partnerschaften mit den Menschen vor Ort bilden die Grundlage für eine verantwortungsvolle und faire Zusammenarbeit. Der Kaffee ist filterfein gemahlen.', 'Weiling GmbH', 'bioladen', 'GERMANY', 'd2a9eb10-566f-4f2e-8447-7b672386702d', 'manager', '2021-08-12 17:16:13', 'System', '2023-10-20 02:10:29', 1492, 959, 0, NULL, 0, 5.7, 'Weiling', 0, NULL, 0, 60, '\n', '2022-11-10 00:03:52', 1764, 'COFFEE', 'COFFEE_TEA_COCOA', 510.2, 24.5, 'VEGAN;VEGETARIAN', NULL, NULL),
(887, 'Solea Espresso entkoffeiniert, gemahlen (Weiling)', '4012346533209', 0, 8.29, 1, 1, NULL, 0, '350283', 'Solea Espresso entkoffeiniert, gemahlen', 'Solea Espresso\nGeschmack:\nEleganter Espresso, mild aromatisch. Perfekt für Cappuccino oder Latte Macchiato.\nEntkoffeinierung:\nNur mit Wasser und Kohlensäure - ganz ohne chemische Lösungsmittel. So erhalten wir die natürliche Vielfalt der Kaffee-Aromen.\nHerkunft:\nArabica-Bohnen aus dem peruanischen Hochland. Mit unseren Kaffeebauern verbindet uns eine langfristige Partnerschaft.\n Anbau:\nGut geschützt unter Schattenbäumen wachsen Lebensbaum Kaffees langsam heran.  \nErnte:\nImmer von Hand. Für Lebensbaum Kaffees werden nur reife Kaffeekirschen gepflückt.\nRöstung:\nWir rösten langsam und nicht zu heiß. Auf diese Weise entwickeln unsere Kaffees ihr volles, ausgewogenes Aroma.', 'Ulrich Walter GmbH', 'LEBENSBAUM', 'Mexiko und Peru', '11af3dc6-c1d0-4b98-b7c6-3219592c81ff', 'correction', '2021-10-02 02:07:46', 'System', '2023-01-16 18:23:53', 1000, 222, NULL, NULL, 0, 4.98, 'Weiling', 2, 1, 0, 60, NULL, '2023-06-13 08:53:12', 1113.75, 'COFFEE', 'COFFEE_TEA_COCOA', 257, 22.5, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(888, 'Couscous (Weiling)', '7640161876705', 0, 1.79, 1, 1, NULL, 0, '374410', 'Couscous', 'Das Babygläschen Couscous ist ein schmackhaftes Menü aus Gemüse, Frucht und wertvollem Bio-Hühnerfleisch für Babys und Kleinkinder im Junioralter.', 'Holle baby food AG', 'Holle ', 'GERMANY', '732123bd-c13e-497c-a2cd-f2404f16b053', 'manager', '2021-08-12 17:20:40', 'System', '2024-02-07 02:09:02', 579, 960, 2, NULL, 0, 1.06, 'Weiling', 0, NULL, 0, 61, 'Wasser, Karotten** 33 %, Hühnerfleisch* 8 %, Birnenpüree**,\nTomatenpüree** 4,8%, Fenchel** 4%, HARTWEIZENGRIESS* 4%, Reisgriess**. *aus biologischer Landwirtschaft, **Demeter (aus biodynamischer Landwirtschaft, demeter-Gesamtanteil 75 %).', '2022-10-15 02:04:44', 326.06, 'BABY_FOOD', 'BABY', 345, 10.8, 'LACTOSEFREE', NULL, NULL),
(889, 'Darjeeling 250 g (Weiling)', '4012346528106', 0, 16.49, 1, 1, NULL, 0, '411355', 'Darjeeling 250 g', 'Kein anderer Tee erreicht das unverwechselbare Aroma eines Darjeeling. Einmal probiert und Sie werden seinen feinherben, blumigen Geschmack und die hellbraune Tassenfarbe sofort wiedererkennen. Unseren Darjeeling-Tee aus biologisch-dynamischem Anbau beziehen wir direkt aus dem Teegarten Ambootia. Hier, an den abgelegenen Südhängen des Himalaya, werden die Teeblätter sorgfältig von Hand gepflückt und danach traditionell veredelt. Ein Hochgenuss - nicht nur geografisch gesehen.', 'Ulrich Walter GmbH', 'LEBENSBAUM', 'Diepholz, Niedersachsen', '345f6ec9-403b-4829-86cc-7807809d0c4b', 'manager', '2021-08-12 17:22:15', 'System', '2024-02-15 02:09:26', 588, 1803, 2, NULL, 0, 9.7, 'Weiling', 2, 1, 0, 60, NULL, '2022-11-15 09:38:51', 1328.25, 'TEA', 'COFFEE_TEA_COCOA', 269.8, 23, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(890, 'b*Gebrannte Erdnüsse (Weiling)', '4035661162855', 0, 4.49, 1, 1, NULL, 0.15, '440050', 'b*Gebrannte Erdnüsse', 'Die bioladen*Erdnüsse kommen aus unserem bioladen*Fair Projekt aus Burkina Faso. Mit dem Kauf gehen pro Glas 5 Cent in dieses Projekt. Sie wollen mehr zum Projekt erfahren, dann schauen Sie auf bioladen.de/qr/burkinafaso. Die Erdnüsse werden knackig geröstet und mit einer dünnen karamellisierten Schicht mit Honig und Salz ummantelt. Durch den Hersteller Ravellis wird die Röstung und Ummantelung in liebevoller Handarbeit durchgeführt. (Im Mehrwegglas.)', 'Weiling GmbH', 'bioladen', 'GERMANY', '5128760d-3885-47ec-b524-5393a04e401e', 'manager', '2021-08-12 17:24:18', 'System', '2023-10-14 02:09:34', 465, 962, 0, NULL, 0, 2.8, 'Weiling', 0, NULL, 0, 62, 'ERDNUSSKERNE* (71 %), Rohrohrzucker*, Honig*, Meersalz *aus kontrolliert ökologischer Erzeugung', '2022-08-31 00:00:12', 509.6, 'SWEETS', 'SNACKS', 300, 10.4, 'VEGETARIAN', NULL, NULL),
(891, 'Geröstete Cashews mit Chili im Pfandglas (Weiling)', '4035661162909', 0, 5.49, 1, 1, NULL, 0.15, '440060', 'Geröstete Cashews mit Chili im Pfandglas', 'Die bioladen*Cashewkerne kommen aus unserem bioladen*Fair Projekt aus Burkina Faso. Mit dem Kauf gehen pro Glas 5 Cent in dieses Projekt. Sie wollen mehr zum Projekt erfahren, dann schauen Sie auf bioladen.de/qr/burkinafaso. Die Herstellung der Cashews ist reine Handarbeit. Im Geschmack sind sie mild nussig. Sie sind geröstet und mit einer pikanten Chilinote versehen. Optimal zum Knabbern. (Im Mehrwegglas.)', 'Weiling GmbH', 'bioladen', 'GERMANY', '33446c68-a3f1-4af2-8b79-065c10749c57', 'manager', '2021-08-12 17:27:06', 'System', '2023-10-14 02:08:43', 468, 963, 0, NULL, 0, 3.43, 'Weiling', 0, NULL, 0, 62, 'CASHEWKERNE* (95%), Sonnenblumenöl*, Steinsalz, Chili*, Paprika* *aus kontrolliert ökologischer Erzeugung', '2022-04-11 14:05:29', 509.6, 'SALTY', 'SNACKS', 315, 10.4, 'VEGAN;VEGETARIAN', NULL, NULL),
(892, 'Panama Feinbitter 80% (Weiling)', '4024297005179', 0, 3.69, 1, 1, NULL, 0, '442724', 'Panama Feinbitter 80%', 'Rar & edel: Die Trinitario-Kakaobohnen für diese feine Bitterschokolade werden von einer Kleinbauernkooperative im Norden von Panama angebaut. Dank der Witterungs- und Bodenverhältnisse sowie durch die sorgfältige Verarbeitung wird hier ein unvergleichlicher Kakao mit ausgeprägtem Aroma erzeugt, der eine absolute Rarität darstellt.\n\nDas Geheimnis des feinen Schmelzes und des einzigartigen Geschmacks liegt im besonderen Herstellungsverfahren: In traditioneller Schweizer Handwerkskunst lassen die Chocolatiers durch besonders langes Conchieren feine Schokolade entstehen, die auf der Zunge zergeht. \n\nWie bei allen Naturata Schokoladen enthält die natürliche Rezeptur nur fair gehandelte Zutaten aus 100 % kontrolliert biologischem Anbau. Ohne künstliche Aromen oder Emulgatoren!', 'Naturata AG', 'NATURATA', 'SWITZERLAND', '2cfb180f-3c99-43c8-b52c-436bdba0add0', 'manager', '2021-08-12 17:28:18', 'System', '2023-10-29 02:05:30', 672, 964, 0, 0, 0, 2.24, 'Weiling', 0, NULL, 0, 298, 'Kakaomasse*, Roh-Rohrzucker*, Kakaobutter*, Bourbon Vanille gemahlen* *aus kontrolliert ökologischer Erzeugung', '2022-11-29 16:09:53', 140.576, 'SWEETS', 'SNACKS', 116, 19.1, 'VEGAN;VEGETARIAN', NULL, NULL),
(893, 'Bio Vollmilch Salty Caramel (Weiling)', '4013320334881', 0, 2.69, 1, 1, NULL, 0, '442806', 'Bio Vollmilch Salty Caramel', 'Kakaomasse nur aus Bohnen aus São Tomé; ohne Emulgatoren, dafür schonendes und sorgfältiges Conchieren der Schokoladenmasse; Kakaobutter als einzig eingesetztes pflanzliches Fett, keine Fremdfette; Direktimport der hochwertigen Zutaten, Unterstützung mehrerer Handelspartner; Mit Bio Vollmilchpulver aus dem Berchtesgadener Land; Innenwickel aus überwiegend nachwachsenden Rohstoffen', 'GEPA mbH', 'GEPA - The Fair Trade Company', 'GERMANY', '8d4dfb2c-dd27-4a7a-975d-01acaab6dc74', 'manager', '2021-08-12 17:30:02', 'System', '2023-07-01 00:01:06', 1578, 965, 3, 10, 0, 1.64, 'Weiling', 0, NULL, 0, 67, 'Rohrohrzucker°*,  Kakaobutter°*, 19% VOLLMILCHPULVER°*, Kakaomasse°*, 7,5% Karamell crisp* (Rohrohrzucker°*, Glucosesirup*, BUTTERREINFETT*, Meersalz), 0,5% Pyramidensalz (Fleur de Sel).Kakao: 41% mindestens *aus kontrolliert ökologischer Erzeugung', '2022-12-02 14:09:11', 120.12, 'SWEETS', 'SNACKS', 90, 15.6, 'VEGETARIAN', NULL, NULL),
