(907, 'Studentenfutter im Pfandglas (Weiling)', '4035661162985', 0, 5.99, 1, 1, NULL, 0, '506065', 'Studentenfutter im Pfandglas', 'Eine perfekte Mischung aus Nuss und Frucht. Die knackigen etwas herzhafteren Nüsse harmonieren perfekt in der Kombination mit den weicheren und süßlichen Trockenfrüchten. (Mischung aus 47 % Nüssen und 53 % Trockenfrüchten im Mehrwegglas.)', 'Weiling GmbH', 'bioladen', 'GERMANY', '3176f514-2c5d-4d0b-99f8-d4f4cef86385', 'manager', '2021-08-12 17:56:54', 'System', '2023-10-14 02:08:40', 1501, 977, 0, NULL, 0, 3.74, 'Weiling', 0, NULL, 0, 62, 'Weinbeeren* geölt (Weinbeeren*, Sonnenblumenöl*), Sultaninen* geölt (Sultaninen*, Sonnenblumenöl*), CASHEWKERNE*, HASELNUSSKERNE*, MANDELN* blanchiert, WALNUSSKERNE* halbe *aus kontrolliert ökologischer Erzeugung', '2022-11-29 15:54:38', 953.694, 'MUISLI_FLAKES_NUTS', 'PANTRY', 521, 12.6, 'VEGAN;VEGETARIAN', NULL, NULL),
(908, 'Kerniger Nuss-Mix im Pfandglas (Weiling)', '4035661162992', 0, 7.99, 1, 1, NULL, 0, '506067', 'Kerniger Nuss-Mix im Pfandglas', 'Ein toller Nuss-Mix bei dem die etwas süßlichen und milderen Nüsse wie Cashewkerne, Mandeln und Paranusskerne auf die etwas aromatisch herberen Nüssen wie Haselnusskerne und Walnusskerne treffen. (Im Mehrwegglas.)\n', 'Weiling GmbH', 'bioladen', 'GERMANY', '0c604340-3b76-40c5-bdd3-3bf61cb800b8', 'manager', '2021-08-12 18:00:09', 'System', '2023-10-14 02:07:17', 482, 978, 0, NULL, 0, 4.99, 'Weiling', 0, NULL, 0, 62, 'CASHEWKERNE*, HASELNUSSKERNE*, HASELNUSSKERNE geröstet*, MANDELN*, PARANUSSKERNE*, WALNUSSKERNE* halbe *aus kontrolliert ökologischer Erzeugung', '2022-11-29 15:53:48', 953.694, 'MUISLI_FLAKES_NUTS', 'PANTRY', 511, 12.6, 'VEGAN;VEGETARIAN', NULL, NULL),
(909, 'Mandelmus 500ml (Weiling)', '4035626112710', 0, 15.49, 1, 1, NULL, 0, '515618', 'Mandelmus 500ml', 'Süßlich-herb; mit Samenschalen vermahlen. Eignet sich hervorragend für verschiedenste Rezeptideen.\n', 'Weiling GmbH', 'bioladen', 'NETHERLANDS', 'b2143cc4-87f2-4153-8a92-a7b73a341dea', 'manager', '2021-08-12 18:04:54', 'System', '2023-10-14 02:12:37', 493, 1808, 0, NULL, 0, 9.36, 'Weiling', 0, NULL, 0, 120, 'geröstete MANDELN* *aus kontrolliert ökologischer Erzeugung', '2023-05-02 12:27:01', 903.125, 'SPREADS_HONEY', 'PANTRY', 765, 12.5, 'VEGAN;VEGETARIAN', NULL, NULL),
(910, 'Hafer 0% Zucker Drink (Weiling)', '4016249225100', 1, 2.29, 1, 1, NULL, 0, '598622', 'Hafer 0% Zucker Drink', 'Durch seinen frischen, leichten Geschmack und wenig Süße ist unser Hafer Drink besonders geeignet für Müslis, Smoothies oder zum Kochen & Backen. Er ist rein pflanzlich und nur aus natürlichen Bio Zutaten.\n\nWir beziehen unseren Hafer aus nachhaltigem Anbau von Bio-Landwirten aus Italien.', 'Allos Hof-Manufaktur GmbH', 'Allos', 'ITALY', 'd89f4ab4-688d-4079-a1e8-f07865923f63', 'manager', '2021-08-12 18:08:50', 'System', '2023-11-25 02:10:13', 2158, 980, 0, NULL, 0, 1.38, 'Weiling', 0, NULL, 0, 103, 'Wasser, HAFER* (11 %), Sonnenblumenöl*, Meersalz. *aus ökologischem Landbau.', '2022-08-10 00:01:24', 1078.27, 'PRESERVED_MILK_DRINKS', 'FRESH;PANTRY', 1063, 20.8, 'VEGAN;VEGETARIAN', NULL, NULL),
(911, 'Agavendicksaft 250 ml (Weiling)', '4016249696122', 0, 4.59, 1, 1, NULL, 0, '610050', 'Agavendicksaft 250 ml', 'Für ein Glas Honig fliegen Bienen etwa dreimal um die Erde. An die Bienen sagen wir deshalb ein dickes DANKE SCHÖN. Und an euch geht ein süßes BITTE SEHR! Lasst euch den Honig schmecken - und natürlich auch unseren Agavendicksaft. Der Honig kommt mit ganz viel gesunden Nährstoffen, die die Bienen bei den Pflanzen mit aufnehmen. Und unser Agavendicksaft bietet ganz viel natürliche Süße. Normalerweise gehen wir bei Allos ja auch gerne die Extrameile für besondere Qualität. Aber bei Honig&Agavendicksaft haben wir nichts hinzuzufügen. Punkt.', 'Allos Hof-Manufaktur GmbH', 'Allos', 'NETHERLANDS', '9b818d72-d0b6-470d-afee-3af301fb8f54', 'manager', '2021-08-12 18:10:52', 'System', '2024-02-03 02:09:39', 350, 1809, 0, NULL, 0, 0, 'Weiling', 0, NULL, 0, 120, 'Agavendicksaft*. *aus ökologischem Anbau.', '2022-06-14 02:10:55', 413.658, 'BAKING_INGREDIENTS;SPICES_COOKING_HELP', 'PANTRY', 512, 14.7, 'VEGAN;VEGETARIAN', NULL, NULL),
(912, 'Erbsensuppe mit Würstchenscheiben (Weiling)', '4031829232101', 0, 3.49, 1, 1, NULL, 0, '620805', 'Erbsensuppe mit Würstchenscheiben', 'Erbsen gehören zu den ältesten Kulturpflanzen der Menschheit, sie haben ihren Ursprung im Orient. Erbsen sind ein ganz besonderes Gemüse – mit ihnen liefert unsere Ökoland Erbsensuppe wertvolles Eiweiß! Unsere Erbsen werden schonend zubereitet, gemeinsam mit typischem Suppengemüse und traditionellen Gewürzen perfekt abgeschmeckt. Und dann geben wir – für den herrlich herzhaften Geschmack – unsere original Ökoland Würstchenscheiben dazu!', 'Ökoland GmbH Nord', 'ÖKOLAND', 'GERMANY', '060abda4-534f-437f-aefb-f2527ac16f0f', 'manager', '2021-08-12 18:16:36', 'System', '2023-12-15 02:34:17', 662, 982, 0, NULL, 0, 1.99, 'Weiling', 0, NULL, 0, 63, 'Trinkwasser, 23% Erbsen*, Fleisch* (Schwein*, Rind*), Kartoffeln*, Karotten*, Lauch*, Zwiebeln*, Sonnenblumenöl*,  SELLERIE*, Steinsalz, Maisstärke*, Meersalz, Verdickungsmittel: Guarkernmehl*; Rohrohrzucker*, Gewürze* (Macis*, Curcuma*, Pfeffer*, Ingwer*, Knoblauch*, Koriander*, Kümmel*), Kräuter* (Liebstöckel*, Petersilie*, Rosmarin*, Oregano*), Dextrose*, Schafsaitling, Rauch.  *aus kontrolliert ökologischer Erzeugung', '2022-05-24 10:43:34', 586.19, 'CONVENIENCE_PRESERVES', 'PANTRY', 452.39, 11, 'PALMOILFREE', NULL, NULL),
(913, '100% Naturreisnudeln (Weiling)', '8713576282504', 0, 3.99, 1, 1, NULL, 0, '645244', '100% Naturreisnudeln', 'Diese herrlichen, glutenfreien Nudeln werden aus biologischem Naturreis und  Wasser hergestellt. Sonst nichts. Sie schmecken herrlich, sind in 5 Minuten gar  und passen perfekt zu Gemüsegerichten, Meeresalgen, Fleisch, Fisch und  japanischen Würzmitteln wie Miso, Tamari und Sesamöl. Hiermit kannst du im  Handumdrehen ein leckeres asiatisches Gericht auf den Tisch bringen. Erhältlich  in fünf weiteren glutenfreien Varianten aus Reis oder Buchweizen.', 'TerraSana Natuurvoeding BV', 'TerraSana', 'CHINA', 'a872b1d3-6620-4ea4-b223-f9c901b24d02', 'manager', '2021-08-12 18:46:47', 'System', '2024-01-16 02:06:28', 1404, 983, 0, NULL, 0, 2.5, 'Weiling', 0, NULL, 0, 506, 'Reismehl aus Vollkornreis*, Wasser *aus kontrolliert ökologischer Erzeugung', '2023-09-28 02:08:34', 571.2, 'PASTA_CEREALS_LEGUMES', 'PANTRY', 253, 28, 'VEGAN;VEGETARIAN;GLUTENFREE', NULL, NULL),
(914, 'Bio Hund Trockenfutter getreidefrei Vegetarisch (Weiling)', '8714265000423', 0, 17.99, 1, 1, NULL, 0, '651033', 'Bio Hund Trockenfutter getreidefrei Vegetarisch', 'Vegetarisches und getreidefreies Trockenfutter mit Bio-Sojabohnen, Erbsen, Tapioka, weißer Lupine und Meeresalgen für ausgewachsene Hunde. Das Bio-Hundefutter ist eine vollwertige, nahrhafte und sehr schmackhafte Mahlzeit, hergestellt aus den besten vegetarischen Zutaten. Reines Bio-Futter und somit ohne Zusatz von chemische Duft-, Farb- und Geschmacksstoffe, Pestizide und GVO. Die besten resorbierbaren pflanzlichen Proteine wurden ausgewählt. So bekommt Ihr Hund genau das, was er braucht.', 'Yarrah Organic Petfood B.V.', 'Yarrah Organic Petfood', 'NETHERLANDS', '8e34c09c-df17-4bed-8d8a-a3de03b76fe1', 'manager', '2021-08-12 18:47:52', 'System', '2023-10-26 02:06:11', 842, 984, 0, NULL, 0, 12.99, 'Weiling', 0, NULL, 0, 120, 'Sojabohnen*, grüne Erbsen*, Tapioka*, Kokosfett*, \nLupine*, Sonnenblumenkernschalen*, Mineralstoe, Bierhefe, \nBaobab*, Erbsenprotein*, Meeresalgen*.  \n* = biologisch *aus kontrolliert ökologischer Erzeugung', '2022-10-20 02:04:38', 8112, 'ANIMAL_FOOD', 'DRUGSTORE', 2035, 39, 'VEGETARIAN', NULL, NULL),
(915, 'bioladen Datteln entsteint 500 g (Weiling)', '4035626110778', 0, 4.99, 1, 1, NULL, 0, '676018', 'bioladen Datteln entsteint 500 g', 'Die Süße und der honigartiger Geschmack unserer bioladen*Datteln wertet viele Gerichte auf. Auch fürs Backen oder für Müslis eignen sich Datteln hervorragend.\n', 'Weiling GmbH', 'bioladen', 'GERMANY', '819bc2d7-5b88-4cd0-aacf-09926f6076e3', 'manager', '2021-08-12 18:49:44', 'System', '2024-01-06 02:05:53', 459, 1810, 0, NULL, 0, 3.3, 'Weiling', 0, NULL, 0, 60, NULL, '2022-04-30 00:01:55', 1134, 'CONVENIENCE_PRESERVES;MUISLI_FLAKES_NUTS', 'PANTRY', 505, 21, 'VEGAN;VEGETARIAN', NULL, NULL),
(916, 'Pflaumen aus Frankreich, getrocknet & entsteint (Weiling)', '4035626114653', 0, 5.49, 1, 1, NULL, 0, '676021', 'Pflaumen aus Frankreich, getrocknet & entsteint', 'Unsere bioladen*Pflaumen stammen von dem Erzeuger La Compagnie des Pruneaux aus dem Süden Frankreichs. Das Unternehmen besitzt und baut die Pflaumen auf einer 120 ha großen Fläche an. Zusätzliche Mengen werden von befreundeten Bio-Bauern aus der Nähe bezogen.  Der Erzeuger besitzt ein eigenes Bienenprogramm welches jedes Jahr dafür sorgt, dass die Blüten die nötige Bestäubung erhalten. Geerntet werden die Pflaumen in der Regel von Mitte August bis Mitte September.', 'Weiling GmbH', 'bioladen', 'FRANCE', 'ba1fabc4-42f2-4925-b12e-41bd7f4d283f', 'manager', '2021-08-12 18:50:50', 'System', '2023-11-08 02:12:16', 463, 986, 0, NULL, 0, 4.24, 'Weiling', 0, NULL, 0, 54, NULL, '2022-04-11 15:16:58', 900, 'CONVENIENCE_PRESERVES;MUISLI_FLAKES_NUTS', 'PANTRY', 250, 15, 'VEGAN;VEGETARIAN', NULL, NULL),
(917, 'Bananenchips geröstet & gesüßt im Pfandglas (Weiling)', '4035661162978', 0, 3.99, 1, 1, NULL, 0, '676025', 'Bananenchips geröstet & gesüßt im Pfandglas', 'Unsere bioladen*Bananenchips sind geröstet und gesüßt. Sie eignen sich perfekt zum Naschen für zwischendurch und in Müslis. (Im Mehrwegglas.)', 'Weiling GmbH', 'bioladen', 'GERMANY', '54db75fb-3558-433d-a3d3-5b2d822128bf', 'manager', '2021-08-12 18:51:59', 'System', '2023-10-14 02:09:40', 448, 987, 0, NULL, 0, 2.18, 'Weiling', 0, NULL, 0, 62, 'Bananen* (68%), Kokosnussöl*, Rohrohrzucker*,  Honig* *aus kontrolliert ökologischer Erzeugung', '2022-04-11 15:16:56', 953.694, 'CONVENIENCE_PRESERVES;MUISLI_FLAKES_NUTS', 'PANTRY', 411, 12.6, 'VEGETARIAN', NULL, NULL),
(918, 'Biofix Tomatensuppe (Weiling)', '4260133142206', 0, 1.79, 1, 1, NULL, 0, '260738', 'Biofix Tomatensuppe', 'Beltane Biofix Suppenmahlzeiten – nicht nur zur kalten Jahreszeit eine einfache, gelingsichere Stärkung. Fruchtige Tomate, Duft und Wärme satt aus der Beltane Suppenküche.\nBeltane Biofix Tomatensuppe, ist ganz einfach und schmeckt genial. Tomate, frische Karotten dazu und jeder kommt genüsslich auf seinen Geschmack.', 'Beltane Naturkost GmbH', 'Beltane', 'GERMANY', '304d7623-230a-4805-992f-ba300bc8c24e', 'manager', '2021-08-12 18:53:44', 'System', '2023-01-16 18:25:51', 443, 988, 0, NULL, 0, 1.12, 'Weiling', 0, NULL, 0, 63, 'Würzmischung 1 zum Anbraten:\nSteinsalz, Knoblauch*, Koriander*, Oregano*, Bohnenkraut*, Rosmarin*, Zimt*\n Würzmischung 2 zum Garen:\nSteinsalz, Reismehl*, Roh-Rohrzucker*, Kartoffelstärke*, Zwiebeln*, Paprika*, SELLERIE*, Karotten*, Basilikum*, Liebstöckel*, Salbei*, Majoran*, Sonnenblumenöl*, Pfeffer*, Trennmittel: Siliciumdioxid *aus kontrolliert ökologischer Erzeugung', '2022-10-18 02:05:03', 259.875, 'CONVENIENCE_PRESERVES;SPICES_COOKING_HELP', 'PANTRY', 43, 16.5, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE;PALMOILFREE', NULL, NULL),
