(922, 'Compostella Kompostierbare Alternativen (Weiling)', '4007749702338', 1, 5.49, 1, 1, NULL, 0, '892050', 'Compostella Kompostierbare Alternativen', 'Für den ökologisch orientierten Haushalt gibt es jetzt eine Alternative aus Papier, die viele Küchenfolien sowie silikonbeschichtetes Backpapier ersetzt. Das Papier ist von Natur aus fettdicht, hitzebeständig bis 220°C, lebensmittelecht, geruchsneutral, geschmacksneutral und innerhalb 12-14 Tagen kompostierbar. Lebensmittel, die mit 1 für 4 Papier verpackt sind, schimmeln praktisch nie, da das Papier offenporig und damit atmungsaktiv ist. ', 'Compostella GmbH', 'Compostella', 'GERMANY', '8679de92-fbee-4cd5-a6b0-255ee1e83836', 'manager', '2021-08-13 08:16:26', 'System', '2024-02-14 02:11:52', 343, 991, NULL, NULL, 0, 3.12, 'Weiling', 0, NULL, 0, NULL, NULL, '2022-11-29 15:41:12', 789.75, 'HOUSEHOLD', 'OTHER', 220, 39, 'VEGAN;VEGETARIAN', NULL, NULL),
