(924, 'Ungesüßte Banane-Nuss-Müsli (Weiling)', '4016249236892', 0, 3.99, 1, 1, NULL, 0, '481164', 'Ungesüßte Banane-Nuss-Müsli', 'Es kommt nicht oft vor, dass man etwas weglassen kann, ohne dass einem etwas fehlt.\nWir haben das Gefühl, bei unseren ungesüßten Müslis ist uns das gelungen. Was denkt\nihr? Ohne zugesetzten Zucker lassen sie nichts vermissen, was man von einem richtig\nguten Müsli erwartet: 100% Bio, absolut lecker, wirklich ballaststoffreich, voller\nVollkornflocken. Dem haben wir nichts hinzuzufügen – außer: Guten Appetit!', 'Allos Hof-Manufaktur GmbH', 'Allos', 'GERMANY', '4b544a34-489e-4fed-a8cc-106b6ca267ec', 'manager', '2021-08-13 17:36:51', 'System', '2023-06-26 10:01:08', 590, 992, 0, NULL, 0, 3, 'Weiling', 0, NULL, 0, 60, 'HAFERVOLLKORNFLOCKEN* (25%), WEIZENVOLLKORNFLOCKEN* (19%), GERSTENVOLLKORNFLOCKEN* (15%), Rosinen* (14%), ROGGENVOLLKORNFLOCKEN* (8%), geröstete WEIZENVOLLKORNFLAKES* (7%), Bananenchips* (6%) (Bananen*, Kokosöl*), SOJAFLOCKEN* (2%), WEIZENVOLLKORNFLAKES* (2%) (WEIZENVOLLKORNMEHL*), Sonnenblumenkerne* (2%), HASELNÜSSE* gehackt und geröstet (2%), Sonnenblumenöl*. *aus ökologischem Landbau.', '2022-08-10 00:09:24', 1658.8, 'MUISLI_FLAKES_NUTS', 'PANTRY', 509, 22, 'VEGAN;VEGETARIAN', NULL, NULL),
