(927, 'Allesreiniger  (Weiling)', '4007547304000', 1, 5.49, 1, 1, NULL, 0, '784019', 'Allesreiniger ', 'Die verwendeten waschaktiven Stoffe weisen in ihrer Kombination eine ausgesprochen gute Hautverträglichkeit auf. Der Allesreiniger ist, wie alle unsere Produkte, hochkonzentriert und daher sehr ergiebig.\n\n• Reinigt und pflegt alle abwischbaren Flächen: Böden, Fliesen, Fenster, Bad- und Küchenmöbel,  Sanitäreinrichtungen\n\n• Frischer natürlicher Duft von Orangen- und Bio-Lemongrassöl\n\n• 100 % biologisch abbaubar\n\n• Erhältlich: 0,5 Liter, 1 Liter, 10 Liter, 20 Liter', 'Sonett GmbH', 'SONETT', 'GERMANY', '1868eccb-88ad-4347-8a64-cbe3da700116', 'manager', '2021-08-13 19:44:41', 'System', '2023-10-13 02:17:12', 354, 995, NULL, NULL, 0, 2.99, 'Weiling', 0, NULL, 0, NULL, NULL, '2022-07-12 14:24:36', 1572.1, 'CLEANING', 'DRUGSTORE', 1050, 26.7, 'VEGAN;VEGETARIAN', NULL, NULL),
