(929, 'Badreiniger (Weiling)', '4007547301504', 1, 4.99, 1, 1, NULL, 0, '784020', 'Badreiniger', 'Bequem in der Anwendung: Einfach aufsprühen, kurz einwirken lassen, abspülen oder leicht abwischen, und ein blitzblankes Ergebnis, bei einwandfreier ökologischer Qualität und 100 % biologischer Abbaubarkeit.\n\n• Für Sauberkeit und Glanz auf Duschwänden, Fliesen, Badewannen, Armaturen, Edelstahl und Waschbecken aus Keramik, Acryl und Glas\n•Entfernt gründlich Kalkbeläge, Wasserflecken und Seifenreste\n• Duftneutral\n• 100 % biologisch abbaubar\n\n\n• Erhältlich: 0,5 Liter, 1 Liter, 10 Liter', 'Sonett GmbH', 'SONETT', 'GERMANY', '48a5d781-1ba2-45cd-83ab-e5c543dcf90d', 'manager', '2021-08-13 19:45:01', 'System', '2023-04-27 02:09:55', 381, 996, NULL, NULL, 0, 1.9, 'Weiling', 0, NULL, 0, NULL, NULL, '2022-07-12 14:24:48', 1135.68, 'CLEANING', 'DRUGSTORE', 557, 26, 'VEGAN;VEGETARIAN', NULL, NULL),
