(931, 'Basische Körperlotion (Weiling)', '4260651311108', 1, 11.99, 1, 1, NULL, 0, '757044', 'Basische Körperlotion', 'FITNE Basische Körperlotion unterstützt die Säure-Basen-Balance\nund das natürliche Gleichgewicht der Haut. Die wertvolle Formulierung\nmit pflanzlichen, kontrolliert biologischen Ölen und Extrakten\nwie Mandelöl, Aprikosenkernöl, Sheabutter und Aloe Vera Extrakt\nversorgt die Haut mit Feuchtigkeit und pflegt intensiv trockene und\ngereizte Haut. Für die tägliche Pflege nach Anwendung des FITNE\nBasen Bades oder der FITNE Basen Dusche.', 'FITNE Health Care GmbH', 'Fitne', 'GERMANY', '99a66e0f-9c6d-4902-8c79-967ec0eb8b89', 'manager', '2021-08-13 19:45:27', 'System', '2023-10-13 02:23:09', 390, 998, NULL, NULL, 0, 5.38, 'Weiling', 0, NULL, 0, NULL, NULL, '2022-04-11 14:58:06', 427.5, 'BODY_CARE', 'DRUGSTORE', 230, 17.1, 'VEGAN;VEGETARIAN', NULL, NULL),
