(938, 'Flächendesinfektion Nachfüller (Weiling)', '4007547303201', 1, 10.99, 1, 1, NULL, 0, '784029', 'Flächendesinfektion Nachfüller', 'Rein pflanzliche Inhaltsstoffe  zeichnen dieses Flächendesinfektionsmittel aus, das eine echte Alternative darstellt zu den bekannten Mitteln aus synthetischen Wirkstoffen mit ihren problematischen Nebenwirkungen. Seit Jahrhunderten wird Alkohol für die Desinfektion verwendet und bis heute sind keine Mikroorganismen bekannt, die gegen Alkohol resistent sind.\n\n• Für die Desinfektion von Arbeitsflächen und Geräten in Küche, Lebensmittelverarbeitung, Sanitärbereich, Praxen etc.\n• Geprüfte Wirksamkeit gegen alle behüllten Viren, Grippeviren, H1N1, H5N1, Herpes, HIV, Coronaviren, Noroviren, MRSA- und ESBL-Keime sowie gegen Pilze, Hefen und Bakterien wie Salmonellen, Colibakterien etc.\n\n\n• Erhältlich: 100 ml, 0,5 Liter, 1 Liter, 10 Liter', 'Sonett GmbH', 'SONETT', 'GERMANY', '02c77e49-47fe-408b-9d4e-640104ff75e3', 'manager', '2021-08-13 19:46:38', 'System', '2023-10-13 02:16:58', 681, 1001, NULL, NULL, 0, 6.25, 'Weiling', 0, NULL, 0, NULL, NULL, '2023-01-24 12:03:49', 1572.1, 'CLEANING', 'DRUGSTORE', 1050, 26.7, 'VEGAN;VEGETARIAN', NULL, NULL),
