(940, 'Fleckenspray (Weiling)', '4007547200005', 1, 3.99, 1, 1, NULL, 0, '784075', 'Fleckenspray', 'Bio-Panamarindenextrakt und Zuckertensid ergeben in der Kombination ein hoch effektives und zugleich schonendes Mittel zur Fleckentfernung, das auch für empfindliche Textilien, Wolle und Seide bestens geeignet ist.\n\n• Mit Bio-Panamarinde\n• Für empfindliche Textilien aus Wolle und Seide\n• Wirksam gegen Flecken von Obst, Kakao, Kugelschreiber, Fett etc.\n• 100 % biologisch abbaubar\n\n• Erhältlich:100 ml', 'Sonett GmbH', 'SONETT', 'GERMANY', '09ea3c59-b39d-4d03-b249-9425ed553360', 'manager', '2021-08-13 19:46:59', 'System', '2023-10-18 02:06:58', 683, 1003, NULL, NULL, 0, 1.85, 'Weiling', 0, NULL, 0, NULL, NULL, '2022-07-12 14:26:52', 247, 'CLEANING', 'DRUGSTORE', 123, 13, 'VEGAN;VEGETARIAN', NULL, NULL),
