(968, 'Öko-Spülschwamm (Weiling)', '4007547605008', 1, 3.39, 1, 1, NULL, 0, '784081', 'Öko-Spülschwamm', 'Ein Spülschwamm, der den höchstmöglichen Anteil an regenerativen, biologisch abbaubaren Rohstoffen enthält. Die Schwammseite besteht aus 100 % Cellulose, die Scheuerseite aus 60 % Sisal und 40% Recycling PET – verbunden mit hoher Haltbarkeit und angenehmer Haptik.\n\n• Aus Cellulose, Sisalfasern und Recycling PET\n• Kratzfreier Schwamm, waschbar bis 60°C\n• Auch für empfindliche Gläser, Edelstahl und Oberflächen mit Lotoseffekt geeignet\n\n• Erhältlich: 2er Pack', 'Sonett GmbH', 'SONETT', 'ITALY', '10f3c29d-cdb7-44c8-bca2-fe44875f251b', 'manager', '2021-08-13 19:52:08', 'System', '2023-04-27 02:08:53', 1377, 1021, NULL, NULL, 0, 1.83, 'Weiling', 0, NULL, 0, NULL, NULL, '2023-05-26 10:09:47', 522, 'HOUSEHOLD;CLEANING', 'DRUGSTORE', 39, 14.5, 'VEGAN;VEGETARIAN', NULL, NULL),
(969, 'Olivenwaschmittel f. W+S sensitiv 20-40°C (Weiling)', '4007547305403', 1, 5.99, 1, 1, NULL, 0, '784047', 'Olivenwaschmittel f. W+S sensitiv 20-40°C', 'Wertvolles gepresstes Olivenöl wird im duftfreien Sonett Olivenwaschmittel sensitiv zu einer Seife verarbeitet, die für Textilien aus Wolle und Seide hervorragende reinigende, pflegende und rückfettende Eigenschaften besitzt. Mit Hilfe des Zuckertensids entsteht ein Feinwaschmittel auf Seifengrundlage, das auch bei hartem Wasser leicht handhabbar ist und alle positiven Eigenschaften eines Seifenwaschmittels beibehält. Das Olivenöl und Rapsöl / Sonnenblumenöl kommen zu 100 % aus kontr. biol. Anbau.\n\nMit reiner Bio-Olivenölseife\n\nHinweise für Allergiker: \n• Rein pflanzliche Tenside \n• Ohne petrochemische Inhaltsstoffe \n• Ohne Duftstoffe, Farbstoffe, Komplexbildner\n• Ohne Konservierungsmittel\n• Ohne Enzyme, ohne Gentechnik\n• 100 % biologisch abbaubar\n\n\n• Erhältlich: 1 Liter', 'Sonett GmbH', 'SONETT', 'GERMANY', '4e4db98c-adfc-4b98-91c1-3d28ba19b2be', 'manager', '2021-08-13 19:52:19', 'System', '2024-02-14 02:08:41', 1472, 1022, NULL, NULL, 0, 4.41, 'Weiling', 0, NULL, 0, NULL, NULL, '2022-10-31 00:02:35', 1572.1, 'CLEANING', 'DRUGSTORE', 1050, 26.7, 'VEGAN;VEGETARIAN', NULL, NULL),
(970, 'Teefilter Gr. 4 (Weiling)', '4012346628509', 1, 3.29, 1, 1, NULL, 0, '871012', 'Teefilter Gr. 4', 'Teefilter aus ungebleichtem Papier, kompostierbar.', 'Ulrich Walter GmbH', 'LEBENSBAUM', 'Diepholz, Niedersachsen', '7c419780-a63e-453f-88f6-9a225808e924', 'correction', '2021-09-08 18:59:25', 'System', '2023-07-08 02:13:19', 1162, 208, NULL, NULL, 0, 1.76, 'Weiling', 2, 1, 0, NULL, NULL, '2023-02-02 09:43:55', 750.2, 'TEA;HOUSEHOLD', 'COFFEE_TEA_COCOA;DRUGSTORE', 99, 22, 'VEGAN;VEGETARIAN', NULL, NULL),
(971, 'Scheuermilch (Weiling)', '4007547400009', 1, 3.99, 1, 1, NULL, 0, '784036', 'Scheuermilch', 'Die Sonett Scheuermilch basiert auf reinem Kalkmehl und ist äußerst sanft und schonend im Gebrauch. Durch die natürliche Lavendel-Citrus-Ölmischung wird eine leicht keimhemmende Wirkung erzielt.\n\n• Zur milden Reinigung von Edelstahl, Emaille, Kunststoff, Glaskeramik, Silber\n\n• Frischer Duft von ätherischem Lemongrassöl aus kontrolliert biologischem Anbau\n\n• 100 % biologisch abbaubar\n\n• Erhältlich: 0,5 l', 'Sonett GmbH', 'SONETT', 'GERMANY', '25dffa48-921e-4388-ba37-c06fe5d55b79', 'manager', '2021-08-13 19:52:38', 'System', '2023-04-27 02:09:14', 1059, 1023, NULL, NULL, 0, 2.2, 'Weiling', 0, NULL, 0, NULL, NULL, '2022-07-12 14:25:31', 855.692, 'CLEANING', 'DRUGSTORE', 535, 26.2, 'VEGAN;VEGETARIAN', NULL, NULL),
(972, '5 Stck. memo Schwammtücher sortiert (Weiling)', '4039468005193', 1, 2.99, 1, 1, NULL, 0, '895120', '5 Stck. memo Schwammtücher sortiert', '- natürliche Rohstoffe\n- ohne Synthetikgitter und künstliche Feuchtmacher\n- 100 % verrottbar nach EMPA-Test\n- scheuerfest, fusselfrei und waschmaschinengeeignet\n- ca. 17 x 19,5 cm\n- 1 Pack. = 5 Tücher (2 x gelb, 2 x blau, 1 x grün)', 'memo AG', 'memo AG', 'EUROPEAN_UNION', '3b7e9d3d-22af-46e4-844e-924214f55015', 'manager', '2021-08-13 19:52:50', 'System', '2023-01-16 18:29:34', 1044, 1024, NULL, NULL, 0, 1.61, 'Weiling', 0, NULL, 0, NULL, NULL, '2022-08-25 02:03:35', 340, 'HOUSEHOLD;CLEANING', 'DRUGSTORE', 58, 20, 'VEGAN;VEGETARIAN', NULL, NULL),
(973, 'Bio Bubbles Bio Seifenblasen (Weiling)', '4007547207004', 1, 2.29, 1, 1, NULL, 0, '780455', 'Bio Bubbles Bio Seifenblasen', 'Die ersten Seifenblasen mit Rohstoffen in Bioqualität, mit natürlichem Schellack für schöne, farbige und langlebige Seifenblasen.\n\nEin Spielzeug für draußen zur Freude großer und kleiner Menschen. Die Seifenblasen können durch drei verschieden große Blasringe gepustet werden und sind nach CE Sicherheitsstandard getestet.\n\n• Erhältlich: 45 ml Döschen mit 3-fach Blasring, 0,5 l Nachfüllflasche', 'Sonett GmbH', 'SONETT', 'GERMANY', 'a01542d0-114f-425a-bf4d-56ee2d23d258', 'manager', '2021-08-13 19:53:01', 'System', '2023-10-13 02:19:28', 1038, 1025, NULL, NULL, 0, 1.22, 'Weiling', 0, NULL, 0, NULL, NULL, '2022-11-29 16:56:33', 116.375, 'OTHER', 'DRUGSTORE', 59, 9.5, NULL, NULL, NULL),
(974, 'Slipeinlage Geformt 30 St (Weiling)', '0782126003065', 1, 2.79, 1, 1, NULL, 0, '830406', 'Slipeinlage Geformt 30 St', 'Natracare Slipeinlagen Geformt aus natürlichen und biologischen Materialien sind atmungsaktiv, sanft zur Haut und fügen sich dank ihres gerformten Schnitts ideal  in die Unterwäsche ein. Für täglichen Schutz und Frische. Die Einlagen enthalten keine Farb- oder Duftstoffe, sind absolut chlorfrei, plastikfrei, biologisch abbaubar und kompostierbar.', 'Bodywise (UK) Ltd.', 'Natracare', 'SWEDEN', 'bd6dea65-68b3-4072-861e-0a0a637a24e1', 'manager', '2021-08-13 19:53:12', 'System', '2023-07-01 00:21:27', 1021, 1026, NULL, NULL, 0, 1.69, 'Weiling', 0, NULL, 0, NULL, NULL, '2022-07-12 14:17:23', 1064, 'BODY_CARE', 'DRUGSTORE', 105, 16, 'VEGAN;VEGETARIAN', NULL, NULL),
(975, 'Slipeinlagen ultra dünn (Weiling)', '782126003096', 1, 3.19, 1, 1, NULL, 0, '830404', 'Slipeinlagen ultra dünn', 'Natracare ultra dünne Slipeinlagen aus natürlichen und biologischen Materialien sind atmungsaktiv und sanft zur Haut. Die Einlagen bestehen aus einer pflanzenbasierten, auslaufsicheren Schicht sowie einer dünnen Schicht GOTS zertifizierter Biobaumwolle. Sie enthalten keine Farb- oder Duftstoffe, sind absolut chlorfrei, plastikfrei, biologisch abbaubar und kompostierbar.', 'Bodywise (UK) Ltd.', 'natracare', 'Vereinigtes Königreich Großbritannien und Nordirland', NULL, 'correction', '2021-08-17 08:07:27', 'manager', '2023-02-27 14:48:08', 1020, NULL, NULL, NULL, 0, 1.62, 'Weiling', 0, NULL, 0, NULL, NULL, '2023-02-27 14:48:08', 362.88, 'BODY_CARE', 'DRUGSTORE', NULL, 16.8, 'VEGAN;VEGETARIAN', NULL, NULL),
(976, 'Bio Stilltee (Weiling)', '4001638095136', 0, 4.99, 1, 1, NULL, 0, '809513', 'Bio Stilltee', 'Wärme, Nähe und Geborgenheit machen aus Stillen mehr als nur eine Nahrungsaufnahme für Ihr Baby. Drei Tassen Weleda Stilltee pro Tag helfen, Ihren Flüssigkeitshaushalt auszugleichen und unterstützen so die Milchbildung und eine entspannte Stillzeit. Die ausgewählten Früchte von Bockshornklee, Anis, Kümmel, Fenchel und Zitronenverbenenblätter verleihen diesem Kräutertee seinen angenehm milden Geschmack. Alle Zutaten stammen aus kontrolliert biologischem Anbau.', 'Weleda AG', 'Weleda', 'GERMANY', '2ee074e7-1df1-447a-91a8-30afa67edfc1', 'manager', '2021-08-13 19:53:39', 'System', '2023-12-14 02:07:04', 979, 1027, 0, NULL, 0, 2.96, 'Weiling', 0, NULL, 0, 64, 'Bockshornkleesamen*, Anisfrüchte*, Fenchelfrüchte* (20%), Kümmelfrüchte*, Zitronenverbenenblätter* (15%). *aus biologischem Anbau', '2022-04-11 15:22:13', 647.14, 'TEA', 'COFFEE_TEA_COCOA', 95, 13.1, 'VEGAN;VEGETARIAN', NULL, NULL),
(977, 'Tabs für Geschirrspülmaschinen (Weiling)', '4007547402805', 1, 6.99, 1, 1, NULL, 0, '784037', 'Tabs für Geschirrspülmaschinen', 'Die Sonett Tabs enthalten Mineralien und vollständig biologisch abbaubare organische Bestandteile. Sie sind zu 100% aus mineralischen und pflanzlichen Rohstoffen hergestellt und enthalten keine Enzyme, keine aggressiven chlorhaltigen Bleichmittel, keine Phosphate und keine Duftstoffe.\n\nNur für Spülmaschinen geeignet mit einstellbarer Wasserenthärtung\n\n• Nicht geeignet für Silber, Bleikristall und handbemaltes Porzellan.\n\n• Wichtig für ein gutes Spülergebnis: Die Enthärtungsanlage des Geschirrspülers 8 °dH / 15 °fH höher einstellen als die tatsächliche Wasserhärte ist. Die Kammern für Regeneriersalz und Klarspüler sollten stets gefüllt sein.\n\n• Erhältlich in: 2 x 20 g Probenpackung, 500 g Karton (25 Tabs x 20 g), 800 Stück lose', 'Sonett GmbH', 'SONETT', 'GERMANY', '5b790477-9f6c-467c-a3c8-89d4ce66c5a6', 'manager', '2021-08-13 19:53:49', 'System', '2023-10-13 02:17:20', 965, 1028, NULL, NULL, 0, 4.36, 'Weiling', 0, NULL, 0, NULL, NULL, '2023-02-02 10:46:05', 1167.7, 'HOUSEHOLD;CLEANING', 'DRUGSTORE', 548, 15.9, 'VEGAN;VEGETARIAN', NULL, NULL),
