(980, 'memo 15x10 Taschentücher  (Weiling)', '4039468006039', 1, 3.29, 1, 1, NULL, 0, '830100', 'memo 15x10 Taschentücher ', '- Sanft zu Schnupfennasen und zur Umwelt\n- werden aus 100 % recycelten Papierfasern hergestellt\n- Durch den 4-lagigen Aufbau und den feinen Prägerand sind sie reißfest\n- Verpackt in einer wiederverschließbaren Folientasche mit 10 Tüchern\n- 1 Pack = 10 x 15 Stk.\n- Farbe weiß', 'memo AG', 'memo AG', 'GERMANY', '1e7bba93-ea7c-42c4-b595-261ea2deba05', 'manager', '2021-08-13 19:54:24', 'System', '2023-12-17 02:57:27', 958, 1029, NULL, NULL, 0, 1.94, 'Weiling', 0, NULL, 0, NULL, NULL, '2023-01-09 17:00:28', 1984.5, 'BODY_CARE;HOUSEHOLD', 'DRUGSTORE', 414, 27, NULL, NULL, NULL),
(981, 'Toilettenpapier 3-lagig (Weiling)', '4039468016243', 1, 6.99, 1, 1, NULL, 0, '830112', 'Toilettenpapier 3-lagig', '- Toilettenpapier 3-lagig\n- Weich und zugleich reißfest\n- aus 100 % recycelten Papierfasern hergestellt\n- Ohne Zusatz von optischen Aufhellern\n- Durch innovative Volumenprägung besonders weich und reißfest\n- Farbe weiß', 'memo AG', 'memo AG', 'GERMANY', '47903663-fb40-4fa1-b829-42ec7105acf9', 'manager', '2021-08-13 19:54:35', 'System', '2023-10-10 00:03:34', 952, 2127, NULL, NULL, 0, 3.95, 'Weiling', 0, NULL, 0, NULL, NULL, '2023-06-05 10:12:09', 10146, 'BODY_CARE;HOUSEHOLD', 'DRUGSTORE', 1102, 44.5, 'VEGAN;VEGETARIAN', NULL, NULL),
(982, 'Waschmittel Color Mint & Lemon 20-60°C (Weiling)', '4007547504004', 1, 6.99, 1, 1, NULL, 0, '784052', 'Waschmittel Color Mint & Lemon 20-60°C', 'Die besondere, energiesparende Sonett-Methode des Verseifens ohne Zufuhr von Energie und der Einsatz von Ölen und ätherischen Ölen zu 100 % aus kontrolliert biologischem Anbau sind wesentliche Qualitätsmerkmale des Waschmittels Color. Durch den Einsatz einer Kombination von Citraten und Seife ist bei allen Wasserhärten kein extra Enthärter notwendig.\n\n• Mit Bio-Pflanzenölseife, ohne Enzyme, ohne Gentechnik\n• Wäscht Farbiges schonend und gründlich\n• Für Outdoor- und Sportbekleidung  \n• Natürlich frischer Duft von Bio-Minzöl und Bio-Lemongrassöl  \n• 100 % biologisch abbaubar\n\n• Erhältlich: 120 ml, 1,5 Liter, 5 Liter, 10 Liter, 20 Liter', 'Sonett GmbH', 'SONETT', 'GERMANY', '02ab1045-eeab-4a91-9446-d1d227677a19', 'manager', '2021-08-13 19:54:52', 'System', '2024-02-14 02:08:18', 903, 1030, NULL, NULL, 0, 4.78, 'Weiling', 0, NULL, 0, NULL, NULL, '2022-07-12 14:26:27', 3278.02, 'CLEANING', 'DRUGSTORE', 1662, 27.1, 'VEGAN;VEGETARIAN', NULL, NULL),
(983, 'Waschmittel Lavendel 30-95°C (Weiling)', '4007547501003', 1, 9.99, 1, 1, NULL, 0, '784002', 'Waschmittel Lavendel 30-95°C', 'Die besondere Energie sparende Methode des Verseifens, der Einsatz von Ölen aus kontrol-liert biologischem Anbau und ein für Flüssig-Waschmittel ausgesprochen günstiges Verhältnis von Preis zu Waschleistung sind die hervorstechenden Merkmale dieses Produkts.\n\nBaustein 1 im Baukastensystem.\n\n• Mit Bio-Pflanzenölseife, ohne Enzyme, ohne Gentechnik\n• Hohe Waschkraft. Für bunte und weiße Wäsche geeignet. Im Baukastenprinzip mit Sonett Enthärter und Sonett Bleichkomplex\n• Zarter Duft von ätherischem Lavendelöl aus kontrolliert biologischem Anbau \n• 100 % biologisch abbaubar\n\nErhältlich: 120 ml, 2 Liter, 5 Liter, 10 Liter, 20 Liter', 'Sonett GmbH', 'SONETT', 'GERMANY', 'ec8c577a-b598-46b7-a21a-47e6c8b05696', 'manager', '2021-08-13 19:55:03', 'System', '2024-02-13 02:07:03', 902, 1031, NULL, NULL, 0, 6.06, 'Weiling', 0, NULL, 0, NULL, NULL, '2023-02-02 09:24:26', 3870.72, 'HOUSEHOLD;CLEANING', 'DRUGSTORE', 2165.5, 32, 'VEGAN;VEGETARIAN', NULL, NULL),
(984, 'Waschmittel Pulver Konzentrat 40-95°C (Weiling)', '4007547100916', 1, 12.99, 1, 1, NULL, 0, '784001', 'Waschmittel Pulver Konzentrat 40-95°C', '- Mit Bio-Pflanzenölseife, ohne Enzyme, ohne Gentechnik. \n\n- Für bunte und weiße Wäsche aus Baumwolle, \nLeinen, Hanf und Mischfasern. \n\n- Alle Öle stammen zu 100% aus kontrolliert biologischem Anbau. \n\n- 100% biologisch abbaubar.\n\n\nBaustein 1\nim Sonett-Baukastensystem\n\nErst durch das Baukastensystem, mit seiner separaten Dosierung der 3 Hauptbestandteile des Waschmittels:\n•waschaktive Substanzen,\n•Enthärter,\n•Bleichmittel,\nist eine optimale Nutzung der einzelnen Stoffe entsprechend dem Verschmutzungsgrad der Kleidung, der Härte des Wassers und dem ganz individuellen Bedürfnis nach dem Weißgrad der Wäsche, wirklich möglich.\nFür ein Seifenwaschmittel ist weiches Wasser unbedingte Voraussetzung. Durch das Baukastenprinzip ist somit die Grundlage geschaffen, die unübertroffenen Vorteile der Seife auch bei härterem Wasser nutzen zu können. Wir verzichten auf Rieselmittel, Füllstoffe, optische Aufheller, Phosphate, Enzyme.\n\n• Erhältlich: 1,2 kg, 2,4 kg, 10 kg\n\nKonzentrat im Baukastensystem mit 100% Bio-Seife', 'Sonett GmbH', 'SONETT', 'GERMANY', '70942dce-1cba-4097-a315-eb06927c2d91', 'manager', '2021-08-13 19:55:14', 'System', '2024-02-14 02:09:05', 901, 1032, NULL, NULL, 0, 8.27, 'Weiling', 0, NULL, 0, NULL, NULL, '2023-02-02 09:25:04', 4909.12, 'HOUSEHOLD;CLEANING', 'DRUGSTORE', 2539, 26.5, 'VEGAN;VEGETARIAN', NULL, NULL),
(985, 'Waschpulver Color sensitiv 20-60°C (Weiling)', '4007547102200', 1, 9.99, 1, 1, NULL, 0, '784084', 'Waschpulver Color sensitiv 20-60°C', 'Ein hochkonzentriertes Pulverwaschmittel für alles Bunte und Feine. Mit Bio-Panamarindenextrakt, der berühmt ist für seine effektive Flecklösekraft. Ohne Kalkbindemittel aus der Erdölchemie wie Polyasparaginsäure, ausschließlich mit dem natürlichen Salz der Zitronensäure. Für alle Wasserhärten, kein separater Enthärter nötig.\n\nmit Bio-Panamarinde und reiner Bio-Pflanzenseife\n\n• rasch und vollständig biologisch abbaubar\n• ohne Enzyme, ohne Gentechnik\n• ohne Petrochemie und Nanotechnik \n• frei von Duftstoffen\n• rein pflanzliche und mineralische Rohstoffe \n\n• Erhältlich: 1,2 kg, 10 kg', 'Sonett GmbH', 'SONETT', 'GERMANY', '34b02869-fd01-4bb1-81c5-4beba767b0b7', 'manager', '2021-08-13 19:55:26', 'System', '2024-02-14 02:08:23', 900, 1033, NULL, NULL, 0, 5.98, 'Weiling', 0, NULL, 0, NULL, NULL, '2022-10-31 00:03:30', 2964, 'CLEANING', 'DRUGSTORE', 1291, 19.5, 'VEGAN;VEGETARIAN', NULL, NULL),
(986, 'WC-Reiniger Zeder-Citronella (Weiling)', '4007547300101', 1, 4.19, 1, 1, NULL, 0, '784023', 'WC-Reiniger Zeder-Citronella', 'Aufgrund der guten Haftung des Produkts auf den WC-Beckenwänden wird die gesamte Wirkkraft voll ausgenutzt. Die Mischung ätherischer Öle mit Nadelbaumöl sorgt für eine wirksame Keimreduzierung und für frischen Duft.\n\n• Entfernt gründlich Schmutz, Urinstein, Kalkablagerungen\n\n• Duft von ätherischem Zedernholzöl aus kontrolliert biologischem Anbau\n\n• 100 % biologisch abbaubar\n\n• Erhältlich: 0,75 Liter, 10 Liter', 'Sonett GmbH', 'SONETT', 'GERMANY', '2c66258e-0c41-4c83-8a17-30e45bbb8a2c', 'manager', '2021-08-13 19:55:37', 'System', '2023-10-13 02:17:38', 899, 1034, NULL, NULL, 0, 2.23, 'Weiling', 0, NULL, 0, NULL, NULL, '2023-04-10 20:13:18', 1351.5, 'CLEANING', 'DRUGSTORE', 806, 26.5, 'VEGAN;VEGETARIAN', NULL, NULL);
