(987, 'Weichspüler Lavendel (Weiling)', '4019886016131', 1, 3.99, 1, 1, NULL, 0, '786003', 'Weichspüler Lavendel', 'Weichheit und Duft auf pflanzlicher Basis. \nÄtherische Öle aus Bio-Anbau verleihen der Wäsche eine duftige Lavendel-Frische. \nEntfernt Waschmittelrückstände sanft und fasertief.\nPflegt und glättet die Fasern.\nFür alle Faserarten geeignet.\nDie sehr gute Hautverträglichkeit ist dermatologisch bestätigt.', 'Sodasan Wasch- und Reinigungsmittel GmbH', 'sodasan', 'Niedersachsen', '4259c49d-a7de-486d-a24a-4aa5defa9b2a', 'manager', '2021-08-13 19:55:47', 'System', '2023-07-12 02:07:02', 897, 1035, NULL, NULL, 0, 1.96, 'Weiling', 0, NULL, 0, NULL, NULL, '2023-02-02 09:22:17', 1668.52, 'HOUSEHOLD;CLEANING', 'DRUGSTORE', 829, 20.2, 'VEGAN;VEGETARIAN', NULL, NULL),
(988, 'Weichspüler Limette (Weiling)', '4019886016162', 1, 3.99, 1, 1, NULL, 0, '786002', 'Weichspüler Limette', 'Weichheit und Duft auf pflanzlicher Basis. \nNatürliche Düfte verleihen der Wäsche eine belebende Limetten-Frische.  \nEntfernt Waschmittelrückstände sanft und fasertief.\nPflegt und glättet die Fasern.\nFür alle Faserarten geeignet. \nDie sehr gute Hautverträglichkeit ist dermatologisch bestätigt.', 'Sodasan Wasch- und Reinigungsmittel GmbH', 'sodasan', 'Niedersachsen', '6d952be1-ec85-4ead-83d6-96fb6885b0db', 'manager', '2021-08-13 19:55:57', 'System', '2023-07-12 02:07:20', 896, 1036, NULL, NULL, 0, 1.96, 'Weiling', 0, NULL, 0, NULL, NULL, '2023-02-02 09:22:59', 1668.52, 'HOUSEHOLD;CLEANING', 'DRUGSTORE', 829, 20.2, 'VEGAN;VEGETARIAN', NULL, NULL),
(989, 'Weichspüler Pfirsich-Frische (Weiling)', '4019886016063', 1, 3.99, 1, 1, NULL, 0, '786004', 'Weichspüler Pfirsich-Frische', 'Weichheit und Duft auf pflanzlicher Basis. \nNatürliche Düfte verleihen der Wäsche eine samtige Pfirsich-Frische.\nEntfernt Waschmittelrückstände sanft und fasertief.\nPflegt und glättet die Fasern. \nFür alle Faserarten geeignet.\nDie sehr gute Hautverträglichkeit ist dermatologisch bestätigt.', 'Sodasan Wasch- und Reinigungsmittel GmbH', 'sodasan', 'Niedersachsen', 'b0e4ddbb-09ea-4947-8f2a-56fe7b4189e3', 'manager', '2021-08-13 19:56:07', 'System', '2023-07-12 02:07:30', 895, 1037, NULL, NULL, 0, 1.96, 'Weiling', 0, NULL, 0, NULL, NULL, '2023-02-02 09:21:56', 1668.52, 'HOUSEHOLD;CLEANING', 'DRUGSTORE', 884, 20.2, 'VEGAN;VEGETARIAN', NULL, NULL),
(990, 'Men Deo Spray (Weiling)', '4260198094328', 1, 5.29, 1, 1, NULL, 0, '823056', 'Men Deo Spray', 'Refresh your day! Die milde Formulierung erfrischt zuverlässig ohne Aluminiumsalze und lässt deine Haut dabei atmen. Verbesserte neue Formulierung mit einem hochwertigem, desodorierendem Wirkstoffkomplex aus Bio-Muskatsalbeihydrolat, einer erlesenen Komposition aus 7 erlesenen Zutaten aus kontrolliert biologischem Anbau , Zitronensäuretriethylester, Zitronensäure, einer speziellen Parfümkomposition und Mikrosilber. Das Wichtigste auf einen Blick: Erfrischendes Deo Spray mit milder Formulierung ohne Aluminiumsalze COSMOS Organic zertifizierte Biokosmetik Wirkstoffkomplex mit Mikrosilber Vegan Inhalt: 75 ml', 'cosmondial GmbH & Co. KG', 'Benecos', 'Sulzbach am Main, BY', NULL, 'manager', '2021-08-14 13:43:53', 'manager', '2023-02-27 14:02:28', 1338, NULL, NULL, NULL, 0, 2.77, 'Weiling', 0, NULL, 0, NULL, 'AQUA (WATER), HORDEUM VULGARE STEM WATER*, CAPRYLYL/CAPRYL GLUCOSIDE, GLYCERIN, TRIETHYL CITRATE, PARFUM (FRAGRANCE)**, BENZYL ALCOHOL, SODIUM COCOYL GLUTAMATE, SODIUM CAPROYL/LAUROYL LACTYLATE, CITRIC ACID, GLYCERYL CAPRYLATE, POLYGLYCERYL-6 OLEATE, DEHYDROACETIC ACID, SODIUM SURFACTIN, ALOE BARBADENSIS LEAF JUICE*, SODIUM BENZOATE, POTASSIUM SORBATE, CALENDULA OFFICINALIS (POT MARIGOLD) FLOWER EXTRACT*, LAVANDULA ANGUSTIFOLIA (LAVENDER) FLOWER EXTRACT*, SALVIA OFFICINALIS (SAGE) OIL, XANTHAN GUM, CI 77820 (SILVER), LINALOOL**, GERANIOL**, LIMONENE**, CITRONELLOL**, COUMARIN**\r\n\r\n*kontrolliert biologischer Anbau\r\n**natürliche Parfümkomposition', '2023-02-27 14:02:28', 216, 'BODY_CARE', 'DRUGSTORE', NULL, 13.5, 'VEGAN;VEGETARIAN', NULL, NULL),
(991, 'BIOTURM SHAMPOO Schuppen (Weiling)', '4260026694065', 1, 5.95, 1, 1, NULL, 0, '743126', 'BIOTURM SHAMPOO Schuppen', 'Unser SHAMPOO Schuppen Nr.105 sorgt für eine Minderung der Schuppen und stellt das Gleichgewicht der Kopfhaut wieder her. Extrakte aus Salbei- und Wacholderbeeren-Extrakt schützen und pflegen.\n\nUnsere neuartige Formulierung für feinen und voluminösen Schaum, bestes Haargefühl und eine wunderbare Nass- und Trockenkämmbarkeit.', 'Bioturm GmbH', 'BIOTURM', 'GERMANY', 'b051923b-0323-420d-8d52-6c88bafff4a2', 'manager', '2021-08-14 13:44:02', 'System', '2023-01-16 18:31:22', 1028, 1038, NULL, NULL, 0, 3.36, 'Weiling', 0, NULL, 0, NULL, NULL, '2022-07-12 14:19:59', 368.903, 'BODY_CARE', 'DRUGSTORE', 250, 16.7, 'VEGAN;VEGETARIAN', NULL, NULL),
(992, 'Baby & Kids Sonnencreme LSF 50+ (Weiling)', '4033981732086', 1, 18.9, 1, 1, NULL, 0, '827016', 'Baby & Kids Sonnencreme LSF 50+', 'Sehr hoher Lichtschutz für zarte Baby- und Kinderhaut. Die Baby & Kids Sonnencreme LSF 50+ von eco cosmetics bietet einen Breitbandschutz vor UVA - B -C. Die sanfte Creme zieht rasch ein, weißelt kaum dank des hohen Anteils an Sanddornöl* und wirkt direkt nach dem Auftragen. Auch kleine Wasserratten sind durch die wasserfeste Formel bestens geschützt. Granatapfel*, Oliven*- und Macadamiaöl* sorgen für Feuchtigkeit und Pflege. Sanddornextrakt* und Nachtkerzenöl* schützen besonders sensible Haut. Eine natürliche Duftkomposition verleiht einen angenehmen, milden Duft.\n* Inhaltstoffe aus kontrolliert biologischem Anbau\nAbfärbung möglich.\nBeachten Sie Ihren individuellen Hauttyp.\nAusgeglichener UVA-UVB Schutz im Verhältnis 1:3', 'Eco Cosmetics GmbH & Co. KG', 'eco cosmetics', 'GERMANY', '763ade41-88cc-47cb-a96d-73455a2ca2b8', 'manager', '2021-08-14 13:44:13', 'System', '2024-01-16 02:09:35', 374, 1039, NULL, NULL, 0, 9.99, 'Weiling', 0, NULL, 0, NULL, NULL, '2022-04-11 15:13:27', 242, 'BODY_CARE', 'DRUGSTORE', 102, 12.5, 'VEGAN;VEGETARIAN', NULL, NULL),
(993, 'Zahncreme Pure Mint (Weiling)', '4260397792438', 1, 5.9, 1, 1, NULL, 0, '863178', 'Zahncreme Pure Mint', 'Unsere  Pure  Mint  Zahncreme  mit Pfefferminznote  sorgt  2x  täglich  für  frischen Atem,  dauerhaft  gesunde  Mundflora  und  pflegt  dabei  nachhaltig  Zähne  und Zahnfleisch.  Durch  den  Zusatz  von  Fluorid  werden  Deine  Zähne  besonders wirksam vor Karies geschützt. ', 'wasserneutral GmbH', 'HYDROPHIL', 'GERMANY', 'd65df597-8646-403a-b41f-b0e1511399ba', 'manager', '2021-08-14 13:44:23', 'System', '2022-04-11 14:31:37', 845, 1040, NULL, NULL, 0, 2.88, 'Weiling', 0, NULL, 0, NULL, NULL, '2022-04-11 14:31:37', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL),
(994, 'Zahncreme Sweet Herbs (Weiling)', '4260397792452', 1, 6.9, 1, 1, NULL, 0, '863180', 'Zahncreme Sweet Herbs', 'Unsere Sweet Herbs Zahncreme ist nach den Richtlinien des NCS (natural cosmetic standard) zertifiziert. Dieser setzt höchste Qualitätsansprüche an die ausgezeichneten Produkte.\r\nKunden können sich durch das NCS-Siegel bei folgenden Punkten sicher sein: kein Mikroplastik, weder aus noch durch Gentechnik hergestellt, keine Parabene, Silikone, PEGs oder Phtalate enthalten, nur natürliche Duftstoffe und pflanzliche Extraktionsmittel, keine radioaktive Bestrahlung uvm.\r\n\r\nUnsere Tube besteht zu über 95% aus Material erneuerbarer Ressourcen. Das verarbeitete Fichtenholz hat seinen Ursprung in PEFC-zertifizierten Wäldern der EU. Die Tube hat eine über 40% bessere CO2-Bilanz als eine herkömmliche PE- Tube.', 'wasserneutral GmbH', 'HYDROPHIL', 'GERMANY', '22bdc46e-3106-47f1-bd3d-b4382836241c', 'manager', '2021-08-14 13:44:35', 'manager', '2023-02-02 08:32:53', 843, 1041, NULL, NULL, 0, 3.36, 'Weiling', 0, NULL, 0, NULL, NULL, '2023-02-02 08:32:53', NULL, 'BODY_CARE', 'DRUGSTORE', NULL, NULL, NULL, NULL, NULL),
(995, 'SMOOTH SKIN Dusch-Peeling (Weiling)', '4021457629749', 1, 4.49, 1, 1, NULL, 0, '760420', 'SMOOTH SKIN Dusch-Peeling', 'Sanftes Peeling für ein seidenweiches Hautgefühl.\r\n\r\nVerwöhnen Sie sich mit der intensiven Duftkomposition und den milden Jojoba Peelingkörpern des lavera Smooth Skin Dusch-Peelings. Die vegane Rezeptur mit wertvollen Inhaltsstoffen und milden Tensiden natürlichen Ursprungs reinigt die Haut, ohne sie auszutrocknen. Die pH-hautneutrale Formel sorgt für ein geschmeidiges Hautgefühl.\r\n\r\nDie perfekte Ergänzung für das lavera Smooth Skin Dusch-Peeling ist die lavera Straffende Bodymilk. \r\n\r\nGREEN SMOOTHING COMPLEX\r\nDie lavera Naturkosmetik-Forschung hat eine milde Rezeptur entwickelt, die mit einer exklusiven Wirkstoffkomposition auf Basis von Rosmarin ein geglättetes Hautgefühl hinterlässt.', 'Weiling', NULL, NULL, '85704557-aa8d-4a8a-b0d8-9362ff78d22e', 'correction', '2021-09-08 18:51:02', 'manager', '2023-02-27 14:50:38', 635, 1325, NULL, NULL, 0, 2.64, 'Weiling', 1, 1, 0, NULL, NULL, '2023-02-27 14:50:38', 635.712, 'BODY_CARE', 'DRUGSTORE', NULL, 17.2, 'VEGAN;VEGETARIAN', NULL, NULL),
(996, 'MILD BALANCE Pflegedusche (Weiling)', '4021457629770', 1, 3.99, 1, 1, NULL, 0, '760426', 'MILD BALANCE Pflegedusche', 'Mit präbiotischen Inhaltsstoffen und sanft zur Hautbarriere\r\n\r\nVerwöhnen Sie sich mit der intensiven Duftkomposition und dem sanften Schaum des lavera Mild Balance Duschgels. Die vegane Rezeptur mit wertvollen Inhaltsstoffen und milden Tensiden natürlichen Ursprungs reinigt die Haut sanft, ohne sie auszutrocknen. Die pH-hautneutrale Pflegeformel hinterlässt ein angenehmes Gefühl auf der Haut. \r\n\r\nGREEN PREBIOTICS COMPLEX\r\nDie lavera Naturkosmetik-Forschung hat eine milde Rezeptur entwickelt, die eine exklusive Wirkstoffkomposition auf Basis von präbiotischen Chiasamen beinhaltet und sanft zur Hautbarriere ist.', 'Laverana GmbH & Co. KG', 'Lavera', 'Wennigsen, NI', 'b85164e8-c581-40a2-98a9-bcb3a116f118', 'correction', '2021-09-08 18:51:52', 'manager', '2023-02-27 14:10:24', 637, 1326, NULL, NULL, 0, 2.21, 'Weiling', 1, 1, 0, NULL, NULL, '2023-02-27 14:10:24', 650, 'BODY_CARE', 'DRUGSTORE', NULL, 20, 'VEGAN;VEGETARIAN', NULL, NULL),
(997, 'ACTIVE TOUCH Pflegedusche (Weiling)', '4021457629787', 1, 3.85, 1, 1, NULL, 0, '760428', 'ACTIVE TOUCH Pflegedusche', 'Belebende Wirkung für Körper und Sinne\r\n\r\nErfrischen Sie sich mit der intensiven Duftkomposition und dem sanften Schaum des lavera Active Touch Duschgels. Die vegane Rezeptur mit wertvollen Inhaltsstoffen und milden Tensiden natürlichen Ursprungs reinigt die Haut sanft, ohne sie auszutrocknen. Die pH-hautneutrale Pflegeformel hinterlässt ein angenehmes Feuchtigkeitsgefühl auf der Haut. \r\n\r\nGREEN POWER COMPLEX\r\nDie lavera Naturkosmetik-Forschung hat eine milde Rezeptur entwickelt, die mit einer exklusiven Wirkstoffkomposition auf Basis von anregendem Pink Pepper eine belebende Wirkung hat.', 'Weiling', NULL, NULL, 'b62983eb-867a-42fb-bac1-55e3a25ef3d1', 'correction', '2021-09-08 18:52:13', 'System', '2021-11-12 19:56:52', 636, 1327, NULL, NULL, 0, 0, 'Weiling', 1, 1, 0, NULL, NULL, '2021-11-12 19:56:52', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL),
