(1001, 'Men Sensitiv Deo Roll-On (Weiling)', '4021457615865', 1, 6.19, 1, 1, NULL, 0, '760303', 'Men Sensitiv Deo Roll-On', 'Der 48h Deo Roll-On mit Bio-Bambus und Bio-Lemongras schenkt ein sicheres und frisches Hautgefühl.\n\n- Schützt wirkungsvoll vor Körpergeruch\n- Enthält keine Aluminiumsalze\n- Beugt Reizungen sensibler Haut vor', 'Weiling', NULL, NULL, 'c483ff8a-78cd-45bc-b498-f55fb5c4f341', 'correction', '2021-09-08 18:42:47', 'System', '2023-10-20 02:10:01', 1337, 1328, NULL, NULL, 0, 3.47, 'Weiling', 1, 1, 0, NULL, NULL, '2023-02-07 10:36:58', 253.92, 'BODY_CARE', 'DRUGSTORE', 79.9, 12, 'VEGAN;VEGETARIAN', NULL, NULL),
(1002, 'Men Sensitiv Duschgel 3In1 (Weiling)', '4021457619313', 1, 4.99, 1, 1, NULL, 0, '760305', 'Men Sensitiv Duschgel 3In1', 'Das 3in1 Dusch-Shampoo mit Bio-Bambus und Bio-Guarana bietet empfindlicher Männerhaut eine extra milde Reinigung von Haut, Haar und Gesicht. Für ein langanhaltendes Frischegefühl.', 'Weiling', NULL, NULL, 'cbdea84c-ca71-4dc9-a2a0-b88350d7e7b9', 'correction', '2021-09-08 18:52:36', 'System', '2023-10-20 02:10:13', 1336, 1329, NULL, NULL, 0, 2.79, 'Weiling', 1, 1, 0, NULL, NULL, '2023-04-04 10:35:41', 635.712, 'BODY_CARE', 'DRUGSTORE', 232.98, 17.2, 'VEGAN;VEGETARIAN', NULL, NULL),
(1003, 'Pflegeshampoo Family (Weiling)', '4021457647606', 1, 5.39, 1, 1, NULL, 0, '768527', 'Pflegeshampoo Family', 'Entdecken Sie das lavera Geheimnis natürlich wirksamer Haarpflege:  \n\nUnsere sorgfältig ausbalancierte Naturkomposition mit Bio-Apfel und Bio-Quinoa ist für die tägliche Haarwäsche Ihrer ganzen Familie geeignet, da sie besonders sanft zu Haar und Kopfhaut ist.\nDie innovative Pflegeformel bietet Ihnen ein sanftes Schaumerlebnis und eine deutlich verbesserte Kämmbarkeit.\nErleben Sie eine neue Dimension natürlicher Pflege und Geschmeidigkeit ganz ohne Silikone.\n\nDas gute Gefühl von zertifizierter Naturkosmetik - ohne Kompromisse.\n\nWir versprechen Ihnen:\n· biologisch abbaubare Rezepturen zu verwenden und auf Silikone, festes und flüssiges Mikroplastik und künstliche Farb- und Konservierungsstoffe* zu verzichten,\n· Naturkompositionen, die exklusiv von der lavera-Forschung mit besten Wirkstoffen natürlichen Ursprungs fein aufeinander abgestimmt und harmonisch komponiert wurden,\n· Naturkosmetik, die von unabhängigen Institutionen zertifiziert und dermatologisch getestet wurde,\n· diese Verpackung besteht zu 93 % aus recyceltem Material, \n· wir sind ein klimaneutrales Unternehmen**.\n\n„la vera\"\", die Wahre, engagiert sich für Klimaschutz und Tierschutz.\n\n* gem. EU-Kosmetik VO\n** ClimatePartner.com/12310-1610-1001', 'Weiling', NULL, NULL, 'b9b21deb-200b-4e32-ac33-c011230b27c1', 'correction', '2021-09-08 18:49:54', 'System', '2023-10-20 02:09:29', 1031, 1330, NULL, NULL, 0, 3.18, 'Weiling', 1, 1, 0, NULL, NULL, '2022-12-29 15:49:39', 414.12, 'BODY_CARE', 'DRUGSTORE', 292.37, 20.4, 'VEGAN;VEGETARIAN', NULL, NULL),
(1004, 'Pflegeshampoo Farbglanz & Pflege (Weiling)', '4021457647651', 1, 4.99, 1, 1, NULL, 0, '768537', 'Pflegeshampoo Farbglanz & Pflege', 'Entdecken Sie das lavera Geheimnis natürlich wirksamer Haarpflege:  \n\nUnsere sorgfältig ausbalancierte Naturkomposition mit Bio-Granatapfel und Bio-Quinoa schenkt Ihrem colorierten oder getönten Haar natürlichen Farbglanz und Pflege.\nDie innovative Pflegeformel bietet Ihnen ein sanftes Schaumerlebnis und eine deutlich verbesserte Kämmbarkeit.\nErleben Sie eine neue Dimension natürlicher Pflege und Geschmeidigkeit ganz ohne Silikone.\n\nDas gute Gefühl von zertifizierter Naturkosmetik - ohne Kompromisse.\n\nWir versprechen Ihnen:\n· biologisch abbaubare Rezepturen zu verwenden und auf Silikone, festes und flüssiges Mikroplastik und künstliche Farb- und Konservierungsstoffe* zu verzichten,\n· Naturkompositionen, die exklusiv von der lavera-Forschung mit besten Wirkstoffen natürlichen Ursprungs fein aufeinander abgestimmt und harmonisch komponiert wurden,\n· Naturkosmetik, die von unabhängigen Institutionen zertifiziert und dermatologisch getestet wurde,\n· diese Verpackung besteht zu 93 % aus recyceltem Material, \n· wir sind ein klimaneutrales Unternehmen**.\n\n„la vera\"\", die Wahre, engagiert sich für Klimaschutz und Tierschutz.\n\n* gem. EU-Kosmetik VO\n** ClimatePartner.com/12310-1610-1001', 'Weiling', NULL, NULL, '6dec67f1-109d-4c74-8159-0d8fe15d10b6', 'correction', '2021-09-08 18:48:19', 'System', '2023-10-20 02:09:58', 1030, 1331, NULL, NULL, 0, 3.18, 'Weiling', 1, 1, 0, NULL, NULL, '2023-01-16 18:31:44', 414.12, 'BODY_CARE', 'DRUGSTORE', 293.03, 20.4, 'VEGAN;VEGETARIAN', NULL, NULL),
