(1016, 'basis sensitiv Lippenbalsam (Weiling)', '4021457625130', 1, 2.79, 1, 1, NULL, 0, '766012', 'basis sensitiv Lippenbalsam', 'Mit dem lavera Sensitive Lippenbalsam schützen Sie Ihre Lippen wirksam vor dem Austrocknen. Die milde Pflegeformel mit Bio-Jojobaöl und Bio-Mandelöl wurde gezielt für die tägliche Anwendung entwickelt. Ihre natürliche Pflege für anspruchsvolle Lippen.\n\nNatürlich ohne Mineralöle & glutenfrei', 'Weiling', NULL, NULL, 'e19e12a7-4331-43fd-a755-8edba70557aa', 'correction', '2021-09-08 18:41:17', 'System', '2023-10-20 02:08:35', 389, 1343, NULL, NULL, 0, 1.5, 'Weiling', 1, 1, 0, NULL, NULL, '2022-07-12 14:11:14', 180, 'BODY_CARE', 'DRUGSTORE', 18.1, 12, 'VEGETARIAN', NULL, NULL),
(1017, 'Protect & Repair Lippenbalsam (Weiling)', '4021457625147', 1, 3.29, 1, 1, NULL, 0, '766014', 'Protect & Repair Lippenbalsam', 'Reichhaltige Pflege & intensive Feuchtigkeit. \nMit dem lavera Repair Lippenbalsam regenerieren Sie Ihre Lippen auf wirksame und nachhaltige Weise. Die reichhaltige Pflegeformel mit Bio-Granatapfelkernöl und Bio-Arganöl wurde für intensive Feuchtigkeit entwickelt. Ihr natürlicher Schutzntensive Feuchtigkeit.\n\n', 'Weiling', NULL, NULL, '2c5dbe7a-1bf0-495d-99ee-510908199890', 'correction', '2021-09-08 18:40:58', 'System', '2023-10-20 02:09:36', 1112, 1344, NULL, NULL, 0, 2.14, 'Weiling', 1, 1, 0, NULL, NULL, '2022-07-12 14:11:11', 180, 'BODY_CARE', 'DRUGSTORE', 17.9, 12, 'VEGAN;VEGETARIAN', NULL, NULL),
(1018, 'Mundwohl Mundspülung (Weiling)', '4086900213104', 1, 9.9, 1, 1, NULL, 0, '796520', 'Mundwohl Mundspülung', 'Zum Schutz der Zahngesundheit und zum Erhalt der gesunden Mundflora ergänzt die Mundwohl Mundspülung ohne Alkohol die ganzheitliche Mundpflege mit Zahnbürste und Zahnseide. Mit der Kraft von 100 % naturreinen ätherischen Ölen in Bio Qualität sorgt sie für Reinigung schwierig zugänglicher Zahnzwischenräume und schenkt das sichere Gefühl eines langanhaltend frischen Atmens.', 'PRIMAVERA LIFE GMBH', 'PRIMAVERA', 'GERMANY', 'befd007c-2ebf-4d5d-b258-13accfa9e026', 'manager', '2021-08-14 13:49:12', 'manager', '2023-02-27 14:12:35', 1358, 1345, NULL, NULL, 0, 5.5, 'Weiling', 0, NULL, 0, NULL, NULL, '2023-02-27 14:12:35', 1000, 'BODY_CARE', 'DRUGSTORE', NULL, 20, NULL, NULL, NULL),
(1019, 'Speick Sun After Sun Lotion (Weiling)', '4009800012035', 1, 13.99, 1, 1, NULL, 0, '826414', 'Speick Sun After Sun Lotion', 'Erfrischende und intensiv feuchtigkeitsspendende After Sun Lotion für alle Hauttypen. Die optimale Portion Extrapflege zur Regeneration sonnengestresster Haut. Der effektive Wirkkomplex mit extra hohem Gehalt an Bio-Aloe vera-Gel aus kontrolliert biologischem Anbau, Zuckerrübenextrakt und pflanzlichem Glyzerin bewahrt den Feuchtigkeitshaushalt der Haut. Mit Repair-Effekt durch hautschützendes Ectoin. Die hochwertigen Inhaltsstoffe mildern Spannungsgefühle spürbar. Das sanft kühlende Cremefluid lässt sich leicht verteilen und zieht schnell ein, ohne zu kleben. Die Komposition natürlicher Extrakte wie Kokos und Vanille verleiht der After Sun Lotion einen angenehm natürlichen Duft. Mit dem einzigartigen Extrakt der hochalpinen Speick-Pflanze (kbW). Für alle Hauttypen geeignet. Vegan.', 'Speick Naturkosmetik GmbH & Co. KG ', 'Speick', 'GERMANY', 'f6004f7d-f286-41dc-80eb-e430581356d8', 'manager', '2021-08-14 13:49:23', 'System', '2024-02-14 02:09:26', 348, 1042, NULL, NULL, 0, 7.66, 'Weiling', 0, NULL, 0, NULL, NULL, '2022-10-14 02:12:03', 672.672, 'BODY_CARE', 'DRUGSTORE', 226, 17.6, 'VEGAN;VEGETARIAN', NULL, NULL),
(1020, 'Speick Sun Sonnenmilch LSF 20 (Weiling)', '4009800012004', 1, 16.99, 1, 1, NULL, 0, '826416', 'Speick Sun Sonnenmilch LSF 20', 'Sonnenmilch mit Lichtschutzfaktor 20: Leichte, sehr gut einziehende Konsistenz mit mittlerem Sonnenschutz für den Körper. Geeignet für dunkle Hauttypen oder vorgebräunte Haut. 100 % natürlich-mineralischer Sonnenschutz auf Basis von Zinkoxid. Zuverlässiger Sofortschutz vor UVA- und UVB-Strahlung mit wasserfester Wirkung. Frei von Aluminium und Parfüm. Sehr gut verträglich für alle Hauttypen. Der enthaltene Hautbarriere-Wirkkomplex versorgt die Haut mit intensiver Pflege: Intensiv feuchtigkeitsspendend mit Zuckerrübenextrakt, hautberuhigendem Schilfrohrextrakt und Granatapfel-Zellschutzkomplex. Enthält den einzigartigen Extrakt der hochalpinen Speick-Pflanze aus kontrolliert biologischer Wildsammlung (kbW). Biologisch leicht abbaubar, zum Schutz der Umwelt. Riff- und korallenfreundlich. \n\nSonnencremes auf mineralischer Basis arbeiten mit mineralischen Mikropigmenten, die sich beim Auftragen als hauchdünne Schicht auf die Haut legen und die UV-Strahlen wie ein Spiegel reflektieren. Bei diesen mineralischen Partikeln handelt es sich bei unseren Speick Sun-Produkten um Zinkoxid-Mikropigmente (kein Nano nach EU Gesetzgebung), die sowohl vor UVA- als auch vor UVB-Strahlung schützen. So wird der Sonnenschutz auf natürliche Weise gewährleistet.', 'Speick Naturkosmetik GmbH & Co. KG ', 'Speick', 'GERMANY', '15efaa2d-71ab-490f-9224-57785bf0bd0c', 'manager', '2021-08-14 13:49:33', 'System', '2023-04-03 02:04:36', 998, 1043, NULL, NULL, 0, 9.45, 'Weiling', 0, NULL, 0, NULL, NULL, '2022-10-14 02:11:55', 581.042, 'BODY_CARE', 'DRUGSTORE', 187, 15.4, 'VEGAN;VEGETARIAN', NULL, NULL),
(1021, 'Speick Sun Sonnencreme LSF 50+ (Weiling)', '4009800012028', 1, 15.99, 1, 1, NULL, 0, '826420', 'Speick Sun Sonnencreme LSF 50+', 'Sonnencreme mit Lichtschutzfaktor 50+, ideal auch für Kinder: Gut einziehende, extrem reichhaltige Konsistenz mit intensivem, sehr hohem Sonnenschutz für Gesicht und Körper. Besonders für sonnenempfindliche Hauttypen und Kinder geeignet, ebenso bei intensiver Sonneneinstrahlung und hoher UV-Belastung wie im Gebirge oder am Wasser. Auch als Lichtschutz für die empfindliche Lippenpartie geeignet. 100 % natürlich-mineralischer Sonnenschutz auf Basis von Zinkoxid. Zuverlässiger Sofortschutz vor UVA- und UVB-Strahlung mit wasserfester Formulierung. Ohne Aluminium, Duftneutral. Sehr gut verträglich für alle Hauttypen. Der enthaltene Hautbarriere-Wirkkomplex versorgt die Haut mit intensiver Pflege: Intensiv feuchtigkeitsspendend mit Zuckerrübenextrakt, hautberuhigendem Schilfrohrextrakt und Granatapfel-Zellschutzkomplex. Mit dem einzigartigen Extrakt der hochalpinen Speick-Pflanze aus kontrolliert biologischer Wildsammlung (kbW). \n\nSonnencremes auf mineralischer Basis arbeiten mit mineralischen Mikropigmenten, die sich beim Auftragen als hauchdünne Schicht auf die Haut legen und die UV-Strahlen wie ein Spiegel reflektieren. Bei diesen mineralischen Partikeln handelt es sich bei unseren Speick Sun-Produkten um Zinkoxid-Mikropigmente (kein Nano nach EU Gesetzgebung), die sowohl vor UVA- als auch vor UVB-Strahlung schützen. So wird der Sonnenschutz auf natürliche Weise gewährleistet.', 'Speick Naturkosmetik GmbH & Co. KG ', 'Speick', 'GERMANY', '73c3e96c-208a-4df8-a489-d682bb42c3f4', 'manager', '2021-08-14 13:49:44', 'System', '2024-02-15 02:07:42', 1437, 1044, NULL, NULL, 0, 9.46, 'Weiling', 0, NULL, 0, NULL, NULL, '2022-10-14 02:11:58', 248.64, 'BODY_CARE', 'DRUGSTORE', 96, 14, 'VEGAN;VEGETARIAN', NULL, NULL),
(1022, 'Speick Sun Sonnenmilch LSF 30 (Weiling)', '4009800012059', 1, 21.99, 1, 1, NULL, 0, '826440', 'Speick Sun Sonnenmilch LSF 30', 'Sonnenmilch mit Lichtschutzfaktor 30, ideal auch für Kinder: Leichte, sehr gut einziehende Konsistenz mit intensivem, hohem Sonnenschutz für Gesicht und Körper. Besonders für helle Hauttypen und Kinder geeignet, ebenso bei intensiver Sonneneinstrahlung und hoher UV-Belastung. 100 % natürlich-mineralischer Sonnenschutz auf Basis von Zinkoxid. Zuverlässiger Sofortschutz vor UVA- und UVB-Strahlung mit wasserfester Formulierung. Ohne Aluminium, Duftneutral. Sehr gut verträglich für alle Hauttypen. Der enthaltene Hautbarriere-Wirkkomplex versorgt die Haut mit intensiver Pflege: Intensiv feuchtigkeitsspendend mit Zuckerrübenextrakt, hautberuhigendem Schilfrohrextrakt und Granatapfel-Zellschutzkomplex. Mit dem einzigartigen Extrakt der hochalpinen Speick-Pflanze aus kontrolliert biologischer Wildsammlung (kbW). \n\nSonnencremes auf mineralischer Basis arbeiten mit mineralischen Mikropigmenten, die sich beim Auftragen als hauchdünne Schicht auf die Haut legen und die UV-Strahlen wie ein Spiegel reflektieren. Bei diesen mineralischen Partikeln handelt es sich bei unseren Speick Sun-Produkten um Zinkoxid-Mikropigmente (kein Nano nach EU Gesetzgebung), die sowohl vor UVA- als auch vor UVB-Strahlung schützen. So wird der Sonnenschutz auf natürliche Weise gewährleistet.', 'Speick Naturkosmetik GmbH & Co. KG ', 'Speick', 'GERMANY', '908a203f-06b5-4a07-9cdc-f834d053a565', 'manager', '2021-08-14 13:49:54', 'System', '2024-01-18 02:08:28', 997, 1045, NULL, NULL, 0, 12.22, 'Weiling', 0, NULL, 0, NULL, NULL, '2022-10-14 02:12:00', 584.815, 'BODY_CARE', 'DRUGSTORE', 199, 15.5, 'VEGAN;VEGETARIAN', NULL, NULL),
(1023, 'Kids 2in1 Shower & Shampoo Fruchtige Orange (Weiling)', '4001638075114', 1, 5.95, 1, 1, NULL, 0, '809122', 'Kids 2in1 Shower & Shampoo Fruchtige Orange', 'So turbulent das Familienleben auch sein mag, eines ist sicher: ihr kleiner Schatz entwickelt sich Tag für Tag weiter und erobert die Welt durch eigene Erfahrungen. Auch wenn ihr Kind jeden Tag ein bisschen selbstständiger wird, benötigt Kinderhaut weiterhin spezielle Pflege – denn sie ist immer noch dünner als Erwachsenenhaut und noch nicht voll in ihrer Funktionsfähigkeit ausgereift. Weleda Naturkosmetik ist deshalb die ideale Wahl für zarte Kinderhaut, da sie besonders sanft ist und dabei mild zu den Augen. Unsere 2in1 Shower & Shampoos lassen Kinderherzen natürlich höher schlagen – unsere großen Kleinen haben mitentschieden und so ist zusammen mit unseren Experten ein sanfter Waschspaß aus der Natur entstanden. Das Ergebnis: Pflegende Inhaltsstoffe, besonders milde Zuckertenside und kinderfreundliche Düfte in einer tierischen Verpackung – und das in gewohnt hoher Weleda Qualität. So können Sie guten Gewissens Ihr Kind an eine eigene Pflegeroutine heranführen. Anwendung Ein paar Spritzer auf Haut und Haare auftragen, sanft einmassieren und mit Wasser abspülen. Tollen Duft und geschmeidiges Gefühl auf Haut und Haaren erleben. Tipp Besonders lange Haare freuen sich über zusätzliche Aufmerksamkeit – gönnen Sie sich und Ihrem Kind eine Extrapflege mit unserer Hafer-Aufbauspülung.', 'Weleda AG', 'Weleda', 'SWITZERLAND', 'bf6cb354-cd00-435d-8fd2-930f296ef54f', 'manager', '2021-08-14 13:50:07', 'System', '2023-07-01 00:04:29', 1272, 1046, NULL, NULL, 0, 3.59, 'Weiling', 0, NULL, 0, NULL, NULL, '2022-04-11 14:09:57', 557.7, 'BODY_CARE', 'DRUGSTORE', 174.2, 14.3, 'VEGAN;VEGETARIAN', NULL, NULL),
(1024, 'Bäuchlein-Massageöl (Weiling)', '4001638095082', 1, 12.99, 1, 1, NULL, 0, '809508', 'Bäuchlein-Massageöl', 'Wenn das Baby schreit, will es oft einfach seine Stimme benutzen oder mitteilen, dass es Kontakt sucht. Es könnte aber auch sein, dass es an Blähungen leidet: Die Verdauungsorgane passen sich erst allmählich an die Lebensbedingungen außerhalb des Mutterleibes an. Das Weleda Bäuchlein-Massageöl, eine fein abgestimmte Komposition auf Grundlage von mildem Mandelöl, ist gezielt konzipiert für entspannende Bauchmassagen. Die natürlichen ätherischen Öle von Majoran, römischer Kamille und Kardamom werden traditionell zur Verdauungsförderung eingesetzt. Eine vorbeugende, sanft pflegende Bauchmassage mit dem Bäuchlein-Massageöl kann vor unangenehmen Winden bewahren. Die regelmäßige Anwendung hilft dem Kind zudem, einen festen Lebensrhythmus zu finden, den es für eine harmonische Entwicklung braucht.', 'Weleda AG', 'Weleda', 'GERMANY', 'ea8525c8-7737-42c3-9776-c467be7340be', 'manager', '2021-08-14 13:50:17', 'System', '2024-02-02 02:12:10', 372, 1047, NULL, NULL, 0, 7.09, 'Weiling', 0, NULL, 0, NULL, NULL, '2022-05-23 14:54:45', 154.088, 'BODY_CARE', 'DRUGSTORE', 116.5, 10.3, 'VEGAN;VEGETARIAN', NULL, NULL),
(1025, 'Bodylotion Orange Sanddorn (Weiling)', '4021457615438', 1, 6.49, 1, 1, NULL, 0, '768203', 'Bodylotion Orange Sanddorn', NULL, 'Laverana GmbH & Co.KG', 'Lavera', 'Wennigsen, NI', NULL, 'correction', '2021-09-08 18:46:12', 'manager', '2023-02-02 16:58:11', 538, NULL, NULL, NULL, 0, 3.22, 'Weiling', 1, 1, 0, NULL, NULL, '2023-02-02 16:58:11', 635.712, 'BODY_CARE', 'DRUGSTORE', NULL, 17.2, NULL, NULL, NULL),
(1026, 'Straffende Bodymilk (Weiling)', '4021457615049', 1, 7.49, 1, 1, NULL, 0, '768126', 'Straffende Bodymilk', 'Die lavera Körperpflege mit wertvollen Bio-Pflanzenextrakten und natürlichen Düften schenkt zart gepflegte Haut – für tägliche Wellness-Momente.\r\n\r\nDie Straffende Bodymilk von lavera mit ihrem natürlichen Wirkstoffkomplex festigt die Hautstruktur bei täglicher Anwendung innerhalb von 14 Tagen.\r\nGrüner Kaffee & Grüntee: Besitzen anregende Eigenschaften und sorgen für ein geglättetes, gestrafftes Hautbild\r\nRosmarin & Traube: Wirken stimulierend und sorgen für ein seidenweiches Hautgefühl.', 'Weiling', NULL, NULL, '9aea3a9c-01ca-4521-9c17-648e7e17fa04', 'correction', '2021-09-08 18:44:13', 'manager', '2022-11-01 14:02:43', 978, 1346, NULL, NULL, 0, 3.62, 'Weiling', 1, 1, 0, NULL, NULL, '2022-11-01 14:02:43', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL),
(1027, 'Pizzolato Spumante rose (Weiling)', '8022836001206', 1, 11.99, 1, 1, NULL, 0, '717775', 'Pizzolato Spumante rose', 'Harmonisch und fruchtig mit einem Hauch von Kirsche, Himbeere und zarten floralen Noten.', 'La Cantina Pizzolato Sr', NULL, 'Italien', NULL, 'manager', '2021-08-14 20:06:28', 'System', '2023-07-01 00:18:53', 1147, NULL, 0, NULL, 0, 6.85, 'Weiling', 0, NULL, 0, NULL, NULL, '2023-02-27 12:12:25', 2376.3, 'WINE_CHAMPAGNE', 'DRINKS', NULL, 30, 'VEGAN;VEGETARIAN', NULL, NULL),
