(1030, 'ROSATO frizzante (Weiling)', '8018759002024', 1, 7.49, 1, 1, NULL, 0, '718570', 'ROSATO frizzante', 'Dezent prickelnde Frische mit kräftigem Biss und wohl balancierter feiner Säure. Aus Merlot-Trauben gekeltert. Ideal als Aperitif und Speisebegleiter..', 'LaSelva', 'LaSelva', 'Veneto', '259b1de4-d0e3-4a48-b6d9-513f42e57676', 'manager', '2021-08-14 20:07:30', 'System', '2023-10-04 02:11:24', 1096, 1050, 0, NULL, 0, 4.99, 'Weiling', 0, NULL, 0, 102, 'Merlot*. *aus kontrolliert ökologischer Erzeugung', '2022-11-29 16:51:05', 2225.29, 'WINE_CHAMPAGNE', 'DRINKS', 1226, 29.4, 'VEGAN;VEGETARIAN', NULL, NULL),
(1031, 'BE TOGETHER RED Rotweincuvée (Weiling)', '4033548000238', 1, 7.69, 1, 1, NULL, 0, '714430', 'BE TOGETHER RED Rotweincuvée', 'BE or not to BE, sein oder nicht sein Wein oder nicht Wein.\nDie BE-Weine sind Ideale Begleiter zu leichtem Essen, Picknick, einem Spieleabend oder einfach nur zum Ausklang des Tages auf der Terrasse.\nImmer wenn es etwas zu genießen gibt, unterstreichen sie den Moment.', 'Weingut Schäfer-Heinrich', 'Weingut Schäfer-Heinrich', 'GERMANY', '26593a9a-a9a6-4221-8fa0-ca9644fb3888', 'manager', '2021-08-14 20:07:42', 'System', '2023-09-06 02:07:40', 397, 1051, 7, NULL, 0, 4.2, 'Weiling', 0, NULL, 0, 61, NULL, '2022-11-29 15:48:18', 1617, 'WINE_CHAMPAGNE', 'DRINKS', 1175, 33, 'VEGAN;VEGETARIAN', NULL, NULL),
(1032, 'BE FRIENDS ROSÈ (Weiling)', '4033548000139', 1, 7.69, 1, 1, NULL, 0, '714431', 'BE FRIENDS ROSÈ', 'BE or not to BE, sein oder nicht sein Wein oder nicht Wein.\nDie BE-Weine sind Ideale Begleiter zu leichtem Essen, Picknick, einem Spieleabend oder einfach nur zum Ausklang des Tages auf der Terrasse.\nImmer wenn es etwas zu genießen gibt, unterstreichen sie den Moment.', 'Weingut Schäfer-Heinrich', 'Weingut Schäfer-Heinrich', 'GERMANY', 'e6450f47-f016-421c-a175-94eeeee3ba02', 'manager', '2021-08-14 20:07:56', 'System', '2024-01-07 02:05:23', 395, 1052, 7, NULL, 0, 4.2, 'Weiling', 0, NULL, 0, 61, NULL, '2022-11-29 15:48:13', 1617, 'WINE_CHAMPAGNE', 'DRINKS', 1175, 33, 'VEGAN;VEGETARIAN', NULL, NULL),
(1033, 'Weißburgunder trocken  (Weiling)', '4037865000803', 1, 8.99, 1, 1, NULL, 0, '710524', 'Weißburgunder trocken ', 'In der Nase spürt man feine Aromen nach Aprikose und\nLindenblüte. Am Gaumen ist er vollmundig und fruchtig. Das\nelegant-ausgewogene Frucht-Säurespiel macht ihn zu einem Wein\nfür viele Gelegenheiten. ', 'Stefan Sander', 'Sander – ökologische Weine', 'Rheinhessen', 'ca11d4a4-a676-4b74-98df-0a9bfae895e0', 'manager', '2021-08-14 20:08:38', 'System', '2023-05-03 02:07:11', 1401, 1053, 3, NULL, 0, 4.9, 'Weiling', 0, NULL, 0, 69, 'enthält SULFITE **aus biodynamischer Erzeugung', '2022-11-29 17:07:19', 1906.08, 'WINE_CHAMPAGNE', 'DRINKS', 1250, 33, 'VEGAN;VEGETARIAN', NULL, NULL),
(1034, 'Merlot trocken (Weiling)', '4037865033009', 1, 12.95, 1, 1, NULL, 0, '712528', 'Merlot trocken', 'Die vollreifen Merlot-Trauben ergeben einen Wein mit Aromen\nvon Pflaumen, Kirschen und feiner Würze. Am Gaumen finden\nsich die gleichen Aromen, gepaart mit feiner, harmonischer Säure,\nrundem Tannin und rundem Körper. Ein jetzt schon trinkreifer\nWein mit wunderschöner Struktur und Länge.', 'Stefan Sander', 'Sander – ökologische Weine', 'Rheinhessen', '034f3969-0e46-4187-9b29-05ddde7a1836', 'manager', '2021-08-14 20:09:24', 'System', '2023-01-16 18:34:51', 1343, 1054, 3, NULL, 0, 7, 'Weiling', 0, NULL, 0, 69, 'enthält SULFITE **aus biodynamischer Erzeugung', '2023-03-14 11:25:06', 1790.56, 'WINE_CHAMPAGNE', 'DRINKS', 1250, 31, 'VEGAN;VEGETARIAN', NULL, NULL),
(1035, 'Morellino di Scansano DOCG (Weiling)', '8032130033049', 1, 14.95, 1, 1, NULL, 0, '711769', 'Morellino di Scansano DOCG', NULL, 'Loacker Tenute S.S.', 'Tenuta Valdifalco', 'ITALY', '4bc2510f-9dd1-474c-9dce-637c76a78186', 'manager', '2021-08-14 20:09:43', 'System', '2023-01-16 18:34:56', 1356, 1347, 0, NULL, 0, 8.25, 'Weiling', 0, NULL, 0, 98, NULL, '2022-04-11 15:01:27', 787.5, 'WINE_CHAMPAGNE', 'DRINKS', 1153, 30, 'VEGAN;VEGETARIAN', NULL, NULL),
(1036, 'b*Tempranillo halbtrocken, rosé (Weiling)', '4035626115124', 1, 4.19, 1, 1, NULL, 0, '710289', 'b*Tempranillo halbtrocken, rosé', 'Leichter Rosé aus Tempranillo Trauben. Frische, hellrote Beerenfrüchte agieren mit feinmineralischen Elementen. Die drei Brüder Francisco, Javier und Luis betreiben seit 20 Jahren ökologischen Weinbau in ihrer Bodega Parra Jimenez in Las Mesas. Dort erzeugen Sie für uns schöne Weine für jeden Tag.  Moderne Kellertechnik und hohes Qualitätsbewusstsein ist Genuss ohne Reue: Dafür steht die Bodegas Parra Jiménez und das kann man auch schmecken.', 'Weiling GmbH', 'bioladen', 'SPAIN', 'd231face-b4d0-4955-a2b2-a84b3de8a0a5', 'manager', '2021-08-14 20:10:08', 'System', '2023-01-16 18:34:58', 438, 1055, 0, NULL, 0, 2.22, 'Weiling', 0, NULL, 0, 149, NULL, '2022-11-29 15:46:17', 1732.8, 'WINE_CHAMPAGNE', 'DRINKS', 1200, 30, 'VEGAN;VEGETARIAN', NULL, NULL),
(1037, 'b*Julián 0,25 l, rot (Weiling)', '4035626112390', 1, 2.29, 1, 1, NULL, 0, '710306', 'b*Julián 0,25 l, rot', 'Ehrlicher Wein: Unkompliziert, fruchtig, süffig. \nSan Isidro kann auf mehr als 50 Jahre Erfahrung im Weinbau zurückblicken und gehört zu den größten ökologischen Weinproduzenten in Spanien. San Isidro liegt in Villanueva de Alcardete in der Provinz Toledo umgeben von Weinbergen. Mit großer Sorgfalt wählen sie die Trauben für unsere Weine aus und keltern daraus fruchtig-frische Weine für jeden Tag. ', 'Weiling GmbH', 'bioladen', 'GERMANY', 'c68a8bd6-27be-497d-b250-f872d4785f14', 'manager', '2021-08-14 20:10:20', 'System', '2023-10-14 02:13:23', 432, 1056, 0, NULL, 0, 1.26, 'Weiling', 0, NULL, 0, 72, NULL, '2022-11-29 15:46:00', 617.792, 'WINE_CHAMPAGNE', 'DRINKS', 400, 19.7, 'VEGAN;VEGETARIAN', NULL, NULL),
(1038, 'Michele 0,25 l, weiß (Weiling)', '4035626112376', 1, 2.49, 1, 1, NULL, 0, '710388', 'Michele 0,25 l, weiß', 'Feiner Duft nach gelben Sommerfrüchten: Zarte Birne, Mirabelle mit einem Touch Exotik. \nSan Isidro kann auf mehr als 50 Jahre Erfahrung im Weinbau zurückblicken und gehört zu den größten ökologischen Weinproduzenten in Spanien. San Isidro liegt in Villanueva de Alcardete in der Provinz Toledo umgeben von Weinbergen. Mit großer Sorgfalt wählen sie die Trauben für unsere Weine aus und keltern daraus fruchtig-frische Weine für jeden Tag. ', 'Weiling GmbH', 'bioladen', 'GERMANY', '2ae1e933-82d3-4a01-85b3-c4cddc4db58f', 'manager', '2021-08-14 20:10:32', 'System', '2023-12-13 02:09:19', 434, 1057, 0, NULL, 0, 1.26, 'Weiling', 0, NULL, 0, 72, NULL, '2023-05-09 17:48:55', 617.792, 'WINE_CHAMPAGNE', 'DRINKS', 400, 19.7, 'VEGAN;VEGETARIAN', NULL, NULL),
(1039, 'b*Rosario 0,25 l, rosé (Weiling)', '4065626113448', 1, 2.29, 1, 1, NULL, 0, '710811', 'b*Rosario 0,25 l, rosé', 'Fruchtige Waldbeeren mit einer cremigen Textur.\nSan Isidro kann auf mehr als 50 Jahre Erfahrung im Weinbau zurückblicken und gehört zu den größten ökologischen Weinproduzenten in Spanien. San Isidro liegt in Villanueva de Alcardete in der Provinz Toledo umgeben von Weinbergen. Mit großer Sorgfalt wählen sie die Trauben für unsere Weine aus und keltern daraus fruchtig-frische Weine für jeden Tag.  ', 'Weiling GmbH', 'bioladen', 'GERMANY', 'd820bda4-e527-4281-a88f-a807060e8c28', 'manager', '2021-08-14 20:10:43', 'System', '2023-10-14 02:14:03', 436, 1058, 0, NULL, 0, 1.26, 'Weiling', 0, NULL, 0, 72, NULL, '2022-11-29 15:46:08', 617.792, 'WINE_CHAMPAGNE', 'DRINKS', 400, 19.7, 'VEGAN;VEGETARIAN', NULL, NULL),
(1040, 'b*10°, weiß (Weiling)', '4035626102131', 1, 5.19, 1, 1, NULL, 0, '714071', 'b*10°, weiß', 'Ein charaktervoller Weißwein aus dem Herzen Spaniens. Eine intensive, fruchtige Aromatik und jugendliche Frische. San Isidro kann auf mehr als 50 Jahre Erfahrung im Weinbau zurückblicken und gehört zu den größten ökologischen Weinproduzenten in Spanien. San Isidro liegt in Villanueva de Alcardete in der Provinz Toledo umgeben von Weinbergen. Mit großer Sorgfalt wählen sie die Trauben für unsere Weine aus und keltern daraus fruchtig-frische Weine für jeden Tag. ', 'Weiling GmbH', 'bioladen', 'SPAIN', '997d92f8-9396-438a-8318-5f1d5dec0aa8', 'manager', '2021-08-14 20:10:55', 'System', '2023-01-16 18:35:05', 422, 1059, 0, NULL, 0, 2.82, 'Weiling', 0, NULL, 0, 149, NULL, '2023-05-09 17:49:37', 1732.8, 'WINE_CHAMPAGNE', 'DRINKS', 1200, 30, 'VEGAN;VEGETARIAN', NULL, NULL),
(1041, 'b*12°, rosé (Weiling)', '4035626102377', 1, 5.19, 1, 1, NULL, 0, '714072', 'b*12°, rosé', 'Fruchtig, moderner Wein, frisch, mit weichem Schmelz durch feine Mineralität. Ein süffiger Wein, jung zu trinken! Die drei Brüder Francisco, Javier und Luis betreiben seit 20 Jahren ökologischen Weinbau in ihrer Bodega Parra Jimenez in Las Mesas. Dort erzeugen Sie für uns schöne Weine für jeden Tag.  Moderne Kellertechnik und hohes Qualitätsbewusstsein ist Genuss ohne Reue: Dafür steht die Bodegas Parra Jiménez und das kann man auch schmecken.', 'Weiling GmbH', 'bioladen', 'SPAIN', 'e740bbfd-cd21-4a3e-b13f-a887c0ba1bc6', 'manager', '2021-08-14 20:11:07', 'System', '2023-01-16 18:35:07', 423, 1060, 0, NULL, 0, 2.82, 'Weiling', 0, NULL, 0, 149, NULL, '2023-04-01 15:25:18', 1732.8, 'WINE_CHAMPAGNE', 'DRINKS', 1200, 30, 'VEGAN;VEGETARIAN', NULL, NULL),
(1042, 'b*18°, rot (Weiling)', '4035626101806', 1, 5.19, 1, 1, NULL, 0, '714073', 'b*18°, rot', '18 °C - bei dieser Trinktemperatur entfalten sich die Aromen dieses ausgeglichenen Rotweins optimal. Fruchtig - würzige Komposition aus reifen Cassis- und feinen Röst- und Vanillearomen. ', 'Weiling GmbH', 'bioladen', 'SPAIN', '8268dd99-99cb-4281-9ec5-0550720d0ee4', 'manager', '2021-08-14 20:11:19', 'System', '2023-10-31 00:00:36', 424, 1061, 0, NULL, 0, 2.82, 'Weiling', 0, NULL, 0, 72, NULL, '2023-06-02 10:40:37', 1732.8, 'WINE_CHAMPAGNE', 'DRINKS', 1200, 30, 'VEGAN;VEGETARIAN', NULL, NULL),
(1043, 'b*Secco, weiß (Weiling)', '4035626114233', 1, 5.29, 1, 1, NULL, 0, '714190', 'b*Secco, weiß', 'Fruchtig, süffig, saftig, prickelnd! Lebendige und feine Perlage. Für viele Anlässe oder mit Freunden. \n', 'Weiling GmbH', 'bioladen', 'SPAIN', '141a79c8-9b86-49bb-a8da-416e525d2950', 'manager', '2021-08-14 20:11:36', 'System', '2023-01-16 18:35:11', 437, 1062, 0, NULL, 0, 2.9, 'Weiling', 0, NULL, 0, 149, NULL, '2022-11-29 15:46:11', 1732.8, 'WINE_CHAMPAGNE', 'DRINKS', 1200, 30, 'VEGAN;VEGETARIAN', NULL, NULL),
(1044, 'BE Happy White Weissweincuvée (Weiling)', '4033548000030', 1, 7.69, 1, 1, NULL, 0, '714432', 'BE Happy White Weissweincuvée', 'BE or not to BE, sein oder nicht sein Wein oder nicht Wein. Die BE-Weine sind Ideale Begleiter zu leichtem Essen, Picknick, einem Spieleabend oder einfach nur zum Ausklang des Tages auf der Terrasse. Immer wenn es etwas zu genießen gibt, unterstreichen sie den Moment. ', 'Weingut Schäfer-Heinrich', 'Weingut Schäfer-Heinrich', 'GERMANY', '617c0ca6-4dd9-4d85-8a22-20b95dfd256c', 'manager', '2021-08-14 20:21:44', 'System', '2023-09-06 02:08:03', 396, 1063, 7, NULL, 0, 4.2, 'Weiling', 0, NULL, 0, 61, NULL, '2022-11-29 15:48:15', 1617, 'WINE_CHAMPAGNE', 'DRINKS', 1300, 33, 'VEGAN;VEGETARIAN', NULL, NULL),
(1045, 'Zweigelt Bio-Qualitätswein trocken (Weiling)', '9120001700332', 1, 8.49, 1, 1, NULL, 0, '716145', 'Zweigelt Bio-Qualitätswein trocken', 'In der Nase überzeugt dieser klassische Zweigelt mit seinter typischen Kirscharomatik. Am Gaumen ist er fruchtbetont, sehr mild und harmonisch mit weichen Tanninen im Abgang.\nDer Zweigelt passt sehr gut zu Gemüse- und Nudelaufläufen, Fleischgerichten, Pasta sowie zu mild-würzigem Hart- und Weichkäse', 'Sonnenmulde Bioweine - DI Andreas Schreiner', 'Sonnenmulde Bioweine', 'Neusiedlersee/Burgenland/Österreich', '54defae5-4622-4f7f-b265-575f722fdb55', 'manager', '2021-08-14 20:22:02', 'System', '2023-01-16 18:35:44', 818, 1064, 0, NULL, 0, 4.6, 'Weiling', 0, NULL, 0, 5, NULL, '2022-08-01 10:00:47', 1607.04, 'WINE_CHAMPAGNE', 'DRINKS', 1200, 31, 'VEGAN;VEGETARIAN', NULL, NULL),
(1046, 'Silvanter Alte Rebe trocken (Weiling)', '4037865000902', 1, 8.79, 1, 1, NULL, 0, '712529', 'Silvanter Alte Rebe trocken', 'Es offenbart sich eine klare und kompakte Frucht, die mit\neinem sehr ausgeglichenen Tanningerüst perfekt ausbalanciert ist.\nIm Nachhall lang anhaltende Fruchtnoten und moderate Säure.\n', 'Stefan Sander', 'Sander – ökologische Weine', 'Rheinhessen', '5f4c8d57-2ea1-4381-8ddf-e83f8e5a39b3', 'manager', '2021-08-14 20:23:08', 'System', '2023-05-03 02:06:11', 1023, 1065, 3, NULL, 0, 7.64, 'Weiling', 0, NULL, 0, 69, 'enthält SULFITE **aus biodynamischer Erzeugung', '2022-04-11 15:37:54', 2129.4, 'WINE_CHAMPAGNE', 'DRINKS', 1250, 35, 'VEGAN;VEGETARIAN', NULL, NULL),
(1047, 'b*Chardonnay, weiß (Weiling)', '4035626115247', 1, 4.99, 1, 1, NULL, 0, '710280', 'b*Chardonnay, weiß', 'Aromen nach Zitrusfrüchten, Äpfeln und Walnüssen. Das Weingut wurde 1890 von der Familie Tessari gegründet und wird heute in dritter Generation betrieben. Die 3 Geschwister Tessari haben das Weingut in die Spitzenklasse geführt.  Der Name des Weinguts kommt von einer kleinen Privatkapelle aus dem 15. Jahrhundert.', 'Weiling GmbH', 'bioladen', 'GERMANY', 'eae3755a-3cfa-4d64-aeaa-0355b4507177', 'manager', '2021-08-14 20:23:34', 'System', '2023-07-01 00:38:38', 426, 1066, 0, NULL, 0, 3.18, 'Weiling', 0, NULL, 0, 72, NULL, '2023-03-02 13:56:49', 1732.8, 'WINE_CHAMPAGNE', 'DRINKS', 1333.3, 30, 'VEGAN;VEGETARIAN', NULL, NULL),
(1048, 'Riesling trocken (Weiling)', '4037865000605', 1, 8.79, 1, 1, NULL, 0, '710525', 'Riesling trocken', 'Im Duft erinnert er an Pfirsich und Apfel, am Gaumen spürt man\neine frische und zugleich delikate Säure, untermalt von Anklängen\nan Limonen. Die Präsenz von CO2 unterstreicht die Frische.\n', 'Stefan Sander', 'Sander – ökologische Weine', 'Rheinhessen', '672bf5fd-9543-449b-b585-5870f5d19221', 'manager', '2021-08-14 20:23:54', 'System', '2023-07-01 00:20:48', 1109, 1067, 3, NULL, 0, 4.9, 'Weiling', 0, NULL, 0, 69, 'enthält SULFITE **aus biodynamischer Erzeugung', '2022-11-29 16:50:24', 1906.08, 'WINE_CHAMPAGNE', 'DRINKS', 1250, 33, 'VEGAN;VEGETARIAN', NULL, NULL),
(1049, 'Riesling Spätlese fruchtsüß (Weiling)', '4037865004207', 1, 9.99, 1, 1, NULL, 0, '710527', 'Riesling Spätlese fruchtsüß', 'Helle, fast grünliche Farbe, feinste Nuancen von Zitrus, Birne und\nPfirsich charakterisieren diese Spätlese. Feinfruchtig, mit\ndeutlicher Süße und harmonischer Säure. ', 'Stefan Sander', 'Sander – ökologische Weine', 'Rheinhessen', '35798b4a-f16b-4f54-8b5c-76409da31b57', 'manager', '2021-08-14 20:24:06', 'System', '2023-05-03 02:05:48', 1110, 1068, 3, NULL, 0, 5.4, 'Weiling', 0, NULL, 0, 69, 'enthält SULFITE **aus biodynamischer Erzeugung', '2022-06-23 05:07:48', 2129.4, 'WINE_CHAMPAGNE', 'DRINKS', 1250, 35, 'VEGAN;VEGETARIAN', NULL, NULL),
