(1052, 'Secco Weiß Piccolo (Weiling)', '4260004914321', 1, 2.99, 1, 1, NULL, 0, '710708', 'Secco Weiß Piccolo', NULL, 'Ökologisches Weingut Schmidt', 'Ökologisches Weingut Schmidt', 'Kaiserstuhl', 'ce81b46a-b421-40d4-8083-4f367bc22a0f', 'manager', '2021-08-14 20:49:20', 'System', '2023-07-01 00:21:57', 1040, 1069, 7, NULL, 0, 1.65, 'Weiling', 0, NULL, 0, 72, 'Traubenmost *aus kontrolliert ökologischer Erzeugung', '2022-04-11 15:08:49', 589.875, 'WINE_CHAMPAGNE', 'DRINKS', 450, 19.5, 'VEGAN;VEGETARIAN', NULL, NULL),
(1053, 'Sauvignon Blanc (Weiling)', '3760105594077', 1, 8.99, 1, 1, NULL, 0, '710137', 'Sauvignon Blanc', 'Seit dem 17. Jahrhundert wird auf der Domaine de L\'Atillon Wein angebaut. Eine lange Tradition, die in neuester Zeit von der Familie de Roux leidenschaftlich fortgeführt. Diese Leidenschaft schmeckt man in jedem ihrer Weine.\r\nAusdrucksvoller Wein mit Noten von Mango und Passionsfrucht. Eine exotische Frische.', 'Recolte', NULL, 'Frankreich', NULL, 'manager', '2021-08-14 21:10:11', 'System', '2023-07-01 00:38:13', 1063, NULL, 0, NULL, 0, 5, 'Weiling', 0, NULL, 0, NULL, NULL, '2023-02-27 14:42:24', 1500, 'WINE_CHAMPAGNE', 'DRINKS', NULL, 30, 'VEGAN', NULL, NULL),
(1054, 'Bacaretto Prosecco (Weiling)', '8017955000063', 1, 3.49, 1, 1, NULL, 0, '714508', 'Bacaretto Prosecco', 'Die Farbe ist ein helles Strohgelb, die Nase hat fruchtige und blumige Noten, mit Anklängen an Apfel und weiße Wildblumen. Im Mund ist er harmonisch und zart liebenswert.', 'PERLAGE s.r.l.', 'Perlage', 'ITALY', '0faa766c-4ec5-48fe-b2b6-27cae6a42279', 'manager', '2021-08-14 21:11:26', 'System', '2023-07-01 00:08:39', 375, 1814, 0, NULL, 0, 2.05, 'Weiling', 0, NULL, 0, 98, 'Glera Trauben', '2022-04-11 14:20:41', 421.401, 'WINE_CHAMPAGNE', 'DRINKS', 380, 18.4, 'VEGAN;VEGETARIAN', NULL, NULL),
(1055, 'Appléritif Apfel - Aronia &  Rose (alkoholfrei) (Weiling)', '4260086780593', 1, 9.99, 1, 1, NULL, 0, '719752', 'Appléritif Apfel - Aronia &  Rose (alkoholfrei)', 'Dieser alkoholfreie Apfelsekt ist eine Hommage an große Rotwein-Cuvées: Tief-Violett im Glas entfalten sich beim Öffnen duftende Noten von Aronia und ein Hauch von Rose. Am Gaumen präsentiert sich dieser Appléritif feinherb: die zurückhaltenden Tannine der Aroniabeere passen perfekt zum leichten Blütenduft der Rose. Ein ideales Getränk für festliche Anlässe oder zum Einstieg in einen besonderes Menü. Und der beste Beweis: Genuss braucht keinen Alkohol!\n\nIm Gegensatz zu Frucht-Secco oder konventionellem alkoholfreien Sekt, hat der Appléritif ein typisches, eigenes Aromenspektrum mit einem vollfruchtigen Geschmack: denn für den Appléritif werden die Äpfel nicht vergoren!\nHeißt: der sonst im Gärprozess entstehende Alkohol muss also auch nicht entzogen werden – denn er war ja nie drin! Stattdessen wird der frische Apfelsaft behutsam verperlt und  in der Flasche mit spannenden Extrakten und Essenzen kombiniert.\nDas Ergebnis: ein vollmundig, prickelndes Geschmackserlebnis – ganz ohne Alkohol!\n\nDurch sein  besonderes Herstellungsverfahren eignet er sich sogar als Erfrischung für schwangere Frauen oder Kinder.', 'Clostermann Organics', 'Clostermann', 'GERMANY', 'bf08faa3-d296-4389-a1af-918512bc22d4', 'manager', '2021-08-14 21:11:44', 'System', '2023-09-07 03:54:02', 421, 1070, 0, NULL, 0, 5.27, 'Weiling', 0, NULL, 0, 72, 'Saft aus Bio- Äpfeln* (85%)*, Aroniasaft* Kohlensäure, Holundersaft*, natürliches Rosenaroma* *aus kontrolliert ökologischer Erzeugung', '2023-01-30 15:34:06', 1771.88, 'WINE_CHAMPAGNE;OTHER_DRINKS', 'DRINKS', 1440, 31.5, 'VEGAN;VEGETARIAN;WITHOUT_ADDED_SUGAR', NULL, NULL),
(1056, '2020 Elbling SL feinherb (Weiling)', '4037273003021', 1, 5.99, 1, 1, NULL, 0, '715152', '2020 Elbling SL feinherb', 'feinherber, würzig-fruchtiger Wein, Handernte, hoher Reifegrad der Trauben', 'Weingut Ernst Hein', 'Weingut Ernst Hein', 'GERMANY', '52b3ebac-c39c-4246-bbf0-1c26b46d1ae4', 'manager', '2021-08-14 21:11:58', 'System', '2023-12-16 02:06:30', 657, 1071, 0, NULL, 0, 3.3, 'Weiling', 0, NULL, 0, 72, NULL, '2023-06-02 11:01:32', 1906.08, 'WINE_CHAMPAGNE', 'DRINKS', 1800, 33, 'VEGAN;VEGETARIAN', NULL, NULL),
(1057, 'Zero S rot - ungeschwefelt, histamingetestet (Weiling)', '4260065960602', 1, 10.49, 1, 1, NULL, 0, '712550', 'Zero S rot - ungeschwefelt, histamingetestet', 'Der Gustavshof Zero S ist ein komplett ohne Schwefelzusatz ausgebauter Rotwein für den alltäglichen Genuss.\n\nDer Zero S überzeugt durch seine dunklen Farbreflexe, fruchtigen Nuancen, weiche Tannine und seinen insgesamt unkomplizierten, ansprechenden, jugendlichen Charakter. Im Duft erinnert er an reife Waldbeeren und Schattenmorellen. Im Mund angekommen, zeigt er sich anschmiegsam und elegant mit reifen zurückhaltenden Tanninen.\n\nDie Weinberge dieses Weines stehen in den windgeschützen Seitentälern des Kloppberges. Dort findet man kalkreiche Mergelböden mit Lehmanteilen, die den Charakter sehr positiv beeinflussen.\n\nDer Gustavshof Zero S wird eher jung getrunken und hat seine Blütezeit in den ersten 2 Jahren. \n\n\nSpeiseempfehlungen \n\nDer Gustavshof Zero S ist ein sehr vielfältig einsetzbarer Essensbegleiter. Er passt hervorragend zu Geflügelgerichten und Pastas.\n\nServieren Sie den Wein  bei 18-20 °C oder leicht gekühlt.\nGeöffnet sollte die Flasche nicht länger als einen Tag stehen.', 'Andreas Roll', 'Gustavshof', 'Rheinhessen', '4bebfd99-2d2c-493b-b7de-b3a1aa2911b6', 'manager', '2021-08-14 21:12:10', 'System', '2023-12-17 03:06:26', 836, 1072, 2, NULL, 0, 5.5, 'Weiling', 0, NULL, 0, 72, 'Wein \nEnthält SULFITE **aus biodynamischer Erzeugung', '2023-04-14 09:21:52', 1906.08, 'WINE_CHAMPAGNE', 'DRINKS', 1200, 33, 'VEGAN;VEGETARIAN', NULL, NULL),
(1058, 'Zero S weiß - ungeschwefelt, histamingetestet (Weiling)', '4260065960268', 1, 10.49, 1, 1, NULL, 0, '712551', 'Zero S weiß - ungeschwefelt, histamingetestet', 'Der ZeroS weiss ist der erste ungeschwefelte, biodynamische Wein in einer klassisch, bekannten und beliebten Stilistik weißer Pinot-Weine. (Stand 2020)\nSeine Ansprechende, lebendige Frucht und sein vollmundiger Geschmack machen ihn zu einem vielfältig einsetzbaren, beliebten Essensbegleiter. Im Duft erinnert der Zero S weiß an Birne und Banane, im Geschmack spielt die milde Säure mit Ausgeglichenheit aus Kraft und Eleganz. Das Mundgefühl und der Geschmack ist gut anhaltend und sehr angenehm. Seine zarten Reflexe von rosa in der Farbe stammen von den rötlichen Grauburgunder-Trauben. Ohne Schwefelung bleiben diese Farbpigmente sehr gut erhalten und verleihen dem Wein Lebendigkeit.\n\nDie Reben für diesen Wein werden auf kalkreichen Böden, inmitten einer vielfältigen Pflanzenwelt biodynamisch nach Demeter-Richtlinien gepflegt und bearbeitet. Die vollreifen Trauben sind schonend gekeltert und werden in einer Spontangärung zu Wein. \n\nInformation für Allergiker: Der ZeroS weiss ist durch ein anerkanntes Labor auf Histamin untersucht und trägt das HistCheck Logo. Der Histamingehalt liegt unter der Nachweisgrenze von 0,25mg/l. \n\nDurch eine besonders dem Wesen der Rebe gerecht werdenden Erziehung, können wir diesen Wein unter Einsparung von mindestens 20% fossiler Rohstoffe erzeugen.\nServieren Sie den Wein am Besten gekühlt bei 10 -12° C\n', 'Andreas Roll', 'Gustavshof', 'Rheinhessen', '565fdc5b-1071-4fc2-a5b2-306e39530947', 'manager', '2021-08-14 21:12:34', 'System', '2023-12-17 03:06:28', 834, 1073, 2, NULL, 0, 5.5, 'Weiling', 0, NULL, 0, 72, 'Wein \nEnthält SULFITE **aus biodynamischer Erzeugung', '2023-04-14 09:21:59', 1906.08, 'WINE_CHAMPAGNE', 'DRINKS', 1200, 33, 'VEGAN;VEGETARIAN;WITHOUT_ADDED_SUGAR', NULL, NULL),
(1059, 'Bioperle (Weiling)', '4035447622221', 1, 8.99, 1, 1, NULL, 0, '712541', 'Bioperle', 'Bioperle Traubensecco', 'Weinhaus Sauer GbR', 'Weinhaus Sauer', 'Pfalz', 'ce242b75-84ef-4271-a617-5938d8109fb0', 'manager', '2021-08-14 21:12:52', 'System', '2023-11-18 02:12:39', 527, 1074, 1, NULL, 0, 5.11, 'Weiling', 0, NULL, 0, 63, 'Traubensaft, Kohlensäure, Antioxydationsmittel Ascorbinsäure *aus kontrolliert ökologischer Erzeugung', '2022-05-23 16:47:15', 2239.75, 'JUICE;WINE_CHAMPAGNE', 'DRINKS', 1200, 31, 'VEGAN;VEGETARIAN;HALAL;WITHOUT_ADDED_SUGAR', NULL, NULL),
(1060, 'Sauvignon Blanc Löss (Weiling)', '4035447110223', 1, 11.99, 1, 1, NULL, 0, '715012', 'Sauvignon Blanc Löss', 'Kompakter, noch jugendlicher Duft mit mineralischer Dichte und würzig, grasigen Noten im Vordergrund. Dazu gesellen sich zarte Anklänge an exotische Maracuja und reife Aprikosen, die von süßlicher Holunderblüte abgerundet werden. \nIm Mund konzentriert mit deutlicher Mineralität und leichtem, erfrischendem Moussieren. Die Säure ist deutlich präsent, wird aber vom dichten Extrakt und der zarten Süße gut in der Balance gehalten. Am Gaumen bleiben die fruchtigen Eindrücke und das dichte Mundgefühl sehr lange präsent. \n', 'Weingut Familie Sauer', 'Weingut Sauer', 'Pfalz', 'cbf050f7-ba13-4020-824d-7ae481190c70', 'manager', '2021-08-14 21:13:07', 'System', '2023-01-16 18:37:25', 1062, 1815, 1, NULL, 0, 6.53, 'Weiling', 0, NULL, 0, 63, 'Wein *aus kontrolliert ökologischer Erzeugung', '2022-11-29 16:53:53', 1715, 'WINE_CHAMPAGNE', 'DRINKS', 1200, 35, 'VEGAN;VEGETARIAN', NULL, NULL),
(1061, 'Sauerstoff red rot (Weiling)', '4035447200092', 1, 7.99, 1, 1, NULL, 0, '715060', 'Sauerstoff red rot', 'Kräftiges Purpurrot.\r\nWarmer würziger Duft von Brombeere, süßer Kirsche und dunklem Schokoladenkuchen, die von etwas schwarzem Pfeffer, einem Hauch von Nelke und Lakritz begleitet werden. \r\nIm Mund  weich mit ganz zarten Tanninen und milder, fruchtbetonter Restsüße. Die Säure präsentiert sich angenehm im Hintergrund und verleiht dem Wein eine gewisse Süffigkeit. Am Gaumen entwickeln sich dunkle Waldfrüchte und schwarze Kirschen, die im langen Finale deutlich nachklingen.', 'Weingut Familie Sauer', 'Weingut Sauer', 'Pfalz', '4d5d1584-9831-4e7a-8ba7-356124280d3e', 'manager', '2021-08-14 21:13:22', 'manager', '2023-02-27 14:40:06', 1065, 1816, NULL, NULL, 0, 4.32, 'Weiling', 0, NULL, 0, NULL, NULL, '2023-02-27 14:40:06', 1641.5, 'WINE_CHAMPAGNE', 'DRINKS', NULL, 33.5, 'VEGAN;VEGETARIAN', NULL, NULL),
(1062, 'Sauerstoff pink rose (Weiling)', '4035447200078', 1, 7.99, 1, 1, NULL, 0, '715062', 'Sauerstoff pink rose', 'Zartes Rotviolett.\nVerspielter Duft von roten Sommerfrüchten mit deutlichen Noten von  Kirsche und würzigen kleinen Erdbeeren. Dazu kommen süßlich-würzige Anklänge von Mandelblüten und einem Hauch Nougat. \nIm Mund leicht und weich mit feiner Restsüße und zartem Moussieren. Die präsente Säure führt den Wein und verleiht ihm Struktur, ohne sich dabei in den Vordergrund zu drängen. Am Gaumen zeigen sich Kirsche und Heidelbeeren, die mit einem Hauch Ananas langsam im Nachhall verblassen. \n', 'Weinhaus Sauer GbR', 'Weinhaus Sauer', 'Pfalz', '4a4dd198-3475-4a03-8e06-13036702a773', 'manager', '2021-08-14 21:13:38', 'System', '2023-01-16 18:37:27', 1066, 1817, 1, NULL, 0, 4.32, 'Weiling', 0, NULL, 0, 63, 'Wein *aus kontrolliert ökologischer Erzeugung', '2023-05-02 14:08:14', 1641.5, 'WINE_CHAMPAGNE', 'DRINKS', 1200, 33.5, 'VEGAN;VEGETARIAN', NULL, NULL),
(1063, 'Sauerstoff blanc weiss (Weiling)', '4035447200085', 1, 7.99, 1, 1, NULL, 0, '715064', 'Sauerstoff blanc weiss', 'Im Duft weich mit fruchtigen Noten von Melone, Kiwi und einem Hauch Banane.                        Dazu gesellen sich leicht nussige Mandelnoten und etwas duftiger Flieder.\r\nIm Mund mit frischer Säure, die von der leichten Restsüße sehr gut ausbalanciert wird. Am Gaumen wirkt der Wein strukturiert und mit viel Mundgefühl und es entwickeln sich Noten von frischer Ananas mit etwas Limette, die lange im Nachhall präsent bleiben.', 'Weingut Familie Sauer', 'Weingut Sauer', 'Pfalz', '24e936e2-97a3-436d-ad96-8c9a6c7db0f9', 'manager', '2021-08-14 21:14:02', 'manager', '2023-02-27 14:39:02', 1067, 1818, NULL, NULL, 0, 4.32, 'Weiling', 0, NULL, 0, NULL, NULL, '2023-02-27 14:39:02', 1641.5, 'WINE_CHAMPAGNE', 'DRINKS', NULL, 33.5, 'VEGAN;VEGETARIAN', NULL, NULL),
