(1066, 'Rivaner-Riesling Feinherb  (Weiling)', '4013584572319', 1, 6.49, 1, 1, NULL, 0, '710719', 'Rivaner-Riesling Feinherb ', 'Ein besonders reiner, auhentischer Wein mit klarer Zitrusfrucht und saftigen Apfelnoten. Die herbstliche Frische dieses Weines ist geprägt von einem spannenden Süße-Säure-Spiel. Einfach anregend! Der ideale Wein zu Frühlings- und Sommergerichten.', 'Friedrich Kiefer KG', 'Friedrich Kiefer', 'Kaiserstuhl', '51197d32-d559-4b11-bd52-be82896e8611', 'manager', '2021-08-14 21:14:40', 'System', '2023-12-17 03:08:59', 909, 1077, 0, NULL, 0, 3.2, 'Weiling', 0, NULL, 0, 72, 'Traubenmost *aus kontrolliert ökologischer Erzeugung', '2023-06-02 10:40:20', 1726.88, 'WINE_CHAMPAGNE', 'DRINKS', 1295, 30.7, 'VEGAN;VEGETARIAN', NULL, NULL),
