(1071, 'Soraloc Prosecco weiß (Weiling)', '8017955001046', 1, 7.99, 1, 1, NULL, 0, '718543', 'Soraloc Prosecco weiß', 'Die Farbe ist ein helles Strohgelb, die Nase ist fruchtig, mit Anklängen an reifen Apfel und Aprikose. Im Mund hat er frische, lange und anhaltende Aromen mit einer sehr feinen Perlage.', 'PERLAGE s.r.l.', 'Perlage', 'ITALY', '576754b8-ced6-4688-9d84-5a5915df4fd6', 'manager', '2021-08-14 21:29:48', 'System', '2023-07-01 00:15:44', 995, 1819, 0, NULL, 0, 4.45, 'Weiling', 0, NULL, 0, 98, 'Glera Trauben *aus kontrolliert ökologischer Erzeugung', '2022-04-11 14:39:16', 150.336, 'WINE_CHAMPAGNE', 'DRINKS', 475, 8.1, 'VEGAN;VEGETARIAN', NULL, NULL),
(1072, 'Grüner Veltliner Heideboden Bio-Qu.wein trocken (Weiling)', '9120001701100', 1, 8.49, 1, 1, NULL, 0, '716149', 'Grüner Veltliner Heideboden Bio-Qu.wein trocken', 'In der Nase überzeugt der Grüne Veltiner Heideboden mit schöner Fruchtaromatik und feinen Noten nach grünem Apfel. Am Gaumen ist er sehr fruchtbetont und würzig, mit einer schönen Harmonie und dem typischen Grünen Veltliner Pfefferl.  Die sehr gut eingebundene Säure macht den Wein sehr angenehm im Abgang.\nDer Grüne Veltliner passt gut zu Vorspeisen, kalten Platten, Salaten, Gemüseaufläufen, Nudelgerichten sowie hellen Fleischgerichten.', 'Sonnenmulde Bioweine - DI Andreas Schreiner', 'Sonnenmulde Bioweine', 'Neusiedlersee / Burgenland / Österreich', '6c433ae1-15f7-47a0-85fe-f243461116ed', 'manager', '2021-08-14 21:39:26', 'manager', '2023-05-03 16:48:55', 755, 1080, 0, NULL, 0, 4.6, 'Weiling', 0, NULL, 0, 5, NULL, '2023-06-02 11:01:47', 1607.04, 'WINE_CHAMPAGNE', 'DRINKS', 1200, 31, 'VEGAN;VEGETARIAN', NULL, NULL),
(1073, 'Pinkus Special 24er (Weiling)', '4023216000035', 1, 1.19, 1, 1, NULL, 0.08, '70301', 'Pinkus Special 24er', 'Rohstoffe aus biologischem Anbau, sorgfältige Herstellung durch Meisterhand und die ungefilterte Abfüllung geben Pinkus Special den unverwechselbaren Geschmack. Es wird nach dem Deutschen Reinheitsgebot hergestellt aus Bioland Malz, Hopfen aus kontrolliertem biologischen Anbau, Hefe und erstklassigem Brauwasser. Pinkus Special wird nicht mit Eiweißstabilisierungsmitteln behandelt. Durch eine etwa dreimonatige Lagerung bei Temperaturen um 0 Grad wird Pinkus Special natur-klar und kann ungefiltert abgefüllt werden.', 'Brauerei Pinkus Müller GmbH & Co. KG', 'Pinkus', 'GERMANY', '961ca5c9-9caf-437c-9975-08e4bb9c4ba9', 'correction', '2021-09-08 15:55:43', 'System', '2023-01-16 18:38:05', 1153, 115, 1, NULL, 24, 0.64, 'Weiling', 2, 1, 0, 63, NULL, '2023-06-02 11:03:32', 790.54, 'BEER', 'DRINKS', 600, 23.5, 'VEGAN;VEGETARIAN', NULL, NULL),
