(1076, 'Roggenkamp Honigbiene (Weiling)', '4260520780301', 0, 6.49, 1, 1, NULL, 0, '270931', 'Roggenkamp Honigbiene', 'Roggenkamp Organcis ist abhängig von natürlichen Rohstoffen, - dafür brauchen wir die Honigbiene zum bestäuben. Die Honigbiene hat Probleme, darum tun wir etwas. Dieser Editions-Becher ist Teil unserer Kampagne \"Projekt Honigbiene\".\n\nIn Deutschland ist die Zahl der Insekten in den letzten Jahren dramatisch zurückgegangen. Die Folgen für die Natur sind verheerend.\nAls Hersteller von Premium Bio-Lebensmitteln ist Roggenkamp Organcis von einer intakten Natur und einem Angebot von natürlichen Rohstoffen abhängig und somit direkt von dem Problem betroffen!\nFür mehr als 80 Prozent der Rohwaren die wir in unserer Produktion verwenden, ist eine Bestäubung durch die Biene notwendig. Nicht nur unsere wichtigste Mitarbeiterin, die Honigbiene, hat ein Problem - sondern letztlich wir alle. Darum müssen wir jetzt die Initiative ergreifen und gemeinsam\netwas tun.\nBitte unterstützen Sie unser Projekt Honigbiene. Mehr dazu: www.roggenkamp-organics.com/honigbiene', 'Roggenkamp Dairy GmbH', 'Roggenkamp Organics', 'GERMANY', '985250ca-82ee-43d2-8e58-02744e275b04', 'correction', '2021-09-17 14:00:10', 'System', '2023-02-07 02:05:17', 649, 257, 0, NULL, 0, 4.53, 'Weiling', 2, 1, 0, 190, NULL, '2022-11-29 16:06:28', 1041.41, 'ICECREAM_DESSERT_FROZEN', 'FROZEN', 400, 11.3, 'VEGETARIAN', NULL, NULL),
(1078, 'Bio Vegi Fresh Natur, vegan (Weiling)', '9011353843443', 0, 2.49, 1, 1, NULL, 0, '660921', 'Bio Vegi Fresh Natur, vegan', 'Vegane Kochcreme zum Verfeinern von Speisen. Glutenfrei.', 'Wojnar s Wiener Leckerbissen ', 'Green Heart', 'AUSTRIA', 'f6900bca-92a6-438f-bae7-c1108bc29fe2', 'manager', '2021-08-15 17:03:45', 'System', '2024-01-19 02:08:29', 922, 1083, 0, NULL, 0, 1.5, 'Weiling', 0, NULL, 0, 0, 'Sojabasis* (31%) (Wasser, SOJABOHNEN*), Kokosfett*, Wasser, Sonnenblumenöl*, Maisstärke*, Branntweinessig*, Speisesalz, Verdickungsmittel: Johannisbrotkernmehl*, Gewürz*. *aus kontrolliert ökologischer Erzeugung', '2022-07-12 14:02:42', 559.55, 'PRESERVED_MILK_DRINKS', 'FRESH;PANTRY', 211, 9.5, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
