(1080, 'Bio Ziegen-H-Milch 3,0% (Weiling)', '4104060031526', 0, 3.29, 1, 1, NULL, 0, '471701', 'Bio Ziegen-H-Milch 3,0%', 'Die Bio Ziegen H-Milch wird aus 100% Bio Ziegenmilch mit natürlichem Fettgehalt hergestellt. Die Bio Ziegen H-Milch ist homogenisiert und ultrahocherhitzt.\nOriginal verschlossen ohne Kühlung haltbar; \nProdukt ohne weitere Behandlung zum menschlichen Verzehr bestimmt. Ausgenommen sind Personen, die auf einzelne Inhaltsstoffe allergisch reagieren.\n', 'Andechser Molkerei Scheitz GmbH', 'Andechser Natur', 'AUSTRIA', '59491541-b83c-42c7-a6ab-f659e3f26087', 'manager', '2021-08-15 17:09:20', 'System', '2023-12-17 03:05:43', 763, 1085, 1, NULL, 0, 2.31, 'Weiling', 0, NULL, 0, 8, 'ZIEGENMILCH*, Stabilisator:\nNatriumcitrat. *aus kontrolliert ökologischer Erzeugung', '2022-04-11 15:50:59', 1135.08, 'PRESERVED_MILK_DRINKS', 'FRESH', 1062, 21.9, 'VEGETARIAN;GLUTENFREE', NULL, NULL),
