(1098, 'Holzofen-Pizza Pesto vegan (Weiling)', '4026813330390', 0, 5.99, 1, 1, NULL, 0, '274009', 'Holzofen-Pizza Pesto vegan', 'Die Steinofen-Pizzen von bio inside werden in Italien nach traditionellen Rezepten von Hand gefertigt. Ihren knusprig-zarten Boden verdanken sie der traditionellen Teigführung mit Bio-Hefe.  Nach einer 24-stündigen Ruhezeit wird der Teig von Hand geformt und mit Bio-Zutaten belegt. Die authentisch-italienische Note bekommt die Pizza durch das Vorbacken im Steinofen mit Holzfeuer.', 'Demeter-Felderzeugnisse GmbH', 'bio inside', 'ITALY', '7dfcc31b-0566-4702-a7ed-0836d9230146', 'manager', '2021-08-16 09:55:43', 'System', '2024-02-07 02:07:44', 811, 1507, 0, NULL, 0, 3.64, 'Weiling', 0, NULL, 0, 104, 'Belag: Tomatensauce* (Tomatenpassata*, Sonnenblumenöl*, Zwiebel*, Knoblauchpulver*, Basilikum*, Oregano*, Pfeffer*), veganer Pizzabelag* 17,4 % (Wasser, Kokosfett*, Kartoffelstärke*, LUPINENMEHL*, naturreines Salz, Curcuma*), Cocktailtomaten* 13 %, Pestosauce* 3,6 % [Wasser, Pesto* 33 % (Basilikum*, Sonnenblumenöl*, Salz), Spinat*, Maisstärke*, natives Olivenöl extra*, Knoblauch*], Teig: WEIZENMEHL*, Wasser, Meersalz, Sonnenblumenöl*, Hefe* *aus kontrolliert ökologischer Erzeugung', '2023-05-02 12:20:56', 1690, 'PIZZA_FROZEN;OTHER', 'FROZEN;OTHER', 419, 26, 'VEGAN;VEGETARIAN', NULL, NULL),
