(1104, 'MSC Kabeljau Filets  (Weiling)', '4250073450189', 0, 4.89, 1, 1, NULL, 0, '277832', 'MSC Kabeljau Filets ', 'Der followfood Kabeljau stammt aus der MSC-zertifizierten Fischerei des Nordostatlantiks. Konkret der Norwegischen See, der Barentssee und dem Gebiet um Spitzbergen und der Bäreninsel. Die Bestände dort sind außerordentlich gut gemanagt und die Quoten konnten die letzten Jahre kontinuierlich erhöht werden.', 'followfood GmbH', 'followfood', 'LITHUANIA', '13ac207a-01e4-4af8-9993-a5ac0d1c851e', 'manager', '2021-08-16 09:56:44', 'System', '2024-01-26 02:09:54', 1254, 1103, NULL, NULL, 0, 4.67, 'Weiling', 0, NULL, 0, NULL, 'KABELJAU**** ****aus Wildfang', '2022-10-01 00:02:01', 998.79, 'MEAT_FISH_FROZEN', 'FROZEN', 285.9, 19.7, NULL, NULL, NULL),
(1105, 'MSC 10 Fischstäbchen in Bio-Panade (Weiling)', '4250073451377', 0, 5.29, 1, 1, NULL, 0, '277854', 'MSC 10 Fischstäbchen in Bio-Panade', 'Fischstäbchen haben nicht umsonst Fans in wahrscheinlich allen Altersklassen. Saftiges Alaska-Seelachs Filet aus nachhaltiger Fischerei, umhüllt von einer knusprigen, goldgelben Bio-Panade. Wer kann da schon widerstehen?\nDer Alaska-Seelachs für die followfood Fischstäbchen stammt aus den Fanggebieten FAO 67 (Nordostpazifik) und FAO 61 (Nordwestpazifik). Der Nordostpazifik – genauer gesagt der Golf von Alaska und die Östliche Beringsee. Die Population dort ist stabil und strenges Management sorgt dafür, dass der Fischereidruck unter den festgelegten Referenzwerten bleibt.\nDer Fischereidruck steht für die Menge an Fisch, welche aus dem Meer entnommen wird. Nachhaltige Fischerei darf nicht mehr entnehmen, als nachwächst.\nNeben dem guten Management ist es wichtig, dass die Fischerei sehr selektiv ist. Bei unseren Fischern sind kaum Beifänge zu verzeichnen – der Fang besteht im Durchschnitt zu 98 % aus der Zielart, dem Alaska-Seelachs. Beide Faktoren, das Management und die Selektivität sind entscheidend für die Nachhaltigkeit der Fischerei. Und diese hat hier praktisch schon Tradition. Als eine der Ersten weltweit erhielten die US-amerikanischen Alaska-Seelachs Fischereien schon im Jahr 2005 das MSC-Siegel für nachhaltige Arbeitsweise.\nIm Nordwestpazifik - genauer gesagt im Ochotskisches Meer findet der Fischfang hauptsächlich im Winter und Frühling von Januar bis Anfang April statt. In dieser Vor- und Hauptlaichzeit bildet Alaska-Seelachs dichte Ansammlungen von Fischen. Die Fischerei in diesem Fanggebiet ist dabei sehr selektiv und hat fast keine Beifänge. So besteht der Fang zu 99 % aus Alaska Seelachs. Der Bestand ist dabei sowohl was die Managementziele für Fischereidruck als auch Populationsgröße angeht, vollkommen im grünen Bereich.', 'followfood GmbH', 'followfood', 'GERMANY', '808d9aa4-d515-48f5-89b0-b8fd216b1907', 'manager', '2021-08-16 09:56:55', 'System', '2024-01-17 02:07:56', 1218, 1104, NULL, NULL, 0, 3.2, 'Weiling', 0, NULL, 0, 63, 'ALASKA-SEELACHS**** 65%, Panade* (WEIZENMEHL*, Wasser, Speisesalz, Hefe*), Sonnenblumenöl*. *aus kontrolliert ökologischer Erzeugung ****aus Wildfang', '2023-06-23 11:19:24', 547.08, 'OTHER', 'OTHER', 265, 18.8, NULL, NULL, NULL),
(1106, 'MSC Schlemmerfilet mit Bio-Bordelaise (Weiling)', '4250073451162', 0, 5.99, 1, 1, NULL, 0, '277856', 'MSC Schlemmerfilet mit Bio-Bordelaise', 'Der Klassiker unter den Schlemmerfilets und immer wieder lecker! Followfood verwendet selbstverständlich hochwertiges Alaska-Seelachs Filet aus nachhaltiger Fischerei und beste Bio-Zutaten. Mit dem würzig abgeschmeckten Schlemmerfilet Bio-Bordelaise kommt der Fischgenuss schnell und einfach auf den Teller.\nDer Alaska-Seelachs für das followfood Schlemmerfilet stammt aus dem Fanggebiet FAO 67. Das ist der Nordostpazifik – genauer gesagt der Golf von Alaska und die Östliche Beringssee. Die Population dort ist stabil und strenges Management sorgt dafür, dass der Fischereidruck unter den festgelegten Referenzwerten bleibt.\nDer Fischereidruck steht für die Menge an Fisch, welche aus dem Meer entnommen wird. Nachhaltige Fischerei darf nicht mehr entnehmen, als nachwächst.\nNeben dem guten Management ist es wichtig, dass die Fischerei sehr selektiv ist. Bei den followfood Fischern sind kaum Beifänge zu verzeichnen – der Fang besteht im Durchschnitt zu 98% aus der Zielart , dem Alaska-Seelachs. Beide Faktoren, das Management und die Selektivität sind entscheidend für die Nachhaltigkeit der Fischerei.\nUnd diese hat hier praktisch schon Tradition. Als eine der Ersten weltweit erhielten die US-amerikanischen Alaska-Seelachs Fischereien schon im Jahr 2005 das MSC-Siegel für nachhaltige Arbeitsweise.', 'followfood GmbH', 'followfood', 'GERMANY', 'ce72557c-870d-4ac3-be72-23e458c7fa9e', 'manager', '2021-08-16 09:57:05', 'System', '2024-01-17 02:08:01', 1057, 1105, NULL, NULL, 0, 4.58, 'Weiling', 0, NULL, 0, 63, 'Alaska-SEELACHS**** 71%, Kräuterauflage* 29% (Wasser, WEIZENMEHL*, BUTTER*, Sonnenblumenöl*, Zwiebeln*, Kräuter* 1,2% [Petersilie*, Dill*], Maisstärke*, Salz, Roh-Rohrzucker*, Reismehl*, Gewürze [Paprika*, Kurkuma*], Knoblauch*, Hefe*, Pastinakenpulver*, Olivenöl*, Karottenpulver*). *aus kontrolliert ökologischer Erzeugun