(1145, 'Gartenkräuter fein gehackt (Weiling)', '4031829253205', 0, 1.79, 1, 1, NULL, 0, '271601', 'Gartenkräuter fein gehackt', 'Die Ökoland Garten-Kräuter präsentieren sich als Bio-Kräuterkomposition aus 6 beliebten Küchenkräutern wie Kresse, Schnittlauch, Sauerampfer, Basilikum, Dill und Petersilie. Sie werden sorgfältig nach strengen Bio-Richtlinien angebaut und erntefrisch tiefgefroren. Fein gehackt, streufähig, in der praktischen wiederverschließbaren Faltschachtel sind sie unverzichtbare Helfer in jeder Küche.', 'Ökoland GmbH Nord', 'ÖKOLAND', 'GERMANY', '418d3558-5019-471b-b31a-22251da28f6a', 'manager', '2021-08-16 10:04:54', 'System', '2023-12-12 02:07:05', 1222, 1124, 0, NULL, 0, 0.92, 'Weiling', 0, NULL, 0, 63, 'Kresse*, Schnittlauch*, Sauerampfer*, Basilikum*, Dill* (in veränderlichen Gewichtsanteilen), Petersilie*. *aus kontrolliert ökologischer Erzeugung', '2023-05-30 10:31:03', 225.75, 'VEGETABLES_HERBS_FROZEN', 'FROZEN', 58.7, 10.5, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE;PALMOILFREE;WITHOUT_ADDED_SUGAR', NULL, NULL),
