(1149, 'Kräuter Italienische Art (Weiling)', '4031829253601', 0, 1.79, 1, 1, NULL, 0, '271606', 'Kräuter Italienische Art', 'Die Ökoland Italienischen Kräuter sind eine feine Bio-Kräutermischung aus mediterranen Gewürzen wie Petersilie, Basilikum, Bärlauch, Thymian, Oregano und roten Zwiebeln. Sie dürfen bei der Zubereitung vieler italienischer Speisen nicht fehlen und bringen einen Hauch von südländischer Lebensfreude in die Gerichte. Sie werden sorgsam angebaut und erntefrisch tiefgefroren. Streufähig in der praktischen wiederverschließbaren Schachtel haben sie als wertvolle Zutat einen festen Platz in jeder Küche.', 'Ökoland GmbH Nord', 'ÖKOLAND', 'GERMANY', 'bcbdbb89-9cc2-4f73-9271-fd9d47b74efc', 'manager', '2021-08-16 10:05:50', 'System', '2023-12-12 02:06:59', 1406, 1128, 0, NULL, 0, 0.9, 'Weiling', 0, NULL, 0, 63, 'Kräuter* (Petersilie*, Basilikum*, Schnittknoblauch*, Thymian*, Oregano*), 32 % rote Zwiebeln*. *aus kontrolliert ökologischer Erzeugung', '2022-04-11 14:36:49', 225.75, 'VEGETABLES_HERBS_FROZEN', 'FROZEN', 58.7, 10.5, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE;PALMOILFREE;WITHOUT_ADDED_SUGAR', NULL, NULL),
(1150, 'Suppengrün (Weiling)', '4031829253700', 0, 1.19, 1, 1, NULL, 0, '271608', 'Suppengrün', 'Das Ökoland Suppengrün ist eine Bio-Gemüsemischung aus typischen Gemüsesorten und Kräutern, wie aus dem eigenen Garten. Diese werden sorgsam angebaut und erntefrisch tiefgefroren. Sie werden so aufeinander abgestimmt, dass sie besonders Gemüsegerichte, Salate und Brühen würzen und verfeinern. Streufähig in der praktischen wiederverschließbaren Faltschachtel sind sie ein unverzichtbarer Küchenhelfer.', 'Ökoland GmbH Nord', 'ÖKOLAND', 'GERMANY', 'a8365275-e940-4b76-9a8b-d46fdca507eb', 'manager', '2021-08-16 10:06:02', 'System', '2023-12-12 02:06:17', 972, 1129, 0, NULL, 0, 0.7, 'Weiling', 0, NULL, 0, 63, 'Karotten*, SELLERIE*, Porree*, 17% Petersilie*, 5% Zwiebeln*. *aus kontrolliert ökologischer Erzeugung', '2022-12-23 13:19:58', 225.75, 'VEGETABLES_HERBS_FROZEN', 'FROZEN', 83.7, 10.5, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE;PALMOILFREE;WITHOUT_ADDED_SUGAR', NULL, NULL),
(1151, 'Tagliatelle Verde mit Bio-Lachsfilet (Weiling)', '4031829254950', 0, 6.59, 1, 1, NULL, 0, '275017', 'Tagliatelle Verde mit Bio-Lachsfilet', 'Der Fisch ist bio-zertifiziert und wird in ökologischer Aquakultur aufgezogen. Der Bio-Lachs stammt aus Norwegen, Irland und Schottland.', 'Ökoland GmbH Nord', 'ÖKOLAND', 'GERMANY', '63530d41-f3ff-407d-a8c4-09500063b810', 'manager', '2021-08-16 10:06:14', 'manager', '2023-02-02 10:45:09', 962, 1130, 0, NULL, 0, 3.95, 'Weiling', 0, NULL, 0, 63, '38% Bandnudeln gegart*, (Wasser, HARTWEIZENGRIEß*, Spinat*), gelbe Karotten*, 10% Cherrytomaten*, 9% LACHSFILET***, SAHNE*, Wasser, CRÈME FRAICHE*, Zwiebeln*, BUTTER*, Maisstärke*, Meersalz, Dill*, Knoblauch*, Roh-Rohrzucker*. *aus kontrolliert ökologischer Erzeugung ***aus anerkannt ökologischer Aquakultur', '2023-02-02 10:45:09', 1225, 'CONVENIENCE_PASTRY_FROZEN;OTHER', 'FROZEN;OTHER', 429, 17.5, 'PALMOILFREE', NULL, NULL),
(1152, 'Tagliatelle Gorgonzola mit Blattspinat (Weiling)', '4031829254967', 0, 4.99, 1, 1, NULL, 0, '275020', 'Tagliatelle Gorgonzola mit Blattspinat', 'Einfach lecker: Bio Bandnudeln fein abgestimmt mit Gorgonzola, cremig, mit ansprechendem Blattspinat, fruchtig abgerundet mit feinen Tomatenwürfeln. Hinweis: das Produkt enthält gemäß der Produktionsweise für Gorgonzola tierisches Lab.', 'Ökoland GmbH Nord', 'ÖKOLAND', 'GERMANY', '685f6e2c-54f7-4f9d-8109-ec9488fd6d47', 'manager', '2021-08-16 10:06:26', 'System', '2023-01-21 02:09:09', 964, 1131, 0, NULL, 0, 2.98, 'Weiling', 0, NULL, 0, 63, '41% Bandnudeln* gegart (Wasser, HARTWEIZENGRIEß*), 17% Blattspinat*, 13% Tomaten*, Wasser, CRÈME FRAîCHE*, 2% GORGONZOLA*, HARTKÄSE*, Stärke* (Mais*, Kartoffel*, Reis*), Meersalz, EDAMER*, Reismehl*, Knoblauch*, BUTTER*, Gemüsepulver* (Pastinaken*, Zwiebeln*, Karotten*), Gewürze* (Muskatnuss*, Kurkuma*), Olivenöl*, Speisesalz. Hinweis: Produkt enthält tierisches Lab. *aus kontrolliert ökologischer Erzeugung', '2022-04-11 15:43:15', 1225, 'OTHER', 'OTHER', 429, 17.5, 'PALMOILFREE;WITHOUT_ADDED_SUGAR', NULL, NULL),
(1153, 'Bratnudeln mit Gemüse (Weiling)', '4031829255025', 0, 4.39, 1, 1, NULL, 0, '275035', 'Bratnudeln mit Gemüse', 'Bio-Gemüsemischung (58%) mit Bandnudeln nach asiatischer Art, exotisch abgeschmeckt, tiefgefroren.', 'Ökoland GmbH Nord', 'ÖKOLAND', 'GERMANY', 'f7f3887a-399d-452b-b97f-3d1346f8c523', 'manager', '2021-08-16 10:06:37', 'System', '2023-12-12 02:07:20', 545, 1132, 0, NULL, 0, 2.64, 'Weiling', 0, NULL, 0, 63, '33% Bandnudeln* gegart (Wasser, HARTWEIZENGRIEß*), Weißkohl*, Karotten*, Gemüsepaprika*, Mungobohnenkeime*, Zwiebeln*, Porree*, Sojasauce* (Wasser, SOJABOHNEN*, WEIZEN*, Meersalz), Sonnenblumenöl*, Meersalz, Maisstärke*, Tomatenmark*, Knoblauch*, Gewürze* (Koriander*, Paprika*, Kreuzkümmel*, Pfeffer*, Cayennepfeffer*). *aus kontrolliert ökologischer Erzeugung', '2023-03-02 13:37:22', 1225, 'CONVENIENCE_PASTRY_FROZEN;OTHER', 'FROZEN;OTHER', 429, 17.5, 'VEGAN;VEGETARIAN;PALMOILFREE;WITHOUT_ADDED_SUGAR', NULL, NULL),
(1154, 'Feinste Bio-Eiscreme Karamell mit Meersalz (Weiling)', '4260520780288', 0, 7.39, 1, 1, NULL, 0, '270905', 'Feinste Bio-Eiscreme Karamell mit Meersalz', 'Wir stehen für eine Qualität, die man schon längst vergessen glaubte. Unsere Produkte stehen uneingeschränkt für Klasse statt Masse. So entstehen besondere Lebensmittel aus kontrolliert ökologischem Anbau. Mit unserer überarbeiteten Rezeptur \"Karamell mit Meersalz\" ist unser Karamell Eiscreme nun zeitgemäßer und mehr im Trend.', 'Roggenkamp Dairy GmbH', 'Roggenkamp Organics', 'GERMANY', '00039ea1-d09d-4b64-afb7-5e25d31dcb52', 'correction', '2021-09-17 13:59:39', 'System', '2023-01-16 18:45:39', 651, 256, 0, NULL, 0, 4.53, 'Weiling', 2, 1, 0, 190, NULL, '2023-04-24 22:47:38', 1041.41, 'ICECREAM_DESSERT_FROZEN', 'FROZEN', 400, 11.3, 'VEGETARIAN', NULL, NULL);
