(1156, 'Himbeeren TK (Weiling)', '4026584103308', 0, 5.69, 1, 1, NULL, 0, '272003', 'Himbeeren TK', 'Voller Himbeergeschmack für das ganze Jahr: ob fürs Müsli, den Smoothie oder den Himbeerkuchen. Mit unseren SOTO Tiefkühl-Himbeeren lässt sich das herrlich fruchtige Aroma des Sommers jederzeit in Ihrer Küche einsetzen.', 'organic veggie food GmbH', 'SOTO', 'GERMANY', '61754615-40f0-4afd-87b2-42108cb70eab', 'manager', '2021-08-16 10:07:09', 'System', '2023-11-26 02:05:27', 1531, 1133, 0, NULL, 0, 3.39, 'Weiling', 0, NULL, 0, 61, 'Himbeeren* tiefgefroren *aus kontrolliert ökologischer Erzeugung', '2022-12-12 08:20:45', 773.344, 'FRUITS_FROZEN', 'FROZEN', 321, 14.3, 'VEGAN;VEGETARIAN;RAWFOOD', NULL, NULL),
(1157, 'Beerenmischung (Weiling)', '4026584103339', 0, 4.69, 1, 1, NULL, 0, '272008', 'Beerenmischung', 'Tief dunkelrote Brombeeren, fruchtig-herbsüße Wild-Heidelbeeren, saftige rote Johannisbeeren, vollaromatische Himbeeren und süß-säuerliche schwarze Johannisbeeren machen unsere leckere Tiefkühl-Beeren-Mischung zu einem wahren Highlight. Genießen Sie den puren Geschmack des Sommers etwa in Form fruchtiger Smoothies, herrlichem veganen Beeren-Cheesecake oder samtiger Beerencreme mit veganer weißer Schokomousse. Grenzenloses vollreifes Aroma – das ganze Jahr!', 'organic veggie food GmbH', 'SOTO', 'GERMANY', '7a3f4799-44d6-4626-82c9-6a4a1b0daf48', 'manager', '2021-08-16 10:07:22', 'System', '2023-11-26 02:05:37', 399, 1134, 0, NULL, 0, 2.87, 'Weiling', 0, NULL, 0, 61, 'Wild-Heidelbeeren* tiefgefroren, Brombeeren* tiefgefroren, Johannisbeeren* rot tiefgefroren, Himbeeren* tiefgefroren, Johannisbeeren* schwarz tiefgefroren *aus kontrolliert ökologischer Erzeugung', '2022-12-12 08:20:16', 773.344, 'FRUITS_FROZEN', 'FROZEN', 321, 14.3, 'VEGAN;VEGETARIAN;RAWFOOD', NULL, NULL),
(1158, 'Wild-Heidelbeeren (Weiling)', '4026584103322', 0, 4.69, 1, 1, NULL, 0, '272009', 'Wild-Heidelbeeren', 'Unsere leckeren Tiefkühl-Heidelbeeren mit dem unverwechselbar fruchtig-herbsüßen Geschmack und der typisch tiefblauen Farbe sind echte Waldblaubeeren mit vielen wertvollen Inhaltsstoffen. Natürlich, echt und vielseitig verwendbar. Für die kreative Beerenküche das ganze Jahr über.', 'organic veggie food GmbH', 'SOTO', 'GERMANY', 'aff7883d-dc79-46e2-9a07-d553d84d45e7', 'manager', '2021-08-16 10:07:33', 'System', '2023-11-26 02:05:47', 793, 1135, 0, NULL, 0, 2.87, 'Weiling', 0, NULL, 0, 61, 'Heidelbeeren* tiefgefroren *aus kontrolliert ökologischer Erzeugung', '2022-12-12 08:20:07', 773.344, 'FRUITS_FROZEN', 'FROZEN', 321, 14.3, 'VEGAN;VEGETARIAN;RAWFOOD', NULL, NULL),
(1159, 'Erdbeeren (Weiling)', '4026584103315', 0, 3.99, 1, 1, NULL, 0, '272011', 'Erdbeeren', 'Unsere aromatischen Tiefkühlfrüchte stehen mit ihrem voll-erdbeerigen Geschmack und ihrer feinen Süße frischen Erdbeeren wirklich nur im Aussehen nach. Das zarte Zellgerüst der Beeren geht nach dem Gefrieren „aus der Form“, doch der vollfruchtige Geschmack bleibt. Damit verlängern wir die Erdbeersaison auf das ganze Jahr.', 'organic veggie food GmbH', 'SOTO', 'GERMANY', '6647193e-cbd9-4711-961c-8a27c829910b', 'correction', '2021-09-25 12:53:25', 'System', '2023-11-26 02:05:57', 1692, 297, 0, NULL, 0, 2.38, 'Weiling', 0, NULL, 0, 61, 'Erdbeeren* tiefgefroren *aus kontrolliert ökologischer Erzeugung', '2022-11-29 16:09:02', 773.344, 'FRUITS_FROZEN', 'FROZEN', 321, 14.3, 'VEGAN;VEGETARIAN;RAWFOOD', NULL, NULL),
(1160, 'gewürfelte Mango (Weiling)', '4026584103360', 0, 3.59, 1, 1, NULL, 0, '272019', 'gewürfelte Mango', 'Ob Mango-Lassi, Mango-Chutney oder Mango-Curry, unsere Tiefkühl-Mango-Würfel bringen exotisches Flair in jede Küche. Genießen Sie den fruchtigen Geschmack von Paradies und Sonnenschein das ganze Jahr.', 'organic veggie food GmbH', 'SOTO', 'GERMANY', 'a3d5e907-7a82-4d69-ad5b-65b23a9d756a', 'manager', '2021-08-16 10:07:54', 'System', '2023-11-05 02:11:45', 1461, 1136, 0, NULL, 0, 2.36, 'Weiling', 0, NULL, 0, 61, 'Mango* tiefgefroren *aus kontrolliert ökologischer Erzeugung', '2022-11-11 10:00:15', 773.344, 'FRUITS_FROZEN', 'FROZEN', 321, 14.3, 'VEGAN;VEGETARIAN;RAWFOOD', NULL, NULL),
(1161, 'Süßkartoffel-Chia-Fritten (Weiling)', '4026584104312', 0, 4.79, 1, 1, NULL, 0, '272021', 'Süßkartoffel-Chia-Fritten', 'Superfood Gemüse-Fritten par excellence: Milde Süßkartoffel und exotische Chia-Samen treffen auf eine Kombination aus Kürbis, Karotten und Kartoffeln. Feine Gewürze verleihen den knusprigen Stäbchen ihren individuellen Charakter und sorgen für ein einzigartiges Geschmackserlebnis.', 'organic veggie food GmbH', 'SOTO', 'GERMANY', '277293b2-f103-4b2f-92c6-ff496e6453d2', 'manager', '2021-08-16 10:08:04', 'System', '2023-11-21 02:06:03', 967, 1137, 0, NULL, 0, 2.93, 'Weiling', 0, NULL, 0, 61, 'Süßkartoffeln* (17%), Hokkaido-Kürbis* (15%), Karotten* (15%), Kartoffeln* (15%), EMMER* (URWEIZEN*), Maisgrieß*, Zwiebeln* (6%), Semmelbrösel* (WEIZENMEHL*, Wasser, Salz, Hefe*), Chiasamen* (Salvia hispanica) (3%), Sonnenblumenöl*, Salz, Gewürze* *aus kontrolliert ökologischer Erzeugung', '2023-03-07 10:00:50', 2280, 'CONVENIENCE_PASTRY_FROZEN;OTHER', 'FROZEN;OTHER', 408, 28.5, 'VEGAN;VEGETARIAN;PALMOILFREE', NULL, NULL),
(1162, 'Eiscreme Bourbon-Vanille (Weiling)', '4065626114889', 0, 3.99, 1, 1, NULL, 0, '270851', 'Eiscreme Bourbon-Vanille', 'Für die bioladen*Eiscreme werden frische Milch und Sahne als Basis zu cremig-feinen Eisspezialitäten veredelt. Bourbon-Vanille sorgt für den echten Vanillegeschmack.\n', 'Weiling GmbH', 'bioladen', 'GERMANY', '6a6e6179-777c-4c00-af75-a6ca4055da8e', 'manager', '2021-08-16 10:08:16', 'System', '2023-10-14 02:10:23', 428, 1138, 3, NULL, 0, 2.36, 'Weiling', 0, NULL, 0, 60, 'entrahmte MILCH*, SAHNE* 34 %, Rohrohrzucker*, EIGELB*,  Glukosesirup*, MAGERMILCHPULVER*, Stabilisator: Johannisbrotkernmehl*, Bourbon-Vanilleextrakt*, gemahlene Bourbon-Vanilleschoten* *aus kontrolliert ökologischer Erzeugung', '2022-11-29 15:45:27', 825.158, 'ICECREAM_DESSERT_FROZEN', 'FROZEN', 320, 11.4, 'VEGETARIAN', NULL, NULL),
