(1201, 'Chakalaka, gereift (BIO) (Weiling)', '4260394567039', 0, 6.79, 1, 1, NULL, 0, '334455', 'Chakalaka, gereift (BIO)', 'Welch köstliche Geschmacksexplosion, die eine pikante Schärfe mit einem Traum aus südafrikanischen Gewürzen vereint. \n\nDr. Mannah´s Tipp: Den Chakalaka genieße ich am Liebsten als Base auf Pizza oder Flammkuchen. Die Schärfe und Würze des Gereiften ist eine wirklich großartige Abwechslung zu einfacher Tomatensoße.\nGreif zu und probiere dich durch die Würze Südafrikas. Du suchst noch weitere köstliche Geschmackserlebnisse?  \nUnsere Gereiften gibt es noch in 12 abwechslungsreichen Sorten.', 'Happy Cheeze GmbH', 'Dr. Mannah´s Vegan Passion', 'GERMANY', 'acaf3f8b-8c1c-42ad-974c-05fddaa78a2f', 'correction', '2021-08-21 16:56:41', 'System', '2023-01-16 18:50:25', 1232, 1173, 0, NULL, 0, 4.28, 'Weiling', 0, NULL, 0, 64, 'CASHEWKERNE* (62%), Wasser, Gewürzmischung* (5,5%) (Paprika*, Steinsalz, Tomate*, Zwiebel*, Chilis*, Pfeffer schwarz*, Kreuzkümmel*, Bockshornklee*, Kurkuma*, Koriander*, Paprika geräuchert* [Paprika*, Rauch]*,Kardamom*, Nelken*, Ceylonzimt*,Ingwer*,Petersilie*, Piment*), Salz, vegane Fermentationskulturen. *aus kontrolliert ökologischer Erzeugung', '2022-05-24 12:09:13', 271.04, 'VEGAN_VEGETARIAN', 'FRESH', 110.5, 8.8, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
