(1206, 'Frische Tortelli mit Ricotta & Spinat 250 g (Weiling)', '4000915029161', 0, 4.39, 1, 1, NULL, 0, '661589', 'Frische Tortelli mit Ricotta & Spinat 250 g', 'Diese feine klassische Tortelli Variante, gefüllt mit Käse und Spinat lässt jedes Nudelliebhaber Herz höher schlagen. Die großen Teigtaschen sind nach traditionellem italienischen Rezept hergestellt und beinhalten eine cremige Füllung die über 50 % der Gesamtnudel ausmacht. ', 'Isana Naturfeinkost GmbH & Co. Produktions- und Handels KG', 'bio-verde', 'ITALY', '9d5c4405-28f2-4baa-965a-fea4e55b5ad4', 'manager', '2021-08-16 10:16:39', 'System', '2023-09-30 00:03:11', 946, 1176, 0, NULL, 0, 2.72, 'Weiling', 0, NULL, 0, 102, 'HARTWEIZENGRIEß*, EIER*, RICOTTA*\n(14%), Spinat* (9%), Kartoffelflocken*,\nPaniermehl*(WEIZENMEHL*, Steinsalz, Hefe),\nSonnenblumenöl*, HARTKÄSE*, Meersalz,\nBUTTER*, Muskat* *aus kontrolliert ökologischer Erzeugung', '2022-11-08 02:05:24', 1247, 'GOURMET_CONVENIENCE', 'FRESH', 270, 21.5, 'VEGETARIAN', NULL, NULL),
