(1208, 'Oliven-Mix ohne Stein 150 g (Weiling)', '4000915102239', 0, 4.99, 1, 1, NULL, 0, '150759', 'Oliven-Mix ohne Stein 150 g', 'Für alle Liebhaber beider Oliven Sorten gibt’s von bio-verde einen Mix aus grünen und schwarzen Oliven. Diese stammen aus Griechenland/Spanien und werden schonend im Salzwasserbad entbittert. Belohnt wird das aufwendige Verfahren mit einem authentischen Olivenaroma.', 'Isana Naturfeinkost GmbH & Co. Produktions- und Handels KG', 'bio-verde', 'GERMANY', '9449cac4-ff10-45ce-a1fb-e001797e78fe', 'manager', '2021-08-16 10:17:01', 'System', '2023-10-27 02:05:59', 1378, 1178, 0, NULL, 0, 3.12, 'Weiling', 0, NULL, 0, 64, 'grüne und schwarze Oliven* (92 %), Kräuter* (3% - Basilikum*,\nPetersilie*, Oregano*, Thymian*, Rosmarin*), Sonnenblumenöl*,\nMeersalz, Olivenöl*, konzentrierter Zitronensaft*, Kartoffelflocken* *aus kontrolliert ökologischer Erzeugung', '2022-07-31 00:00:50', 513.216, 'GOURMET_CONVENIENCE', 'FRESH', 170, 14.4, 'VEGAN;VEGETARIAN', NULL, NULL),
(1209, 'Grüne Oliven gefüllt mit Knoblauch 150 g (Weiling)', '4000915102277', 0, 5.39, 1, 1, NULL, 0, '150763', 'Grüne Oliven gefüllt mit Knoblauch 150 g', 'Die grünen Oliven mit Knoblauch-Füllung stammen aus Spanien oder Griechenland und werden nach Ihrem Salzwasserbad bei bio-verde mit verschiedenen Kräutern und einer Spur Öl veredelt.', 'Isana Naturfeinkost GmbH & Co. Produktions- und Handels KG', 'bio-verde', 'GERMANY', 'dd0ad674-ee54-47db-9f89-bc560a514cff', 'manager', '2021-08-16 10:17:12', 'System', '2023-09-24 02:12:29', 751, 1179, 0, NULL, 0, 3.3, 'Weiling', 0, NULL, 0, 64, 'grüne Oliven* (82 %), Knoblauch* (10%), Kräuter* (3% -\nBasilikum*, Petersilie*, Oregano*, Thymian*, Rosmarin*),\nSonnenblumenöl*, Meersalz, Olivenöl*, konzentrierter\nZitronensaft*, Kartoffelflocken* *aus kontrolliert ökologischer Erzeugung', '2022-11-29 16:18:58', 532.8, 'GOURMET_CONVENIENCE', 'FRESH', 170, 14.4, 'VEGAN;VEGETARIAN', NULL, NULL),
(1210, 'Prepack Toskana-Mix (Weiling)', '4000915105636', 0, 2.99, 1, 1, NULL, 0, '150933', 'Prepack Toskana-Mix', 'Ein besonderes geschmackliches Highlight von bio-verde bietet der Toskana-Mix. Hier vereinen sich gleich 5 Top Produkte zu einem Antipasti-Mix bestehend aus schwarzen und grünen Oliven , sonnengetrockneten Tomaten, Artischockenherzen und Peperoni an feiner Spezial-Marinade.', 'Isana Naturfeinkost GmbH & Co. Produktions- und Handels KG', 'bio-verde', 'GERMANY', '1979c024-f673-4dc0-b235-a5eeea7725fb', 'manager', '2021-08-16 10:17:23', 'System', '2023-09-07 02:55:23', 940, 1180, 0, NULL, 0, 1.95, 'Weiling', 0, NULL, 0, 64, 'Gemüse* 92% in veränderlichen Gewichtsanteilen (Artischocken*, grüne Oliven*, schwarze Oliven*, getrocknete Tomaten*, Peperoni*), Sonnenblumenöl*, Meersalz, Olivenöl*, Weißweinessig*,Thymian*, Branntweinessig* *aus kontrolliert ökologischer Erzeugung', '2022-11-29 17:03:28', 469.3, 'GOURMET_CONVENIENCE', 'FRESH', 107, 9.5, 'VEGAN;VEGETARIAN;PALMOILFREE', NULL, NULL),
(1211, 'Pesto frisch Genovese (Weiling)', '4000915104516', 0, 4.19, 1, 1, NULL, 0, '151170', 'Pesto frisch Genovese', 'Der Begriff \"Pesto\" leitet sich von dem italienischen Wort \"pestare\" ab und bedeutet \"zerstoßen, zerkleinern\". So werden für das Pesto Genovese frische Kräuter, Knoblauch, Nüsse, sowie Hartkäse kleingehackt und mit Öl vermischt. Es entsteht eine aromatisch schmackhafte Sauce.', 'Isana Naturfeinkost GmbH & Co. Produktions- und Handels KG', 'bio-verde', 'GERMANY', '5d2919b1-5070-474a-946b-a7f0daf48ba9', 'manager', '2021-08-16 10:17:36', 'System', '2023-10-10 00:01:29', 1380, 1181, 0, NULL, 0, 2.72, 'Weiling', 0, NULL, 0, 64, 'Sonnenblumenöl*, Basilikum*\n(33%), HARTKÄSE*, CASHEWKERNE*,\nWeißweinessig*,\nOlivenöl*, Knoblauch*,\nMeersalz, Kartoffelflocken*,\nZitronensaftkonzentrat* *aus kontrolliert ökologischer Erzeugung', '2022-09-05 00:14:49', 262.5, 'GOURMET_CONVENIENCE', 'FRESH', 300, 10.5, 'VEGETARIAN', NULL, NULL),
(1212, 'Pesto frisch Basilikum (Weiling)', '4000915104806', 0, 4.39, 1, 1, NULL, 0, '151173', 'Pesto frisch Basilikum', 'Das beliebte Pesto Basilikum ist  auch ohne Käse in veganer Qualität erhältlich.', 'Isana Naturfeinkost GmbH & Co. Produktions- und Handels KG', 'bio-verde', 'GERMANY', '74d57679-ae4a-4db9-b716-3ad290671904', 'manager', '2021-08-16 10:17:47', 'System', '2023-10-10 00:01:58', 1379, 1182, 0, NULL, 0, 2.72, 'Weiling', 0, NULL, 0, 64, 'Sonnenblumenöl*, Basilikum*\n(37%), CASHEWKERNE*, Weißweinessig*,\nKnoblauch*,\nOlivenöl*, Meersalz, Kartoffelflocken*,\nkonzentrierter\nZitronensaft* *aus kontrolliert ökologischer Erzeugung', '2022-11-28 12:33:18', 317.625, 'GOURMET_CONVENIENCE', 'FRESH', 300, 10.5, 'VEGAN;VEGETARIAN', NULL, NULL),
