(1215, 'Guacamole vegan Avocado-Creme (Weiling)', '4000915100709', 0, 5.19, 1, 1, NULL, 0, '151243', 'Guacamole vegan Avocado-Creme', 'Die herzhaft aromatische Avocado-Creme besteht zu 97 % aus reiner Fruchtmasse, abgeschmeckt mit Knoblauch und Salz. Das vitaminreiche Produkt stammt ursprünglich aus Mexiko und wird dort in erster Linie zu Maisfladen oder Tortilla Chips verzehrt.', 'Isana Naturfeinkost GmbH & Co. Produktions- und Handels KG', 'bio-verde', 'GERMANY', 'a7e9b2f9-8d73-4f0e-84f6-60c77aeac224', 'manager', '2021-08-16 10:18:28', 'System', '2023-12-22 02:05:47', 761, 1184, 0, NULL, 0, 3.12, 'Weiling', 0, NULL, 0, 64, 'Avocado* (97%), Zitronensaftkonzentrat*, Meersalz,\nKnoblauch* *aus kontrolliert ökologischer Erzeugung', '2023-05-12 11:04:44', 514.425, 'GOURMET_CONVENIENCE', 'FRESH', 160, 9.5, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(1216, 'Montello Stick Italienischer Hartkäse (Weiling)', '4000915103359', 0, 2.89, 1, 1, NULL, 0, '335109', 'Montello Stick Italienischer Hartkäse', 'Der Montello ist ein klassischer italienischer Hartkäse. Die praktische Form eignet sich ideal zum Reiben oder Hobeln mit einer italienischen Käsereibe.', 'Isana Naturfeinkost GmbH & Co. Produktions- und Handels KG', 'bio-verde', 'Italien', '47e562d8-6b8e-4dc4-8016-67cb488b37b3', 'manager', '2021-08-16 10:18:40', 'System', '2023-10-28 02:07:35', 1355, 1185, 0, NULL, 0, 2.71, 'Weiling', 0, NULL, 0, 103, 'KUHMILCH* (pasteurisiert), Salinensalz, Lab (mikrobiell) *aus kontrolliert ökologischer Erzeugung', '2022-06-06 10:13:26', 170.625, 'CHEESE', 'FRESH', 128, 19.5, 'VEGETARIAN', NULL, NULL),
(1217, 'Parmigiano Reggiano \"Originale\" gerieben D.O.P. (Weiling)', '4000915107777', 0, 2.49, 1, 1, NULL, 0, '335113', 'Parmigiano Reggiano \"Originale\" gerieben D.O.P.', 'Der Parmigiano Reggiano ist einer der berühmteste italienische Käse mit geschützter Herkunftsbezeichnung (D.O.P.). Alle D.O.P. (Denominazione Origine Protetta)-Produkte dürfen nur in einer bestimmten Region hergestellt werden und auch deren Rohstoffe  müssen von dieser Region stammen.', 'Isana Naturfeinkost GmbH & Co. Produktions- und Handels KG', 'bio-verde', 'Reggio Emilia', '50cbedcf-3eff-4d8f-88a6-97474ec31636', 'manager', '2021-08-16 10:18:51', 'System', '2023-10-28 02:07:43', 1160, 364, 0, NULL, 0, 1.52, 'Weiling', 0, NULL, 0, 102, 'KUHMILCH*, Salz, tierisches Lab *aus kontrolliert ökologischer Erzeugung', '2022-11-29 16:44:10', 206.625, 'CHEESE', 'FRESH', 42, 14.5, NULL, NULL, NULL),
(1218, 'Gorgonzola DOP Azzurro dolce (Weiling)', '4000915100013', 0, 3.99, 1, 1, NULL, 0, '335142', 'Gorgonzola DOP Azzurro dolce', 'Der Azzurro Gorgonzola ist ein D.O.P. (Denominazione Origine Protetta)-Produkt – ein Käse mit geschützter Herkunftsbezeichnung. Alle D.O.P. (Denominazione Origine Protetta)-Produkte dürfen nur in einer bestimmten Region hergestellt werden und auch deren Rohstoffe müssen von dieser Region stammen.', 'Isana Naturfeinkost GmbH & Co. Produktions- und Handels KG', 'bio-verde', 'Lombardei', '0507cc09-38ee-49fe-b308-10036ce3b6b3', 'manager', '2021-08-16 10:19:08', 'System', '2023-11-10 02:08:09', 1224, 1186, 0, NULL, 0, 2.44, 'Weiling', 0, NULL, 0, 102, 'KUHMILCH* (pasteurisiert), Meersalz, tierisches Lab *aus kontrolliert ökologischer Erzeugung', '2023-01-03 09:46:22', 568.17, 'CHEESE', 'FRESH', 140, 17.7, 'VEGETARIAN', NULL, NULL),
(1220, 'Sahne Schmelzkäse-Creme 175 g (Weiling)', '4000915101027', 0, 3.49, 1, 1, NULL, 0, '335161', 'Sahne Schmelzkäse-Creme 175 g', 'Die Schmelzkäsecreme von bio-verde zeichnet sich durch einen harmonisch sahnig-cremigen Geschmack aus. Extra streichfähig findet man diese im Kühlregal.', 'Isana Naturfeinkost GmbH & Co. Produktions- und Handels KG', 'bio-verde', 'Bayern/Österreich', 'c00f082e-9b7d-4da9-9dfe-d5b670faecbc', 'manager', '2021-08-16 10:19:31', 'System', '2023-01-16 18:53:10', 1084, 365, 0, NULL, 0, 2.53, 'Weiling', 0, NULL, 0, 60, 'KÄSE* (45%), Wasser, BUTTER*, MOLKENPULVER*, Schmelzsalz: Natriumcitrat, Säuerungsmittel: Milchsäure *aus kontrolliert ökologischer Erzeugung', '2022-06-06 10:12:50', 487.2, 'CHEESE', 'FRESH', 190, 14.5, 'VEGETARIAN', NULL, NULL),
(1221, 'Küstenfischer Herings-Salat mit Dill (Weiling)', '4000915108323', 0, 3.39, 1, 1, NULL, 0, '163901', 'Küstenfischer Herings-Salat mit Dill', 'Die Heringe für diese Delikatesse stammen von der deutschen Nordseeküste. Eine traditionelle Fangmethode mit pelagischen Netzen schont den Meeresboden mit seiner Pflanzenwelt und ein Beifang der dort lebenden Meerestiere vermieden. Die klassische Rezeptur mit feinem Dill ist traditionell mit Gurken und Zwiebeln sowie einem Hauch Senf verfeinert.', 'Isana Naturfeinkost GmbH & Co. Produktions- und Handels KG', 'bio-verde', 'GERMANY', 'f5e16fde-a9f4-472d-b98d-0ca83afedf88', 'manager', '2021-08-16 10:19:42', 'System', '2023-12-21 02:06:52', 794, 363, NULL, NULL, 0, 2.35, 'Weiling', 0, NULL, 0, 64, 'HERING** (Clupea harengus - 41%), Sonnenblumenöl*, Gurken*, Zwiebeln*, Rohrzucker*, SENF* (Wasser, SENFSAATEN*,\nBranntweinessig*, Meersalz, Gewürze*, Kräuter*), konzentrierter Apfelsaft*, EIGELB*, Meersalz, Branntweinessig*, Dill* (1%) (*= aus kontrolliert biologischem Anbau (59%), **= Wildfisch).', '2022-10-29 00:00:50', 484.704, 'GOURMET_CONVENIENCE', 'FRESH', 160, 9.9, NULL, NULL, NULL),
(1222, 'Span. Jamón Serrano Aufschnitt 80 g (Weiling)', '4000915108415', 0, 7.29, 1, 1, NULL, 0, '164002', 'Span. Jamón Serrano Aufschnitt 80 g', 'Der Jamon Serrano ist der klassische Roh-Schinken aus Spanien er zeichnet sich durch sein rubinrotes Fleisch und einen unvergesslichen Geschmack aus. ', 'Isana Naturfeinkost GmbH & Co. Produktions- und Handels KG', 'bio-verde', 'GERMANY', '9c842079-98eb-48ae-978b-63b788860e4f', 'manager', '2021-08-16 10:19:52', 'System', '2023-01-16 18:53:25', 1036, 1187, 0, NULL, 0, 5.3, 'Weiling', 0, NULL, 0, 64, 'Schweinefleisch*, Meersalz *aus kontrolliert ökologischer Erzeugung', '2022-06-06 10:03:26', 141, 'SAUSAGE', 'FRESH', 93, 20, NULL, NULL, NULL),
(1223, 'Delikatess-Forellen-Filet 100 g NATURLAND (Weiling)', '4000915108156', 0, 7.49, 1, 1, NULL, 0, '164068', 'Delikatess-Forellen-Filet 100 g NATURLAND', 'Das Fleisch der Regenbogenforelle ist besonders mager und eiweißhaltig.  Die Forelle stammt hauptsächlich aus unserer hauseigenen Fischzucht vom Gut Dessau in Oberbayern! Zusätzlich werden Forellen aus Hessen am Fuße des Taunus Gebirge verarbeitet. Beide Forellen sind Naturland zertifiziert.', 'Isana Naturfeinkost GmbH & Co. Produktions- und Handels KG', 'bio-verde', 'GERMANY', '0d576cce-bfce-4f6c-8f82-e74625c88aba', 'manager', '2021-08-16 10:20:07', 'System', '2023-01-16 18:53:31', 1221, 1188, 3, NULL, 0, 5.35, 'Weiling', 0, NULL, 0, 64, 'REGENBOGENFORELLE (Oncorhynchus mykiss)*, Meersalz, Buchenholz-Rauch ***aus anerkannt ökologischer Aquakultur', '2022-06-06 10:03:19', 378.51, 'MEAT_FISH', 'FRESH', 128, 31, NULL, NULL, NULL),
