(1257, 'Falafel \"traditionell\" (Weiling)', '4026584133527', 0, 3.39, 1, 1, NULL, 0, '661413', 'Falafel \"traditionell\"', 'Unsere Interpretation des weltberühmten Snacks aus der traditionellen Küche der östlichen Mittelmeerregion. Eine herrlich würzige Komposition mit 100% der Kichererbsen aus unserem regionalem Anbauprojekt in Bayern. Verfeinert mit frischem Koriander, Petersilie und feinem Hokkaido-Kürbis sind die Falafel die perfekte Ergänzung für Bowls, Wraps und Salate - auch pur oder mit einem Hummus-Dip ein wahrer Genuss. Wir freuen uns sehr über die Auszeichnung \"natürlich Leserliebling 2023\"!', 'organic veggie food GmbH', 'SOTO', 'GERMANY', '6adb8711-2a70-45bc-9e4a-3d9f593b393b', 'manager', '2021-08-16 10:26:34', 'System', '2023-12-14 02:08:47', 1217, 1214, 0, NULL, 0, 2.04, 'Weiling', 0, NULL, 0, 61, 'Kichererbsen* (47%), Hokkaido-Kürbis* (17%), Zwiebeln* (17%), Kichererbsenmehl* (15%), Sonnenblumenöl*, Salz, Koriander*, Gewürze*, Petersilie* *aus kontrolliert ökologischer Erzeugung', '2023-04-24 22:53:43', 809.375, 'GOURMET_CONVENIENCE', 'FRESH', 231.5, 17.5, 'VEGAN;VEGETARIAN', NULL, NULL),
(1258, 'Mini-Frühlingsrollen \"china\" (Weiling)', '4026584132209', 0, 3.59, 1, 1, NULL, 0, '661416', 'Mini-Frühlingsrollen \"china\"', 'Die Mini-Version unseres Klassikers - knuspriger Teig umhüllt Gemüse, Tofu und knackige Sprossen, abgerundet mit einer harmonischen Ingwernote. Der klassische Genuss im Mini-Format eignet sich ideal als Vorspeise oder fürs Buffet.', 'organic veggie food GmbH', 'SOTO', 'GERMANY', 'a8d905c4-f053-4d6b-ae91-cb81fe442060', 'manager', '2021-08-16 10:26:44', 'System', '2023-12-14 02:09:34', 1349, 1215, 0, NULL, 0, 2.18, 'Weiling', 0, NULL, 0, 61, 'Füllung: Weißkohl* (28%), Mungbohnensprossen* (10%), Karotten* (10%), Tofu* (Wasser, SOJABOHNEN*, Festigungsmittel: Nigari), Lauch* (4%), Kartoffelflocken*, Sojasauce* Shoyu (Wasser, SOJABOHNEN*, WEIZEN*, Meersalz), SESAM*, Salz, Gewürze*\n\nTeig: Wasser, WEIZENMEHL*, Sonnenblumenöl*, Salz *aus kontrolliert ökologischer Erzeugung', '2022-12-06 12:02:28', 656.25, 'GOURMET_CONVENIENCE', 'FRESH', 211.5, 17.5, 'VEGAN;VEGETARIAN', NULL, NULL),
(1259, 'Burger Gemüse \"rote Linse\" (Weiling)', '4026584131707', 0, 3.59, 1, 1, NULL, 0, '661444', 'Burger Gemüse \"rote Linse\"', 'Mit dem hohen Anteil an Hülsenfrüchten liefert der Rote Linse Burger wichtige Proteine, was besonders für eine rein pflanzliche Ernährung von großer Bedeutung ist. Der mild-nussige Geschmack überzeugt auch in der Kategorie „Genuss pur“.', 'organic veggie food GmbH', 'SOTO', 'GERMANY', '6621043b-2b70-4f35-96c4-f8953687140c', 'manager', '2021-08-16 10:26:55', 'System', '2023-12-14 02:07:27', 1223, 1216, 0, NULL, 0, 2.14, 'Weiling', 0, NULL, 0, 61, 'Rote Linsen* (26%), Wasser, Maisgrieß* (13%), Hokkaido-Kürbis* (11%), Sonnenblumenkerne* (7%), Lauch*, Kartoffeln*, Kartoffelflocken*, Karotten*, Zwiebeln*, Sonnenblumenöl*, Tapiokastärke*, Salz, Gewürze* *aus kontrolliert ökologischer Erzeugung', '2023-06-06 09:28:01', 503.125, 'GOURMET_CONVENIENCE', 'FRESH', 171.5, 17.5, 'VEGAN;VEGETARIAN;PALMOILFREE', NULL, NULL),
(1260, 'Burger Süßkartoffel (Weiling)', '4026584131806', 0, 2.99, 1, 1, NULL, 0, '661465', 'Burger Süßkartoffel', 'Die Mischung aus fruchtiger Süßkartoffel, mildem Kürbis und knackigen Kürbiskernen macht den Süßkartoffel Burger zu einem vollwertigen Highlight. Klassisch im Burger Bun, im Wrap oder als Topping für Bowls und Salate ist diese harmonisch abgestimmte Spezialität ein wahrer Allrounder. Wir freuen uns sehr über die ÖKO-TEST Auszeichnung \"sehr gut\" (Ausgabe 07/2023)!', 'organic veggie food GmbH', 'SOTO', 'GERMANY', '3ca4b8b3-11cb-47f2-a6d4-b1966e9dbed7', 'manager', '2021-08-16 10:27:06', 'System', '2023-12-14 02:07:38', 968, 1217, 0, NULL, 0, 2.14, 'Weiling', 0, NULL, 0, 61, 'Süßkartoffeln* (15%), Maisgrieß* (15%), Kartoffeln* (13%), roter Paprika* (12%), Buchweizen* (10%), Karotten*, Hokkaido-Kürbis*, Kürbiskerne* (4%), Rucola* (4%), Zwiebeln*, Tapiokastärke*, Sonnenblumenöl*, Koriander*, Salz, Gewürze* *aus kontrolliert ökologischer Erzeugung', '2022-07-12 14:23:37', 503.125, 'GOURMET_CONVENIENCE', 'FRESH', 171.5, 17.5, 'VEGAN;VEGETARIAN;PALMOILFREE', NULL, NULL),
