(1270, 'SUUR, Fermentierte Hot Sauce, Sriracha (Weiling)', '4260669270084', 0, 4.19, 1, 1, NULL, 0, '152574', 'SUUR, Fermentierte Hot Sauce, Sriracha', 'Sriracha ist schon lange kein Geheimtipp mehr. Benannt nach der Küstenstadt Si Racha im gleichnamigen Landkreis in Thailand hat es die süß-scharfe Hot Sauce zu weltweiter Berühmtheit gebracht und tunt inzwischen vom Sandwich bis zum Eintopf alles, was nicht bei drei auf dem Löffel ist.\nFür unsere Interpretation der klassischen Sriracha fermentieren wir rote süße Paprika und Knoblauch mehrere Monate. Damit geben wir der Sauce nicht nur richtig Aromentiefe, sondern auch noch jede Menge probiotische, lebendige Mikroorganismen mit. Die in Hessen extra für uns angebauten Bioland Habanero-Chili geben der SUUR Sriracha den Schärfe-Punch, Weißwein-Essig und Rohrzucker runden den Geschmack ab. Verzichten können wir dabei auf sämtliche unnötigen Zusatz- und Konservierungsstoffe. ⁠\n\n', 'Gute Kulturen GmbH', 'SUUR', 'GERMANY', 'e725c221-69a1-4b3a-93b1-5fbabf37fd9d', 'manager', '2021-08-16 10:28:58', 'System', '2023-02-22 02:05:02', 817, 1219, 0, NULL, 0, 0, 'Weiling', 0, NULL, 0, 64, 'Rote Paprika (65%)*, Knoblauch*, Rohrzucker*, Weißwein-Essig*, Steinsalz, Habanero-Chili* (1%), Verdickungsmittel: Guarkernmehl* *aus kontrolliert ökologischer Erzeugung', '2022-11-05 02:04:49', 354.375, 'GOURMET_CONVENIENCE', 'FRESH', 323, 17.5, 'VEGAN;VEGETARIAN;RAWFOOD', NULL, NULL),
