(1288, 'Bio Rote Grütze (Weiling)', '4008471521501', 0, 5.59, 1, 1, NULL, 0, '472184', 'Bio Rote Grütze', 'Rote Grütze ist ein Klassiker unter den Desserts. Bekannt aus dem hohen Norden hat sie mittlerweile Genießer in allen Teilen der Erde gefunden. Die Rote Grütze von Söbbeke ist ein ganz besonderes Dessert. Sie wird aus Sauerkirschen, Himbeeren, Süßkirschen und roten und schwarzen Johannisbeeren hergestellt und mundet ohne Zusatz von Aromen herrlich fruchtig. Angeboten wird die Söbbeke Rote Grütze im praktischen 500 g Becher. Passend dazu gibt es die köstliche Bourbon Vanille Soße im  200 ml Becher. Mit Sahne und Bourbon-Vanille verfeinert ist die Bourbon Vanille Soße die ideale Krönung für die Rote Grütze. Man kann mit ihr natürlich auch andere Desserts oder auch Eis versüßen. Ebenfalls ganz ohne den Zusatz von Aromastoffen kann man mit ihr nach Herzenslust unbeschwert schlemmen.', 'Molkerei Söbbeke GmbH', 'Söbbeke', 'GERMANY', '5792f74a-b297-454b-929a-6e3650cd8451', 'manager', '2021-08-16 10:32:31', 'System', '2024-02-07 02:06:39', 1385, 1230, 0, NULL, 0, 3.25, 'Weiling', 0, NULL, 0, 63, '50 % Früchte* (Sauerkirschen*, Rote Johannisbeeren*, Schwarze Johannisbeeren*, Himbeeren*), Wasser, Rübenzucker*, Stärke*, Verdickungsmittel Pektin *aus kontrolliert ökologischer Erzeugung', '2023-06-09 09:37:56', 1010.8, 'VEGAN_VEGETARIAN;PRESERVED_MILK_DRINKS', 'FRESH', 513, 11.2, 'VEGETARIAN;PALMOILFREE;GLUTENFREE', NULL, NULL),
(1289, 'Bio Bourbon Vanille-Soße (Weiling)', '4008471521518', 0, 1.99, 1, 1, NULL, 0, '472187', 'Bio Bourbon Vanille-Soße', 'Passend zur Roten Grütze von Söbbeke gibt es die köstliche Bourbon Vanille Soße im  200 ml Becher. Mit Sahne und Bourbon-Vanille verfeinert ist die Bourbon Vanille Soße die ideale Krönung für jedes Dessert. Ebenfalls ganz ohne den Zusatz von Aromastoffen, wie alles von Söbbeke, kann man mit ihr nach Herzenslust unbeschwert schlemmen.', 'Molkerei Söbbeke GmbH', 'Söbbeke', 'GERMANY', '29522804-2f93-4ac7-874e-aec623ecd642', 'manager', '2021-08-16 10:32:43', 'System', '2024-02-07 02:06:23', 541, 1231, 1, NULL, 0, 0.98, 'Weiling', 0, NULL, 0, 63, 'MAGERMILCH*, 14% SAHNE* (30% Fett), Rübenzucker*, Stärke*, Verdickungsmittel Johannisbrotkernmehl*, 0,1 % Bourbonvanilleschotenextrakt*, färbendes Lebensmittel Karottensaftkonzentrat* und Curkuma*, 0,01 % Bourbonvanillepulver* *aus kontrolliert ökologischer Erzeugung', '2022-11-04 02:04:33', 545.625, 'DAIRY_PRODUCTS_EGGS', 'FRESH', 209.3, 9.7, 'VEGETARIAN;GLUTENFREE', NULL, NULL),
