(1299, 'Räucherknacker vegan (Weiling)', '4012359138101', 0, 3.79, 1, 1, NULL, 0, '662028', 'Räucherknacker vegan', 'Geräucherte Tofu-Bratwurst mit Biss! Zum Anbraten und Grillen, ein Genuss zum Beispiel mit brauner Sauce und Röstzwiebeln.\n\nDie Würstchen vor und während des Grillens mit Öl einpinseln und regelmäßig wenden, bis sie die gewünschte Kruste haben. Tofu-Würstchen sollten grundsätzlich am Rande der Glut gegrillt werden, da sie sonst schnell \"anbrennen\". ', 'Taifun-Tofu GmbH', 'Taifun', 'Baden-Württemberg', 'dcad410c-24b1-4268-80f1-178dc0385d43', 'manager', '2021-08-16 10:34:40', 'System', '2024-02-06 02:12:37', 1123, 1236, 0, NULL, 0, 2.6, 'Weiling', 0, NULL, 0, 64, 'TOFU* 70% (SOJABOHNEN* 55%, Wasser, Gerinnungsmittel: Magnesiumchlorid, Calciumsulfat), kaltgepresstes Sonnenblumenöl*, WEIZENEIWEISS*, Sojasauce* (Wasser, SOJABOHNEN*, WEIZEN*, Meersalz), Gemüsepaprika*, Meersalz, Peperoni*, Tomaten*, Zwiebeln*, Karotten*, Verdickungsmittel: Guarkernmehl*, Weißweinessig*, Knoblauch*, Pfeffer schwarz*, Kümmel*, Koriander*, Buchenholzreiberauch. *aus kontrolliert ökologischer Erzeugung', '2022-09-02 03:48:03', 433.048, 'VEGAN_VEGETARIAN', 'FRESH', 267.1, 14.8, 'VEGAN;VEGETARIAN;LACTOSEFREE', NULL, NULL),
(1300, 'Tofiner (Weiling)', '4012359133007', 0, 5.19, 1, 1, NULL, 0, '662035', 'Tofiner', 'Einfach drei bis vier Minuten im Wasserbad erhitzen. Hervorragend auch in Suppen oder Eintöpfen. Sowohl kalt als auch warm ein voller Genuss!\n\nProbieren Sie die Tofiner als Vespermahlzeit. Heiß machen, mit Senf servieren und dazu frisches Bauernbrot reichen.', 'Taifun-Tofu GmbH', 'Taifun', 'Baden-Württemberg', '192e6fca-47ed-4783-8a8d-cde0d994f1a3', 'manager', '2021-08-16 10:34:50', 'System', '2023-01-30 16:00:40', 953, 1237, 0, NULL, 0, 3.11, 'Weiling', 0, NULL, 0, 64, 'Tofu* 75% (SOJABOHNEN* 55%, Wasser, Gerinnungsmittel: Magnesiumchlorid, Calciumsulfat), kaltgepresstes Sonnenblumenöl*, Sojasauce* (Wasser, SOJABOHNEN*, WEIZEN*, Meersalz), HAFER*, Meersalz, Verdickungsmittel: Guarkernmehl*, Bockshornklee*, Koriander*, Pfeffer weiß*, Pfeffer schwarz*, Paprika edelsüß*, Paprika scharf*, Kümmel*, Knoblauch*, Buchenholzreiberauch. *aus kontrolliert ökologischer Erzeugung', '2023-05-02 12:29:46', 530, 'VEGAN_VEGETARIAN', 'FRESH', 320.3, 26.5, 'VEGAN;VEGETARIAN;LACTOSEFREE', NULL, NULL),
(1301, 'Tofu natur 200g (Weiling)', '4012359110107', 0, 2.19, 1, 1, NULL, 0, '662036', 'Tofu natur 200g', 'Naturtofu stammt aus China, wo er seit über 2.000 Jahren geschätzt wird. Ob würzig, scharf, süß oder sauer – Tofu natur lässt Würzung in jede beliebige Richtung zu. Aufgrund seiner festen Konsistenz eignet er sich hervorragend zum Marinieren, Frittieren und Anbraten.\n', 'Taifun-Tofu GmbH', 'Taifun', 'Baden-Württemberg', '00021465-ec55-4a89-ad2a-65477d9069d5', 'manager', '2021-08-16 10:35:01', 'System', '2024-02-06 02:12:04', 954, 1238, 0, NULL, 0, 1.27, 'Weiling', 0, NULL, 0, 64, 'SOJABOHNEN* (55%), Wasser, Gerinnungsmittel: Magnesiumchlorid, Calciumsulfat. *aus kontrolliert ökologischer Erzeugung', '2023-01-12 12:35:35', 325, 'VEGAN_VEGETARIAN', 'FRESH', 221.7, 13, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(1302, 'Räuchertofu Mandel-Sesam (Weiling)', '4012359113108', 0, 3.29, 1, 1, NULL, 0, '662050', 'Räuchertofu Mandel-Sesam', 'Unser beliebter Räuchertofu hat bereits viele Menschen von Tofu überzeugt. Die knackige Sesam-Mandel-Kombination wird von einer leckeren Rauchnote abgerundet. \n\nEr passt sowohl zu kalten, als auch zu warmen Speisen. Ob Gemüse, Reis, Kartoffeln oder frische Salate – der Räuchertofu ergänzt Gerichte mit seinem charakteristischen feinwürzigen Aroma.\n\nTraditionell verwendete man das Räuchern, um Speisen haltbar zu machen. Heutzutage räuchern wir fast ausnahmslos, um die leckere Geschmacksnote zu erzielen. \n\nWir räuchern ausschließlich mit dem speziellen Reiberauchverfahren, dem Rauchverfahren mit der geringsten Belastung an gesundheitsschädigenden Stoffen. Ein Metallrad reibt lange an einem Buchenholzscheit, bis es eine Temperatur von 300 - 400° C erreicht. Im Vergleich zu konventionellen Räucherverfahren, bei denen bis zu 800° C eingesetzt werden, ist unsere niedertemperierte Räucherung sehr schonend. Der dabei entstehende Rauch wird zu den Produkten in die Räucherkammer geleitet und verleiht ihnen die besondere aromatische Note. Zudem arbeitet unsere Reiberauchanlage emissionsfrei.', 'Taifun-Tofu GmbH', 'Taifun', 'Baden-Württemberg', 'b07524e1-753c-40b7-833c-4a10952e993b', 'manager', '2021-08-16 10:35:11', 'System', '2023-07-01 00:20:02', 1121, 1239, 0, NULL, 0, 2.27, 'Weiling', 0, NULL, 0, 64, 'Tofu* 87% (SOJABOHNEN* 55%, Wasser, Gerinnungsmittel: Magnesiumchlorid, Calciumsulfat), Sojasauce* (Wasser, SOJABOHNEN*, WEIZEN*, Meersalz), MANDELN* 3,4%, SESAM* 3,1%, Buchenholzreiberauch. *aus kontrolliert ökologischer Erzeugung', '2022-05-17 03:11:15', 325, 'VEGAN_VEGETARIAN', 'FRESH', 212.9, 13, 'VEGAN;VEGETARIAN;LACTOSEFREE', NULL, NULL),
(1303, 'Papillon - veganer Aufschnitt mit Paprika (Weiling)', '4012359164001', 0, 2.79, 1, 1, NULL, 0, '662066', 'Papillon - veganer Aufschnitt mit Paprika', 'Brotbelag mit frischen Paprikastückchen. Hervorragend auch in vegetarischen Wurstsalaten und auf der Pizza.\n\nWenn Sie den Aufschnitt für die Pizza verwenden möchten, sollten Sie die Scheiben nur in den letzten zwei Minuten mitbacken.', 'Taifun-Tofu GmbH', 'Taifun', 'Baden-Württemberg', '1920487b-8798-49ab-b80b-8af3a59c5f87', 'manager', '2021-08-16 10:35:21', 'System', '2023-08-22 02:06:22', 956, 1240, 0, NULL, 0, 2.08, 'Weiling', 0, NULL, 0, 64, 'TOFU* 60% (SOJABOHNEN* 55%, Wasser, Gerinnungsmittel: Magnesiumchlorid, Calciumsulfat), WEIZENEIWEISS*, Gemüsepaprika* 9,1%, kaltgepresstes Sonnenblumenöl*, Weißweinessig*, Gemüsebrühe* (Meersalz, Hefeextrakt*, Sonnenblumenöl*, Lauch*, Karotten*, SELLERIE*, Macis*, Muskatnuss*, Petersilie*), Verdickungsmittel: Guarkernmehl*, Zwiebeln*, Meersalz, Auberginen*, Karotten*, Tomaten*, Peperoni*, Knoblauch*, Paprika edelsüß*, Kardamom*, Pfeffer schwarz*, Pfeffer weiß*, Ingwer*, Koriander*, Kurkuma*, Kümmel*. *aus kontrolliert ökologischer Erzeugung', '2022-05-17 03:11:00', 480, 'VEGAN_VEGETARIAN', 'FRESH', 138.7, 24, 'VEGAN;VEGETARIAN;LACTOSEFREE', NULL, NULL),
(1304, 'Rondo - veganer Aufschnitt mit Kräutern (Weiling)', '4012359165008', 0, 2.79, 1, 1, NULL, 0, '662068', 'Rondo - veganer Aufschnitt mit Kräutern', 'Feinwürzig mit frischen Kräutern und Räuchertofu. Schmeckt auf Brot und Brötchen, in frischen Salaten oder auch als Pizzabelag.\n\nNicht entnommene Scheiben bewahren Sie am Besten in einer Frischhaltebox auf oder schützen sie mit Frischhaltefolie.', 'Taifun-Tofu GmbH', 'Taifun', 'Baden-Württemberg', '19096442-b0f9-4928-aba3-7c08c64722eb', 'manager', '2021-08-16 10:35:32', 'System', '2023-08-22 02:06:21', 955, 1241, 0, NULL, 0, 2.08, 'Weiling', 0, NULL, 0, 64, 'TOFU* 61% (SOJABOHNEN* 55%, Wasser, Gerinnungsmittel: Magnesiumchlorid, Calciumsulfat), WEIZENEIWEISS*, kaltgepresstes Sonnenblumenöl*, Karotten*, Gemüsebrühe* (Meersalz, Hefeextrakt*, Sonnenblumenöl*, Lauch*, Karotten*, SELLERIE*, Macis*, Muskatnuss*, Petersilie*), Verdickungsmittel: Guarkernmehl*, Zwiebeln*, Kräuter* 0,5% (Basilikum*, Petersilie*), Koriander*, Ingwer*, Macis*, Muskatnuss*, Pfeffer weiß*, Pfeffer schwarz*, Zitronenöl*. *aus kontrolliert ökologischer Erzeugung', '2022-05-17 03:10:59', 480, 'VEGAN_VEGETARIAN', 'FRESH', 138.6, 24, 'VEGAN;VEGETARIAN;LACTOSEFREE', NULL, NULL),
(1305, 'Bärlauch Bratfilets (Weiling)', '4012359144102', 0, 2.99, 1, 1, NULL, 0, '662122', 'Bärlauch Bratfilets', 'Ein Muss für alle, die dieses Wildgemüse schätzen. Durch den frischen Bärlauch erhalten diese Bratfilets ihre unverwechselbare Note.\n\nKurz in der Pfanne anbraten. Lecker zu Nudeln, Kartoffeln und Gemüse.\n Oder zum Grillen: Einfach vorher mit etwas Öl bestreichen. Bitte nur kurz auf den Rost legen oder in einer Grillschale braten. ', 'Taifun-Tofu GmbH', 'Taifun', 'Baden-Württemberg', 'aab34170-2990-4cc0-820e-2b1b46048af5', 'manager', '2021-08-16 10:35:42', 'System', '2023-11-17 02:11:23', 386, 1242, 0, NULL, 0, 1.99, 'Weiling', 0, NULL, 0, 64, 'TOFU* 85% (SOJABOHNEN* 55%, Wasser, Gerinnungsmittel: Magnesiumchlorid, Calciumsulfat), Sonnenblumenöl*,\nBärlauch* 5%, Zwiebeln*, Gemüsebrühe* (Meersalz, Hefeextrakt*, Sonnenblumenöl*, Lauch*, Karotten*, SELLERIE*,\nMacis*, Muskatnuss*, Petersilie*), Zitronensaftkonzentrat*, Ingwer*. *aus kontrolliert ökologischer Erzeugung', '2022-05-23 15:03:18', 303.75, 'GOURMET_CONVENIENCE', 'FRESH', 171.3, 15, 'VEGAN;VEGETARIAN;LACTOSEFREE', NULL, NULL),
(1306, 'Seidentofu (Weiling)', '4012359115003', 0, 2.99, 1, 1, NULL, 0, '662130', 'Seidentofu', 'Traditionell japanisch in Demeter-Qualität. Zartcremige, feine Konsistenz. Hervorragend zum Zubereiten von Süßspeisen, Saucen und Dips geeignet.\n\nZum Öffnen der Packung am Besten mit einem spitzen und scharfen Messer an der Innenseite des Packungsrandes entlang schneiden. Oberfolie entfernen und den Seidentofu auf einen Teller stürzen.', 'Taifun-Tofu GmbH', 'Taifun', 'Baden-Württemberg', '01473fd1-b015-4b40-81aa-bef91fc6758a', 'manager', '2021-08-16 10:35:54', 'System', '2023-07-01 00:19:09', 1039, 1243, 2, NULL, 0, 2.11, 'Weiling', 0, NULL, 0, 64, 'Wasser, SOJABOHNEN** 21%, Gerinnungsmittel: Magnesiumchlorid. **aus biodynamischer Erzeugung', '2022-05-17 03:10:54', 604.8, 'VEGAN_VEGETARIAN', 'FRESH', 440, 14.4, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(1307, 'Räuchertofu klassik (Weiling)', '4012359111104', 0, 3.29, 1, 1, NULL, 0, '662186', 'Räuchertofu klassik', 'Die klassische Variante des Räuchertofus. Einfach kalt zur Brotzeit oder in Salaten. Angebraten hervorragend zu Gemüsegerichten, Reis, Kartoffeln oder Nudeln.\n\nWir räuchern ausschließlich mit dem speziellen Reiberauchverfahren, dem Rauchverfahren mit der geringsten Belastung an gesundheitsschädigenden Stoffen. Ein Metallrad reibt lange an einem Buchenholzscheit, bis es eine Temperatur von 300 - 400° C erreicht. Im Vergleich zu konventionellen Räucherverfahren, bei denen bis zu 800° C eingesetzt werden, ist unsere niedertemperierte Räucherung sehr schonend. Der dabei entstehende Rauch wird zu den Produkten in die Räucherkammer geleitet und verleiht ihnen die besondere aromatische Note. Zudem arbeitet unsere Reiberauchanlage emissionsfrei.\n', 'Taifun-Tofu GmbH', 'Taifun', 'Baden-Württemberg', '3e0f92ca-1494-493b-910a-dec6cf44a823', 'manager', '2021-08-16 10:36:05', 'System', '2023-01-26 20:01:48', 1122, 1244, 0, NULL, 0, 1.95, 'Weiling', 0, NULL, 0, 64, 'Tofu* (93%) (SOJABOHNEN* (55%), Wasser, Gerinnungsmittel: Magnesiumchlorid, Calciumsulfat), Sojasauce* (Wasser, SOJABOHNEN*, WEIZEN*, Meersalz), Buchenholzreiberauch. *aus kontrolliert ökologischer Erzeugung', '2023-01-05 11:16:09', 325, 'VEGAN_VEGETARIAN', 'FRESH', 210.7, 13, 'VEGAN;VEGETARIAN;LACTOSEFREE', NULL, NULL),
(1308, 'Bauern Handkäse mit Kümmel (Weiling)', '4026367043104', 0, 3.29, 1, 1, NULL, 0, '334901', 'Bauern Handkäse mit Kümmel', 'Die Upländer Bauernmolkerei wurde 1996 von 18 Bio-Bäuerinnen und Bio-Bauern der Milcherzeugergemeinschaft Hessen w.V. gegründet. Mittlerweile beliefern über 100 Bio-Betriebe aus der Region unsere Molkerei.\nWir produzieren hochwertige Bio-Milchprodukte nach den strengen Richtlinien des Bioland-Verbandes. Somit sind eine artgerechte Tierhaltung und die Fütterung der Tiere mit ökologisch angebauten Futtermitteln selbstverständlich. \nBesonderen Wert legt die Upländer Bauernmolkerei auf nachhaltig faire Milchpreise, damit unsere Bio-Bäuerinnen und Bio-Bauern auf einer stabilen Basis die Existenz ihrer Betriebe auch in Zukunft sichern können.\nÜbrigens: Die Bio-Bauern liefern nicht nur die Milch, sie verarbeiten und vermarkten sie auch in eigener Regie. Die Anteile an der Upländer Bauernmolkerei GmbH werden mehrheitlich von den Bio-Bauern gehalten.', 'Upländer Bauernmolkerei GmbH', 'Upländer Bauernmolkerei', 'GERMANY', '457f47e8-5df7-45de-8a43-ba626de3c43f', 'manager', '2021-08-16 10:36:16', 'System', '2023-10-21 02:08:40', 526, 1245, 1, NULL, 0, 1.92, 'Weiling', 0, NULL, 0, 63, 'SAUERMILCHQUARK*, Säureregulatoren\n(Natriumhydrogencarbonat, Calciumcarbonat), Speisesalz,\nKümmel* *aus ökologischer Landwirtschaft', '2022-11-29 15:55:23', 225, 'CHEESE', 'FRESH', 201, 9, 'VEGETARIAN', NULL, NULL),
