(1321, 'Wheaty Vegan Superhero Burger (Weiling)', '4032277008706', 0, 4.39, 1, 1, NULL, 0, '660208', 'Wheaty Vegan Superhero Burger', 'Unser neuer Vegan Superhero ist der beste vegane Burger, den es bisher gibt. Die Patties haben Biss und eine tolle körnige Struktur, sind saftig und stehen im Geschmack ihrem Vorbild aus Fleisch in nichts nach. Außerdem rettet er quasi nebenbei das Klima: bei der Herstellung eines herkömmlichen Burgers aus Rindfleisch entstehen so viel Treibhausgase, dass man bis zu 320 Kilometer mit dem Auto fahren könnte. Nicht so bei unserer Variante! So steht dem perfekten veganen Hamburger nichts mehr im Wege.', 'TOPAS GmbH', 'Wheaty', 'GERMANY', 'cba6577e-6c93-47f1-9c12-88d57707f812', 'manager', '2021-08-16 10:38:51', 'System', '2023-09-07 03:34:39', 883, 1257, 0, NULL, 0, 2.59, 'Weiling', 0, NULL, 0, 61, '60 % Seitan* (Wasser, WEIZENeiweiß*), WEIZENeiweißtexturat* (WEIZENeiweiß*, WEIZENmehl*), ölsäurereiches (High-Oleic) Sonnenblumenöl*, SOJAsauce* (Wasser, SOJAbohnen*, Meersalz), Zwiebeln*, Gewürze*, Steinsalz, Reismehl*, Verdickungsmittel: Johannisbrotkernmehl*. *aus kontrolliert ökologischer Erzeugung', '2023-07-03 10:45:08', 363, 'VEGAN_VEGETARIAN;GOURMET_CONVENIENCE', 'FRESH', 206, 22, 'VEGAN;VEGETARIAN', NULL, NULL),
