(1333, 'Delikatess Geflügel-Fleischwurst (Weiling)', '4031829230695', 0, 4.39, 1, 1, NULL, 0, '161023', 'Delikatess Geflügel-Fleischwurst', 'Die Ökoland Geflügel-Fleischwurst wird aus bestem Bio-Puten- und -Hähnchenfleisch hergestellt. Das Ergebnis ist ein Produkt von höchster Qualität, die Sie schmecken können. Dank einer ausgefeilten Rezeptur unter Verwendung von Sonnenblumenöl und einem hohen Fleischanteil schmeckt sie so ausgezeichnet. Geeignet für den kalten Verzehr, zum Erhitzen und Braten.', 'Ökoland GmbH Nord', 'ÖKOLAND', 'GERMANY', 'f0b40ac3-f433-44d4-a0d1-ea703f90faf3', 'manager', '2021-08-16 10:41:29', 'System', '2023-12-12 02:06:37', 594, 1265, 4, NULL, 0, 2.75, 'Weiling', 0, NULL, 0, 63, '63% Geflügelfleisch* (Pute*, Huhn*), 15% Sonnenblumenöl*, Trinkwasser, Geflügelhaut*, Meersalz, Gewürze* (Knoblauch*, Koriander*, Ingwer*, Macis*, Muskatnuss*, Pastinake*, Pfeffer*, Zwiebel*), Saccharose*. *aus kontrolliert ökologischer Erzeugung', '2022-05-24 10:25:24', 945, 'SAUSAGE', 'FRESH', 185.5, 20, 'GLUTENFREE;LACTOSEFREE;PALMOILFREE', NULL, NULL),
