(1346, 'Hofmilch 3,8%, Karton (Weiling)', '4035661162428', 0, 1.99, 1, 1, NULL, 0, '475300', 'Hofmilch 3,8%, Karton', 'Pasteurisiert, traditionell hergestellt. Alle Herstellungsschritte finden direkt auf dem Hof statt. Von der Weide bis zur Hofmolkerei ist es nur ein kurzer Spaziergang. Die frische Milch wird direkt in der Hofmolkerei Telgte in einem Natural Board-Karton abgefüllt. Dieser ist zu 100 % ungebleicht, nicht weiß beschichtet und verzichtet auf eine Verpackungsschicht.\n', 'Hof Fockenbrock GmbH & CO. KG', 'bioladen', 'Telgte, Nordrhein-Westfalen', '72f21c5c-a578-404d-a023-e0ffbe03b699', 'correction', '2021-09-08 19:23:49', 'System', '2023-10-14 02:10:39', 474, 236, 1, NULL, 0, 1.19, 'Weiling', 2, 0, 0, 63, NULL, '2023-05-12 11:19:24', 971.75, 'DAIRY_PRODUCTS_EGGS', 'FRESH', 1048.09, 23, 'VEGETARIAN', NULL, NULL),
