(1348, 'Erbsen TK (Weiling)', '4026813020031', 0, 3.29, 1, 1, NULL, 0, '271502', 'Erbsen TK', 'Natural Cool versorgt Sie das ganze Jahr mit frischem Gemüse in bester Demeter- und Bio-Qualität. Das Gemüse wird im optimalen Reifegrad geerntet, direkt verarbeitet und einzeln tiefgefroren. Genießen Sie ein Maximum an Nährstoffen und Vitaminen.', 'Demeter-Felderzeugnisse GmbH', 'Natural Cool', 'NETHERLANDS', '6dc3aa2e-5717-4cf2-aab8-c61feb204136', 'manager', '2021-08-16 11:59:50', 'System', '2023-09-07 02:47:57', 661, 1515, 2, NULL, 0, 1.98, 'Weiling', 0, NULL, 0, 120, 'Erbsen** *aus kontrolliert ökologischer Erzeugung **aus biodynamischer Erzeugung', '2023-05-12 11:17:43', 1078.27, 'VEGETABLES_HERBS_FROZEN', 'FROZEN', 475, 19.2, 'VEGAN;VEGETARIAN', NULL, NULL),
