(1417, 'Dwersteg Organic Eier-Liqueur Naturland (dwersteg)', '4019578003005', 1, 19.99, 1, 1, NULL, 0, NULL, 'Dwersteg Organic Eier-Liqueur Naturland', 'Unser Eier-Liqueur wird nach einem alten Hausrezept auf kaltem Wege hergestellt. Durch dieses schonende Verfahren erhält er seine satte gelbe Farbe und die feine Konsistenz. Abgerundet mit natürlicher Bourbon Vanille.', 'dwersteg', 'dwersteg', 'Steinfurt, NRW', '7a3d72fc-af94-4aca-9cca-aea72f7e9227', 'correction', '2021-09-08 19:33:17', 'System', '2023-03-03 02:16:42', 641, 1283, 3, NULL, 0, 10.7, 'dwersteg', 2, 1, 0, 61, NULL, '2022-05-24 10:38:41', 1314, 'SPIRITS', 'DRINKS', 1100, 36.5, NULL, NULL, NULL),
