(1509, 'Weizen-Vollkornmehl, demeter (Weiling)', '4022381203180', 0, 2.69, 1, 1, NULL, 0, '250458', 'Weizen-Vollkornmehl, demeter', 'Für unser Weizen-Vollkornmehl verwenden wir besten demeter-Weizen. In unserer eigenen Mühle wird das Getreide in mehreren Schritten mit größter Sorgfalt und Fingerspitzengefühl zu diesem Vollkornmehl vermahlen, das alle wertvollen Bestandteile des Korns enthält.\n\nDu fragst Dich, was den Unterschied zwischen einer Industriemühle und einem Handwerksbetrieb wie der Spielberger Mühle ausmacht? Es sind allem voran die Menschen, die hier mit großer Sorgfalt arbeiten. Denn unsere Mühle ist kein computergesteuerter, lebensmitteltechnologischer Prozessautomat – ohne die Menschen kann die Mühle nicht mahlen. Natürlich wird dabei auch gepumpt, gefördert, gebürstet, geschrotet und gemahlen. Mit Maschinen und Lärm und genau gesteuerten Abläufen. Aber in unseren Handwerksmühlen läuft das nicht automatisiert und standardisiert. Die Müller:innen arbeiten mit handwerklichem Geschick und mit viel Fingerspitzengefühl um diesen aufwändigen, komplexen Prozess der Müllerei zu steuern. Um Mehl von erstklassiger Qualität zu erhalten, verwenden sie dabei alle Sinne: An den Vibrationen im Gebäude spüren die Müller:innen, ob die Mühle richtig läuft. Sie hören jede noch so kleine Abweichung vom Soll. Mit Händen, Augen und Nase prüfen sie die Qualität. Sie fühlen und sehen ob das Mehl die richtige Struktur hat. Am aromatischen Duft erkennen sie, ob die Arbeit gelungen ist.', 'Spielberger GmbH', 'Spielberger Mühle', 'GERMANY', 'de6a007a-8905-4e4d-ab7b-f4f0e6f11e35', 'correction', '2021-08-27 14:08:37', 'System', '2024-02-14 02:07:52', 1591, 93, 2, NULL, 0, 1.52, 'Weiling', 0, NULL, 0, 64, 'WEIZENvollkornmehl** **aus biodynamischer Erzeugung', '2023-01-30 14:57:48', 1386, 'BAKING_INGREDIENTS;PASTA_CEREALS_LEGUMES', 'PANTRY', 1014.4, 22, 'VEGAN;VEGETARIAN;RAWFOOD', NULL, NULL),
