(1519, 'ITAPROTECT Atemschutz (Weiling)', '7427136094001', 1, 2.99, 1, 1, NULL, 0, '998890', 'ITAPROTECT Atemschutz', 'Die FFP2-Alltagsmaske wird in Italien gefertigt und entspricht dem vorgeschriebenen EU-Standard EN149:2001+A1:2009.\r\n\r\nAls nachhaltig tätiges Unternehmen sprechen wir uns grundsätzlich gegen den Gebrauch von Einwegprodukten aus und wissen, dass sich derartige Produkte mit unserer Firmenphilosophie widersprechen. Unter den aktuellen Bedingungen wiegt an dieser Stelle allerdings der Gesundheitsschutz höher. Wir haben jedoch bei der Beschaffung streng darauf geachtet, dass wir europäische Ware beziehen, die alle Anforderungen an Masken- bzw. Hygienestandards erfüllt.', 'memo AG', 'memo Handelsware', 'ITALY', '7fcdeb23-aafd-4147-af3a-7faa211e8d55', 'manager', '2021-08-27 11:02:52', 'manager', '2023-02-27 12:02:52', 1601, 83, NULL, NULL, 0, 1.49, 'Weiling', 0, NULL, 0, NULL, NULL, '2023-02-27 12:02:52', 100, 'BODY_CARE;HOUSEHOLD;OTHER_DRUGSTORE_ARTICLES', 'DRUGSTORE', NULL, 15, NULL, NULL, NULL),
