(1521, 'Ziegenquark SB 150g (Weiling)', '4260100870385', 0, 2.79, 1, 1, NULL, 0, '334440', 'Ziegenquark SB 150g', 'Monte Ziego ist 100 % Bio und 100 % Ziege\n\nSeit dem Jahr 2000 produzieren wir handwerklich hergestellten Ziegenkäse in verschiedenen Variationen. Hierbei setzen wir stets auf höchste Qualität welche wir durch den Einsatz bester Rohstoffe, handwerkliche schonende Verarbeitung und eine enge Kommunikation und Zusammenarbeit mit unseren Schwarzwälder Ziegenbauern gewährleisten. \n\nDie  Produktion der handwerkliche Käsespezialitäten findet in Teningen - zwischen Glotter, Elz und Dreisam gelegen - auf einer Fläche von 850 qm statt.\n\nNeben der Entwicklung neuer Produkte bauen wir auch unser Qualitätswesen stetig aus - seit dem Frühjahr 2016 sind wir IFS Food zertifiziert.', 'Monte Ziego GmbH & Co. KG', 'Monte Ziego', 'Schwarzwald', '8a764e3c-dd44-41bf-8d97-f3c353aca148', 'correction', '2021-09-10 02:20:29', 'System', '2023-11-16 02:14:04', 1603, 237, 2, NULL, 0, 2.08, 'Weiling', 0, NULL, 0, 69, 'ZIEGENMILCH**, Säuerungskulturen, Kälbermagenlab. **aus biodynamischer Erzeugung *aus kontrolliert ökologischer Erzeugung', '2022-10-29 02:03:51', 318.987, 'CHEESE', 'FRESH', 160, 6.9, NULL, NULL, NULL),
