(1525, 'Garam Masala Indische Küche (Weiling)', '4012346168807', 0, 3.29, 1, 1, NULL, 0, NULL, 'Garam Masala Indische Küche', 'Garam Masala - das heiße Gewürz - hat seine Wurzeln in der ayurvedischen Heilkunde, der zufolge es, dank Zimt, Kardamom und Gewürznelke, den Körper von Innen wärmt. Unsere Interpretation der indischen Gewürzmischung verleiht Ihren Gerichten würzig-warme und angenehm pfeffrige Noten.', 'Ulrich Walter GmbH', 'LEBENSBAUM', 'Diepholz, Niedersachsen', '81e20f7b-f03f-47b5-b536-5300d22d0626', 'correction', '2021-09-08 18:09:58', 'System', '2023-01-16 19:09:24', 1607, 104, 0, NULL, 0, 1.88, 'Weiling', 2, 1, 0, 60, NULL, '2022-11-29 15:20:27', 269.5, 'SPICES_COOKING_HELP', 'PANTRY', 43, 14, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE;PALMOILFREE', NULL, NULL),
