(1528, 'Glutenfreie Hirseflocken, kbA (Weiling)', '4022381027656', 0, 2.19, 1, 1, NULL, 0, NULL, 'Glutenfreie Hirseflocken, kbA', 'Hirse ist von Natur aus glutenfrei. Damit der Glutengehalt unserer glutenfreien Hirseflocken garantiert unter 20 ppm (20 mg/kg) Gluten liegt, werden sie sorgfältig getrennt von allen glutenhaltigen Produkten gehalten und mehrmals analysiert. Dafür achten wir in unserer Mühle auf streng getrennte Warenströme und separate Produktionslinien. Erst wenn auch die letzte Analyse die Glutenfreiheit bestätigt, verlassen die Produkte unser Haus. Für eine ökologische und sichere Verpackungslösung für die glutenfreien Produkte setzen wir auf Pergaminpapier. Dieses ist sehr dicht und besitzt eine Fettbarriere. Bei unseren Beuteln für die glutenfreien Produkte verwenden wir einen kompletten Innenbeutel aus diesem Papier. Er bietet ausreichend Schutz vor nachträglicher Verunreinigung. Weil er aus 100% Papier besteht, kann er problemlos über das Altpapier entsorgt werden. Für unsere glutenfreien Hirseflocken wird das ganze Korn gedämpft und anschließend zu einer schönen Flocke gewalzt. So bleiben alle wertvollen Inhaltsstoffe des vollen Getreidekorns erhalten. Hirse ist besonders reich an Silicium. Dieses Spurenelement stärkt Haut, Haare und Nägel. Mit ihrem nussigen, milden Geschmack und dem hohen Gehalt an Mineralstoffen wie Eisen und Magnesium sind Hirseflocken ein sehr wertvoller Baustein in einer gesunden Ernährung.', 'Spielberger GmbH', 'Spielberger Mühle', 'Ukraine', 'fdf6f908-0cb8-4c07-b60f-70b75a37e0d8', 'correction', '2021-09-07 11:24:17', 'System', '2024-02-07 02:07:55', 1609, 102, 0, NULL, 0, 1.25, 'Weiling', 0, NULL, 0, 64, 'Hirseflocken* *aus kontrolliert ökologischer Erzeugung', '2023-01-16 19:09:28', 760, 'MUISLI_FLAKES_NUTS', 'PANTRY', 260, 19, 'VEGAN;VEGETARIAN;GLUTENFREE', NULL, NULL),
(1529, 'Pesto Rucola (Weiling)', '4000915104523', 0, 3.69, 1, 1, NULL, 0, NULL, 'Pesto Rucola', 'Der Begriff \"Pesto\" leitet sich von dem italienischen Wort \"pestare\" ab und bedeutet \"zerstoßen, zerkleinern\". So werden für das Pesto Rucola frische Kräuter, Knoblauch, Nüsse, sowie Hartkäse kleingehackt und mit Öl vermischt. Es entsteht eine aromatisch schmackhafte Sauce', 'Isana Naturfeinkost GmbH & Co. Produktions- und Handels KG', 'bio-verde', 'GERMANY', '5075e421-82a9-4cec-bfd9-529fab429aad', 'correction', '2021-09-07 11:23:48', 'System', '2023-10-10 00:01:41', 1610, 101, 0, NULL, 0, 2.72, 'Weiling', 0, NULL, 0, 64, 'Sonnenblumenöl*, Rucola* (17%),\nPetersilie*, HARTKÄSE* (9%), CASHEWKERNE*,\nWeißweinessig*, Knoblauch*,\nOlivenöl*, Meersalz, Kartoffelflocken*,\nkonzentrierter Zitronensaft* *aus kontrolliert ökologischer Erzeugung', '2022-08-27 00:00:24', 317.625, 'GOURMET_CONVENIENCE', 'FRESH', 300, 10.5, 'VEGETARIAN', NULL, NULL),
