(1542, '80% Bio-Zartbitterschokolade & Fleur de Sel (Weiling)', '4260485630505', 0, 2.79, 1, 1, NULL, 0, NULL, '80% Bio-Zartbitterschokolade & Fleur de Sel', 'Salziges trifft auf Süßes-eine Geschmacksexplosion, unsere Schokolade mit Fleur de Sel und 80% Kakaoanteil. Unsere 80%-ige Schokolade mit Fleur de Sel verbindet kraftvolle Kakaoaromen mit dem Prickeln von Salzkristallen. Ein wahres Freudenfest für die Geschmacksnerven. ', 'fairafric AG', 'fairafric', 'GHANA', '754106ad-f17f-4bb7-8cff-5abd433409a6', 'manager', '2021-09-07 12:14:31', 'System', '2023-12-09 03:52:48', 1622, 105, 0, NULL, 0, 1.7, 'Weiling', 0, NULL, 0, 588, 'Kakaomasse*, Rohrohrzucker*, Kakaobutter*, Fleur de Sel *aus kontrolliert ökologischer Erzeugung', '2022-11-29 15:41:24', 115.182, 'SWEETS', 'SNACKS', 92, 16.2, 'VEGAN;VEGETARIAN', NULL, NULL),
