(1545, 'WH MM Bioland Zaziki (Weiling)', '4028332442424', 0, 2.99, 1, 1, NULL, 0, NULL, 'WH MM Bioland Zaziki', 'HERZHAFTE DIPS\nMit würzigen Dips schmecken knackige Gemüsesticks, Cräcker oder Chips erst so\nrichtig lecker. Auch passen Dips prima zu Fleisch, Fisch, Gemüse oder frischem Brot.\nDie Weißenhorner Milch Manufaktur hat drei ausgezeichnete Köstlichkeiten im\nSortiment, die mit ihren aromatischen Zutaten in Bioland-Qualität und ihren individuellen\nRezepturen einen Geschmack vom Feinsten bieten.', 'Weißenhorner Molkerei GmbH', 'Weißenhorner Milch Manufaktur', 'GERMANY', '1de8217e-6636-4e55-aecc-e1637b383a4a', 'manager', '2021-09-07 12:35:10', 'System', '2023-05-23 02:05:24', 1625, 106, 1, NULL, 0, 1.74, 'Weiling', 0, NULL, 0, 60, 'RAHMJOGHURT* (75%), Gurken* (18%), 3% Knoblauch*, Olivenöl*, Meersalz, Zitronensaftkonzentrat*, Pfeffer*, native Maisstärke*, Sonnenblumenöl*, Verdickungsmittel: Johannisbrotkernmehl*. *aus kontrolliert ökologischer Erzeugung', '2023-06-02 11:01:13', 496.375, 'DAIRY_PRODUCTS_EGGS;GOURMET_CONVENIENCE', 'FRESH', 175, 9.5, 'VEGETARIAN', NULL, NULL),
