(1549, 'Premium Bio Vanille Soße (Weiling)', '4260520786051', 0, 1.99, 1, 1, NULL, 0, NULL, 'Premium Bio Vanille Soße', 'Zu frischen Erdbeeren, roter Grütze oder Schokopudding kann es nur eine Begleiterin geben: Unsere cremige Bourbon Vanille Soße die nach klassischem Rezept gekocht wird. Eine klassische Vanille Soße mit einfachen, natürlichen Zutaten.', 'Roggenkamp Dairy GmbH', 'Roggenkamp Organics', 'GERMANY', 'fb447f73-85bd-4404-b1f9-6c18e66d3b8c', 'correction', '2021-09-08 19:24:17', 'System', '2023-01-16 19:10:28', 1629, 110, 0, NULL, 0, 1.67, 'Weiling', 2, 1, 0, 62, NULL, '2022-07-12 14:13:09', 297.729, 'GOURMET_CONVENIENCE', 'FRESH', 165, 13, 'VEGETARIAN', NULL, NULL),
(1550, 'Bauchfleisch Schwein (Schlehbaumhof)', '100026', 0, 24.9, 0, 1, NULL, 0, '100026', 'Bauchfleisch Schwein', 'Dieses Produkt stammt von Bunten Bentheimer Schweinen vom Bioland-Schlehbaumhof in Osnabrück-Darum, wo sie in mobiler Auslaufhaltung ökologisch gehalten werden. Dank der „Schweinmobile“ kann der Schlehbaumhof eine ganzjährige Freilandhaltung gewährleisten. So sind die Schweine bei Bedarf vor Wettereinflüssen geschützt und können gleichzeitig von den natürlichen Reizen auf der Auslauffläche profitieren.\r\n Mehr Infos findet ihr unter https://schlehbaumhof.de/tiere/schweine/.', 'Schlehbaumhof', NULL, 'Osnabrück-Darum', NULL, 'correction', '2021-09-08 16:52:45', 'manager', '2022-03-22 15:24:32', 1630, NULL, 1, NULL, 0, 17.6, 'Schlehbaumhof', 2, 0, 3, NULL, NULL, '2022-03-22 15:24:32', NULL, '3', NULL, NULL, NULL, NULL, NULL, NULL),
