(1553, 'Bulgur-Salat mit Paprika und Curry, vegan (Weiling)', '4000915100501', 0, 2.79, 1, 1, NULL, 0, NULL, 'Bulgur-Salat mit Paprika und Curry, vegan', 'Bulgur wird vorwiegend in der Türkei und im Vorderen Orient als Grundnahrungsmittel verzehrt, dazu werden die Weizenkörner getrocknet und anschließend klein geschnitten.\nbio-verde zaubert daraus einen erfrischenden Salat verfeinert mit Paprika, Lauch und Curry.', 'Isana Naturfeinkost GmbH & Co. Produktions- und Handels KG', 'bio-verde', 'GERMANY', 'd60dfb79-512b-4086-a4dd-ff4dda490ea7', 'manager', '2021-09-08 15:07:14', 'System', '2023-01-16 19:10:33', 1633, 111, 0, NULL, 0, 1.84, 'Weiling', 0, NULL, 0, 64, 'Bulgur* (49% - HARTWEIZEN* und Wasser), Lauch*, Olivenöl*, Paprika* (9%), Petersilie*, Agavendicksaft*, Meersalz, Zitronensaftkonzentrat*, Curry* 0,4% , Peperoni*, Branntweinessig*, Kurkuma* *aus kontrolliert ökologischer Erzeugung', '2022-06-23 04:24:16', 480.2, 'GOURMET_CONVENIENCE', 'FRESH', 138, 9.8, 'VEGAN;VEGETARIAN', NULL, NULL),
