(1556, 'Lakritzschlange Salzlakritz (Weiling)', '8713576162073', 0, 1.29, 1, 1, NULL, 0, NULL, 'Lakritzschlange Salzlakritz', 'Diese Salzlakritzschlangen kannst duin Ruhe genießen. Die Schlangen sind sage  und schreibe 65 cm lang. Sie schmecken leicht salzig und haben eine Struktur,  die gleichzeitig weich und doch fest ist. Die Hauptzutat, die besondere  schwarze Zuckerrohrmelasse, ist vonechter biologischer Spitzenqualität. Das  Süßholzwurzelextrakt holen wir uns bei Experten aus Süditalien. Ein herrlicher  biologischer und veganer Snack für Jung und Alt!  Probiereauch einmal die süßen Lakritzschlangen!', 'TerraSana Natuurvoeding BV', 'TerraSana', 'FINLAND', '88c06370-ac31-4f35-a074-95ebae65d0b9', 'manager', '2021-09-08 15:14:30', 'System', '2023-07-01 00:18:21', 1636, 113, 0, NULL, 0, 0.92, 'Weiling', 0, NULL, 0, 35, 'schwarze Zuckerrohrmelasse*, WEIZENmehl*, Zuckerrübensirup*, Salz, Maissirup*, Süßholzwurzelextrakt* 2%, Anisöl* *aus kontrolliert ökologischer Erzeugung', '2022-10-15 02:05:40', 212.8, 'SWEETS', 'SNACKS', 58, 76, 'VEGAN;VEGETARIAN', NULL, NULL),
(1557, 'Kochbananen Chips salzig (Weiling)', '4270000598203', 0, 2.29, 1, 1, NULL, 0, NULL, 'Kochbananen Chips salzig', 'el origen, der crunchy Snack aus Lateinamerika: Bio-Kochbananen Chips mit Meersalz, die den Ausbau von direct trade und biologisch nachhaltiger Landwirtschaft in Ecuador unterstützen. Vegan, Bio-zertifiziert, Palmöl-frei, Glutenfrei, ohne Zusätze. Für unsere super leckeren Chips werden die Bio-Kochbananen frisch geerntet, in feine Scheiben geschnitten und zusammen mit Sonnenblumenöl und Meersalz zu diesem super leckeren Snack verarbeitet. In Lateinamerika sind diese Chips als traditionelle Spezialität weit verbreitet und schon lange sehr beliebt.', 'el origen food GmbH', 'el origen', 'ECUADOR', 'a11c7959-b481-4d3f-8719-0f9a4d6d97a8', 'manager', '2021-09-08 15:16:38', 'System', '2023-12-09 03:40:41', 1637, 1823, 0, NULL, 0, 1.48, 'Weiling', 0, NULL, 0, 541, 'Bio-Kochbananen* (64 %), Bio-Sonnenblumenöl*, Meersalz\n*100 % aus kontrolliert biologischem Anbau\n *aus kontrolliert ökologischer Erzeugung', '2022-11-11 10:01:02', 900, 'SALTY', 'SNACKS', 84, 20, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE;KOSCHER;HALAL;WITHOUT_ADDED_SUGAR', NULL, NULL),
