(1565, 'Salami Stück (Schlehbaumhof)', '2100019123450', 0, 7.39, 1, 1, NULL, 0, NULL, 'Salami Stück', 'Dieses Produkt stammt von Bunten Bentheimer Schweinen vom Bioland-Schlehbaumhof in Osnabrück-Darum, wo sie in mobiler Auslaufhaltung ökologisch gehalten werden. Dank der „Schweinmobile“ kann der Schlehbaumhof eine ganzjährige Freilandhaltung gewährleisten. So sind die Schweine bei Bedarf vor Wettereinflüssen geschützt und können gleichzeitig von den natürlichen Reizen auf der Auslauffläche profitieren.\r\n Mehr Infos findet ihr unter https://schlehbaumhof.de/tiere/schweine/.', 'Schlehbaumhof', NULL, 'Osnabrück-Darum', NULL, 'correction', '2021-09-15 10:50:20', 'manager', '2021-10-18 12:29:54', 1647, NULL, 1, NULL, 0, 0, 'Schlehbaumhof', 2, 0, 0, NULL, NULL, '2021-10-18 12:29:54', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL),
