(1601, 'Kaffee Brezel (Weiling)', '4250096904294', 0, 4.79, 1, 1, NULL, 0, NULL, 'Kaffee Brezel', 'Unsere Dinkelvollkorn-Cantuccinis, Butterkekse, Kaffee-Brezeln oder Schwarz-Weiß-Gebäck sind feine Gebäcke zu einer Tasse Tee oder Kaffee. Ein tolles Geschenk für liebe Freunde, aber natürlich auch eines für den eigenen Gaumen. Zart duftend und aromatisch im Geschmack. Für unsere hohen Qualitätsansprüche verwenden wir ausschließlich hochwertige Zutaten.', 'Wertkreis Gütersloh gGmbH', 'Kiebitzhof', 'Gütersloh, NRW', '28a1779a-3140-48f8-b3fa-546ba2ca55e5', 'correction', '2021-10-05 12:19:24', 'System', '2023-11-10 02:10:00', 1684, 2291, 1, NULL, 0, 2.85, 'Weiling', 2, 1, 0, 63, NULL, '2023-05-16 10:18:09', 675, 'SWEETS', 'SNACKS', 170, 20, 'VEGETARIAN', NULL, NULL),
