(1606, 'Bio Mare Stremel Lachs Natur (Weiling)', '4004689269044', 0, 6.89, 1, 1, NULL, 0, NULL, 'Bio Mare Stremel Lachs Natur', 'Der Lachs wächst in einer ökologischen Aquakultur vor der schottischen und irischen Küste heran. Permanentes Ankämpfen gegen die Strömung des Atlantiks und hochwertiges biologisches Futter sorgen dafür, dass der Fisch zartes, fast fettfreies Fleisch hat.', 'Wechsler Feinfisch GmbH', 'Bio Mare', 'GERMANY', '1e81662b-e089-4300-8448-919e69b9a4d3', 'manager', '2021-09-24 12:12:15', 'System', '2023-11-29 02:12:14', 1689, 296, 3, NULL, 0, 4.6, 'Weiling', 0, NULL, 0, 61, 'BIO-LACHS, Meersalz, Buchenholzrauch *aus kontrolliert ökologischer Erzeugung', '2022-04-16 00:00:16', 427.5, 'MEAT_FISH', 'FRESH', 124, 25, NULL, NULL, NULL),
(1607, 'Schweine-Hüftsteaks (Schlehbaumhof)', '100080', 0, 34.9, 0, 1, NULL, 0, NULL, 'Schweine-Hüftsteaks', 'Dieses Produkt stammt von Bunten Bentheimer Schweinen vom Bioland-Schlehbaumhof in Osnabrück-Darum, wo sie in mobiler Auslaufhaltung ökologisch gehalten werden. Dank der „Schweinmobile“ kann der Schlehbaumhof eine ganzjährige Freilandhaltung gewährleisten. So sind die Schweine bei Bedarf vor Wettereinflüssen geschützt und können gleichzeitig von den natürlichen Reizen auf der Auslauffläche profitieren.\r\n Mehr Infos findet ihr unter https://schlehbaumhof.de/tiere/schweine/.', 'Schlehbaumhof', NULL, 'Osnabrück-Darum', NULL, 'manager', '2021-09-24 12:36:28', 'manager', '2022-03-22 15:08:13', 1690, NULL, 1, NULL, 0, 24.2, 'Schlehbaumhof', 2, 0, 3, NULL, NULL, '2022-03-22 15:08:13', NULL, '3', NULL, NULL, NULL, NULL, NULL, NULL),
