(1612, 'Couscous Salat mit Linsen und Lauch (Weiling)', '4000915100570', 0, 2.79, 1, 1, NULL, 0, NULL, 'Couscous Salat mit Linsen und Lauch', 'Couscous entsteht aus Hartweizengrieß und\nwird zu feinen Kügelchen gerieben. Ursprünglich kommt das Getreideprodukt aus der Nordafrikanischen Küche. Bei bio-verde wird aus Couscous sowie Karotten, Linsen und feinen Kräutern ein aromatischer Salat gezaubert.', 'Isana Naturfeinkost GmbH & Co. Produktions- und Handels KG', 'bio-verde', 'GERMANY', '16e81fc4-8e11-412c-acb0-425f9564f711', 'manager', '2021-09-29 14:07:28', 'System', '2023-06-21 02:06:15', 1697, 299, 0, NULL, 0, 2, 'Weiling', 0, NULL, 0, 64, 'Couscous* (27% - HARTWEIZEN* und Wasser), Sonnenblumenöl*, Linsen* (14%), Karotten* (10%), Olivenöl*, Petersilie*, Lauch* (6%), Paprika*, Tomaten*, Meersalz, Agavendicksaft*, Knoblauch*, konzentrierter Apfelsaft*, konzentrierter Zitronensaft*, Branntweinessig*, Paprika edelsüß*, Peperoni*, Kurkuma* *aus kontrolliert ökologischer Erzeugung', '2022-10-28 02:04:26', 480.2, 'GOURMET_CONVENIENCE', 'FRESH', 138, 9.8, 'VEGAN;VEGETARIAN', NULL, NULL),
(1613, 'Pizza-Pizza Bratfilets (Weiling)', '4012359144201', 0, 2.69, 1, 1, NULL, 0, NULL, 'Pizza-Pizza Bratfilets', 'Kurz mit etwas Öl anbraten und fertig!\nIdeal für den kleinen Hunger zwischendurch oder zu Pastagerichten und Salaten. Passt auch hervorragend kalt aufs Brot. \n', 'Taifun-Tofu GmbH', 'Taifun', 'Baden-Württemberg', 'd12f08e7-eb58-4bc3-9580-c2d0b6a45da2', 'manager', '2021-09-29 14:11:40', 'System', '2024-01-26 02:09:39', 1698, 300, 0, NULL, 0, 1.99, 'Weiling', 0, NULL, 0, 64, 'TOFU* 74% (SOJABOHNEN* 55%, Wasser, Gerinnungsmittel: Magnesiumchlorid, Calciumsulfat), Gemüsepaprika*,\nSonnenblumenöl*, Tomatenmark*, Meersalz, Auberginen*, Knoblauch*, Paprika scharf*, Weißweinessig*, Basilikum*, Thymian*,\nRosmarin*, Oregano*, Peperoni*. *aus kontrolliert ökologischer Erzeugung', '2022-05-17 03:11:17', 303.75, 'GOURMET_CONVENIENCE', 'FRESH', 173.3, 15, 'VEGAN;VEGETARIAN;LACTOSEFREE', NULL, NULL),
