(1623, 'Heumilch Bergkäse (Weiling)', '208194', 0, 28.9, 0, 1, NULL, 0, NULL, 'Heumilch Bergkäse', 'Der Bergkäse ist wie der Emmentaler ein typischer Hartkäse, der im Allgäu hergestellt wird. Kräftig und robust im Äußeren entpuppt sich der ÖMA Heumilch Bergkäse als reichhaltiger Klassiker im Geschmack. Er ist ausnehmend würzig und der feine Schmelz seines Teiges zergeht auf der Zunge. Er wird aus reinster Heumilch von Hörner tragenden Demeter-Kühen in unserer Käserei Leupolz hergestellt. Während der Reifung bei 15°C wird der Bergkäse zweimal wöchentlich gewendet und mit einer leichten Salzlake eingerieben (geschmiert). Dadurch erhält er ein pikantes Aroma und einen geschmeidigen Teig. Für die interessierten Kunden & Käseliebhaber gibt es Hintergrundinformationen und -geschichten rund um den Käse, die Landwirte und die Molkerei. Alles zusammengefasst in einem ÖMA Partnerporträt. Inmitten des Allgäuer Hügellands liegt unsere ÖMA Käserei Leupolz, die im Jahre 1960 als genossenschaftlich organisierte \'Emmentaler Käserei Leupolz\' gegründet wurde. Aufgrund der steigenden Anzahl ökologisch wirtschaftender Milchbauern in der Region wurde 1986 eine zweite, gesonderte Produktionslinie eingerichtet, auf der bis heute ausschließlich Demeter-Produkte hergestellt werden. Käsermeister Pit Pfohl und seine Mitarbeiter verarbeiten hier täglich 13.000 Liter frische Demeter-Milch zu Butter, Schnitt- und Hartkäse. Die Beliebtesten unter ihnen sind die Hartkäse-Klassiker Heumilch Emmentaler und Heumilch Bergkäse. Die 22 Demeter-Lieferlandwirte bewirtschaften ihre Höfe auf biologisch-dynamische Wirtschaftsweise. Diese zeichnet sich aus durch Vielfalt in Anbau und Tierhaltung, Entwicklung des Hofes als individuellen, lebendigen Organismus, Arbeiten im Rhythmus natürlicher Kreisläufe und kosmischer Einflüsse und gezielten Einsatz der biologisch-dynamischen Präparate. Die Hörner tragenden Milchkühe grasen im Sommer auf den kräuterreichen Allgäuer Wiesen, im Winter wird ausschließlich getrocknetes Heu und hofeigenes Getreideschrot zugefüttert.\r\n\r\nBergkäse ist fester Bestandteil der süddeutschen Küche, gehört auf jedes Käsebrett und dient zum Überbacken herzhafter Gerichte. Gewürfelt ist der ÖMA Allgäuer Bergkäse eine ausgezeichnete Begleitung für gehaltvolle Rotweine. Weintipps und Rezepte finden Sie auf www.oema.de', 'ÖMA Beer GmbH', NULL, 'Allgäu', NULL, 'correction', '2021-10-01 11:06:28', 'manager', '2023-05-05 09:21:23', 1708, NULL, 2, NULL, 0, 17.9, 'Weiling', 0, NULL, 1, NULL, 'KUHMILCH*, Speisesalz, Milchsäurekulturen, mikrobielles Lab\r\nenthält folgende allergene Zutaten: Milch\r\n**aus biodynamischer Erzeugung', '2023-05-05 09:21:23', 2500, 'CHEESE', 'FRESH', NULL, NULL, 'VEGETARIAN', NULL, NULL),
