(1627, 'ÖMA Back-Bergkäse, Bioland - SB', '4026913124158', 0, 3.49, 1, 1, NULL, 0, NULL, 'ÖMA Back-Bergkäse, Bioland - SB', 'Mit unserer Partnermolkerei Bantel aus dem nahen Vorarlberg ist uns ein weiterer Clou in Sachen schnelle und leckere Küche gelungen. Würzige Bergkäse Sticks in knuspriger Panade vorgebacken. Eine schmackhafte Mahlzeit, die schnell und kinderleicht zubereitet ist. Ob Sie als Begleiter ein süß-saures Chutney wählen oder die Sticks auf ein Salatbett anrichten, unser ÖMA Back-Bergkäse ist ein delikater Hochgenuss. Die Grundlage ist mildwürziger Bergkäse aus bester Bioland-Milch aus unserer ÖMA Produktion in Kimratshofen. Ein Muss für jedes SB-Regal.\n\nVerpackt ist der ÖMA Back-Bergkäse in einem Karton mit 25% Grasanteil. Bei dieser umweltbewussten Kartonherstellung wird ein Teil des wertvollen Holzschliffs durch aufbereitete Grasfasern ersetzt. Dieses Gras stammt von extensiven Naturwiesen. Kurze Transportwege, weniger CO2-Emissionen und geringerer Energie- und Wasserverbrauch bedeuten eine positive Ökobilanz.\nSelbstverständlich ist der Karton zudem FSC zertifiziert und somit ein erster Schritt für einen schonenden Umgang mit Waldressourcen. Zu guter Letzt wird die Faltschachtel Print CO2 geprüft. Der schädliche Ausstoß bei der Druckproduktion und Versand wird berechnet und durch die Unterstützung von konkreten Klimaprojekten kompensiert. \n\nFür die interessierten Kunden & Käseliebhaber gibt es Hintergrundinformationen und -geschichten rund um den Käse, die Landwirte und die Molkerei. Alles zusammengefasst in einem ÖMA Partnerporträt.\n\nIn der hoch über dem Bodensee gelegenen Käserei wird Handarbeit noch ganz großgeschrieben. Die 1886 – vom Urgroßvater – gegründete Familienkäserei Bantel hat auf Initiative der Ökologischen Molkereien Allgäu 1994 auf die ökologische Wirtschaftsweise umgestellt.', 'ÖMA Beer GmbH', 'ÖMA', 'Vorarlberg', '1eed9408-f5dd-438a-adbb-b26294d2775c', 'manager', '2021-10-01 12:12:29', 'System', '2023-09-07 03:51:55', 1712, 303, 1, NULL, 0, 0, NULL, 0, NULL, 0, 0, 'Bergkäse* 70% (KUHMILCH*, Speisesalz, Milchsäurekulturen, mikrobielles Lab), Semmelbrösel* 15% (WEIZENMEHL*, Hefe*, Speisesalz), BUTTERSCHMALZ* 14,5%, VOLLEIPULVER*, WEIZENMEHL* *aus kontrolliert ökologischer Erzeugung', '2021-11-11 12:45:49', 393.3, 'CHEESE', 'FRESH', 118, 11.5, 'VEGETARIAN', NULL, NULL),
