(1630, 'ÖMA Délicette, Bioland - Theke/SB', '4026913157996', 0, 6.79, 1, 1, NULL, 0, NULL, 'ÖMA Délicette, Bioland - Theke/SB', 'Aus täglich frisch angelieferter Bioland-Milch zaubert Käsermeister Georg Bantel die sahnig-herzhafte Weichkäse-Spezialität ÖMA Délicette. Der Weichkäse mit weißem Edelschimmel wird nach 2-3 Wochen Pflege im Reifekeller in eine Holzspandose verpackt, in der er später als Ofen-Menue ausgebacken werden kann. \nMit unserer ÖMA Délicette gelingt jederzeit und im Nu eine perfekte Mahlzeit. In großer und kleiner Runde, in der Familie oder zu zweit, erweist sich das Ofen-Menue als wunderbar einfach und schnell gezaubertes Käsegericht. In der kühleren Jahreszeit aus dem Ofen, im Sommer als Grill-Variante bietet die Délicette cremigen Weichkäse-Genuss vom Allerfeinsten - der Hit für Ihr SB-Regal! \nFür die interessierten Kunden & Käseliebhaber gibt es Hintergrundinformationen und -geschichten rund um den Käse, die Landwirte und die Molkerei. Alles zusammengefasst in einem ÖMA Partnerporträt. \nDie 1886 gegründete Familienkäserei Bantel hat auf Initiative der Ökologischen Molkereien Allgäu 1996 auf die ökologische Wirtschaftsweise umgestellt. Heute werden von ÖMA-Käsermeister Georg Bantel wöchentlich 60.000 Liter ökologisch gewonnene Alpenmilch zu absoluten Premiumprodukten verarbeitet. Die Energie für die Produktion wird über eine eigene Photovoltaik- & Biomasseheizanlage bezogen, Energie eingespart wird durch eine Wärmerückgewinnungsanlage. Insgesamt liefern 12 ausgewählte Landwirte den kostbaren Rohstoff Milch und tragen mit ihrer Arbeit tagtäglich zum Erhalt und zur Pflege der Landschaft bei. Die Milch kommt aus Deutschland und Österreich und die Höfe der Lieferlandwirte liegen alle in der Region Vorarlberg im Umkreis von max. 15km um die Molkerei. Kurze Wege eben.', 'ÖMA Beer GmbH', 'ÖMA', 'Vorarlberg', '2b4c1995-f4ae-4ffb-9322-b819d2553430', 'manager', '2021-10-01 15:22:05', 'System', '2023-09-07 03:52:00', 1715, 304, 1, NULL, 0, 4.9, NULL, 0, NULL, 0, 0, 'KUHMILCH*, Speisesalz, Käsereikulturen, mikrobielles Lab *aus kontrolliert ökologischer Erzeugung', '2022-06-06 10:00:45', 504, 'CHEESE', 'FRESH', 335, 12, 'VEGETARIAN', NULL, NULL),
