(1644, 'Hof-Gemüse Bernds Brokkoli Mandel', '4016249132378', 0, 2.99, 1, 1, NULL, 0, NULL, 'Hof-Gemüse Bernds Brokkoli Mandel', 'Unser Gemüse ist so lecker, da wollten wir unbedingt so viel wie möglich in unseren Aufstrich unterbringen. So kam es, dass unser Hof-Gemüse-Aufstrich eine neue Kategorie im Bio-Fachmarkt begründet hat. So viel hatte vorher nämlich noch keiner verarbeitet. Ja, bis zu 70%! Je mehr Gemüse, desto mehr Geschmack. Ist ja irgendwie logisch. Und das bei einem Fettgehalt von maximal 20%. Ergibt nach unserer Rechnung satte 100% Gemüse-Genuss. (Im Kochen sind eben besser als im Rechnen.)', 'Allos Hof-Manufaktur GmbH', 'Allos', 'GERMANY', '023c26f3-e8b7-47d8-b9ae-5c9b98fca1d6', 'manager', '2021-10-05 08:13:34', 'System', '2024-02-03 02:09:53', 1730, 312, 0, NULL, 0, 1.95, NULL, 0, NULL, 0, 61, 'Brokkoli* (44%), Zucchini* (13%),Sonnenblumenkerne*,\nSonnenblumenöl*, Zwiebeln* (5%), Agavendicksaft*, MANDELN* (3%), Kartoffeln* (3%), ,  Zitronensaftkonzentrat*, Kartoffelstärke*, Zwiebelpulver*, Spinatpulver*, weißer Pfeffer*, Muskatnuss*, Meersalz, Verdickungsmittel: Johannisbrotkernmehl*. *aus ökologischem Landbau.', '2022-11-29 16:22:28', 373.034, 'SPREADS_HONEY', 'PANTRY', 286, 7.4, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(1645, 'Body Lotion Vitalisierend (Weiling)', '4021457637447', 1, 7.49, 1, 1, NULL, 0, NULL, 'Body Lotion Vitalisierend', 'Die Body Lotion Vitalisierend mit Bio-Orange & Bio-Mandelöl für normale Haut.\n\nErlebe das lavera Gefühl vitalisierender Pflege:\nUnsere milde Formel mit Bio-Orange und Bio-Mandelöl schenkt deiner Haut wohltuende Feuchtigkeit und verwöhnt die Sinne mit belebendem Duft.\n- Leichte Textur\n- Belebender Orangenduft\n- 100 % natürlich schöne Haut\nBio-Orange kann mit ihrem anregenden Duft die Sinne beleben und ist für ihre hautpflegenden Eigenschaften bekannt.\nBio-Mandelöl wird für seine nährenden und feuchtigkeitsbewahrenden Eigenschaften geschätzt.\n\nUnser Versprechen:\n- Biologisch abbaubare Rezepturen ohne Mineralöle und ohne künstliche Duft-,  Farb- und  Konservierungsstoffe*\n- Zertifiziert nach dem strengen, unabhängigen NATRUE Naturkosmetikstandard. Verträglichkeit dermatologisch bestätigt\n- Klimaneutrale Produkte**, Kunststoff dieser Flasche inkl. Verschluss aus 100 % recyceltem Material\n- Vegan & nach PETA-Kriterien zertifiziert\n- Exklusive Naturkompositionen aus der lavera-Forschung, mit dem Besten aus der Natur\n* gem. EU-Kosmetik VO\n** ClimatePartner.com/12310-1610-1001\n\nlavera. Natur, die du fühlst\n\nMade in Germany', 'Laverana GmbH & Co.KG', NULL, 'Wennigsen, Niedersachsen', '094cb4da-13c4-4ac0-9502-5c3c8610d495', 'manager', '2021-10-05 10:27:55', 'System', '2023-10-20 02:08:13', 1731, 1350, NULL, NULL, 0, 4.59, 'Weiling', 1, 1, 0, NULL, NULL, '2022-10-13 02:05:52', 478.216, 'BODY_CARE', 'DRUGSTORE', 228.03, 18.1, 'VEGAN;VEGETARIAN', NULL, NULL),
