(1651, 'BIO BRUNCH MIX (Weiling)', '4022993045901', 0, 3.79, 1, 1, NULL, 0, NULL, 'BIO BRUNCH MIX', 'BRUNCH MIX\n(Glutenfreie Bio Kleingebäckmischung mit Maisbrötchen,\nMaisbrötchen mit Leinsamenmehl und Maisbrötchen mit\nÖlsaaten zum Aufbacken oder Toasten): Der perfekte Mix für jeden, der am liebsten von allem probieren möchte. In beiden Hälften befindet sich von jeder Sorte mindestens eines der Minibrötchen. Diese Auswahl ist einfach ideal für jedes Buffet.', 'Schnitzer GmbH & Co. KG', 'Schnitzer GLUTENFREIHEIT', 'GERMANY', '76bd87de-bb79-40b6-8af9-fe7a96ad087f', 'manager', '2021-10-08 11:15:51', 'System', '2023-02-09 02:05:40', 1736, 320, 0, NULL, 0, 2.38, 'Weiling', 0, NULL, 0, 61, 'Maisbrötchen: Wasser, 30% Maisstärke*, Reisnatursauerteig* (Reismehl*, Wasser), Hirseflocken*, Leinsamenmehl*, Sonnenblumenöl*, 3 % Maismehl*, Reismehl*,  Flohsamenschalen*, Erbsenprotein*, Dextrose*, Meersalz, Hefe*, Verdickungsmittel: Guarkernmehl*, Xanthan, Gewürze*.\n\nMaisbrötchen mit Leinsamenmehl: Wasser, 27% Maisstärke*, Reisnatursauerteig* (Reismehl*, Wasser), 4% Leinsamenmehl*, Apfelfaser*, Sonnenblumenöl*, Reismehl*, 3% Maismehl*, Flohsamenschalen*, Erbsenprotein, Meersalz, Hefe*, Verdickungsmittel: Guarkernmehl*, Xanthan, Gewürze*.\n\nMaisbrötchen mit Ölsaaten: Wasser, 27% Maisstärke*, Reisnatursauerteig* (Reismehl*, Wasser), 4 % Leinsamenmehl*, Apfelfaser*, Sonnenblumenöl*, Reismehl*, 3% Maismehl*, 2% SESAM*, 2% Leinsamen*, Flohsamenschalen*, Erbsenprotein, Meersalz, Hefe*, Verdickungsmittel: Guarkernmehl*, Xanthan, Gewürze*. *aus kontrolliert ökologischer Erzeugung', '2022-11-29 15:58:02', 2147.04, 'BREAD_BUNS', 'PASTRY', 213, 21.3, 'VEGETARIAN;GLUTENFREE', NULL, NULL),
(1652, 'Hafer Blueberry Vanilla (Weiling)', '42418702', 0, 2.59, 1, 1, NULL, 0, NULL, 'Hafer Blueberry Vanilla', 'Von Natur aus cremig süßer Hafer bildet die Basis für unsere fermentierten Alternativen. Vegane, probiotische Joghurtkulturen formen seinen vollmundigen Charakter, reife Früchte setzen tiefe Akzente. Für ein Geschmackserlebnis, das dem Gaumen in Erinnerung bleibt. \nHarvest Moon Hafer Blueberry Vanilla - Die vollmundige Verschmelzung aus samtigen Heidelbeeren und delikater Vanille.', 'Whollees GmbH', 'Harvest Moon', 'AUSTRIA', '090641db-eac6-4c4c-878f-136ad665b45c', 'manager', '2021-10-08 11:58:27', 'System', '2023-09-28 02:07:17', 1737, 321, 0, NULL, 0, 1.89, 'Weiling', 0, NULL, 0, 0, 'Haferdrink* 73 % (Wasser, Hafer*), Heidelbeeren* 8 %, Traube*, Stärke*, Reis*, Kokosöl*, Bourbon Vanille*, Zitrone*, Holunder*, Meersalz, vegane Joghurtkulturen.\n* = kontrolliert biologischer Anbau. *aus kontrolliert ökologischer Erzeugung', '2022-10-10 00:01:18', 800, 'VEGAN_VEGETARIAN', 'FRESH', 295, 10, 'VEGAN;VEGETARIAN', NULL, NULL),
(1653, 'Ziegenfrischkäse in Olivenöl & Kräuter SB 150g (Weiling)', '4260100870101', 0, 4.69, 1, 1, NULL, 0, NULL, 'Ziegenfrischkäse in Olivenöl & Kräuter SB 150g', 'Monte Ziego ist 100 % Bio und 100 % Ziege\n\nSeit dem Jahr 2000 produzieren wir handwerklich hergestellten Ziegenkäse in verschiedenen Variationen. Hierbei setzen wir stets auf höchste Qualität welche wir durch den Einsatz bester Rohstoffe, handwerkliche schonende Verarbeitung und eine enge Kommunikation und Zusammenarbeit mit unseren Schwarzwälder Ziegenbauern gewährleisten. \n\nDie  Produktion der handwerkliche Käsespezialitäten findet in Teningen - zwischen Glotter, Elz und Dreisam gelegen - auf einer Fläche von 850 qm statt.\n\nNeben der Entwicklung neuer Produkte bauen wir auch unser Qualitätswesen stetig aus - seit dem Frühjahr 2016 sind wir IFS Food zertifiziert.', 'Monte Ziego GmbH & Co. KG', 'Monte Ziego', 'Schwarzwald', '01eb30ae-2616-4a55-8481-8775837a2eff', 'manager', '2021-10-08 12:03:58', 'System', '2023-09-07 03:51:48', 1738, 322, 2, NULL, 0, 3.1, 'Weiling', 0, NULL, 0, 69, '87% ZIEGENFRISCHKÄSE** (ZIEGENMILCH**, Kulturen, Kälbermagenlab, Steinsalz), 12 % Olivenöl*, 0,7 % Kräutermischung*, Knoblauch*. *aus kontrolliert ökologischer Erzeugung **aus biodynamischer Erzeugung', '2022-10-29 02:03:49', 318.987, 'CHEESE', 'FRESH', 160, 6.9, NULL, NULL, NULL),
