(1670, 'Nackenbraten Schwein (Schlehbaumhof)', '100120', 0, 29.9, 0, 1, NULL, 0, NULL, 'Nackenbraten Schwein', 'Dieses Produkt stammt von Bunten Bentheimer Schweinen vom Bioland-Schlehbaumhof in Osnabrück-Darum, wo sie in mobiler Auslaufhaltung ökologisch gehalten werden. Dank der „Schweinmobile“ kann der Schlehbaumhof eine ganzjährige Freilandhaltung gewährleisten. So sind die Schweine bei Bedarf vor Wettereinflüssen geschützt und können gleichzeitig von den natürlichen Reizen auf der Auslauffläche profitieren.\r\n Mehr Infos findet ihr unter https://schlehbaumhof.de/tiere/schweine/.', 'Schlehbaumhof', NULL, 'Osnabrück-Darum', NULL, 'manager', '2021-10-14 12:35:20', 'manager', '2022-03-22 15:30:19', 1755, NULL, 1, NULL, 0, 20.9, 'Schlehbaumhof', 2, 0, 3, NULL, NULL, '2022-03-22 15:30:19', NULL, '3', NULL, NULL, NULL, NULL, NULL, NULL),
