(1673, 'Yogi Tea® Kurkuma Chai, Bio-Gewürztee (Weiling)', '4012824404120', 0, 3.79, 1, 1, NULL, 0, NULL, 'Yogi Tea® Kurkuma Chai, Bio-Gewürztee', '-Intensiv, vielseitig, zauberhaft\n-Chai - Tee mit goldgelben Kurkuma, Zimt, Ingwer, Karadomom und Pfeffer\n-100% natürliche Zutaten, 100% Bio\n-Teebeutel 100% kompostierbar, recyclebare Verpackung\n-Mit der Anleitung für eine inspirierende Yoga-Übung auf jeder Packung\n-Mit motivierenden Weisheiten an jedem Teebeutel\n\nDer Gewürz-Tee Yogi Tea® Kurkuma Chai Bio  ist kräftig, sinnlich und vielseitig. Die starke Mutter Erde bringt sie hervor: die wundervolle, gold-leuchtende Kurkuma-Wurzel. Durch ihren Genuss fühlen wir uns auch in turbulenten Zeiten gut aufgehoben. Kombiniert mit Chai-Gewürzen und  Zimt entfaltet der Gewürztee sein volles, kräftiges Aroma. Lassen Sie sich verzaubern. Besonders lecker auch leicht gesüßt und mit Milch oder einer (veganen) Alternative.', 'YOGI TEA GmbH', 'YOGI TEA', 'ITALY', '2fc95f6b-401a-4ddb-b095-081d9a822b0c', 'manager', '2021-10-15 14:56:39', 'System', '2023-01-16 19:13:53', 1758, 325, 0, NULL, 0, 2.09, 'Weiling', 0, NULL, 0, 102, 'Kurkuma* (Gelbwurz) (55%), Zimt* (14%), Süßholz*, Ingwer* (7%), Kardamom* (3%), schwarzer Pfeffer*, Apfel*, Fenchel*, Muskatblüte*, Kakaoschalen*, Nelken*. *aus kontrolliert ökologischer Erzeugung', '2022-12-17 12:09:41', 585, 'TEA', 'COFFEE_TEA_COCOA', 69, 12, 'VEGAN;VEGETARIAN', NULL, NULL),
