(1682, 'Neutral Gesichtscreme (Weiling)', '4021457625093', 1, 14.79, 1, 1, NULL, 0, NULL, 'Neutral Gesichtscreme', 'Tägliche, hochwirksame Pflege!\n\nDie lavera Neutral Gesichtscreme ist besonders gut verträglich. Sie beruhigt gereizte Haut und beugt Irritationen vor. Spannungsgefühle werden dank intensiver Pflege wirksam gelindert.\n\nHochwirksame Rezeptur:\n• Reichhaltig gepflegtes Hautgefühl\n• Mindert Trockenheitsfältchen\n• Für Neurodermitiker geeignet\n\nGREEN ULTRA SENSITIVE COMPLEX\nDie lavera Naturkosmetik-Forschung hat eine sanfte Rezeptur speziell für empfindliche Haut entwickelt, die mit einer exklusiven Wirkstoffkomposition mit hautverträglichem Süßholzwurzelextrakt die natürliche Hautbarriere stabilisiert.\n', 'Laverana GmbH & Co.KG', NULL, 'Wennigsen, Niedersachsen', '452c9a8a-cf02-4892-baab-9b6e64faf203', 'manager', '2021-10-18 16:37:42', 'System', '2023-10-20 02:09:13', 1766, 1351, NULL, NULL, 0, 8.03, 'Weiling', 1, 1, 0, NULL, NULL, '2023-06-16 09:15:36', 231.648, 'BODY_CARE', 'DRUGSTORE', 69.5, 12.7, 'VEGETARIAN', NULL, NULL),
