(1685, 'PUR Möhren-Apfelsalat mit Ingwer (Weiling)', '4260148651007', 0, 3.99, 1, 1, NULL, 0, NULL, 'PUR Möhren-Apfelsalat mit Ingwer', 'Wir von der Bio-Manufaktur lieben unser Handwerk. Unsere Feinkostsalate werden wie zu Hause von Hand zubereitet, individuell abgeschmeckt und verpackt ready-to-eat. Schmecke den Unterschied… Guten Appetit!', 'PUR Bio Feinkost Manufaktur GmbH & Co. KG', 'PUR Bio-Manufaktur', 'GERMANY', 'f676d45c-6e25-4c48-87ac-5fc91398df84', 'manager', '2021-10-19 09:26:07', 'manager', '2023-06-09 09:44:50', 1769, 354, 0, NULL, 0, 2.35, 'Weiling', 0, NULL, 0, 67, '65 % Möhren*, 16 % Äpfel* (Ascorbinsäure*), Zitronensaft*, Apfelessig*, Sonnenblumenöl*, Rohrohrzucker*, 1,2 % Ingwer*, Meersalz, Maisquellstärke* *aus kontrolliert ökologischer Erzeugung', '2023-06-09 09:45:01', 519.75, 'GOURMET_CONVENIENCE', 'FRESH', 218, 13.5, 'VEGAN;VEGETARIAN;RAWFOOD', NULL, NULL),
