(1694, 'ÖMA Back-Camembert, Bioland - SB', '4026913124004', 0, 3.49, 1, 1, NULL, 0, NULL, 'ÖMA Back-Camembert, Bioland - SB', 'Ein cremiger Camembert in knuspriger Panade vorgebacken! Eine äußerst delikate Mahlzeit, die leicht und schnell zubereitet ist. Ob Sie ihn klassisch mit Preiselbeeren genießen oder sich in gewagteren Kombinationen über ihn hermachen, der ÖMA Back-Camembert ist ein ganz besonderer Leckerbissen.  Rohstoff ist frische Bioland-Milch aus dem Alpenvorland.\n\nFür die interessierten Kunden & Käseliebhaber gibt es Hintergrundinformationen und -geschichten rund um den Käse, die Landwirte und die Molkerei. Alles zusammengefasst in einem ÖMA Partnerporträt.\n\nIn der hoch über dem Bodensee gelegenen Käserei wird Handarbeit noch ganz groß geschrieben. Die 1886 – vom Urgroßvater – gegründete Familienkäserei Bantel hat auf Initiative der Ökologischen Molkereien Allgäu 1994 auf die ökologische Wirtschaftsweise umgestellt. Heute werden von Käsermeister Georg Bantel und seinen 15 Mitarbeitern wöchentlich 60.000 Liter ökologisch gewonnene Alpenmilch zu absoluten Premium-Produkten verarbeitet. Sein Bruder Walter kümmert sich ums Kaufmännische und Ernst, Bruder Nummer drei, widmet sich der Logistik. Im Besten Sinne also ein Familienbetrieb.\nDie Energie für die Käse-Produktion wird über eine eigene Photovoltaik- & Biomasseheizanlage bezogen, Energie eingespart wird durch eine Wärmerückgewinnungsanlage. Insgesamt liefern 12 ausgewählte Bio-Landwirte den kostbaren Rohstoff Milch und tragen mit ihrer Arbeit tagtäglich zum Erhalt und zur Pflege der Landschaft bei. Die Milch kommt aus Deutschland und Österreich und die Höfe der Lieferlandwirte liegen alle in der Region Vorarlberg im Umkreis von max. 15km um die Molkerei. Kurze Wege eben.', 'ÖMA Beer GmbH', 'ÖMA', 'Vorarlberg', 'f490f82c-8df5-4194-94f8-d45c9c7d904b', 'manager', '2021-10-26 08:08:40', 'System', '2023-09-07 03:52:07', 1776, 359, 1, NULL, 0, 2.04, NULL, 0, NULL, 0, 0, 'Camembert* 80% (KUHMILCH*, Speisesalz, Käsereikulturen, mikrobielles Lab), Semmelbrösel* 10% (WEIZENMEHL*, Hefe*, Speisesalz), BUTTERSCHMALZ* 9,5%, VOLLEIPULVER*, WEIZENMEHL* *aus kontrolliert ökologischer Erzeugung', '2022-06-06 10:03:05', 414.18, 'CHEESE', 'FRESH', 118, 11.8, 'VEGETARIAN', NULL, NULL),
(1695, 'Bio Grießpudding Vanille (Weiling)', '4008471507314', 0, 1.19, 1, 1, NULL, 0, NULL, 'Bio Grießpudding Vanille', 'Den besten Grießpudding kocht mit Sicherheit die Oma. Aber es geht auch einfacher. Söbbeke - Die Bio-Molkerei! hat jetzt vier Sorten köstlichen Grießpudding im Sortiment. So kann man den leckeren Grießpudding überall und immer genießen, als Nachtisch, als kleine Zwischenmahlzeit oder bei der Arbeit. Dieses Dessert zeichnet sich durch seine cremige Konsistenz aus und besticht mit viel frischer Milch, Hartweizengrieß und einem Schuß guter Sahne. Mit seinem 150 g Becher hat der Grießpudding eine ideale Größe. Es gibt ihn in den Sorten Traditionell, Vanille und mit Himbeeren. Bei der Sorte Himbeere wird der Grießpudding im Zweikammer-Becher angeboten. Hier können die Liebhaber des unverwechselbaren Fruchtgeschmacks ihre ganz persönliche Mischung selber herstellen, indem man ganz einfach die Ecke mit der Frucht umknickt und das köstliche Fruchtmus auf den Grießpudding gibt. Alle Sorten werden, wie alles bei Söbbeke, ohne Zusatz von Aromen oder weitere Zusätze hergestellt, das ist die Söbbeke-Qualität. Hier schmeckt man noch die reine Frucht und die gute Bio-Milch.', 'Molkerei Söbbeke GmbH', NULL, 'Gronau-Epe, Nordrhein-Westfalen', 'becf1d3e-175a-4076-a967-938fa79b111c', 'manager', '2021-10-26 09:04:30', 'System', '2023-10-16 10:03:48', 1777, 360, 1, NULL, 0, 0.78, 'Weiling', 1, 1, 0, 63, NULL, '2022-11-29 16:18:25', 388.075, 'DAIRY_PRODUCTS_EGGS', 'FRESH', 159.6, 9.5, 'VEGETARIAN', NULL, NULL),
