(1704, 'Dinkel Stollenkonfekt (Weiling)', '4250096908070', 0, 3.39, 1, 1, NULL, 0, NULL, 'Dinkel Stollenkonfekt', 'Die Vanillekipferl, das Spekulatius-Gebäck und auch der Dinkel-Stollen schmecken wie Kindheitserinnerungen. Sie sind nach traditionellen Rezepten und aus hochwertigen Zutaten gebacken. Durch das Feingespür unseres Bäckermeisters entsteht eine perfekte Harmonie der Zutaten. Für die Schokoladenliebhaber bietet unser Sortiment saftige und aromatische Printen. \n\nNicht nur der Duft unserer Weihnachtsspezialitäten, sondern auch der Geschmack entführen euch in das Gefühl der Weihnachtszeit.', 'Kiebitzhof', NULL, 'Gütersloh, Nordrhein-Westfalen', '363c8b1c-5fcf-49a7-9a55-7b26859d5066', 'manager', '2021-11-01 16:43:31', 'System', '2023-11-10 02:10:10', 1783, 2294, 1, NULL, 0, 3.2, 'Weiling', 2, 1, 0, 63, NULL, '2022-04-11 14:01:26', 675, 'SWEETS', 'SNACKS', 221, 18, 'PALMOILFREE', NULL, NULL),
