(1724, 'Repair Handcreme (Weiling)', '4021457645084', 0, 3.99, 1, 1, NULL, 0, NULL, 'Repair Handcreme', 'Erlebe das lavera Gefühl geschmeidig weicher Hände:\nUnsere schützende Formel mit Bio-Calendula und Bio-Sheabutter gibt deinen beanspruchten Händen sofort das Gefühl reichhaltiger, intensiver Pflege.\n\n- SOS Hilfe für beanspruchte Hände\n- Lindert sofort Spannungsgefühle\n- Langanhaltender Schutz\n- Für sehr trockene, strapazierte Haut\n- Vegan\n- Hergestellt in Deutschland\n- Ohne Mikroplastik\n- 100 % zertifizierte Naturkosmetik \n\nBio-Calendula ist als Heilpflanze bekannt und wirkt beruhigend auf die Haut.\nBio-Sheabutter wird auf Grund intensiv pflegender Eigenschaften in unseren Produkten für trockene Haut eingesetzt.\n\nUnser Versprechen:\n- Biologisch abbaubare Rezepturen ohne Mineralöle und ohne künstliche Duft-, Farb- und Konservierungsstoffe*\n- Zertifiziert nach dem strengen, unabhängigen NATRUE Naturkosmetikstandard. Verträglichkeit dermatologisch bestätigt\n- Klimaneutrale Produkte**, Kunststoff dieser Tube inkl. Verschluss aus 96 % recyceltem Material\n- Nach PETA-Kriterien zertifiziert\n- Exklusive Naturkompositionen aus der lavera-Forschung, mit dem Besten aus der Natur\n\nwww.lavera.de \n\n* gem. EU-Kosmetik VO\n** ClimatePartner.com/12310-1610-1001\n\nlavera. Natur, die du fühlst', 'Laverana GmbH & Co.KG', NULL, 'Deutschland (Wennigsen, Niedersachsen)', 'acfcbdea-4e3d-406a-873a-ba34516b7f89', 'manager', '2021-11-03 18:26:15', 'System', '2023-10-20 02:09:45', 1797, 1352, NULL, NULL, 0, 2.36, 'Weiling', 1, 1, 0, NULL, NULL, '2023-02-13 23:25:28', 336.663, 'BODY_CARE', 'DRUGSTORE', 87.58, 14.7, 'VEGAN;VEGETARIAN', NULL, NULL),
