(1750, 'Yogi Tea® Christmas Tea Bio', '4012824404229', 0, 3.29, 1, 1, NULL, 0, NULL, 'Yogi Tea® Christmas Tea Bio', 'Für eine zauberhafte Adventszeit.\n\nDie schönste Zeit des Jahres feiert YOGI TEA® mit einer ayurvedischen Teekomposition aus aromatischem Honeybush und weihnachtlichen Gewürzen wie Zimt und Sternanis. Um in dieser besonderen Zeit etwas zurückzugebenen, unterstützt YOGI TEA® seit vielen Jahren das Bildungsprogramm „Medadumbara Organic“ in Sri Lanka – einem Land, aus dem wir einige unserer Zutaten beziehen. Das Programm ermöglicht Kindern den Besuch einer Schule und verschafft ihnen so Aussicht auf eine bessere Zukunft.', 'YOGI TEA GmbH', 'YOGI TEA', 'ITALY', 'de73b9c2-7fa0-4064-8c42-d6657da047dd', 'manager', '2021-11-22 13:22:25', 'System', '2023-01-16 19:17:03', 1830, 1586, 0, NULL, 0, 2.09, NULL, 0, NULL, 0, 62, 'Rotbusch*, Zimt* (13%), Süßholz*, Koriander*, Honeybush* (6%), Orangenschalen*, Nelken*, Schwarzer Pfeffer*, Anis*, getrockneter Zitronensaft*, Sternanis* (3%), Kardamom*, geröstete Zichorienwurzel*, Limone*, Orangenöl*, Zimtöl* *aus kontrolliert ökologischer Erzeugung', '2022-06-23 05:06:38', 585, 'TEA', 'COFFEE_TEA_COCOA', 71, 12, 'VEGAN;VEGETARIAN', NULL, NULL),
