(1800, 'Janosch Waldbärentee', '4012346277806', 0, 3.49, 1, 1, NULL, 0, NULL, 'Janosch Waldbärentee', 'Beerig und süß – für kleine und große Bären. Dieser Bio-Früchtetee schmeckt kleinen Bären ganz groß. Köstlich beerig und mit süßer Vanille. Der Kleine Bär macht im Sommer gern Bowle draus, lehnt sich zurück und träumt von Panama.', 'Ulrich Walter GmbH', 'LEBENSBAUM', 'Diepholz, Niedersachsen', 'ff067842-0b66-440d-bd77-09c5ee6f359a', 'manager', '2021-11-29 14:44:53', 'System', '2023-01-16 19:17:58', 1877, 1732, 0, NULL, 0, 1.94, NULL, 2, 1, 0, 60, NULL, '2022-11-29 15:23:45', 485.76, 'TEA', 'COFFEE_TEA_COCOA', 64, 16, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(1801, '7 Zwerge Kindersaft Trinkpäckchen (Weiling)', '4015533022128', 1, 1.39, 1, 1, NULL, 0, NULL, '7 Zwerge Kindersaft Trinkpäckchen', 'Unser beliebter Klassiker vereint biologisch-dynamisch angebaute Früchte von Baum, Strauch und Feld zu einer wohlschmeckenden Direktsaft-Komposition. Mit ihrer unterschiedlichen Reifedauer, Erntezeitpunkten und Wuchsformen stehen sie beispielhaft für die Vielfalt der Natur. Das Ergebnis ist ein köstlicher Direktsaft für kleine und große Genießer, der natürlich ohne zugesetzten Zucker auskommt.', 'Voelkel GmbH', 'Voelkel', 'GERMANY', '4c8d5c7c-48d3-41e7-8b27-84a8454dc480', 'manager', '2021-11-29 14:45:42', 'System', '2024-01-17 02:10:23', 1876, 1733, 2, NULL, 0, 0.75, 'Weiling', 0, NULL, 0, 64, 'Apfelsaft** 41 %, Traubensaft** 35 %, Möhrensaft**¹ 11 %, Heidelbeersaft* 4,8%, \nErdbeermark** 3 %, Hagebuttenmark* 3 %, Birnensaft** 2 %, Sanddornmark* 0,2% *aus kontrolliert ökologischer Erzeugung **aus biodynamischer Erzeugung', '2023-01-30 15:23:09', 228, 'JUICE;LEMONADE', 'DRINKS', 220, 12, 'VEGAN;VEGETARIAN', NULL, NULL),
