(1829, 'HAPPY FRESHNESS Pflegedusche', '4021457629695', 1, 4.29, 1, 1, NULL, 0, NULL, 'HAPPY FRESHNESS Pflegedusche', 'Belebender Duft für einen beschwingten Start in den Tag\r\n\r\nErfrischen Sie sich mit der intensiven Duftkomposition und dem sanften Schaum des lavera Happy Freshness Duschgels. Die vegane Rezeptur mit wertvollen Inhaltsstoffen und milden Tensiden natürlichen Ursprungs reinigt die Haut sanft, ohne sie auszutrocknen. Die pH-hautneutrale Pflegeformel hinterlässt ein angenehmes Hautgefühl.  \r\n\r\nGREEN FRESHNESS COMPLEX\r\nDie lavera Naturkosmetik-Forschung hat eine milde Rezeptur entwickelt, die mit einer exklusiven Wirkstoffkomposition auf Basis von Limonen die Haut erfrischt.', 'Laverana GmbH & Co.KG', 'lavera', 'Hannover, Niedersachsen', '42898494-09eb-48f5-8967-52f9d559c2b7', 'manager', '2021-12-10 12:09:47', 'manager', '2021-12-10 12:23:15', 1910, 1774, NULL, NULL, 0, 2.23, NULL, 1, 1, 0, NULL, NULL, '2021-12-10 12:23:15', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL),
(1830, 'Kräuterzahncreme ayurveda (Weiling)', '4251191898006', 1, 5.35, 1, 1, NULL, 0, NULL, 'Kräuterzahncreme ayurveda', 'AUROMÈRE ® System Mundhygiene - natürlich, frisch und wirkungsvoll Dass kräftiges Zahnfleisch und regelmäßige Mundhygiene zusammen gehören, wussten alte Kulturen bereits vor Jahrhunderten. So wurden (und werden noch heute) die faserig gekauten Zweige des Neembaumes als natürliche Zahnbürste genutzt. Außer Neem hält die Natur aber noch weitere wirkungsvolle Helfer für uns bereit - für eine stabile Mundflora und kräftige Zähne. Viele Pflanzen verfügen über Antioxidantien, enthalten antimikrobielle und stärkende Substanzen. Über 30 verschiedene, sich in ihrer Wirkung optimal ergänzende Pflanzen verwenden wir für AUROMÈRE ® System Mundhygiene. Ayurvedische 24 Kräuter-Zahncreme: Die milde Familien-Pflege für kräftiges Zahnfleisch und Zähne Extrakte des Neembaumes, Nelkenöl und Süßholz wirken plaque- und kariesverursachenden Bakterien entgegen. Chinesische Dattel, Gelbholz, Rosenapfel und Baleria kräftigen und beruhigen das Zahnfleisch. Feine Putzkörper reinigen die Zähne sanft und entfernen schonend schädliche Zahnbeläge. Für den sehr angenehmen und einzigartigen Geschmack sorgen z. B. Thymian, Minze und Ceylon Zimt. AUROMÈRE ® Kräuter-Zahncreme ist sehr mild und kann auch von Kindern verwendet werden. Enthält keine unnötigen Füllstoffe wie Schäumer und ist daher sehr ergiebig und sparsam.', 'Apeiron Handels GmbH & Co KG', 'Apeiron', 'Wallenhorst, NI', NULL, 'manager', '2021-12-10 12:12:03', 'manager', '2023-02-27 13:50:57', 1911, NULL, NULL, NULL, 0, 2.99, 'Weiling', 2, 1, 0, NULL, 'Calciumcarbonat, Wasser, Glyzerin (pflanzlich), Sorbit, Süßholz, Silica, Niembaum, Zahnbürstenbaum, Granatapfel, Chinesische Dattel, Rosenapfel, Gewürznelke, Europäische Walnuss, Barleria, Mandel, Gelbholz, Galleiche, Gelbholzbaum, Nepalpfeffer, Sappanbaum, Krapp, Katechu Akazie, Sarsaparille, Ceylon Zimtbaum, Spanische Kirsche, Marokkokamille, Ägyptischer Kümmel, Geranie, Echter Thymian, Pfefferminze, Grüne Minze, Eukalyptus, Anis, Meeresalgen, Natriumbenzoat', '2023-02-27 13:50:57', 236.672, 'BODY_CARE', 'DRUGSTORE', NULL, 17.2, 'VEGAN;VEGETARIAN', NULL, NULL),
(1831, 'Rosenwasser Vital Spray & Tonic  (Weiling)', '4251191891007', 1, 9.69, 1, 1, NULL, 0, NULL, 'Rosenwasser Vital Spray & Tonic', 'Rosenwasser wird traditionell als tonisierende Pflege für Körper und Seele angewendet. Das zart duftende Spray kombiniert ideal pflegende Wirkung mit sinnlicher Erfrischung. Es vitalisiert und klärt den Teint, versorgt mit Feuchtigkeit und bereitet auch sensible Haut nach der Reinigung optimal auf die folgende Pflege vor. Ein belebendes und erfrischendes Spray für Gesicht und Dekolleté während der Reise, bei trockener Raumluft und an heißen Sommertagen.', 'Apeiron Handels GmbH & Co KG', 'Apeiron', 'Wallenhorst, NI', NULL, 'manager', '2021-12-10 12:13:06', 'manager', '2023-02-27 12:26:19', 1912, NULL, NULL, NULL, 0, 5.25, 'Weiling', 2, 1, 0, NULL, 'Aqua, Rosa damascena extract, Geraniol*, Citronellol* * from natural essential oils / Bestandteil natürlicher ätherischer Öle', '2023-05-26 10:18:54', 296.24, 'BODY_CARE', 'DRUGSTORE', NULL, 14, 'VEGAN;VEGETARIAN', NULL, NULL),
