(1865, 'Wheaty Veganer Festtagsbraten (Weiling)', '4032277006733', 0, 16.49, 1, 1, NULL, 0, NULL, 'Wheaty Veganer Festtagsbraten', 'Unsere Innovation zum Fest: Die ultimative Bratenalternative nicht nur für Vegetarier. Mit seiner faserigen Struktur kommt der Vesttagsbraten einem Rinderbraten zum Verwechseln nahe! Unglaublich locker und saftig, und dennoch mit Biss - genau so, wie ein Braten sein soll!', 'TOPAS GmbH', 'Wheaty', 'GERMANY', 'f86157d0-bccf-4e59-b720-b6d792d9ec40', 'manager', '2021-12-14 09:58:51', 'System', '2022-06-23 04:57:19', 1940, 1826, 0, NULL, 0, 10.15, 'Weiling', 0, NULL, 0, NULL, NULL, '2022-11-29 17:08:34', NULL, '3', NULL, NULL, NULL, NULL, NULL, NULL),
(1866, 'Spätburgunder Lößterrassen (Weiling)', '4037865001602', 1, 14.95, 1, 1, NULL, 0, NULL, 'Spätburgunder Lößterrassen', 'Der Wein zeigt sich komplex, strukturiert und nachhaltig. In der\nNase spürt man ein Aromenspiel dunkler Früchte, gepaart mit\nrauchigen Noten. Der Gaumen ist klar und direkt, mit reifer\nFrucht und eleganten Tannine; schöne Harmonie.\n', 'Stefan Sander', 'Sander – ökologische Weine', 'Rheinhessen', 'ee2046fd-4f12-4a2d-8b9e-0c9a3a65441e', 'manager', '2021-12-17 12:04:02', 'System', '2023-01-16 19:20:31', 1942, 1827, 3, NULL, 0, 8.1, 'Weiling', 0, NULL, 0, 69, 'enthält SULFITE **aus biodynamischer Erzeugung', '2022-06-23 05:09:24', 2376.3, 'WINE_CHAMPAGNE', 'DRINKS', 1250, 30, 'VEGAN;VEGETARIAN', NULL, NULL),
(1867, 'Familien Punsch mit Sternanis verfeinert (Weiling)', '4015533046285', 1, 3.99, 1, 1, NULL, 0, NULL, 'Familien Punsch mit Sternanis verfeinert', 'Punsch-Genuss für die ganze Familie\nDieser alkoholfreie Punsch aus knackigen Äpfeln, Holunderbeeren und Sauerkirschen, meisterlich verfeinert mit Sternanis und Zimt, ist ein winterlicher Genuss für Groß und Klein. Leicht erhitzt bringt er wohlige Wärme aus der Tasse direkt in unsere Herzen.', 'Voelkel GmbH', 'Voelkel', 'GERMANY', '13a18fa1-9a5c-4ac6-a100-2ffc2fd2ba3d', 'manager', '2021-12-17 12:07:46', 'System', '2024-01-17 02:08:18', 1943, 1828, 0, NULL, 0, 2.22, 'Weiling', 0, NULL, 0, 64, 'Apfelsaft* 70 %, Holunderbeersaft* 8%, Rhabarbersaft* 8%, , Sauerkirschsaft* 6%, Traubensüße*, Gewürzauszug (natürliches Mineralwasser, Gewürznelken*, Hagebuttenschalen*, Apfelstücke*, Hibiskusblüten*, Sternanis*, Zitronenschalen*, Orangenschalen*, Rooibos*, Zimt*, Korinthen*, Bourbon-Vanille*), Aroniasaft*. *aus kontrolliert ökologischer Erzeugung', '2022-11-29 15:20:12', 1697.55, 'JUICE', 'DRINKS', 1240.2, 27.2, 'VEGAN;VEGETARIAN', NULL, NULL),
(1868, 'Winter Apfel Punsch mir edler Schlehe verfeinert (Weiling)', '4015533046346', 1, 3.99, 1, 1, NULL, 0, NULL, 'Winter Apfel Punsch mir edler Schlehe verfeinert', 'Fruchtige Auszeit für eisige Tage\n\nDas Beste am Winter ist dieser herrlich fruchtige Punsch. Leicht erhitzt verströmt der Punsch aus knackigen Äpfeln und edler Schlehe sein unverkennbares Aroma. Schluck für Schluck spendet er wohlige Wärme und Behaglichkeit.', 'Voelkel GmbH', 'Voelkel', 'GERMANY', 'e86b55d0-b42f-4c17-8d32-111818ecaac8', 'manager', '2021-12-17 12:09:29', 'System', '2024-01-17 02:10:17', 1944, 1829, 0, NULL, 0, 2.22, 'Weiling', 0, NULL, 0, 64, 'Apfelsaft* 91%, Schlehensaft* 5%, konzentrierter\nApfelsaft*, Bourbon-Vanille-Auszug* (natürliches Mineralwasser, Bourbon-Vanille*), Heidelbeersaft* 1 %, Gewürznelkenauszug* (natürliches Mineralwasser, Gewürznelken*). *aus kontrolliert ökologischer Erzeugung', '2023-02-02 09:09:30', 1697.55, 'WINE_CHAMPAGNE;JUICE;OTHER_DRINKS', 'DRINKS', 1241.7, 27.2, 'VEGAN;VEGETARIAN', NULL, NULL),
