(1888, 'Tofu Natur 400g (Weiling)', '4012359110206', 0, 3.29, 1, 1, NULL, 0, NULL, 'Tofu Natur 400g', 'Der traditionelle Basis-Tofu ist reich an hochwertigem Pflanzeneiweiß und lässt sich vielfältig zubereiten. Ob würzig, scharf, süß oder sauer – unser Natur-Tofu lässt sich in jede beliebige Richtung verarbeiten. Auf Grund seiner festen Konsistenz eignet er sich hervorragend zum Anbraten. \n\nBevor Sie den Tofu verarbeiten, tupfen Sie ihn mit einem Küchenpapier ab oder lassen Sie ihn längere Zeit abtropfen. Wenn Sie nicht das ganze Tofustück verarbeiten, legen Sie den zurückbehaltenen Tofu in eine Schale und bedecken Sie ihn vollständig mit frischem Wasser. So hält sich Ihr Tofu im Kühlschrank noch drei bis vier Tage frisch. Wasser täglich wechseln.', 'Taifun-Tofu GmbH', 'Taifun', 'GERMANY', '25114c74-ac6e-4b1d-aa6d-0453ad956bf2', 'manager', '2021-12-28 11:13:47', 'System', '2023-11-17 02:11:08', 1961, 1835, 0, NULL, 0, 1.97, 'Weiling', 0, NULL, 0, 64, 'SOJABOHNEN* (55%), Wasser, Gerinnungsmittel: Magnesiumchlorid, Calciumsulfat. *aus kontrolliert ökologischer Erzeugung', '2023-08-11 11:59:40', 585, 'VEGAN_VEGETARIAN', 'FRESH', 428.7, 13, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
