(1902, 'Glücks-Sterne (Weiling)', '4026584133305', 0, 3.49, 1, 1, NULL, 0, NULL, 'Glücks-Sterne', 'Dank mildem Hokkaido-Kürbis und knackigen Sonnenblumenkernen sind die veganen Glücks Sterne die Stars bei Groß und Klein. Vollkornreis und Tofu machen die Sterne zu einem vollwertigen und saftigen Genuss.', 'organic veggie food GmbH', 'SOTO', 'GERMANY', '62714d7a-b0f8-4e8f-af76-2f8647924f76', 'manager', '2022-01-03 10:55:38', 'System', '2024-01-28 02:06:03', 1972, 1843, 0, NULL, 0, 2.14, 'Weiling', 0, NULL, 0, 61, 'Vollkornreis* (25%),  Hokkaido-Kürbis* (19%), Karotten* (19%), Tofu* (17%) (Wasser, SOJABOHNEN*, Festigungsmittel: Nigari), DINKELFLOCKENMEHL*, Sonnenblumenkerne*, HAFERFLOCKEN*, Buchweizenmehl*, Sonnenblumenöl*, Salz,  Gewürze* *aus kontrolliert ökologischer Erzeugung', '2022-07-12 14:22:54', 984.375, 'GOURMET_CONVENIENCE', 'FRESH', 261.5, 17.5, 'VEGAN;VEGETARIAN;PALMOILFREE', NULL, NULL),
(1903, 'Garnelen roh TK (Weiling)', '4250073450752', 0, 6.99, 1, 1, NULL, 0, NULL, 'Garnelen roh TK', 'Diese Bio-Garnelen stammen aus einem Naturland-Projekt in Ecuador, wo sie in zertifizierten Teichsystemen aufwachsen und zudem die umliegenden Mangrovenwälder schützen. Die Kleinbauernbetriebe garantieren ideale Wachstumsbedingungen für die ökologische Aufzucht der Garnelen.\nDie Ufer sind mit Pflanzen bewachsen und bieten natürlichen Lebensraum für viele Tierarten. Mangrovenwälder sind wichtige Brutgebiete für Fische und Krebstiere und zählen zu den produktivsten Ökosystemen der Erde. Bei dieser nachhaltigen Zuchtmethode wird die Natur nicht aktiv geschützt. \nFür die Ernährung der Garnelen wird ausschließlich nachhaltiges, zertifiziertes Biofutter verwendet; und durch geringe Besatzdichten wird das Auftreten von Krankheiten vermieden, sodass es nicht zum Einsatz von Antibiotika kommen muss. Umweltstandards und Sozialkriterien sind unumgängliche Aspekte für die erfolgreiche Zertifizierung nach Naturland-Richtlinien.\nSo sorgen die followfood Garnelenfarmer für ideale Wachstumsbedingungen für die Bio-Garnelen und faire Arbeitsbedingungen werden gewährleistet. Also kannst du jetzt mit gutem Gewissen leckere Meeresfrüchte genießen und dabei noch das Klima retten.\nWusstest du schon, dass unsere Garnelen entdarmt sind? Der sichtbare gräuliche Streifen am Bauch der Garnele ist nur ein Nervenstrang, der bedenkenlos mitgegessen werden kann.', 'followfood GmbH', 'followfood', 'NETHERLANDS', 'd670560a-805c-479e-91b4-887bcd813839', 'manager', '2022-01-03 11:05:14', 'System', '2023-11-15 02:09:12', 1971, 1844, 3, NULL, 0, 4.69, 'Weiling', 0, NULL, 0, 120, 'GARNELEN***\n ***aus anerkannt ökologischer Aquakultur', '2022-11-29 16:14:29', 998.79, 'MEAT_FISH_FROZEN', 'FROZEN', 192, 19.7, NULL, NULL, NULL),
(1904, 'b*Frischkäse Kräuter (Weiling)', '4035661163395', 0, 2.19, 1, 1, NULL, 0, NULL, 'b*Frischkäse Kräuter', 'Doppelrahmstufe, wärmebehandelt, mit vielfältiger Kräutermischung aus Knoblauch, Zwiebeln, Schnittlauch, Dill, Basilikum, Rosmarin, Majoran, Oregano, Petersilie und Thymian verfeinert. Herzhaft zu kombinieren - ideal als Brotaufstrich oder zum Dippen.', 'Weiling GmbH', 'bioladen', 'AUSTRIA', '8751fc18-e243-4c3c-af7e-f31c30a0518f', 'manager', '2022-01-03 11:07:12', 'System', '2023-10-14 02:11:24', 1978, 1845, 0, NULL, 0, 1.25, 'Weiling', 0, NULL, 0, 8, 'FRISCHKÄSE*, Knoblauch*, Zitronensaft*, Salz, Zwiebeln*, Schnittlauch*, Dill*, Basilikum*, Rosmarin*, Majoran*, Oregano*, Petersilie*, Thymian* *aus kontrolliert ökologischer Erzeugung', '2023-04-01 15:21:28', 397.296, 'CHEESE', 'FRESH', 190, 12.4, 'VEGETARIAN', NULL, NULL),
