(1907, 'Brokkoli TK Bio', '4026813000323', 0, 2.49, 1, 1, NULL, 0, NULL, 'Brokkoli TK Bio', 'Natural Cool versorgt Sie das ganze Jahr mit frischem Gemüse in bester Demeter- und Bio-Qualität. Das Gemüse wird im optimalen Reifegrad geerntet, direkt verarbeitet und einzeln tiefgefroren. Genießen Sie ein Maximum an Nährstoffen und Vitaminen.', 'Demeter-Felderzeugnisse GmbH', 'Natural Cool', 'NETHERLANDS', '655cec6c-06c6-470a-ab8b-3b36f678f27b', 'manager', '2022-01-07 09:41:49', 'System', '2023-01-16 19:22:18', 1980, 1846, 0, NULL, 0, 1.32, NULL, 0, NULL, 0, 120, 'Brokkoli* *aus kontrolliert ökologischer Erzeugung', '2022-05-24 10:15:20', 1244.16, 'VEGETABLES_HERBS_FROZEN', 'FROZEN', 320, 19.2, 'VEGAN;VEGETARIAN', NULL, NULL),
