(1910, 'Steinsalz 12 kg Eimer (Weiling)', '4260040174147', 0, 9.99, 1, 1, NULL, 0, NULL, 'Steinsalz 12 kg Eimer', 'Dieses naturbelassene Steinsalz ist vor mehr als 200 Mio. Jahren durch Austrocknung der Urmeere entstanden und lagert heute, geschützt vor Umwelteinflüssen, in 400 - 750 m Tiefe unter der Erde. Es ist vollständig naturbelassen und unbehandelt, also nicht chemisch gereinigt.\nDas Steinsalz von Natur Hurtig stammt aus einem der ältesten Salzstöcke Mitteldeutschlands. Es wird bergmännisch abgebaut, in traditionellen Mahlstühlen schonend gemahlen und sorgfältig ausgesiebt. Anerkannte Institute überwachen die Qualität. Salz ist ein essentieller Grundbaustein des Lebens und übernimmt im Organismus des Menschen lebenswichtige Aufgaben.\nDas feingemahlene Steinsalz empfiehlt sich zum Würzen von Speisen, ist jedoch auch für andere Salzanwendungen geeignet, bei denen es auf naturbelassene Qualität ankommt.', 'Natur Hurtig', 'Natur Hurtig', 'GERMANY', '7827fe5e-4cec-49ed-a808-720556cc737c', 'manager', '2022-01-11 09:31:07', 'System', '2023-01-16 19:22:23', 1983, 1984, NULL, NULL, 0, 10.8, 'Weiling', 0, NULL, 0, NULL, 'Speisesalz (Deutsches Steinsalz) Deutsches Steinsalz', '2022-11-10 00:02:03', 18954, 'SPICES_COOKING_HELP', 'PANTRY', 12400, 27, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE;PALMOILFREE;RAWFOOD', NULL, NULL),
(1911, 'Sasse Kakao mit Nuss Likör (Weiling)', '4015141047070', 1, 22.99, 1, 1, NULL, 0, NULL, 'Sasse Kakao mit Nuss Likör', 'Wenn es um die Zutaten für unsere Naturtalente geht, gibt es bei Sasse keine zwei Meinungen: Beste Bioqualität muss es sein. Frische, handverlesene und unbehandeltete Zutaten von unseren Partnern aus der Region. Das macht sich bemerkbar: In Qualität und Geschmack sind unsere vier Liköre eine Klasse für sich - als Aperitif, Dessertspezialität oder Digestif. Aber wir können Ihnen und Ihren Kunden viel erzählen. Überzeugen Sie sich selbst.', 'Feinbrennerei Sasse', 'Sasse', 'Schöppingen, NRW', NULL, 'manager', '2022-01-11 09:36:48', 'manager', '2023-02-27 14:36:28', 1984, NULL, 0, NULL, 0, 12.25, 'Weiling', 1, 1, 0, NULL, NULL, '2023-02-27 14:36:28', 875, 'SPIRITS', 'DRINKS', NULL, 35, 'VEGAN', NULL, NULL),
