(1917, 'Festes Pflegeshampoo Frische & Balance (Weiling)', '4021457647972', 1, 6.49, 1, 1, NULL, 0, NULL, 'Festes Pflegeshampoo Frische & Balance', 'Entdecke das lavera Geheimnis natürlich wirksamer Haarpflege in fester Form:\nDie festen Pflegeshampoos von lavera Naturkosmetik sorgen für leicht kämmbares und natürlich gepflegtes Haar. \nUnd das Beste: Zertifizierte Naturkosmetik, 0% Plastik, 0% Silikone.\n\nDas gute Gefühl von zertifizierter Naturkosmetik - ohne Kompromisse.\nUnsere sorgfältig ausbalancierte Naturkomposition mit Bio-Matcha und Bio-Quinoa reinigt schnell nachfettendes Haar besonders gründlich, schenkt ihm anhaltende Frische und hilft der Kopfhaut, ihr natürliches Gleichgewicht wiederzufinden.\nDie innovative Pflegeformel bietet ein sanftes Schaumerlebnis und eine leichte Kämmbarkeit - ganz ohne Silikone.\n\n3x ergiebiger als Flüssigshampoo - Unser festes Shampoo ist je nach Haarlänge und Anwendungsgewohnheit dreimal ergiebiger als Flüssigshampoo.\n\nUnser Versprechen:\n - Naturkosmetik: Zertifiziert und dermatologisch getestet\n - Rezepturen: Biologisch abbaubar, ohne Silikone, ohne festes Mikroplastik, ohne künstliche Farb- und Konservierungsstoffe*\n - Verpackung: Recycelbares Kartonmaterial aus 100% Recyclingfasern\n\"\"la vera\"\", die Wahre, engagiert sich für Klimaschutz und Tierschutz.\n\n*gem. EU-Kosmetik VO', 'Laverana GmbH & Co.KG', 'lavera', 'Hannover, Niedersachsen', '685e64cc-4e47-46da-9f95-211f584e90e3', 'manager', '2022-01-14 09:51:22', 'System', '2023-10-20 02:09:20', 2215, 1850, NULL, NULL, 0, 3.67, 'Weiling', 1, 1, 0, NULL, NULL, '2022-07-12 14:09:41', 108.108, 'BODY_CARE', 'DRUGSTORE', 57.8, 7.8, 'VEGAN;VEGETARIAN', NULL, NULL),
(1918, 'b* Tomatensauce Ricotta & Parmigiano Reggiano (Weiling)', '4035661163517', 0, 3.19, 1, 1, NULL, 0, NULL, 'b* Tomatensauce Ricotta & Parmigiano Reggiano', 'Die Tomaten für die bioladen*Produkte werden von Bio-Bauern in Italien unter besten klimatischen Bedingungen angebaut.\nAuf ihren ökologisch bewirtschafteten Feldern reifen die „pomodori“ zu sonnenverwöhnten aromatischen Früchten heran. Nach original italienischen Rezepten werden die Tomaten von einem Familienbetrieb in der Region Latium zu etwas ganz Besonderem verfeinert –\nunseren Tomatensaucen. (mit Ricotta & Parmesan)', 'Weiling GmbH', 'bioladen', 'ITALY', '2b87dcf4-53c8-4a26-918b-9ae1c0c971e7', 'manager', '2022-01-18 09:24:15', 'System', '2023-10-14 02:08:31', 1992, 1851, 0, NULL, 0, 1.9, 'Weiling', 0, NULL, 0, 103, 'Tomaten* (73%), RICOTTA*(7%), Zwiebeln*, PARMIGIANO REGGIANO DOP* (4%), Rohrohrzucker*, rote Paprika*, natives Olivenöl* extra, Meersalz, Maisstärke*, Zitronensaft*, Basilikum*, Knoblauch*, Oregano*. *aus kontrolliert ökologischer Erzeugung', '2023-06-23 11:05:15', 442.572, 'CONVENIENCE_PRESERVES', 'PANTRY', 525.2, 11.5, 'GLUTENFREE', NULL, NULL),
(1919, 'b* Schlagsahne (Weiling)', '4035626100281', 0, 1.79, 1, 1, NULL, 0, NULL, 'b* Schlagsahne', 'Die bioladen*Sahne wird ohne Stabilisatoren oder andere Zusätze hergestellt und rahmt daher natürlich auf. (Mindestens 30 % Fett, wärmebehandelt)', 'Weiling GmbH', 'bioladen', 'GERMANY', '616bd533-4d01-445e-9668-c688687f5ad1', 'manager', '2022-01-18 09:29:02', 'System', '2023-05-24 02:04:52', 1993, 1852, 0, NULL, 0, 1.06, 'Weiling', 0, NULL, 0, 63, NULL, '2023-08-11 11:56:27', 417.182, 'DAIRY_PRODUCTS_EGGS', 'FRESH', 209.32, 9.7, 'VEGETARIAN', NULL, NULL),
(1920, 'Joghurt Stracciatella 7,5% (Weiling)', '4008471507932', 0, 2.99, 1, 1, NULL, 0.15, NULL, 'Joghurt Stracciatella 7,5%', 'Alle unsere Produkte sind frei von zugesetzten Aromastoffen.', 'Molkerei Söbbeke GmbH', 'Söbbeke', 'Gronau-Epe, Nordrhein-Westfalen', '9b2fd8ee-3449-463b-82b6-63eb075e652d', 'manager', '2022-01-18 09:34:11', 'System', '2024-02-07 02:06:55', 1994, 1853, 1, NULL, 0, 1.98, 'Weiling', 1, 1, 0, 63, NULL, '2022-06-06 10:07:52', 903.125, 'DAIRY_PRODUCTS_EGGS', 'FRESH', 734, 12.5, 'VEGETARIAN;GLUTENFREE', NULL, NULL),
(1921, 'Muskatnuß gemahlen Tüte (Weiling)', '4012346157207', 0, 4.29, 1, 1, NULL, 0, NULL, 'Muskatnuß gemahlen Tüte', 'Muskatnuss hat einen warmen, würzig aromatischen Geschmack. Der anspruchsvolle Tropenbaum wächst nur an ausgewählten Orten, bringt dafür aber ein einzigartiges Gewürz hervor. Verwenden Sie es sparsam, um Suppen, Soßen und Aufläufe zu verfeinern.', 'Ulrich Walter GmbH', 'Lebensbaum', 'Diepholz, Niedersachsen', '033b46ac-8add-4fff-a0f8-def78089a649', 'manager', '2022-01-18 09:40:44', 'System', '2023-01-16 19:22:51', 1990, 1854, 0, NULL, 0, 2.53, 'Weiling', 2, 1, 0, 60, NULL, '2022-11-29 15:12:10', 269.5, 'SPICES_COOKING_HELP', 'PANTRY', 43, 14, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(1922, 'Zahncreme Complete Care Fluoridfrei (Weiling)', '4021457629091', 1, 3.49, 1, 1, NULL, 0, NULL, 'Zahncreme Complete Care Fluoridfrei', 'Die lavera Zahncreme Complete Care Fluoridfrei mit Bio-Echinacea und Calcium bietet 5-fachen Rundumschutz*. Die hochwirksame, fluoridfreie Rezeptur mit Calcium schützt die Zähne zuverlässig.\n\n5-facher Rundumschutz* - FLUORIDFREI:\n- entfernt schonend Zahnbelag\n- schützt vor Karies\n- schützt vor Zahnsteinbildung\n- schützt vor Zahnfleischproblemen\n- frischer Atem\n\nGREEN PREVENTION COMPLEX:  Die lavera Naturkosmetik-Forschung hat eine hochwirksame fluoridfreie Rezeptur entwickelt, die mit einer exklusiven Wirkstoffkomposition auf Basis von Calcium die Zähne schützt.\n\n* bei regelmäßigem Putzen', 'Laverana GmbH & Co.KG', 'lavera', 'Hannover', '5bb5af95-a8cf-465f-9f81-c25edc7776bb', 'manager', '2022-01-19 17:13:38', 'System', '2023-07-01 00:38:23', 1995, 1855, NULL, NULL, 0, 2.18, 'Weiling', 1, 1, 0, NULL, NULL, '2022-05-17 03:12:50', 280.5, 'BODY_CARE', 'DRUGSTORE', 110.51, 15, 'VEGAN;VEGETARIAN', NULL, NULL),
(1923, 'Kinder-Zahngel', '4001638081863', 1, 4.95, 1, 1, NULL, 0, NULL, 'Kinder-Zahngel', 'Das Weleda Kinder-Zahngel ist in Geschmack und Konsistenz der kindlichen Wahrnehmung angepasst und erleichtert so die tägliche Zahnpflege für Kinder und Eltern. Sie enthält keine Fluoride. Die milde Gesamtkomposition enthält keine Substanzen, die den Organismus belasten, wenn das Gel geschluckt wird. Die pflanzlichen Auszüge des Zahngels und der bewährte Kieselsäure-Putzkörper entfernen Zahnbelag und schützen so zuverlässig vor Karies. Anwendung Das Kinder-Zahngel wird auf die feuchte Zahnbürste gegeben. Das Gel legt sich beim Putzen zunächst um die Zähne, verteilt sich dann als feiner Schaum gleichmäßig im gesamten Mundraum und sollte anschließend gründlich ausgespült werden. Auch die Zahnbürste nach Gebrauch gut spülen.', 'Weleda AG', 'Weleda', 'GERMANY', '191a0f9a-9791-4e9c-a414-c8fc77904b78', 'manager', '2022-01-19 17:16:53', 'System', '2024-02-02 02:12:12', 1996, 1856, NULL, NULL, 0, 2.75, NULL, 0, NULL, 0, NULL, NULL, '2022-01-19 17:18:18', 197.34, 'BODY_CARE', 'DRUGSTORE', 78.6, 13, 'VEGAN;VEGETARIAN', NULL, NULL),
(1924, 'Ratanhia-Zahncreme (Weiling)', '4001638098083', 1, 4.29, 1, 1, NULL, 0, NULL, 'Ratanhia-Zahncreme', 'Die erfrischende Weleda Ratanhia-Zahncreme mit einem mineralischen Putzkörper aus Calciumcarbonat (Kreide) reinigt die Zähne sanft und gründlich. Regelmäßiges Putzen mit der Ratanhia-Zahncreme entfernt Zahnbelag gründlich und schützt so zuverlässig vor Karies. Die Wurzel der in den peruanischen Anden wild wachsenden Ratanhiapflanze ist reich an Gerbstoffen: Auszüge aus der Ratanhiawurzel straffen das Mundgewebe und helfen so, Zahnfleischbluten vorzubeugen. Die natürlichen ätherischen Öle von Pfefferminze und Krauseminze geben ein besonders frisches Mundgefühl und langanhaltend frischen Atem. Anwendungstipps Die Zähne zweimal täglich oder so oft wie vom Zahnarzt empfohlen gründlich putzen. Für Kinder ab 6 Jahren empfehlen wir eine erbsengroße Menge.', 'Weleda AG', 'Weleda', 'GERMANY', '7320ec8e-91ec-4545-bf2a-fb4c0538aca0', 'manager', '2022-01-19 17:19:36', 'System', '2024-02-02 02:12:28', 1997, 1857, NULL, NULL, 0, 3.32, 'Weiling', 0, NULL, 0, NULL, NULL, '2022-10-10 00:11:55', 269.382, 'BODY_CARE', 'DRUGSTORE', 125.9, 13.9, 'VEGAN;VEGETARIAN', NULL, NULL),
(1925, 'Sole-Zahncreme (Weiling)', '4001638098090', 1, 4.95, 1, 1, NULL, 0, NULL, 'Sole-Zahncreme', 'Die Weleda Sole-Zahncreme mit einem löslichen Putzkörper aus Natriumbicarbonat (Salz) beugt Karies durch die Neutralisation schädlicher Säuren vor und hemmt somit auch die Neubildung von Zahnstein. Sie enthält keine Fluoride. Der einzigartige Putzkörper aus Salzkristallen regt außerdem den Speichelfluss und damit die physiologische Selbstreinigung an. Der angenehm prickelnde, leicht salzige Geschmack der Sole-Zahncreme wird abgerundet durch anregendes Pfefferminzöl, das langanhaltende Frische schafft. Anwendung Geben Sie 2 cm der Weleda Sole-Zahncreme auf die trockene Zahnbürste und reinigen Sie die Zähne und das Zahnfleisch mit kleinen, kreisenden Bewegungen.', 'Weleda AG', 'Weleda', 'GERMANY', '7a786751-042b-4fa9-a771-92c9935840d1', 'manager', '2022-01-19 17:20:39', 'System', '2024-02-02 02:12:31', 1998, 1858, NULL, NULL, 0, 3.33, 'Weiling', 0, NULL, 0, NULL, NULL, '2022-01-19 17:22:10', 269.382, 'BODY_CARE', 'DRUGSTORE', 129.7, 13.9, 'VEGETARIAN', NULL, NULL),
(1926, 'Pflanzen-Zahngel (Weiling)', '4001638086554', 1, 4.29, 1, 1, NULL, 0, NULL, 'Pflanzen-Zahngel', 'Das milde Weleda Pflanzen-Zahngel mit einem Kieselsäureputzkörper reinigt die Zähne gründlich und schonend, ohne den Zahnschmelz anzugreifen. Ein Auszug aus Ratanhiawurzel strafft das Mundgewebe und hilft so, Zahnfleischbluten vorzubeugen. Die speziell auf reizempfindliches Zahnfleisch abgestimmten Heilpflanzenauszüge halten die Mundflora im natürlichen Gleichgewicht.', 'Weleda AG', 'Weleda', 'GERMANY', '702b2745-5533-4d89-95e5-049e5380d5a4', 'manager', '2022-01-19 17:23:26', 'System', '2024-02-02 02:12:37', 2000, 1859, NULL, NULL, 0, 3.32, 'Weiling', 0, NULL, 0, NULL, NULL, '2022-07-12 14:27:22', 269.382, 'BODY_CARE', 'DRUGSTORE', 119.1, 13.9, 'VEGAN;VEGETARIAN', NULL, NULL),
(1927, 'Calendula-Zahncreme (Weiling)', '4001638098014', 1, 4.99, 1, 1, NULL, 0, NULL, 'Calendula-Zahncreme', 'Die mentholfreie Weleda Calendula-Zahncreme ist konzipiert für Menschen, die auf Pfefferminzöl verzichten möchten - zum Beispiel während einer homöopathischen Behandlung. Mildes ätherisches Fenchelöl gibt, als Alternative zum klassischen Pfefferminzgeschmack, ein frisches Mundgefühl. Ein mineralischer Putzkörper aus Calciumcarbonat (Kreide) reinigt die Zähne sanft und gründlich. Durch regelmäßiges Putzen mit der Weleda Calendula-Zahncreme wird Zahnbelag zuverlässig entfernt und so Karies vorgebeugt. Ein Auszug aus beruhigender Calendula beugt Irritationen vor und hilft, den gesamten Mundraum gesund zu halten. Anwendungstipps Die Zähne zweimal täglich oder wie vom Zahnarzt empfohlen gründlich putzen. Für Kinder ab 6 Jahren empfehlen wir eine erbsengroße Menge.', 'Weleda AG', 'Weleda', 'GERMANY', 'de4891ee-5b7e-467d-9afe-c520a02658af', 'manager', '2022-01-19 17:24:23', 'System', '2024-02-02 02:12:44', 1999, 1860, NULL, NULL, 0, 3.32, 'Weiling', 0, NULL, 0, NULL, NULL, '2022-07-12 14:27:24', 269.382, 'BODY_CARE', 'DRUGSTORE', 125.6, 13.9, 'VEGAN;VEGETARIAN', NULL, NULL),
