(1935, 'Heimische Holunderbeere Saft Voelkel (Weiling)', '4015533047985', 1, 6.49, 1, 1, NULL, 0, NULL, 'Heimische Holunderbeere Saft Voelkel', 'In diesem Muttersaft mit 100 % Fruchtgehalt steckt das Beste aus biologisch angebauten, sonnenverwöhnten Holunderbeeren.', 'Voelkel GmbH', 'Voelkel', 'GERMANY', '34693fcf-9ae2-4004-8e2e-4de0ce6530d6', 'manager', '2022-01-25 10:05:54', 'System', '2024-01-17 02:08:42', 2008, 1866, 0, NULL, 0, 3.51, 'Weiling', 0, NULL, 0, 64, 'Holunderbeersaft*. *aus kontrolliert ökologischer Erzeugung', '2023-03-16 22:56:25', 1697.55, 'JUICE', 'DRINKS', 1234.1, 27.2, 'VEGAN;VEGETARIAN', NULL, NULL),
(1936, 'Mandel Drink 0% Zucker Allos', '4016249143558', 1, 3.49, 1, 1, NULL, 0, NULL, 'Mandel Drink 0% Zucker Allos', 'Mandeln. Schluss. Aus. Fertig. Genug. Ja, die kleinen Dinger sind so lecker, da muss man eigentlich gar nichts hinzufügen. (Schon gar kein Zucker.) Noch dazu, wo Mandeln so beliebt sind. Aber wir wollten diese Stelle auf der Verpackung auch nicht leer lassen – sonst wären die Mandeln am Ende noch beleidigt und du hättest diesen netten Text nicht lesen können.', 'Allos Hof-Manufaktur GmbH', 'Allos', 'ITALY', '8d786654-e4c0-4170-97b6-175a1b6784a5', 'manager', '2022-01-25 10:19:07', 'System', '2023-10-13 02:32:03', 2009, 1867, 0, NULL, 0, 2.04, NULL, 0, NULL, 0, 103, 'Wasser, MANDELN* (5%), Meersalz. *aus ökologischem Landbau.', '2022-11-29 16:38:06', 1078.27, 'PRESERVED_MILK_DRINKS', 'FRESH;PANTRY', 1033, 20.8, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(1937, 'Persika - Freilandgurke (Saatgut) (Weiling)', '4260012641578', 0, 3.2, 1, 1, NULL, 0, NULL, 'Persika - Freilandgurke (Saatgut)', 'Ertragreiche Vespergurke mit glattschaligen Früchten, die bis zu 20 cm lang werden. Geeignet für den Anbau im Freiland oder im Gewächshaus. Die Jungpflanzen sollten bei der Pflanzung noch klein sein und nach dem Setzen muss die Pflanze zügig weiterwachsen können. Gurken sind sehr wärmebedürftig und wachsen erst ab Temperaturen von über 12°C.\n\"TIPP\": Auf eine warme Anzucht achten! Gurken keimen am schnellsten bei konstant 25 - 28°C. Sie sollten innerhalb einer Woche keimen.', 'Bingenheimer Saatgut AG', 'Bingenheimer Saatgut', 'GERMANY', '9655ce9b-b215-4399-8684-74ee307bb592', 'manager', '2022-01-25 10:22:43', 'System', '2023-12-11 02:11:38', 2025, 1868, 2, NULL, 0, 2.01, 'Weiling', 0, NULL, 0, NULL, NULL, '2023-03-02 13:59:41', 18.696, 'SEEDS', 'DRUGSTORE', 3.01, 11.4, 'VEGETARIAN', NULL, NULL),
(1939, 'Verte à coeur plein - Feldsalat (Saatgut) (Weiling)', '4260012641110', 0, 2.8, 1, 1, NULL, 0, NULL, 'Verte à coeur plein - Feldsalat (Saatgut)', 'Dunkelgrüne, mittelgroße Blätter, gesund und widerstandsfähig. Für den Winteranbau geeignet. Wenn Feldsalat im heißen und trockenen August ausgesät wird kann es zu erheblichen Auflaufproblemen kommen. Hier helfen eine Beschattung mit einem Vlies und das Bewässern des Bodens vor der Aussaat. \n\"TIPP\": Feldsalat braucht wenig Stickstoff und sollte keinesfalls nach Hülsenfrüchten angebaut werden.', 'Bingenheimer Saatgut AG', 'Bingenheimer Saatgut', 'GERMANY', '7c698a03-0fca-49bc-a239-1a7ed9c4fef2', 'manager', '2022-01-25 10:30:25', 'System', '2023-12-11 02:11:27', 2030, 1870, 2, NULL, 0, 1.75, 'Weiling', 0, NULL, 0, NULL, NULL, '2023-03-02 13:59:39', 46.74, 'SEEDS', 'DRUGSTORE', 6.57, 11.4, 'VEGETARIAN', NULL, NULL),
(1940, 'Fritz - Paprika (Saatgut) (Weiling)', '4260012644944', 0, 3.2, 1, 1, NULL, 0, NULL, 'Fritz - Paprika (Saatgut)', 'eckerer, süßer Snack-Paprika, der besonders für den Freilandanbau und die Kultivierung im Kübel oder Hochbeet geeignet ist. Die dickwandigen Mini-Paprikas wechseln ihre Farbe während der Reifung von grün nach rot. Paprika müssen frühzeitig angezogen werden und sind sehr wärmebedürftig. \n\"TIPP\": Für den Anbau im Pflanzgefäß mindestens einen 10 l Topf wählen. In großen Pflanzgefäßen werden die Pflanzen üppiger und setzen mehr Früchte an.', 'Bingenheimer Saatgut AG', 'Bingenheimer Saatgut', 'GERMANY', '708cef37-1ce6-46f0-92ad-952afb0f8388', 'manager', '2022-01-25 10:31:31', 'System', '2023-12-11 02:11:10', 2017, 1871, 2, NULL, 0, 2.01, 'Weiling', 0, NULL, 0, NULL, NULL, '2023-03-02 14:00:45', 18.696, 'SEEDS', 'DRUGSTORE', 2.6, 11.4, 'VEGETARIAN', NULL, NULL),
(1941, 'Einfache Kresse (Saatgut) (Weiling)', '4260012641196', 0, 2.8, 1, 1, NULL, 0, NULL, 'Einfache Kresse (Saatgut)', 'Raschwachsendes, pikant-würziges Kraut. Für die Aussaat in Schalen bestens geeignet. Kresse ist ein Lichtkeimer, daher die Saat nicht abdecken, sondern nur andrücken und feucht halten. Bereits nach 8 - 10 Tagen können Sie ernten und damit Ihrem Salat die richtige Würze geben. Von März bis September kann Kresse auch breitwürfig ins Freiland gesät werden. Eine Düngung ist nicht erforderlich.\n\"TIPP\": Besonders geschätzt wird Kresse als Brotbelag oder im Kräuterquark, Sie können aber auch Soßen und Suppen damit verfeinern.', 'Bingenheimer Saatgut AG', 'Bingenheimer Saatgut', 'GERMANY', 'daec686a-a798-4c53-bae2-6dbf8fe899db', 'manager', '2022-01-25 10:32:19', 'System', '2023-11-09 02:11:24', 2014, 1872, 2, NULL, 0, 1.75, 'Weiling', 0, NULL, 0, NULL, NULL, '2023-03-02 14:00:09', 132.02, 'SEEDS', 'DRUGSTORE', 31.33, 16.4, 'VEGETARIAN', NULL, NULL),
(1942, 'Sora - Radies (Saatgut) (Weiling)', '4260012641288', 0, 2.9, 1, 1, NULL, 0, NULL, 'Sora - Radies (Saatgut)', 'Festes, karminrotes Radies mit schöner runder Form, dass für die gesamte Freilandsaison geeignet ist. Sora bleibt lange fest und zart, selbst wenn es größer wird. Radieschen ist eine anspruchslose Kultur, die in beinahe jedem Boden gedeiht. Eine gleichmäßige Wasserversorgung ist wichtig, sonst gehen die Radieschen vorzeitig in Blüte und werden pelzig oder zu scharf.\n\"TIPP\": Die Blätter werden gerne von Erdflöhen besucht. Abhilfe: Anbau unter Vlies oder durch regelmäßiges Hacken für eine feinkrümlige Bodenoberfläche sorgen.', 'Bingenheimer Saatgut AG', 'Bingenheimer Saatgut', 'GERMANY', '7937657b-f382-4cc2-8453-9ac3af080e75', 'manager', '2022-01-25 10:33:06', 'System', '2023-12-11 02:11:21', 2028, 1873, 2, NULL, 0, 1.75, 'Weiling', 0, NULL, 0, NULL, NULL, '2023-05-12 11:22:35', 46.74, 'SEEDS', 'DRUGSTORE', 9.61, 11.4, 'VEGETARIAN', NULL, NULL);
INSERT INTO `product` (`id`, `identifier`, `barcode`, `taxes`, `price_per_unit`, `price_unit`, `stocktype`, `next_delivery`, `deposit`, `supplier_product_identifier`, `name`, `description`, `producer`, `brand`, `origin`, `data_nature_id`, `created_by`, `created_date`, `last_modified_by`, `last_modified_date`, `web_product_id`, `product_details_id`, `organic_certification`, `fairtrade_certification`, `crate`, `supplier_price`, `supplier`, `distance`, `regional_type`, `barcode_type`, `organic_inspection`, `ingredients`, `modified_price_label`, `volume`, `categories`, `category_groups`, `weight`, `length`, `tags`, `nutritional_info`, `filling_quantity`) VALUES
(1943, 'Verdil - Spinat, zart-geschmackvoll (Saatgut) (Weiling)', '4260012641820', 0, 3.2, 1, 1, NULL, 0, NULL, 'Verdil - Spinat, zart-geschmackvoll (Saatgut)', 'Klassischer Herbst- und Überwinterungsspinat. Verdil wächst sehr zügig mit großen kräftigen Blättern und schöner Rosettenbildung. Bei Spinat ist ein feuchter, lockerer Boden wichtig, sonst keimen die Samen nicht. Spinat gedeiht in voller Sonne und im Halbschatten. Er leistet auch als Gründüngung gute Dienste. Verdil ist besonders aromatisch und deshalb auch gut für Rohkost geeignet, zum Beispiel für die Zubereitung als Spinatsalat.\n\"TIPP\": Späte Aussaaten ab September überwintern bis zur Ernte im Frühjahr. Die Pflanzen überwintern mit 2 - 4 Laubblättern am besten.', 'Bingenheimer Saatgut AG', 'Bingenheimer Saatgut', 'GERMANY', '64a23c91-f4cb-4cf4-9223-38f31129dc2d', 'manager', '2022-01-25 10:33:53', 'System', '2023-11-09 02:10:08', 2029, 1874, 2, NULL, 0, 2.01, 'Weiling', 0, NULL, 0, NULL, NULL, '2023-03-02 14:01:00', 132.02, 'SEEDS', 'DRUGSTORE', 31.33, 16.4, 'VEGETARIAN', NULL, NULL),
(1944, 'Zuckertraube - Cocktailtomate (Saatgut) (Weiling)', '4260012641370', 0, 3.2, 1, 1, NULL, 0, NULL, 'Zuckertraube - Cocktailtomate (Saatgut)', 'Reich tragende, Cocktailtomatensorte mit hohem Wuchs. Die langen Trauben bilden viele süße, sehr aromatische, leuchtend rote Früchte aus. Tomaten nicht zu früh aussäen. Für den Hausgarten reicht Ende März/Anfang April. Die Keimtemperatur sollte ca. 24°C betragen. Bester Schutz gegen Kraut- und Braunfäule ist ein Dach über den Pflanzen. Tomaten freuen sich über eine Mulchschicht auf dem Boden. \n\"TIPP\": Beim Pflanzen ins Beet den Wurzelballen tief setzen, denn am Hauptstamm bilden sich dann Nebenwurzeln.', 'Bingenheimer Saatgut AG', 'Bingenheimer Saatgut', 'GERMANY', 'f5a47e66-ae9b-48f4-9cc0-537077c4f82b', 'manager', '2022-01-25 10:34:43', 'System', '2023-12-11 02:12:30', 2031, 1875, 2, NULL, 0, 2.01, 'Weiling', 0, NULL, 0, NULL, NULL, '2023-03-02 13:59:17', 18.696, 'SEEDS', 'DRUGSTORE', 2.52, 11.4, 'VEGETARIAN', NULL, NULL),
(1945, 'Zucchini Serafina (Saatgut) (Weiling)', '4260012643695', 0, 3.2, 1, 1, NULL, 0, NULL, 'Zucchini Serafina (Saatgut)', 'Die schön geformten, zylindrischen Früchte sind glänzend dunkelgrün marmoriert und von ausgezeichnetem, aromatischem Geschmack. Zucchini hat einen hohen Nährstoff- und Wasserbedarf. Für guten Fruchtansatz mindestens zwei Pflanzen setzen und die Früchte im noch jungen Stadium ernten. \nTIPP: Zuerst bildet die Pflanze ausschließlich männliche Blüten, die unbedingt an der Pflanze bleiben müssen. Erst wenn die Temperaturen passen und die Pflanze stark genug ist, bilden sich die weibliche Blüten, erkennbar am Fruchtknoten.', 'Bingenheimer Saatgut AG', 'Bingenheimer Saatgut', 'GERMANY', 'f70718d3-a94a-43e2-91a3-55d3ed109c7a', 'manager', '2022-01-25 10:35:24', 'System', '2023-12-11 02:12:36', 2033, 1876, 2, NULL, 0, 2.01, 'Weiling', 0, NULL, 0, NULL, NULL, '2023-03-02 14:01:06', 37.392, 'SEEDS', 'DRUGSTORE', 4.56, 11.4, 'VEGETARIAN', NULL, NULL),
(1946, 'Schmitt Schnittlauch mittelgr. (Saatgut) (Weiling)', '4260012641448', 0, 2.8, 1, 1, NULL, 0, NULL, 'Schmitt Schnittlauch mittelgr. (Saatgut)', 'Der mehrjährige Schnittlauch ist eher anspruchslos, gedeiht aber auf humosen Gartenböden mit einer guten Wasserversorgung besonders gut. Er lässt sich auch im Winter beernten, dafür kräftige Wurzelballen im Spätherbst aus dem Garten in Töpfe pflanzen und auf die Fensterbank stellen. \n\"TIPP\":Blüht in rosarot-lila Scheindolden, die hübsch in frischen und trockenen Sträußen aussehen aber auch essbar sind. Schnittlauch-Saatgut besitzt nur im ersten Jahr eine hohe Keimfähigkeit, deshalb nicht auf Vorrat kaufen.', 'Bingenheimer Saatgut AG', 'Bingenheimer Saatgut', 'GERMANY', '3d3b3fa4-d4f6-4620-9f5a-beec40713c1b', 'manager', '2022-01-25 10:36:17', 'System', '2023-12-11 02:10:33', 2034, 1877, 2, NULL, 0, 1.75, 'Weiling', 0, NULL, 0, NULL, NULL, '2023-03-02 14:00:40', 28.044, 'SEEDS', 'DRUGSTORE', 4.56, 11.4, 'VEGETARIAN', NULL, NULL),
(1947, 'Calendula - Blumen (Saatgut) (Weiling)', '4260012641011', 0, 2.8, 1, 1, NULL, 0, NULL, 'Calendula - Blumen (Saatgut)', 'Beliebte Mischung aus einfachen, ungefüllten Blüten in gelben und orangen Farbtönen. Unkomplizierte, anspruchslose und reichblühende Heil- und Zierpflanzen. Nach dem ersten Flor sollten sie zurückgeschnitten werden, dann blühen sie bis weit in den Herbst hinein.\n\"TIPP\": Die essbaren Blüten der Ringelblumen lassen sich ganz einfach im Salat zubereiten. Dabei sind sie nicht nur Dekoration, sondern geben auch einen ganz besonderen Geschmack.', 'Bingenheimer Saatgut AG', 'Bingenheimer Saatgut', 'GERMANY', '75287d21-511c-4e03-96c0-9f94bc74f7f7', 'manager', '2022-01-25 10:36:59', 'System', '2023-12-11 02:11:16', 2011, 1878, 2, NULL, 0, 1.75, 'Weiling', 0, NULL, 0, NULL, NULL, '2023-03-02 13:59:05', 56.088, 'SEEDS', 'DRUGSTORE', 3.78, 11.4, 'VEGETARIAN', NULL, NULL),
(1948, 'Cosmea - Blumen (Saatgut) (Weiling)', '4260012641035', 0, 2.8, 1, 1, NULL, 0, NULL, 'Cosmea - Blumen (Saatgut)', 'Alte Bauerngartenpflanze und beliebte Schnittblume für feine Sommerblumensträuße. Aus feingefiederten, starkwüchsigen und verzweigten Pflanzen treiben große violette, rosa und weiße Blüten aus. Das Ausschneiden verblühter Pflanzenteile erhöht die Blühwilligkeit beträchtlich.\n\"TIPP\": Nicht zu stark düngen, sonst wird die Pflanze zu groß, neigt zum Umfallen und blüht erst sehr spät.', 'Bingenheimer Saatgut AG', 'Bingenheimer Saatgut', 'GERMANY', '913d21a8-7889-4acb-baef-261629af50dd', 'manager', '2022-01-25 10:37:45', 'System', '2023-12-11 02:11:32', 2012, 1879, 2, NULL, 0, 1.75, 'Weiling', 0, NULL, 0, NULL, NULL, '2023-03-02 13:59:26', 18.696, 'SEEDS', 'DRUGSTORE', 3.01, 11.4, 'VEGETARIAN', NULL, NULL),
(1949, 'Sonnenblume La Torre (Saatgut) (Weiling)', '4260012641059', 0, 2.8, 1, 1, NULL, 0, NULL, 'Sonnenblume La Torre (Saatgut)', 'La Torre wächst verzweigt und mehrtriebig bis zu 2 Meter hoch. Die Blüten sind eher klein, Durchmesser etwa 15 cm, in hellgelben, gelben und roten Farbtönen. Sonnenblumen brauchen einen nahrhaften Boden mit ausreichend Feuchtigkeit und einen vollsonnigen Platz im Garten.\n\"TIPP\": Die Sonnenblume \'La Torre\' ist eine Solitärpflanze und wirkt besonders gut in der Einzelstellung. Sie ist ein toller Blickfang, da sie durch ihre Größe und Statur besonders hervortritt.', 'Bingenheimer Saatgut AG', 'Bingenheimer Saatgut', 'GERMANY', 'a29d5d50-3b59-4e4b-917e-f63a67e229aa', 'manager', '2022-01-25 10:38:31', 'System', '2023-12-11 02:11:43', 2027, 1880, 2, NULL, 0, 1.75, 'Weiling', 0, NULL, 0, NULL, NULL, '2023-03-02 14:00:57', 46.74, 'SEEDS', 'DRUGSTORE', 5.06, 11.4, 'VEGETARIAN', NULL, NULL),
(1950, 'Kapuzinerkresse - Blumen (Saatgut) (Weiling)', '4260012641547', 0, 3.2, 1, 1, NULL, 0, NULL, 'Kapuzinerkresse - Blumen (Saatgut)', 'Rankende Mischung mit ungefüllten Blüten in schönem Farbenspiel mit leuchtenden Gelb-, Orange- und Rottönen. Anspruchslos an Boden und Standort wächst sie sogar in Nordlagen. Blätter und Blüten sind essbar, sie haben einen senfkresseartigen Geschmack. Bessere Keimergebnisse erzielt man durch Vorkühlen der feuchten Samen: 5 Tage bei ca. 5°C\nTIPP: Nicht zu stark düngen, da sonst vor allem Blätter gebildet werden.', 'Bingenheimer Saatgut AG', 'Bingenheimer Saatgut', 'GERMANY', '6bdc1b9f-666b-4ac5-8ac5-3f5f8b474d34', 'manager', '2022-01-25 10:39:15', 'System', '2023-12-11 02:10:54', 2019, 1881, 2, NULL, 0, 2.01, 'Weiling', 0, NULL, 0, NULL, NULL, '2023-03-02 13:59:56', 74.784, 'SEEDS', 'DRUGSTORE', 6.05, 11.4, 'VEGETARIAN', NULL, NULL),
(1951, 'Mischung Bienenweide (Saatgut) (Weiling)', '4260012642384', 0, 2.8, 1, 1, NULL, 0, NULL, 'Mischung Bienenweide (Saatgut)', 'Komposition aus einjährigen Kräutern, Duft- und Blütenpflanzen. Dient vielen Insektenarten als Nahrungsgrundlage. Ideal für kleine Freiflächen und Blüteninseln im Garten, für sonnige bis halbschattige Standorte. In der Mischung enthalten sind Buchweizen, Kornblume, Ringelblume, Borretsch, Dill und Phazelie. Verteilen Sie den Inhalt der Tüte dünn und gleichmäßig auf ca. 4 m², leicht mit Erde bedecken und bis zur Keimung feucht halten.\n\"TIPP\": Alle Blumen dieser Mischnung säen sich gerne wieder von selbst aus. ', 'Bingenheimer Saatgut AG', 'Bingenheimer Saatgut', 'GERMANY', 'd24c620c-58e6-4932-b075-3c702e7d4bc1', 'manager', '2022-01-25 10:40:05', 'System', '2023-12-11 02:11:58', 2023, 1882, 0, NULL, 0, 1.75, 'Weiling', 0, NULL, 0, NULL, NULL, '2023-03-02 13:58:38', 56.088, 'SEEDS', 'DRUGSTORE', 5.54, 11.4, 'VEGETARIAN', NULL, NULL),
(1952, 'Lucinde - Kopfsalat (Saatgut) (Weiling)', '4260012644227', 0, 3.2, 1, 1, NULL, 0, NULL, 'Lucinde - Kopfsalat (Saatgut)', 'Lucinde ist ein mildaromatischer Kopfsalat mit mittelschweren, festen Köpfen und einer frisch-hellgrünen Farbe. Er kann im Freiland über die gesamte Gartensaison angebaut werden. Kopfsalat ist ein Mittelzehrer und kommt in einer lebendigen Gartenerde ohne zusäztliche Düngung aus.\n\"TIPP\": Salat ist ein Lichtkeimer-daher nur dünn mit Erde absieben, und benötigt keine hohen Keimtemperaturen. Bei Temperaturen über 22°C  ist es von Vorteil, die Aussaatschalen einen Tag ins Kühle zu stellen, dann keimt er zuverlässiger. Bei Aussaat ins Freiland abends säen und mit einem Vlies beschatten.', 'Bingenheimer Saatgut AG', 'Bingenheimer Saatgut', 'GERMANY', 'c99f677e-a81d-4976-b215-f02af56a29d1', 'manager', '2022-01-25 10:40:54', 'System', '2023-12-11 02:11:53', 2022, 1883, 2, NULL, 0, 2.01, 'Weiling', 0, NULL, 0, NULL, NULL, '2023-03-02 13:59:59', 28.044, 'SEEDS', 'DRUGSTORE', 2.68, 11.4, 'VEGETARIAN', NULL, NULL),
(1953, 'Einfache Schnitt 3  - Glatte Petersilie  (Saatgut) (Weiling)', '4260012643084', 0, 1.9, 1, 1, NULL, 0, NULL, 'Einfache Schnitt 3  - Glatte Petersilie  (Saatgut)', 'Petersiliensaatgut braucht bis zu 3 Wochen zur Keimung. In dieser Zeit ist eine gute Wasserversorgung wichtig, der Boden darf aber auch nicht verschlämmen. Für die Aussaat jedes Jahr einen neuen Standort wählen. Petersilie ist zweijährig, das heißt die Pflanzen überwintern und können noch bis April/Mai geerntet werden, bevor sie anfangen zu blühen.\n\"TIPP\": Petersilie gedeiht auch gut im Halbschatten.', 'Bingenheimer Saatgut AG', 'Bingenheimer Saatgut', 'GERMANY', '6018f647-1dda-4b24-8e67-f6596f9ee1f5', 'manager', '2022-01-25 10:41:37', 'System', '2023-12-14 02:10:50', 2015, 1884, 0, NULL, 0, 1.19, 'Weiling', 0, NULL, 0, NULL, NULL, '2023-03-02 13:59:50', 28.044, 'SEEDS', 'DRUGSTORE', 3.72, 11.4, 'VEGETARIAN', NULL, NULL),
(1954, 'Essbare Blüten - Blumenmischung (Saatgut) (Weiling)', '4260012642360', 0, 3.2, 1, 1, NULL, 0, NULL, 'Essbare Blüten - Blumenmischung (Saatgut)', 'Bunte, einjährige Mischung aus Ringelblume, Borretsch, Kornblume und Speisechrysantheme Die Blüten sind essbar und auch für Insekten attraktiv. Der Anbau in Pflanzgefäßen auf Balkon und Terrasse ist problemlos möglich. Die regelmäßige Ernte fördert die Bildung weiterer Blüten. \n\"TIPP\": Auf Salaten sind sie nicht nur dekorativ, sondern verleihen auch einen ganz besonderen Geschmack. Ein optisches Highlight für jedes Getränk sind Blüten-Eiswürfel.', 'Bingenheimer Saatgut AG', 'Bingenheimer Saatgut', 'GERMANY', 'e0d0c7cd-7899-42bd-a3a6-35f404c6d7aa', 'manager', '2022-01-25 10:42:21', 'System', '2023-11-29 02:12:08', 2016, 1885, 2, NULL, 0, 2.01, 'Weiling', 0, NULL, 0, NULL, NULL, '2023-03-02 13:59:35', 94.3, 'SEEDS', 'DRUGSTORE', 8.9, 16.4, 'VEGETARIAN', NULL, NULL),
(1956, 'Dorenia - Tomate (Saatgut) (Weiling)', '4260012643794', 0, 3.2, 1, 1, NULL, 0, NULL, 'Dorenia - Tomate (Saatgut)', 'Diese Freiland Tomate  zeichnet sich durch ihr besondere Robustheit gegen Braunfäule aus. Für das Gewächshaus ist sie aufgrund ihrer starken Wüchsigkeit weniger geeignet. Tomaten nicht zu früh aussäen. Für den Hausgarten reicht Ende März/Anfang April. Die Keimtemperatur sollte ca. 24°C betragen. Tomaten freuen sich über eine Mulchschicht auf dem Boden. \nTIPP: Beim Pflanzen ins Beet den Wurzelballen tief setzen, denn am Hauptstamm bilden sich dann Nebenwurzeln.', 'Bingenheimer Saatgut AG', 'Bingenheimer Saatgut', 'GERMANY', '6c566a30-5d2c-4f3e-8e93-628448956cb6', 'manager', '2022-01-25 10:43:02', 'System', '2023-12-11 02:10:59', 2013, 1887, 2, NULL, 0, 2.01, 'Weiling', 0, NULL, 0, NULL, NULL, '2023-03-02 14:01:02', 18.696, 'SEEDS', 'DRUGSTORE', 2.55, 11.4, 'VEGETARIAN', NULL, NULL),
(1957, 'Basilikum großblättrig - Kräuter (Saatgut) (Weiling)', '4260012643275', 0, 1.9, 1, 1, NULL, 0, NULL, 'Basilikum großblättrig - Kräuter (Saatgut)', 'Typ Genoveser. Große, dunkelgrüne, gewölbte Blätter mit ausgeprägt starkem Aroma und kräftigem Wuchs. Basilikum ist wärmebedürftig, liebt volle Sonne und einen windgeschützten Platz, auch für Balkonkästen und Töpfe. Nicht übermäßig gießen aber auch nie austrocknen lassen. Aussaat nur dünn mit Erde bedecken, bis zur Keimung feucht halten.\n\"TIPP\":  Bei der Ernte nicht einzelne Blätter, sondern Triebspitzen schneiden. Die Pflanze verzweigt sich dann stärker und bildet mehr Blattmasse. Gute Basis für Pesto Genovese.', 'Bingenheimer Saatgut AG', 'Bingenheimer Saatgut', 'GERMANY', '0ecf21f0-2c8a-40ad-9e27-b5021abb2f94', 'manager', '2022-01-25 10:44:04', 'System', '2023-12-11 02:10:28', 2010, 1888, 2, NULL, 0, 1.19, 'Weiling', 0, NULL, 0, NULL, NULL, '2023-03-02 13:58:26', 28.044, 'SEEDS', 'DRUGSTORE', 3.72, 11.4, 'VEGETARIAN', NULL, NULL),
(1958, 'Liebesapfel - Paprika (Saatgut) (Weiling)', '4260012644111', 0, 3.2, 1, 1, NULL, 0, NULL, 'Liebesapfel - Paprika (Saatgut)', 'Der Paprika Liebesapfel bildet tomatenförmige, dickwandige Früchte, die von grün nach rot abreifen. Die ausgereiften, saftigen Schoten haben einen ausgezeichneten süß-aromatischen Geschmack. Diese Paprikasorte ist auch für das Freiland geeignet und braucht unbedingt eine ausreichende Nährstoff- und Wasserversorgung. \n\nTipp:  Tipp: Die Aussaat von Paprika braucht viel Wärme zum Keimen (durchgehend 25 - 28°C). Zu niedrige Temperaturen sind die häufigste Ursache dafür, dass Paprikasamen nicht aufgehen.', 'Bingenheimer Saatgut AG', 'Bingenheimer Saatgut', 'GERMANY', 'efb1b239-78a1-4171-afcd-c5b9b8179de4', 'manager', '2022-01-25 10:45:11', 'System', '2023-12-11 02:12:20', 2020, 1889, 2, NULL, 0, 2.01, 'Weiling', 0, NULL, 0, NULL, NULL, '2023-03-02 14:00:24', 28.044, 'SEEDS', 'DRUGSTORE', 2.68, 11.4, 'VEGETARIAN', NULL, NULL),
(1959, 'Snack-Tomaten Mix - Saatmischung (Saatgut) (Weiling)', '4260012644098', 0, 4.3, 1, 1, NULL, 0, NULL, 'Snack-Tomaten Mix - Saatmischung (Saatgut)', 'Eine farbenfrohe Kombination aus 3 wohlschmeckenden Sorten Cocktail-Tomaten. Neben der beliebten Ruthje runden die dunkelviolette Cherry-Tomate Black Cherry und die gelbfrüchtige Goldiana das Geschmackserlebnis ab. Ruthje bildet leuchtend rote, leicht herzförmige Früchte mit einem außergewöhnlich guten Geschmack. Black Cherry punktet mit hohem Ertrag und sehr gesunden Pflanzen. Goldiana-Tomätchen sind platzfest und schmecken ausgereift richtig lecker. Alles in allem eine gelungene Mischung für eine vitaminreiche Zwischenmahlzeit oder den bunten Salatteller.\nTIPP: Alle drei Sorten freuen sich über ein Dach, dass vor Nässe von oben schützt. Geschmacksfördernd sind eine zurückhaltende Düngung,  viel Sonne und eine eher trockene Kulturführung.', 'Bingenheimer Saatgut AG', 'Bingenheimer Saatgut', 'GERMANY', 'f044084f-81c1-4fe5-8ed1-5211435fabb1', 'manager', '2022-01-25 10:45:57', 'System', '2023-11-09 02:11:46', 2026, 1890, 2, NULL, 0, 2.69, 'Weiling', 0, NULL, 0, NULL, NULL, '2023-03-02 14:00:53', 75.44, 'SEEDS', 'DRUGSTORE', 5.94, 16.4, 'VEGETARIAN', NULL, NULL),
(1960, 'Kräuter Allerlei  (Saatscheibe) (Weiling)', '4260012644630', 0, 2.7, 1, 1, NULL, 0, NULL, 'Kräuter Allerlei  (Saatscheibe)', 'Fünf verschiedene Saatscheiben von klassischen Küchenkräutern, die man immer zur Hand haben sollte: Krause (Grüne Perle 2) und glatte Petersilie (Einfacher Schnitt 3), Schnittlauch (Gonzales), Dill und Kerbel (Verena). Mit den Saatscheiben ist die Aussaat in Töpfen oder Balkonkästen besonders einfach. Das Gefäß bis ca. 2 cm unter dem Rand mit Erde füllen und andrücken. Die Saatscheiben auflegen, gut bewässern, dünn mit Erde oder Sand bedecken, nochmals befeuchten und bis zur Keimung nicht austrocknen lassen\n\nTIPP: Selbst angezogene Kräutertöpfe sind bei guten Bedingungen im Gegensatz zu den im Handel erhältlichen mehrmals beerntbar.', 'Bingenheimer Saatgut AG', 'Bingenheimer Saatgut', 'GERMANY', 'dc569ac2-d386-4633-9a18-fa9b871ee44a', 'manager', '2022-01-25 10:47:08', 'System', '2023-11-09 02:11:30', 2032, 1891, 2, NULL, 0, 1.75, 'Weiling', 0, NULL, 0, NULL, NULL, '2023-03-02 14:00:06', 75.44, 'SEEDS', 'DRUGSTORE', 7.81, 16.4, 'VEGETARIAN', NULL, NULL),
(1961, 'Ostergras- Sommergerste Pirona (Saatgut) (Weiling)', '4260012643176', 0, 1.9, 1, 1, NULL, 0, NULL, 'Ostergras- Sommergerste Pirona (Saatgut)', 'Traditionell zu Ostern macht sich dieses saftig-grüne Gras besonders schön als Dekoration für Osternester. Bei Zimmertemperatur braucht das Gras 7 - 10 Tage bis es eine schöne Wuchshöhe erreicht. Ausgesät wird in Schalen, am besten an einem warmen, hellen Platz. Die Samen auf die Erde geben, andrücken und mit 1 cm Erde bedecken. Bis zur Keimung feucht halten\n\"TIPP\": Ihr Ostergras gedeiht in jedem Gefäß, besonders nett sieht es in Keramiktöpfen aus. Das Ostergras können Sie anschließend an den Osterhasen und andere Haustiere verfüttern.', 'Bingenheimer Saatgut AG', 'Bingenheimer Saatgut', 'GERMANY', 'a4e36726-70d6-45b0-95ac-4440bbb070ca', 'manager', '2022-01-25 10:47:49', 'System', '2023-11-09 02:11:08', 2024, 1892, 2, NULL, 0, 1.19, 'Weiling', 0, NULL, 0, NULL, NULL, '2023-03-02 14:00:20', 150.88, 'SEEDS', 'DRUGSTORE', 67.63, 16.4, 'VEGETARIAN', NULL, NULL),
(1962, 'Liefje - Einlegegurke (Saatgut) (Weiling)', '4260012645453', 0, 2.8, 1, 1, NULL, 0, NULL, 'Liefje - Einlegegurke (Saatgut)', 'Gesundwachsende, erfragreiche Einlegegurke, die sich mit ihrem sehr guten, aromatischen Geschmack auch als Snackgurke eignet. Die Jungpflanzen sollten bei der Pflanzung noch klein sein und nach dem Setzen muss die Pflanze zügig weiterwachsen können.\n\"TIPP\":  Auf eine warme Anzucht achten! Gurken keimen am schnellsten bei 25-28°C durchgehend. Sie sollten innerhalb einer Woche gekeimt sein.', 'Bingenheimer Saatgut AG', 'Bingenheimer Saatgut', 'GERMANY', '46816b6f-7679-4c90-afc8-a36961e74da5', 'manager', '2022-01-25 10:48:29', 'System', '2023-12-11 02:10:39', 2021, 1893, 2, NULL, 0, 1.75, 'Weiling', 0, NULL, 0, NULL, NULL, '2023-03-02 13:59:28', 18.696, 'SEEDS', 'DRUGSTORE', 3.01, 11.4, 'VEGETARIAN', NULL, NULL),
(1963, 'griechischer Oregano - Kräuter (Saatgut) (Weiling)', '4260012645286', 0, 2.8, 1, 1, NULL, 0, NULL, 'griechischer Oregano - Kräuter (Saatgut)', 'Der mehrjährige Oregano ist das klassische Pizzagewürz und eine unkomplizierte, genügsame und vielseitige Gewürzpflanze für das Kräuterbeet oder als Topfpflanze für Balkon und Terasse. Sehr trockenheitsverträglich und eine ausgezeichnete Futterpflanze für Insekten. Oregano gehört zu den Schwachzehrern und kommt völlig ohne Kompostgaben aus.\n\"TIPP\": Die Pflanzen sollten alle 4 - 5 Jahre erneuert werden, da der Gehalt an Inhaltsstoffen mit der Zeit abnimmt.', 'Bingenheimer Saatgut AG', 'Bingenheimer Saatgut', 'GERMANY', '6da08532-a5ab-4f56-bf31-a856775f175f', 'manager', '2022-01-25 10:49:15', 'System', '2023-12-11 02:11:05', 2018, 1894, 2, NULL, 0, 1.75, 'Weiling', 0, NULL, 0, NULL, NULL, '2023-03-02 14:00:14', 9.348, 'SEEDS', 'DRUGSTORE', 2.68, 11.4, 'VEGETARIAN', NULL, NULL),
