(1971, 'FOR MEN Rasiercreme (Weiling)', '4001638098809', 1, 5.99, 1, 1, NULL, 0, NULL, 'FOR MEN Rasiercreme', 'Die Weleda Rasiercreme schützt und pflegt zugleich die empfindliche, vom Rasieren strapazierte Haut mit einem Auszug aus Stiefmütterchen, Ziegenmilch und Mandelmilch. Vor und nach dem Rasieren empfiehlt sich das erfrischende Rasierwasser. Der After Shave Balsam pflegt und beruhigt zusätzlich nach der Rasur. Schützt die vom Rasieren strapazierte Haut Sorgt für ein extra zartes Hautgefühl Anwendungstipp Gesicht und Rasierpinsel mit warmem Wasser etwas anfeuchten. Rasiercreme auf den Rasierpinsel geben, im Gesicht verteilen und leicht aufschäumen. Alternativ die Rasiercreme in den Händen aufschäumen und direkt auf das Gesicht geben. Nach der Rasur das Gesicht mit Wasser abwaschen und sanft abtrocknen.', 'Weleda AG', 'Weleda', 'GERMANY', 'e468a234-8d55-4e11-9400-ae1942e55420', 'manager', '2022-01-28 10:41:14', 'System', '2024-02-02 02:12:21', 2606, 1897, NULL, NULL, 0, 3.4, 'Weiling', 0, NULL, 0, NULL, NULL, '2022-12-20 00:04:58', 269.382, 'BODY_CARE', 'DRUGSTORE', 103.9, 13.9, 'VEGETARIAN', NULL, NULL),
(1972, 'Glutenfreie Haferflocken Großblatt, demeter (Weiling)', '4022381027571', 0, 2.99, 1, 1, NULL, 0, NULL, 'Glutenfreie Haferflocken Großblatt, demeter', 'Unsere glutenfreien Haferflocken werden vom Anbau bis zum Verkauf im Laden sorgfältig getrennt von allen glutenhaltigen Produkten gehalten und mehrmals analysiert. Damit der Glutengehalt verlässlich unter 20 ppm (20 mg/kg) Gluten liegt, muss bereits der Landwirt bei der Anbauplanung, bei der Ernte, der Lagerung und dem Transport Verunreinigungen vermeiden. In unserer Mühle achten wir auf streng getrennte Warenströme. Erst wenn auch die letzte Analyse die Glutenfreiheit bestätigt, verlassen die Produkte unser Haus. Für eine ökologische und sichere Verpackungslösung für die glutenfreien Produkte setzen wir auf Pergaminpapier. Dieses ist sehr dicht und besitzt eine Fettbarriere. Bei unseren Beuteln für die glutenfreien Produkte verwenden wir einen kompletten Innenbeutel aus diesem Papier. Er bietet ausreichend Schutz vor nachträglicher Verunreinigung. Weil er aus 100% Papier besteht, kann er problemlos über das Altpapier entsorgt werden. Für unsere glutenfreien Haferflocken wird das ganze Korn gedarrt, gedämpft und anschließend zu einer schönen Flocke gewalzt. So bleiben alle Inhaltsstoffe des vollen Getreidekorns erhalten. Hafer ist ein wahres heimisches Superfood, denn er bietet eine Menge Vitamine und Mineralstoffe wie B-Vitamine, Vitamin E, Kalium, Eisen und Zink. Zudem punktet das Getreide mit einem hohen Eiweißgehalt und sättigenden Ballaststoffen. Besonders reich ist Hafer an dem Ballaststoff Beta-Glucan. Dieser macht ihn besonders gesund, denn Beta-Glucan wirkt sich positiv auf den Cholesterin- und Blutzuckerspiegel aus.', 'Spielberger GmbH', 'Spielberger Mühle', 'GERMANY', '7c269e1e-cf54-4fde-9f9b-2d5146b91ff8', 'manager', '2022-02-01 15:47:34', 'System', '2024-01-30 02:05:21', 124, 1898, 2, NULL, 0, 1.81, 'Weiling', 0, NULL, 0, 64, 'HAFERflocken Großblatt, glutenfrei** **aus biodynamischer Erzeugung', '2023-11-29 02:08:38', 977.5, 'MUISLI_FLAKES_NUTS', 'PANTRY', 492, 23, 'VEGAN;VEGETARIAN;GLUTENFREE', NULL, NULL),
