(1975, 'Kichererbsen-Chips Meersalz', '8711812414870', 0, 2.99, 1, 1, NULL, 0, NULL, 'Kichererbsen-Chips Meersalz', 'Herrlich locker-knusprige Kichererbsen-Chips aus aromatischen Kichererbsen kontrolliert biologischen Anbaus. Mit 30% weniger gesättigten Fettsäuren als herkömmliche Kartoffelchips und verfeinert mit einer Prise Meersalz, aromatischem Rosmarin oder pikanter Paprika für puren Knabbergenuss.', 'Allos Hof-Manufaktur GmbH', 'De Rit', 'CZECH_REPUBLIC', 'b61a1485-b181-40ee-9f7a-e71c0480753c', 'manager', '2022-02-03 15:25:56', 'System', '2024-01-03 02:06:08', 2042, 1899, 0, NULL, 0, 1.9, NULL, 0, NULL, 0, 27, 'Kichererbsenmehl* (43%), Kartoffelstärke*, Sonnenblumenöl*, Kartoffelmehl*,  Meersalz (1,5%). * aus biologischem Anbau.', '2022-09-01 02:44:38', 1579.5, 'SALTY', 'SNACKS', 80, 27, 'VEGAN;VEGETARIAN', NULL, NULL),
