(1998, 'now Fresh Berry 0,33l (Weiling)', '4012852204921', 1, 1.29, 1, 1, NULL, 0.08, NULL, 'now Fresh Berry 0,33l', 'Unsere Summer Edition 2022, besticht durch die feine Süße und Vollmundigkeit der Brombeere. Vollreife Bio-Zitronen geben der Limo einen säuerlichen Kick,\nwährend die Minze erfrischende Akzente setzt. Diese now Bio-Limo haben wir zusammen mit unserem Stakeholderkreis entwickelt: Vertreter unseres gesamten\nLieferanten- und Kundennetzwerks haben die Kreation für euch ausgewählt!\nFruchtgehalt 9,2%', 'Neumarkter Lammsbräu', 'now', 'GERMANY', 'e75bd731-821b-4a62-b3d4-22406b5e6f54', 'manager', '2022-02-10 16:04:14', 'System', '2023-01-16 19:27:47', 2065, 1911, 3, NULL, 0, 0.7, 'Weiling', 0, NULL, 0, 60, 'Natürliches Mineralwasser mit Kohlensäure versetzt, Zucker*, Brombeersaft aus Brombeersaftkonzentrat* 4,6%, Zitronensaft aus Zitronensaftkonzentrat* 4,5%, Minzsirup*(Zucker*, Zitronensaft* 0,1%, Wasser, Minze*) *aus ökologischem Anbau', '2022-12-12 08:21:26', 1102.5, 'LEMONADE', 'DRINKS', 680, 22.5, 'VEGAN;VEGETARIAN', NULL, NULL),
(1999, 'Ohne Muhhh Drink 1,5% Fett (Weiling)', '4016249024307', 1, 2.79, 1, 1, NULL, 0, NULL, 'Ohne Muhhh Drink 1,5% Fett', 'Ohne Muhhh – das ist unser umweltfreundlicher Milchersatz. Der vegane Drink basiert auf Reis, Kokos und Soja aus ökologischem Anbau. Der vollmundige Geschmack und die milchige Konsistenz machen Ohne Muhhh zur ersten veganen Milchalternative, die nicht wie ein Ersatzprodukt schmeckt. Ob zum Kochen, Backen, für leckere Müslis oder im Kaffee: Verwende statt Milch einfach Ohne Muhhh aus dem nachhaltigen Getränkekarton.', 'Allos Hof-Manufaktur GmbH', 'Allos', 'ITALY', '6cb65f8e-5e11-4b62-af30-eee3326cd763', 'manager', '2022-02-10 16:05:04', 'System', '2023-11-25 02:13:46', 2066, 1912, 0, NULL, 0, 1.5, 'Weiling', 0, NULL, 0, 103, 'Wasser, Reis*, Kokosnuss*, SOJABOHNEN* geschält, Sonnenblumenöl* kaltgepresst, Stabilisator: Guarkernmehl*, Meersalz. *aus  ökologischem Landbau.', '2023-02-03 10:52:43', 1078.27, 'PRESERVED_MILK_DRINKS', 'FRESH;PANTRY', 1051, 20.8, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(2000, 'Natur-Eierfarben (Weiling)', '4012561501014', 1, 2.8, 1, 1, NULL, 0, NULL, 'Natur-Eierfarben', 'Die AURO Pflanzenchemie AG gehört zu den ökologischen Pionierunternehmen, die schon sehr früh markttaugliche und technisch ausgereifte Beispiele für den Übergang der chemischen Industrie in die post-fossile Ära entwickelt hat. Seit Gründung ist AURO bei Forschungsgrundsätzen, Rohstoffauswahl, Herstellungsverfahren, Produktgestaltung und -dokumentation sowie Verbrauchsminimierung und Abfallentsorgung einer strikten Orientierung an Nachhaltigkeitskriterien verpflichtet.', 'AURO Pflanzenchemie AG', 'Auro', 'Braunschweig, NI', NULL, 'manager', '2022-02-10 16:06:31', 'manager', '2023-02-27 14:16:48', 2067, NULL, NULL, NULL, 0, 2.6, 'Weiling', 0, NULL, 0, NULL, 'WEIZENGRIESS, Maltodextrin, Farbstoffe: Norbixin, Indigotin (Indigokarmin), Echtes Karmin, Kupferhaltige Komplexe der Chlorophylle und Chlorophylline, Säuerungsmittel: Citronensäure', '2023-02-27 14:16:48', 153, 'OTHER;HOUSEHOLD', 'DRUGSTORE;OTHER', NULL, 9, NULL, NULL, NULL),
(2001, 'Mini Cookie Himbeer Cheesecake (Weiling)', '4005561007242', 0, 2.49, 1, 1, NULL, 0, NULL, 'Mini Cookie Himbeer Cheesecake', 'Genau das Richtige für den kleinen Genussmoment zwischendurch: der Mini Cookie Himbeer Cheesecake! Tauche ab in eine kreative, bunte Auszeit mit deinen Mini Cookie! Fruchtige Himbeere und Zitrone kombiniert mit leckerem Cheesecake-Geschmack werden dich wie eine Muse küssen und dich dem Alltag entfliehen lassen! \nDie Mini Cookie der Bohlsener Mühle werden mit Bioland-Weizenmehl aus der hauseigenen Wassermühle in Bohlsen gebacken, gesüßt mit Bioland Rübenzucker aus Deutschland.\n\nDie Werte des Bio-Pioniers Bohlsener Mühle finden sich auf der Verpackung wieder: kurze Transportwege, Klimaschutz und regionaler Anbau werden thematisiert. Auch gegen Lebensmittelverschwendung setzt sich das Unternehmen mit dem Hinweis »oft länger gut« auf der Verpackung ein.\n\nDie Bohlsener Mühe\n\nGemahlen wird in Bohlsen seit 1265.\nIn unserer Wassermühle verarbeitet die Bohlsener Mühle seit mehr als 40 Jahren 100 % ökologische Rohstoffe. Gemeinsam mit den Landwirtinnen und Landwirten, die die Bohlsener Mühle beliefern, setzt sich das  mittelständische Unternehmen für zukunftsfähiges Wirtschaften, ökologischen Landbau und ihre Region ein. Heute werden in der Mühle und der Bäckerei vielfältige Bio-Lebensmittel gemahlen, gebacken und komponiert. Dabei verbindet die Bohlsener Mühle traditionelles Handwerk mit modernster Herstellungstechnik und klaren Rezepturen.', 'Bohlsener Mühle ', 'Bohlsener Mühle', 'GERMANY', 'c3b7176c-9880-4c2c-84b1-59e8fe1b5248', 'manager', '2022-02-10 16:07:21', 'System', '2024-01-17 02:11:00', 2068, 1913, 1, NULL, 0, 1.43, 'Weiling', 0, NULL, 0, 60, 'WEIZENmehl Type 1050*, HAFERvollkornflocken*, ungehärtetes Palmfett*, Rübenzucker, JOGHURTpulver* 5 %, Himbeergrieß* gefriergetrocknet 2%, Backtriebmittel (Ammoniumbicarbonat, Natriumhydrogencarbonat), Meersalz, Zitronenöl* <0,5 % *aus kontrolliert ökologischer Erzeugung', '2023-03-24 09:50:28', 1007.5, 'SWEETS', 'SNACKS', 128.4, 15.5, 'VEGETARIAN', NULL, NULL),
(2002, 'Fruchtaufstrich Aprikose (Weiling)', '4250096907981', 0, 4.69, 1, 1, NULL, 0, NULL, 'Fruchtaufstrich Aprikose', 'Besonders fruchtig schmecken unsere Aufstriche. Denn sie enthalten sehr viele sorgsam ausgewählte Bio-Früchte, in der Regel 70 %. Sie kochen nur so lange wie unbedingt nötig. Und nur vorsichtig ergänzen wir bei manchen Sorten Gewürze, damit die Frucht ihren vollen Geschmack entfalten kann. \n\nDie Bio-Fruchtaufstriche vom Kiebitzhof sind ein wunderbares Geschenk für liebe Freunde oder für Sie selbst. Es sagt: ,,Schön, dass es dich gibt!\"', 'Kiebitzhof', NULL, 'Gütersloh, Nordrhein-Westfalen', '06fe4968-b055-4c9b-b6a2-008b7a8cafa0', 'manager', '2022-02-10 16:08:35', 'System', '2023-09-26 02:26:00', 2069, 2303, 0, NULL, 0, 2.95, 'Weiling', 2, 1, 0, 63, NULL, '2022-02-10 16:15:03', 416.5, 'SPREADS_HONEY', 'PANTRY', 395, 8.5, 'VEGAN;VEGETARIAN', NULL, NULL),
