(2006, 'Body Milk Sanft (Weiling)', '4021457637461', 1, 8.29, 1, 1, NULL, 0, NULL, 'Body Milk Sanft', 'Die Body Milk Sanft mit Bio-Wildrose & Bio-Sheabutter für normale bis trockene Haut.\n\nErlebe das lavera Gefühl eines besonderen Verwöhnmoments:\nUnsere milde Formel mit Bio-Wildrose und Bio-Sheabutter spendet trockener Haut intensive Pflege und verwöhnt die Sinne mit floralem Duft.\n- Schützt vor dem Austrocknen\n- Sinnlicher Wildrosenduft\n- 100 % natürlich schöne Haut\nBio-Wildrose ist bekannt für ihren Gehalt an Vitamin C, wirkt kräftigend und sorgt für ein angenehmes Hautgefühl.\nBio-Sheabutter enthält viele wertvolle Inhaltsstoffe wie Vitamin E und wird auf Grund intensiv pflegender Eigenschaften in unseren Produkten für trockene Haut eingesetzt.\n\nUnser Versprechen:\n- Biologisch abbaubare Rezepturen ohne Mineralöle und ohne künstliche Duft-,  Farb- und  Konservierungsstoffe*\n- Zertifiziert nach dem strengen, unabhängigen NATRUE Naturkosmetikstandard. Verträglichkeit dermatologisch bestätigt\n- Klimaneutrale Produkte**, Kunststoff dieser Flasche inkl. Verschluss aus 100 % recyceltem Material\n- Vegan & nach PETA-Kriterien zertifiziert\n- Exklusive Naturkompositionen aus der lavera-Forschung, mit dem Besten aus der Natur\n* gem. EU-Kosmetik VO\n** ClimatePartner.com/12310-1610-1001\n\nlavera. Natur, die du fühlst\n\nMade in Germany', 'Laverana GmbH & Co.KG', 'lavera', 'Wennigsen, NI', '0e531bcf-2d01-4409-be04-f3a6e01c2967', 'manager', '2022-02-13 12:56:14', 'System', '2024-01-03 02:05:57', 2073, 1916, NULL, NULL, 0, 4.59, 'Weiling', 1, 1, 0, NULL, NULL, '2023-02-13 23:27:13', 478.216, 'BODY_CARE', 'DRUGSTORE', 227.18, 18.1, 'VEGAN;VEGETARIAN', NULL, NULL),
