(2021, 'Ohne Muhhh zum Kochen', '4016249024277', 0, 1.29, 1, 1, NULL, 0, NULL, 'Ohne Muhhh zum Kochen', 'Unser CUISINES sind allererste Sahne – und das ganz ohne Sahne. Wer braucht denn auch schon Milchprodukte für feinste Kochkünste? Also alle Meisterköche aufgepasst: Wenn ihr eure Suppen, Soßen, Aufläufe oder euer Gebäck verfeinern wollt, müsst ihr keine Kuh belästigen. Je nachdem, welchen Fettgehalt ihr braucht, findet ihr für jedes Rezept die passende Lösung. Mit unseren CUISINES habt ihr einfach allos im Griff!', 'Allos Hof-Manufaktur GmbH', 'Allos', 'ITALY', 'ce7dc307-2a7e-412c-8b63-b167e8c8a9a8', 'manager', '2022-02-25 07:33:10', 'System', '2023-11-29 02:13:12', 2087, 1926, 0, NULL, 0, 1, NULL, 0, NULL, 0, 103, 'Wasser, Sonnenblumenöl* kaltgepresst, Reis*, SOJABOHNEN* geschält, Kokospaste*, Stabilisator: Guarkernmehl*, Emulgator: SOJALECITHIN*, Meersalz. *aus ökologischem Landbau.', '2022-11-29 16:42:38', 252.72, 'PRESERVED_MILK_DRINKS', 'FRESH;PANTRY', 218, 11.7, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
