(2027, 'Agavendicksaft 250ml (Weiling)', '4035626101301', 0, 2.99, 1, 1, NULL, 0, NULL, 'Agavendicksaft 250ml', 'In der subtropischen Landschaft Mexikos bilden die silbrigen Agavenpflanzen einen schönen Kontrast zu sandigem Boden und azurblauem Himmel.\nAus dem \"süßen Herz\" der blauen Agave, die in der subtropischen Landschaft Mexikos wächst, wird dieser Saft gewonnen und eingedickt. Ein vielseitig einsetzbares Süßungsmittel.', 'Weiling GmbH', 'bioladen', 'GERMANY', '2c7c62d9-3d44-4ed1-9329-4a3959d2163d', 'manager', '2022-02-25 08:18:40', 'System', '2023-08-23 02:07:53', 2093, 1931, 0, NULL, 0, 1.86, 'Weiling', 0, NULL, 0, 60, NULL, '2022-11-15 11:21:22', 343.04, 'BAKING_INGREDIENTS;SPICES_COOKING_HELP', 'PANTRY', 281.9, 12.8, 'VEGAN;VEGETARIAN', NULL, NULL),
(2028, 'Lavera invisible 24h Deo Roll-On (Weiling)', '4021457614981', 0, 5.49, 1, 1, NULL, 0, NULL, 'Lavera invisible 24h Deo Roll-On', '48h Deo Power aus der Natur - zuverlässiger Schutz ohne Deo Flecken. Ganz ohne Aluminiumsalze. Erlebe außerdem das gute Gefühl, gemeinsam mit uns als klimaneutrales Unternehmen einen wirksamen Beitrag zum Umweltschutz zu leisten. Zum Beispiel durch unseren vollständigen Verzicht auf Mikroplastik. Die Rezeptur ist biologisch abbaubar, und Flasche und Deckel bestehen zu 96% aus recyceltem Material. Das gute Gefühl von 100% zertifizierter Naturkosmetik  ohne Kompromisse. Unser Versprechen:  Naturkosmetik: Zertifiziert und dermatologisch getestet  Rezepturen: Biologisch abbaubar, ohne Aluminiumsalze, ohne künstliche Duft- und Konservierungsstoffe*  Verpackung: Flasche und Deckel bestehen zu 96% aus recyceltem Material la vera\"\", die Wahre, engagiert sich für Klimaschutz und Tierschutz *gemäß EU-KosmetikVO', 'Laverana GmbH & Co.KG', 'Lavera', 'Hannover, NI', NULL, 'manager', '2022-02-25 16:59:46', 'manager', '2023-02-27 13:54:41', 2094, NULL, NULL, NULL, 0, 2.89, 'Weiling', 1, 1, 0, NULL, 'Water (Aqua), Alcohol* denat., Triethyl Citrate, Glyceryl Caprylate, Sodium Caproyl/Lauroyl Lactylate, Levulinic Acid, Xanthan Gum, Moringa Oleifera Leaf Extract*, Verbena Officinalis Leaf Extract*, Betula Alba Leaf Extract*, Hamamelis Virginiana (Witch Hazel) Leaf Extract*, Pentylene Glycol, Glycerin, Sodium Levulinate, Zinc PCA, Sea Salt (Maris Sal), Calcium Lactate, Hydrogenated Lecithin, Fragrance (Parfum)**, Limonene**, Geraniol**, Linalool**, Benzyl Salicylate**, Citral**, Citronellol**, Benzyl Alcohol**\r\n\r\n* Ingredients from certified organic agriculture\r\n**natural essential oils', '2023-02-27 13:54:41', 253.92, 'BODY_CARE', 'DRUGSTORE', NULL, 12, 'VEGAN;VEGETARIAN', NULL, NULL),
(2029, 'Lavera Straffende Bodylotion (Weiling)', '4021457637454', 0, 8.49, 1, 1, NULL, 0, NULL, 'Lavera Straffende Bodylotion', 'Die basis sensitiv Body Lotion Straffend mit Bio-Aloe Vera & natürlichem Coenzym Q10 verbessert die Hautelastizität in 14 Tagen.\n\nErlebe das lavera Gefühl spürbar strafferer Haut:\nUnsere milde Formel mit Bio-Aloe Vera und natürlichem Coenzym Q10 schenkt straffere Haut – schon nach zwei Wochen.\n- Zieht extra schnell ein \n- 24 h Feuchtigkeit\n- 100 % natürlich schöne Haut\nBio-Aloe Vera ist ein wahres Multitalent, enthält viele unterschiedliche Wirkstoffe und ist für ihre feuchtigkeitsspendende Wirkung bekannt.\nNatürliches Coenzym Q10 ist am Energiestoffwechsel der Zellen beteiligt und kann durch seine antioxidativen Eigenschaften vor frühzeitiger Hautalterung schützen.\n\nUnser Versprechen:\n- Biologisch abbaubare Rezepturen ohne Mineralöle und ohne künstliche Duft-,  Farb- und  Konservierungsstoffe*\n- Zertifiziert nach dem strengen, unabhängigen NATRUE Naturkosmetikstandard. Verträglichkeit dermatologisch bestätigt\n- Klimaneutrale Produkte**, Kunststoff dieser Flasche inkl. Verschluss aus 100 % recyceltem Material\n- Vegan & nach PETA-Kriterien zertifiziert\n- Exklusive Naturkompositionen aus der lavera-Forschung, mit dem Besten aus der Natur\n* gem. EU-Kosmetik VO\n** ClimatePartner.com/12310-1610-1001\n\nlavera. Natur, die du fühlst\n\nMade in Germany', NULL, 'Lavera', NULL, '0a64e843-47c2-4a25-b560-fae185e2bdec', 'manager', '2022-02-25 17:12:34', 'System', '2023-10-20 02:08:16', 2095, 1932, NULL, NULL, 0, 5.54, 'Weiling', 0, 0, 0, NULL, NULL, '2022-10-13 02:05:55', 559.832, 'BODY_CARE', 'DRUGSTORE', 282.27, 19.8, 'VEGAN;VEGETARIAN', NULL, NULL),
(2030, 'Vollmilch-Lolly Hase', '4005967576892', 0, 0.99, 1, 1, NULL, 0, NULL, 'Vollmilch-Lolly Hase', 'Der Klassiker: Lolly in Hasen-Form aus zart schmelzender Vollmilchschokolade, am Stiel und in buntem Papier verpackt.', 'Minderleinsmuehle GmbH & Co. KG', 'Rosengarten', 'GERMANY', '5b1a0920-e4ca-4407-939e-fbe36c3315b4', 'manager', '2022-03-01 09:18:04', 'System', '2023-09-07 02:31:35', 2096, 1933, 0, NULL, 0, 0.61, NULL, 0, NULL, 0, 60, 'Rohrohrzucker* unraffiniert, Kakaobutter*, VOLLMILCHPULVER* 19%, Kakaomasse*\nKakao: 40 % mindestens *aus kontrolliert ökologischer Erzeugung', '2023-03-16 22:45:24', 41.65, 'SWEETS', 'SNACKS', 17.2, 17, 'VEGETARIAN', NULL, NULL),
(2031, 'CHICZA Bio-Kaugummi Spearmint ', '7503010108061', 0, 2.29, 1, 1, NULL, 0, NULL, 'CHICZA Bio-Kaugummi Spearmint ', '•Bio, vegan, laktose- und glutenfrei und rein natürlich gesüßt mit Agavendicksaft, Traubenzucker oder Rohrzuckersaft\n\n•Das erste zertifiziert biologische, 100% natürliche und biologisch abbaubare Kaugummi, hergestellt aus Chicle Naturlatex, dem ursprünglichem Kaugummi-Rohstoff\n\n•Ohne Polymere, sprich Petrochemie in der Kaumasse sowie ohne Aspartam, Sorbit und Glycerin\n\n•Schont die Umwelt, da es nicht klebt und biologisch abbaubar ist\n\n•CHICZA Bio-Regenwaldkaugummi wird in Bauernkooperativen in Mexiko unter fairen Bedingungen gewonnen. Die Arbeit der Chicleros trägt zu einem nachhaltigen Schutz des Regenwaldes bei\n\n•Verpackung fast vollständig biologisch abbaubar, Pappschachtel bestehend aus FSC zertifizierter Cellulose\nBesonderheiten\n\nCHICZA ist das weltweit erste zertifiziert biologische, 100% natürliche und biologisch abbaubare Kaugummi, hergestellt aus Chicle. \n\nChicle ist der ursprüngliche Rohstoff für Kaugummis, ein Naturlatex des Chicozapote Baumes, der von Produzentenkooperativen in den mexikanischen Regenwäldern der Halbinsel Yukatan unter fairen Bedingungen gewonnen wird. \n\nChicozapote-Bäume lassen sich nicht in Plantagen anpflanzen, sondern sie benötigen das diversifizierte Umfeld eines intakten Regenwaldes, um Latex zu produzieren. Die Arbeit der Chicleros trägt daher zu einem nachhaltigen Schutz der Wälder bei.\n\nAnders als viele konventionelle Produkte kommt CHICZA völlig ohne Polymere, sprich Petrochemie in der Kaumasse aus sowie ohne Aspartam, Sorbit und Glycerin.\n\nEs schont die Umwelt, da es nicht auf der Straße klebt und biologisch abbaubar ist.\n\nCHICZA ist für vegetarische und vegane Ernährung geeignet, biologisch, laktose- und glutenfrei und rein natürlich gesüßt mit Agavendicksaft, Traubenzucker und Rohrzuckersaft.\n\nDie Verpackung ist fast vollständig biologisch abbaubar, da die Schachtel aus FSC zertifizierter Cellulose besteht.\n\nErhältlich in den Geschmacksrichtungen\n\nSpearmint\nMinze\nLimone\nZimt\nBeeren Mix\nKaffee', 'Mayan Rainforest Netherlands Company B.V. ', 'CHICZA', 'MEXICO', 'c9fdb7c0-56ca-428f-8e59-3007d2db3eee', 'manager', '2022-03-01 09:24:36', 'System', '2023-12-09 03:28:17', 2097, 1934, 0, NULL, 0, 1.44, NULL, 0, NULL, 0, 806, 'Rohrzuckersirup (37%)*, Chicle-Kaumasse (35%)*, Glucose (24%)*, Agavendicksaft (3%)*, Speerminze Aroma* *aus kontrolliert ökologischer Erzeugung', '2022-10-28 02:03:46', 56, 'SWEETS', 'SNACKS', 35, 10, 'VEGAN;VEGETARIAN', NULL, NULL),
