(2038, 'Hamburger buns gf (Weiling)', '4022993046076', 0, 4.19, 1, 1, NULL, 0, NULL, 'Hamburger buns gf', 'HAMBURGER BUNS\n(Glutenfreie Bio Maisbrötchen mit Sesam zum Aufbacken oder Toasten): Kreativität erlaubt. Ob als fleischhaltige oder vegetarische Variante, das super fluffige Hamburger Brötchen nach Belieben mit frischen, saftigen Zutaten belegen und glutenfreien Burger-Genuss erleben.', 'Schnitzer GmbH & Co. KG', 'Schnitzer GLUTENFREIHEIT', 'GERMANY', 'cef78d32-f749-4b68-bb69-e648585e947b', 'manager', '2022-03-04 09:35:23', 'System', '2023-11-29 02:11:07', 2104, 1936, 0, NULL, 0, 2.5, 'Weiling', 0, NULL, 0, 61, '29% Maisstärke*, Wasser, Reisnatursauerteig* (Reismehl*, Wasser), Reismehl*, 5 % SESAM*, VOLLEI*, Tapiokastärke*, Rohrzucker*, Glukosesirup*, Sonnenblumenöl*, Flohsamenschalen*, Erbsenprotein*, Hefe*, Meersalz, Verdickungsmittel: Guarkernmehl*, Xanthan, Gewürze*. *aus kontrolliert ökologischer Erzeugung', '2023-05-02 12:07:40', 2268, 'BREAD_BUNS', 'PASTRY', 263, 21.6, 'VEGETARIAN;GLUTENFREE;PALMOILFREE', NULL, NULL),
(2039, 'Mini Cookie Salz Karamell (Weiling)', '4005561007259', 0, 2.49, 1, 1, NULL, 0, NULL, 'Mini Cookie Salz Karamell', 'Genau das Richtige für den kleinen Genussmoment zwischendurch: der Mini Cookie Salz Karamell! Reise entspannt in eine knusprig Cookie-Welt: Mit deinem Mini Cookie erlebst du die einzigartige Kombination aus leckerem, gold-braunem Karamell und einer feinen Salz-Note! Lass dich treiben und genieße deine Auszeit aus dem Alltag! \nDie Mini Cookie der Bohlsener Mühle werden mit Bioland-Weizenmehl aus der hauseigenen Wassermühle in Bohlsen gebacken, gesüßt mit Bioland Rübenzucker aus Deutschland.\n\nDie Werte des Bio-Pioniers Bohlsener Mühle finden sich auf der Verpackung wieder: kurze Transportwege, Klimaschutz und regionaler Anbau werden thematisiert. Auch gegen Lebensmittelverschwendung setzt sich das Unternehmen mit dem Hinweis »oft länger gut« auf der Verpackung ein.\n\nDie Bohlsener Mühle\n\nGemahlen wird in Bohlsen seit 1265.\nIn unserer Wassermühle verarbeitet die Bohlsener Mühle seit mehr als 40 Jahren 100 % ökologische Rohstoffe. Gemeinsam mit den Landwirtinnen und Landwirten, die die Bohlsener Mühle beliefern, setzt sich das  mittelständische Unternehmen für zukunftsfähiges Wirtschaften, ökologischen Landbau und ihre Region ein. Heute werden in der Mühle und der Bäckerei vielfältige Bio-Lebensmittel gemahlen, gebacken und komponiert. Dabei verbindet die Bohlsener Mühle traditionelles Handwerk mit modernster Herstellungstechnik und klaren Rezepturen.', 'Bohlsener Mühle ', 'Bohlsener Mühle', 'GERMANY', 'afbf26e5-3b6f-457f-aa0a-178bf1c0b6c6', 'manager', '2022-03-04 09:39:26', 'System', '2024-01-17 02:10:56', 2105, 1937, 1, NULL, 0, 1.43, 'Weiling', 0, NULL, 0, 60, 'WEIZENmehl Type 1050*, HAFERvollkornflocken*, Rübenzucker*, BUTTER*, Sonnenblumenöl*, Karamell* 10 % (Rohrohrzucker*, Glukosesirup* (WEIZEN*), SAHNE*, BUTTER*, Meersalz), Steinsalz 0,4 %, Backtriebmittel (Ammoniumbicarbonat, Natriumhydrogencarbonat). *aus kontrolliert ökologischer Erzeugung', '2023-04-12 19:27:38', 1007.5, 'SWEETS', 'SNACKS', 128.4, 15.5, 'VEGETARIAN', NULL, NULL),
(2040, 'Roggenvollkornmehl (Weiling)', '4022381012737', 0, 2.59, 1, 1, NULL, 0, NULL, 'Roggenvollkornmehl', 'Roggen hat einen kräftig-würzigen Geschmack. In der Spielberger Mühle wird das Getreide in mehreren Schritten zu diesem feinen Vollkornmehl vermahlen, das alle wertvollen Bestandteile des Korns enthält. ', 'Spielberger GmbH', 'Spielberger Mühle', 'GERMANY', '6c18d21c-43e1-40b2-84d6-5e30c41652b0', 'manager', '2022-03-04 09:46:05', 'System', '2024-01-19 02:06:41', 2106, 1938, 2, NULL, 0, 1.52, 'Weiling', 0, NULL, 0, 64, 'ROGGENvollkornmehl** **aus biodynamischer Erzeugung', '2022-12-17 12:10:54', 1320, 'BAKING_INGREDIENTS', 'PANTRY', 1014.4, 22, 'VEGAN;VEGETARIAN;RAWFOOD', NULL, NULL),
