(2046, 'Knusper Frühstück 3-Korn glutenfrei Bio', '4015637823096', 0, 3.29, 1, 1, NULL, 0, NULL, 'Knusper Frühstück 3-Korn glutenfrei Bio', 'Ohne Verwendung von genmodifizierten Organismen oder genmodifizierten Rohmaterialien, ohne Verwendung von Konservierungsstoffen und Zusätzen. Rückstandsanalyse der einzelnen Zusätze.', 'Bauck GmbH', 'Bauckhof', 'GERMANY', 'd6ca13cd-d70d-4d39-b2bc-29d8e2f5c65b', 'manager', '2022-03-08 08:10:01', 'System', '2023-09-26 02:37:02', 2112, 1941, 0, NULL, 0, 1.94, NULL, 0, NULL, 0, 64, 'Maisgritz* 51%, Maisgrieß* 16%, Reismehl* 9%, glutenfreies Buchweizenvollkornmehl* 9%, Rohrohrzucker*, Quinoavollkornmehl*, Amaranthvollkornmehl*,  Meersalz. *aus kontrolliert ökologischer Erzeugung', '2022-04-11 14:10:27', 1512.88, 'MUISLI_FLAKES_NUTS', 'PANTRY', 238, 24.5, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(2047, 'Premium Schinken', '4031829234105', 0, 5.49, 1, 1, NULL, 0, NULL, 'Premium Schinken', 'Über 4 Monate im handwerklichen Naturreifeverfahren ohne Nitritpökelsalz gereift, entwickelt der Ökoland Premium Schinken seinen unverfälschten Geschmack. Nur bester Schweineschinken wird hierfür verarbeitet, alles unter strengen Qualitätskontrollen. Bioland-zertifiziert. Ohne Nitritpökelsalz und andere Zusatzstoffe hergestellt. Von Natur aus glutenfrei, laktosefrei, natürliche Hefenbildung durch Fermentation. Innovative Verpackung aus Polypropylen (PP) bewirkt hohe Recyclebarkeit für die Kreislaufwirtschaft von Verpackungsmaterialien.', 'Ökoland GmbH Nord', 'ÖKOLAND', 'GERMANY', '9b638b00-7ac3-4c90-8fb4-fd8e64ad633e', 'manager', '2022-03-08 09:21:20', 'System', '2023-12-13 02:05:58', 2113, 1942, 1, NULL, 0, 3.8, NULL, 0, NULL, 0, 61, 'Schweinefleisch*, Meersalz, Roh-Rohrzucker*. *aus kontrolliert ökologischer Erzeugung', '2022-10-29 00:01:05', 476, 'SAUSAGE', 'FRESH', 97.5, 23.8, 'GLUTENFREE;LACTOSEFREE;PALMOILFREE', NULL, NULL),
