(2050, 'Schafkäse Knoblauch Peperoni (Weiling)', '4000915037807', 0, 4.59, 1, 1, NULL, 0, NULL, 'Schafkäse Knoblauch Peperoni', 'Der Schafskäse ist der typische Salzlakenkäse aus Griechenland. Dieser Original Schafskäse ist mit Knoblauch und Peperoncini im Käseteig leicht pikant gewürzt. ', 'Isana Naturfeinkost GmbH & Co. Produktions- und Handels KG', 'bio-verde', 'Griechenland', 'a61f20c6-f20a-4ba9-859d-43124242caef', 'manager', '2022-03-11 09:11:28', 'System', '2023-09-07 02:59:34', 2116, 1945, 0, NULL, 0, 2.74, 'Weiling', 0, NULL, 0, 64, 'SCHAFMILCH* (55%), ZIEGENMILCH* (37%), Peperoni* (4%), Knoblauch* (3%), Meersalz, Branntweinessig*, mikrobielles Lab, Milchsäurekulturen *aus kontrolliert ökologischer Erzeugung', '2023-05-09 17:23:06', 280, 'CHEESE', 'FRESH', 160, 14, 'VEGETARIAN', NULL, NULL),
(2051, 'Fetawürfel mit Rucola & Petersilie (Weiling)', '4065626115084', 0, 3.69, 1, 1, NULL, 0, NULL, 'Fetawürfel mit Rucola & Petersilie', 'Bioladen*Feta verfeinert mit einer Rucola-Petersilie-Kräutermarinade. Aus Schaf- und Ziegenmilch.', 'Weiling GmbH', 'bioladen', 'GERMANY', '5cf5d574-5eb4-43c0-8e1f-f81c4e6209c9', 'manager', '2022-03-15 08:12:01', 'System', '2023-01-16 19:31:21', 2117, 1946, 0, NULL, 0, 2.22, 'Weiling', 0, NULL, 0, 64, 'FETAKÄSE* (68%) - mind. 45 % Fett i. Tr., Sonnenblumenöl*, Rucola* (4 %), Petersilie* (4%), CASHEWKERNE*, Knoblauch* (2 %), Weißweinessig*, Meersalz, Kartoffelflocken*, Olivenöl*, Zitronensaftkonzentrat* *aus kontrolliert ökologischer Erzeugung', '2022-07-31 00:02:09', 351.975, 'GOURMET_CONVENIENCE', 'FRESH', 107.1, 9.5, 'VEGETARIAN', NULL, NULL),
(2052, 'Buchweizen Vital Bowl to go (Weiling)', '4260148657337', 0, 5.99, 1, 1, NULL, 0, NULL, 'Buchweizen Vital Bowl to go', 'Blattsalat? So einfach machen wir uns nicht! Unsere Vital-Bowls sind wahre Nährstoff-Helden. Bei allen Sorten achten wir auf eine balancierte Komposition aus Hülsenfrüchten, Kohlgemüse und \"Superfoods\". Zusammen mit unseren feinen Dressing, genießt du eine super leckere und gesunde Bowl, die dich lange satt hält. Tipp: Mit etwas frischem Zitronensaft beträufeln. Das Vitamin C der Zitrone verbessert die Aufnahme von wertvollen Nährstoffen!', 'PUR Bio Feinkost Manufaktur GmbH & Co. KG', 'PUR Bio-Manufaktur', 'GERMANY', '2566e092-d5e3-41d5-b8e8-949cabe91072', 'manager', '2022-03-15 08:15:06', 'System', '2023-01-16 19:31:35', 2118, 1947, 0, NULL, 0, 3.91, 'Weiling', 0, NULL, 0, 67, '52% Buchweizen-Mix* (39% gegarte Buchweizen* Wasser), Parboiled Reis* (Wasser), Rosenkohl*, Azukibohnen*, Möhren*) 21% Süßkartoffelsalat* (61% Süßkartoffel*, Lauch*, Paprika*, Sonnenblumenöl*, Agavendicksaft*, Zitronensaft*, Meersalz, Cayenne*), 11% Falafelpüree* (Kichererbsen*, Zwiebeln*, Sonnenblumenöl, Möhren*, Koriander*, Tamari* (SOJA*), SESAMÖL*, Meersalz, Cumin*, Paprika*, Knoblauch*), 16% Currydressing* (Wasser, Sonnenblumenöl*, Weißweinessig*, konzentrierter Traubenmost*, Agavendicksaft*, Zitronensaft*, 4% Curry* (SENF*, SELLERIE*), Maisquellstärke*, Meersalz) *aus kontrolliert ökologischer Erzeugung', '2023-01-16 19:31:35', 12675, 'GOURMET_CONVENIENCE', 'FRESH', 360, 75, 'VEGAN;VEGETARIAN', NULL, NULL),
(2053, 'Pesto frisch Bärlauch (Weiling)', '4000915104547', 0, 4.19, 1, 1, NULL, 0, NULL, 'Pesto frisch Bärlauch', 'Der Begriff \"Pesto\" leitet sich von dem italienischen Wort \"pestare\" ab und bedeutet \"zerstoßen, zerkleinern\". So werden für das Pesto Bärlauch frische Kräuter sowie Hartkäse  kleingehackt und mit Öl vermischt. Es entsteht eine aromatisch schmackhafte Sauce', 'Isana Naturfeinkost GmbH & Co. Produktions- und Handels KG', 'bio-verde', 'GERMANY', '6c3d95d1-3ca4-4b4e-88dd-1d07aa2137f2', 'manager', '2022-03-15 08:17:19', 'System', '2023-10-10 00:01:52', 2119, 1948, 0, NULL, 0, 2.72, 'Weiling', 0, NULL, 0, 64, 'Sonnenblumenöl*, Bärlauch***** (31%), HARTKÄSE*(13%), Kartoffelflocken*, Olivenöl*, Meersalz, konzentrierter Zitronensaft* *aus kontrolliert ökologischer Erzeugung *****aus bio-zertifizierter Wildsammlung', '2022-09-05 00:21:03', 317.625, 'GOURMET_CONVENIENCE', 'FRESH', 300, 10.5, 'VEGETARIAN', NULL, NULL),
