(2058, 'Nudelsalat mit Tomaten-Cashew-Pesto und Oliven (Weiling)', '4260148651601', 0, 3.99, 1, 1, NULL, 0, NULL, 'Nudelsalat mit Tomaten-Cashew-Pesto und Oliven', 'Wir von der Bio-Manufaktur lieben unser Handwerk. Unsere Feinkostsalate werden wie zu Hause von Hand zubereitet, individuell abgeschmeckt und verpackt ready-to-eat. Schmecke den Unterschied… Guten Appetit!', 'PUR Bio Feinkost Manufaktur GmbH & Co. KG', 'PUR Bio-Manufaktur', 'GERMANY', 'e8ae10ce-1ee2-48db-8d6c-3f9c60fc9a57', 'manager', '2022-03-15 08:26:01', 'System', '2023-01-16 19:31:51', 2125, 1951, 0, NULL, 0, 2.35, 'Weiling', 0, NULL, 0, 67, '49% Penne* (HARTWEIZENGRIEß*), 18% Tomaten- CASHEWPESTO* (20% Tomaten*, Trinkwasser, 17% getrocknete Tomaten*, Sonnenblumenöl*, Rohrohrzucker*, CASHEW*, roter Balsamico* (Rotweinessig*, Traubenmost*), Olivenöl*, Meersalz, Knoblauch*, Basilikum*, Pfeffer*) Zucchini*, Paprika*, Zwiebeln*, 2% Oliven* *aus kontrolliert ökologischer Erzeugung', '2023-05-12 11:05:13', 519.75, 'GOURMET_CONVENIENCE', 'FRESH', 218, 13.5, 'VEGAN;VEGETARIAN', NULL, NULL),
(2059, 'Schlierbacher Ziegen Frischkäse Natur (Weiling)', '9026500003670', 0, 3.29, 1, 1, NULL, 0, NULL, 'Schlierbacher Ziegen Frischkäse Natur', 'Schlierbacher Bio Ziegenfrischkäse Natur –\n aus bester, frischer Bio-Ziegenmilch wird in Schlierbach der herrlich cremige Ziegenfrischkäse mit besonderer Sorgfalt hergestellt. Die feine Ziegenmilchnote und der frische Geschmack versprechen besonderen Genuss! Und Kuhmilchallergiker können sich über Abwechslung im Frischkäsebereich freuen!\nTipp: Schlierbacher Ziegenfrischkäse ist ein hervorragender Brotaufstrich, passt aber auch perfekt zu Knabberstangen und lässt sich im Dressiersack fein dekorieren. Zusätzlich gibt er cremigen Suppen und Sauce eine herrliche Note!\n', 'Käserei Stift Schlierbach GmbH & Co. KG', 'Schlierbacher', 'Oberösterreich', 'f948c361-9a94-4bf3-8167-a41fbf2a1c6e', 'manager', '2022-03-15 08:28:36', 'System', '2023-12-17 02:51:07', 2124, 1952, 0, NULL, 0, 2.11, 'Weiling', 0, NULL, 0, 8, 'ZIEGENFRISCHKÄSE*, Speisesalz *aus kontrolliert ökologischer Erzeugung', '2022-10-21 02:03:41', 369.671, 'CHEESE', 'FRESH', 165.08, 9.2, 'WITHOUT_ADDED_SUGAR', NULL, NULL),
