(2064, 'Leckermäulchen Tee (Lebensbaum) (Weiling)', '4012346252605', 0, 4.99, 1, 1, NULL, 0, NULL, 'Leckermäulchen Tee (Lebensbaum)', 'In Kombination mit süßem Apfel entfachen Himbeere, Erdbeere und Brombeere in unserem orange-roten Leckermäulchen®-Tee ein wahres Fruchtfeuerwerk mit mild beerigem Geschmack. Für diese Mischung haben wir Früchte ausgewählt, die Kinder auch gerne frisch essen - die Verwandlung eines bunten Obsttellers in einen leckeren Tee. So lieblich und lecker, dass Nachsüßen nicht notwendig ist.', 'Ulrich Walter GmbH', 'LEBENSBAUM', 'GERMANY', '3cee58c3-9f80-4c3d-8294-c15cc430aff7', 'manager', '2022-03-18 08:53:04', 'System', '2024-02-15 02:11:07', 2128, 1957, 0, NULL, 0, 2.94, 'Weiling', 0, NULL, 0, 60, 'Apfel*, Hagebutte*, Orange*, Süßes Brombeerblatt*, Holunderbeere*, Himbeere* (3 %), Rote Bete*, Erdbeere* (1 %) *aus kontrolliert ökologischer Erzeugung', '2022-11-29 15:27:19', 760, 'TEA', 'COFFEE_TEA_COCOA', 105, 19, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(2065, 'Hafer Flapjack Salz-Karamell (Weiling)', '4016249074722', 0, 1.99, 1, 1, NULL, 0, NULL, 'Hafer Flapjack Salz-Karamell', 'Gegen den Hunger zwischendurch haben wir was. Und zwar unsere hervorragenden\nFlapjacks. Wie alle unsere Riegel kommen auch die aus bestem Hause – dem Allos-Hof in\nDrebber im wünderschönen Niedersachsen. Zu dem ebenso leckeren wie\nballaststoffreichen Hafer gesellen sich noch beste Früchte, knackig Nüsse und edler\nKakao. Man muss sich manchmal wundern, dass so viel guter Geschmack überhaupt in so\neinen kleinen Riegel passt.', 'Allos', 'Allos', 'Germany', '943daf78-e6b2-4755-845c-9cc703112a84', 'manager', '2022-03-18 08:57:05', 'System', '2023-06-09 02:09:19', 2129, 1958, NULL, NULL, 0, 1.15, 'Weiling', 0, 0, 0, 60, NULL, '2022-05-24 12:05:19', 145, 'SWEETS', 'SNACKS', 51, 14.5, 'VEGETARIAN', NULL, NULL),
