(2068, 'Leberwurst Pute (Weiling)', '4065626114087', 0, 3.39, 1, 1, NULL, 0, NULL, 'Leberwurst Pute', 'Das Fleisch dieses bioladen*Produktes stammt von\nverbandszertifizierten Bio-Bauernhöfen. Eine ökologische Tierhaltung mit großzügigem Auslauf im Freien und biologischem Futter ist die beste Grundlage für eine ausgezeichnete Fleischqualität.\n', 'bioladen', NULL, NULL, '362ae124-2dc9-4ef5-b9da-2ef397665b06', 'manager', '2022-03-18 09:15:55', 'System', '2024-01-18 02:08:20', 2133, 1961, NULL, NULL, 0, 2.02, 'Weiling', 0, 1, 0, 74, NULL, '2022-05-30 10:00:49', 253.125, 'OTHER', 'OTHER', 130, 12.5, NULL, NULL, NULL),
(2069, 'Bioland Französische Vinaigrette 250 ml  ', '4260221611614', 0, 4.69, 1, 1, NULL, 0, NULL, 'Bioland Französische Vinaigrette 250 ml  ', 'Emils Französische Vinaigrette&Dip (Bioland) in der 250ml Flasche\n\nKräuter und Senf ergänzt um kräftige Öle. Eine kleine Geschmacksexplosion aus feinen Noten. Zu kräftigen und bitteren Salaten, zu Käse, Sandwiches und ganz allgemein als Verleckerung.\n\nBIOLAND, Vegan**, Unpasteurisiert, Glutenfrei nach DZG, Lactosefrei, null Zusatzstoffe.\n\n** Garantiert gelatinefrei: 100% vegane Essige & veganes Etikettenpapier: 100% kaseinfrei.\n\nBesonderheiten:\nVegan, unpasteurisiert, Lactosefrei, Glutenfrei nach DZG, konsequent ohne Tricks Stabilisatoren,Verdickungsmittel. 100% Bio. Bioland-Qualität.\n\nHerstellung:\nDer Gegenentwurf von Massenproduktion. Qualitätsverliebte Handarbeit hergestellt in Deutschland – im eigenen Manufaturbetrieb.', 'wageswiese GmbH', 'Emils Biomanufaktur', 'GERMANY', '6172bade-9207-4022-9841-10998176eccf', 'manager', '2022-03-18 09:22:29', 'System', '2024-02-06 02:11:09', 2134, 1962, 1, NULL, 0, 2.5, NULL, 0, NULL, 0, 63, 'Rapsöl kaltgepresst*, Apfelsaft* aus Apfelsaftkonzentrat*, SENF* (Apfelmost*, SENFSAAT*, Apfelessig*, Steinsalz, Kurkuma*), Apfelessig*, Rapsöl kaltgepresst mit Knoblauchöl* (Rapsöl* kaltgepresst, Knoblauchöl), Meersalz, Petersilie*, Kerbel*, Schnittlauch*. *aus kontrolliert ökologischer Erzeugung', '2023-07-03 10:44:51', 573.3, 'OIL_VINEGAR_SAUCES;OTHER', 'PANTRY;OTHER', 408.5, 14, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE;WITHOUT_ADDED_SUGAR', NULL, NULL),
(2070, 'Weizenmehl 550 (Weiling)', '4022381200189', 0, 2.79, 1, 1, NULL, 0, NULL, 'Weizenmehl 550', 'Für unser Weizenmehl 550 verwenden wir besten demeter-Weizen. In unserer eigenen Mühle wird das Getreide in mehreren Schritten mit größter Sorgfalt und Fingerspitzengefühl zu diesem besonders vielseitig verwendbaren, hellen Mehl vermahlen.  \n\nDu fragst Dich, was den Unterschied zwischen einer Industriemühle und einem Handwerksbetrieb wie der Spielberger Mühle ausmacht? Es sind allem voran die Menschen, die hier mit großer Sorgfalt arbeiten. Denn unsere Mühle ist kein computergesteuerter, lebensmitteltechnologischer Prozessautomat – ohne die Menschen kann die Mühle nicht mahlen. Natürlich wird dabei auch gepumpt, gefördert, gebürstet, geschrotet und gemahlen. Mit Maschinen und Lärm und genau gesteuerten Abläufen. Aber in unseren Handwerksmühlen läuft das nicht automatisiert und standardisiert. Die Müller:innen arbeiten mit handwerklichem Geschick und mit viel Fingerspitzengefühl um diesen aufwändigen, komplexen Prozess der Müllerei zu steuern. Um Mehl von erstklassiger Qualität zu erhalten, verwenden sie dabei alle Sinne: An den Vibrationen im Gebäude spüren die Müller:innen, ob die Mühle richtig läuft. Sie hören jede noch so kleine Abweichung vom Soll. Mit Händen, Augen und Nase prüfen sie die Qualität. Sie fühlen und sehen ob das Mehl die richtige Struktur hat. Am aromatischen Duft erkennen sie, ob die Arbeit gelungen ist.', 'Spielberger GmbH', 'Spielberger Mühle', 'GERMANY', '4cd7b44f-37e0-4a27-a1e9-8af2e459dd4f', 'manager', '2022-03-22 10:03:40', 'System', '2024-02-14 02:07:42', 2135, 1963, 2, NULL, 0, 1.67, 'Weiling', 0, NULL, 0, 64, 'WEIZENmehl 550** **aus biodynamischer Erzeugung', '2022-11-29 17:08:10', 1386, 'BAKING_INGREDIENTS', 'PANTRY', 1014.4, 22, 'VEGAN;VEGETARIAN;RAWFOOD', NULL, NULL),
(2071, 'Fetacreme mit Manouri & Bärlauch (Weiling)', '4065626115121', 0, 2.79, 1, 1, NULL, 0, NULL, 'Fetacreme mit Manouri & Bärlauch', 'Cremig-streichfähige Fetacreme aus Schaf- und Ziegenkäse mit Bärlauch.', 'Weiling GmbH', 'bioladen', 'GERMANY', '97cf9cf1-ffe4-4921-86e6-69a2f30b316a', 'manager', '2022-03-22 10:06:15', 'System', '2023-03-04 02:07:16', 2136, 1964, 0, NULL, 0, 1.69, 'Weiling', 0, NULL, 0, 64, 'SCHAF* UND ZIEGENKÄSE (83%  -  52 % Feta*, 31 % Manouri*),  Sonnenblumenöl*, Bärlauch** (6%), Meersalz *aus kontrolliert ökologischer Erzeugung', '2022-06-06 10:06:51', 424.175, 'GOURMET_CONVENIENCE', 'FRESH', 120, 9.5, 'VEGETARIAN', NULL, NULL),
(2072, 'Quinoa Vital Bowl to go (Weiling)', '4260148657115', 0, 6.39, 1, 1, NULL, 0, NULL, 'Quinoa Vital Bowl to go', 'Blattsalat? So einfach machen wir uns nicht! Unsere Vital-Bowls sind wahre Nährstoff-Helden. Bei allen Sorten achten wir auf eine balancierte Komposition aus Hülsenfrüchten, Kohlgemüse und \"Superfoods\". Zusammen mit unseren feinen Dressing, genießt du eine super leckere und gesunde Bowl, die dich lange satt hält. Tipp: Mit etwas frischem Zitronensaft beträufeln. Das Vitamin C der Zitrone verbessert die Aufnahme von wertvollen Nährstoffen!', 'PUR Bio Feinkost Manufaktur GmbH & Co. KG', 'PUR Bio-Manufaktur', 'GERMANY', 'fc5db470-3971-4d62-9a9a-7b3028ba161a', 'manager', '2022-03-22 10:09:02', 'System', '2023-02-24 02:08:34', 2138, 1965, 0, NULL, 0, 3.91, 'Weiling', 0, NULL, 0, 67, '47%Quinoa-Mix* (54%Quinoa*, Kichererbsen*, 8%CASHEWS*, Sonnenblumenöl*, Meersalz), 17% Rote Betesalat* (77 % gegarte Rote Bete*, Zwiebeln*, Apfelessig*, Sonnenblumenöl*, 2 % gerösteter SESAM*, roter Balsamico* (Rotweinessig*, konzentrierter Traubenmost*), Rapsöl*, Meersalz, Rohrohrzucker*, Maisquellstärke*, getrocknete Petersilie*, weißer Pfeffer*), Möhren-Apfelsalat* (62 % Möhren*, 19 % Äpfel* (Ascorbinsäure*), Apfelessig*, Sonnenblumenöl*, Rohrohrzucker*, Ingwer*, Meersalz, Maisquellstärke*), 19 % Sesamdressing* (Trinkwasser, 10,5 % SESAM*, Sonnenblumenöl*, Agavendicksaft*, Zitronensaft*, Maisquellstärke*, SESAMÖL*, Tamari* (SOJA*), Paprika*, Meersalz, Cayenne*) *aus kontrolliert ökologischer Erzeugung', '2023-02-13 23:06:54', 929.5, 'GOURMET_CONVENIENCE', 'FRESH', 370, 13, 'VEGAN;VEGETARIAN', NULL, NULL),
(2073, 'Sonnenblumenöl nativ, 0,5l (Weiling)', '3445020210706', 0, 4.99, 1, 1, NULL, 0, NULL, 'Sonnenblumenöl nativ, 0,5l', 'Erste kalte Pressung. Reich an Vitamin E.\nErntefrische Bio-Sonnenblumenkerne, leicht angeschält und einmal kalt gepresst, ergeben ein naturbelassenes mildes Öl mit sanft-gelber Färbung. Es ist ein vielseitiges Öl und besonders geeignet für Salate, Rohkost und zum Abschmecken von warmen Gerichten.', 'Huilerie Moog SAS', 'BIO PLANÈTE', 'FRANCE', '6fdb8aac-5cc4-4022-b10f-eb2f21c366d4', 'manager', '2022-03-22 10:10:47', 'System', '2024-02-08 02:06:42', 2137, 1966, 0, NULL, 0, 3.13, 'Weiling', 0, NULL, 0, 52, NULL, '2024-02-02 02:06:50', 1161.88, 'OIL_VINEGAR_SAUCES', 'PANTRY', 764, 27.5, 'VEGAN;VEGETARIAN;RAWFOOD;PALMOILFREE', NULL, NULL),
