(2093, 'Vollkorn-Knäckebrot mit Dinkel (Weiling)', '4024297007852', 0, 2.39, 1, 1, NULL, 0, NULL, 'Vollkorn-Knäckebrot mit Dinkel', 'Kross, luftig, lecker: Das Vollkorn-Knäckebrot mit Dinkel von Naturata überzeugt durch seinen einzigartigen knusprigen Biss und seinen herzhaften Roggengeschmack. Die knusprig-leichte Brot-Alternative schmeckt sowohl herzhaft als auch süß belegt. \n\nBesonders kross gebacken - ausschließlich aus hochwertigen Demeter-Zutaten. Für den perfekten Genuss!', 'Naturata AG', 'NATURATA', 'GERMANY', 'd7da2048-64f7-43cb-9062-c33c361cd682', 'manager', '2022-03-25 06:52:11', 'System', '2024-02-15 02:07:26', 2160, 1967, 2, NULL, 0, 1.81, 'Weiling', 0, NULL, 0, 60, 'ROGGENVOLLKORNMEHL**, DINKELVOLLKORNMEHL** (eine WEIZENART) 6 %, DINKELFLOCKEN** (eine WEIZENART) 5 %, Meersalz **aus biodynamischer Erzeugung', '2022-09-10 00:04:34', 1344, 'BREAD_BUNS', 'PASTRY', 262, 16, 'VEGAN;VEGETARIAN', NULL, NULL),
(2094, 'Kinderzahnbürste rot', '4260397790113', 1, 3.9, 1, 1, NULL, 0, NULL, 'Kinderzahnbürste rot', 'Eine Zahnbürste, die Euch dabei hilft Euren Plastikverbrauch stark zu reduzieren. Mit einem biologisch abbaubaren Griff aus dem schnell nachwachsenden Rohstoff Bambus. Borsten mit hervorragenden Putzeigenschaften aus dem nachwachsenden Rohstoff Rizinusöl. Nachhaltig und 100% vegan!\r\nWir verwenden konsequent ökologische Naturfarben in Zusammenarbeit mit AURO.', 'wasserneutral GmbH', 'HYDROPHIL', 'CHINA', '0a5db338-4adc-44a6-9e14-7600bf1e4f93', 'manager', '2022-03-25 07:11:40', 'manager', '2023-02-02 20:45:06', 2161, 1968, NULL, NULL, 0, 1.5, NULL, 0, NULL, 0, NULL, NULL, '2023-02-02 20:45:06', 140.4, 'BODY_CARE;BABY_BODY_CARE', 'DRUGSTORE;BABY', NULL, 19.5, NULL, NULL, NULL),
