(2097, 'Rote u. Grüne Paprikaglocken gefüllt (Weiling)', '4260634281121', 0, 3.99, 1, 1, NULL, 0, NULL, 'Rote u. Grüne Paprikaglocken gefüllt', 'Green Goodies, wir produzieren die Frische im Antipasti Bereich. \nGeniessen Sie unsere roten & grünen Bio Paprika-Glocken gefüllt mit Frischkäse. \nDie Paprika-Glocken für unsere Bio-Antipasti beziehen wir von unseren Bauern aus dem Mittelmeer Raum. \nDen Bio-Frischkäse für die Füllungen aus dem Allgäu und unser Rapsöl von einer Bio-Ölmühle aus Deutschland. \nUnsere Antipasti werden dann Stück für Stück von Hand gefüllt.\nIdeal als mediterrane Vorspeise oder als Beilage zu Gegrilltem, zu Raclette und zu Fondue. ', 'Green Goodies Food GmbH', 'Green Goodies Food ', 'GERMANY', 'a5861419-9c89-42ed-aa40-8180aae48489', 'manager', '2022-03-25 10:41:10', 'System', '2023-03-16 02:07:39', 2164, 2015, 0, NULL, 0, 2.85, 'Weiling', 0, NULL, 0, 65, '53 % Frischkäse Doppelrahmstufe (Milch*; Milchsäurekulturen; mikrobielles Lab); 34 % eingelegte Paprika-Glocken (Paprika-Glocken*; Speisesalz; Säuerungsmittel: Citronensäure; Essig*); Rapsöl* *aus kontrolliert ökologischer Erzeugung', '2022-07-12 14:03:08', 596.16, 'GOURMET_CONVENIENCE', 'FRESH', 170, 13.8, 'VEGETARIAN;WITHOUT_ADDED_SUGAR', NULL, NULL),
