(2115, 'Weizenmehl 1050 demeter (Weiling)', '4022381202183', 0, 2.79, 1, 1, NULL, 0, NULL, 'Weizenmehl 1050 demeter', 'Für unser Weizenmehl 1050 verwenden wir besten demeter-Weizen. In unserer eigenen Mühle wird das Getreide in mehreren Schritten mit größter Sorgfalt und Fingerspitzengefühl zu diesem mittelhellen Mehl vermahlen, das noch viele wertvolle Bestandteile des Korns enthält.  \n\nDu fragst Dich, was den Unterschied zwischen einer Industriemühle und einem Handwerksbetrieb wie der Spielberger Mühle ausmacht? Es sind allem voran die Menschen, die hier mit großer Sorgfalt arbeiten. Denn unsere Mühle ist kein computergesteuerter, lebensmitteltechnologischer Prozessautomat – ohne die Menschen kann die Mühle nicht mahlen. Natürlich wird dabei auch gepumpt, gefördert, gebürstet, geschrotet und gemahlen. Mit Maschinen und Lärm und genau gesteuerten Abläufen. Aber in unseren Handwerksmühlen läuft das nicht automatisiert und standardisiert. Die Müller:innen arbeiten mit handwerklichem Geschick und mit viel Fingerspitzengefühl um diesen aufwändigen, komplexen Prozess der Müllerei zu steuern. Um Mehl von erstklassiger Qualität zu erhalten, verwenden sie dabei alle Sinne: An den Vibrationen im Gebäude spüren die Müller:innen, ob die Mühle richtig läuft. Sie hören jede noch so kleine Abweichung vom Soll. Mit Händen, Augen und Nase prüfen sie die Qualität. Sie fühlen und sehen ob das Mehl die richtige Struktur hat. Am aromatischen Duft erkennen sie, ob die Arbeit gelungen ist.', 'Spielberger GmbH', 'Spielberger Mühle', 'GERMANY', '694d8fcc-e75b-46cc-9d4d-885e6a8ace09', 'manager', '2022-04-01 10:40:50', 'System', '2024-02-14 02:07:45', 2191, 1974, 2, NULL, 0, 1.67, 'Weiling', 0, NULL, 0, 64, 'WEIZENmehl 1050** **aus biodynamischer Erzeugung', '2023-02-02 09:17:21', 1386, 'BAKING_INGREDIENTS;PASTA_CEREALS_LEGUMES', 'PANTRY', 1014.4, 22, 'VEGAN;VEGETARIAN;RAWFOOD', NULL, NULL),
(2116, 'Yogi Tea® Lakritz Bio (Weiling)', '4012824400160', 0, 3.69, 1, 1, NULL, 0, NULL, 'Yogi Tea® Lakritz Bio', 'Süß, ausgleichend, erfüllend.\n \nSüßholz hilft uns auf angenehme Weise „runterzukommen.” Wenn der ganze Tag aus Telefonieren, Kommunikation, schnellem Denken und Unterwegssein besteht, beruhigt und erdet eine gesunde, natürliche Süße. Die Gewürze im Tee lassen uns unseren Körper wieder spüren. Wir entschleunigen. Ingwer, Orangenschalen und andere orientalische Gewürzgeheimnisse vervollkommnen diesen besonderen Tee zu einem wahrhaftigen Geschmackserlebnis.', 'YOGI TEA GmbH', 'YOGI TEA', 'ITALY', '115f7d0b-f24c-454f-bd5b-e76021683489', 'manager', '2022-04-01 10:41:36', 'manager', '2023-03-21 11:54:27', 2184, 1975, 0, NULL, 0, 2.09, 'Weiling', 0, NULL, 0, 62, 'Süßholz* (38%), Zimt*, Orangenschalen* (8%), Ingwer*(5%), Kardamom* (4%), geröstete Zichorienwurzel*, Nelken*, Orangenöl*, schwarzer Pfeffer*, Vanilleextrakt*. *aus kontrolliert ökologischer Erzeugung', '2023-03-21 11:54:27', 585, 'TEA', 'COFFEE_TEA_COCOA', 65, 12, 'VEGAN;VEGETARIAN', NULL, NULL),
