(2126, 'Energie-Taler (Weiling)', '4026584133206', 0, 3.49, 1, 1, NULL, 0, NULL, 'Energie-Taler', 'Der feine Taler auf Basis von Vollkornreis wird durch Zucchini, Karotte und Tofu besonders lecker und saftig. Knackige Sonnenblumenkerne, edler Sesam und frische Sprossen sorgen für das gewisse Etwas.', 'organic veggie food GmbH', 'SOTO', 'GERMANY', '8a53b774-d386-4d17-b5ef-8dc34a7906f6', 'manager', '2022-04-08 12:34:27', 'System', '2023-12-14 02:08:01', 2198, 1981, 0, NULL, 0, 2.14, 'Weiling', 0, NULL, 0, 61, 'Vollkornreis* (27%), Zucchini* (16%), Tofu* (16%) (Wasser, SOJABOHNEN*, Festigungsmittel: Nigari), Karotten* (16%), DINKELFLOCKENMEHL*, HAFERFLOCKEN*, Sonnenblumenkerne*, Buchweizenmehl*, Mungbohnensprossen* (2%), Sonnenblumenöl*, SESAM* (1%), Salz, Gewürze* *aus kontrolliert ökologischer Erzeugung', '2022-11-29 16:08:32', 984.375, 'GOURMET_CONVENIENCE', 'FRESH', 261.5, 17.5, 'VEGAN;VEGETARIAN', NULL, NULL),
(2127, 'Ratatouille-Ecken (Weiling)', '4026584130816', 0, 3.99, 1, 1, NULL, 0, NULL, 'Ratatouille-Ecken', 'Inspiriert von der provenzalischen Küche Frankreichs spielen in unseren Knusperecken Ratatouille die beliebtesten Zutaten der Provence die Hauptrolle: Auberginen, Tomaten, Paprika, Zucchini und Olivenöl, verfeinert mit sonnenverwöhnten Kräutern, machen die Ecken zu einem fruchtigen Genuss im Dinkelteig.', 'organic veggie food GmbH', 'SOTO', 'GERMANY', '66558ac3-200f-4058-ae66-4dedeeabd2a2', 'manager', '2022-04-08 12:36:13', 'System', '2023-12-14 02:09:22', 2199, 1982, 0, NULL, 0, 2.7, 'Weiling', 0, NULL, 0, 61, 'Füllung: Auberginen* (10%), Weißkraut* (8%), Tomatenmark*, Vollkornreis*, Karotten* (6%), Maisgrieß*,  roter Paprika* (5%), Zucchini* (4%), Zwiebeln* (4%), Mais* (3%), Olivenöl*, Salz, Gewürze*, Rübenzucker*\n\nTeig: Wasser, DINKELMEHL* (20%), Sonnenblumenöl*, Salz *aus kontrolliert ökologischer Erzeugung', '2022-10-29 02:03:10', 984.375, 'GOURMET_CONVENIENCE', 'FRESH', 261.5, 17.5, 'VEGAN;VEGETARIAN;PALMOILFREE', NULL, NULL),
