(2129, 'Maximum Shine Shampoo Soothing Lavender (Weiling)', '5701058006567', 1, 7.59, 1, 1, NULL, 0, NULL, 'Maximum Shine Shampoo Soothing Lavender', 'Das Maximum Shine Shampoo reinigt und pflegt matt aussehendes, glanzloses Haar. Bio-Lavendelöl verleiht dem Haar maximalen Glanz, glättendes Bio-Brokkolisamenöl sorgt für einen natürlichen Anti-Frizz-Effekt. TUNE IN - finde Ruhe jeden Tag mit Soothing Lavender. Beruhigender, wohltuender und rein natürlicher Duft des Lavendel. - Shampoo für maximalen Glanz - mit Bio-Brokkolisamenöl und Bio-Lavendelöl - mit Inhaltsstoffen zu 99% natürlichen Urspungs - 100% vegan und tierversuchsfrei (Veganblume) - mit dem entspannenden, natürlichen Lavendelduft Entdecke weitere Pflegeprodukte der Mindful Beauty Kollektion Tune In | Soothing Lavender: Genieße Momente der Achtsamkeit und eine Auszeit für Körper und Geist durch den beruhigenden, wohltuenden und rein natürlichen Lavendelduft. Das macht Produkte von Urtekram besonders: - dänische, zertifizierte Natur- und Biokosmetik nach Ecocert Cosmos Organic Standard - 100% vegan und tierversuchsfrei (Veganblume) - ohne Mikroplastik, Parabene und synthetische Konservierungsstoffe - mit 100% biologisch abbaubaren Inhaltsstoffen - pflanzenbasierte Verpackung aus Zuckerrohrabfällen', 'Midsona Deutschland GmbH', 'Urtekram', 'Ascheberg, NRW', NULL, 'manager', '2022-04-08 16:54:56', 'System', '2023-07-01 00:16:53', 2201, NULL, NULL, NULL, 0, 4.03, 'Weiling', 1, 1, 0, NULL, 'Wasser, Aloe Vera-Extrakt*, Kokoszuckertenside, Tensid aus natürlichem Kokosöl und Palmkernöl, Glycerin**, Traubenzucker, polymerisiertes Glycerin, Kochsalz, Diglyzerin, Brokkolikernöl*, Kamillenöl*, Eukalyptusöl*, Lavendelblütenextrakt*,Lavendelöl*, Lavandinöl*, Rosmarinöl*, Weidenrindenextrakt*, Fermentationsprodukt der Milchsäurebakterien, Beta-Sitosterol, Natriumsalz der Hyaluronsäure, Lipid auf Kokosbasis, Squalan (geruchsneutrales, pflanzliches Öl), Guarkernmehl, Milchsäure, Vitamin E, Natronlauge, Parfum, Linalool (natürlicher Bestandteil ätherischer Öle). (* = Inhaltsstoff aus biologischem Anbau, ** = aus biologischen Produkten gewonnen)', '2023-02-27 13:58:19', 449.973, 'BODY_CARE', 'DRUGSTORE', NULL, 17.3, 'VEGAN;VEGETARIAN', NULL, NULL),
