(2135, 'Premium Pfefferschinken', '4031829234198', 0, 5.49, 1, 1, NULL, 0, NULL, 'Premium Pfefferschinken', 'Über 4 Monate im handwerklichen Naturreifeverfahren ohne Nitritpökelsalz gereift und mit Pfeffer gewürzt, entwickelt der Ökoland Premium Pfefferschinken seinen unverfälschten und pikanten Geschmack. Nur bester Schweineschinken wird hierfür verarbeitet, alles unter strengen Qualitätskontrollen. Bioland-zertifiziert. Ohne Nitritpökelsalz und andere Zusatzstoffe hergestellt. Von Natur aus glutenfrei, laktosefrei, natürliche Hefenbildung durch Fermentation. Innovative Verpackung aus Polypropylen (PP) bewirkt hohe Recyclebarkeit für die Kreislaufwirtschaft von Verpackungsmaterialien.', 'Ökoland GmbH Nord', 'ÖKOLAND', 'GERMANY', 'd8ec9bec-1b44-41ac-b7b2-858e2ee94a17', 'manager', '2022-04-12 09:45:23', 'System', '2023-12-13 02:06:01', 2205, 2001, 1, NULL, 0, 3.71, NULL, 0, NULL, 0, 61, 'Schweinefleisch*, Meersalz, Pfeffer*, Schweinegelatine*, Roh-Rohrzucker*. *aus kontrolliert ökologischer Erzeugung', '2022-04-12 10:00:26', 476, 'SAUSAGE', 'FRESH', 87.5, 23.8, 'GLUTENFREE;LACTOSEFREE;PALMOILFREE', NULL, NULL),
