(2137, 'Edel Bitter Chili 70% Cacao', '4044889000733', 0, 2.79, 1, 1, NULL, 0, NULL, 'Edel Bitter Chili 70% Cacao', 'Der Edel Kakao ´Arriba´ (direkt von Kleinbauern-Cooperativen) macht die Schokolade zu einem einzigartigen Geschmackserlebnis: charaktervolles Aroma in wunderbarer Harmonie mit einem unglaublichen Schmelz. Getrocknete Chilischoten sorgen für eine feurig-scharfe Note.', 'EcoFinia GmbH', 'Vivani', 'GERMANY', '9081e37f-92b4-4046-a3c2-7d6847ff31db', 'manager', '2022-04-16 06:50:14', 'System', '2023-01-16 19:36:20', 2206, 2003, 0, NULL, 0, 1.62, NULL, 0, NULL, 0, 67, 'Kakaomasse*, Roh-Rohrzucker*, Kakaobutter*, Chili*(getrocknet). \nKakao: 70% mindestens. \nKann Bestandteile von SCHALENFRÜCHTEN, MILCH und GLUTEN enthalten. *aus kontrolliert ökologischer Erzeugung', '2022-07-12 14:20:35', 139.048, 'SWEETS', 'SNACKS', 114, 19.1, 'VEGAN;VEGETARIAN;KOSCHER', NULL, NULL),
