(2158, 'Weisswein Essig ungefiltert (Weiling)', '4015533049606', 0, 4.99, 1, 1, NULL, 0.15, NULL, 'Weisswein Essig ungefiltert', 'Seit vier Generationen glauben wir als Demeter und Bio-Pionier an ein Leben im Einklang mit der Natur. Ihre Vielfalt schenkt uns die Früchte und Inspiration für unsere köstlichen Säfte. Mit unserer gemeinwohlorientierten Stiftung setzen wir uns deshalb für ihren Erhalt und eine enkeltaugliche Landwirtschaft ein.', 'Voelkel GmbH', 'Voelkel', 'GERMANY', 'e8df8817-19fb-4c6a-b9d3-a360aa1c135d', 'manager', '2022-04-27 10:09:08', 'manager', '2023-02-27 11:35:38', 2227, 2014, NULL, NULL, 0, 3, 'Weiling', 0, NULL, 0, NULL, 'Weissweinessig** **aus biodynamischer Erzeugung', '2023-02-27 11:35:38', 1697.55, 'OIL_VINEGAR_SAUCES', 'PANTRY', NULL, 27.2, NULL, NULL, NULL),
