(2160, 'Rapsöl nativ heimisch 0,5l (Weiling)', '4260355580497', 0, 6.39, 1, 1, NULL, 0, NULL, 'Rapsöl nativ heimisch 0,5l', '\"Während die Nachfrage nach Bio-Produkten hierzulande kontinuierlich steigt, stagniert das Wachstum der ökologischen Anbaufläche in Deutschland. Um den Bedarf zu decken, werden Bio-Produkte daher zum großen Teil aus dem Ausland importiert, obwohl der Anbau vieler Rohstoffe auch bei uns machbar wäre.\nDie BIO PLANÈTE Serie »Aus gutem Grund« ist eine Initiative für die Stärkung und Erweiterung der ökologischen Landwirtschaft in Deutschland, die über das übliche Maß an Transparenz hinausgeht. Sie umfasst Bio-Produkte aus deutscher Herkunft, für die die Bauern einen Preis bekommen, der die Kultivierung dieser Ölsaaten für sie langfristig attraktiv macht und somit einen Schritt in Richtung mehr Bio-Landwirtschaft in Deutschland bedeutet. Denn nur eine biologische Bewirtschaftung der Ackerflächen ist eine moderne Landwirtschaft und ein zukunftsfähiges Modell.\n\"', 'Ölmühle Moog GmbH', 'BIO PLANÈTE', 'GERMANY', '65a47281-268e-4119-afa9-6b59521b4c20', 'manager', '2022-04-27 19:39:44', 'System', '2023-12-17 02:57:11', 2228, 2016, 0, NULL, 0, 3.76, 'Weiling', 0, NULL, 0, 63, NULL, '2023-05-02 12:27:57', 1161.88, 'OIL_VINEGAR_SAUCES', 'PANTRY', 760, 27.5, 'VEGAN;VEGETARIAN;RAWFOOD', NULL, NULL),
