(2162, 'Nockerl Bärlauch (Weiling)', '4000915101157', 0, 3.99, 1, 1, NULL, 0, NULL, 'Nockerl Bärlauch', 'Ein schnelles Kartoffelgericht ganz ohne waschen, schälen und schneiden. Nockerl sind kleine Kartoffelbällchen aus Italien, hergestellt aus ganzen vorgekochten Kartoffeln. Anders als bei den allgemein am Markt befindlichen Gnocchi, die aus Kostengründen hauptsächlich aus Kartoffelmehl und Wasser bestehen.', NULL, 'Bio Verde', NULL, 'f42a903a-9a27-4bcd-bc20-e279351ae39a', 'manager', '2022-04-28 18:56:11', 'System', '2023-09-24 02:12:50', 2230, 2018, 1, NULL, 0, 2.72, 'Weiling', 0, 0, 0, 108, NULL, '2022-10-29 00:02:03', 925.38, 'GOURMET_CONVENIENCE', 'FRESH', 410, 19.4, 'VEGETARIAN', NULL, NULL),
(2163, 'basis sensitiv Cremedusche (Weiling)', '4021457648429', 1, 4.79, 1, 1, NULL, 0, NULL, 'basis sensitiv Cremedusche', 'Erlebe das lavera Gefühl natürlich pflegender Reinigung: \nDie gut verträgliche pH-hautneutrale Formel unserer Cremedusche mit milden Tensiden reinigt besonders sanft und schont dabei deine Hautflora. Zusätzlich sorgt der klassisch-frische basis sensitiv Duft  für einen wohltuenden Duschgenuss.\n\n- Schont die Hautflora\n- Gute Hautverträglichkeit\n- Für trockene & sensible Haut geeignet\n\nMit Bio-Aloe Vera und Bio-Mandelöl\n\nBio-Aloe Vera wird aufgrund ihrer hautpflegenden Eigenschaften bei Produkten für sensible Haut eingesetzt.\nBio-Mandelöl wird für seine nährenden und feuchtigkeitsbewahrenden Eigenschaften geschätzt.\n\nUnser Versprechen:\n- Biologisch abbaubare Rezepturen ohne Mineralöle und ohne künstliche Duft-, Farb- und Konservierungsstoffe*\n- Zertifiziert nach dem strengen, unabhängigen NATRUE Naturkosmetikstandard. Verträglichkeit dermatologisch bestätigt\n- Kunststoff dieser Flasche inkl. Verschluss aus 100 % recyceltem Material\n- Nach PETA-Kriterien zertifiziert und für das Tierwohl engagiert\n- Exklusive Naturkompositionen aus der\nlavera-Forschung, mit dem Besten aus der Natur\n\nwww.lavera.de \n\n* gem. EU-Kosmetik VO\n\n\nlavera. Natur, die du fühlst', 'Laverana GmbH & Co.KG', 'lavera', 'Hannover, Niedersachsen', '8d6b969a-861c-4988-9bdd-fa065d3bc4c8', 'manager', '2022-04-29 08:21:59', 'System', '2023-10-20 02:09:25', 2231, 2019, NULL, NULL, 0, 2.59, 'Weiling', 1, 1, 0, NULL, NULL, '2022-05-23 15:04:31', 559.832, 'BODY_CARE', 'DRUGSTORE', 288.29, 19.8, 'VEGAN;VEGETARIAN', NULL, NULL),
(2164, 'Pflegedusche Erfrischend (Weiling)', '4021457648443', 1, 4.49, 1, 1, NULL, 0, NULL, 'Pflegedusche Erfrischend', 'Erlebe das lavera Gefühl erfrischender Duschmomente:\nDie pH-hautneutrale Formel unseres Duschgels mit milden Tensiden reinigt besonders sanft und schont dabei deine Hautflora. Zugleich verwandelt der zitrisch-spritzige Limettenduft deine tägliche Dusche in ein erfrischendes Wohlfühlerlebnis.\n\n- Schont die Hautflora\n- Zitrisch-spritziger Limettenduft\n- Auch für trockene & sensible Haut geeignet\n\nMit Bio-Limette und Bio-Zitronengras\n\nBio-Limette erfrischt mit ihrem spritzigen Duft die Sinne.\nBio-Zitronengras ist für seine reinigende und erfrischende Wirkung bekannt.\n\nUnser Versprechen:\n- Biologisch abbaubare Rezepturen ohne Mineralöle und ohne künstliche Duft-, Farb- und Konservierungsstoffe*\n- Zertifiziert nach dem strengen, unabhängigen NATRUE Naturkosmetikstandard. Verträglichkeit dermatologisch bestätigt\n- Kunststoff dieser Flasche inkl. Verschluss aus 100 % recyceltem Material\n- Nach PETA-Kriterien zertifiziert und für das Tierwohl engagiert\n- Exklusive Naturkompositionen aus der lavera-Forschung, mit dem Besten aus der Natur\n\nwww.lavera.de \n\n* gem. EU-Kosmetik VO\n\n\nlavera. Natur, die du fühlst', 'Laverana GmbH & Co.KG', 'lavera', 'Hannover, Niedersachsen', '599980f0-6842-4a6d-ab9d-257ad57f0a5f', 'manager', '2022-04-29 08:24:37', 'System', '2024-02-07 02:11:33', 2232, 2020, NULL, NULL, 0, 2.59, 'Weiling', 1, 1, 0, NULL, NULL, '2022-05-23 16:50:27', 559.832, 'BODY_CARE', 'DRUGSTORE', 303.84, 19.8, 'VEGAN;VEGETARIAN', NULL, NULL),
(2165, 'Tofu Basilico (Weiling)', '4012359114204', 0, 3.29, 1, 1, NULL, 0, NULL, 'Tofu Basilico', 'Der Tofu Basilico von Taifun steckt voller frischer Kräuter. Die feine Basilikumnote setzt Akzente sowohl in der kalten als auch in der warmen mediterranen Küche. \n\nWürfeln oder in Scheiben schneiden. Hervorragend im Tomatensalat. Lecker auch zu Brot oder eingelegt als Antipasti genießen. Angebraten als Beilage zu Gemüsegerichten.', 'Taifun-Tofu GmbH', 'Taifun', 'Baden-Württemberg', 'e6d568e5-124e-4c8a-9012-14b9c5b5e466', 'manager', '2022-04-29 08:28:41', 'System', '2024-02-06 02:12:43', 2233, 2021, 0, NULL, 0, 2.27, 'Weiling', 0, NULL, 0, 64, 'Tofu* 88% (SOJABOHNEN* 55%, Wasser, Gerinnungsmittel: Magnesiumchlorid, Calciumsulfat), Olivenöl extra vergine*, Basilikum* 4,2%, Gemüsebrühe* (Meersalz, Hefeextrakt*, Sonnenblumenöl*, Lauch*, Karotten*, SELLERIE*, Macis*, Muskatnuss*, Petersilie*), Bärlauch*, Petersilie*. *aus kontrolliert ökologischer Erzeugung', '2022-11-10 10:26:12', 325, 'VEGAN_VEGETARIAN', 'FRESH', 211.5, 13, 'VEGAN;VEGETARIAN;LACTOSEFREE', NULL, NULL),
