(2173, 'Hühnerfrikassee (Weiling)', '4031829255100', 0, 5.49, 1, 1, NULL, 0, NULL, 'Hühnerfrikassee', 'Zartes Hühnerfleisch mit Reis und Champignons in einer hellen Sauce. Tiefgefroren. Für die Ökoland Tiefkühlgerichte werden ausschließlich hochwertige Bio-Zutaten verwendet. Das Gemüse wird erntefrisch eingefroren. Durch ein modernes und schonendes Herstellungsverfahren wird das Kochen enorm erleichtert. Die Zutaten werden dabei mit den Kräutern und Gewürzen so gemischt, dass sie die Gerichte unter Zugabe von wenigen Esslöffeln Wasser oder Öl in ca. 6 - 10 Minuten servierfertig garen können.', 'Ökoland GmbH Nord', 'ÖKOLAND', 'GERMANY', '11df688d-a129-4b15-b1f5-b2e393793b0d', 'manager', '2022-05-06 01:42:18', 'System', '2023-03-27 02:03:51', 2240, 2025, 0, NULL, 0, 3.32, 'Weiling', 0, NULL, 0, 63, '41% Reis* gegart (Wasser, Reis*, Speisesalz), 15 % Gemüse* - in veränderlichen Gewichtsanteilen (Karotten*, Erbsen*), 15% Hühnerfleisch* gegart, 14% Champignons*, SAHNE*, Maisstärke*, Meersalz, Reismehl*, Zitronensaft*, Gewürze* (Muskat*, Pfeffer*, Curcuma*, Knoblauch*), Roh-Rohrzucker*, Hühnerfett*. *aus kontrolliert ökologischer Erzeugung', '2022-11-29 16:24:20', 1225, 'OTHER', 'OTHER', 479, 17.5, 'PALMOILFREE', NULL, NULL),
