(2175, 'Süsses Lakritz (Weiling)', '8713576163186', 0, 3.29, 1, 1, NULL, 0, NULL, 'Süsses Lakritz', 'ZOO ist Lakritz mit einem schönen Biss und einem mittleren süßen Geschmack.  Was du schmeckst, ist echte Bio-Qualität. Leckere vegane Lakritz, von der man  wirklich nicht lassen kann. Obwohl ZOO Lakritz wie Zootiere geformt ist, ist  diese Lakritz zu 100% pflanzlich. So kann Jung und Alt dieses süße Bio-Lakritz  genießen!  Probiere auch unsere anderen 14 Arten von Lakritz!', 'TerraSana Natuurvoeding BV', 'TerraSana', 'ITALY', '8198afd6-e903-4333-8e43-94f6da7b581d', 'manager', '2022-05-09 20:08:40', 'manager', '2023-03-02 13:00:46', 2242, 2026, 0, NULL, 0, 1.95, 'Weiling', 0, NULL, 0, 1644, 'Rohrohrzucker*, Verdickungsmittel: Gummiarabikum*, Glukosesirup*, Süßholzwurzelextrakt* 6%, natürliche Aromastoffe: Anisextrakt* und Minzeextrakt*, Holunderbeerextrakt* *aus kontrolliert ökologischer Erzeugung', '2023-03-02 13:00:46', 320, 'SWEETS', 'SNACKS', 107, 20, 'VEGAN;VEGETARIAN;GLUTENFREE', NULL, NULL),
