(2183, 'Delikatess Geflügel-Bratwürstchen (Weiling)', '4031829230640', 0, 4.99, 1, 1, NULL, 0, NULL, 'Delikatess Geflügel-Bratwürstchen', 'Die Ökoland Geflügel-Bratwürstchen werden aus reinem Bio Puten- und Hähnchenfleisch hergestellt und in Delikatess Qualität angeboten. Dank einer ausgefeilten Rezeptur unter Verwendung von Sonnenblumenöl, geschmackvollen Gewürzen und einem hohen Fleischanteil schmecken sie so ausgezeichnet gut. Hochwertiges Bio-Fleisch bedeutet, dass unsere Bio-Bauern konsequent für eine artgerechte Haltung und gesunde Fütterung der Tiere sorgen.', 'Ökoland GmbH Nord', 'ÖKOLAND', 'GERMANY', '6ecd1566-1df3-4b56-ae8d-eb14d53b9a37', 'manager', '2022-05-12 14:33:56', 'System', '2023-12-12 02:06:44', 2248, 2028, 4, NULL, 0, 3.08, 'Weiling', 0, NULL, 0, 63, '63% Geflügelfleisch* (Pute*, Huhn*), 17% Sonnenblumenöl*, Trinkwasser, Geflügelhaut*, Meersalz, Gewürze* (Pfeffer*, Zwiebel*, Piment*), Majoran*, Schafsaitling. *aus kontrolliert ökologischer Erzeugung', '2022-11-29 16:14:43', 494, 'MEAT_FISH;SAUSAGE', 'FRESH', 186, 19, 'GLUTENFREE;LACTOSEFREE;PALMOILFREE;WITHOUT_ADDED_SUGAR', NULL, NULL),
