(2190, 'Pizzateig Backmischung Gf (Weiling)', '4022381033879', 0, 2.79, 1, 1, NULL, 0, NULL, 'Pizzateig Backmischung Gf', 'Glutenfreie Pizza zu backen ist schwierig? Nicht mit unserer Backmischung für glutenfreien Pizzateig. Ganz einfach zubereitet ist der Pizzateig genauso lecker wie beim Lieblingsitaliener.  \n\nUnd das Beste: Mit unseren Backmischungen vermeidest du Müll und hilfst der Natur, denn\nDu vermeidest Plastik: Kein Plastikinnenbeutel, sondern eine Verpackung aus 100% Papier.\nDu vermeidest Verpackungsmüll: Keine Faltschachtel, dadurch im Schnitt weniger als die Hälfte des Verpackungsmülls im Vergleich zu Backmischungen mit Faltschachtel. ', 'Spielberger GmbH', 'Spielberger Mühle', 'GERMANY', '6f3f34ff-dede-4657-bb63-5c8e0e3d4f05', 'manager', '2022-05-17 08:28:56', 'System', '2023-11-29 02:08:25', 2252, 2031, 0, NULL, 0, 1.69, 'Weiling', 0, NULL, 0, 64, 'Reis-Vollkornmehl*, Maisstärke*, Hirsemehl*, Weinstein-Backpulver* (Säuerungsmittel: Monokaliumtartrat, Backtriebmittel: Natriumhydrogencarbonat, Maisstärke*), Meersalz, Würzhefeflocken* (Melassehefe*, Reismehl*, Meersalz), Johannisbrotkernmehl*, Flohsamenschalen gemahlen* *aus kontrolliert ökologischer Erzeugung', '2022-06-09 02:05:05', 760, 'OTHER_PASTRY', 'PASTRY', 360, 19, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(2191, 'Sonnenblumenöl nativ 0,5L (Weiling)', '4260355580473', 0, 5.49, 1, 1, NULL, 0, NULL, 'Sonnenblumenöl nativ 0,5L', 'Während die Nachfrage nach Bio-Produkten hierzulande kontinuierlich steigt, stagniert das Wachstum der ökologischen Anbaufläche in Deutschland. Um den Bedarf zu decken, werden Bio-Produkte daher zum großen Teil aus dem Ausland importiert, obwohl der Anbau vieler Rohstoffe auch bei uns machbar wäre.\nDie BIO PLANÈTE Serie »Aus gutem Grund« ist eine Initiative für die Stärkung und Erweiterung der ökologischen Landwirtschaft in Deutschland, die über das übliche Maß an Transparenz hinausgeht. Sie umfasst Bio-Produkte aus deutscher Herkunft, für die die Bauern einen Preis bekommen, der die Kultivierung dieser Ölsaaten für sie langfristig attraktiv macht und somit einen Schritt in Richtung mehr Bio-Landwirtschaft in Deutschland bedeutet. Denn nur eine biologische Bewirtschaftung der Ackerflächen ist eine moderne Landwirtschaft und ein zukunftsfähiges Modell.', 'Ölmühle Moog GmbH', 'BIO PLANÈTE', 'GERMANY', 'be6c0235-4db8-4960-859a-e2b78d6255cb', 'manager', '2022-05-17 08:38:53', 'System', '2023-12-17 02:55:23', 2253, 2032, 0, NULL, 0, 3.42, 'Weiling', 0, NULL, 0, 63, NULL, '2022-11-29 16:58:07', 1161.88, 'OIL_VINEGAR_SAUCES', 'PANTRY', 759, 27.5, 'VEGAN;VEGETARIAN;RAWFOOD', NULL, NULL),
