(2199, 'MozzaVella Kugel (Weiling)', '7640166798453', 0, 2.79, 1, 1, NULL, 0, NULL, 'MozzaVella Kugel', '«MozzaVella» ist eine echte Innovation, denn es ist die erste vegane Mozzarella-Kugel in Lake auf dem Markt. Hergestellt auf Mandel- und Haferbasis ist sie eine rein pflanzliche Alternative für Veganer und Kunden, die weniger Milchprodukte konsumieren wollen. «MozzaVella» lässt sich wie ein klassischer Mozzarella verwenden – in der kalten Küche für die Zubereitung von Insalata Caprese und anderen Rohköstlichkeiten, in der warmen Küche für Pasta, Pizza und Aufläufe. Oder als Belag für Snacks wie Panini, Pita-Brote und Sandwiches. Der kulinarischen Kreativität sind keine Grenzen gesetzt.\n\n«MozzaVella» ist dabei nicht nur etwas für eingefleischte Veggies. Auch Konsumenten, die unter Laktoseintoleranz, Glutensensitivität oder Zöliakie leiden, können dieses Produkt bedenkenlos in ihre Ernährung integrieren, da es frei von Laktose und Gluten ist. Zur Herstellung werden ausschließlich Rohstoffe aus kontrolliert biologischem Anbau verwendet.', 'Züger Frischkäse AG', 'Züger Frischkäse AG', 'SWITZERLAND', '954b14c2-529a-4511-8994-7fc0e0c4f01c', 'manager', '2022-05-17 15:53:07', 'System', '2023-09-07 03:52:42', 2260, 2035, 0, NULL, 0, 1.81, 'Weiling', 0, NULL, 0, 298, 'Wasser (Schweiz), 13% MANDELmehl*(Spanien, Vereinigte Staaten von Amerika), Kokosfett* (Indien, Sri Lanka), Rapsöl* (Niederlande),\n0,5% fermentiertes Hafermehl* glutenfrei (Europäische Union), Salz (Schweiz), Säuerungsmittel:\nMilchsäure E270; Verdickungsmittel: Xanthan E415, Johannisbrotkernmehl* E410,\nNatriumalginat E401 *aus kontrolliert ökologischer Erzeugung', '2022-11-07 10:01:05', 1062.72, 'VEGAN_VEGETARIAN', 'FRESH', 203.4, 16.4, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE;WITHOUT_ADDED_SUGAR', NULL, NULL),
(2200, 'Creme Duo Pudding vegan (Weiling)', '4260289420579', 0, 2.19, 1, 1, NULL, 0, NULL, 'Creme Duo Pudding vegan', 'Das cremige Haferdessert von THE VEGAN COW ist die perfekte Kombination aus einer veganen Hafercreme, kräftigen Haselnüssen und Schokolade in zwei Schichten', 'THE VEGAN COW GmbH', 'THE VEGAN COW', 'SWITZERLAND', '258fcae6-648c-4507-803b-893008134e28', 'manager', '2022-05-17 15:58:49', 'System', '2023-09-07 03:53:39', 2261, 2036, 0, NULL, 0, 1.28, 'Weiling', 0, NULL, 0, 298, 'Wasser, Rohrohrzucker*, Wachsmaisstärke*, HAFERMEHL* fermentiert 5,1%, HASELNUSSPASTE* 2,5%, Kokosfett*, Kakaopulver* 0,8%, Geliermittel (Agar-Agar*), Speisesalz, Vanilleextrakt*.\n *aus kontrolliert ökologischer Erzeugung', '2023-09-07 03:53:39', 319.484, 'VEGAN_VEGETARIAN;PRESERVED_MILK_DRINKS', 'FRESH', 131, 8.6, 'VEGAN;VEGETARIAN', NULL, NULL),
