(2203, 'Wheaty Lyoner Art mit Paprika (Weiling)', '4032277010150', 0, 2.39, 1, 1, NULL, 0, NULL, 'Wheaty Lyoner Art mit Paprika', 'Fleischwurst ohne Fleisch: Dieser Aufschnitt schmeckt wie Paprika-Lyoner! Der einzige Unterschied: Er ist rein pflanzlich. Auf Basis von Erbseneiweiß, herrlich fruchtig-frisch durch Paprikastücke in allen drei Farbvarianten. Perfekt auf Brot, für die kalte Platte oder im veganen Wurstsalat.', 'TOPAS GmbH', 'Wheaty', 'GERMANY', '85430bdb-d85a-4868-823b-57de9980b98f', 'manager', '2022-05-17 16:17:21', 'System', '2023-11-04 02:14:14', 2264, 2038, 0, NULL, 0, 1.41, 'Weiling', 0, NULL, 0, 61, 'Trinkwasser, 15 % Paprika*, ölsäurereiches (High-Oleic) Sonnenblumenöl*, 6% Erbsenprotein*, Verdickungsmittel (Xanthan und Johannisbrotkernmehl*), Speisesalz, Gewürze*, Zwiebeln*, Hefeextrakt*, färbendes Lebensmittel (Konzentrat aus Rettich* und Karotte*). *aus kontrolliert ökologischer Erzeugung', '2023-03-14 11:24:40', 394.875, 'VEGAN_VEGETARIAN', 'FRESH', 88, 22.5, 'VEGAN;VEGETARIAN', NULL, NULL),
(2204, 'Black Forest Tofu (Weiling)', '4012359113306', 0, 3.49, 1, 1, NULL, 0, NULL, 'Black Forest Tofu', 'Sanft geräuchert und mit Kümmel, Zwiebeln und Kräutern verfeinert - der Black Forest Tofu schmeckt so richtig nach Wald- und Hüttenabenteuer. Zur Freude von Allergikern wird diese Räuchertofuspezialität zudem mit der glutenfreien Sojasoße Tamari abgerundet. \n\nMit seiner würzigen Note passt der Black Forest Tofu sowohl kalt zur Brotzeit als auch angebraten zu Gemüsegerichten. ', 'Taifun-Tofu GmbH', 'Taifun', 'Baden-Württemberg', 'c4791fc6-a1a6-40de-b0e5-0d1b8f66a9ee', 'manager', '2022-05-17 16:19:49', 'System', '2023-07-01 00:19:08', 2265, 2039, 0, NULL, 0, 2.32, 'Weiling', 0, NULL, 0, 64, 'Tofu* 91% (SOJABOHNEN* 55%, Wasser, Gerinnungsmittel: Magnesiumchlorid, Calciumsulfat), Sojasauce Tamari* (SOJABOHNEN*, Wasser, Meersalz, Reiswein Mirin* [Reis*, Wasser]), Zwiebeln*, Kümmel*, Petersilie*, Buchenholzreiberauch. *aus kontrolliert ökologischer Erzeugung', '2022-09-30 00:01:40', 325, 'VEGAN_VEGETARIAN', 'FRESH', 219.6, 13, 'VEGAN;VEGETARIAN', NULL, NULL),
