(2206, 'Veganer Grobian (Weiling)', '4032277011317', 0, 4.49, 1, 1, NULL, 0, NULL, 'Veganer Grobian', 'Eine grobe Wurst mit einer Würzung, die Charakter hat. Keine Chemie, nur Biozutaten, mit einem Aroma, dank dem sich diese vegane Spezialität vielfältig einsetzen lässt, ob gegrillt, gebraten oder als Kochbeilage in einer Suppe oder im Kohleintopf.”', 'TOPAS GmbH', 'Wheaty', 'GERMANY', 'fc910ac0-ffa9-4464-a4c2-31cfd38fdaf1', 'manager', '2022-05-19 18:34:48', 'System', '2023-09-07 03:34:52', 2267, 2040, 0, NULL, 0, 2.67, 'Weiling', 0, NULL, 0, 61, '70 % Seitan* (Wasser, WEIZENeiweiß*), ölsäurereiches (High-Oleic) Sonnenblumenöl*, Wasser, WEIZENeiweißtexturat* (WEIZENeiweiß*, WEIZENmehl*), Hefeextrakt*, Erbsenprotein*, Zwiebeln*, Steinsalz, Gewürze*, färbendes Lebensmittel (Konzentrat aus Rettich* und Karotte*), Verdickungsmittel: Agar Agar*, Johannisbrotkernmehl*, Buchenholzrauch. *aus kontrolliert ökologischer Erzeugung', '2023-04-10 20:18:28', 426.3, 'VEGAN_VEGETARIAN', 'FRESH', 153, 17.5, 'VEGAN;VEGETARIAN', NULL, NULL),
(2207, 'Thai Chili Sauce Gastroline (Weiling)', '4030917019808', 0, 15.99, 1, 1, NULL, 0, NULL, 'Thai Chili Sauce Gastroline', 'Sanchon Thai Chili Sauce, eine süßlich-pikante Komposition roter Chilis und feiner Gewürze, ist mit ihrem typisch thailändisch harmonischen Geschmack die ideale Ergänzung zu Fingerfood, zum Grillen oder als Tischgewürz.', 'Petersilchen GmbH', 'Sanchon', 'GERMANY', 'ffa0b679-7da8-4d54-802e-5bb1b1c00b2b', 'manager', '2022-05-19 18:46:08', 'System', '2023-09-26 02:34:28', 2275, 2041, 0, NULL, 0, 10.75, 'Weiling', 0, NULL, 0, 67, 'Wasser, Rohrohrzucker*, 17% Paprikaschoten*\n(Chili*, Paprika* in veränderlichen Gewichtsanteilen), Branntweinessig*, Tapiokastärke*, Meersalz, Ingwer*, Knoblauch*,  Verdickungsmittel:\nGuarkernmehl* *aus kontrolliert ökologischer Erzeugung', '2022-11-29 15:35:43', 1534.08, 'OIL_VINEGAR_SAUCES', 'PANTRY', 1217, 18.8, 'VEGAN;VEGETARIAN;PALMOILFREE', NULL, NULL);
