(2214, 'Zartbitterschokolade 92 % (Weiling)', '4260485630109', 0, 2.99, 1, 1, NULL, 0, NULL, 'Zartbitterschokolade 92 %', 'Mehr Kakao geht kaum! Ganze 92% Kakaoanteil hat diese vegane Bio-Zartbitterschokolade und dadurch einen sehr geringen Zuckeranteil. Da soll noch einmal jemand behaupten, Schokolade wäre nicht gesund!', 'fairafric AG', 'fairafric', 'GHANA', 'c1665039-1b2d-4985-9d7f-b3971d85c4e0', 'manager', '2022-05-24 11:06:14', 'System', '2023-12-09 03:52:49', 2748, 2043, 0, NULL, 0, 1.76, 'Weiling', 0, NULL, 0, 588, 'Rohrohrzucker*, Kakaobutter*, Kakaomasse*. *aus kontrolliert ökologischer Erzeugung', '2023-03-02 13:57:11', 115.182, 'SWEETS', 'SNACKS', 92, 16.2, 'VEGAN;VEGETARIAN', NULL, NULL),
(2215, 'b*Walnusskerne halbe (Weiling)', '4035626111140', 0, 3.29, 1, 1, NULL, 0, NULL, 'b*Walnusskerne halbe', 'Die Walnüsse kommen aus Moldawien. Im Geschmack sind sie herb-nussig mit leicht bitterem Ton. Sie können perfekt für Backwaren verwendet werden. (Es handelt sich bei der Ware um Hälften.)\n', 'Weiling GmbH', 'bioladen', 'GERMANY', '0c7b07ec-4120-49c7-8734-bb88bb148948', 'manager', '2022-05-24 11:13:37', 'System', '2023-11-08 02:12:30', 2482, 2044, 0, NULL, 0, 1.86, 'Weiling', 0, NULL, 0, 72, NULL, '2023-04-01 15:23:34', 455.625, 'OTHER', 'OTHER', 104, 13.5, 'VEGAN;VEGETARIAN', NULL, NULL),
