(2217, 'Sauce Hollandaise Roggenkamp (Weiling)', '4260520781223', 0, 3.99, 1, 1, NULL, 0, NULL, 'Sauce Hollandaise Roggenkamp', 'Eine echte Holländische Soße (in der französischen Küche Sauce Hollandaise genannt) ist wohl die vielseitigste klassische Soße überhaupt. Unsere Sauce Hollandaise besteht aus einfachen, natürlichen Zutaten und wird traditionelle mit Butter und Ei aufgeschlagen.', 'Roggenkamp Dairy GmbH', 'Roggenkamp Organics', 'Gütersloh, Nordrhein-Westfalen', 'bf4885d0-5cc3-4c6c-9b2f-c85ad6d44af3', 'manager', '2022-05-24 20:54:47', 'System', '2023-01-16 19:41:26', 2277, 2046, 0, NULL, 0, 2.65, 'Weiling', 2, 1, 0, 62, NULL, '2022-05-24 20:56:04', 990, 'GOURMET_CONVENIENCE', 'FRESH', 210, 18, 'VEGETARIAN', NULL, NULL),
