(2219, 'Wheaty Merguez Snacker (Weiling)', '4032277011164', 0, 1.29, 1, 1, NULL, 0, NULL, 'Wheaty Merguez Snacker', 'Der Merguez Snacker, mit arabischer Schärfe, die ihr Aroma nachhaltig entfaltet. Ungekühlt haltbar und ein idealer Proteinlieferant. Für Sportler, Macher und aktive Büro- und Homeofficearbeiter. Perfekt gegen den kleinen Hunger, oder als Powerschub für die nächste Herausforderung. Bio-vegan, klimafreundlich und fair in Deutschland vom Vegan-Pionier Wheaty hergestellt.', 'TOPAS GmbH', 'Wheaty', 'GERMANY', '937140b2-bdd3-460e-8f33-ad958664e5c3', 'manager', '2022-05-27 11:12:48', 'System', '2023-09-07 03:34:29', 2280, 2047, 0, NULL, 0, 0.75, 'Weiling', 0, NULL, 0, 61, '72 % Seitan* (Wasser, WEIZENeiweiß*), Zwiebeln*, ölsäurereiches (High-Oleic) Sonnenblumenöl*, Paprika rot*, Gewürze*, Hefeextrakt*, Steinsalz, Verdickungsmittel (Agar-Agar*, Guarkernmehl* und Johannisbrotkernmehl*), Buchenholzrauch. *aus kontrolliert ökologischer Erzeugung', '2023-05-05 09:34:01', 120.4, 'VEGAN_VEGETARIAN;CONVENIENCE_PRESERVES;GOURMET_CONVENIENCE', 'FRESH;PANTRY', 33, 17.5, 'VEGAN;VEGETARIAN;PALMOILFREE', NULL, NULL),
(2220, 'Allos Iss mir nicht Wurst Leberwurst (Weiling)', '4016249315894', 0, 3.29, 1, 1, NULL, 0, NULL, 'Allos Iss mir nicht Wurst Leberwurst', 'Wer den Geschmack von Wurst liebt, aber keine Wurst essen mag, für den haben wir genau das Richtige: unsere herzhaft deftigen Aufstriche nach Art einer Streichwurst. Ja, da lachen die Hühner – und Schweine und anderen Tiere. Denn unsere Aufstriche sind rein pflanzlich. Tierisch lecker wie das Original – aber eben auf Basis von Linsen! So viel guter Geschmack braucht nun einmal keine tierischen Zutaten.', 'Allos Hof-Manufaktur GmbH', 'Allos', 'GERMANY', 'd55e2cb6-6670-436e-9910-00f2e576345c', 'manager', '2022-05-27 11:14:48', 'System', '2024-02-03 02:10:24', 2281, 2048, 0, NULL, 0, 1.95, 'Weiling', 0, NULL, 0, 61, 'Wasser, Rapsöl*, braune Linsen* getrocknet (12%), Kokosfett*, Tomatenmark*, Zwiebeln*, Rauchsalz (Meersalz, Erlenholzrauch), Shii-Take Pilze* getrocknet, Agavendicksaft*, Röstzwiebeln*, Majoran*, geräuchertes Zwiebelgranulat*, geräuchertes Knoblauchgranulat*, weißer Pfeffer*, Liebstöckel*,  Thymian*, Zitronensaftkonzentrat*, Kardamom*, geräuchertes Paprikapulver*, Ingwer*, Macisblüte*, Piment*, Buchenholzrauch, Eichenholzrauch. *aus ökologischem Landbau.', '2023-05-30 10:11:12', 373.034, 'SPREADS_HONEY', 'PANTRY', 286, 7.4, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
