(2229, 'Wildblumenkäse Heumilch (Weiling)', '4026273027571', 0, 6.99, 1, 1, NULL, 0, NULL, 'Wildblumenkäse Heumilch', 'Das Bunt von Allgäuer Blumenwiesen auf bestem Bauernkäse in Bio-Qualität – was will man mehr? Der Baldauf Wildblumenkäse war einer der ersten seiner Art auf dem Käsemarkt und gerade deshalb haben unsere Affineure das schier Unmögliche geschafft, den Bio Wildblumenkäse noch zu perfektionieren. Es wird mit selbst entwickelten Kulturen gearbeitet, um den Käse dann ganze 12 Wochen lang reifen zu lassen. Auf der essbaren Naturrinde leuchtet eine bunte Mischung aus blauen Kornblumen, gelben Ringelblumenblu?ten und feinen Erdbeerblättern, die zum einzigartigen Geschmack beitragen.', 'Gebr. Baldauf GmbH & Co. KG', 'Baldauf Käse', 'Bayern, Allgäu', '6b65f864-6114-4c7c-82fc-22e40e9322c6', 'manager', '2022-06-07 10:25:02', 'System', '2023-09-07 02:51:14', 2292, 2055, 1, NULL, 0, 4.65, 'Weiling', 0, NULL, 0, 63, 'MILCH* (Heumilch g.t.S.), Salz, KÄSEREIKULTUREN, tierisches Lab, Naturrinde mit Blütenmix (Ringelblumenblütenblätter*, Erdbeerblätter*, Schabzigerklee*, Kornblumenblütenblätter*). *aus kontrolliert ökologischer Erzeugung', '2022-11-09 06:02:12', 165, 'CHEESE', 'FRESH', 186, 11, NULL, NULL, NULL),
