(2243, 'Erdnuss Break Riegel gf (Weiling)', '4022993042023', 0, 1.59, 1, 1, NULL, 0, NULL, 'Erdnuss Break Riegel gf', 'Der Riegel enthält relativ wenig verarbeitete Rohstoffe und besteht lediglich aus ganzen Erdnüssen und Honig. Es wird kein raffinierter Zucker eingesetzt. Der Riegel ist cholesterinfrei und enthält viele Ballaststoffe für eine gesunde Verdauung. Die Sorte Erdnuss ist glutenfrei, d.h. für Zöliakiekranke und auch für Weizenallergiker geeignet.', 'Schnitzer GmbH & Co. KG', 'Schnitzer GLUTENFREE', 'GREECE', '59cba9e6-feaa-421f-9ff4-2198575fd192', 'manager', '2022-06-29 11:14:41', 'System', '2023-01-16 19:42:53', 2307, 2064, 0, NULL, 0, 0.95, 'Weiling', 0, NULL, 0, 1003, '83% ERDNÜSSE*, 17% Honig* *aus kontrolliert ökologischer Erzeugung', '2023-01-16 19:42:53', 97.875, 'SWEETS', 'SNACKS', 41, 14.5, 'VEGETARIAN;GLUTENFREE', NULL, NULL),
(2244, 'Espresso Solea®, gemahlen', '4012346533308', 0, 6.79, 1, 1, NULL, 0, NULL, 'Espresso Solea®, gemahlen', 'Geschmack:\nEleganter Espresso, feinwürzig aromatisch mit feiner Crema.\nHerkunft:\nArabica-Bohnen aus dem süd- und mittelamerikanischen Hochland sowie von den Berghängen Südindiens. Mit unseren Kaffeebauern verbindet uns eine langfristige Partnerschaft.\nAnbau:\nGut geschützt unter Schattenbäumen wachsen Lebensbaum Kaffees langsam heran.  \nErnte:\nImmer von Hand. Da am Kaffeestrauch zugleich reife wie unreife Kaffeekirschen hängen, ist die Auswahl von Hand für die Qualität besonders wichtig. Für Lebensbaum Kaffees werden nur reife Kaffeekirschen gepflückt.\nRöstung:\nWir rösten langsam und nicht zu heiß. Auf diese Weise entwickeln unsere Kaffees ihr volles, ausgewogenes Aroma.', 'Ulrich Walter GmbH', 'LEBENSBAUM', 'Bio-Arabica-Bohnen aus dem peruanischen und mexikanischen Hochland', 'c0e14d64-6501-4494-bacc-7bd5beaf69b9', 'manager', '2022-07-01 16:10:01', 'System', '2023-06-26 10:08:36', 2308, 2065, 0, NULL, 0, 4.78, NULL, 0, NULL, 0, 60, '100 % Arabica*, gemahlen *aus kontrolliert ökologischer Erzeugung', '2022-11-29 15:18:59', 1113.75, 'COFFEE', 'COFFEE_TEA_COCOA', 257, 22.5, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(2245, 'Plantagen Kaffee, gemahlen', '4012346045818', 0, 8.69, 1, 1, NULL, 0, NULL, 'Plantagen Kaffee, gemahlen', 'Geschmack: Naturmild und fein aromatisch: ein sortenreiner Demeter-Arabica mit angenehm leichter Säure\n\nHerkunft: Mexiko, Sierra Madre de Chiapas - Finca Irlanda\n\nAnbau: Nach den naturnahen Methoden des biologisch-dynamischen Landbaus. In kühlen Höhenlagen reifen die Kaffeekirschen langsam heran.\n\nErnte: Von Hand. So werden nur die reifen Kaffeekirschen geerntet und sorgsam verlesen.\n\nRöstung: In Deutschlands ältester Bio-Rösterei. Die hochwertigen Kaffeebohnen werden langsam und schonend veredelt.\n\nQualität hat Herkunft - www.lebensbaum.de', 'Ulrich Walter GmbH', 'LEBENSBAUM', 'Mexiko', '8eada58d-ff91-4b2c-837f-f49762c8ae0c', 'manager', '2022-07-01 16:40:34', 'System', '2024-02-14 02:10:37', 2309, 2066, 2, NULL, 0, 5.24, NULL, 0, NULL, 0, 60, '100 % Arabica**, gemahlen **aus biodynamischer Erzeugung', '2023-05-12 11:19:05', 1064.25, 'COFFEE', 'COFFEE_TEA_COCOA', 259, 21.5, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(2246, 'Baby & Kids Sonnencreme LSF 45', '4033981732079', 1, 13.99, 1, 1, NULL, 0, NULL, 'Baby & Kids Sonnencreme LSF 45', 'Hoher Lichtschutz für zarte Baby- und Kinderhaut. Die Baby & Kids Sonnencreme LSF 45 von eco cosmetics bietet einen Breitbandschutz vor UVA - B -C . Die sanfte Creme zieht rasch ein, weißelt nicht und wirkt direkt nach dem Auftragen. Auch kleine Wasserratten sind durch die wasserfeste Formel bestens geschützt. Granatapfel*,Oliven*- und Macadamiaöl* sorgen für Feuchtigkeit und Pflege. Sanddornextrakt* und Nachtkerzenöl* schützen besonders sensible Haut. Eine natürliche Duftkomposition verleiht einen angenehmen, milden Duft.\n* Inhaltstoffe aus kontrolliert biologischem Anbau\nAbfärbung möglich.\nBeachten Sie Ihren individuellen Hauttyp.\nAusgeglichener UVA-UVB Schutz im Verhältnis 1:3', 'Eco Cosmetics GmbH & Co. KG', 'eco cosmetics', 'GERMANY', '08ddf505-fd25-4ffc-9b35-344a7131d3c7', 'manager', '2022-07-01 17:46:58', 'System', '2024-01-16 02:09:31', 2310, 2067, NULL, NULL, 0, 7.39, NULL, 0, NULL, 0, NULL, NULL, '2022-12-19 23:49:36', 242, 'BODY_CARE', 'DRUGSTORE', 102, 12.5, 'VEGAN;VEGETARIAN', NULL, NULL),
(2247, 'Body Lotion Erfrischend', '4021457637423', 1, 7.49, 1, 1, NULL, 0, NULL, 'Body Lotion Erfrischend', 'Die Body Lotion Erfrischend mit Bio-Limette & Bio-Mandelöl für normale Haut.\n\nErlebe das lavera Gefühl erfrischender Pflege:\nUnsere milde Formel mit Bio-Limette & Bio-Mandelöl schenkt deiner Haut wohltuende Feuchtigkeit und verwöhnt die Sinne mit erfrischendem Duft\n- Leichte Textur\n- Spritziger Limettenduft\n- 100 % natürlich schöne Haut\nBio-Limette kann mit seinem spritzigen Duft die Sinne erfrischen und somit eine erheiternde Wirkung erzielen.\nBio-Mandelöl wird für seine nährenden und feuchtigkeitsbewahrenden Eigenschaften geschätzt.\n\nUnser Versprechen:\n- Biologisch abbaubare Rezepturen ohne Mineralöle und ohne künstliche Duft-,  Farb- und  Konservierungsstoffe*\n- Zertifiziert nach dem strengen, unabhängigen NATRUE Naturkosmetikstandard. Verträglichkeit dermatologisch bestätigt\n- Klimaneutrale Produkte**, Kunststoff dieser Flasche inkl. Verschluss aus 100 % recyceltem Material\n- Vegan & nach PETA-Kriterien zertifiziert\n- Exklusive Naturkompositionen aus der lavera-Forschung, mit dem Besten aus der Natur\n* gem. EU-Kosmetik VO\n** ClimatePartner.com/12310-1610-1001\n\nlavera. Natur, die du fühlst\n\nMade in Germany', 'Laverana GmbH & Co.KG', 'lavera', 'Hannover - Niedersachsen', '4cc76ff7-4320-433e-9abc-ed46500b78ff', 'manager', '2022-07-01 17:50:03', 'System', '2023-10-20 02:08:27', 2311, 2068, NULL, NULL, 0, 4.59, NULL, 0, NULL, 0, NULL, NULL, '2022-12-20 00:03:46', 478.216, 'BODY_CARE', 'DRUGSTORE', 228.61, 18.1, 'VEGAN;VEGETARIAN', NULL, NULL),
