(2266, 'Tofu Curry-Mango (Weiling)', '4012359114501', 0, 3.29, 1, 1, NULL, 0, NULL, 'Tofu Curry-Mango', 'Eine raffinierte Kombination aus Curry mit Mango-Stückchen und einer dezenten Ingwer-Cayenne-Note. Optisch besticht dieses Produkt durch ein auffallendes Currygelb.\n\nSowohl kalt als auch warm verzehrbar.\nBestens geeignet zu Salaten, Reispfannen und Gemüsegerichten.', 'Taifun-Tofu GmbH', 'Taifun', 'Baden-Württemberg', 'a69618f3-b0c4-4056-ad05-830628892b48', 'manager', '2022-07-12 08:10:07', 'manager', '2023-01-26 16:56:49', 2332, 2081, 0, NULL, 0, 2.05, 'Weiling', 0, NULL, 0, 64, 'TOFU* 81% (SOJABOHNEN* 55%, Wasser, Gerinnungsmittel: Magnesiumchlorid, Calciumsulfat), Mango* 4,5%,\nLimettensaft*, Ingwer kandiert* 2,3% (Ingwer*, Rohrzucker*), Meersalz, kaltgepresstes Sonnenblumenöl*, Rübenzucker*,\nCurry* 1,2% (Kurkuma*, Koriander*, SENFKÖRNER*, Paprika scharf*, Bockshornklee*, Fenchel*, Kümmel*, Basilikum*,\nRosmarin*, Oregano*, Thymian*, Salbei*), Weißweinessig*, Reismehl*, Knoblauch*, Petersilie*, Kurkuma*, Chilli*. *aus kontrolliert ökologischer Erzeugung', '2022-12-17 12:17:39', 345.8, 'VEGAN_VEGETARIAN', 'FRESH', 218.1, 13.3, 'VEGAN;VEGETARIAN;LACTOSEFREE', NULL, NULL),
(2267, 'Getrocknete Tomaten mit frischen Kräutern (Weiling)', '4000915102222', 0, 4.79, 1, 1, NULL, 0, NULL, 'Getrocknete Tomaten mit frischen Kräutern', 'Ein Stückchen Sommer schmeckt man wenn man in die sonnengetrockneten Tomaten von bio-verde beisst. Verfeinert mit einer Spur Öl und Basilikum, unglaublich aromatisch und frisch.', 'Isana Naturfeinkost GmbH & Co. Produktions- und Handels KG', 'bio-verde', 'GERMANY', '14ee10b8-eb98-4332-9c61-299ae84ab5f1', 'manager', '2022-07-15 10:02:23', 'System', '2023-10-27 02:05:45', 2334, 2082, 0, NULL, 0, 2.89, 'Weiling', 0, NULL, 0, 64, 'getrocknete Tomaten* (93%), Meersalz, Sonnenblumenöl*,\nBranntweinessig*, Basilikum* (2%),\nOlivenöl*, Oregano* *aus kontrolliert ökologischer Erzeugung', '2022-07-15 10:03:02', 532.8, 'GOURMET_CONVENIENCE', 'FRESH', 150, 14.4, 'VEGAN;VEGETARIAN', NULL, NULL),
