(2270, 'Quinoa-Taler (Weiling)', '4026584133220', 0, 3.29, 1, 1, NULL, 0, NULL, 'Quinoa-Taler', 'Die Taler erhalten ihren ausgezeichnet nussigen Charakter durch eine feine Basis aus Quinoa, saftigen Karotten, Brokkoli und Zucchini. Sonnenblumenkerne sorgen für einen knackigen Biss. Petersilie und ein Hauch Zitrone verleihen den Talern das gewisse Etwas und eine herrlich frische Note.', 'organic veggie food GmbH', 'SOTO', 'GERMANY', '31f402f7-a635-4656-aefc-2cdede41b3ea', 'manager', '2022-07-15 10:24:03', 'System', '2023-12-14 02:07:15', 2337, 2083, 0, NULL, 0, 2.14, 'Weiling', 0, NULL, 0, 61, 'Quinoa* (29%), Karotten* (14%), Broccoli* (12%), Kichererbsenmehl*, Sonnenblumenkerne* (11%), Zucchini* (7%), Zwiebeln* (7%), Maisgrieß*, Sonnenblumenöl*, Petersilie*, Salz, Gewürze* (enthält SENF*), Zitronensaft* *aus kontrolliert ökologischer Erzeugung', '2023-01-16 19:44:28', 656.25, 'GOURMET_CONVENIENCE', 'FRESH', 206.5, 17.5, 'VEGAN;VEGETARIAN', NULL, NULL),
