(2274, 'Weleda Schönheitsdusche (Weiling)', '7611916125720', 0, 6.99, 1, 1, NULL, 0, NULL, 'Weleda Schönheitsdusche', 'Bringen Sie mit der Inspire Schönheitsdusche Granatapfel Ihre innere und äußere Schönheit in Einklang. Die Cremedusche pflegt die Haut samtweich, während ein sinnlich-femininer Duft von Orange, Davana und Vanille Ihre Sinne inspiriert. Lassen Sie sich und Ihre Phantasie von fruchtig-süßer Orange beflügeln, vom kräftig-warmen Davana in tropische Regionen entführen und von samtig-balsamischer Vanille verwöhnen. Milde Zuckertenside in der Inspire Schönheitsdusche Granatapfel reinigen die Haut besonders sanft. Zusätzlich pflegt die Cremedusche Ihre Haut mit wertvollen Ölen aus Bio-Granatapfelsamen, Bio-Macadamianüssen und Bio-Sesam. Reich an ungesättigten Fettsäuren, bewahren sie die natürliche Feuchtigkeit der Haut und schützen sie so vor dem Austrocknen – für ein samtweiches Hautgefühl. Die Hautverträglichkeit der Cremedusche ist dermatologisch bestätigt – die Rezeptur ist biologisch abbaubar (nach OECD). Tipp Das Granatapfel Regenerierende Pflege-Öl oder die Straffende Pflege Körperlotion Granatapfel sorgen nach dem Duschen für sinnliche Wohlfühlmomente.', 'Weleda AG', 'Weleda', 'SWITZERLAND', 'fd76e8bb-ebf4-4134-95d3-e42e384f3d90', 'manager', '2022-07-25 18:01:50', 'System', '2023-10-20 02:07:57', 2340, 2085, NULL, NULL, 0, 4.77, 'Weiling', 0, NULL, 0, NULL, NULL, '2022-07-25 18:02:36', 609.224, 'BODY_CARE', 'DRUGSTORE', 226.2, 17.2, 'VEGAN;VEGETARIAN', NULL, NULL);
