(2277, 'Eistee Beere 1,5 Grad (Weiling)', '4260637450371', 1, 2.29, 1, 1, NULL, 0, NULL, 'Eistee Beere 1,5 Grad', 'Auch keinen Planet B in der Tasche?\nDieser Eistee wird durch Zertifikate klimapositiv gestellt und gleicht doppelt so viel CO2 aus, wie bei seiner Produktion anfällt. Mit einskommafünfgrad  unterstützt du zukunftsweisende Klimaprojekte. Aktuell fließen unsere Ausgleichszertifikate in ein Gold-Standardzertifiziertes Brunnenbauprojekt in Afrika. klimaretter-getraenke.bio', 'Immer Bio GmbH', 'einskommafünfgrad', 'GERMANY', 'ea40f8cf-87e9-4bd5-8791-f5ead0708ee6', 'manager', '2022-08-01 11:06:42', 'System', '2023-09-07 03:33:37', 2343, 2087, 0, NULL, 0, 1.15, 'Weiling', 0, NULL, 0, 64, 'BIO Aufguss aus Schwarztee 92 % (natürliches Mineralwasser, Schwarzer Tee*1), Rübenzucker*, Aroniasaft* 3 %, Heidelbeersaft* 0,6 %, Schwarzer Johannisbeersaft* 0,5 %, Zitronensaftkonzentrat*.  *aus kontrolliert ökologischer Erzeugung', '2022-09-01 23:52:38', 969.878, 'LEMONADE', 'DRINKS', 797, 18.2, 'VEGAN;VEGETARIAN', NULL, NULL),
(2278, 'Pesto calabrese (Weiling)', '8053323644354', 0, 3.99, 1, 1, NULL, 0, NULL, 'Pesto calabrese', 'Ein schmackhaftes Pesto auf Basis von Paprika, das durch die Zugabe von Ricotta- und Schafskäse eine besonders cremige Konsistenz und einen delikaten Geschmack erhält.', 'LaSelva', 'LaSelva', 'ITALY', '2df7720b-0ba2-4d32-9dc1-064de5428000', 'manager', '2022-08-01 11:08:33', 'System', '2023-06-13 02:10:50', 2345, 2088, 0, NULL, 0, 2.4, 'Weiling', 0, NULL, 0, 102, 'Paprika* 31%, natives Olivenöl extra*, getrocknete Tomaten*, RICOTTA-KÄSE* (KUHMILCHMOLKE*, Salz, Milchsäure) 10%, SCHAFSKÄSE* (SCHAFMILCH*, Lämmerlab), Zwiebeln*, Tomatenmark zweifach konzentriert*, CASHEWNÜSSE*, Basilikum* 3%, konzentrierter Traubenmost*, Chili*, Meersalz, Säureregulator: Milchsäure. *aus kontrolliert ökologischer Erzeugung', '2022-11-29 16:44:26', 279.414, 'CONVENIENCE_PRESERVES', 'PANTRY', 235, 8.6, 'VEGETARIAN', NULL, NULL),
(2279, 'Greco Halloumi Grill- und Bratkäse, Bio - SB', '4005096027340', 0, 5.99, 1, 1, NULL, 0, NULL, 'Greco Halloumi Grill- und Bratkäse, Bio - SB', 'Halloumi ist eine jahrhundertealte Käse-Spezialität von der Insel Zypern und wird meistens aus Kuh-, Schaf- und Ziegenmilch gekäst. Sein Name setzt voraus, dass er aus dem Süden Zyperns stammen muss. Durch seine spezielle Herstellungsweise bleibt der halbfeste Bio-Schnittkäse auch beim Grillen und Braten in Form! Ein perfekter Grill- und Bratkäse also, der sich vielseitig verwenden lässt und ruck-zuck zubereitet ist. Der Koch-Kreativität sind beim Halloumi keine Grenzen gesetzt. Ob für Salate in kleine Würfel geschnitten oder als Grillspieß mit Gemüse und Zwiebeln sorgt er für unkomplizierten Käse-Genuss. Durch die Zugabe von getrockneter Minze während der Herstellung erhält der Halloumi seinen besonders feinen, frischen Geschmack. Das praktische 200g-Stück, das vor dem Grillen und Braten in Scheiben portioniert werden kann, eignet sich – vor allem in den Frühjahrs- und Sommermonaten – als umsatzstarker Artikel für das SB-Kühlregal.\n\nUnser Halloumi Grill- und Bratkäse stammt aus der Region Limassol im Süden Zyperns. Die gesamte Milch dafür wird von einem Landwirt geliefert.', 'ÖMA Beer GmbH', 'ÖMA', 'Limassol', '290bd83e-03f0-4c83-8b8b-bb182e8f2b6a', 'manager', '2022-08-02 09:37:38', 'System', '2023-09-07 03:51:58', 2346, 2089, 0, NULL, 0, 4.41, NULL, 0, NULL, 0, 26, 'KUHMILCH*, SCHAFMILCH*, ZIEGENMILCH*, Meersalz, mikrobielles Lab, Minze* 0,5% *aus kontrolliert ökologischer Erzeugung', '2022-08-02 10:00:14', 392.175, 'CHEESE', 'FRESH', 214, 10.5, 'VEGETARIAN', NULL, NULL),
(2280, 'Amaranth 500g (Weiling)', '4022381034098', 0, 3.99, 1, 1, NULL, 0, NULL, 'Amaranth 500g', 'Amaranth ist botanisch gesehen kein Getreide, kann aber in vielen Gerichten wie Getreide verwendet werden. Amaranth ist eine hochwertige Proteinquelle und von Natur aus glutenfrei. Verwenden Sie Amaranth als ganzes Korn als Beilage, in Gemüsepfannen, Aufläufen, als Suppeneinlage oder für Füllungen. Schmeckt auch in süßen Aufläufen und Gerichten.\nGemahlen eignet sich Amaranth in Mischungen für die glutenfreie Bäckerei.\nUnser Spielberger Amaranth stammt von einer Demeter-Kleinstbauern-Initiative im Norden Indiens. Hier versorgen sich mehrere hundert Landwirte vorwiegend selbst. Über eine Initiative vor Ort werden ihre Überschüsse gesammelt und gemeinsam vermarktet. Damit bekommen viele indische Bauern eine nachhaltige Chance für eine gesunde und wirtschaftliche Zukunft.  Ein tolles Projekt, das wir gerne unterstützen. ', 'Spielberger GmbH', 'Spielberger Mühle', 'GERMANY', '0ed94c12-2ab0-47d4-9483-84d19ba81810', 'manager', '2022-08-02 19:07:53', 'System', '2024-01-17 02:06:43', 2347, 2090, 2, NULL, 0, 2.42, 'Weiling', 0, NULL, 0, 64, 'Amaranth** **aus biodynamischer Erzeugung', '2023-01-16 19:44:51', 760, 'PASTA_CEREALS_LEGUMES', 'PANTRY', 510, 19, 'VEGAN;VEGETARIAN;GLUTENFREE;RAWFOOD', NULL, NULL),
