(2284, 'Sonnenblumenkerne 250g (Weiling)', '4019339405079', 0, 2.19, 1, 1, NULL, 0, NULL, 'Sonnenblumenkerne 250g', 'Diese aromatischen Sonnenblumenkerne stammen von ausgewählten Bio-Bauern in Europa.\r\nSonnenblumenkerne eignen sich besonders als Zutat für Müsli, Brot, Kuchen, Kartoffel- und Gemüsegerichte.', 'Midsona Deutschland GmbH', 'Davert', 'Ascheberg, NRW', NULL, 'manager', '2022-08-03 19:08:51', 'manager', '2023-02-27 14:56:30', 2352, NULL, 0, NULL, 0, 1.28, 'Weiling', 0, NULL, 0, NULL, 'Sonnenblumenkerne*\r\n*aus kontrolliert ökologischer Erzeugung', '2023-02-27 14:56:30', 371.475, 'MUISLI_FLAKES_NUTS', 'PANTRY', NULL, 12.7, 'VEGAN;VEGETARIAN;GLUTENFREE;HALAL', NULL, NULL),
(2285, 'Kichererbsen-Chips Rosmarin', '8711812414733', 0, 2.99, 1, 1, NULL, 0, NULL, 'Kichererbsen-Chips Rosmarin', 'Herrlich locker-knusprige Kichererbsen-Chips aus aromatischen Kichererbsen kontrolliert biologischen Anbaus. Mit 30% weniger gesättigten Fettsäuren als herkömmliche Kartoffelchips und verfeinert mit einer Prise Meersalz, aromatischem Rosmarin oder pikanter Paprika für puren Knabbergenuss.', 'Allos Hof-Manufaktur GmbH', 'De Rit', 'CZECH_REPUBLIC', '1289e35f-d186-4968-8f4a-b643686333e7', 'manager', '2022-08-05 08:54:06', 'System', '2023-11-28 02:06:59', 2353, 2094, 0, NULL, 0, 1.9, NULL, 0, NULL, 0, 27, 'Kichererbsenmehl* (38,8%), Kartoffelstärke*, Kartoffelmehl*, Sonnenblumenöl*, Meersalz, Salz, Rosmarin*, Zwiebelpulver*, Knoblauchpulver*, Liebstöckel*, schwarzer Pfeffer*. *aus kontrolliert ökologischer Erzeugung', '2023-01-02 08:39:11', 1579.5, 'SALTY', 'SNACKS', 80, 27, 'VEGAN;VEGETARIAN', NULL, NULL),
