(2288, 'Pizzaböden mit roter Bete (Weiling)', '8713576003154', 0, 5.29, 1, 1, NULL, 0, NULL, 'Pizzaböden mit roter Bete', 'Rote Bete in der Pizza? Aber klar! In diesem traditionell gefertigten  knusprigen Pizzaboden verstecken sich 35 % Rote Bete. Wenn das keine optimale  Basis ist! Mit diesem Pizzaboden sicherst du dir deine tägliche Portion Gemüse.  Und dann kommt natürlich noch dein eigener Belag dazu! Das Rezept dieses  Pizzabodens stammt von einem italienischen Chefkoch, der höchsten Wert auf die  Qualität seiner biologischen und reinen Zutaten legt. Der Pizzaboden ist schön  fest, also belege ihn, mit was immer du willst! Wenn das nicht richtig  traditionell aussieht! Also, wie wäre es mit einer Pizza-Party? Probiere auch  einmal den Pizzaboden mit Möhre und Kürbis!', 'TerraSana Natuurvoeding BV', 'TerraSana', 'ITALY', '2a8f28b6-f4ed-4984-966e-52d7d1ecc741', 'manager', '2022-08-06 11:42:56', 'System', '2023-10-06 02:05:20', 2356, 2095, 0, NULL, 0, 3.13, 'Weiling', 0, NULL, 0, 107, 'WEIZENmehl*, hydratisierte Rote Bete-Pulver* 35%, Sonnenblumenöl*, Kartoffelstärke*, Backtriebmittel: Weinsteinpulver und Backsoda, Meersalz, Erbsenprotein*, Emulgator: Sonnenblumenlecithin*, Verdickungsmittel: Guarkernmehl*, Hefe*, Gemüsekonzentrat* (Rettich* und Möhre*) *aus kontrolliert ökologischer Erzeugung', '2022-10-15 02:05:08', 1350, 'OTHER_PASTRY', 'PASTRY', 320, 30, 'VEGAN;VEGETARIAN', NULL, NULL),
