(2317, 'Datteln im Speckmantel Premium-Qualität', '4031829234068', 0, 7.99, 1, 1, NULL, 0, NULL, 'Datteln im Speckmantel Premium-Qualität', 'Die fruchtig-süßen Datteln \"Deglet Nour\" aus dem Norden Afrikas harmonieren wunderbar mit dem herzhaften Speckmantel. Der \"Ökoland Bacon Premium-Qualität\" für den Speckmantel wird über 2 Monate im handwerklichen Naturreifeverfahren ohne Nitritpökelsalz gereift und anschließend schonend geräuchert. So entwickelt er seinen unverfälschten Geschmack und ist besonders zum Erhitzen geeignet. Nur magerer Bioland-Schweinebauch aus Deutschland wird hierfür verarbeitet, alles unter strengen Qualitätskontrollen. Von Natur aus glutenfrei, laktosefrei, natürliche Hefenbildung durch Fermentation.', 'Ökoland GmbH Nord', 'ÖKOLAND', 'GERMANY', 'eedcee3a-c943-43ad-9d78-b522d0daab28', 'manager', '2022-08-12 06:12:55', 'System', '2023-12-12 02:07:23', 2387, 2109, 0, NULL, 0, 5.33, NULL, 0, NULL, 0, 61, '50% Datteln* entkernt, 50%  Premium Bauchspeck* geräuchert (Schweinefleisch*, Meersalz, Roh-Rohrzucker*, Buchenholzrauch). Veränderliche Gewichtsanteile aufgrund des natürlich schwankenden Dattelgewichts. *aus kontrolliert ökologischer Erzeugung', '2022-08-12 08:00:30', 780, 'SAUSAGE', 'FRESH', 186, 26, 'GLUTENFREE;LACTOSEFREE;PALMOILFREE', NULL, NULL),
(2318, 'basis sensitiv Body Milk Reichhaltig', '4021457637485', 1, 7.49, 1, 1, NULL, 0, NULL, 'basis sensitiv Body Milk Reichhaltig', 'Die basis sensitiv Body Milk Reichhaltig mit Bio-Aloe Vera & Bio-Sheabutter bietet 24 Stunden intensive Feuchtigkeitspflege für trockene Haut. \n\nErlebe das lavera Gefühl spürbar geschmeidiger Haut:\nUnsere milde Formel mit Bio-Aloe Vera und Bio-Sheabutter spendet trockener Haut intensive Feuchtigkeit und bietet langanhaltende Pflege.\n- Schützt vor dem Austrocknen\n- 24 h intensive Feuchtigkeit\n- 100 % natürlich schöne Haut\nBio-Aloe Vera ist ein wahres Multitalent, enthält viele unterschiedliche Wirkstoffe und ist für ihre feuchtigkeitsspendende Wirkung bekannt.\nBio-Sheabutter enthält viele wertvolle Inhaltsstoffe wie Vitamin E und wird auf Grund intensiv pflegender Eigenschaften in unseren Produkten für trockene Haut eingesetzt.\n\nUnser Versprechen:\n- Biologisch abbaubare Rezepturen ohne Mineralöle und ohne künstliche Duft-,  Farb- und  Konservierungsstoffe*\n- Zertifiziert nach dem strengen, unabhängigen NATRUE Naturkosmetikstandard. Verträglichkeit dermatologisch bestätigt\n- Klimaneutrale Produkte**, Kunststoff dieser Flasche inkl. Verschluss aus 100 % recyceltem Material\n- Vegan & nach PETA-Kriterien zertifiziert\n- Exklusive Naturkompositionen aus der lavera-Forschung, mit dem Besten aus der Natur\n* gem. EU-Kosmetik VO\n** ClimatePartner.com/12310-1610-1001\n\nlavera. Natur, die du fühlst\n\nMade in Germany', 'Laverana GmbH & Co.KG', 'lavera', 'Wennigsen, NI', '7c7e43df-710f-4d73-b586-3813d10fa73f', 'manager', '2022-08-15 09:01:18', 'System', '2024-01-03 02:06:00', 2389, 2110, NULL, NULL, 0, 4.2, NULL, 1, 1, 0, NULL, NULL, '2023-02-13 23:25:54', 559.832, 'BODY_CARE', 'DRUGSTORE', 276.42, 19.8, 'VEGAN;VEGETARIAN', NULL, NULL),
