(2333, 'Bio-Buttermilch (Weiling)', '4026367044095', 0, 1.39, 1, 1, NULL, 0, NULL, 'Bio-Buttermilch', 'Die Upländer Bauernmolkerei wurde 1996 von 18 Bio-Bäuerinnen und Bio-Bauern der Milcherzeugergemeinschaft Hessen w.V. gegründet. Mittlerweile beliefern über 100 Bio-Betriebe aus der Region unsere Molkerei.\nWir produzieren hochwertige Bio-Milchprodukte nach den strengen Richtlinien des Bioland-Verbandes. Somit sind eine artgerechte Tierhaltung und die Fütterung der Tiere mit ökologisch angebauten Futtermitteln selbstverständlich. \nBesonderen Wert legt die Upländer Bauernmolkerei auf nachhaltig faire Milchpreise, damit unsere Bio-Bäuerinnen und Bio-Bauern auf einer stabilen Basis die Existenz ihrer Betriebe auch in Zukunft sichern können.\nÜbrigens: Die Bio-Bauern liefern nicht nur die Milch, sie verarbeiten und vermarkten sie auch in eigener Regie. Die Anteile an der Upländer Bauernmolkerei GmbH werden mehrheitlich von den Bio-Bauern gehalten.', 'Upländer Bauernmolkerei GmbH', 'Upländer Bauernmolkerei', 'GERMANY', '1f4c8e47-239a-4f4a-a820-8e57f819353f', 'manager', '2022-08-23 03:08:50', 'System', '2023-11-02 02:06:36', 2405, 2118, 1, NULL, 0, 0.94, 'Weiling', 0, NULL, 0, 63, 'BUTTERMILCH*', '2022-08-23 12:20:28', 736.128, 'DAIRY_PRODUCTS_EGGS', 'FRESH', 519, 14.2, 'VEGETARIAN', NULL, NULL),
