(2352, 'Wheaty Vegane Weiße (Weiling)', '4032277002780', 0, 4.29, 1, 1, NULL, 0, NULL, 'Wheaty Vegane Weiße', 'Wheaty Weiße: Das zeitgemäße ökologische Traditionswürstchen: 100% vegane Naturkost. Traditionell gibt es in bayrischen Landen eine Weißwurst, die nur im Wasserbad in der Pelle erhitzt wird. Niemals gegrillt oder gebraten. Zuwiderhandlungen werden als Kulturvergehen betrachtet. So soll man unsere  Wheaty Weiße auch nur in der Pelle im Wasserbad erhitzen und dann geschält geniessen. Mit dem obligaten Muskat-Zitronen-Petersilie- Geschmack. Passt sehr gut zu süßem Senf. Oder umgekehrt.', 'TOPAS GmbH', 'Wheaty', 'GERMANY', 'ee2f9770-9c14-4d9c-b375-8603b1c26569', 'manager', '2022-09-02 01:16:57', 'System', '2023-08-01 08:00:41', 2423, 2132, 0, NULL, 0, 2.8, 'Weiling', 0, NULL, 0, 61, '82 % Seitan* (Wasser, WEIZENeiweiß*), ölsäurereiches (High-Oleic) Sonnenblumenöl*, Steinsalz, Hefeextrakt*, Zwiebeln*, Gewürze*, Verdickungsmittel: Guarkernmehl*, Petersilie*, Zitrone*. *aus kontrolliert ökologischer Erzeugung', '2022-11-29 17:08:26', 280, 'VEGAN_VEGETARIAN', 'FRESH', 193, 14, 'VEGAN;VEGETARIAN', NULL, NULL),
(2353, 'Münchner Weißwurst, 2 St. (Weiling)', '4030068020807', 0, 3.79, 1, 1, NULL, 0, NULL, 'Münchner Weißwurst, 2 St.', 'Brühwürstchen aus Schweine- und Kalbsfleisch, mit Petersilie verfeinert. Der bayerische Klassiker für das niveauvolle Frühstück.', 'Chiemgauer Naturfleisch GmbH', 'Chiemgauer Naturfleisch', 'GERMANY', 'f40270f7-15f2-4f60-b7b6-e98223d75383', 'manager', '2022-09-02 01:22:42', 'System', '2023-09-07 03:04:51', 2424, 2133, 4, NULL, 0, 2.69, 'Weiling', 0, NULL, 0, 61, 'Schweine- und Kalbfleisch* (70%), Schweinespeck*, Schweineschwarten*, Trinkwasser, Steinsalz, Zwiebel*, Petersilie*, Pfeffer weiß*, Muskat*, Zitronenpulver*, Schweinesaitling *aus kontrolliert ökologischer Erzeugung', '2022-09-02 01:23:30', 780, 'SAUSAGE', 'FRESH', 140, 20, NULL, NULL, NULL),
