(2355, 'Ziegenkäsebällchen Mix (Weiling)', '5412680094029', 0, 4.69, 1, 1, NULL, 0, NULL, 'Ziegenkäsebällchen Mix', 'Der Käsehersteller der Ziegenkäsebällchen war 1999 der erste Bauernhof in Belgien, der Ziegenkäse in ökologischer Qualität produzierte. In der Welt der Käsehersteller nimmt dieser Betrieb einen besonderen Platz ein. Mit ungebrochener Begeisterung, wie  in den ersten Tagen, wird in traditioneller Weise Ziegenkäse produziert.\nDie Ziegenkäsepalette \"erzählt\" die Geschichte von zwei kreativen Unternehmern aus Ostflandern, Gino und Nadine De Clercq. Angesichts ihrer Herkunft ist es nicht verwunderlich, dass sie den Weg des Agrar- und Ernährungssektors gewählt haben. Gino stammt aus einer Familie von Gewächshausbauern in der Blumengemeinde Lochristi. Er studierte Kochen. Nadine ist Teil einer Bauernfamilie. 1981 starteten sie ihre Ziegenfarm in Lochristi, weil sie sich \"einen naturnahen Job aussuchen wollten\". Sie gehen nach Frankreich, um die Kunst der Käseherstellung zu perfektionieren. Ihr Ziel war von jeher, natürliche Produkte ohne Konservierungsstoffe oder Farbstoffe in Handarbeit herzustellen.', 'Vallée Verte GmbH', 'Vallée Verte', 'Belgien Ost-Flandern', '67f2b933-538d-48db-9f8a-fc3734838db1', 'manager', '2022-09-02 01:37:43', 'System', '2023-01-16 19:49:36', 2426, 2134, 0, NULL, 0, 3.04, 'Weiling', 0, NULL, 0, 3, 'Ziegenfrischkäse* (ZIEGENMILCH* , Salz, tierisches Lab, Milchsäurekulturen), Bruschetta* (<2%) (Tomate*, Knoblauch*, Maisstärke*, Oregano*), Gartenkräuter* (<2%) (Petersilie*, Zwiebel*, Knoblauch*, Curry*   (Kurkuma* , Kreuzkümmel* , Koriander* , SENF* , Fenchel* , schwarzer Pfeffer*, roter Pfeffer* , Knoblauch*), Meerrettich*, Ingwer*, weißer Pfeffer*) *aus kontrolliert ökologischer Erzeugung', '2022-09-02 01:52:12', 387.872, 'CHEESE', 'FRESH', 112, 13.6, NULL, NULL, NULL),
(2356, 'Burrata Apulien (Weiling)', '4026913151734', 0, 3.49, 1, 1, NULL, 0, NULL, 'Burrata Apulien', 'Burrata gehört wie Mozzarella zu der Gruppe der Filata Käse, der sogenannten Brüh- und Knetkäse. Bei der Herstellung wird aus dem Filatakäse die typische Beutelform modelliert. Diese Hülle wird mit Sahne und zu Strängen gezogenem Käseteig gefüllt und wieder geschlossen. Die Sahnefüllung gibt der Burrata ihre cremige Konsistenz, daher rührt auch ihr Name: das italienische Burrata bedeutet so viel wie \'gebuttert\'. ÖMA Burrata hat eine glatte, rein-weiße Oberfläche, der Geschmack des Pasta Filata-Käses ist mild, buttrig-sahnig und leicht säuerlich frisch. Ursprung der Burrata ist die Region Apulien im Südosten Italiens. Um die frische Sahne auf dem Transport von weit abgelegenen Höfen zu konservieren, wurde diese in Mozzarella-Säckchen verpackt.', 'ÖMA Beer GmbH', 'ÖMA', 'ITALY', 'e50e8461-a5da-44d5-bf22-f975dc2ad905', 'manager', '2022-09-02 01:56:56', 'System', '2023-09-07 03:52:05', 2427, 2135, 0, NULL, 0, 2.11, 'Weiling', 0, NULL, 0, 102, 'KUHMILCH*, SAHNE*, Meersalz, Kälberlab, Säuerungsmittel: Milchsäure *aus kontrolliert ökologischer Erzeugung', '2023-01-16 19:49:38', 512.488, 'CHEESE', 'FRESH', 275.567, 9.4, NULL, NULL, NULL),
