(2358, 'Bio Badischer Federweißer rot (Weiling)', '4013584200861', 1, 4.99, 1, 1, NULL, 0, NULL, 'Bio Badischer Federweißer rot', 'Unser Federweißer/Neuer Süßer wird von uns direkt von der Presse als süßer  Traubensaft abgefüllt.\n\nDie erste Lieferung erfolgt deshalb als süßer Saft, der mit etwas Hefe versehen ist,        sodass unter normalen Bedingungen die Gärung nach zwei Tagen einsetzt. \n\nSpätere Lieferungen werden bei uns angegoren und als leicht gärender Neuer Süßer verschickt. \n', 'Friedrich Kiefer KG', 'Friedrich Kiefer', 'Kaiserstuhl', 'bea99dd3-0b46-4fdc-b7fe-ab7d90c5adc9', 'manager', '2022-09-02 02:20:58', 'System', '2023-12-17 03:09:01', 2429, 2136, 0, NULL, 0, 2.89, 'Weiling', 0, NULL, 0, 72, 'Traubenmost *aus kontrolliert ökologischer Erzeugung', '2022-11-29 15:49:31', 2431.75, 'WINE_CHAMPAGNE', 'DRINKS', 1480, 30.7, 'VEGAN;VEGETARIAN', NULL, NULL),
