(2382, 'Michele weiß, 1l (Weiling)', '4035626100175', 1, 4.99, 1, 1, NULL, 0, NULL, 'Michele weiß, 1l', 'Feiner Duft nach gelben Sommerfrüchten: Zarte Birne, Mirabelle mit einem Touch Exotik. San Isidro kann auf mehr als 50 Jahre Erfahrung im Weinbau zurückblicken und gehört zu den größten ökologischen Weinproduzenten in Spanien. San Isidro liegt in Villanueva de Alcardete in der Provinz Toledo umgeben von Weinbergen. Mit großer Sorgfalt wählen sie die Trauben für unsere Weine aus und keltern daraus fruchtig-frische Weine für jeden Tag. ', 'Weiling GmbH', 'bioladen', 'GERMANY', '1fe22dc5-8e87-4011-9a27-4fa77d54e06b', 'manager', '2022-09-09 19:18:45', 'System', '2023-10-14 02:11:44', 2453, 2148, 0, NULL, 0, 2.72, 'Weiling', 0, NULL, 0, 72, NULL, '2023-04-24 22:54:13', 2066.7, 'WINE_CHAMPAGNE', 'DRINKS', 1816.7, 30, 'VEGAN;VEGETARIAN', NULL, NULL),
(2383, 'Pesto frisch Puttanesca (Weiling)', '4000915104554', 0, 4.19, 1, 1, NULL, 0, NULL, 'Pesto frisch Puttanesca', 'Der Begriff \"Pesto\" leitet sich von dem italienischen Wort \"pestare\" ab und bedeutet \"zerstoßen, zerkleinern\". So werden für das Pesto Puttanesca getrocknete Tomaten, Oliven, Knoblauch und Peperoni  kleingehackt und mit Öl vermischt. Es entsteht eine aromatisch schmackhafte Sauce', 'Isana Naturfeinkost GmbH & Co. Produktions- und Handels KG', 'bio-verde', 'GERMANY', '86224bfd-6f65-4124-87d2-864e217a3d00', 'manager', '2022-09-09 19:32:36', 'System', '2023-01-16 19:51:17', 2454, 2149, 0, NULL, 0, 2.73, 'Weiling', 0, NULL, 0, 64, 'Grüne Oliven* (43%), Sonnenblumenöl*, getrocknete Tomaten*, schwarze Oliven* (7%), Meersalz, Olivenöl*, Knoblauch* *aus kontrolliert ökologischer Erzeugung', '2022-09-19 15:03:16', 317.625, 'GOURMET_CONVENIENCE', 'FRESH', 300, 10.5, 'VEGAN;VEGETARIAN', NULL, NULL),
(2384, 'Quark-Alternative Kräuter (Weiling)', '42438519', 0, 2.99, 1, 1, NULL, 0, NULL, 'Quark-Alternative Kräuter', 'Die erste rein natürliche, pflanzliche Quark-Alternative ohne Soja. Traumhaft cremig und erfrischend mild, dass es dem Original zum Verwechseln ähnlich schmeckt. Pur oder verfeinert mit frischen Kräutern passt unsere Quark-Alternative sowohl zum morgendlichen Müsli als auch zu Pellkartoffeln am Abend. Und dazu ist sie auch noch so gut zu dir und dem Planeten, dass selbst Kühe neidisch wären. Und weil wir nicht satt werden, dir und dem Planeten Gutes zu tun, unterstützen wir mit jedem verkauften Produkt soziale Projekte. Damit die Welt noch ein bisschen schöner und gerechter wird.', 'Whollees GmbH', 'Harvest Moon', 'AUSTRIA', '89f1b0e8-3486-499b-9ab3-fb93cffd6d85', 'manager', '2022-09-09 19:34:13', 'System', '2023-09-07 02:52:44', 2455, 2150, 0, NULL, 0, 1.6, 'Weiling', 0, NULL, 0, 0, 'Wasser, Kokosmilch* (Kokos*, Wasser), Kokosöl*, Tapiokastärke*, Favabohnenprotein*, Mandelprotein*, Petersilie*, Schnittlauch*, Zwiebel*, Knoblauch*, Meersalz, vegane Kulturen. *aus kontrolliert ökologischer Erzeugung', '2022-09-09 20:00:48', 451.086, 'VEGAN_VEGETARIAN', 'FRESH', 201.27, 9.5, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE;WITHOUT_ADDED_SUGAR', NULL, NULL),
(2385, 'Wheaty Sucuk Snacker (Weiling)', '4032277009413', 0, 1.29, 1, 1, NULL, 0, NULL, 'Wheaty Sucuk Snacker', 'Der Sucuk Snacker, 1000 & 1 Gewürze schmeicheln die Geschmacksknospen und lassen mit sanfter Schärfe von der Küche des Orients träumen. Ungekühlt haltbar und ein idealer Proteinlieferant. Für Sportler, Macher und aktive Büro- und Homeofficearbeiter. Perfekt gegen den kleinen Hunger, oder als Powerschub für die nächste Herausforderung. Bio-vegan, klimafreundlich und fair in Deutschland vom Vegan-Pionier Wheaty hergestellt.', 'TOPAS GmbH', 'Wheaty', 'GERMANY', '10aa0e7c-ced1-41c3-8b64-e565ca9ad2fb', 'manager', '2022-09-09 19:40:31', 'System', '2023-09-07 03:33:48', 2456, 2151, 0, NULL, 0, 0.75, 'Weiling', 0, NULL, 0, 61, '72 % Seitan* (Wasser, WEIZENeiweiß*), ölsäurereiches (High-Oleic) Sonnenblumenöl*, WEIZENeiweißtexturat* (WEIZENeiweiß*, WEIZENmehl*), Hefeextrakt*, Paprika*, 2 % Knoblauch*, Gewürze*, Zwiebeln*, Steinsalz, Verdickungsmittel (Guarkernmehl* und Johannisbrotkernmehl*), Säuerungsmittel: vegane Milchsäure, Paprikaextrakt*. *aus kontrolliert ökologischer Erzeugung', '2023-05-05 09:34:08', 120.4, 'GOURMET_CONVENIENCE', 'FRESH', 33, 17.5, 'VEGAN;VEGETARIAN;PALMOILFREE', NULL, NULL),
