(2401, 'Snäckebrot Schwarzkümmel Käse (Weiling)', '4005561536018', 0, 2.99, 1, 1, NULL, 0, NULL, 'Snäckebrot Schwarzkümmel Käse', 'Anders als Brot, mehr als ein Knäcke und besser als ein Snäck - eben ´Snäckebrot´! Snäckebrot schmeckt zum Frühstück, als Snäck zwischendurch und beim gemütlichen Abend mit lieben Menschen. Erhältlich in verschiedenen Geschmacksrichtungen. Für verführerische Beleg-Varianten & ideal zum Dippen & Snäcken.', 'Bohlsener Mühle ', 'Bohlsener Mühle', 'GERMANY', '41ef939f-3721-41c0-89e7-695676ed1b40', 'manager', '2022-09-20 12:01:50', 'System', '2023-09-07 03:46:06', 2472, 2162, 1, NULL, 0, 1.86, 'Weiling', 0, NULL, 0, 60, 'DINKELvollkornschrot*¹, DINKELvollkornmehl*¹, Sonnenblumenöl* 11 %, KÄSE* 7 %, HAFERvollkornflocken* geschrotet, Leinsamen*, Reismehl*, SESAM* 3 %,  Meersalz, Schwarzkümmel* 1 %, Zwiebeln getrocknet* 1 %, Hefe*, Antioxidationsmittel: Rosmarinextrakt*. *aus kontrolliert ökologischer Erzeugung', '2023-01-16 19:53:05', 1134, 'BREAD_BUNS', 'PASTRY', 216, 18, 'VEGETARIAN', NULL, NULL),
(2402, 'Feigenkonfitüre (Weiling)', '4035626100533', 0, 3.99, 1, 1, NULL, 0, NULL, 'Feigenkonfitüre', 'Die traditionelle, handwerkliche Verarbeitung in einer kleinen Manufaktur an den Hängen des Ätna bewahrt die Einzigartigkeit und Intensität von Geschmack und Duft.\nMilder Duft nach sonnengereiften Feigen mit kräftiger Fruchtsüße. Fruchtiges, weich-cremiges Geschmackserlebnis. (Fruchtig-süßes Aroma sonnengereifter Feigen.)', 'Weiling GmbH', 'bioladen', 'ITALY', 'dc040aca-78b2-4beb-a555-5685589e5588', 'manager', '2022-09-20 12:04:55', 'System', '2023-10-14 02:14:30', 2473, 2163, 0, NULL, 0, 2.48, 'Weiling', 0, NULL, 0, 98, 'Feigen*, Rohrzucker*,  Geliermittel: Pektin, Zitronensaft* *aus kontrolliert ökologischer Erzeugung', '2022-09-30 00:02:55', 359.125, 'SPREADS_HONEY', 'PANTRY', 394.7, 8.5, 'VEGAN;VEGETARIAN', NULL, NULL),
(2403, 'Risotto mit Steinpilzen (Weiling)', '4260261495014', 0, 4.99, 1, 1, NULL, 0, NULL, 'Risotto mit Steinpilzen', 'Risottos sind ein traditionell norditalienisches Gericht und bei vielen Feinschmeckern sehr beliebt als Vorspeise oder als Beilage zu einem Fleischgericht. \r\n\r\nProbieren Sie edle Steinpilze klassisch mit Arborio Reis, Zucchini, Tomate, Basilikum und Knoblauch. Mit seinem nussigen Aroma veredelt der Steinpilz jedes Gericht. \r\n \r\nDie Zubereitung ist kinderleicht und das Pilz-Risotto gelingt bestimmt. Einfach unter Rühren Flüssigkeit zugeben und schon nach 30 Minuten ist ein leckeres Essen fertig. Mit leichtem Biss, so wie es sich für ein echtes Risotto gehört. Nach Ihren persönlichen Vorlieben können Sie das Risotto mit Salz, Pfeffer und weitern Kräutern würzen. Das Tüpfelchen auf dem i ist dann noch ein kleines Stück Butter und frisch geriebener Parmesan. Natürlich sind auch unsere Pilz-Risottos in der gewohnt hohen Qualität, ohne Zusatzstoffe und alle Zutaten in Bio-Qualität.', 'Pilze Wohlrab GmbH & Co. KG', 'Pilze Wohlrab', 'GERMANY', '58aacd83-e150-4739-b56c-0fda70cb85cd', 'manager', '2022-09-20 12:07:52', 'manager', '2023-02-27 12:24:43', 2474, 2164, NULL, NULL, 0, 2.94, 'Weiling', 0, NULL, 0, NULL, NULL, '2023-08-01 11:41:40', 640, 'PASTA_CEREALS_LEGUMES;CONVENIENCE_PRESERVES', 'PANTRY', NULL, 16, 'VEGAN;VEGETARIAN', NULL, NULL),
(2404, 'Wald und Kräuter TB (Weiling)', '4012346204208', 0, 3.99, 1, 1, NULL, 0, NULL, 'Wald und Kräuter TB', 'Wie Versteckenspielen im Wald: Dieser feinherbe Kräutertee weckt Erinnerungen an Tage voller Abenteuer. Walnussblatt, Kiefernsprossen und Brombeerblatt schmecken aufregend würzig, Apfelminze und Zitronengras\nschenken spritzige Frische. Salbei und Melisse steuern Kräuterkraft bei. Auf in die Natur!', 'Ulrich Walter GmbH', 'Lebensbaum', 'Diepholz', '257457c5-95ba-41c9-9eb4-954399ab8f65', 'manager', '2022-09-20 12:10:24', 'System', '2023-07-04 02:18:19', 2475, 2165, 0, NULL, 0, 2.35, 'Weiling', 2, 1, 0, 60, NULL, '2022-11-29 15:36:41', 585, 'TEA', 'COFFEE_TEA_COCOA', 64.6, 12, 'VEGAN;VEGETARIAN;LACTOSEFREE', NULL, NULL),
(2405, 'Schokolade 50% mit Haselnüssen & Meersalz (Weiling)', '5060270123880', 0, 3.69, 1, 1, NULL, 0, NULL, 'Schokolade 50% mit Haselnüssen & Meersalz', 'Die Kombination von reichhaltiger, cremiger Milchschokolade und karamellisierten Haselnüssen + Meersalz ist unwiderstehlich. Mit 50% Kakao ist dies eine hochprozentige dunkle Milchschokoladentafel mit einem ausgeprägten Kakaogeschmack und leicht süßen sauren Noten, die aus dem Kakao stammen.\nDer Kakao dieser Tafel stammt aus Perú und der Dominikanischen Republik.', 'Chocolate and Love Limited', 'Chocolate and Love Limited', 'SWITZERLAND', '4cf0a2d1-3243-44eb-8743-ce926869b185', 'manager', '2022-09-20 12:15:12', 'System', '2023-12-09 03:40:36', 2476, 2166, 0, 0, 0, 2.26, 'Weiling', 0, NULL, 0, 298, 'Kakaomasse*, Rohrzucker*, Kakaobutter*, Caramelstücke* (10%) (Rohrzucker*, VOLLMILCHPULVER*, BUTTER*, Glukosesirup*), Vollrohrzucker*, Meersalz (0.5%), Vanilleschoten*. *aus kontrolliert ökologischer Erzeugung', '2022-11-29 16:55:01', 113.04, 'SWEETS', 'SNACKS', 80, 15.7, 'VEGETARIAN', NULL, NULL),
