(2427, 'Gouda Rucola-Pinienkerne (Weiling)', '208163', 0, 19.9, 0, 1, NULL, 0, NULL, 'Gouda Rucola-Pinienkerne', 'Junger Gouda mit Rucola und Pinienkerne. Der Rucola und die leicht gebrandete Pinienkerne erinnern einen an einen klassischen Italienischen Pesto.\r\n\r\nUnsere 200 Kühe grasen mehr als 6 Monate jährlich auf ungespritzten, kräuterreichen Weiden. Auf unser Landgut machen benutzen wir die Milch der Molkerei für unseren Biologischen Käse. Der Rucola und die leicht gebrandete Pinienkerne erinnern einen an einen klassischen Italienischen Pesto. In kombination mit den cremigen jungen Gouda ist dass ein abslouter Volltreffer.', 'Heerlijkheid Mariënwaerdt', NULL, 'Niederlande', NULL, 'manager', '2022-10-05 16:35:35', 'manager', '2022-11-20 20:53:27', 2500, NULL, 0, NULL, 0, 12.65, 'Weiling', 0, NULL, 1, NULL, 'KUHMILCH*, Salz, Mikrobielles Lab, Säurewecker, Rucola frisch*, Pinienkerne*\r\nenthält folgende allergene Zutaten: Milch\r\n*aus kontrolliert ökologischer Erzeugung', NULL, NULL, '3', NULL, NULL, NULL, NULL, NULL, NULL),
