(2431, 'Lasagne Bolognese mit Bio-Rind (Weiling)', '4260100261633', 0, 5.99, 1, 1, NULL, 0, NULL, 'Lasagne Bolognese mit Bio-Rind', '   ', 'Ökofrost GmbH', 'Biopolar', 'ITALY', '562c6368-10bd-4460-a6f7-a1e5d8b0acfa', 'manager', '2022-10-05 17:01:31', 'System', '2023-10-05 02:05:27', 2503, 2180, 0, NULL, 0, 3.79, 'Weiling', 0, NULL, 0, 103, 'MILCH*, Fleischsoße 25% [Gemüse* in veränderlichen Gewichtsanteilen (Karotten*, Zwiebeln*, SELLERIE*) , passierte Tomaten*, Rindfleisch* 17%, Tomatenmark*, Wasser, Sonnenblumenöl*, Rotwein* (enthält SULFITE), BUTTER*, Salz, Knoblauch*, Rosmarin*, Salbei*, Majoran*, schwarzer Pfeffer*, Thymian*, Chili*], HARTWEIZENGRIESS*, BUTTER*, WEIZENMEHL*, pasteurisiertes EI*, Sonnenblumenöl*, KÄSE*, Salz, Wasser, Muskat* *aus kontrolliert ökologischer Erzeugung', '2022-11-29 16:35:31', 991.23, 'OTHER', 'OTHER', 448, 19, 'WITHOUT_ADDED_SUGAR', NULL, NULL),
(2432, 'Appleritif Apfel Salz-Pomeranze & Wacholder (Weiling)', '4260086780562', 1, 9.99, 1, 1, NULL, 0, NULL, 'Appleritif Apfel Salz-Pomeranze & Wacholder', 'Der Appléritif Salz-Pomeranze & Wacholder ist mit seinem breiten Aromenspektrum eine Hommage an besonders elegante Crémants. Spritzige Bitternote trifft hier auf feine Säure und elegante Zitrusnoten. Eine Prise Salz sorgt für ein harmonisches Geschmackserlebnis und verleiht diesem Appléritif seine besondere Perlage.\n\nIm Gegensatz zu Frucht-Secco oder konventionellem alkoholfreien Sekt, hat der Appléritif ein typisches, eigenes Aromenspektrum mit einem vollfruchtigen Geschmack: denn für den Appléritif werden die Äpfel nicht vergoren!\nHeißt: der sonst im Gärprozess entstehende Alkohol muss also auch nicht entzogen werden – denn er war ja nie drin! Stattdessen wird der frische Apfelsaft behutsam verperlt und  in der Flasche mit spannenden Extrakten und Essenzen kombiniert.\nDas Ergebnis: ein vollmundig, prickelndes Geschmackserlebnis – ganz ohne Alkohol!\n\nDurch sein  besonderes Herstellungsverfahren eignet er sich sogar als Erfrischung für schwangere Frauen oder Kinder.', 'Clostermann Organics', 'Clostermann', 'GERMANY', '5bfba847-9fa5-4110-8c5a-3c5b8b641c68', 'manager', '2022-10-05 18:34:23', 'System', '2023-09-07 03:53:58', 2504, 2181, 0, NULL, 0, 5.27, 'Weiling', 0, NULL, 0, 72, 'Saft aus Bio- Äpfeln* (99%), Kohlensäure, Wacholderbeeren-Destillat*, Zitronensaftkonzentrat*. natürliche Extrakte für Tonic-Getränke*,natürliches Bitterorangen-Aromaextrakt*, Ur-Salz. *aus kontrolliert ökologischer Erzeugung', '2023-01-30 15:34:45', 1771.88, 'WINE_CHAMPAGNE;OTHER_DRINKS', 'DRINKS', 1440, 31.5, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(2433, 'Byodo Crema con \"Aceto Balsamico di Modena IGP\" (Weiling)', '4018462416020', 0, 4.49, 1, 1, NULL, 0, NULL, 'Byodo Crema con \"Aceto Balsamico di Modena IGP\"', 'Cremig, cremiger, CREMA - nur von Byodo gibt\'s den fruchtigen Balsamico-Genuss aus feinsten 100% Bio-Zutaten. Die Byodo Crema con \"Aceto Balsamico di Modena IGP\" findet sich in der handlichen 150 ml Squeeze-Flasche wieder und ist damit ideal zum Verzieren und Verfeinern geeignet. Ihr samtiger, unvergleichlicher Charakter hebt und unterstreicht den Geschmack von mediterranen Speisen.\n\nDie fruchtige Creme mit 40% Aceto Balsamico di Modena IGP kommt direkt aus Modena. Ihre samtige Konsistenz erhält sie von Maisstärke und kommt ganz ohne Xanthan aus.', 'Byodo Naturkost GmbH', 'Byodo', 'ITALY', '4483730c-08a2-430c-a620-fe9516871fa6', 'manager', '2022-10-09 12:11:09', 'System', '2023-08-08 02:06:08', 2505, 2182, 0, NULL, 0, 2.9, 'Weiling', 0, NULL, 0, 102, 'konzentrierter Traubenmost* (56,5%), Aceto Balsamico di Modena IGP* (40%) (Weinessig*, gekochter Traubenmost*), Maisstärke*. *aus kontrolliert ökologischer Erzeugung', '2023-01-02 08:41:41', 286.595, 'OIL_VINEGAR_SAUCES', 'PANTRY', 199.9, 15.5, 'VEGAN;VEGETARIAN;HALAL', NULL, NULL),
(2434, 'Kreuzkümmel (Kumin), gemahlen (Weiling)', '4012346156002', 0, 2.99, 1, 1, NULL, 0, NULL, 'Kreuzkümmel (Kumin), gemahlen', 'Kreuzkümmel hat einen aromatischen Geschmack, der beim Braten oder Rösten eine nussige Note entwickelt. Falafel oder indische Currys sind ohne Kreuzkümmel undenkbar. Sie können aber auch Suppen, Salate und Gebäck damit würzen.', 'Ulrich Walter GmbH', 'LEBENSBAUM', 'Diepholz, NI', 'f2991a65-8bac-4512-a432-5e82d7543353', 'manager', '2022-10-09 12:12:39', 'System', '2023-06-26 10:08:42', 2506, 2183, 0, NULL, 0, 2.05, 'Weiling', 2, 1, 0, 60, NULL, '2022-11-29 15:33:37', 269.5, 'SPICES_COOKING_HELP', 'PANTRY', 43, 14, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(2435, 'Pizza Verdura Bio vegan 339g', '4250073456075', 0, 5.79, 1, 1, NULL, 0, NULL, 'Pizza Verdura Bio vegan 339g', 'Bio Pizza Verdura vegan - Unverwechselbar und echt im Geschmack. Das aromatisch italienische Grillgemüse und der frische Brokkoli aus biologischem Anbau betonen auf dem knusprigen Bio-Dinkelboden das mediterrane Flair der veganen Variante. Gebacken wurde die Pizza traditionell im Holzofen.', 'followfood GmbH', 'followfood', 'ITALY', '7c543f69-3af4-4ee8-a60e-5298bbd5f8ae', 'manager', '2022-10-14 08:04:07', 'System', '2023-11-23 02:09:02', 2507, 2184, 0, NULL, 0, 3.49, NULL, 0, NULL, 0, 103, 'Zutaten: DINKELMEHL* (eine WEIZENART) 35,9%, Wasser, Tomatenpüree* 14%, marinierte Aubergine* 7,4% (gegrillte Aubergine*, Sonnenblumenöl*, Petersilie*, Salz), marinierte Zucchini* 7,4% (gegrillte Zucchini*, Sonnenblumenöl*, Petersilie*, Salz), Spinat* 5,9%, Brokkoli* 4,4%, gegrillte rote Paprika* 3%, gegrillte gelbe Paprika* 3%, natives Olivenöl* extra, Salz, Sonnenblumenöl*, Traubenzucker*, Hefe*, Zwiebeln*, schwarzer Pfeffer*. *aus kontrolliert ökologischer Erzeugung', '2023-01-30 15:06:28', 2163.2, 'PIZZA_FROZEN;OTHER', 'FROZEN;OTHER', 407, 26, 'VEGAN;VEGETARIAN', NULL, NULL),
