(2439, 'Fruchtiger Winterpunsch TB (Weiling)', '4012346542003', 0, 3.99, 1, 1, NULL, 0, NULL, 'Fruchtiger Winterpunsch TB', 'Wenn es draußen ungemütlich ist, sollte man sich die Zeit zuhause versüßen - mit Fruchtiger Winterpunsch. Johannisbeere, Holunderbeere und Feige sorgen für fruchtige Süße, Orange, Zimt und Vanille für würzigen Punschgeschmack. Tiefrot leuchtet der Früchtetee in der Tasse und bringt Farbe in die grauen Tage.', 'Ulrich Walter GmbH', 'LEBENSBAUM', 'Diepholz, Niedersachsen', '7dc955a7-b03f-4d4c-8b1d-dcd744898a49', 'manager', '2022-10-21 14:31:24', 'System', '2023-11-01 00:00:25', 2511, 2188, 0, NULL, 0, 2.35, 'Weiling', 2, 1, 0, 60, 'Apfel*, Schwarze Johannisbeere*, Hibiskus*, Hagebutte*, Holunderbeere*, Süßholzwurzel*, Orangenschale*, Rote Bete*, Honigbusch*, Feige*, Zimt*, Süßes Brombeerblatt*, Honigkraut*, Vanille* *aus kontrolliert ökologischer Erzeugung', '2022-10-21 14:31:42', 585, 'TEA', 'COFFEE_TEA_COCOA', 77.9, 12, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(2440, 'Wärmende Winterkräuter TB (Weiling)', '4012346542102', 0, 3.99, 1, 1, NULL, 0, NULL, 'Wärmende Winterkräuter TB', 'Das beste Mittel gegen Kälte und Dunkelheit - vollmundiger Rooibostee mit erlesenen Gewürzen wie Sternanis und Gewürznelke. Machen Sie es sich gemütlich, wenn Winterstürme um die Häuser pfeifen und sternenklare Nächte es richtig kalt werden lassen. Tun Sie Leib und Seele etwas Gutes.', 'Ulrich Walter GmbH', 'LEBENSBAUM', 'Diepholz, Niedersachsen', '9771d3fd-1e57-424d-8c34-732771cb0bfc', 'manager', '2022-10-21 14:33:44', 'System', '2023-01-16 19:56:17', 2512, 2189, 0, NULL, 0, 2.35, 'Weiling', 2, 1, 0, 60, 'Rooibos*,\r\nOrange*,\r\nAnis*,\r\nSüßes Brombeerblatt*,\r\nOrangenschale*,\r\nSternanis*,\r\nGewürznelke* *aus kontrolliert ökologischer Erzeugung', '2022-10-21 14:34:10', 585, 'TEA', 'COFFEE_TEA_COCOA', 64.6, 12, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(2441, 'Würziger Winterapfel TB (Weiling)', '4012346542201', 0, 3.99, 1, 1, NULL, 0, NULL, 'Würziger Winterapfel TB', 'Wie ein warmer Sonnenstrahl im Winter - auf der Basis von Apfel und Hagebutte ist dieser Früchtetee ein freundlicher Begleiter durch die kalte Jahreszeit. Exotische Gewürze wie Ingwer, Zimt und Kardamom vertreiben dunkle Wolken und wärmen von innen. Machen Sie es sich gemütlich: mit dicken Socken und Würziger Winterapfel.', 'Ulrich Walter GmbH', 'LEBENSBAUM', 'Diepholz, Niedersachsen', '4cb900d2-aaec-4cb6-9628-04abd66f5966', 'manager', '2022-10-21 14:35:11', 'System', '2023-12-02 02:09:37', 2513, 2190, 0, NULL, 0, 2.35, 'Weiling', 2, 1, 0, 60, 'Wilder Apfel* (33%), Hagebutte*, Ceylon-Zimt*, Süssholzwurzel*, Zichorienwurzel*, Cassia-Zimt*, Kardamom*, Ingwer*, Gewürznelke*, Honigblatt*, Vanille*. *aus kontrolliert ökologischer Erzeugung', '2022-10-21 14:35:25', 585, 'TEA', 'COFFEE_TEA_COCOA', 87.9, 12, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
