(2455, 'Skyr Vanille (Weiling)', '4104060030789', 0, 2.29, 1, 1, NULL, 0, NULL, 'Skyr Vanille', 'Bestkontrollierte Bio-Milch von bayerischen Kühen, die auf kleereichen, sattgrünen Wiesen grasen; die Markenkulturen L.acidophilus und B.bifidum, die überwiegend rechtsdrehende Milchsäure bilden und die durch ihre Stoffwechselförderung Ihr Wohlbefinden steigern und helfen Ihren Körper im Gleichgewicht zu halten; sind Grundlage für den ANDECHSER NATUR Geschmack. Durch die Verwendung von reinen Früchten können wir auf jegliche Aromazusätze zu 100% verzichten und lassen Sie die Natur schmecken.', 'Andechser Molkerei Scheitz GmbH', 'Andechser Natur', 'Bayern', '90966f42-d4bb-49f1-945b-82386b86ee17', 'manager', '2022-10-23 10:44:09', 'System', '2023-04-28 02:05:50', 2527, 2201, 1, NULL, 0, 1.53, 'Weiling', 0, NULL, 0, 60, 'MAGERMILCH*, Rübenzucker*, Apfelsaft* aus Apfelsaftkonzentrat*, Honig*, Bourbon-Vanilleschotenextrakt*, Verdickungsmittel: Johannisbrotkernmehl*, Guarkernmehl* und Pektin, Bourbon-Vanilleschote gemahlen*, Milchsäurekulturen. *aus kontrolliert ökologischer Erzeugung', '2022-10-23 10:44:39', 1046.9, 'CHEESE', 'FRESH', 417, 11.6, 'VEGETARIAN;GLUTENFREE', NULL, NULL),
(2456, 'Wildkräuter-Marinade (Weiling)', '4260133142374', 0, 2.59, 1, 1, NULL, 0, NULL, 'Wildkräuter-Marinade', 'Bärlauch hat in dieser Würzmischung für Marinade die Duftnase vorn. Mit Thymian, Zwiebeln und Lorbeer kommt hier einiges zusammen. Dieser Geschmacksattacke kann selbst Tofu nicht widerstehen. Einfach einpinseln und auf dem Grillrost oder in der Pfanne knusprig braten. So kommt Vielfalt auf den Grillteller.', 'Beltane Naturkost GmbH', 'Beltane', 'GERMANY', '4334b6e5-85e8-40a5-8c94-362fac6fd364', 'manager', '2022-10-23 10:48:36', 'System', '2023-10-05 02:05:56', 2528, 2202, 0, NULL, 0, 1.49, 'Weiling', 0, NULL, 0, 63, 'Steinsalz, Knoblauch*, Bärlauch*, Zwiebeln*, Koriander*, Pfeffer*, SELLERIE*, Karotten*, Kümmel*, Basilikum*, Roh-Rohrzucker*, Lorbeer*, Majoran*, Rosmarin*, Chili*, Salbei*, Thymian*, Säuerungsmittel: Zitronensäure, Zitronenöl* *aus kontrolliert ökologischer Erzeugung', '2022-12-17 12:16:41', 199.665, 'CONVENIENCE_PRESERVES;SPICES_COOKING_HELP', 'PANTRY', 44.5, 13.5, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE;PALMOILFREE', NULL, NULL),
(2457, 'Iss mir nicht Wurst Teewurst (Weiling)', '4016249315863', 0, 2.99, 1, 1, NULL, 0, NULL, 'Iss mir nicht Wurst Teewurst', 'Wer den Geschmack von Wurst liebt, aber keine Wurst essen mag, für den haben wir genau das Richtige: unsere herzhaft deftigen Aufstriche nach Art einer Streichwurst. Ja, da lachen die Hühner – und Schweine und anderen Tiere. Denn unsere Aufstriche sind rein pflanzlich. Tierisch lecker wie das Original – aber eben auf Basis von Linsen! So viel guter Geschmack braucht nun einmal keine tierischen Zutaten.', 'Allos Hof-Manufaktur GmbH', 'Allos', 'GERMANY', 'dcd047b6-c054-437a-aed0-56f941ca8507', 'manager', '2022-10-25 11:05:41', 'System', '2024-02-03 02:09:22', 2529, 2203, 0, NULL, 0, 1.95, 'Weiling', 0, NULL, 0, 61, 'Wasser, Kokosfett*, rote Linsen* getrocknet (12%), Rapsöl*, rote Paprika*, Tomatenmark*, Rauchsalz (Meersalz, Erlenholzrauch), SENF* (Wasser, SENFSAATEN*, Branntweinessig*, Meersalz, Kurkuma*, Koriander*, Paprika* edelsüß, Piment*), geräuchertes Paprikapulver*, Shii-Take Pilze* getrocknet, Agavendicksaft*, Kartoffelstärke*, Zwiebelpulver*, geräuchertes Zwiebelgranulat*, geräuchertes Knoblauchgranulat*, Röstzwiebeln*,  weißer Pfeffer*, Koriander*, Kümmel*, Macisblüte*,  Liebstöckel*, Ingwer*, Kardamom*, Zitronensaftkonzentrat*, Buchenholzrauch, Eichenholzrauch. *aus ökologischem Landbau.', '2022-10-25 11:06:50', 373.034, 'SPREADS_HONEY', 'PANTRY', 286, 7.4, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(2458, 'Vanillepudding agava (Weiling)', '4260096395657', 0, 1.29, 1, 1, NULL, 0, NULL, 'Vanillepudding agava', 'Unser Pudding lädt zum Träumen ein - mit dem vollmundigen Geschmack von Vanille und einem Hauch Meersalz lässt dich dieser Pudding dahinschmelzen.\n\nBitte noch hinzufügen: 500 ml Milch, 2 EL Zucker\n\n1. 500ml (pflanzliche**) Milch abmessen.\n2. 100ml von dieser (kalten) Milch mit Puddingpulver anrühren.\n3. Übrige Milch mit 2 EL Zucker zum Kochen bringen.\n4. Topf von der Kochstelle nehmen und angerührtes Puddingpulver einrühren.\n5. Unter ständigem Rühren nochmals kurz aufkochen.\n6. Anschließend in eine Schale geben und auskühlen lassen. \n\n**Konsistenz kann bei pflanzlicher Milch abweichen\n\nHier finden Sie mehr zu unserem Vanilleprojekt:\nhttps://www.agava.bio/blog/unser-vanilleprojekt/ ', 'Sonnentracht GmbH', 'Agava', 'GERMANY', '45489395-59ac-42d7-8765-65377b4e4989', 'manager', '2022-10-25 11:10:43', 'System', '2023-09-30 00:02:14', 2530, 2204, 0, NULL, 0, 0.81, 'Weiling', 0, NULL, 0, 60, 'Maisstärke*, Kürbispulver*, gemahlene Vanille* 0,5%, Meersalz *aus kontrolliert ökologischer Erzeugung', '2022-10-25 12:00:31', 315, 'BAKING_INGREDIENTS;CONVENIENCE_PRESERVES', 'PANTRY', 36.2, 15, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE;WITHOUT_ADDED_SUGAR', NULL, NULL),
