(2460, 'Sultaninen 250g (Weiling)', '4065626113462', 0, 2.49, 1, 1, NULL, 0, NULL, 'Sultaninen 250g', 'Unsere bioladen*Sultaninen werden nicht geschwefelt, sie sind sonnengetrocknet und geölt. Aufgrund ihres süß-saftigen Geschmacks finden sie in vielen Gerichten ihre Verwendung oder einfach als Snack für zwischendurch.\n', 'Weiling GmbH', 'bioladen', 'GERMANY', '51423b5a-3f3d-4a45-a8e4-2f80872f4bf2', 'manager', '2022-10-25 11:32:10', 'System', '2023-01-16 19:57:45', 2532, 2205, 0, NULL, 0, 1.43, 'Weiling', 0, NULL, 0, 60, 'Sultaninen (99,6%)*, Sonnenblumenöl* *aus kontrolliert ökologischer Erzeugung', '2022-10-25 11:33:11', 556.875, 'CONVENIENCE_PRESERVES;MUISLI_FLAKES_NUTS', 'PANTRY', 253, 16.5, 'VEGAN;VEGETARIAN', NULL, NULL),
(2461, 'Dinkel Vanillekipferl Kiebitzhof (Weiling)', '4250096907844', 0, 3.19, 1, 1, NULL, 0, NULL, 'Dinkel Vanillekipferl Kiebitzhof', 'Die Vanillekipferl, das Spekulatius-Gebäck und auch der Dinkel-Stollen schmecken wie Kindheitserinnerungen. Sie sind nach traditionellen Rezepten und aus hochwertigen Zutaten gebacken. Durch das Feingespür unseres Bäckermeisters entsteht eine perfekte Harmonie der Zutaten. Für die Schokoladenliebhaber bietet unser Sortiment saftige und aromatische Printen. \n\nNicht nur der Duft unserer Weihnachtsspezialitäten, sondern auch der Geschmack entführen euch in das Gefühl der Weihnachtszeit.', 'Kiebitzhof', 'Kiebitzhof', 'Gütersloh, NRW', '0834cd5f-7897-43b6-99a9-6c9ad63ed29a', 'manager', '2022-10-25 11:38:01', 'System', '2023-11-10 02:09:56', 2533, 2309, 1, NULL, 0, 2.85, 'Weiling', 2, 1, 0, 63, NULL, '2022-12-22 08:51:45', 675, 'SWEETS', 'SNACKS', 171, 18, 'VEGETARIAN;PALMOILFREE', NULL, NULL),
