(2463, 'Hummus mit sonnengetrockneten Tomaten (Weiling)', '8713576198133', 0, 4.99, 1, 1, NULL, 0, NULL, 'Hummus mit sonnengetrockneten Tomaten', 'Dieser leckere Hummus wird aus Kichererbsen, Tahin, sonnengetrockneten Tomaten  und Gewürzen hergestellt. Du kannst Hummus so vielseitig verwenden, doch das  Glas ist meist leer, bevor man weiß, wie einem geschieht! Nicht nur lecker auf  einem Cracker, sondern auch als Basis auf einer Piadina oder als Dip für  Gemüse. Möchtest du gerne immer ein Glas vorrätig haben? Das geht problemlos,  denn ungeöffnet braucht dieser Hummus nicht in den Kühlschrank.  Auch erhältlich als Hummus Original und Hummus mit Chili.', 'TerraSana Natuurvoeding BV', 'TerraSana', 'NETHERLANDS', 'd0525207-545e-4377-9485-052839dbfa84', 'manager', '2022-10-25 11:44:49', 'System', '2023-11-04 02:11:18', 2535, 2206, 0, NULL, 0, 3.07, 'Weiling', 0, NULL, 0, 120, 'Kichererbsen* 33%, Wasser, Sonnenblumenöl*, Sonnengetrocknete Tomaten* 10%, Zitronensaft*, SESAMpaste*, Reisstärke*, Paprikapulver*, Knoblauchpulver*, Kardamom*, Basilikum*, Kreuzkümmel*, Cayennepfeffer* *aus kontrolliert ökologischer Erzeugung', '2023-08-01 11:41:29', 360, 'OIL_VINEGAR_SAUCES', 'PANTRY', 307, 10, 'VEGAN;VEGETARIAN;GLUTENFREE', NULL, NULL),
