(2467, 'FESTES PFL.SHAMPOO BASIS (Weiling)', '4021457642113', 1, 6.49, 1, 1, NULL, 0, NULL, 'FESTES PFL.SHAMPOO BASIS', 'Entdecke das lavera Geheimnis natürlich wirksamer Haarpflege in fester Form:\nDie festen Pflegeshampoos von lavera Naturkosmetik sorgen für leicht kämmbares und natürlich gepflegtes Haar. \nUnd das Beste: Zertifizierte Naturkosmetik, 0% Plastik, 0% Silikone.\n\nDas gute Gefühl von zertifizierter Naturkosmetik - ohne Kompromisse.\nUnsere sorgfältig ausbalancierte Naturkomposition mit Bio-Aloe Vera und Bio-Quinoa ist besonders sanft zu empfindlicher Kopfhaut und spendet dem Haar wohltuende Feuchtigkeit.\nDie innovative Pflegeformel bietet ein sanftes Schaumerlebnis und eine leichte Kämmbarkeit - ganz ohne Silikone.\n\n3x ergiebiger als Flüssigshampoo - Unser festes Shampoo ist je nach Haarlänge und Anwendungsgewohnheit dreimal ergiebiger als Flüssigshampoo.\n\nUnser Versprechen:\n - Naturkosmetik: Zertifiziert und dermatologisch getestet\n - Rezepturen: Biologisch abbaubar, ohne Silikone, ohne festes Mikroplastik, ohne künstliche Farb- und Konservierungsstoffe*\n - Verpackung: Recycelbares Kartonmaterial aus 100% Recyclingfasern\n\"la vera\", die Wahre, engagiert sich für Klimaschutz und Tierschutz.\n\n*gem. EU-Kosmetik VO', 'Laverana GmbH & Co.KG', 'lavera', 'Hannover, Niedersachsen', 'c279b6bf-8499-4d40-a27b-e548a7c17f62', 'manager', '2022-10-27 17:17:06', 'System', '2023-10-20 02:09:52', 2539, 2209, NULL, NULL, 0, 4, 'Weiling', 1, 1, 0, NULL, NULL, '2023-01-16 19:58:08', 108.108, 'BODY_CARE', 'DRUGSTORE', 57.8, 7.8, 'VEGAN;VEGETARIAN', NULL, NULL),
