(2485, 'Kürbiskernmus mit Steinsalz (Weiling)', '8713576003482', 0, 5.79, 1, 1, NULL, 0, NULL, 'Kürbiskernmus mit Steinsalz', 'Hast du gerne etwas Gesundes auf deinem Brot, möchtest aber etwas anderes als  beispielweise Erdnussmus? Dieses geröstete Kürbiskernmus streicht sich  wunderbar und schmeckt köstlich. Du kannst es als Dip, Aufstrich oder als Basis  für eine Sauce und ein Dressing verwenden. Das Beste an diesem  Bio-Kürbiskernmus ist, dass es geschmacklich sowohl zu herzhaften als auch zu  süßen Gerichten passt. Genauso vielseitig wie Erdnussmus! Wir machen dieses  Kürbiskernmus in unserem Hause mit viel Liebe. Das schmeckst du. Probiere auch  unsere anderen Nussmuse!', 'TerraSana Natuurvoeding BV', 'TerraSana', 'NETHERLANDS', '547e1d03-8ce6-4d60-8f37-6a567a12ea6a', 'manager', '2022-11-04 13:46:19', 'System', '2023-09-07 03:10:03', 2559, 2225, 0, NULL, 0, 3.63, 'Weiling', 0, NULL, 0, 120, 'Kürbiskerne geröstet*, Steinsalz *aus kontrolliert ökologischer Erzeugung', '2023-03-10 12:50:14', 441, 'SPREADS_HONEY', 'PANTRY', 420, 9, 'VEGAN;VEGETARIAN;GLUTENFREE', NULL, NULL),
