(2487, 'Dinkel Spekulatius (Weiling)', '4250096907851', 0, 4.29, 1, 1, NULL, 0, NULL, 'Dinkel Spekulatius', 'Die Vanillekipferl, das Spekulatius-Gebäck und auch der Dinkel-Stollen schmecken wie Kindheitserinnerungen. Sie sind nach traditionellen Rezepten und aus hochwertigen Zutaten gebacken. Durch das Feingespür unseres Bäckermeisters entsteht eine perfekte Harmonie der Zutaten. Für die Schokoladenliebhaber bietet unser Sortiment saftige und aromatische Printen. \n\nNicht nur der Duft unserer Weihnachtsspezialitäten, sondern auch der Geschmack entführen euch in das Gefühl der Weihnachtszeit.', 'Wertkreis Gütersloh gGmbH', 'Kiebitzhof', 'GERMANY', '741a923d-0aac-46eb-9e6f-4e52b7beab98', 'manager', '2022-11-04 14:25:04', 'System', '2023-11-10 02:10:19', 2561, 2311, 1, NULL, 0, 2.85, 'Weiling', 0, NULL, 0, 63, 'DINKELVOLLKORNMEHL* (WEIZENart) (23 %), DINKELMEHL*  (WEIZENart) (23 %), Rübenzucker*, BUTTER*, VOLLMILCH*(5 %), Honig*(3 %), VOLLEI*,  Spekulatiusgewürze*(0,5 %), Backtriebmittel: Ammoniumbicarbonat,  Nelken* *aus kontrolliert ökologischer Erzeugung', '2023-01-16 19:59:48', 675, 'SWEETS', 'SNACKS', 171, 18, 'VEGETARIAN', NULL, NULL),
