(2492, 'FETO Natur - fermentierter Tofu', '4012359180001', 0, 3.29, 1, 1, NULL, 0, NULL, 'FETO Natur - fermentierter Tofu', 'Für die Herstellung von FETO wird Naturtofu mit veganen Joghurtkulturen fermentiert. Das verleiht ihm eine angenehm säuerliche Note.\n\nFETO lässt sich mit seinem fein-salzigen Geschmack kalt oder warm genießen. Er eignet sich hervorragend für Tofu-Neulinge, etwa mit Melone zu einem köstlichen Salat angerichtet!', 'Taifun-Tofu GmbH', 'Taifun', 'Baden-Württemberg', '9c1bcc1a-ee6b-408e-8d57-35cf8765721f', 'manager', '2022-11-04 15:44:01', 'System', '2024-02-06 02:12:41', 2567, 2229, 0, NULL, 0, 2.18, NULL, 0, NULL, 0, 64, 'TOFU* 97% (SOJABOHNEN* 55%, Wasser, Gerinnungsmittel: Magnesiumchlorid, Calciumsulfat), Meersalz, Rübenzucker*, vegane Joghurtkultur: Str. thermophilus. *aus kontrolliert ökologischer Erzeugung', '2022-11-29 16:10:36', 325, 'VEGAN_VEGETARIAN', 'FRESH', 214.8, 13, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
