(2499, 'Bergkäse g.U. 3 Monate gereift BioVomBerg (Weiling)', '208164', 0, 21.9, 0, 1, NULL, 0, NULL, 'Bergkäse g.U. 3 Monate gereift BioVomBerg', 'Von Hörner tragenden Kühen aus dem Allgäuer Hügelland.\r\n\r\nDer Bergkäse ist wie der Emmentaler ein typischer Hartkäse, der im Allgäu hergestellt wird. Kräftig und robust im Äußeren entpuppt sich der ÖMA Heumilch Bergkäse als reichhaltiger Klassiker im Geschmack. Er ist ausnehmend würzig und der feine Schmelz seines Teiges zergeht auf der Zunge. Er wird aus reinster Heumilch von Hörner tragenden Demeter-Kühen in unserer Käserei Leupolz hergestellt. Während der Reifung bei 15°C wird der Bergkäse zweimal wöchentlich gewendet und mit einer leichten Salzlake eingerieben (geschmiert). Dadurch erhält er ein pikantes Aroma und einen geschmeidigen Teig. Für die interessierten Kunden & Käseliebhaber gibt es Hintergrundinformationen und -geschichten rund um den Käse, die Landwirte und die Molkerei. Alles zusammengefasst in einem ÖMA Partnerporträt. Inmitten des Allgäuer Hügellands liegt unsere ÖMA Käserei Leupolz, die im Jahre 1960 als genossenschaftlich organisierte \'Emmentaler Käserei Leupolz\' gegründet wurde. Aufgrund der steigenden Anzahl ökologisch wirtschaftender Milchbauern in der Region wurde 1986 eine zweite, gesonderte Produktionslinie eingerichtet, auf der bis heute ausschließlich Demeter-Produkte hergestellt werden. Käsermeister Pit Pfohl und seine Mitarbeiter verarbeiten hier täglich 13.000 Liter frische Demeter-Milch zu Butter, Schnitt- und Hartkäse. Die Beliebtesten unter ihnen sind die Hartkäse-Klassiker Heumilch Emmentaler und Heumilch Bergkäse. Die 22 Demeter-Lieferlandwirte bewirtschaften ihre Höfe auf biologisch-dynamische Wirtschaftsweise. Diese zeichnet sich aus durch Vielfalt in Anbau und Tierhaltung, Entwicklung des Hofes als individuellen, lebendigen Organismus, Arbeiten im Rhythmus natürlicher Kreisläufe und kosmischer Einflüsse und gezielten Einsatz der biologisch-dynamischen Präparate. Die Hörner tragenden Milchkühe grasen im Sommer auf den kräuterreichen Allgäuer Wiesen, im Winter wird ausschließlich getrocknetes Heu und hofeigenes Getreideschrot zugefüttert.', 'Bioalpin eGen', 'Bio vom Berg', 'Österreich', NULL, 'manager', '2022-11-07 13:37:18', 'manager', '2022-11-20 20:54:37', 2575, NULL, NULL, NULL, 0, 13.7, 'Weiling', 0, NULL, 1, NULL, 'KUHMILCH*, Speisesalz, Milchsäurekulturen, mikrobielles Lab\r\nenthält folgende allergene Zutaten: Milch\r\n\r\n*aus kontrolliert ökologischer Erzeugung', '2023-03-16 22:51:58', NULL, '3', NULL, NULL, NULL, NULL, NULL, NULL),
(2500, 'Schlierbacher Ofenkäse würzig (Weiling)', '9026500003830', 0, 3.89, 1, 1, NULL, 0, NULL, 'Schlierbacher Ofenkäse würzig', 'Genießen Sie den typischen Weichkäsegeschmack mal warm und löffeln Sie den ofenheißen Bio-Käsegenuss mit Weißbrot oder Gemüsesticks. Der Käsegenuss passt auch perfekt zu Ofenkartoffeln oder frisch gegrilltem Fleisch.', 'Käserei Stift Schlierbach GmbH & Co. KG', 'Schlierbacher', 'Oberösterreich - Schlierbach', 'b975f404-b699-4423-b557-fcdb2d9d97ea', 'manager', '2022-11-07 13:39:43', 'System', '2023-12-17 02:50:58', 2576, 2231, 0, NULL, 0, 2.44, 'Weiling', 0, NULL, 0, 8, 'KUHMILCH*, Speisesalz, Lab, Rotkultur *aus kontrolliert ökologischer Erzeugung', '2023-12-17 02:50:58', 399.97, 'CHEESE', 'FRESH', 170.4, 11.5, 'WITHOUT_ADDED_SUGAR', NULL, NULL),
(2501, 'Ribeaupierre Ziege (Weiling)', '208167', 0, 34.9, 0, 1, NULL, 0, NULL, 'Ribeaupierre Ziege', 'Durch würzige Rotkulturen erhält diese Käsespezialität ihr feines Aroma, das sahnig-mild unterlegt ist. Es harmoniert perfekt mit dem dezenten Geschmack der Ziegenmilch. Für anspruchsvolle Käsegenießer.', 'Vandersterre Holland B.V.', NULL, 'Niederlande', NULL, 'manager', '2022-11-07 13:45:09', 'manager', '2023-03-09 12:34:07', 2577, NULL, 0, NULL, 0, 21.7, 'Weiling', 0, NULL, 1, NULL, 'ZIEGENMILCH* pasteurisiert, Natriumchlorid (Kochsalz), Mikrobielles (vegetarisches) Lab, Milchsäurebakterien als Starterkultur\r\nenthält folgende allergene Zutaten: Milch\r\n*aus kontrolliert ökologischer Erzeugung', '2023-05-05 13:21:21', 2500, 'CHEESE', 'FRESH', 250, 10, 'VEGETARIAN', NULL, NULL),
