(2514, 'b*Putenbrust, gekocht & geräuchert (Weiling)', '4035626000345', 0, 3.99, 1, 1, NULL, 0, NULL, 'b*Putenbrust, gekocht & geräuchert', 'Die gekochte Putenbrust ist ein traditionell hergestellter Kochschinken aus der Brust mit einem hervorragendem Geflügelaroma und einem feinen Rauchgeschmack, in Scheiben geschnitten. Das Fleisch für dieses bioladen*Produkt kommt von der Familie Heggemann aus der Dingdener Heide. Dort wachsen die Tiere ihren Bedürfnissen entsprechend auf. Das Produkt ist Bioland-zertifiziert.', 'Weiling GmbH', 'bioladen*', 'Deutschland', NULL, 'manager', '2022-11-10 10:40:54', 'manager', '2022-11-10 10:41:51', 2329, NULL, 1, NULL, 0, 2.59, 'Weiling', 0, NULL, 0, NULL, 'Putenfleisch (92,7%)*, Trinkwasser, Meersalz, Gewürze (Zwiebel, Liebstöckel, Brennnesselblätter, Majoran, Pfeffer, Macisblüte, Muskatnuss)*, Hefe*, Zitrone*, Vollrohrzucker*, Rote-Beete-Saft* (färbendes Lebensmittel), Rauch.', '2022-11-10 10:41:51', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL),
