(2572, 'Schwäbische Maultaschen mit Fleisch-Füllung (Weiling)', '4000915105179', 0, 3.79, 1, 1, NULL, 0, NULL, 'Schwäbische Maultaschen mit Fleisch-Füllung', 'Frische Maultaschen mit Fleischfüllung, fix und fertig im Ganzen. Der Klassiker in der Schwäbischen Küche, eine vollmundige Füllung aus Schweine-Hackfleisch in feinem Nudelteig.', 'Isana Naturfeinkost GmbH & Co. Produktions- und Handels KG', 'bio-verde', 'GERMANY', '9697eeea-cb2e-4399-9b71-c574aaca50d5', 'manager', '2022-11-16 11:54:46', 'System', '2023-09-24 02:09:36', 2652, 2242, 0, NULL, 0, 2.25, 'Weiling', 0, NULL, 0, 60, 'Füllung: Schweinefleisch* (20%), Trinkwasser, Semmelbrösel* (WEIZENMEHL*, Hefe*, Meersalz), Zwiebeln*, Spinat*, Speck*, VOLLEI*, Meersalz, Gewürze* (Pfeffer*, Zwiebel*, Knoblauch*, Koriander*, Majoran*), Teigmantel: HARTWEIZENGRIEß*, Trinkwasser, VOLLEI*, Meersalz, färbendes Gewürz* (Kurkuma*) *aus kontrolliert ökologischer Erzeugung', '2022-11-21 13:53:17', 840, 'GOURMET_CONVENIENCE', 'FRESH', 270, 20, NULL, NULL, NULL),
