(2574, 'ÖMA Allgäuer Raclette Scheiben (Weiling)', '4026913172357', 0, 6.79, 1, 1, NULL, 0, NULL, 'ÖMA Allgäuer Raclette Scheiben', 'Für ein gelungenes Raclette benötigt man einen aromatischen, pikant würzigen Raclette-Käse und nette Gäste. Unser ÖMA Allgäuer Raclette überzeugt durch seine Vielfalt an Aromen und seine besonders cremige Struktur. Aus bester Bioland-Milch der umliegenden Allgäuer Wiesen gekäst, reift er mindestens 6 Wochen und wird mit Rotkultur gepflegt, wodurch er seinen würzigen Geschmack erhält. Der ÖMA Allgäuer Raclette findet seinen Platz klassisch im Raclette-Pfännchen und macht auch beim Überbacken eine gute Figur. Als praktische Scheiben in einer regalplatzsparenden und wiederverschließbaren Frischebox lädt er im Handumdrehen zu einer gemütlichen Runde. Wer den Käse kräftiger mag, kann die verzehrbare Rinde einfach mitschmelzen. Bei diesem Genuss bleiben die Gäste auch gerne etwas länger. \nSanft geschwungene Hügel, saftig grüne Wiesen und das typische Braunvieh prägen das Landschaftsbild rund um die ÖMA Produktion in Kimratshofen im bayerischen Allgäu. Hier blickt man auf eine lange Tradition in der Milchverarbeitung zurück, deren Grundstein im Jahre 1960 mit der Gründung der Milchverwertung Kimratshofen-Frauenzell gelegt wurde. Durch den Zusammenschluss mit zwei weiteren Molkereien entstand 2010 die Allgäu Milch Käse eG - kurz AllMiKäs. Aufgrund der engen genossenschaftlichen Verflechtung mit den Lieferlandwirten besteht eine tiefe Verwurzelung und Verbundenheit mit der Region, die sich in sozialem Engagement, nachhaltigem Wirtschaften und schonendem Umgang mit Ressourcen zeigt. In den letzten Jahren wurden unter Käsermeister Hubert Dennenmoser 5 Mio. Euro in die Bereiche Energie, Wasser und Abwasser investiert, wodurch die Käserei eine hervorragende Energiebilanz mit 30-40% Einsparungen im Energie- und Wasserverbrauch pro Kilo Käse vorweisen kann. Unter anderem wurde dies durch die Installation einer eigenen Windkraftanlage, ein eigenes Blockheizkraftwerk und einer Solaranlage erreicht. Auch die von den Bio-Bauern ökologisch bewirtschaftete Fläche kann sich mit über 3.500 ha sehen lassen.', 'ÖMA Beer GmbH', 'ÖMA', 'Allgäu', '21c4acd1-828b-4b6f-aa18-14cfbe1a04a6', 'manager', '2022-11-16 12:00:33', 'System', '2023-09-07 03:51:57', 2654, 2244, 1, NULL, 0, 4.25, 'Weiling', 0, NULL, 0, 63, 'KUHMILCH*, Speisesalz, Milchsäurekulturen, mikrobielles Lab *aus kontrolliert ökologischer Erzeugung', '2023-01-16 20:02:27', 802.56, 'CHEESE', 'FRESH', 311, 19, 'VEGETARIAN', NULL, NULL),
