(2578, 'Ribeaupierre Kuh (Weiling)', '208166', 0, 23.9, 0, 1, NULL, 0, NULL, 'Ribeaupierre Kuh', 'Durch würzige Rotkulturen erhält diese Käsespezialität ein feines Aroma, das sahnig-mild unterlegt ist. Ein Käse für Feinschmecker, auch geeignet für die anspruchsvolle Käseplatte oder zum Überbacken.', 'Vandersterre Holland B.V.', NULL, 'Niederlande', NULL, 'manager', '2022-11-16 13:12:51', 'manager', '2022-11-16 13:13:24', 2658, NULL, 0, NULL, 0, 15, 'Weiling', 0, NULL, 1, NULL, 'KUHMILCH* pasteurisiert, Natriumchlorid (Kochsalz), Mikrobielles (vegetarisches) Lab, Milchsäurebakterien als Starterkultur\r\nenthält folgende allergene Zutaten: Milch', NULL, NULL, '3', NULL, NULL, NULL, NULL, NULL, NULL),
(2579, 'Charmeux Bockshorn (Weiling)', '208172', 0, 23.9, 0, 1, NULL, 0, NULL, 'Charmeux Bockshorn', 'Die Zugabe von Bockshornklee verleihen diesem halbfesten Schnittkäse sein typisches, feines Aroma. Eine Käsespezialität für Feinschmecker.', 'Vandersterre Holland B.V.', NULL, 'Niederlande', NULL, 'manager', '2022-11-16 13:15:09', 'manager', '2022-11-16 13:15:45', 2659, NULL, 0, NULL, 0, 15.1, 'Weiling', 0, NULL, 1, NULL, 'KUHMILCH* pasteurisiert, Natriumchlorid (Kochsalz), Mikrobielles (vegetarisches) Lab, Bockshornklee* (1,0%), Koriander*\r\nenthält folgende allergene Zutaten: Milch\r\n*aus kontrolliert ökologischer Erzeugung', NULL, NULL, '3', NULL, NULL, NULL, NULL, NULL, NULL),
(2580, 'Alpenstolz 10-12 M (Weiling)', '204870', 0, 27.9, 0, 1, NULL, 0, NULL, 'Alpenstolz 10-12 M', 'Nicht jedes Unternehmen hat das Glück, seine Rohstoffe aus zwei der schönsten Nationalparks Österreichs zu gewinnen, dem Nationalpark Hohe Tauern, der zu den großartigsten Hochgebirgslandschaften der Erde zählt, und dem Biosphärenpark Nockberge, ein erhabenes, mächtiges, alpines Juwel mit einzigartigen Naturschätzen sowie seltenen Tier- und Pflanzenarten. Das Ergebnis dieser atemberaubenden Landschaften mit der üppigen Flora und den einheimischen Kühen sind Milch- und Käseprodukte in erstklassiger Qualität mit einzigartigem Geschmack.', 'Vallée Verte GmbH', NULL, 'Kehl, BaWü', NULL, 'manager', '2022-11-16 13:18:43', 'manager', '2022-11-16 13:19:27', 2660, NULL, 0, NULL, 0, 17.32, 'Weiling', 0, NULL, 1, NULL, 'KuhMILCH*, Salz, Milchsäurekulturen, Labaustauschstoff (mikrobielles Lab), Festigungsmittel: Calciumchlorid\r\nenthält folgende allergene Zutaten: Milch\r\n*aus kontrolliert ökologischer Erzeugung', NULL, NULL, '3', NULL, NULL, NULL, NULL, NULL, NULL),
(2581, 'Comté AOP M. Petite 5 M (Weiling)', '208223', 0, 31.9, 0, 1, NULL, 0, NULL, 'Comté AOP M. Petite 5 M', 'Comté AOP ist einer der berühmtesten Käse Frankreichs. Bereits im 11. Jahrhundert schlossen sich die Bauern in der Region Franche-Comté zusammen, um haltbare Käseräder für die langen Wintermonate herzustellen. Auch heute noch sind die Milcherzeuger*innen mehrheitlich in Genossenschaften organisiert und verarbeiten ihre Milch gemeinsam. Somit hat sich in der Region eine besondere Käsekultur entwickelt. Die traditionellen Methoden der Käseherstellung im Kupferkessel haben sich bis heute erhalten. Im Jahr 1952 erhielt der Comté als einer der ersten Käse einen Herkunftsschutz. Die Weiden im Herstellungsgebiet sind bis zu 1500 Meter hoch gelegen und haben eine reiche Flora, die den besonderen Geschmack des Comté ergibt. Dort grasen die einheimischen Kuhrassen deren Milch frisch verarbeitet wird, deshalb müssen sich die Käsereien in einem Umkreis von 25 km befinden. Silagefütterung ist nicht erlaubt. Nach der Herstellung der Comté-Laibe, die genauen Regeln folgt, werden die Käse bei Affineur*innen gereift.', 'Vallée Verte GmbH', NULL, 'Frankreich', NULL, 'manager', '2022-11-16 13:21:35', 'manager', '2022-11-16 13:22:19', 2661, NULL, 0, NULL, 0, 19.4, 'Weiling', 0, NULL, 1, NULL, 'KUHMILCH* (Rohmilch), Meersalz, Milchsäurekulturen, tierisches Lab\r\nenthält folgende allergene Zutaten: Milch\r\n*aus kontrolliert ökologischer Erzeugung', NULL, NULL, '3', NULL, NULL, NULL, NULL, NULL, NULL),
(2582, 'Emmentaler (Weiling)', '240016', 0, 24.9, 0, 1, NULL, 0, NULL, 'Emmentaler', 'Bio Hartkäse mit 45% Fett i. Tr., mit Rohmilch hergestellt', 'SalzburgMilch GmbH', NULL, 'Österreich', NULL, 'manager', '2022-11-16 13:24:42', 'manager', '2023-05-05 09:17:30', 2662, NULL, 0, NULL, 0, 15.65, 'Weiling', 0, NULL, 1, NULL, 'Bio Hartkäse mit 45% Fett i. Tr., mit Rohmilch hergestellt\r\nenthält folgende allergene Zutaten: Milch\r\n*aus kontrolliert ökologischer Erzeugung, *kontrolliert biologischer Anbau', '2023-05-05 09:17:30', 2700, 'DAIRY_PRODUCTS_EGGS', 'FRESH', NULL, NULL, NULL, NULL, NULL),
(2583, 'Uriger Allgäuer leicht (Weiling)', '208168', 0, 21.9, 0, 1, NULL, 0, NULL, 'Uriger Allgäuer leicht', 'Handwerklich gekäst aus eigener Bio-Heumilch. Kleine Allgäuer Bauernhöfe liefern frische BioHeumilch. Hohe Transparenz vom Landwirt bis hin zum Konsument .', 'Bio-Schaukäserei Wiggensbach eG', NULL, 'Wiggensbach, Bayern', NULL, 'manager', '2022-11-16 15:21:31', 'manager', '2022-11-16 15:22:00', 2663, NULL, 1, NULL, 0, 14.1, 'Weiling', 0, NULL, 1, NULL, 'Bioland HeuMILCH*, Milchsäurekultur, mikrobielles Lab, Steinsalz, Kunststoffüberzug mit Schabzigerklee**\r\nenthält folgende allergene Zutaten: Milch\r\n*aus kontrolliert ökologischer Erzeugung', NULL, NULL, '3', NULL, NULL, NULL, NULL, NULL, NULL),
(2584, 'Rusticus Schabzigerklee (Weiling)', '208274', 0, 22.9, 0, 1, NULL, 0, NULL, 'Rusticus Schabzigerklee', 'Feiner Käsegeschmack mit nussigem Schabzigerklee', 'Die Käsemanufaktur Allgäu GmbH', NULL, 'Altusried, Bayern', 'b1752ef5-6e07-4de4-8d2b-04d6f67049a8', 'manager', '2022-11-16 15:24:00', 'manager', '2022-11-17 19:08:39', 2664, NULL, NULL, NULL, 0, 14.35, 'Weiling', 0, NULL, 1, NULL, 'pasteurisierte KUHMILCH*, Speisesalz, Milchsäurekulturen, mikrobielles Lab, Rinde mit Schabzigerklee*\r\nenthält folgende allergene Zutaten: Milch\r\n*aus kontrolliert ökologischer Erzeugung', '2022-11-17 19:08:39', NULL, '3', NULL, NULL, NULL, NULL, NULL, NULL),
(2585, 'Cheddar mild (Weiling)', '208186', 0, 26.9, 0, 1, NULL, 0, NULL, 'Cheddar mild', 'Cheddar ist ein großes Dorf im Bezirk Sedgemoor der englischen Grafschaft Somerset. Die Gemeinde liegt am südlichen Rand der Mendip Hills, einer Reihe von Kalksteinhügeln die auch eine Cheddar-Schlucht und mehrere Schauhöhlen umfasst. Darauf nimmt auch der Name Bezug: Das Wort \"Cheddar\" kommt von dem alten englischen Wort \" ceodor\" und bedeutet \"tiefe dunkle Höhle\" oder \"Tasche\". Der Käse wird seit dem 15. Jahrhundert in Betrieben dieses westlichen Teils Englands hergestellt und trägt den Namen der für seine Erzeugung bekannten Region. In England ist Cheddar ein sehr populärer Käse. Trotz seiner Berühmtheit sind nur zwei Cheddar-Sorten geschützt.', 'Vallée Verte GmbH', NULL, 'Großbritannien', NULL, 'manager', '2022-11-16 15:27:00', 'manager', '2022-11-16 15:28:25', 2665, NULL, 0, NULL, 0, 16.7, 'Weiling', 0, NULL, 1, NULL, 'KuhMILCH*, Steinsalz, Labaustauschstoff, Milchsäurekulturen\r\nenthält folgende allergene Zutaten: Milch', NULL, NULL, '3', NULL, NULL, NULL, NULL, NULL, NULL),
(2586, 'Manchego DO (Weiling)', '208187', 0, 38.9, 0, 1, NULL, 0, NULL, 'Manchego DO', 'Mitten in der Castilla la Mancha liegt der in den 60iger Jahren gegründeteFamilienbetrieb, der heute von den Geschwistern Concha und Mateo Garcia geleitet wird. Seit 1996 wird die Finca biologisch bewirtschaftet. Die besondere Lage berechtigt sieBio-Manchego herzustellen. Auf 300 Hektar Land lebenhier 1800 Manchego-Schafe. Für die Käseproduktion wird ausschließlich die hofeigene Milch verwendet.', 'Finca Fuentillezjos alimentos ecológicos SL', NULL, 'Spanien', NULL, 'manager', '2022-11-16 15:30:08', 'manager', '2022-11-16 15:30:45', 2666, NULL, 0, NULL, 0, 24.2, 'Weiling', 0, NULL, 1, NULL, 'pasteurisierte SCHAFSMILCH*, Milchsäurebakterien, Lab, Fermente, Meersalz\r\nenthält folgende allergene Zutaten: Milch\r\n* = Zutaten aus ökol. Landbau', NULL, NULL, '3', NULL, NULL, NULL, NULL, NULL, NULL),
