(2589, 'Pecorino Sardo Maturo DOP (Weiling)', '200003', 0, 27.9, 0, 1, NULL, 0, NULL, 'Pecorino Sardo Maturo DOP', 'Klassischer Schafkäse aus Sardinien.\r\n\r\nDie Käserei Argiolas wurde 1954 von den beiden Brüdern Ennio und EligioArgiolas in Dolianova auf Sardinien gegründet. Ihr Ziel war es, typischen sardischen Käsezu produzieren und diesen über die Landesgrenzen hinaus bekannt zu machen. Ganz zu Beginn stellten die sardischen Schäfer den ³Fiore SardoÊ noch selbst in ihren Schafställen her und brachten ihn zum Reifen in den Keller der Argiolas-Brüder. Auch heute noch stellt Argiolas Formaggi landestypische Käse- und Milchprodukte her und erhält somit die alte sardische Molkerei-Tradition. Seit über 10 Jahren werden dort auch feine biologische Käsespezialitäten gefertigt. Die verarbeitete Milch stammt ausschließlich aus Sardinien, was dem Käse seine ganz eigene Charakteristik verleiht.', 'ARGIOLAS FORMAGGI s.r.l.', NULL, 'Italien', NULL, 'manager', '2022-11-16 15:43:24', 'manager', '2022-11-16 15:44:05', 2668, NULL, 0, NULL, 0, 17.65, 'Weiling', 0, NULL, 1, NULL, 'pasteurisierte SCHAFSMILCH*, Salz, Milchfermente\r\nenthält folgende allergene Zutaten: Milch\r\n* = Zutaten aus ökol. Landbau', NULL, NULL, '3', NULL, NULL, NULL, NULL, NULL, NULL),
(2590, 'Kolumbus (Weiling)', '208229', 0, 35.9, 0, 1, NULL, 0, NULL, 'Kolumbus', 'Schweizer Schnittkäse aus thermisierter Milch,  5 - 7 Monate gereift, mind. 45 % Fett i. Tr. Der Geschmacksentdecker. Köstlich-würzig, mit seiner 5- bis 7-monatigen Reifezeit bringt er schon Charakter mit, ist aber auch für Käsefreunde zu empfehlen, die es nicht allzu intensiv mögen. Jetzt auch im auffälligen Kleid. Der Käse wird mit einem Malzkonzentrat mit ausgesuchten Kräutern und Wasser gepflegt.', 'Weiling GmbH', 'bioladen', 'SWITZERLAND', NULL, 'manager', '2022-11-16 15:46:03', 'manager', '2022-11-17 19:28:15', 2669, 2256, 0, NULL, 0, 21.2, 'Weiling', 0, NULL, 1, NULL, NULL, NULL, NULL, '3', NULL, NULL, NULL, NULL, NULL, NULL),
