(2593, 'Gouda mittelalt/pikant (Weiling)', '208277', 0, 19.9, 0, 1, NULL, 0, NULL, 'Gouda mittelalt/pikant', 'Halbfester Schnittkäse mit 50 % Fett i. Tr.  Aus Milch von deutschen Bauernhöfen am Niederrhein. Mind. 3 Monate lang gehegt und gepflegt. Durch die längere Reifezeit bekommt der Käse ein volles, pikantes Aroma.', 'Weiling GmbH', 'bioladen', 'GERMANY', NULL, 'manager', '2022-11-16 15:55:24', 'manager', '2023-03-28 09:26:35', 2672, 2253, 1, NULL, 0, 13, 'Weiling', 0, NULL, 1, NULL, 'KUHMILCH*, Meersalz, Milchsäurekultur, Mikrobielles Lab (vegetarisch) *aus kontrolliert ökologischer Erzeugung', '2023-03-28 09:26:35', 2500, 'DAIRY_PRODUCTS_EGGS', NULL, NULL, NULL, NULL, NULL, NULL),
(2594, 'Leonardo da Vinci (Weiling)', '240081', 0, 24.9, 0, 1, NULL, 0, NULL, 'Leonardo da Vinci', 'Schnittkäse 50 % Fett i. Tr., rotgeschmiert. Großer Name mit edlem Auftritt. Rotkulturen und der Kräutersud aus Schabzigerklee, Löwenzahn, Brennnessel und Petersilie geben dem Käse seine besondere Charakteristik. An diesem Geschmack kommt niemand vorbei.', 'Weiling GmbH', 'bioladen', 'GERMANY', NULL, 'manager', '2022-11-16 15:58:15', 'manager', '2022-11-17 19:28:47', 2673, 2257, 1, NULL, 0, 15.8, 'Weiling', 0, NULL, 1, NULL, NULL, NULL, NULL, '3', NULL, NULL, NULL, NULL, NULL, NULL),
(2595, 'Gouda Marrakesch \"Ras el Hanout\" (Weiling)', '208838', 0, 19.9, 0, 1, NULL, 0, NULL, 'Gouda Marrakesch \"Ras el Hanout\"', 'Schnittkäse, 50 % Fett i. Tr. Mit Gewürzen aus der nordafrikanischen Küche – ein orientalisches Geschmackserlebnis.\r\nMarrakesch - das klingt nach Fernweh und duftet nach Orient. Die marrokanische Stadt ist bekannt für ihre lebhaften und bunten Märkte. Hier findet man eine unendliche Vielfalt an Kräutern und Gewürzen, farbenprächtig und betörend.  Darunter befindet sich garantiert auch die traditionelle Gewürzmischung \"Ras el Hanout\", die häuftig aus mehr als 30 Gewürzen besteht und von jedem Gewürzhändler aus süßlichen und scharfen Aromen selber kreiert wird.  Unserem neuen bioladen*Gouda Marrakesch \"Ras el Hanout\" geben Bockshornklee, Koriander, Ingwer, Kreuzkümmel, Chili, schwarzer Pfeffer und Gewürznelken die besondere Note.', 'Weiling GmbH', 'bioladen', 'NETHERLANDS', NULL, 'manager', '2022-11-16 16:00:24', 'manager', '2022-11-17 19:30:49', 2674, 2255, 1, NULL, 0, 12.85, 'Weiling', 0, NULL, 1, NULL, 'pasteurisierte KUHMILCH*, Meersalz, Bockshornklee*, Koriander*, Ingwer*, Kreuzkümmel*, Chili*, Schwarzer Pfeffer*, Gewürznelken*, Milchsäurekultur, Mikrobielles Lab (vegetarisch) *aus kontrolliert ökologischer Erzeugung', NULL, NULL, '3', NULL, NULL, NULL, NULL, NULL, NULL),
(2596, 'Rotes Gold (Weiling)', '200004', 0, 22.9, 0, 1, NULL, 0, NULL, 'Rotes Gold', 'Ein Goldschatz, der nicht von Alchimisten, sondern von Menschen mit Leidenschaft für sagenhaft guten Käse entwickelt wurde. Die Pflege mit einem raffinierten Sud aus Eichenrinde, Dinkelkorn und Rotkultur lässt die Laibe im Laufe von drei Monaten zu einem goldfarbenen Käse mit fein-würzigem Geschmack heranreifen. Die Familienkäserei Aurora, die bereits seit 20 Jahren unseren erfolgreichen bioladen*Gouda herstellt, erweitert nun unser Portfolio um diesen affinierten, charaktervollen Schnittkäse und zeigt auch hier ihr ganzes käsemeisterliches Können.', 'Weiling GmbH', 'Bioladen', 'Deutschland', NULL, 'manager', '2022-11-16 16:02:51', 'manager', '2023-03-09 12:33:02', 2675, NULL, 1, NULL, 0, 14.5, 'Weiling', 0, NULL, 1, NULL, 'KUHMILCH*, Meersalz, Milchsäurekulturen, Mikrobielles Lab, affiniert mit Eichenrinde* und DINKELKORN*\r\nenthält folgende allergene Zutaten: Gluten, Milch\r\n*aus kontrolliert ökologischer Erzeugung', '2023-03-09 12:33:02', 2571.43, 'CHEESE', 'FRESH', NULL, NULL, 'VEGETARIAN;LACTOSEFREE', NULL, NULL),
