(2602, 'Schweinefilet (Weiling)', '200171', 0, 47.9, 0, 1, NULL, 0, NULL, 'Schweinefilet', 'Das Fleisch für dieses bioladen*Produkt stammt von verbandszertifizierten Bio-Bauernhöfen vom Niederrhein und Westfalen. Die Schweine werden in Gruppen gehalten. Der Stall bietet ausreichend Auslauf und eine Wühlmöglichkeit. So können sie ihr arttypisches Verhalten ausleben.', 'Weiling GmbH', 'Bioladen', 'Niederrhein/Westfalen', NULL, 'manager', '2022-11-17 22:39:19', 'manager', '2022-11-17 22:40:55', 2686, NULL, 4, NULL, 0, 32.2, 'Weiling', 0, NULL, 1, NULL, 'Schweinefleisch*\r\n*aus kontrolliert ökologischer Erzeugung', NULL, NULL, '3', NULL, NULL, NULL, NULL, NULL, NULL),
