(2604, 'Lammbert Schaf Weichkäse (Weiling)', '800800', 0, 39.9, 0, 1, NULL, 0, NULL, 'Lammbert Schaf Weichkäse', 'Feiner Weichkäse mit Weißschimmel aus Schafmilch vom Reutebachhof.\r\n\r\nUnsere Milchschafspezialitäten vom Reutebachhof schreiben seit über 30 Jahren Erfolgsgeschichte im Naturkostkühlregal. Nachhaltigkeit wird hier gelebt. Ohne Transportwege wird die in unserem landwirtschaftlichen Betrieb erzeugte, frisch gemolkene Bio-Schafmilch direkt in der eigenen EU zugelassenen Molkerei verarbeitet. Sie wird nicht entrahmt und nicht homogenisiert. Somit enthält so alle natürlichen Bestandteile. Eine Natur schonende Produktion ermöglicht es uns, natürliche Schafprodukte aus der Region anbieten zu können.', 'Reutebachhof', 'Lammbert', 'Bühlerzell, BaWü', NULL, 'manager', '2022-11-18 09:33:40', 'manager', '2023-03-09 12:34:52', 2688, NULL, 1, NULL, 0, 22.69, 'Weiling', 0, NULL, 2, NULL, 'SCHAFMILCH*, Salz, mikrobielles Lab, Milchsäurekulturen,\r\nenthält folgende allergene Zutaten: Milch\r\n*aus kontrolliert ökologischer Erzeugung', '2023-05-02 12:21:44', 3000, 'CHEESE', 'FRESH', 350, 12, 'VEGETARIAN', NULL, NULL),
