(2609, 'Teelichter dunkelrot Stearin (Weiling)', '4046203432046', 1, 3.99, 1, 1, NULL, 0, NULL, 'Teelichter dunkelrot Stearin', 'Pflanzliches Stearin wird als Stearinsäure aus der Frucht der Ölpalme gewonnen und ist damit ein Naturprodukt aus nachwachsenden Rohstoffen und biologisch abbaubar. Stearin brennt geruchsneutral, rußarm und ruhig. Aufgrund der Härte des Wachses ist Stearin besonders formstabil. Typisch für Stearinkerzen sind die leicht glitzernde, kristalline Struktur und ein ruhiger Abbrand. Das von der KERZENFARM verarbeitete Stearin stammt ausschließlich von RSPO-zertifizierten Produzenten.\r\n\r\nEs handelt sich bei diesem Produkt um ein Deko-Teelicht, das mit hoher Flamme brennt und daher nicht als Nutzteelicht (z.B. in Stövchen o.Ä.) geeignet ist. Bitte verwenden Sie diese Teelichte nur im dafür vorgesehenen Glas.', 'KERZENFARM HAHN', 'KERZENFARM HAHN', 'Nienbüttel, SH', NULL, 'manager', '2022-11-18 12:26:54', 'manager', '2023-02-27 11:28:47', 2694, NULL, NULL, NULL, 0, 1.89, 'Weiling', 0, NULL, 0, NULL, NULL, '2023-02-27 11:28:47', 296.4, 'HOUSEHOLD;OTHER_DRUGSTORE_ARTICLES', 'DRUGSTORE', NULL, 19, NULL, NULL, NULL),
