(2628, 'Feine Bitter Schokolade 99 % Cacao (Weiling)', '4044889002904', 0, 2.69, 1, 1, NULL, 0, NULL, 'Feine Bitter Schokolade 99 % Cacao', 'Die VIVANI Feine Bitter 99% bietet Cacao-Genuss der Extraklasse. Ein pures Kakao-Erlebnis aus feinstem Panama-Kakao, welcher besonders durch seine angenehme Milde besticht.\n\nDurch die dünne 80 g Tafelausformung entfaltet sich ein unvergleichlicher Schmelz im Mund, was den herben Kakaogeschmack gekonnt in Szene setzt. Der extrem geringe Anteil an edlem Kokosblütenzucker (unraffiniert) gerät hier unverdienterweise zum Nebendarsteller – wenn auch zu einem absolut Erstklassigen.', 'EcoFinia GmbH', 'Vivani', 'Herford, NRW', '8fd9a092-2cfa-4a91-93f6-7ce7e77548cb', 'manager', '2022-11-21 13:55:32', 'System', '2023-01-16 20:04:14', 2712, 2269, 0, NULL, 0, 1.62, 'Weiling', 2, 1, 0, 67, 'Kakaomasse*°, Kakaobutter*°, Kokosblütenzucker* 1%. Kakao: 99% mindestens. \r\nKann Bestandteile von SCHALENFRÜCHTEN, MILCH und GLUTEN enthalten. *aus kontrolliert ökologischer Erzeugung', '2023-01-02 08:39:01', 139.048, 'SWEETS', 'SNACKS', 94, 19.1, 'VEGAN;VEGETARIAN;PALMOILFREE;KOSCHER', NULL, NULL),
