(2641, 'Grießpudding mit Himbeer Soße (Weiling)', '4008471507321', 0, 1.59, 1, 1, NULL, 0, NULL, 'Grießpudding mit Himbeer Soße', 'Den besten Grießpudding kocht mit Sicherheit die Oma. Aber es geht auch einfacher. Söbbeke - Die Bio-Molkerei! hat jetzt vier Sorten köstlichen Grießpudding im Sortiment. So kann man den leckeren Grießpudding überall und immer genießen, als Nachtisch, als kleine Zwischenmahlzeit oder bei der Arbeit. Dieses Dessert zeichnet sich durch seine cremige Konsistenz aus und besticht mit viel frischer Milch, Hartweizengrieß und einem Schuß guter Sahne. Mit seinem 150 g Becher hat der Grießpudding eine ideale Größe. Es gibt ihn in den Sorten Traditionell, Vanille und mit Himbeeren. Bei der Sorte Himbeere wird der Grießpudding im Zweikammer-Becher angeboten. Hier können die Liebhaber des unverwechselbaren Fruchtgeschmacks ihre ganz persönliche Mischung selber herstellen, indem man ganz einfach die Ecke mit der Frucht umknickt und das köstliche Fruchtmus auf den Grießpudding gibt. Alle Sorten werden, wie alles bei Söbbeke, ohne Zusatz von Aromen oder weitere Zusätze hergestellt, das ist die Söbbeke-Qualität. Hier schmeckt man noch die reine Frucht und die gute Bio-Milch.', 'Molkerei Söbbeke GmbH', 'Söbbeke', 'Gronau-Epe, NRW', '000364d1-4e3e-4d66-965c-b231ad28cb8a', 'manager', '2022-11-25 09:17:46', 'System', '2023-01-26 20:01:04', 2725, 2322, 1, NULL, 0, 0.81, 'Weiling', 1, 1, 0, 63, '55% VOLLMILCH*, 14% SAHNE*, 10% Himbeeren*, Rüben- und Rohrohrzucker*, 5% HARTWEIZENGRIEß*, MAGERMILCHPULVER*, Verdickungsmittel Johannisbrotkernmehl* und Pektin, Zitronensaftkonzentrat*\r\nenthält folgende allergene Zutaten: Gluten, Milch\r\n*aus kontrolliert ökologischer Erzeugung', '2023-01-09 16:55:42', 469.3, 'DAIRY_PRODUCTS_EGGS', 'FRESH', 160.2, 9.5, 'VEGETARIAN', NULL, NULL),
