(2658, 'Pizza Tonno (Weiling)', '4250073453609', 0, 5.99, 1, 1, NULL, 0, NULL, 'Pizza Tonno', '   Tuna trifft auf Bella Vita. Auf die followfood Pizza Tonno kommt selbstverständlich nur der am nachhaltigsten gefangene Thunfisch: Fair Trade zertifiziert und handgeangelt von Fischern auf den Malediven. Beifang ist damit fast ausgeschlossen. Verfeinert wird die Pizza mit schwarzen Oliven und roten Zwiebeln aus biologischer Landwirtschaft.\nDie Pizza Tonno ist mit dem MSC und Fair Trade zertifizierten Thunfisch nicht nur extrem nachhaltig belegt, sondern auch richtig lecker und echt italienisch im Geschmack. So besteht die Tomatensauce aus Bio-Tomaten aus der Region Emilia Romagna. Ganz bewusst wurde bei der Verarbeitung der sonnengereiften Tomaten auf die Zugabe von Zucker verzichtet.\nNicht nur der Geschmack der Pizzen überzeugt, sondern auch die nachhaltige Herstellung. Bei der Produktion unserer Pizzen in Norditalien setzt followfood auf ausschließlich erneuerbare Energie. Dabei wird auf eine stetige Verringerung des CO2-Ausstoßes geachtet.', 'followfood GmbH', 'followfood', 'ITALY', '42044acd-a054-4353-ac31-20584556762b', 'manager', '2022-12-06 11:54:10', 'System', '2023-11-24 02:07:19', 2741, 2331, NULL, NULL, 0, 3.47, 'Weiling', 0, NULL, 0, 102, 'WEIZENMEHL* 30,5 %, Tomatenpüree* 15,8 %, Wasser, THUNFISCH**** 13,3 %, MOZZARELLA* 11,7 %, rote Zwiebeln* 6,7%, schwarze Oliven* 4%, Sonnenblumenöl*, Salz, Traubenzucker*, WEIZENMALZMEHL*, Hefe*, Zwiebelpulver*, schwarzer Pfeffer*. *aus kontrolliert ökologischer Erzeugung ****aus Wildfang', '2023-05-02 12:21:14', 2195.2, 'OTHER', 'OTHER', 368, 28, NULL, NULL, NULL),
(2659, 'Gemüsechips Süßkartoffel Tomate Rosmarin (Weiling)', '8718781200695', 0, 3.39, 1, 1, NULL, 0, NULL, 'Gemüsechips Süßkartoffel Tomate Rosmarin', 'Diese besonderen Gemüsechips verbinden den feinen Geschmack der Süßkartoffel mit der leichten Frische der Tomate. Ein Hauch Rosmarin verleiht den Chips einen typisch mediterranen Geschmack. Genießen Sie die Süsskartoffelchips als Snack oder zum Apéritief.\nDer echte Geschmack der reinen Zutaten, dafür steht GoPure! Produziert werden diese leckeren Chips von Yellow Chips aus dem niederländischen Emmeloord. Im Jahr 2013 von drei begeisterten Lebensmittelprofis gegründet, bieten die „Chipsmacher“ ein abwechslungsreiches Sortiment von Kartoffel- und Gemüsechips. Natürlich sind alle Produkte – so wie der Name es sagt – pur: biologisch und vegan, frei von Allergen und zugefügtem Zucker und Hefe. GoPure – straight from the land.\n ', 'Yellow Chips B.V.', 'GoPure', 'NETHERLANDS', '9835673b-23eb-4f60-9ca9-61ae75f7eb62', 'manager', '2022-12-06 11:58:12', 'System', '2023-02-21 02:11:00', 2742, 2332, 0, NULL, 0, 2.03, 'Weiling', 0, NULL, 0, 120, 'Süßkartoffel* (57,7%), Sonnenblumenöl*, Tomatenpulver* (1,8%), Rosmarin* (1,3%), Meersalz,  Paprikapulver*, Knoblauchpulver*, Zwiebelpulver*, Petersilie*, Cayennepfeffer*, Liebstöckelwurzel*. vor Wärme geschützt und trocken lagern. Unter Schutzatmosphäre verpackt.  *aus kontrolliert ökologischer Erzeugung', '2023-01-16 20:06:24', 2509, 'SWEETS;SALTY', 'SNACKS', 85, 26, 'VEGAN;VEGETARIAN;GLUTENFREE', NULL, NULL),
