(2681, 'Zartbitterschokolade 67% Mint Crunch (Weiling)', '5060270121862', 0, 3.69, 1, 1, NULL, 0, NULL, 'Zartbitterschokolade 67% Mint Crunch', 'Dunkle Schokolade mit Pfefferminzkrokant: Das natürliche Pfefferminzöl ist frisch und dennoch mild. Die Kombination aus Pfefferminze und dunkler Schokolade und die knackige Textur machen diese Tafel für Liebhaber von Minze einfach unwiderstehlich.\nAusgezeichnet mit dem Great Taste Award *2015, *2014, *2013', 'Chocolate and Love Limited', 'Chocolate and Love Limited', 'SWITZERLAND', '2c59054f-08c3-43d0-adef-cccdbcda6e5a', 'manager', '2022-12-23 12:25:33', 'System', '2023-12-09 03:40:25', 2768, 2347, 0, 0, 0, 2.21, 'Weiling', 0, NULL, 0, 298, 'Kakaomasse*, Rohrzucker*, Kakaobutter*, Pfefferminzkrokant* (10%) (Rohrzucker*, natürliches Pfefferminzöl*), Vollrohrzucker*,  Vanilleschoten*. *aus kontrolliert ökologischer Erzeugung', '2023-01-16 20:07:51', 113.04, 'SWEETS', 'SNACKS', 80, 15.7, 'VEGAN;VEGETARIAN', NULL, NULL),
(2682, 'Geröstete Cashews gesalzen (Weiling)', '4035661162657', 0, 5.19, 1, 1, NULL, 0, NULL, 'Geröstete Cashews gesalzen', 'Die bioladen*Cashewkerne kommen aus unserem bioladen*Fair Projekt aus Burkina Faso. Mit dem Kauf gehen pro Verpackung 5 Cent in dieses Projekt. Sie wollen mehr zum Projekt erfahren, dann schauen Sie auf bioladen.de/qr/burkinafaso. Die Herstellung der Cashews ist reine Handarbeit. Im Geschmack sind sie mild nussig. Sie sind geröstet und gesalzen und sind optimal zum Knabbern. ', 'Weiling GmbH', 'bioladen', 'GERMANY', 'a4c13e33-83b7-4f1f-928b-b880ae2614c1', 'manager', '2022-12-23 12:29:31', 'System', '2023-11-01 02:06:36', 2769, 2348, 0, NULL, 0, 3.11, 'Weiling', 0, NULL, 0, 72, 'CASHEWKERNE geröstet* (95%), Sonnenblumenöl*, Steinsalz *aus kontrolliert ökologischer Erzeugung', '2023-06-30 09:54:55', 455.625, 'SALTY', 'SNACKS', 154, 13.5, 'VEGAN;VEGETARIAN', NULL, NULL),
