(2686, 'Hähnchenkeulen, 2 Stück (Weiling)', '257931', 0, 19.9, 0, 1, NULL, 0, NULL, 'Hähnchenkeulen, 2 Stück', 'Das Fleisch für dieses bioladen*Produkt kommt aus der Dingdener Heide oder aus dem niedersächsischen Twistringen. Dort wachsen die Tiere ihren Bedürfnissen entsprechend auf. Die jeweilige Verbandsqualität Bioland oder Naturland finden Sie auf dem Etikett.', 'Naturlandhof Hoffmeier', 'Bioladen', 'Hamm, NRW', NULL, 'manager', '2022-12-23 15:45:10', 'manager', '2022-12-23 15:45:24', 2774, NULL, 3, NULL, 0, 12.81, 'Weiling', 1, 0, 1, NULL, NULL, NULL, NULL, '3', NULL, NULL, NULL, NULL, NULL, NULL),
(2687, 'Hanf Drink Berief (Weiling)', '4004790026079', 1, 2.59, 1, 1, NULL, 0, NULL, 'Hanf Drink Berief', 'Überall wo Berief drauf steht, steckt auch Lecker drin. Denn wir lieben nicht nur pflanzliche Produkte, sondern auch guten Geschmack.', 'Berief Food GmbH', 'Berief', 'Beckum, NRW', NULL, 'manager', '2022-12-29 10:50:00', 'manager', '2023-02-15 11:52:30', 2775, NULL, 3, NULL, 0, 1.41, 'Weiling', 1, 1, 0, NULL, 'Trinkwasser, Hanfsamen*, Sonnenblumenöl*, Meersalz\r\n*aus kontrolliert biologischem Anbau', '2023-02-15 11:52:30', 1083.74, 'PRESERVED_MILK_DRINKS', 'PANTRY', NULL, 21.2, NULL, NULL, NULL),
(2688, 'ZeroZero alkoholfrei (Weiling)', '4260065961142', 1, 9.99, 1, 1, NULL, 0, NULL, 'ZeroZero alkoholfrei', 'ZeroZero ist die gesunde, natürlich und feinherbe Alternative zu alkoholfreiem Wein und Wein.\nZeroZero wird als wohlschmeckendes Genussgetränk gereicht und serviert wie Sie es bei\neinem Weißwein gewohnt sind.\nDer ZeroZero ist nicht nur alkoholfrei und lecker, sondern auch ungeschwefelt und aus\nnatürlichen biodynamischen Zutaten. Seine Zusammensetzung wirkt basenbildend und hat\n75% weniger Kalorien als Wein. Das alles verschafft unserem ZeroZero ein absolutes\nAlleinstellungsmerkmal. Wir haben bewusst auf die hochtechnische Entalkoholisierung\nverzichtet und uns für 100% Natürlichkeit in Demeter-Qualität entschieden.\nDer ZeroZero polarisiert sympathisch, wie Sie es von Wein kennen. Er kitzelt charmant die Sinne\nduftet nach reifen Trauben, ist auch nach Minuten noch im Mund zu spüren und ist nicht zu\nsüss, eher feinherb. Er bietet sogar einen geistigen Effekt*, den man sonst vom Wein kennt. Er ist\nmehrere Jahre in der geschlossenen Flasche haltbar und auch geöffnet kann man ihn mehrere\nTage lang genießen. Durch den Verzicht auf Schwefel ist er allergikerfreundlich.\n*geistigen Effekt meint hier nicht die Alkoholwirkung bei Wein, sondern eine langanhaltend\nspürbare Wirkung im Körper. Das ist die Wirkung die man auch bei Wein spürt, bevor die\nAlkoholwirkung einsetzt.', 'Andreas Roll', 'Gustavshof', 'Rheinhessen', '00592aab-de15-4b6f-8d69-d82ba22057e3', 'manager', '2022-12-29 10:56:50', 'System', '2023-12-17 03:06:22', 2776, 2349, 2, NULL, 0, 5.2, 'Weiling', 0, NULL, 0, 72, 'Fermentierte und nicht fermentierte Demeter-Trauben, Wasser **aus biodynamischer Erzeugung', '2023-02-02 08:30:51', 1906.08, 'WINE_CHAMPAGNE;OTHER_DRINKS;SPIRITS', 'DRINKS', 1200, 33, 'VEGAN;VEGETARIAN', NULL, NULL),
(2689, 'Dressing Sylter Art (Weiling)', '4018462417317', 0, 3.99, 1, 1, NULL, 0, NULL, 'Dressing Sylter Art', 'Das Byodo Dressing Sylter Art wird aus feinsten Bio-Zutaten hergestellt und ist garantiert glutenfrei, eifrei und vegan. Für die typische, dezente Gemüsenote im Salatsaucen-Klassiker sorgen fein gehackte Zwiebeln und Karotten. Statt Kristallzucker verleiht feinster Agavendicksaft dem veganen Bio-Dressing Sylter Art eine leichte, natürliche Süße. Es passt herrlich zu knackigen Eisberg- und Karottensalaten. Die praktische 245 ml-Flasche garantiert zudem ein einfaches Handling und Dosieren – kurz schütteln, über den Salat gießen und genießen. Nach dem Öffnen bitte im Kühlschrank aufbewahren.\n', 'Byodo Naturkost GmbH', 'Byodo', 'GERMANY', 'bd107efb-c8e9-48f9-9197-39093b5232f5', 'manager', '2022-12-29 11:02:06', 'System', '2023-12-17 03:08:06', 2777, 2350, 0, NULL, 0, 2.49, 'Weiling', 0, NULL, 0, 67, 'Wasser, Sonnenblumenöl*, Zwiebel* (11 %), Branntweinessig*, Agavendicksaft*, Steinsalz, Sonnenblumenprotein*, Verdickungsmittel: Guarkernmehl*, Maisstärke*, Karotten*, Gewürze*, Kräuter*. *aus kontrolliert ökologischer Erzeugung', '2023-02-01 11:20:26', 532.8, 'OIL_VINEGAR_SAUCES', 'PANTRY', 409.3, 14.8, 'VEGAN;VEGETARIAN;KOSCHER;HALAL;GLUTENFREE', NULL, NULL),
(2690, 'Alpenländer Kräuterkäse Scheiben (Weiling)', '4104060011702', 0, 3.49, 1, 1, NULL, 0, NULL, 'Alpenländer Kräuterkäse Scheiben', 'Halbfester Schnittkäse, Butterkäse mit würzig-frischer Note mit einem Hauch von Knoblauch. Die Kräutermischung stammt aus ökologisch kontrollierter Landwirtschaft. Produkt ohne weitere Behandlung zum menschlichen Verzehr bestimmt. Ausgenommen sind Personen, die auf einzelne Inhaltsstoffe allergisch reagieren.', 'Andechser Molkerei Scheitz GmbH', 'Andechser Natur', 'GERMANY', 'b8b8422c-2b58-4b11-b167-6fe5504ff943', 'manager', '2022-12-29 11:07:49', 'System', '2023-12-17 03:06:11', 2778, 2351, 0, NULL, 0, 2.15, 'Weiling', 0, NULL, 0, 8, 'Pasteurisierte KUHMILCH*, Speisesalz, Käsereikulturen, mikrobielles Lab, Schnittlauch*, Bärlauch*, Knoblauch*. *aus kontrolliert ökologischer Erzeugung', '2023-10-18 02:05:49', 482.6, 'CHEESE', 'FRESH', 160, 20, 'VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
