(2693, 'Rindersalami, geschnitten (Weiling)', '4035626100953', 0, 4.19, 1, 1, NULL, 0, NULL, 'Rindersalami, geschnitten', 'Das Fleisch dieses bioladen*Produktes stammt von verbandszertifizierten Bio-Bauernhöfen. Eine ökologische Tierhaltung mit großzügigem Auslauf im Freien und biologischem Futter ist die beste Grundlage für eine ausgezeichnete Fleischqualität.', 'Weiling GmbH', 'bioladen', 'GERMANY', 'e09c277e-4499-4209-a3bf-1df164557d43', 'manager', '2022-12-29 15:52:24', 'System', '2023-04-18 02:09:26', 2781, 2352, 4, NULL, 0, 2.43, 'Weiling', 0, NULL, 0, 61, 'Rindfleisch* (130 g/100 g)*, Meersalz, Gewürze (Zwiebel, Liebstöckel, Brennnesselblätter, Majoran, Pfeffer, Macisblüte, Muskatnuss, Knoblauch)*, Vollrohrzucker*, Rote-Bete-Saft* (färbendes Lebensmittel), Rauch *aus kontrolliert ökologischer Erzeugung', '2023-04-10 20:11:21', 256.25, 'SAUSAGE', 'FRESH', 89, 20.5, NULL, NULL, NULL);
