(2698, 'Mein Ei Ersatz gf (Weiling)', '4005394100929', 0, 1.59, 1, 1, NULL, 0, NULL, 'Mein Ei Ersatz gf', 'Ei-Ersatz, 100% pflanzlich, BIO Dein Ei-Ersatz eignet sich perfekt für süße Gebäcke wie Waffeln, Pfannkuchen oder Pancakes. Oder für herzhafte Gerichte wie Kartoffel- und Gemüsepuffer, Aufläufe, Serviettenknödel oder zum Panieren. Zur Zubereitung von Rühr- oder Spiegelei nicht geeignet.', 'Biovegan GmbH', 'Biovegan', 'Bonefeld, RLP', NULL, 'manager', '2023-01-02 08:54:18', 'manager', '2023-01-02 08:54:31', 2786, NULL, 0, NULL, 0, 0.91, 'Weiling', 0, NULL, 0, NULL, 'SÜSSLUPINENMEHL*, Maisstärke*, Maismehl*, Verdickungsmittel: Guarkernmehl*; Leinprotein*, Sonnenblumenprotein*, Emulgator: Lecithine* (Sonnenblume*).\r\nenthält folgende allergene Zutaten: Lupine\r\n*aus kontrolliert ökologischer Erzeugung', '2023-01-02 08:54:38', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL),
