(2711, 'Zartbitter Crunchies (Weiling)', '4260645761728', 0, 3.99, 1, 1, NULL, 0, NULL, 'Zartbitter Crunchies', 'Crunchige Flakes mit mit herber Zartbitterschokolade. Die perfekte Kombination für alle Zartbitter Freunde!\r\n\r\nSchokoladige Crunchies genießen und das auch noch vegan? Mit unseren veganen Bio Zartbitter Crunchies ist das möglich! Knackiger Crunch umhüllt mit herber Zartbitterschokolade - Die perfekte Kombination für alle Schokoladenfans! Genießen und auch der Umwelt etwas Gutes tun: Die Zutaten sind aus kontrolliert biologischem Anbau und auch die Verpackung ist zu 100 Prozent recyclebar und schont damit die Natur.', 'CMMA Gartmann GmbH', 'Gartmann', 'Hamburg', NULL, 'manager', '2023-01-05 11:13:36', 'manager', '2023-02-27 11:38:07', 2799, NULL, 0, NULL, 0, 2.5, 'Weiling', 0, NULL, 0, NULL, '68 % Bio Zartbitterschokolade (Kakao: 60% mindestens) (Rohrohrzucker*, Kakaomasse*, Kakaobutter*), Bio Cornflakes (Mais*,Rohrzucker*,Salz).\r\n*aus kontrolliert ökologischer Erzeugung', '2023-02-27 11:38:07', 2592, 'SWEETS', 'SNACKS', NULL, 18, NULL, NULL, NULL),
