(2770, 'Feste Pflegedusche High Vitality (Weiling)', '4021457648016', 1, 5.49, 1, 1, NULL, 0, NULL, 'Feste Pflegedusche High Vitality', 'Entdecke das lavera Geheimnis natürlich vitalisierender Körperreinigung in fester Form: Die vegane Rezeptur mit Bio-Orange und Bio-Minze bietet ein angenehmes Schaumerlebnis mit wohltuendem Duft und reinigt die Haut sanft, ohne sie auszutrocknen. Für ein gepflegtes Hautgefühl schon bei der Anwendung.\n\n3x ergiebiger als Duschgel - Unsere feste Pflegedusche ist je nach Anwendungsgewohnheit dreimal ergiebiger als Duschgel.\n\nUnser Versprechen:\n- Naturkosmetik: Zertifiziert und dermatologisch getestet\n- Rezepturen: Biologisch abbaubar, ohne festes Mikroplastik, ohne künstliche Farb- und Konservierungsstoffe*\n- Verpackung: Recycelbares Kartonmaterial aus 100% Recyclingfasern\n„la vera“, die Wahre, engagiert sich für Klimaschutz und Tierschutz.\n* gem. EU-Kosmetik VO\n\nDas gute Gefühl von 100% zertifizierter Naturkosmetik – ohne Kompromisse.', 'Laverana GmbH & Co.KG', 'lavera', 'Hannover, Niedersachsen', '21ce4a54-26d9-484f-80e7-cdebad9e937c', 'manager', '2023-01-23 11:43:25', 'System', '2023-07-01 00:12:57', 2854, 2374, NULL, NULL, 0, 3.33, 'Weiling', 1, 1, 0, NULL, NULL, '2023-01-23 11:43:19', 108.108, 'BODY_CARE', 'DRUGSTORE', 57.8, 7.8, 'VEGAN;VEGETARIAN', NULL, NULL),
