(2776, 'Aufs Brot Mango Curry (Weiling)', '4016249150358', 0, 2.79, 1, 1, NULL, 0, NULL, 'Aufs Brot Mango Curry', 'Deutschland ist HOME OF THE STULLE. Und wer so leckeres Brot kann, der belegt das nicht mit irgend etwas. Da auch wir diesem Klassiker verpflichtet sind, haben wir uns in der Allos-Rezepte-Schmiede hingesetzt und ein paar würdige Aufstriche aus Rapsöl kreiert. Das Ergebnis ist so cremig, streichzart und lecker, das es sich ganz hervorragend auf dem Brot macht – aber auch zu Salaten, Pasta oder als Dip.', 'Allos Hof-Manufaktur GmbH', 'Allos', 'GERMANY', '9dadf50a-7969-43c9-9087-e4a07ef11b8c', 'manager', '2023-01-26 18:27:07', 'System', '2024-02-03 02:10:30', 2858, 2380, 0, NULL, 0, 1.81, 'Weiling', 0, NULL, 0, 61, 'Mangopüree* (25%), Rapsöl*, Orangensaft aus\nOrangensaftkonzentrat*, Sonnenblumenkerne*,\nWasser, Zitronensaft aus Zitronensaftkonzentrat*,\nAgavendicksaft*, Kokosmilch* (Kokosnussfleisch*, Wasser), Currypulver*\n(1,5%) (Koriander*, Kurkuma*, Fenchel*, Bockshornklee*,\nKümmel*, Ingwer*, Zwiebel*, Paprika*,\nKnoblauch*, Zimt*, Chili*), Meersalz, Obstessig*,\nEiweißpulver aus Sonnenblumenkernen*,\nTapiokastärke*,\nweißer Pfeffer*, Chilipulver*. *aus ökologischem Landbau.', '2023-01-26 18:27:31', 373.034, 'SPREADS_HONEY', 'PANTRY', 291, 7.4, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(2777, 'Kimchi 125 g (Weiling)', '4000915102024', 0, 3.19, 1, 1, NULL, 0, NULL, 'Kimchi 125 g', '„Prickelnd frisch – leicht säuerlich – besonders schmackhaft“. So in etwa lässt sich Kimchi beschreiben, das Nationalgericht der Koreaner. Die Rohware dazu gibt´s bei uns gleich um die Ecke. Bauer Drexl aus Kaufering, etwa 7 km von uns entfernt, liefert uns den regionalen Spitzkohl. Mittlerweile baut er jährlich 25 Tonnen Spitzkohl für bio-verde an.', 'Isana Naturfeinkost GmbH & Co. Produktions- und Handels KG', 'bio-verde', 'GERMANY', 'c4eda4d8-68ec-453d-86a3-66322cd8d747', 'manager', '2023-01-26 18:28:49', 'manager', '2023-01-26 18:29:01', 2859, 2381, 0, NULL, 0, 1.9, 'Weiling', 0, NULL, 0, 64, 'Spitzkohl* (61%), Zwiebeln*, Paprika*, Ingwer*,\nKarotten*, Knoblauch* (2%), konzentrierter\nApfelsaft*, Meersalz, Gewürze*, Gurke*, Kurkuma*,\nBranntweinessig* *aus kontrolliert ökologischer Erzeugung', '2023-01-26 18:29:08', 480.2, 'GOURMET_CONVENIENCE', 'FRESH', 140, 9.8, 'VEGAN;VEGETARIAN;PALMOILFREE', NULL, NULL),
