(2790, 'Thai-Curry Gewürzmischung (Weiling)', '4012346172804', 0, 1.49, 1, 1, NULL, 0, NULL, 'Thai-Curry Gewürzmischung', 'Für eine exotische Curry-Pfanne. Die thailändische Küche \nverlangt nach vielen Zutaten. Um Ihnen etwas Arbeit abzunehmen, ist der Großteil davon in dieser Würzmischung vereint. Kurkuma, Ingwer und Limette verbreiten einen Hauch Exotik, Galgant verleiht feine Schärfe. Und das Essen ist so gut wie fertig.', 'Ulrich Walter GmbH', 'LEBENSBAUM', 'Diepholz, Niedersachsen', '13244615-fd54-478e-b0b8-717bb5885904', 'manager', '2023-01-30 15:09:39', 'System', '2024-02-15 02:08:34', 2871, 2388, 0, NULL, 0, 0.89, 'Weiling', 2, 1, 0, 60, 'Zwiebel*, Kartoffelstärke*, Meersalz, Knoblauch*, Koriander*, Paprika*, Kurkuma*, Ingwer*, Rohrohrzucker*, Korianderblatt*(2 %), Limette*, Galgant*, Zitronenverbene*, Chili* *aus kontrolliert ökologischer Erzeugung', '2023-01-30 15:09:26', 82.5, 'CONVENIENCE_PRESERVES;SPICES_COOKING_HELP', 'PANTRY', 26.7, 16.5, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(2791, 'Ombar Rohschokolade Erdbeere + Kokosmilch', '5060102661085', 0, 2.79, 1, 1, NULL, 0, NULL, 'Ombar Rohschokolade Erdbeere + Kokosmilch', 'Schokolade zum Wohlfühlen\nOmbar ist eine zart schmelzende, köstlich cremige Schokolade aus Rohkakao.\n\nUnsere ausgezeichnete Premium-Schokolade wird aus hochwertigem Kakao hergestellt, der aus nachhaltigen Kleinbetrieben in Ecuador stammt. \n\nVon unserer zart schmelzenden Kokosmilchsorte, über die besondere Note der 72% Rohkakao bis hin zu dem fruchtigen Geschmack von Blaubeere + Acai bietet Ombar ein vielseitiges Sortiment für jeden Geschmack. \n\nVegan\nUnsere gesamte Schokolade ist 100% pflanzlich – besser für unsere Gesundheit und den Planeten.\n\nWir sind Bio-zertifiziert\nUnsere Inhaltsstoffe sind außergewöhnlich. Deswegen sind wir bei der Organic Food Federation zertifiziert.\n\nFair Trade\nDas Wohlbefinden unserer MitarbeiterInnen liegt uns am Herzen – von den Kakaobauern bis zu unserem Produktionsteam. \n\nWarum Rohkakao?\nWeil Kakao unglaublich nährstoffreich ist – und wir das Gute im Kakao bewahren wollen! Bei den meisten Schokoladen wird der Kakao geröstet, wodurch viele der natürlich guten Inhaltsstoffe zerstört werden.\n\nUnser Kakao wird bei niedrigen Temperaturen verarbeitet, so dass er seine Aromen und seine gesunden Nährstoffe behält. Dazu fügen wir ausschließlich nachhaltige, fair gehandelte Premium-Zutaten bei. \n', 'Mood Foods Ltd.', 'Ombar', 'UNITED_KINGDOM', 'db700ed7-3866-49d3-9472-c22ebb566c03', 'manager', '2023-01-30 15:11:35', 'System', '2023-12-09 03:28:26', 2872, 2389, 0, 12, 0, 1.66, NULL, 0, NULL, 0, 189, 'Kokosblütenzucker*, ungerösteter Kakao*+, Kakaobutter*, Kokoscreme* (14%), Erdbeerpulver* (7%), Vanilleextrakt*, Live-Kulturen: Lactobacillus acidophilus *aus kontrolliert ökologischem Anbau, +Fair Trade-zertifiziert gemäß der Fair for Life Standards (46%). Kakaogehalt mind. 55% *aus kontrolliert ökologischer Erzeugung', '2023-01-30 15:12:14', 25, 'SWEETS', 'SNACKS', 37, 10, 'VEGAN;VEGETARIAN;RAWFOOD', NULL, NULL),
(2792, 'Edamame ohne Schale', '4026813000538', 0, 3.59, 1, 1, NULL, 0, NULL, 'Edamame ohne Schale', 'Das Gemüse von bio inside ist reich an Vitaminen und Vitalstoffen. Es wird erntefrisch verarbeitet und schonend tiefgefroren. So bleiben die Nähstoffe am besten erhalten und bewahren dabei ihr sortentypisches Aroma.', 'Demeter-Felderzeugnisse GmbH', 'bio inside', 'NETHERLANDS', '1f22adff-d705-4321-8648-c470225984a8', 'manager', '2023-01-31 11:13:03', 'System', '2023-09-08 02:08:48', 2873, 2390, 0, NULL, 0, 2.48, NULL, 0, NULL, 0, 120, 'SOJABOHNEN* *aus kontrolliert ökologischer Erzeugung', '2023-01-31 11:13:03', 704, 'VEGETABLES_HERBS_FROZEN', 'FROZEN', 307, 22, 'VEGAN;VEGETARIAN;GLUTENFREE', NULL, NULL),
(2793, 'Snäckebrot Curry & Kürbiskern (Weiling)', '4005561536032', 0, 2.99, 1, 1, NULL, 0, NULL, 'Snäckebrot Curry & Kürbiskern', 'Anders als Brot, mehr als ein Knäcke und besser als ein Snäck - eben ´Snäckebrot´! Snäckebrot schmeckt zum Frühstück, als Snäck zwischendurch und beim gemütlichen Abend mit lieben Menschen. Erhältlich in verschiedenen Geschmacksrichtungen. Für verführerische Beleg-Varianten & ideal zum Dippen & Snäcken.', 'Bohlsener Mühle ', 'Bohlsener Mühle', 'GERMANY', '2986e2f3-ab16-43c6-9b19-f7a861ff2f7d', 'manager', '2023-02-03 10:48:14', 'System', '2023-09-23 02:16:12', 2874, 2391, 1, NULL, 0, 1.86, 'Weiling', 0, NULL, 0, 60, 'WEIZENmehl Type 1050*, Topping (Kürbiskerne* zerkleinert 6 %, Maltodextrin* (Mais*), Rohrohrzucker*, ungehärtetes Palmfett*, Honig* 1 %, teilentrahmtes MILCHpulver*, Emulgator: SOJA-Lecithine*), WEIZENvollkornschrot*, Sonnenblumenöl* 10 %, DINKELvollkornschrot*¹, HAFERvollkornflocken* geschrotet, Leinsamen* 3 %, Reismehl*, SESAM*, Curry* 2%, Meersalz, Hefe*, Antioxidationsmittel: Rosmarinextrakt*. *aus kontrolliert ökologischer Erzeugung', '2023-02-03 10:48:12', 1134, 'BREAD_BUNS', 'PASTRY', 216, 18, 'VEGETARIAN', NULL, NULL),
(2794, 'Cashewkerne, ganz, 100 g (Weiling)', '4035626110877', 0, 3.49, 1, 1, NULL, 0, NULL, 'Cashewkerne, ganz, 100 g', 'Die bioladen*Cashewkerne kommen aus unserem bioladen*Fair Projekt aus Burkina Faso. Mit dem Kauf gehen pro Verpackung 5 Cent in dieses Projekt. Sie wollen mehr zum Projekt erfahren, dann schauen Sie auf bioladen.de/qr/burkinafaso. Die Herstellung ist reine Handarbeit. Im Geschmack sind sie mild-nussig und leicht süßlich. Man kann sie gut für Saucen, in Pestos, in Gebäck oder einfach als Snack verwenden. (Es handelt sich um ungeröstete und ungesalzene Ware.)\n', 'Weiling GmbH', 'bioladen', 'GERMANY', '06ddc372-9e70-48de-8c3c-949771b25487', 'manager', '2023-02-03 10:51:45', 'System', '2023-10-14 02:07:20', 2875, 2392, 0, NULL, 0, 2.18, 'Weiling', 0, NULL, 0, 60, NULL, '2023-02-03 10:51:44', 489.375, 'OTHER', 'OTHER', 103, 14.5, 'VEGAN;VEGETARIAN', NULL, NULL),
(2795, 'Byodo Delikatess Mayonnaise, 80% Fett, Tube', '4018462158104', 0, 2.29, 1, 1, NULL, 0, NULL, 'Byodo Delikatess Mayonnaise, 80% Fett, Tube', 'Die klassische Bio-Mayonnaise von Byodo wird mit Eiern von freilaufenden Bio-Hühnern hergestellt. Sie ist wunderbar cremig und  schmeckt angenehm mild. Sie verfeinert  wunderbar Kartoffel- und Feinkostsalate, ist eine tolle Basis für selbstgemachte Saucen und ist ein cremig-köstlicher Genuss auf Häppchen. Als klassische Mayonnaise hat die Creme einen Fettgehalt von 80%.\nDank der 100 ml-Tube lässt sich diese Bio-Mayonnaise leicht portionieren und ist schnell verbraucht. Für immer-frischen Mayo-Genuss!', 'Byodo Naturkost GmbH', 'Byodo', 'GERMANY', '60d24a2c-d976-4d66-9662-a6ea2d2d7d45', 'manager', '2023-02-03 10:53:35', 'System', '2023-12-17 03:07:12', 2876, 2393, 0, NULL, 0, 1.34, NULL, 0, NULL, 0, 67, 'Sonnenblumenöl*, EIGELB* (7,1%), Wasser, Branntweinessig*, Zucker*, SENF* (Wasser, SENFSAAT*, Branntweinessig*, Steinsalz, Gewürze*, Gewürzextrakt*), Meersalz, Zitronensaftkonzentrat* *aus kontrolliert ökologischer Erzeugung', '2023-04-24 22:37:28', 166.5, 'OIL_VINEGAR_SAUCES', 'PANTRY', 105.1, 18.5, 'VEGETARIAN;HALAL;GLUTENFREE', NULL, NULL),
(2796, 'Ramen - Japanische Nudelsuppe mit Ingwer (Weiling)', '4020943134309', 0, 3.99, 1, 1, NULL, 0, NULL, 'Ramen - Japanische Nudelsuppe mit Ingwer', 'Lassen Sie sich von dem köstlich-würzigen Geschmack dieser original japanischen Suppe überraschen! Ganz ohne Kochen zubereitet ist sie eine ideale Mahlzeit für unterwegs, am Arbeitsplatz oder wenn es mal schnell gehen soll.', 'Arche Naturprodukte GmbH', 'Arche Naturküche', 'JAPAN', '683ff6c1-0e6e-47d5-951a-5a6bcb4eeac3', 'manager', '2023-02-03 10:54:41', 'System', '2023-06-21 02:05:42', 2877, 2394, 0, NULL, 0, 2.47, 'Weiling', 0, NULL, 0, 668, 'Nudeln (73%): WEIZENMEHL*, Meersalz\n\n\nBrühe: Reismiso* (SOJABOHNEN*, Vollkornreis*, Meersalz, Wasser, Aspergillus oryzae),  GERSTENMALZ*, Shoyu* (Wasser, SOJABOHNEN*, WEIZEN*, Meersalz, Aspergillus oryzae), Wasser, SESAMÖL*, Meersalz, Ingwer*, Chili* *aus ökologischer Landwirtschaft', '2023-02-03 10:54:39', 761.4, 'CONVENIENCE_PRESERVES', 'PANTRY', 111, 18.8, 'VEGAN;VEGETARIAN', NULL, NULL),
(2797, 'Glow by Nature Tagespflege (Weiling)', '4021457650859', 1, 15.99, 1, 1, NULL, 0, NULL, 'Glow by Nature Tagespflege', 'Erlebe das lavera Gefühl spürbar vitalisierter Haut:\nUnsere Glow by Nature Tagespflege wirkt müder Haut und ersten Anzeichen von Hautalterung auf natürliche Weise entgegen. Die hochwirksame Formel mit natürlichem Coenzym Q10 und Vitamin C reduziert freie Radikale und schützt so vor oxidativem Stress. Sie vitalisiert müde Haut, spendet langanhaltend Feuchtigkeit und mindert erste Fältchen. Spüre, wie die schnell einziehende Textur sanft mit deiner Haut verschmilzt und ihr dabei wunderbar leichte Pflege schenkt – für einen gesund aussehenden, strahlenden Teint.\n\nDie innovative Pflegeformel für einen natürlichen Glow:\n- Mindert erste Fältchen \n- Wirkt Anzeichen müder Haut entgegen \n- Verleiht der Haut neue Strahlkraft\n\nNatürliches Coenzym Q10 – ist am Energiestoffwechsel der Zellen beteiligt und schützt durch seine antioxidativen Eigenschaften vor frühzeitiger Hautalterung.\nNatürliches Vitamin C – ist ein hochwirksames Antioxidans und schützt die Haut als bedeutender Radikalfänger vor oxidativen Schäden.\n\nUnser Versprechen:\n- Biologisch abbaubare Rezeptur ohne Mineralöle und ohne künstliche Duft-, Farb- und Konservierungsstoffe*\n- Zertifiziert nach dem strengen, unabhängigen NATRUE Naturkosmetikstandard. Verträglichkeit dermatologisch bestätigt\n- Der Tiegel (exkl. Verschluss) besteht aus 90 % Altglas und das Kartonmaterial dieser Faltschachtel ist aus 100 % Recyclingfasern\n- Nach PETA-Kriterien zertifiziert und für das Tierwohl engagiert\n- Exklusive Naturkompositionen aus der lavera-Forschung, mit dem Besten aus der Natur\n* gem. EU-Kosmetik VO\n\nDas gute Gefühl von 100 % zertifizierter Naturkosmetik – ohne Kompromisse.\n\nlavera. Natur, die du fühlst.', 'Laverana GmbH & Co.KG', 'lavera', 'Hannover', 'a91dc126-d1ab-40ed-a085-32caada5fb5e', 'manager', '2023-02-03 10:56:14', 'System', '2023-07-01 00:38:36', 2878, 2395, NULL, NULL,