(2803, 'Sushi Nori Bio - 6 Blätter (Weiling)', '8713576003611', 0, 6.19, 1, 1, NULL, 0, NULL, 'Sushi Nori Bio - 6 Blätter', 'Sushi Nori ist in der Hauptsache für die Herstellung von Sushi-Rollen gedacht.  Das Einrollen von Reis ist jedoch nicht die einzige Möglichkeit. Du kannst sie  auch für vietnamesische (Sommerrollen), mediterrane (mit Hummus) oder eine  kohlenhydratarme Version (mit zerdrückter Avocado, Sprossen und anderem  frischen Grün) verwenden. Dieses Sushi Nori ist aus kontrolliert biologischem  Anbau, was etwas ganz Besonderes ist. Video: So ernten wir in Japan Meeresalgen.', 'TerraSana Natuurvoeding BV', 'TerraSana', 'SPAIN', '80a60be7-50f0-43ab-9438-7887119250ea', 'manager', '2023-02-03 12:53:05', 'System', '2023-11-23 02:08:44', 2884, 2397, 0, NULL, 0, 3.7, 'Weiling', 0, NULL, 0, 172, 'getrocknete und geröstete Bio-Nori-Meeresalgen* *aus kontrolliert ökologischer Erzeugung', '2023-02-03 12:55:10', 116.6, 'CONVENIENCE_PRESERVES', 'PANTRY', 20, 26.5, 'VEGAN;VEGETARIAN;GLUTENFREE', NULL, NULL),
(2804, 'Smoothie Mango Maracuja, kühlfrisch (Weiling)', '4015533054341', 1, 3.19, 1, 1, NULL, 0, NULL, 'Smoothie Mango Maracuja, kühlfrisch', 'Seit vier Generationen glauben wir als Demeter- und Bio-Pionier an ein Leben im Einklang mit der Natur. Ihre Vielfalt ist die Quelle der Inspiration für unser Sortiment. Mit der gemeinwohlorientierten Voelkel Stiftung setzen wir uns deshalb für Biodiversität und eine zukunftsfähige Landwirtschaft ein.\nLagern im Kühlregal bei + 5° bis + 10°', 'Voelkel GmbH', 'Voelkel', 'GERMANY', '46fac8af-1555-426a-afdf-7b81702e68b8', 'manager', '2023-02-07 10:35:26', 'System', '2024-02-02 02:13:50', 2885, 2398, 0, NULL, 0, 1.69, 'Weiling', 0, NULL, 0, 64, 'Apfelsaft* 28%, Orangensaft*, Mangomark* 19%, Apfelmark* 14%, Bananenmark*, Zitronensaft*, Maracujasaft* 1,5%. *aus kontrolliert ökologischer Erzeugung', '2023-05-12 11:20:32', 521.42, 'SMOOTHIES_SYRUPS', 'DRINKS', 412.9, 15.5, 'VEGAN;VEGETARIAN', NULL, NULL),
(2805, 'Geröstete Erdnüsse mit Salz (Weiling)', '4035661162633', 0, 4.19, 1, 1, NULL, 0, NULL, 'Geröstete Erdnüsse mit Salz', 'Die bioladen*Erdnüsse kommen aus unserem bioladen*Fair Projekt aus Burkina Faso. Mit dem Kauf gehen pro Verpackung 5 Cent in dieses Projekt. Sie wollen mehr zum Projekt erfahren, dann schauen Sie auf bioladen.de/qr/burkinafaso. Die Erdnüsse werden knackig geröstet und gesalzen. ', 'Weiling GmbH', 'bioladen', 'GERMANY', '089ab204-0199-4297-8f2c-ef62e9f35de2', 'manager', '2023-02-07 10:39:07', 'System', '2023-05-25 02:04:37', 2886, 2399, 0, NULL, 0, 2.49, 'Weiling', 0, NULL, 0, 72, 'ERDNUSSKERNE* (95 %), Sonnenblumenöl*, Steinsalz *aus kontrolliert ökologischer Erzeugung', '2023-04-10 20:08:03', 455.625, 'SALTY', 'SNACKS', 154, 13.5, 'VEGAN;VEGETARIAN', NULL, NULL),
