(2807, 'Tofeé Tofu Halloumi-Style (Weiling)', '4026427000511', 0, 2.49, 1, 1, NULL, 0, NULL, 'Tofeé Tofu Halloumi-Style', 'Bio-Sojabhnen von Vertragsanbauern aus Österreich oder Deutschland. Braten, backen, würfeln, krümeln. Eine frische Tofu-Erfahrung. Der erste Tofu im Halloumi-Style. ', 'Tofutown.com GmbH', 'KATO', 'GERMANY', '32fff2ba-013b-4dbf-bb50-9189ef502c8f', 'manager', '2023-02-10 09:07:36', 'manager', '2023-02-10 09:07:47', 2888, 2401, 0, NULL, 0, 1.52, 'Weiling', 0, NULL, 0, 60, 'Trinkwasser, SOJABOHNEN* (40 %), Kokosfett*, Reifekultur, Gerinnungs-mittel: Calciumsulfat, Glukose*, Meersalz. *aus kontrolliert ökologischer Erzeugung', '2023-02-10 09:07:54', 312.375, 'VEGAN_VEGETARIAN', 'FRESH', 213, 10.5, 'VEGAN;VEGETARIAN;WITHOUT_ADDED_SUGAR', NULL, NULL),
(2808, 'BioSaurus aus Mais Ketchup (Weiling)', '8588004638327', 0, 2.19, 1, 1, NULL, 0, NULL, 'BioSaurus aus Mais Ketchup', 'Dinostarker Knabberspaß in allen Formen und Farben: Mit ihrem einzigartigen Design, das alle Blicke anzieht, sind BioSaurus die perfekte Ergänzung für Ihr Snackregal. Nach dem phänomenalen Start im Naturkosthandel ist klar, diese Saurier erobern die Welt im Sturm. Die hochwertigen Mais-Snacks werden aus sorgfältig ausgewählten, biologisch angebauten Rohstoffen hergestellt. Da sie schonend extrudiert werden, sind sie fettärmer als vergleichbare frittierte Snacks. Zum Einsatz kommt dabei nur europäisches High-Oleic-Sonnenblumenöl, das immer erst nach dem Backen hinzugefügt wird, sodass das Öl nie heißer als 120°C wird. Durch die Zugabe des Fetts bei niedrigeren Temperaturen ist der Gehalt an Transfetten besonders niedrig. Ein Lieblingsprodukt aller ernährungsbewussten Eltern.\n\nNeben den bekannten und beliebten Sauriern Junior (Sea Salt), Igor (Cheese) und Babe (Ketchup) gibt es ab sofort auch gepoppte Chips in unterschiedlichen Formen und Geschmacksrichtungen. Sorten wie Lila Mais – Sea Salt, Rote Linse – Red Pepper und Mais – Nacho Cheese runden Ihr Snackangebot ab. Die knackigen Snacks sind dabei nicht nur lecker, sondern auch cool und nachhaltig. Wie alle Snacks von BioSaurus bestechen die Popped durch ihre angenehme Würzung, ihr auffälliges Design und ihren Spaßfaktor. Alle BioSaurus Snacks sind vegetarisch, glutenfrei- und bio-zertifiziert.', 'McLLOYD´S s.r.o.', 'BioSaurus', 'SLOVAKIA', '239cee2c-7218-4260-aba9-74f660d90efc', 'manager', '2023-02-10 09:12:12', 'System', '2023-06-28 02:12:09', 2889, 2402, 0, NULL, 0, 1.28, 'Weiling', 0, NULL, 0, 143, 'Mais* 80% [Mehl*, Gries*], Sonnenblumenöl*, Ketchupwürzmischung* 5%\n(Tomaten*, Zucker*, Salz, Zitronenpulver*, Zwiebeln*, Hefeextrakt*, Gewürze* [Knoblauch*, Pfeffer*, Nelken*, Zimt*], Paprika-Extrakt*). *aus kontrolliert ökologischer Erzeugung', '2023-02-10 09:11:57', 2028, 'SALTY', 'SNACKS', 54, 26, 'VEGAN;VEGETARIAN;GLUTENFREE', NULL, NULL),
(2809, 'Wunderbrödchen Weltmeister (Weiling)', '4015637015286', 0, 3.99, 1, 1, NULL, 0, NULL, 'Wunderbrödchen Weltmeister', 'Für uns als Mühle, mit regionalen Wurzeln und enger Verbundenheit mit unseren Landwirten, spielt Hafer eine wichtige Rolle. So ist Hafer auch die Basis unseres beliebten Bauckhof Wunderbrøds. Und das gibt es jetzt auch in Klein! Für das gemütliche Frühstück oder Abendbrot, für den schnellen Snack unterwegs oder die Picknick-Tafel. Dieses Produkt ist bei der Deutschen Zöliakie-Gesellschaft registriert.', 'Bauck GmbH', 'Bauckhof', 'GERMANY', '26dbc714-d7ab-4f74-ae82-cc0afeacfb63', 'manager', '2023-02-10 09:15:18', 'System', '2023-10-26 02:06:42', 2890, 2403, 2, NULL, 0, 2.44, 'Weiling', 0, NULL, 0, 64, 'Saaten* 48 % (Goldleinsaat geschrotet*, Sonnenblumenkerne**, SESAM**, Blaumohn*), HAFERvollkornflocken glutenfrei**, gemahlene Flohsamenschalen*, Steinsalz *aus kontrolliert ökologischer Erzeugung **aus biodynamischer Erzeugung', '2023-02-10 09:16:20', 961.875, 'BAKING_INGREDIENTS;BREAD_BUNS', 'PANTRY;PASTRY', 357, 22.5, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(2810, 'Junge Jackfrucht in Salzlake (Weiling)', '4260479380027', 0, 3.99, 1, 1, NULL, 0, NULL, 'Junge Jackfrucht in Salzlake', 'Was ist Jackfruit?\nJackfruit ist mit bis zu 40 Kilogramm die größte Baumfrucht der Welt, deren Potenzial jedoch nicht ausgenutzt wird. Bislang verkommen in Sri Lanka bis zu 70% der Jackfruits, da die Früchte bisher wenig gehandelt werden. Die Bäume können so groß wie Eichen werden und über eine Tonne Jackfruits tragen. Unsere Jackfruit-Bäume stehen in Mischkulturen mit zum Beispiel Mangobäumen oder Ananaspflanzen. Für Jacky F. Bio-Jackfruits verwenden wir ausschließlich die knackigen jungen Jackfrüchte. Diese Unterscheidung ist wichtig, denn nur die jungen Früchte eignen sich für herzhafte Gerichte. Die reifen, süßen Früchte eignen sich eher für Nachspeisen.\n\nUnd was mache ich mit Jackfruit?\nJacky F. - Das ist Fruchtfleisch! Denn die Konsistenz erinnert an saftiges Hühnchenfleisch. Ob Frikadellen, Pulled Jackfruit oder asiatisches Curry, Jackfruit ist vielseitig einsetzbar. Auf jeder Dose ist zudem ein Rezeptbüchlein. Unsere Jackfruits zeichnen sich durch eine hohe Bissfestigkeit aus, die sehr entscheidend ist, wenn die Produkte als Burger oder Gulasch verwendet werden. \nIm Gegensatz zu vielen anderen Fleischalternativen ist Jacky F. Bio-Jackfruit soja- und glutenfrei, wenig verarbeitet und ganz natürlich, nur mit Meersalz und Limettensaft, eingekocht.', 'Api Jamu GmbH', 'Jacky F.', 'SRI_LANKA', '095bdf86-f182-4aa1-befc-b802c2208ada', 'manager', '2023-02-10 09:19:08', 'manager', '2023-02-10 09:19:26', 2891, 2404, 0, NULL, 0, 2.49, 'Weiling', 0, NULL, 0, 67, 'Bio-Jackfrucht*, Wasser, Meersalz, Bio-Limettensaft* *aus kontrolliert ökologischer Erzeugung', '2023-02-10 09:19:04', 630, 'CONVENIENCE_PRESERVES', 'PANTRY', 445, 11.2, 'VEGAN;VEGETARIAN;GLUTENFREE;WITHOUT_ADDED_SUGAR', NULL, NULL),
(2811, 'Rodelika - Möhre (Saatgut) (Weiling)', '4260012641233', 0, 3.1, 1, 1, NULL, 0, NULL, 'Rodelika - Möhre (Saatgut)', 'Stark wachsende, ertragreiche Sorte mit kräftigem Laub. Große, abgestumpfte, glattschalige Möhre mit intensiv orange-roter Farbe, sowie kräftig-aromatischem Geschmack. Rodelika können Sie sehr gut Einlagern. Kulturdauer etwa 5 Monate.\n\"TIPP\": Gegen Möhrenfliege wählen Sie eine freie, windige Lage oder decken die Kultur mit Vlies ab. Keine frische Düngung! Möhren nur alle sechs Jahre an derselben Stelle anbauen.', 'Bingenheimer Saatgut AG', 'Bingenheimer Saatgut', 'GERMANY', 'faa3f17e-f83c-449d-a396-0ccac339299b', 'manager', '2023-02-10 09:22:32', 'System', '2023-12-11 02:12:42', 2892, 2405, 2, NULL, 0, 2.01, 'Weiling', 0, NULL, 0, NULL, NULL, '2023-03-02 14:00:33', 28.044, 'SEEDS', 'DRUGSTORE', 4.56, 11.4, 'VEGETARIAN', NULL, NULL),
