(2838, 'Tomatenmark Tube Byodo (Weiling)', '4018462603543', 0, 2.19, 1, 1, NULL, 0, NULL, 'Tomatenmark Tube Byodo', 'Doppelte Konzentration für ein vielfaches an Genuss. Das verspricht das Byodo Tomatenmark Doppelfrucht in der praktischen und zu 100% recycelten Tube. Der intensive Geschmack sonnenverliebter, italienischer Tomaten wurde in dem leckeren Bio-Tomatenmark herrlich eingefangen und gibt vielen Speisen eine wunderbar fruchtige Note.', 'Byodo Naturkost GmbH', 'Byodo', 'ITALY', '48ba732d-e83e-4af6-a660-24d43d5e9347', 'manager', '2023-03-02 15:49:21', 'System', '2023-12-17 03:06:53', 2916, 2420, 0, NULL, 0, 1.23, 'Weiling', 0, NULL, 0, 103, 'Tomaten* (28-30% Trockenmasse) *aus kontrolliert ökologischer Erzeugung', '2023-04-10 20:10:10', 251.125, 'CONVENIENCE_PRESERVES', 'PANTRY', 161.1, 20.5, 'VEGAN;VEGETARIAN;KOSCHER;HALAL;WITHOUT_ADDED_SUGAR', NULL, NULL),
(2839, 'Cashewmus Crunchy mit Steinsalz (Weiling)', '8713576003598', 0, 7.49, 1, 1, NULL, 0, NULL, 'Cashewmus Crunchy mit Steinsalz', 'Unser Cashewmus besteht aus leicht gerösteten, Bio-Cashewnüssen, verfeinert  mit einer Prise Salz. Dieser leckere Brotaufstrich hat einen leicht süßen  Geschmack und eine cremige Konsistenz. Was du schmeckst, sind pure Cashewnüsse  von bester Qualität und die schonende Verarbeitung. Cashewmus ist besonders  lecker auf Brot oder Crackern, aber es eignet sich auch sehr gut zum Backen  oder um seine eigene Nussmilch damit herzustellen. Ein Highlight zum Frühstück  oder Mittagessen!  Probiere auch einmal unsere anderen 17 Nussmuse aus!', 'TerraSana Natuurvoeding BV', 'TerraSana', 'NETHERLANDS', 'cca20a8e-6b64-4f1a-ac0d-793059ef7b53', 'manager', '2023-03-07 09:57:58', 'System', '2023-09-07 03:10:47', 2917, 2421, 0, NULL, 0, 4.67, 'Weiling', 0, NULL, 0, 120, 'CASHEWNÜSSE geröstet*, Steinsalz *aus kontrolliert ökologischer Erzeugung', '2023-03-07 09:59:48', 441, 'SPREADS_HONEY', 'PANTRY', 420, 9, 'VEGAN;VEGETARIAN;GLUTENFREE', NULL, NULL),
