(2848, 'Edel Bitter 100% Cacao + Nibs, Santo Domingo', '4044889004106', 0, 2.79, 1, 1, NULL, 0, NULL, 'Edel Bitter 100% Cacao + Nibs, Santo Domingo', 'Die VIVANI Edel Bitter 100% + Nibs bietet den ultimativen Cacao-Genuss, mehr Cacao geht nicht! Der Santo-Domingo-Edelkakao wird in seiner aromatischen Note unterlegt mit crunchigen Kakaosplittern.\n\nDurch die dünne 80 g Tafelausformung entfaltet sich ein unvergleichlicher Schmelz im Mund, was den herben Kakaogeschmack gekonnt in Szene setzt.', 'EcoFinia GmbH', 'Vivani', 'GERMANY', '17854993-ea5c-4338-8b51-431d67967f55', 'manager', '2023-03-10 09:32:57', 'manager', '2023-03-10 09:38:05', 2925, 2422, 0, NULL, 0, 1.62, NULL, 0, NULL, 0, 67, 'Kakaomasse*°, Kakaobutter*°, Kakao Nibs*° 5%. Kakao: 100%.\nKann Bestandteile von SCHALENFRÜCHTEN, MILCH und GLUTEN enthalten. *aus kontrolliert ökologischer Erzeugung', '2023-03-10 12:43:48', 139.048, 'SWEETS', 'SNACKS', 94, 19.1, 'VEGAN;VEGETARIAN;PALMOILFREE;KOSCHER', NULL, NULL),
