(2858, 'Weißer Pfeffer, ganz', '4012346157504', 0, 3.99, 1, 1, NULL, 0, NULL, 'Weißer Pfeffer, ganz', 'Bezeichnend für weißen Pfeffer ist seine aromatische, milde Schärfe. Zu seiner Herstellung werden nur die hellen Kerne der reifen Pfefferbeeren verwendet. Frisch gemahlener weißer Pfeffer darf in keiner  Béchamelsauce fehlen - eignet sich aber genauso gut auch für Geflügel oder Fisch.', 'Ulrich Walter GmbH', 'LEBENSBAUM', 'GERMANY', '4f33d69b-43c3-487c-928f-35f6f6fd43f7', 'manager', '2023-03-21 09:15:14', 'manager', '2023-03-21 09:20:21', 2935, 2430, 0, NULL, 0, 2.23, NULL, 0, NULL, 0, 60, 'Weißer Pfeffer* *aus kontrolliert ökologischer Erzeugung', '2023-03-21 09:21:41', 269.5, 'SPICES_COOKING_HELP', 'PANTRY', 53, 14, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(2859, 'Schwarzer Pfeffer, ganz', '4012346153803', 0, 3.69, 1, 1, NULL, 0, NULL, 'Schwarzer Pfeffer, ganz', 'Schwarzer Pfeffer schmeckt fruchtig-scharf. Die Beeren dieser Schlingpflanze werden noch vor der Reife von Hand gepflückt und dann sonnengetrocknet, wodurch sich die schwarze Farbe einstellt. Schwarzer Pfeffer verleiht allen Speisen und Gerichten eine pikante Note.', 'Ulrich Walter GmbH', 'LEBENSBAUM', 'GERMANY', '1f1d56b0-3281-4692-85a2-bcbf856ffcf4', 'manager', '2023-03-21 09:18:54', 'manager', '2023-03-21 09:19:49', 2936, 2431, 2, NULL, 0, 2.05, NULL, 0, NULL, 0, 60, 'Pfeffer schwarz** **aus biodynamischer Erzeugung', '2023-03-21 09:22:21', 269.5, 'SPICES_COOKING_HELP', 'PANTRY', 53, 14, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
