(2862, 'Mini Cookie Schoko Haselnuss (Weiling)', '4005561002421', 0, 2.49, 1, 1, NULL, 0, NULL, 'Mini Cookie Schoko Haselnuss', 'Genau das Richtige für den kleinen Genussmoment zwischendurch: der Mini Cookie Schoko Haselnuss! Genieß‘ entspannt deine Auszeit mit zartschmelzender Zartbitterschokolade und knackig aromatischen Haselnüsse, vereint in deinem Mini Cookie! Diese Kombi kann mehr als nur lecker: Beiß rein und erlebe die Schoko-Explosion mit ordentlich Nuss-Wumms.  \nDie Mini Cookie der Bohlsener Mühle werden mit Bioland-Weizenmehl aus der hauseigenen Wassermühle in Bohlsen gebacken, gesüßt mit Bioland Rübenzucker aus Deutschland.\n\n\nDie Werte des Bio-Pioniers Bohlsener Mühle finden sich auf der Verpackung der Mini Cookies wieder: kurze Transportwege, Klimaschutz und regionaler Anbau werden thematisiert. Auch gegen Lebensmittelverschwendung setzt sich das Unternehmen mit dem Hinweis »oft länger gut« auf der Verpackung ein.\n\n\nDie Bohlsener Mühle\n\nGemahlen wird in Bohlsen seit 1265.\nIn unserer Wassermühle verarbeitet die Bohlsener Mühle seit mehr als 40 Jahren 100 % ökologische Rohstoffe. Gemeinsam mit den Landwirtinnen und Landwirten, die die Bohlsener Mühle beliefern, setzt sich das  mittelständische Unternehmen für zukunftsfähiges Wirtschaften, ökologischen Landbau und ihre Region ein. Heute werden in der Mühle und der Bäckerei vielfältige Bio-Lebensmittel gemahlen, gebacken und komponiert. Dabei verbindet die Bohlsener Mühle traditionelles Handwerk mit modernster Herstellungstechnik und klaren Rezepturen.', 'Bohlsener Mühle ', 'Bohlsener Mühle', 'GERMANY', 'e5237c3c-fac6-4050-a54f-68db1eb69ab1', 'manager', '2023-03-24 09:47:43', 'System', '2024-01-17 02:11:07', 2939, 2434, 1, NULL, 0, 1.43, 'Weiling', 0, NULL, 0, 60, 'WEIZENmehl Type 1050*, Rübenzucker*, Zartbitterschokolade* (20%) (Kakaomasse*, Rohrohrzucker*, Kakaobutter*, Emulgator: Sonnenblumen-Lecithine*), ungehärtetes Palmfett*, HASELNÜSSE* geröstet gehackt (6%), stark entölter Kakao* (3%), Backtriebmittel (Ammoniumbicarbonat, Natriumhydrogencarbonat), Meersalz. *aus kontrolliert ökologischer Erzeugung', '2023-05-02 14:12:52', 1007.5, 'SWEETS', 'SNACKS', 128.4, 15.5, 'VEGAN;VEGETARIAN', NULL, NULL),
