(2869, 'Gouda mittelalt, in Scheiben (Weiling)', '4035626114363', 0, 3.69, 1, 1, NULL, 0, NULL, 'Gouda mittelalt, in Scheiben', 'In wiederverschließbarer Verpackung. Herzhaft-pikanter mittelalter Gouda. In der Rinde gereift und daher besonders geschmackvoll. Hergestellt in der Käserei Aurora in Kranenburg in Deutschland aus Milch von Bioland-Betrieben vom Niederrhein. Hier wird von Käsekönnern nach traditionellen Methoden und mit modernster Technik Käse von hoher Qualität produziert.', 'Weiling GmbH', 'bioladen', 'GERMANY', '6d1aa768-31ff-40b8-9cb7-85a53ba49b08', 'manager', '2023-03-30 19:00:23', 'System', '2023-10-31 00:01:03', 2946, 2437, 1, NULL, 0, 2.24, 'Weiling', 0, NULL, 0, 120, '- *aus kontrolliert ökologischer Erzeugung', '2023-07-11 10:20:58', 685, 'CHEESE', 'FRESH', 161, 20, 'VEGETARIAN;LACTOSEFREE', NULL, NULL),
