(2873, 'Gute-Nacht-Tee (Weiling)', '4012346222806', 0, 3.99, 1, 1, NULL, 0, NULL, 'Gute-Nacht-Tee', 'Der Tag war aufregend? Das Gedankenkarussell dreht sich? In dieser harmonischen Kräuterteemischung gehen Melisse, Lavendelblüte und Passionsblume eine entspannte Verbindung mit duftigem Zitronengras und sanften Rosenblüten ein und begleiten Sie sanft durch den Abend. Einfach Augen schließen und – loslassen.', 'Ulrich Walter GmbH', 'LEBENSBAUM', 'Diepholz, NI', 'b8299dfc-18ab-4c27-a506-c0e1d3cc1023', 'manager', '2023-03-30 19:48:50', 'System', '2023-07-08 02:15:30', 2950, 2439, 0, NULL, 0, 2.35, 'Weiling', 2, 1, 0, 60, 'Rooibos*, Melisse*, Zitronengras*, Orange*, Lavendelblüte* (8 %), Passionsblume* (5 %), Rosenblüte*, Honigkraut* *aus kontrolliert ökologischer Erzeugung', '2023-03-30 19:48:48', 585, 'TEA', 'COFFEE_TEA_COCOA', 54.6, 12, 'VEGETARIAN;LACTOSEFREE;VEGAN', NULL, NULL),
(2874, 'Teriyaki (Weiling)', '4020943139397', 0, 3.99, 1, 1, NULL, 0, NULL, 'Teriyaki', 'Die Teriyaki Marinade & Würzsauce sorgt für besonderen Glanz! Das glutenfreie Bio Teriyaki hält, was die Herleitung des japanischen Names verspricht: „Teri“ bedeutet Glanz und „yaku“ steht für Braten, Schmoren und Grillen. Teriyaki ist eine der bekanntesten japanischen Saucen. Historisch gesehen ist Teriyaki noch eine recht junge Entdeckung, hat sich aber sicher auch wegen der einfachen und schnellen Anwendung zügig verbreitet. ARCHE Bio Teriyaki ist vegan und glutenfrei. Die Sauce sorgt für besonderen Glanz und köstlich-würzigen Geschmack. Mit der fertigen, fein abgeschmeckten Marinade auf Basis von Sojasauce gelingen Grill-, Wok- und Pfannengerichte und lassen sich Dressings und Saucen würzig abschmecken. Und das alles ganz ohne Knoblauch und nur mit Reissirup gesüßt... Tipp: Das glutenfreie ARCHE Bio Teriyaki schmeckt auch pur als Grillsauce!', 'Arche Naturprodukte GmbH', 'Arche Naturküche', 'ITALY', 'a0961a45-63ea-40cf-a020-735ee40af7ee', 'manager', '2023-03-30 19:50:04', 'System', '2023-10-17 02:06:03', 2951, 2440, 0, NULL, 0, 2.37, 'Weiling', 0, NULL, 0, 104, 'Reissirup*, Wasser, Tamari SOJAsauce* (20%) (Wasser, SOJAbohnen*, Salz, Alkohol*), Apfelessig*, Salz, Maisstärke*, Geliermittel: Pektin, Ingwerpulver*, Zwiebelpulver*, Pfefferpulver* schwarz, Verdickungsmittel: Xanthan *aus ökologischem Landbau', '2023-03-30 19:49:58', 388.784, 'OIL_VINEGAR_SAUCES', 'PANTRY', 350, 17.6, 'VEGAN;VEGETARIAN;GLUTENFREE', NULL, NULL),
(2875, 'Olivenwaschmittel Wolle & Seide (Weiling)', '4007547305007', 1, 7.49, 1, 1, NULL, 0, NULL, 'Olivenwaschmittel Wolle & Seide', 'Wertvolles gepresstes Olivenöl wird in diesem Produkt zu einer Seife verarbeitet, die für Textilien aus Wolle und Seide hervorragende reinigende, pflegende und rückfettende Eigenschaften besitzt. Mit Hilfe des Zuckertensids entsteht ein Feinwaschmittel auf Seifengrundlage, das auch bei hartem Wasser leicht handhabbar ist und alle positiven Eigenschaften eines Seifenwaschmittels beibehält. Das Olivenöl, Rapsöl und Sonnenblumenöl sowie das ätherische Lavendelöl kommen zu 100 % aus kontrolliert biologischem Anbau.\n\nOlivenwaschmittel für Wolle und Seide\nMit reiner Bio-Olivenölseife\n20° 30° 40°C\n\n• Für alle feinen Gewebe aus Naturfasern und Mischgewebe  \n• Erhält die Elastizität und Weichheit der Textilien\n• Zarter Duft von ätherischem Lavendelöl aus kontrolliert biologischem Anbau \n• 100 % biologisch abbaubar\n\n• Erhältlich: 120 ml, 1 Liter, 5 Liter, 10 Liter, 20 Liter', 'Sonett GmbH', 'SONETT', 'GERMANY', '55b87098-2c8f-4f7f-bdc0-af45b0a36c96', 'manager', '2023-03-30 19:54:02', 'System', '2024-02-14 02:08:50', 2952, 2441, NULL, NULL, 0, 4.41, 'Weiling', 0, NULL, 0, NULL, NULL, '2023-03-30 19:54:27', 1572.1, 'CLEANING', 'DRUGSTORE', 1050, 26.7, 'VEGAN;VEGETARIAN', NULL, NULL),
