(2879, 'Dusch-Peeling (Weiling)', '4021457648689', 1, 5.49, 1, 1, NULL, 0, NULL, 'Dusch-Peeling', 'Erlebe das lavera Gefühl seidenweicher Haut:\nDie pH-hautneutrale Formel unseres Peelings mit rein natürlichen Peelingkörpern befreit deine Haut sanft von losen Hautschüppchen und reinigt schonend mit milden Tensiden. Zugleich umhüllt dich ein einzigartiger grüner Duft nach Limette und Rosmarin, erfrischt und schenkt dir absolutes Wohlbefinden.\n\n- Entfernt sanft lose Hautschüppchen\n- Erfrischende Duftkomposition aus Limette & Rosmarin \n- Auch für trockene & sensible Haut geeignet\n\nMit Bio-Rosmarin und Bio-Grüner Kaffee\n\nBio-Rosmarin wird für seine durchblutungsfördernde und anregende Wirkung geschätzt\nBio-Grüner Kaffee wird aufgrund seiner anregenden und hautpflegenden Wirkung eingesetzt.\n\nUnser Versprechen:\n- Biologisch abbaubare Rezepturen ohne Mineralöle und ohne künstliche Duft-, Farb- und Konservierungsstoffe*\n- Zertifiziert nach dem strengen, unabhängigen NATRUE Naturkosmetikstandard. Verträglichkeit dermatologisch bestätigt\n- Kunststoff dieses Verschlusses aus 100 % recyceltem Material  \n- Nach PETA-Kriterien zertifiziert und für das Tierwohl engagiert\n- Exklusive Naturkompositionen aus der lavera-Forschung, mit dem Besten aus der Natur\n\nwww.lavera.de \n\n* gem. EU-Kosmetik VO\n\nlavera. Natur, die du fühlst', 'Laverana GmbH & Co.KG', 'lavera', 'Hannover, Niedersachsen', '7fb26ad4-5b56-4166-94bd-5426d292ac55', 'manager', '2023-04-04 10:37:10', 'System', '2023-10-20 02:09:10', 2956, 2442, NULL, NULL, 0, 2.93, 'Weiling', 1, 1, 0, NULL, NULL, '2023-04-04 10:37:07', 861.927, 'BODY_CARE', 'DRUGSTORE', 231.85, 19, 'VEGAN;VEGETARIAN', NULL, NULL),
(2880, 'Basenkräuter (Weiling)', '4012346242606', 0, 3.99, 1, 1, NULL, 0, NULL, 'Basenkräuter', 'Fünf abgestimmte Wildkräuter von Brennnessel bis Himbeerblatt verbinden sich mit Grünem Haferkraut und Zitronengras zu einer leichten Kräuterteemischung. \n\nZusammen bilden die Kräuter und Blüten ein feines Geschmackserlebnis - für kurze Auszeiten oder zwischendurch.', 'Ulrich Walter GmbH', 'LEBENSBAUM', 'GERMANY', '7eb26cec-aa64-4f8c-998b-5d8c62598f3a', 'manager', '2023-04-04 14:39:24', 'System', '2024-02-14 02:10:26', 2957, 2443, 0, NULL, 0, 2.35, 'Weiling', 0, NULL, 0, 60, 'Brennnessel*, GRÜNES HAFERKRAUT*, Himbeerblatt*, Zitronengras*, Fenchel*, Schafgarbe*, Koriander*, Lindenblüte* (4 %), Brombeerblatt*, Ringelblume*, Salbei*, Ysop* *aus kontrolliert ökologischer Erzeugung', '2023-04-04 20:18:31', 1443.75, 'TEA', 'COFFEE_TEA_COCOA', 66, 25, 'VEGETARIAN;GLUTENFREE;LACTOSEFREE;VEGAN', NULL, NULL),
