(2902, 'Schoko-Erdnüsse im Glas (Vegablum)', '4260536475246', 0, 5.99, 1, 1, NULL, 0, NULL, 'Schoko-Erdnüsse im Glas', 'Unsere Schoko-Erdnüsse im Glas sind ein wunderbarer Snack für Zwischendurch und eignen sich ganz prima einfach so zum Naschen oder Verschenken. Die Erdnüsse werden von leckerer Schokolade ummantelt und eignen sich außerdem auch besonders gut zum Dekorieren und Verfeinern von Süßspeisen, Kuchen und anderen Desserts.\r\n\r\nUnsere bunten Erdnüsse kannst du naschen, ohne dabei ein schlechtes Gewissen zu haben. Denn der Snack ist zu 100 % vegan und besteht nur aus rein biologischen Zutaten. Dabei achten wir bei den verwendeten Farbstoffen auch auf rein pflanzliche Farbmittel aus u.a. Schwarzer Johannisbeere, Spirulina, Apfel oder Karotte. Damit kannst du auch deinen Kindern getrost etwas abgeben, ganz ohne Gewissensbisse.\r\n\r\nFür Erwachsene und Kinder ein nussiger, schokoladiger Spaß. Die veganen Bio Schoko-Erdnüsse können zur Dekoration von Kuchen und Torten benutzt oder einfach pur genascht werden.\r\n\r\nZucker und Schokolade sind zertifiziert nach Standards, die neben der Einhaltung ökologischer Kriterien u.a. auch die Einhaltung sozialer Standards erfordern.\r\n\r\nAlso ein rundum nussiges Produkt, das keine Wünsche offen lässt!', 'Vegablum KG', 'Vegablum', 'Plettenberg, NRW', NULL, 'manager', '2023-04-06 13:38:14', 'manager', '2023-04-06 13:39:21', 2979, NULL, 0, NULL, 0, 3.71, 'Vegablum', 0, NULL, 0, NULL, 'Rohrzucker*, Kakaomasse*, Erdnusskerne (22%)*, Kakaobutter*, Reisstärke*, Verdickungsmittel: Gummi arabicum*, Färbendes Lebensmittel (Konzentrat aus Spirulina*, Saflor, Apfel*, Karotte*, Rettich*, Kürbis* und schwarze Johannisbeere*), Überzugsmittel: Carnaubawachs*\r\n*aus kontrolliert biologischem Anbau', '2023-04-06 13:39:52', 450, 'SWEETS', 'SNACKS', NULL, NULL, 'VEGAN;VEGETARIAN;PALMOILFREE', NULL, NULL),
(2903, 'Schokolinsen im Glas (Vegablum)', '4260536475208', 0, 5.79, 1, 1, NULL, 0, NULL, 'Schokolinsen im Glas', 'Unsere Schoko-Vlinsen im Glas sind ein wunderbarer Snack für Zwischendurch und eignen sich ganz prima einfach so zum Naschen oder Verschenken. Sie werden von leckerer Schokolade ummantelt und eignen sich außerdem auch besonders gut zum Dekorieren und Verfeinern von Süßspeisen, Kuchen und anderen Desserts.\r\n\r\nDiese bunten Vlinsen kannst du naschen, ohne dabei ein schlechtes Gewissen zu haben. denn der Snack ist zu 100 % vegan und besteht nur aus rein biologischen Zutaten. Dabei achten wir bei den verwendeten Farbstoffen auch auf rein pflanzliche Farbmittel aus u.a. Schwarzer Johannisbeere, Spirulina, Apfel oder Karotte. Damit kannst du auch deinen Kindern getrost etwas abgeben, ganz ohne Gewissensbisse.\r\n\r\nZucker und Schokolade sind zertifiziert nach Standards, die neben der Einhaltung ökologischer Kriterien u.a. auch die Einhaltung sozialer Standards erfordern.\r\n\r\nAlso ein rundum buntes Produkt, das keine Wünsche offen lässt!', 'Vegablum KG', 'Vegablum', 'Plettenberg, NRW', NULL, 'manager', '2023-04-06 13:43:43', 'manager', '2023-04-06 13:44:00', 2980, NULL, 0, NULL, 0, 3.5, 'Vegablum', 0, NULL, 0, NULL, 'Edelbitterschokolade (53%) *:(Kakaomasse*, Rohrzucker*, Kakaopulver*, Emulgator: Sojalecithine*), Rohrzucker*, Reisstärke*, Färbendes Lebensmittel (Konzentrat aus Spirulina*, Saflor, Apfel*, Karotte*, Rettich*, Kürbis* und Schwarze Johannisbeere*); Verdickungsmittel: Gummi arabicum*, Überzugsmittel: Carnaubawachs*\r\n*aus kontrolliert biologischem Anbau', '2023-04-06 13:44:20', 450, 'SWEETS', 'SNACKS', NULL, NULL, 'VEGAN;VEGETARIAN;PALMOILFREE', NULL, NULL),
(2904, 'Nussliebe Schoko-Banane (Vegablum)', '4260536477691', 0, 6.49, 1, 1, NULL, 0, NULL, 'Nussliebe Schoko-Banane', 'Du liebst Schokolade? Wir auch! Wusstest du, dass Früchte wunderbar mit Schokolade zusammenpassen? Denk nur an die Schoko-Früchte auf dem Weihnachtsmarkt…hmnmm so lecker, da läuft dir gleich das Wasser im Mund zusammen, oder? Uns auf jeden Fall.\r\n\r\nUm diesen Geschmack jeden Tag genießen zu können, haben wir die Nussliebe Schoko-Banane entwickelt. Die cremige Haselnusscreme besticht einfach alle Nussliebhaber*innen und überzeugt nicht nur durch ihre zarte Konsistenz, sondern auch mit ihrem unvergleichlich aromatischen Geschmack.\r\n\r\nUnsere neue Nussliebe Schoko-Banane wird aus 69,5 % sorgfältig gerösteten Haselnüssen hergestellt und nur durch Reissiruppulver und Banane gesüßt. Da kannst du es dir als Naschkatze so richtig schmecken lassen. Für unsere Schoko-Bananen Creme werden ausgewählte Haselnüsse sorgfältig geröstet und anschließend schonend mit Kakaobutter, Banane, Reissiruppulver und Kakaopulver zu einer zarten Creme verarbeitet. Dank der schonenden Röstung der frischen Haselnüsse entstehen Röstaromen, die uns direkt in ferne Weiten versetzen und den Genuss zu etwas ganz Besonderem machen. \r\n\r\nThat´s it. Mehr ist nicht drin in unserer Nussliebe Schoko-Banane und mehr gehört da auch nicht rein! Denn oft sind Nusscremes unter anderem mit Palmöl gestreckt. Das hat bei uns aber keine Chance! Du kannst dich auf streichzarten Genuss dank hochwertiger Kakaobutter freuen. Wir verwenden nur die besten Zutaten mit den höchsten Qualitätsstandards und lassen die Natur für sich sprechen. \r\n\r\nDie schonende Verarbeitung und die aromatische Röstung, die hochwertigen Zutaten und der gesamte Herstellungsprozess garantieren dir den allerhöchsten Genuss unserer samtig-cremigen Nussliebe!\r\n\r\nDu möchtest die Nusscreme gleich ausprobieren? Super, dann genieße sie doch einfach als Brotaufstrich, auf Crêpes, beim Backen, im Müsli, als Topping, zum Verfeinern von Desserts oder einfach so zum Löffeln! Du wirst sie lieben, so wie wir auch! Überzeuge dich selbst vom aromatisch nussig-bananigen Geschmack und probiere die neue Nussliebe gleich aus.\r\n\r\nWenn du lange und viel von deiner Nussliebe haben möchtest, solltest du sie bei Zimmertemperatur lagern, denn im Kühlschrank wird die Kakaobutter hart. Wenn du allerdings Schoko-Bällchen oder andere feste Desserts daraus herstellen möchtest, ist es vorteilhaft, sie in den Kühlschrank zu stellen.', 'Vegablum KG', 'Vegablum', 'Plettenberg, NRW', NULL, 'manager', '2023-04-06 13:51:26', 'manager', '2023-04-06 13:51:36', 2981, NULL, 0, NULL, 0, 3.9, 'Vegablum', 0, NULL, 0, 67, 'HASELNÜSSE geröstet* (69,5%), Banane* (14%), Reissiruppulver*, Kakaobutter*, Kakaopulver* (3%)\r\n*aus kontrolliert biologischem Anbau', '2023-04-06 13:54:27', 450, 'SPREADS_HONEY', 'PANTRY', NULL, NULL, 'VEGAN;VEGETARIAN;PALMOILFREE', NULL, NULL),
(2905, 'Wonig Löwenzahn (Vegablum)', '4260536476304', 0, 5.49, 1, 1, NULL, 0, NULL, 'Wonig Löwenzahn', 'Selbstgemachter Löwenzahnwonig ist wohl eines der bekanntesten Sorten aus der heimischen Küche. Er wird schon seit vielen Jahrzehnten frei nach Omas Hausrezept selbst hergestellt. Wir haben ihn perfektioniert, die Konsistenz ist schön dickflüssig und der Geschmack ist einfach einzigartig lecker, du wirst begeistert sein!\r\n\r\nDer blumige Geschmack erinnert direkt an die leuchtend gelben Blüten des Löwenzahns, die uns wohl allen von Kindheitstagen an bekannt sind. Die Blüten werden geerntet, bevor sie sich zur Pusteblume verwandeln. Aber auch nicht zu schnell, denn die Bienchen benötigen vorher noch den Nektar für ihren Honig!\r\n\r\nDie vegane Honig-Alternative Löwenzahn eignet sich hervorragend zum Süßen von Tee und Müsli, über Pancakes oder einfach als herrlich süßen Brotaufstrich.\r\n\r\nLöwenzahn\r\nLöwenzahn wächst in rauen Mengen in heimischen Gefilden und wird oft einfach nur als Unkraut betrachtet. Aber er kann noch viel mehr. In Salaten, Tees und zum Garnieren von herzhaften Speisen hat der Löwenzahn seinen Platz in der Küche schon lange erobert!', 'Vegablum KG', 'Vegablum', 'Plettenberg, NRW', NULL, 'manager', '2023-04-06 13:53:53', 'manager', '2023-04-06 13:54:05', 2982, NULL, 0, NULL, 0, 3.31, 'Vegablum', 0, NULL, 0, 67, 'Rohrohrzucker*, Wasser, Löwenzahn-Extrakt* 4,5%*\r\n*aus kontrolliert biologischem Anbau', '2023-04-06 13:53:53', 450, 'SPREADS_HONEY', 'PANTRY', NULL, NULL, 'VEGAN;VEGETARIAN', NULL, NULL),
(2906, 'Wonig Apfel (Vegablum)', '4260536476335', 0, 5.49, 1, 1, NULL, 0, NULL, 'Wonig Apfel', 'Unser Wonig überzeugt dich von Anfang an mit seinem herrlich aromatischen Geschmack und verfeinert dabei auch noch dein Frühstück. Hier hast du eine große Auswahl an verschiedenen Geschmacksrichtungen, bei denen du dich ausprobieren kannst.\r\n\r\nDie Sorte Apfel ist herrlich süß und gleichzeitig fruchtig mit einer spritzigen Säure, so dass sie super auf dem Frühstücksbrötchen oder über Pancakes schmeckt.', 'Vegablum KG', 'Vegablum', 'Plettenberg, NRW', NULL, 'manager', '2023-04-06 13:56:03', 'manager', '2023-04-06 13:58:30', 2984, NULL, 0, NULL, 0, 3.31, 'Vegablum', 0, NULL, 0, 67, 'Rohrohrzucker*, Wasser, Apfelsaftkonzentrat* 9%\r\n*aus kontrolliert biologischem Anbau', '2023-04-06 13:56:03', 450, 'SPREADS_HONEY', 'PANTRY', NULL, NULL, 'VEGAN;VEGETARIAN', NULL, NULL);
