(2907, 'Wonig Lavendel (Vegablum)', '4260536476076', 0, 5.49, 1, 1, NULL, 0, NULL, 'Wonig Lavendel', 'Den kräftigen Geruch von Lavendel liebt man oder eben nicht, aber wir werden für dieses intensive Geschmackserlebnis sicherlich viele Liebhaber*innen finden!\r\n\r\nAuch wer eigentlich gar nicht auf Lavendel steht, sollte zumindest einmal kosten und wird womöglich überrascht sein, wie lecker diese bienenfreundliche Pflanze doch schmecken kann!\r\n\r\nBestelle dir doch einfach ein kleines Gläschen in unserem Probierset zum Aussuchen mit.\r\n\r\nUnd um dem Ganzen noch die Geschmacks-Krone aufzusetzen haben wir ihn mit einem Hauch Tonka verfeinert. Wir benutzen die ganze Bohne zum Aromatisieren, es befindet sich also nur das leckere Aroma in unserer Honig-Alternative, so dass du dir auch keine Sorgen um den Cumaringehalt machen musst.\r\n\r\nZum Kochen, für Süßspeisen, in den Tee oder vielleicht sogar über die Pancakes?\r\n\r\nLavendel\r\nWer kennt ihn nicht, den frisch-würzigen aber auch sehr blumigen bis parfümartigen Geruch von Lavendel. Sofort steigen Bilder der Provence in uns auf, blauviolette Lavendelfelder, ein leckerer Wein, Urlaub und ein lauer Sommerabend.\r\n\r\nWer hier nun einen süßlichen Geschmack erwartet irrt sich. Der Geschmack erinnert eher an Rosmarin und ist leicht herb-bitter. Der blumige Geruch kombiniert mit dem leicht herb-bitteren Geschmack ergeben ein ganz neues außergewöhnliches Aroma.\r\n\r\nTonka\r\nIn Europa wird die Tonka-Bohne am liebsten Desserts und anderen Leckereien beigemischt. In der Küche setzt man die Tonka-Bohne ähnlich der Muskatnuss ein. Gerieben, z.B. mit der Muskatreibe oder dem Mörser, ist sie ein guter Ersatz für die Vanilleschote. Eiscreme, Pudding oder herzhaftes Gebäck lassen sich mit der dunkelbraunen Bohne verfeinern.\r\n\r\nSterneköche experimentieren gerne mit der Bohne, um neue spannende Kreationen vorstellen zu können. Sie ist etwa 6 cm groß, mandelförmig und gibt süßen Speisen einen ganz besonderen Reiz.\r\n\r\nGeschmacklich ähnelt die Tonka-Bohne ein wenig der Vanille. Dank Noten von Karamell, Zimt, Mandeln und Rum sowie ihres süßen, unverwechselbaren Heublumenduftes, begeistert sie mit ihrem unvergleichlichen Aroma.', 'Vegablum KG', 'Vegablum', 'Plettenberg, NRW', NULL, 'manager', '2023-04-06 13:58:05', 'manager', '2023-04-06 13:58:13', 2983, NULL, 0, NULL, 0, 3.31, 'Vegablum', 0, NULL, 0, 67, 'Rohrohrzucker*, Wasser, Lavendel-Extrakt* 2,5%*, Tonka-Extrakt*\r\n*aus kontrolliert biologischem Anbau', '2023-04-06 13:58:04', 450, 'SPREADS_HONEY', 'PANTRY', NULL, NULL, 'VEGAN;VEGETARIAN', NULL, NULL),
(2908, 'Kartoffel Chips Dill Schnittlauch (Weiling)', '8718781200053', 0, 2.99, 1, 1, NULL, 0, NULL, 'Kartoffel Chips Dill Schnittlauch', 'Robust und unwiderstehlich! Die geschnittenen Canyon Dill & Chive (Dill & Schnittlauch) sind grob geschnitten und portionsweise gebacken, so bekommen sie die unvergleichliche Textur. Dies sind keine Chips mehr, dies ist pures Abenteuer!\nDer echte Geschmack der reinen Zutaten, dafür steht GoPure! Produziert werden diese leckeren Chips von Yellow Chips aus dem niederländischen Emmeloord. Im Jahr 2013 von drei begeisterten Lebensmittelprofis gegründet, bieten die „Chipsmacher“ ein abwechslungsreiches Sortiment von Kartoffel- und Gemüsechips. Natürlich sind alle Produkte – so wie der Name es sagt – pur: biologisch und vegan, frei von Allergen und zugefügtem Zucker und Hefe. GoPure – straight from the land.', 'Yellow Chips B.V.', 'GoPure', 'NETHERLANDS', 'd34e3c70-9de2-4d9e-b595-dd31acb6cf85', 'manager', '2023-04-14 08:39:17', 'manager', '2023-04-14 09:16:43', 2985, 2450, 0, NULL, 0, 1.7, 'Weiling', 0, NULL, 0, 120, 'Kartoffeln*, Sonnenblumenöl*, Maismehl*, Meersalz, Schnittlauch* (0,8), Dill* (0,4), Zwiebel*, Knoblauch*, Kardamom*, Kümmel*. vor Wärme geschützt und trocken lagern. Unter schutzatmosphäre verpackt .  *aus kontrolliert ökologischer Erzeugung', '2023-06-30 09:55:16', 3010.8, 'SALTY', 'SNACKS', 130, 26, 'VEGAN;VEGETARIAN;GLUTENFREE', NULL, NULL),
