(2911, 'Creamy White grüner Pfeffer (Weiling)', '4260394564076', 0, 5.49, 1, 1, NULL, 0, NULL, 'Creamy White grüner Pfeffer', 'Die edle Camembert Käse-Alternative auf Blumenkohl-Basis.\nDiese vegane Käse-Alternative schmeckt einzigartig cremig. Eine Camembert Alternative die dir ein französisches Geschmackserlebnis auf den Teller zaubert.  Nun auch in der Sorte \"grüner Pfeffer\".\n\nDr. Mannah´s Tipp: Ich empfehle dir den Creamy White zusammen mit fruchtigem Chutney, pur, zur Brotzeit oder als Zutat beim Kochen. \nDu kannst ihn paniert frittieren oder ihn cremig im Ofen backen! Ein wahre Köstlichkeit!', 'Happy Cheeze GmbH', 'Dr. Mannah\'s', 'GERMANY', 'bd58b430-ba87-416c-97f1-55b9451c73d8', 'manager', '2023-04-14 09:14:23', 'System', '2023-07-20 02:13:21', 2986, 2451, 0, NULL, 0, 3.15, 'Weiling', 0, NULL, 0, 64, 'Wasser, Blumenkohl* 23,8%, Palmöl* 22,9%, Stärke* 11,4%, Sonnenblumenprotein*, \nKarotten*, grüner Pfeffer* 5,0%, Salz, Branntweinessig*, Verdickungsmittel (Xanthan, Guarkernmehl*), vegane Fermentations- und Edelschimmelkulturen. *aus kontrolliert ökologischer Erzeugung', '2023-04-14 09:14:17', 283.5, 'CHEESE;VEGAN_VEGETARIAN', 'FRESH', 152, 9, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
