(2913, 'Schafvollmilch Flasche (Weiling)', '4032816000017', 0, 3.69, 1, 1, NULL, 0.15, NULL, 'Schafvollmilch Flasche', 'Ohne Transportwege wird die in unserem landwirtschaftlichen Betrieb erzeugte, frisch gemolkene Bio-Schafmilch direkt in der eigenen EU zugelassenen Molkerei verarbeitet. Sie wird nicht entrahmt und enthält so alle natürlichen Bestandteile. Eine Natur schonende Produktion ermöglicht es uns, natürliche Schafprodukte aus der Region anbieten zu können.', 'Reutebachhof', 'Reutebachhof', 'Bühlerzell, BaWü', NULL, 'manager', '2023-04-21 09:36:45', 'System', '2023-07-01 00:23:03', 2988, NULL, 1, NULL, 0, 2.28, 'Weiling', 0, NULL, 0, NULL, NULL, '2023-04-21 09:37:58', 847.872, 'DAIRY_PRODUCTS_EGGS', 'FRESH', NULL, 20.7, 'VEGETARIAN', NULL, NULL),
