(2922, 'now Sunny Orange 0,5l (Weiling)', '4012852253844', 1, 1.79, 1, 1, NULL, 0.08, NULL, 'now Sunny Orange 0,5l', 'Purer Orangen-Geschmack für Fans – kräftig, fruchtreich und erfrischend. Mit einem Spritzer Zitrone verfeinert.', 'Neumarkter Lammsbräu', 'now', 'GERMANY', '32391df2-8645-4d42-bfe6-6d789954f924', 'manager', '2023-04-28 09:34:44', 'System', '2023-10-20 02:10:34', 2995, 2455, 3, NULL, 0, 0.9, 'Weiling', 0, NULL, 0, 60, 'Natürliches Mineralwasser mit Kohlensäure versetzt, Orangensaft aus Orangensaftkonzentrat* 17%, Zucker*, Zitronensaft aus Zitronensaftkonzentrat*, Orangenextrakt* *aus ökologischem Anbau', '2023-04-28 09:35:02', 1127, 'LEMONADE', 'DRINKS', 870, 23, 'VEGAN;VEGETARIAN', NULL, NULL),
(2923, 'Rotes Linsen-Dal (Weiling)', '4260195540149', 0, 3.99, 1, 1, NULL, 0, NULL, 'Rotes Linsen-Dal', 'In Zusammenarbeit mit dem veganen Spitzenkoch, Kochbuchautor und Influencer Timo Franke haben wir ein Linsen-Dal kreiert, welches seinesgleichen sucht. Timo Franke hat dieses Gericht während einer kulinarischen Weiterbildungsreise in Indien für sich entdeckt und seither, ist das Linsen-Dal eines seiner liebsten Gerichte. Seit 2009 produzieren wir in Müncheberg / Brandenburg vegane Bio-Suppen im Glas in unserer hauseigenen Manufaktur. Mit insg. 17 Mitarbeiterinnen und Mitarbeitern verarbeiten wir größtenteils regionale Zutaten und fördern zusammen mit unserem Partner Regionalwert AG Berlin-Brandenburg die regionale Bio-Landwirtschaft. Unsere Zutaten und Rezepturen sind uns heilig, weshalb wir den Produktionsprozess an die Rezeptur anpassen und nicht die Rezeptur an den Prozess. Deswegen sind unsere Suppen ohne Suppenchemie wie zB:  Geschmacksverstärker / Hefeextrakt / Milcheiweiß  Stärke / modifizierte Stärken  Konservierungsstoffe  Verdickungsmittel  Maltodextrin  Zucker: Zucker (Saccharose), Milchzucker  Emulgatoren  Säuerungsmittel z.B. Citronensäure  Eigelb (Carotinoide)  Farbstoffe: Tomatenpulver / Rote-Bete-Pulver u.a.', 'WDM Bio-Fertigprodukte GmbH', 'Wünsch Dir Mahl', 'Müncheberg, BB', NULL, 'manager', '2023-04-28 09:39:20', 'System', '2023-09-01 00:00:59', 2996, NULL, 0, NULL, 0, 2.44, 'Weiling', 0, NULL, 0, NULL, 'Wasser, Rote Linsen* (18%), Paprika gelb* (7%), Tomatenmark* (4%), Olivenöl*, Steinsalz, Knoblauch*, SENFKÖRNER*, Paprikapulver edelsüß*, Koriander*, Kreuzkümmel*, Curcuma*, Chili*\r\nenthält folgende allergene Zutaten: Senf\r\n*aus kontrolliert ökologischer Erzeugung', '2023-04-28 09:39:39', 703.125, 'CONVENIENCE_PRESERVES', 'PANTRY', NULL, 12.5, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
