(2933, 'Gemüse-Quinoa-Sticks (Weiling)', '4026584133015', 0, 3.29, 1, 1, NULL, 0, NULL, 'Gemüse-Quinoa-Sticks', 'Kunterbunt und super lecker: Die veganen Gemüse-Quinoa-Sticks bestechen mit einer Kombination aus feinem (Pseudo-)Getreide und farbenfrohen Gemüsestückchen: grüne Erbsen, roter Paprika und gelbe Maiskörner. Ummantelt von einer zart-knusprigen Hülle sind die milden Stäbchen ein Genuss für Groß und Klein – ob zum Salat, zur Suppe oder als leckerer, gesunder Snack.', 'organic veggie food GmbH', 'SOTO', 'GERMANY', '862eb327-e95a-49f5-8218-ed4ea30568a8', 'manager', '2023-05-05 09:35:52', 'System', '2023-12-14 02:08:59', 3005, 2461, 0, NULL, 0, 2.1, 'Weiling', 0, NULL, 0, 61, 'Quinoa* (32%), Vollkornreis* (18%), Karotten* (14%),  roter Paprika* (7%), Mais* (6%), Kartoffelflocken*, Erbsen* (4%), Maisgrieß*, Zucchini* (3%), Zwiebel* (2%), Tapiokastärke*, Sonnenblumenöl*, Salz, Gewürze* *aus kontrolliert ökologischer Erzeugung', '2023-05-05 09:36:16', 656.25, 'GOURMET_CONVENIENCE', 'FRESH', 181.5, 17.5, 'VEGAN;VEGETARIAN;PALMOILFREE', NULL, NULL),
(2934, 'Bio Knusperbrot Hafer (Weiling)', '3380380078019', 0, 3.79, 1, 1, NULL, 0, NULL, 'Bio Knusperbrot Hafer', 'Blumenbrot - inspiriert von den Blüten des Buchweizen . Alle Sorten (insgesamt 15) sind Vegan, glutenfrei  und bis auf die Sorte Feige auch Koscher. Zur Philosophie Ekibio gehört außerdem, dass Blumenbrote ohne Hefe, Eier, Fette, Milchprodukte und Aromastoffe verarbeitet werden. Somit ist das Blumenbrot (\"Le Pain Des Fleurs\") nicht nur für Menschen mit Glutenunverträglichkeit bestens geeignet. Der Teig für das Knusperbrot wird während der Verarbeitung einige Sekunden bei einer hohen Temperatur von 300 bis 400°C getoastet. Dabei entsteht die spezielle knusprige Textur, die auch von Sorte zu Sorte variiert.', 'EKIBIO SAS', 'Blumenbrot', 'FRANCE', 'd26bd4f4-4233-4ff6-8950-1528eba73631', 'manager', '2023-05-12 09:06:34', 'System', '2023-08-26 02:06:02', 3006, 2462, 0, NULL, 0, 2.29, 'Weiling', 0, NULL, 0, 52, 'Hafermehl* (50%), Reismehl*, Meersalz.\n*aus biologischem Anbau *aus kontrolliert ökologischer Erzeugung', '2023-05-12 11:03:26', 1447.88, 'BREAD_BUNS', 'PASTRY', 200, 16.5, 'VEGAN;VEGETARIAN;GLUTENFREE;KOSCHER;WITHOUT_ADDED_SUGAR', NULL, NULL),
