(2949, 'Eisen Vital Complex (Weiling)', '4035784161407', 1, 16.9, 1, 1, NULL, 0, NULL, 'Eisen Vital Complex', 'Eisen Vital Complex (Bio)\n\nNahrungsergänzungsmittel aus biologischen\nDirektsäften mit pflanzlichem und biologischem\nEisen aus dem Curryblatt\n\n\nEisen\n- trägt zur normalen Bildung von roten Blutkörperchen und Hämoglobin bei\n- trägt zu einem normalen Sauerstofftransport im Körper bei\n- trägt zu einem normalen Energiestoffwechsel bei\n- trägt zur Verringerung von Müdigkeit und Ermüdung bei \n- trägt zu einer normalen kognitiven Funktion bei\n- trägt zu einer normalen Funktion des Immunsystems bei\n- hat eine Funktion bei der Zellteilung', 'GSE Vertrieb GmbH', 'GSE ', 'GERMANY', 'a5322b4c-fa4a-4d58-b1b3-6781bd46d95d', 'manager', '2023-05-26 09:57:01', 'System', '2023-12-17 03:06:31', 3020, 2468, 0, NULL, 0, 9.23, 'Weiling', 0, NULL, 0, 62, 'Roter Traubensaft*, Sauerkirschsaft*, Schwarzer\nJohannisbeersaft*, Brombeersaft*, Aroniasaft*,\nHolundersaft*, Curryblattextrakt* (Murraya koenigii) *aus kontrolliert ökologischer Erzeugung', '2023-05-26 09:56:59', 810, 'OTHER_DRUGSTORE_ARTICLES', 'DRUGSTORE', 593, 22.5, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE;WITHOUT_ADDED_SUGAR', NULL, NULL),
(2950, 'now Cherry Cola 0,33l (Weiling)', '4012852204938', 1, 1.39, 1, 1, NULL, 0.08, NULL, 'now Cherry Cola 0,33l', 'Unsere Fan-Edition 2023 haben dieses Mal unsere vermutlich größten Fans entwickelt: Unsere Mitarbeiterinnen und Mitarbeiter.\nBei einer gemeinsamen Verkostung mit dem Team unserer Limo-Küche fiel die Wahl auf die fruchtig-erfrischende Kombi aus Cola und Kirschen.\n\nDie naturtrübe Bio-Limonade verbindet intensiven Fruchtgeschmack mit dem authentischen Cola-Erlebnis. \nDer Saft echter Bio-Sauerkirschen und ein Hauch Bio-Zitrone bringen eine spritzig-saure Note in die vollmundige Süße aus karamellisiertem Zucker. Anregend-köstlich, mit der natürlichen Kraft von Guarana.\nFruchtgehalt 16,1 %', 'Neumarkter Lammsbräu', 'now', 'GERMANY', 'c3611e60-a36e-4164-8e1e-db916211c2bb', 'manager', '2023-05-26 10:00:24', 'System', '2023-06-16 12:02:07', 3021, 2469, 3, NULL, 0, 0.72, 'Weiling', 0, NULL, 0, 60, 'Natürliches Mineralwasser mit Kohlensäure versetzt, Sauerkirschsaft aus Sauerkirschsaftkonzentrat* 14,2%, Zucker*, Zitronensaft aus Zitronensaftkonzentrat* 1,9%, karamellisierter Zucker*, Guaranaextrakt*, Gewürzextrakt *aus ökologischem Anbau', '2023-05-26 10:00:45', 1102.5, 'LEMONADE', 'DRINKS', 680, 22.5, 'VEGAN;VEGETARIAN', NULL, NULL),
(2951, 'Grill-und Würzsauce Curry Mango (Weiling)', '4030917048600', 0, 3.29, 1, 1, NULL, 0, NULL, 'Grill-und Würzsauce Curry Mango', 'Unsere Grill- und Würzsauce Curry Mango schmeckt herrlich fruchtig-exotisch und rundet eure Gerichte als idealer Begleiter ab. Zu gegrillten Spezialitäten wie Halloumi, Hühnchen oder feinem Gemüse - einfach köstlich.', 'Petersilchen GmbH', 'Sanchon', 'Steinheim, NRW', '2f399509-1477-4237-8297-f1f12a52a0d2', 'manager', '2023-05-26 10:02:45', 'System', '2023-07-04 02:15:23', 3022, 2470, 0, NULL, 0, 1.95, 'Weiling', 1, 1, 0, 67, 'Sonnenblumenöl*, Apfelaft* aus Apfelsaftkonzentrat*, Wasser, 11% Mangopüree*, Rohrohrzucker*, Tomatenmark* einfach konzentriert, Branntweinessig*, 2,3% Currymischung* (enthält SENF*), Meersalz, Sonnenblumenkernmehl*, Zitronensaft* aus Zitronensaftkonzentrat*, Maisstärke*, Fababohnenprotein* Verdickungsmittel: Guarkernmehl* (01-09-02-23) *aus kontrolliert ökologischer Erzeugung', '2023-05-26 10:02:40', 514.25, 'OIL_VINEGAR_SAUCES', 'PANTRY', 437, 17, 'VEGAN;VEGETARIAN;GLUTENFREE;PALMOILFREE', NULL, NULL),
