(2956, 'Mascara Vegan Volume magic black (Weiling)', '4260198091617', 1, 5.49, 1, 1, NULL, 0, NULL, 'Mascara Vegan Volume magic black', 'Vegan, voluminös und in verführerischem magic black - dieses Volumentalent ohne Duftstoffe ist milder formuliert als die anderen benecos Mascara-Topseller. Dank der unkomplizierten Textur mit pflegendem Bio-Muskatellersalbeihydrolat, Bio-Avocadoöl und Vitamin E kannst du die Wimpern für mehr Volumen jederzeit ein zweites oder drittes Mal tuschen, ohne dass sie verklumpen. Glutenfrei. Das Wichtigste auf einen Blick: Volumenmascara Ökotest: sehr gut (Ausgabe 02/2021) Ohne Duftstoffe Mit pflegendem Bio-Avocadoöl und Vitamin E Vegan Zertifizierte Naturkosmetik (BDIH) Inhalt: 10 ml', 'cosmondial GmbH & Co. KG', 'benecos', 'Deutschland', NULL, 'manager', '2023-05-26 10:16:41', 'manager', '2023-05-26 10:16:52', 3027, NULL, NULL, NULL, 0, 2.99, 'Weiling', 0, NULL, 0, NULL, 'SALVIA SCLAREA (CLARY) FLOWER/LEAF/STEM WATER*, CETEARYL ALCOHOL, GLYCERIN*, ACACIA SENEGAL GUM, BRASSICA CAMPESTRIS/ALEURITES FORDII OIL COPOLYMER, GLYCERYL ROSINATE, GLYCERYL STEARATE, SILICA, POTASSIUM PALMITOYL HYDROLYZED WHEAT PROTEIN, OLEIC/LINOLEIC/LINOLENIC POLYGLYCERIDES, TOCOPHEROL, GLYCERYL CAPRYLATE, MAGNESIUM ALUMINUM SILICATE, AQUA (WATER), SORBITAN OLIVATE, CETEARYL OLIVATE, CETYL PALMITATE, SORBITAN PALMITATE, PERSEA GRATISSIMA (AVOCADO) OIL*, XANTHAN GUM, CI 77499 (IRON OXIDES), CI 77820 (SILVER)\r\n\r\n*aus kontrolliert biologischem Anbau', '2023-05-26 10:16:40', NULL, 'BODY_CARE;OTHER_DRUGSTORE_ARTICLES', 'DRUGSTORE', NULL, NULL, 'VEGAN;VEGETARIAN', NULL, NULL),
