(2970, 'Asiasauce Thai Mango, Sanchon', '4030917026707', 0, 3.29, 1, 1, NULL, 0, NULL, 'Asiasauce Thai Mango, Sanchon', 'Die Asiasaucen von Sanchon schmecken süß und pikant zugleich. Zum Dippen für Frühlingsrollen, Fleisch und Gemüse. Zu gegrilltem Fisch, zu Fingerfood oder einfach so.', 'Petersilchen GmbH', 'Sanchon', 'GERMANY', '00844104-4120-4a9a-a413-d1997f9b79f9', 'manager', '2023-06-02 09:50:56', 'System', '2023-07-04 02:14:17', 3041, 2476, 0, NULL, 0, 1.95, NULL, 0, NULL, 0, 67, 'Mangos* (42 %), Rohrohrzucker*, Wasser, Weißweinessig*, Tapiokastärke*, Zitronensaftkonzentrat*, rote Chilis*, rote Paprika*, Knoblauch*, Meersalz, Verdickungsmittel: Guarkernmehl*, Johannisbrotkernmehl*; Kaffirlimettenblätter*, Curcuma* *aus kontrolliert ökologischer Erzeugung', '2023-06-02 10:38:39', 514.25, 'OIL_VINEGAR_SAUCES', 'PANTRY', 462, 17, 'VEGAN;VEGETARIAN;GLUTENFREE;PALMOILFREE', NULL, NULL),
(2971, 'Geschirrspülmittel Lemon 5l (Weiling)', '4007547307605', 1, 17.99, 1, 1, NULL, 0, NULL, 'Geschirrspülmittel Lemon 5l', 'Das Sonett Geschirrspülmittel ist ein konzentriertes Produkt und daher sehr ergiebig im Gebrauch. Die verwendeten Tenside Kokosfettalkoholsulfat und Zuckertensid sind 100 % biologisch abbaubar und in dieser Kombination zugleich sehr gut hautverträglich.\n\n• Rein pflanzliche Tenside, besonders hautschonend\n• Für das Geschirrspülen von Hand\n• Natürlich frischer Duft von Bio-Lemongrassöl \n• 100 % biologisch abbaubar\n\n• Erhältlich: 120 ml, 300 ml, 1 Liter, 5 Liter, 10 Liter und 20 Liter', 'Sonett GmbH', 'SONETT', 'GERMANY', '96ae4994-f154-47a7-827b-a9a744f4bfac', 'manager', '2023-06-02 10:06:11', 'System', '2023-10-13 02:19:16', 3042, 2477, NULL, NULL, 0, 11.01, 'Weiling', 0, NULL, 0, NULL, NULL, '2023-08-04 10:44:35', 7342.12, 'CLEANING', 'DRUGSTORE', 5210, 25.4, 'VEGAN;VEGETARIAN', NULL, NULL),
(2972, 'Schwangerschafts-Body Butter (Weiling)', '4001638530088', 1, 17.99, 1, 1, NULL, 0, NULL, 'Schwangerschafts-Body Butter', 'Die Weleda Schwangerschafts-Body Butter verbessert durch regelmäßige Massagen die Elastizität der Haut auf natürliche Weise und beugt somit dem Entstehen von Dehnungsstreifen vor. Dank der schnell einziehenden Formel erhält Ihr Babybauch die nötige Pflege – auch wenn Sie nur wenig Zeit für die Massage haben. Die Body Butter wurde in Zusammenarbeit mit Apothekern und Hebammen entwickelt und enthält Tigergrasextrakt, Bio-Sheabutter, reichhaltige Bio-Kakaobutter und wertvolle Öle. Der dezent feinblumige Duft nach Rose, Neroli und Myrrhe ist frisch und zart zugleich. Er hüllt wohlig ein und stimmt gelassen. Bauen Sie über die Massage eine Bindung zu Ihrem Baby auf – mit unserer nährenden Pflegeformel aus Inhaltsstoffen 100 % natürlichen Ursprungs. Recycling Information Wir bei Weleda suchen kontinuierlich nach nachhaltigeren Alternativen für die Verpackung unserer Produkte. Unser Ziel ist es, unsere hochwertigen Produkte zu schützen und gleichzeitig die nachhaltigsten Verpackungsmöglichkeiten zu nutzen. Für die Schwangerschafts-Body Butter verwenden wir Glas, da es unendlich recyclebar ist und eine Faltschachtel, die zu mindestens 85 % aus recycelten Fasern besteht. Bitte führen Sie den Glasbehälter dem Recyclingsystem zu. Tipp Die schnell einziehende Body Butter ist ideal für die schnelle Massage, zum Beispiel morgens kurz vor dem Anziehen. Für längere, sanfte Massagen empfehlen wir das Weleda Schwangerschafts-Pflegeöl, dem Frauen seit mehr als 20 Jahren vertrauen.', 'Weleda AG', 'Weleda', 'GERMANY', '74626cba-0f0f-4bb5-8de7-38679a0e7ae3', 'manager', '2023-06-02 10:09:49', 'System', '2024-02-02 02:12:15', 3043, 2478, NULL, NULL, 0, 10.04, 'Weiling', 0, NULL, 0, NULL, NULL, '2023-06-02 10:09:42', 397.936, 'BODY_CARE', 'DRUGSTORE', 304, 7.7, 'VEGAN;VEGETARIAN', NULL, NULL),
(2973, 'Binde Maxi Super (Weiling)', '0782126003034', 0, 3.49, 1, 1, NULL, 0, NULL, 'Binde Maxi Super', 'Natracare Binden Maxi Super aus natürlichen und biologischen Materialien sind atmungsaktiv und bieten zuverlässigen Schutz an mittleren bis starken Tagen. Die Binden sind dank weicher, ökologischer Zellulose und  qualitativ hochwertiger Biobaumwolle wunderbar sanft zu empfindlicher Haut. Die Einlagen enthalten keine Farb- oder Duftstoffe, sind absolut chlorfrei, plastikfrei, biologisch abbaubar und kompostierbar. Umverpackung aus Maisstärke.', 'Bodywise (UK) Ltd.', 'Natracare', 'GREECE', 'd0073692-af3a-4a60-920a-baaef31768c6', 'manager', '2023-06-02 10:11:55', 'System', '2023-11-28 02:07:19', 3044, 2479, NULL, NULL, 0, 2.12, 'Weiling', 0, NULL, 0, NULL, NULL, '2023-06-02 10:12:11', 1472.94, 'BODY_CARE', 'DRUGSTORE', 150, 16.7, 'VEGAN;VEGETARIAN', NULL, NULL),
