(2976, 'Grillkäse Classic (Weiling)', '9006037014592', 0, 2.29, 1, 1, NULL, 0, NULL, 'Grillkäse Classic', 'Hergestellt aus bester Bio-Kuhmilch kann der fein schmeckende Weichkäse in nur wenigen Minuten auf dem Grill, in der Pfanne, in der Fritteuse sowie in der Mikrowelle zubereitet werden. Weiters ist der Bio-Grillkäse die perfekte Zutat für ein besonderes Burger-Erlebnis!', 'Concept Fresh Vertriebsgesellschaft mbH', 'Genussland Österreich', 'AUSTRIA', '7b65679b-56ef-4371-aeeb-8b289965ce9c', 'manager', '2023-06-02 10:35:37', 'System', '2023-12-17 02:50:49', 3047, 2480, 0, NULL, 0, 1.36, 'Weiling', 0, NULL, 0, 1, 'pasteurisierte KUHMILCH*, Speisesalz, Lab *aus kontrolliert ökologischer Erzeugung', '2023-06-02 10:35:57', 332.5, 'CHEESE', 'FRESH', 136.2, 10, 'VEGETARIAN;GLUTENFREE;PALMOILFREE;WITHOUT_ADDED_SUGAR', NULL, NULL),
(2977, 'Sesamcracker (Weiling)', '8713576192032', 0, 3.99, 1, 1, NULL, 0, NULL, 'Sesamcracker', 'Herrlich knusprige Cracker mit Sesam, die außerdem vollkommen frei von Hefe  und Palmöl sind. Ideal für unterwegs, als Partysnack oder zu Suppe oder einem  Salat. Lecker mit sowohl süßem als auch herzhaftem Belag: Nussmus, Hummus oder  Oliventapenade.  Erhältlich in vier weiteren Sorten: Dinkel, Naturell, Gesalzen und Rosmarin &  Leinsaat.', 'TerraSana Natuurvoeding BV', 'TerraSana', 'ITALY', '5fcd7240-3ed7-4479-b040-e16941b6f2df', 'manager', '2023-06-06 09:29:07', 'System', '2023-10-04 02:10:54', 3048, 2481, 0, NULL, 0, 2.49, 'Weiling', 0, NULL, 0, 108, 'WEIZENmehl*, extra natives Olivenöl* 9.6%, WEIZENkleie*, SESAMsamen* 2.8%, Salz, Säureregulator: Natriumbicarbonat, Reis*- und GERSTENsirup*, Sauerteig* (enthält WEIZEN), GERSTENmalzmehl*, Antioxidationmittel: Rosmarin-Extrakt* *aus kontrolliert ökologischer Erzeugung', '2023-06-06 09:28:59', 1404, 'SALTY', 'SNACKS', 318, 26, 'VEGAN;VEGETARIAN', NULL, NULL),
