(2979, 'Grüne Oliven ohne Stein mariniert (Weiling)', '4000915102246', 0, 4.59, 1, 1, NULL, 0, NULL, 'Grüne Oliven ohne Stein mariniert', 'Die aus Griechenland stammenden Grünen Oliven sind bereits entsteint und werden nach Ihrem Salzbad bei bio-verde veredelt und mit frischen Kräutern und einer Spur Öl mariniert. ', 'Isana Naturfeinkost GmbH & Co. Produktions- und Handels KG', 'bio-verde', 'GERMANY', '017a3ba4-ce77-4953-9841-f5a9a6f91b43', 'manager', '2023-06-06 09:35:22', 'System', '2023-10-27 02:05:40', 3050, 2482, 0, NULL, 0, 2.78, 'Weiling', 0, NULL, 0, 64, 'grüne Oliven* (92 %), Kräuter* (3% - Basilikum*, Petersilie*,\nOregano*, Thymian*, Rosmarin*), Sonnenblumenöl*, Meersalz,\nOlivenöl*, konzentrierter Zitronensaft*, Kartoffelflocken* *aus kontrolliert ökologischer Erzeugung', '2023-06-06 09:35:42', 532.8, 'GOURMET_CONVENIENCE', 'FRESH', 170, 14.4, 'VEGAN;VEGETARIAN', NULL, NULL),
(2980, 'Linsensalat mit Belugalinsen und Balsamicodressing (Weiling)', '4260148651403', 0, 3.79, 1, 1, NULL, 0, NULL, 'Linsensalat mit Belugalinsen und Balsamicodressing', 'Wir von der Bio-Manufaktur lieben unser Handwerk. Unsere Feinkostsalate werden wie zu Hause von Hand zubereitet, individuell abgeschmeckt und verpackt ready-to-eat. Schmecke den Unterschied… Guten Appetit!', 'PUR Bio Feinkost Manufaktur GmbH & Co. KG', 'PUR Bio-Manufaktur', 'GERMANY', '3f623a90-b5f5-4a54-8a8b-77fa4dc16dbd', 'manager', '2023-06-06 09:37:10', 'manager', '2023-06-06 09:38:47', 3051, 2483, 0, NULL, 0, 2.29, 'Weiling', 0, NULL, 0, 67, '35% gagarte Linsen*, 22% gegarte Belugalinsen*, Paprika*, Sonnenblumenöl*, Möhren*, Zwiebeln*, 5% Balsamico* (Rotweinessig*, konzentrierter Traubenmost*), SENF* (Wasser, GELBSENFSAAT*, Branntweinessig*, Meersalz, BRAUNSENFSAAT*, Gewürze*), Zitronensaft*, Rauchsalz (Meersalz, Hickoryholz-Rauch), Agavendicksaft*, Petersilie*, Rosmarin*, weißer Pfeffer*, Meersalz, Maisquellstärke *aus kontrolliert ökologischer Erzeugung', '2023-06-06 09:38:54', 519.75, 'GOURMET_CONVENIENCE', 'FRESH', 218, 13.5, 'VEGAN;VEGETARIAN', NULL, NULL),
