(2984, 'Rote Beeren Multi 100% Direktsaft (Weiling)', '4015533013942', 1, 3.19, 1, 1, NULL, 0, NULL, 'Rote Beeren Multi 100% Direktsaft', 'Sorgfältig ausgewählte Beerenfrüchte wie rote Trauben, Erdbeeren, Heidelbeeren und Brombeeren, werden in unserer Naturkostsafterei mit aromatischen Äpfeln zu diesem wohlschmeckenden Direktsaft vereint.', 'Voelkel GmbH', 'Voelkel', 'GERMANY', '5c3403de-2edd-4fd2-831c-f9da709d81ce', 'manager', '2023-06-06 09:57:49', 'System', '2024-01-17 02:09:00', 3056, 2485, 2, NULL, 0, 1.74, 'Weiling', 0, NULL, 0, 64, 'Apfelsaft** 72%, Erdbeermark** 10%, roter Traubensaft** 8%, Heidelbeersaft* 4%, Brombeersaft** 4%, Hagebuttenmark*, Preiselbeersaft* *aus kontrolliert ökologischer Erzeugung **aus biodynamischer Erzeugung', '2023-08-01 12:05:30', 996.523, 'LEMONADE;JUICE', 'DRINKS', 816.6, 18.7, 'VEGAN;VEGETARIAN', NULL, NULL),
(2985, 'Red Lentil BBQ-Burger (Weiling)', '4260687036143', 0, 4.39, 1, 1, NULL, 0, NULL, 'Red Lentil BBQ-Burger', 'Der Red Lentil BBQ-Style Burger Bratling ist eine gesunde, ressourcenschonende und vor allem geschmackvolle Alternative zu herkömmlichen Fleischburgern, ohne dabei Fleischgeschmack zu imitieren. Die einfache Zubereitung und Ausgiebigkeit (2 Stück je 90g) machen den veganen Burger Bratling auf Basis von Jackfrucht, Roten Linsen und Kichererbsen mit einem Gemüseanteil von über 60% zu einer gesunden, leichten sowie leckeren Mahlzeit. In seiner Konsistenz ist der Burger Bratling innen zart und durch die roten Linsen knackig. Nach dem Anbraten wird er wunderbar knusprig. Abgerundet wird das Gourmet Convenience (Gourvenience) Erlebnis durch einen authentischen, leicht scharfen BBQ Geschmack, der ganz bewusst nicht an Fleisch erinnert. ', 'Bunte Burger GmbH', 'Bunte Burger', 'GERMANY', '31535c67-6780-4e28-bbb1-3a02f7293de3', 'manager', '2023-06-06 10:02:27', 'System', '2023-07-01 00:27:28', 3057, 2486, 0, NULL, 0, 2.65, 'Weiling', 0, NULL, 0, 67, 'Junge grüne Jackfrucht in Lake (26%)* (Jackfrucht*, Wasser, Meersalz), Kichererbsen gekocht*, Ketchup* (Tomatenmark*, Rohrohrzucker*, Branntweinessig*, Steinsalz, Gewürze*), Rote Linsen (15%)*, Rapsöl desodoriert*, Zwiebel gemahlen*, Kichererbsenmehl*, Apfelessig naturtrüb*, Flohsamenschalen*, Paprika geräuchert gemahlen* (Paprika*, Rauch), Steinsalz, Chili gemahlen*, Pfeffer weiß gemahlen*, Knoblauch gemahlen*, Ingwer gemahlen* *aus kontrolliert ökologischer Erzeugung', '2023-07-04 09:23:27', 557.568, 'GOURMET_CONVENIENCE', 'FRESH', 203, 13.2, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE;KOSCHER;HALAL', NULL, NULL),
(2986, 'Shiitake Scheiben getrocknet (Weiling)', '4260261492068', 0, 4.49, 1, 1, NULL, 0, NULL, 'Shiitake Scheiben getrocknet', 'Der Shiitake riecht knoblauchartig und eignet sich ganz besonders zum Trocknen: sein würziger Geschmack wird beim Trocknen deutlich intensiver. Er ist ernährungsphysiologisch ein sehr wertvoller Pilz und enthält Ballaststoffe, Proteine, die Vitamine B, C und die Vitamin-D-Vorstufe Ergosterol sowie die Mineralien Eisen, Kalium und Zink. Der Shiitake wird häufig auch als König der Heilpilze bezeichnet. Er passt hervorragend zu zahlreichen Gerichten  ein Vorrat an getrockneten Shiitake sollte deshalb in keiner Küche fehlen. Der Shiitake, der auch Pansaniapilz genannt wird, weil er in seiner Heimat Asien am Pansania-Baum wächst. Er spielt in der asiatischen Küche eine sehr wichtige Rolle, ist jedoch bei uns erst seit ungefähr 30 Jahren bekannt und wird immer beliebter. Kommerziell angebaut wird der Shiitake auf Buchen, Eichen, Ahorn und Walnussbäumen.', 'Pilze Wohlrab GmbH & Co. KG', 'Wohlrab', 'Deutschland', NULL, 'manager', '2023-06-09 09:27:34', 'System', '2023-10-31 00:00:12', 3058, NULL, 0, NULL, 0, 2.68, 'Weiling', 0, NULL, 0, NULL, '100% getrocknete Shiitake-Scheiben*\r\n*aus kontrolliert ökologischer Erzeugung', '2023-06-09 09:27:59', 640, 'PASTA_CEREALS_LEGUMES;CONVENIENCE_PRESERVES;SPICES_COOKING_HELP', 'PANTRY', NULL, NULL, 'VEGAN;VEGETARIAN', NULL, NULL),
(2987, 'Wald und Wiesen Mix getrocknet (Weiling)', '4260261493683', 0, 4.99, 1, 1, NULL, 0, NULL, 'Wald und Wiesen Mix getrocknet', 'Wald & Wiesen Mix von Pilze Wohlrab ist aromaschonend getrocknet. Der nussige Steinpilz, die würzige Herbsttrompete und der schmackhafte Champignon machen diesen Mix so kostbar. Für herbstliche Gerichte und auch als aromatische Würze in vegetarischen und veganen Rezepten. Der Wald & Wiesen Mix von Pilze Wohlrab ist ökologisch erzeugt bzw. Bio-zertifiziert und trägt das EU-Bio-Siegel (Öko-Kontrollstelle: DE-ÖKO-006)', 'Pilze Wohlrab GmbH & Co. KG', 'Wohlrab', 'Deutschland', NULL, 'manager', '2023-06-09 09:30:19', 'System', '2023-09-30 00:00:15', 3059, NULL, 0, NULL, 0, 2.99, 'Weiling', 0, NULL, 0, NULL, 'Inhalt in veränderlichen Gewichtsanteilen: Champignon*, Herbsttrompete*****, Steinpilz*****\r\n*aus kontrolliert ökologischer Erzeugung, *****aus bio-zertifizierter Wildsammlung', '2023-06-09 09:30:18', 640, 'PASTA_CEREALS_LEGUMES;CONVENIENCE_PRESERVES;SPICES_COOKING_HELP', 'PANTRY', NULL, NULL, 'VEGAN;VEGETARIAN', NULL, NULL),
(2988, 'Indonesisches Ketjap Manis (Weiling)', '8713576003383', 0, 4.19, 1, 1, NULL, 0, NULL, 'Indonesisches Ketjap Manis', 'Möchtest du deine Gerichte noch aromatischer machen? Etwas Bio-Ketjap Manis  kann viel bewirken. In Indonesien weiß man das schon seit langem. Man verwendet  diese süße Sojasauce als Marinade, um Tofu oder Tempeh zu würzen, aber auch ein  Spritzer in einer Suppe oder Sauce verleiht jedem Gericht eine süßliche  Umami-Note. Das Besondere an dieser süßen Sojasauce ist, dass sie mit  Kokosblütenzucker gesüßt ist, einer Zuckerart mit einem niedrigen glykämischen  Index!', 'TerraSana Natuurvoeding BV', 'TerraSana', 'NETHERLANDS', '7362ff32-5d9a-4927-a10c-d1fd149b778f', 'manager', '2023-06-09 09:31:27', 'System', '2023-09-07 03:10:13', 3060, 2487, 0, NULL, 0, 2.44, 'Weiling', 0, NULL, 0, 120, 'Kokosblütenzucker*, Wasser, Tapiokasirup*, Tamari* (SOJAbohnen*, Wasser, Meersalz, gesalzenes Shochu* (Wasser, Reis*, Salz, Koji-Ferment), Koji-Ferment), Weißweinessig*, Meersalz, Verdickungsmittel: Maisstärke*, Ingwerpulver* *aus kontrolliert ökologischer Erzeugung', '2023-06-09 09:31:47', 639.16, 'OIL_VINEGAR_SAUCES', 'PANTRY', 430, 19, 'VEGAN;VEGETARIAN;GLUTENFREE', NULL, NULL),
(2989, 'Indonesisches Nasi Goreng Bumbu (Weiling)', '8713576003390', 0, 5.19, 1, 1, NULL, 0, NULL, 'Indonesisches Nasi Goreng Bumbu', 'Für einen traditionellen Reistisch stehen in Indonesien Frauen stundenlang in  der Küche und bereiten die leckersten Bumbus aus frischen Zutaten zu. Mit  diesem authentischen Bumbu kannst du den selben intensiven und authentischen  Geschmack genießen, aber anstatt stundenlang zu kochen, kannst du das köstliche  Nasi Goreng in weniger als 20 Minuten auf den Tisch bringen. Die indonesische  Küche ist eine Kunst für sich. Wir verstehen das wie kein anderer. Deshalb  haben wir für unser Nasi Goreng Bumbu die besten Köche der indonesischen Küche  gebeten, ihre Küchengeheimnisse mit uns zu teilen. Jetzt kannst du dir auch zu  Hause im Handumdrehen ein schnelles und aromatisches indonesisches Gericht  zubereiten. Das Bumbu ist als Sauce zu verwenden, die du ganz einfach mit  deinen Lieblingszutaten und Gemüse mischen kannst. Serviere dazu einen leckeren  Reis und fertig ist das Gericht.', 'TerraSana Natuurvoeding BV', 'TerraSana', 'NETHERLANDS', 'd46f2d30-6343-414c-b5d0-4f267a94dacf', 'manager', '2023-06-09 09:33:15', 'System', '2023-09-29 02:10:13', 3061, 2488, 0, NULL, 0, 3.07, 'Weiling', 0, NULL, 0, 120, 'Wasser, Zwiebel*, Sojasoße Süß* (Zuckerrübensirup*, Kokosblütenzucker*, SOJAbohnesaft*, Wasser, Meersalz, Gewürze*, Koriander*, Lorbeer*, Zitronengras*), Kokosblütenzucker*, Tomatenmark*, Knoblauch*, Sushiessig* (Wasser, Naturreis*, Meersalz, Koji-Ferment), Meersalz, Paprika*, weißer Pfeffer* , Verdickungsmittel: Pfeilwurz*, Rote Chilischote, Gewürznelke* *aus kontrolliert ökologischer Erzeugung', '2023-06-09 09:33:34', 374.616, 'CONVENIENCE_PRESERVES;OIL_VINEGAR_SAUCES;SPICES_COOKING_HELP', 'PANTRY', 345, 8.6, 'VEGAN;VEGETARIAN;GLUTENFREE', NULL, NULL),
(2990, 'Haselnuss Torte (Weiling)', '4260100262685', 0, 4.59, 1, 1, NULL, 0, NULL, 'Haselnuss Torte', NULL, 'Ökofrost GmbH', 'Biopolar', 'ITALY', '469bea02-e5c1-45b1-89bf-5d077ebd7f86', 'manager', '2023-06-09 09:36:46', 'manager', '2023-06-09 09:36:55', 3062, 2489, 0, NULL, 0, 2.73, 'Weiling', 0, NULL, 0, 103, 'SOJADRINK* (Wasser, SOJA*), Rohrzucker*, Kokosmilch* (Kokosnussextrakt*, Wasser, Kokoswasser*), fermentierte Zubereitung auf SOJABASIS* (Wasser, geschälte SOJABOHNEN*, Milchsäurebakterien), Sonnenblumenöl*, Kakaobutterzubereitung* [Kakaobutter*, Rohrzucker*, Reisdrinkpulver* (Reis*, Sonnenblumenöl*, Salz), Emulgator (Lecithine*)], HASELNUSSPASTE* 4 %, TOFU* (Wasser, SOJA*), Wasser, Reismehl*, Zartbitterschokolade* [Kakaomasse*, Rohrzucker*, Kakaobutter*, Emulgator (SOJALECITHINE*), Vanilleextrakt*], Reisstärke*, Kokosöl*, Kartoffelstärke*, Reissirup* (Reis*, Wasser), Verdickungsmittel (Pektin, Agar-Agar, Johannisbrotkernmehl*, Xanthan), Agaven-Inulin*, HASELNUSSSTÜCKE* 0,4 %, Traubenzucker*, Kaffee* 0,3 %, Backtriebmittel (Kaliumtartrate, Natriumcarbonate), Kakaopulver*, Kaffeeextrakt 0,03%, Zitronensaft* *aus kontrolliert ökologischer Erzeugung', '2023-06-09 09:37:04', 581.9, 'CONVENIENCE_PASTRY_FROZEN;ICECREAM_DESSERT_FROZEN', 'FROZEN', 135.8, 11.5, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
