(2992, 'Buttermilchdrink Himbeere (Weiling)', '4056479582031', 0, 1.49, 1, 1, NULL, 0, NULL, 'Buttermilchdrink Himbeere', 'Fruchtig-frischer Buttermilchdrink mit hohem Fruchtanteil, ohne Aromazusätze.\r\nUnsere Buttermilch gewinnen wir als natürliches Nebenprodukt bei der Herstellung unserer Sauerrahmbutter. Unter Zugabe reinen Fruchtpürees und abgerundet mit etwas Rübenzucker, wird aus ihr ein fruchtig-frischer Buttermilchdrink, dessen Fruchtanteil so hoch ist, dass er ohne Aromazusätze auskommt. Bei der Erzeugung und Verarbeitung unserer Produkte steht für uns immer ein zukunftsfähiges Beziehungsgeflecht von Menschen, Tieren und Natur im Mittelpunkt. Um dem gerecht zu werden, haben wir uns eigene zusätzliche Qualitätsstandards gesetzt  für eine Landwirtschaft, die zu einer lebenswerten Zukunft beiträgt.', 'Hamfelder Hof Bauernmeierei', 'Hamfelder Hof', 'Mühlenrade, SH', NULL, 'manager', '2023-06-09 09:42:57', 'System', '2023-07-01 00:01:12', 3065, NULL, 1, NULL, 0, 0.85, 'Weiling', 0, NULL, 0, NULL, 'Buttermilch* (84 %), Himbeerpüree** (10 %), Rübenzucker* (5 %), Stabilisator: Pektin\r\nenthält folgende allergene Zutaten: Milch\r\n*aus kontrolliert ökologischer Erzeugung, **aus ökologischem Anbau, EU', '2023-07-14 10:08:35', 635.625, 'DAIRY_PRODUCTS_EGGS', 'FRESH', NULL, NULL, 'VEGETARIAN', NULL, NULL),
(2993, 'Pflanze Kräuter (Weiling)', '000002', 0, 2.7, 1, 1, NULL, 0, NULL, 'Pflanze Kräuter', NULL, NULL, NULL, NULL, NULL, 'manager', '2023-06-09 09:46:33', 'manager', '2023-06-09 13:46:45', 3066, NULL, 1, NULL, 0, 1.6, 'Weiling', 0, NULL, 3, NULL, NULL, '2023-06-09 13:46:45', NULL, 'OTHER', 'OTHER', NULL, NULL, NULL, NULL, NULL),
(2994, 'Erdnusstopf Afrikanisch (Weiling)', '4260195546035', 0, 3.99, 1, 1, NULL, 0, NULL, 'Erdnusstopf Afrikanisch', 'Ein kräftiger Eintopf aus weißen Bohnen, Erbsen und Gemüse in einer Erdnusssauce. Angenehme Schärfe. Ein kulinarischer Ausflug nach Westafrika. Unsere Zutaten und Rezepturen sind uns heilig, weshalb wir den Produktionsprozess an die Rezeptur anpassen und nicht die Rezeptur an den Prozess. Deswegen sind unsere Suppen ohne Suppenchemie wie zB:  Geschmacksverstärker / Hefeextrakt / Milcheiweiß  Stärke / modifizierte Stärken  Konservierungsstoffe  Verdickungsmittel  Maltodextrin  Zucker: Zucker (Saccharose), Milchzucker  Emulgatoren  Säuerungsmittel z.B. Citronensäure  Eigelb (Carotinoide)  Farbstoffe: Tomatenpulver / Rote-Bete-Pulver u.a.', 'WDM Bio-Fertigprodukte GmbH', 'Wünsch Dir Mahl', 'Deutschland', NULL, 'manager', '2023-06-13 09:00:08', 'System', '2023-09-01 00:01:04', 3067, NULL, 0, NULL, 0, 2.44, 'Weiling', 0, NULL, 0, 71, 'Wasser, Zuckererbsen* (15%), Weiße Bohnen* (7%), ERDNUSS* (6%), Zwiebeln* (6%), Möhren* (6%), Tomatenmark*, Steinsalz, Paprikapulver edelsüß*, Knoblauch*, Ingwer*, Pfeffer schwarz*, Chili*\r\nenthält folgende allergene Zutaten: Erdnuss\r\n*aus kontrolliert ökologischer Erzeugung', '2023-06-13 09:00:36', 703.125, 'CONVENIENCE_PRESERVES', 'PANTRY', NULL, NULL, 'VEGAN;VEGETARIAN;GLUTENFREE;LACTOSEFREE', NULL, NULL),
(2995, 'Farfalle (Weiling)', '4065626114766', 0, 1.69, 1, 1, NULL, 0, NULL, 'Farfalle', 'Original italienisch genießen: Die bioladen*Pasta wird aus 100 % italienischem Hartweizengrieß nach traditionellem Verfahren in der Lombardei hergestellt. A.S.T.R.A. Bio, unser Pasta-Produzent aus Casteldidone arbeitet eng mit der Kooperative IRIS zusammen– Bio-Pionier in Italien seit 1978. Dort arbeiten alle mit großer Überzeugung und Sorgfalt für beste Produktqualität. Zur Herstellung werden Bronzeformen verwendet. Sie verleihen den Nudeln eine raue Oberfläche, die Saucen besonders gut aufnehmen kann. Durch die schonende Trocknung behält die Pasta ihre Kochfestigkeit und gelingt immer perfekt al dente. Eine besondere Qualität, die man schmeckt!', 'Weiling GmbH', 'bioladen', 'ITALY', 'eea592ea-4684-4685-ada7-3a43867582ac', 'manager', '2023-06-13 09:06:27', 'System', '2023-10-14 02:11:34', 3068, 2491, 0, NULL, 0, 1, 'Weiling', 0, NULL, 0, 102, 'HARTWEIZENGRIEß* *aus kontrolliert ökologischer Erzeugung', '2023-06-13 09:06:43', 1414.5, 'PASTA_CEREALS_LEGUMES', 'PANTRY', 506.5, 20.5, 'VEGAN;VEGETARIAN', NULL, NULL),
