(2998, 'Ziegenfrischkäse Kräuter & rosa Pfeffer (Weiling)', '4000915107043', 0, 3.19, 1, 1, NULL, 0, NULL, 'Ziegenfrischkäse Kräuter & rosa Pfeffer', 'Der Ziegenfrischkäse in einer fein-würzigen Kräutermarinade wird mit rosa Pfefferkörnern bereichert. Die Frischkäse Spezialität (kann Spuren von Schafmilch enthalten) ist das ganze Jahr über verfügbar.', 'Isana Naturfeinkost GmbH & Co. Produktions- und Handels KG', 'bio-verde', 'Belgien oder Bulgarien', '2b8033aa-69d8-4f86-a3fa-c8e0b58c801d', 'manager', '2023-06-16 08:50:56', 'System', '2023-12-21 02:06:26', 3071, 2492, 0, NULL, 0, 1.93, 'Weiling', 0, NULL, 0, 64, 'Ziegenfrischkäse (79%) aus pasteurisierter ZIEGENMILCH*\n50% Fett i.Tr., Sonnenblumenöl*, Olivenöl*,\nKräuter* (1% - Petersilie*, Oregano*, Thymian*,\nRosmarin*), Meersalz, rosa Pfeffer* (0,2%) *aus kontrolliert ökologischer Erzeugung', '2023-08-01 12:06:17', 437.184, 'CHEESE', 'FRESH', 115, 9.9, 'VEGETARIAN', NULL, NULL),
(2999, 'Rote Bratwurst vegan (Weiling)', '4032277011775', 0, 3.99, 1, 1, NULL, 0, NULL, 'Rote Bratwurst vegan', 'Knackig und voller Aroma, dank veganer, essbarer Natur-Pelle. Super-saftig, grobe Textur, würzig im Geschmack. Ideal als Grill- oder Bratwurst zu Gemüse, Kartoffeln oder nur im Brötchen.\nEin veganer Gamechanger zum 30jährigen Jubiläum der Marke Wheaty.', 'TOPAS GmbH', 'Wheaty', 'GERMANY', 'c59e373e-be87-4a8d-ad63-7e3a561011ee', 'manager', '2023-06-16 08:53:34', 'System', '2023-09-26 02:42:03', 3072, 2493, 0, NULL, 0, 2.34, 'Weiling', 0, NULL, 0, 61, '80 % Seitan* (Wasser, WEIZENeiweiß*), ölsäurereiches (High-Oleic) Sonnenblumenöl*, essbare Hülle (Stabilisatoren: Natriumalginat, Konjakgummi, Guarkernmehl), Steinsalz, Hefeextrakt*, Zwiebeln*, Gewürze*, färbendes Lebensmittel (Konzentrat aus Rettich* und Karotte*), Verdickungsmittel (Agar-Agar* und Johannisbrotkernmehl*), Buchenholzrauch. *aus kontrolliert ökologischer Erzeugung', '2023-06-16 08:53:53', 365.4, 'VEGAN_VEGETARIAN', 'FRESH', 104, 17.5, 'VEGAN;VEGETARIAN', NULL, NULL),
