(3006, 'Aioli Classico frisch (Weiling)', '4000915100990', 0, 2.19, 1, 1, NULL, 0, NULL, 'Aioli Classico frisch', 'Die bio-verde Aioli Classico ist eine Knoblauch Mayonnaise nach spanischer Art.', 'Isana Naturfeinkost GmbH & Co. Produktions- und Handels KG', 'bio-verde', 'GERMANY', '94a8598e-dece-42de-bf60-e7cafbcb72e2', 'manager', '2023-06-20 09:26:27', 'System', '2023-07-01 00:04:09', 3079, 2496, 0, NULL, 0, 1.33, 'Weiling', 0, NULL, 0, 64, 'Sonnenblumenöl*, Knoblauch* ( 10%), EIGELB* (8%), SENF* ( Wasser, SENFSAATEN*, Branntweinessig*, Meersalz, Gewürze*, Kräuter*),\nMeersalz, Branntweinessig*, Rohrzucker* *aus kontrolliert ökologischer Erzeugung', '2023-06-20 09:26:54', 306.85, 'GOURMET_CONVENIENCE', 'FRESH', 97, 9.5, 'VEGETARIAN', NULL, NULL),
(3007, 'Thunfischsalat 125g (Weiling)', '4045800656947', 0, 2.79, 1, 1, NULL, 0, NULL, 'Thunfischsalat 125g', 'Der beliebte Fischsalat – jetzt auch in MSC- und Bio-Qualität.\nMit Bio-Eiern, Bio-Mais und Bio-Erbsen. Alle Zutaten der Sauce stammen aus aus ökologischer Landwirtschaft.\nDer Thunfisch wird im Westlichen Indischen Ozean FAO 51 mit Handleinen und Angelleinen (handbetrieben) gefangen. Die Hand and Polelines-Methode hat lt. MSC keine Bodenauswirkungen. \nGluten- und laktosefrei. \nErhältlich in der 125g SB-Verpackung.', 'Popp Feinkost GmbH', 'Grünhof', 'GERMANY', '8d79bae5-bed7-4e0b-a1ab-adf20eb37755', 'manager', '2023-06-20 09:28:26', 'System', '2023-11-02 02:09:21', 3080, 2497, NULL, NULL, 0, 1.66, 'Weiling', 0, NULL, 0, 72, 'THUNFISCH 26 %, EIER*, Mais*, Rapsöl*, Wasser, Erbsen*, Branntweinessig*,\nRohrohrzucker*, Tomatenmark*, Reisstärke*, EIGELB*, Speisesalz, Kräuter*,\nKnoblauch*, Gewürze*, Verdickungsmittel: Guarkernmehl*; SENFAAT*. *aus ökologischer Landwirtschaft\n63 % der Zutaten stammen aus ökologischer Landwirtschaft\nDE-ÖKO-039\n\nThunfisch (Katsuwonus pelamis) gefangen im Westlichen Indischen Ozean FAO 51 mit Haken und Langleinen.', '2023-08-01 12:06:30', 424.359, 'GOURMET_CONVENIENCE', 'FRESH', 133, 11.7, 'GLUTENFREE;LACTOSEFREE', NULL, NULL),
