(3009, 'Tofu alla Milanese (Weiling)', '4067583200100', 0, 4.19, 1, 1, NULL, 0, NULL, 'Tofu alla Milanese', 'Frischer Nigari Tofu mit Tomaten und Oregano verfeinert und dann knusprig paniert.\r\n\r\nUnsere Tofus werden mit Nigari, einem Meerwasserextrakt, gefertigt. Diese traditionell japanische Art Tofus herzustellen kombinieren wir mit dem Feingefühl italienischer Kochkunst. Der frische Nigari Tofu wird mit Tomaten und Oregano verfeinert und dann knusprig paniert. Schonend verarbeitet ist er sehr verträglich. Der luftig leckere Tofu ist außen knusprig und innen herzhaft cremig - und das herrlich italienisch gewürzt. Augen zu - Urlaub da! Ideal für eine vegane Scalopina Milanese, oder zu Pasta, oder zum Salat (gebraten oder kalt), als Crispy Italian Burger, oder zu ...', 'Casa Alpe Adria GmbH', 'Fattoria Vegetale', 'Plattling, BY', NULL, 'manager', '2023-06-20 09:35:31', 'System', '2023-07-31 00:02:44', 3082, NULL, 0, NULL, 0, 2.5, 'Weiling', 0, NULL, 0, NULL, 'TOFU* 35% (SOJA*, Wasser, Nigari (Magnesiumchlorid)), Kruste* (WEIZENMEHL*, Wasser, Maismehl*, WEIZENSTÄRKE*, Salz, Paprikapulver*) SOJAMEHL*, Sonnenblumenöl*, Semmelbrösel* (WEIZENMEHL*, Salz), Wasser, getrocknete Tomaten*, 3%, Tapiokastärke*, Weinessig*, Tomatenmarkkonzentrat* 2%, Zwiebeln*, HAFER*, Gemüsebrühe* (Salz, Reismehl*, Maisstärke*, Gemüse* in veränderlichen Gewichtsanteilen (Zwiebeln*, SELLERIE*, Karotten*, Petersilie*, Lauch*), Miso* (SOJA*, Reis*, Wasser, Salz, Koji), Hefeextrakt*, Olivenöl*, Gewürze*), Hefeextrakt*, Sojasauce*, (SOJA*, Wasser, Salz, Shochu* (Wasser, Reis*, Koji, Salz)), Salz, Oregano*, Verdickungsmittel: Johannisbrotkernmehl*, Knoblauch*\r\nenthält folgende allergene Zutaten: Soja, Sellerie\r\n*aus kontrolliert ökologischer Erzeugung', '2023-08-01 12:06:39', 828, 'VEGAN_VEGETARIAN', 'FRESH', NULL, NULL, 'VEGAN;VEGETARIAN;LACTOSEFREE', NULL, NULL),
