(3012, 'Better Keks Dinkel', '4016249080600', 0, 3.19, 1, 1, NULL, 0, NULL, 'Better Keks Dinkel', 'Jetzt mal Butter bei die Fisch! Ja, aber nicht bei die Kekse. Also alle Besser-Esser aufgepasst: Dieser Keks schmeckt wie ein Butterkeks, ist aber ein Better-Keks. Denn sein guter Geschmack braucht keine Butter. Zubereitet aus bestem Dinkel-Vollkornmehl und verfeinert mit raffinierter Bourbon-Vanille ist er die bettere Wahl für alle, die es vegan lieben. Und für die, die es lecker lieben sowieso.', 'Allos Hof-Manufaktur GmbH', 'Allos', 'GERMANY', '1f768f35-63c2-4221-ae93-515804e7d33e', 'manager', '2023-06-23 10:04:23', 'System', '2023-11-25 02:08:29', 3085, 2498, 0, NULL, 0, 1.89, NULL, 0, NULL, 0, 60, 'DINKELVOLLKORNMEHL* (eine Weizenart) (61%), Rohrohrzucker*, Sonnenblumenöl*, Reissirup*, Backtriebmittel: Natriumhydrogencarbonat, Meersalz, Bourbon-Vanille* gemahlen *aus ökologischem Landbau.', '2023-08-01 12:05:52', 465.6, 'SWEETS', 'SNACKS', 178, 19.4, 'VEGAN;VEGETARIAN', NULL, NULL),
