(3015, 'Thaireisnudeln', '8713576282511', 0, 3.99, 1, 1, NULL, 0, NULL, 'Thaireisnudeln', 'Diese weißen Reisnudeln werden aus biologischem weißen Reis hergestellt. Sie  haben eine dünne Textur und passen geschmacklich sehr gut zu den herzhaften und  Umami-Aromen der japanischen Küche. Sie sind 100% glutenfrei, es kann also  jeder diese Nudeln genießen. Lecker mit einer frischen, leichten Zitronensauce  oder einer deftigen asiatischen Erdnusssauce. Passt gut zu einer herzhaften  (Miso-)Suppe mit Meeresalgen oder in vegetarische Gerichte mit Tofu oder  Seitan. In weniger als 5 Minuten fertig! Erhältlich in fünf anderen  glutenfreien Varianten aus Reis oder Buchweizen.', 'TerraSana Natuurvoeding BV', 'TerraSana', 'CHINA', '37f80c87-d406-4d93-9acc-922ffef55a28', 'manager', '2023-06-30 09:31:33', 'System', '2023-07-01 00:03:52', 3087, 2499, 0, NULL, 0, 2.5, NULL, 0, NULL, 0, 506, 'Reismehl aus Thaireis*, Wasser *aus kontrolliert ökologischer Erzeugung', '2023-06-30 09:53:15', 571.2, 'PASTA_CEREALS_LEGUMES', 'PANTRY', 253, 28, 'VEGAN;VEGETARIAN;GLUTENFREE', NULL, NULL),
