(3018, 'Mandel Nougat Crisp (Weiling)', '4044889004717', 0, 2.99, 1, 1, NULL, 0, NULL, 'Mandel Nougat Crisp', 'Dunkle Mandelnougat Schokolade mit knusprigen Mandelstückchen, gesüßt mit Kokosblütenzucker.', 'EcoFinia GmbH', 'Vivani', 'Herford, NRW', '49272654-3c96-4175-bbeb-d08ed87f75d0', 'manager', '2023-06-30 09:48:06', 'manager', '2023-06-30 09:48:18', 3089, 2500, 0, NULL, 0, 1.81, 'Weiling', 2, 1, 0, 67, 'Kokosblütenzucker* 32 %, MANDELN* 28 % (gehackt*/ MANDELmark*), Kakaomasse*°, Kakaobutter*°, Buchweizenmehl*, Bourbon Vanilleextrakt*. Kakao: 38% mindestens. \r\nKann Bestandteile von anderen SCHALENFRÜCHTEN, MILCH und GLUTEN enthalten. *aus kontrolliert ökologischer Erzeugung', '2023-06-30 09:48:03', 139.048, 'SWEETS', 'SNACKS', 94, 19.1, 'VEGAN;VEGETARIAN;PALMOILFREE', NULL, NULL),
(3019, 'Kokos-Schlagcreme', '8713576003680', 0, 3.99, 1, 1, NULL, 0, NULL, 'Kokos-Schlagcreme', 'Vegane Kokos-Schlagcreme, die sich steif aufschlagen lässt, wunderbar als  Topping für veganes Gebäck geeignet. Mit 91% Kokosnuss, und einem Fettanteil  von 30% ist diese Kokosmilch so cremig, dass du keine Schlagsahne mehr  brauchst. Diese Kokos-Schlagcreme lässt sich vielseitig wie Schlagsahne  verwenden. Schön cremig, lecker und rein pflanzlich. Ohne den Emulgator  Guarkernmehl. Mit dem natürlichen Bindemittel Tapioka, denn das macht diese  Kokossahne herrlich fest.  Serviere eine veganes Sahnehäubchen auf Gebäck oder auf heißer Schokolade.', 'TerraSana Natuurvoeding BV', 'TerraSana', 'SRI_LANKA', 'd11f4664-3b2a-41d3-8fd8-7d88ffc83d0b', 'manager', '2023-06-30 12:52:46', 'manager', '2023-06-30 12:52:47', 3090, 2501, 0, NULL, 0, 2.24, NULL, 0, NULL, 0, 1016, 'Kokosnussfleisch - Extrakt* 91%, Wasser, Tapiokastärke* *aus kontrolliert ökologischer Erzeugung', '2023-06-30 12:59:23', 618.75, 'CONVENIENCE_PRESERVES', 'PANTRY', 463, 11, 'VEGAN;VEGETARIAN;GLUTENFREE', NULL, NULL),
