(3021, 'Seitan Barbecue (Weiling)', '4067583013014', 0, 2.79, 1, 1, NULL, 0, NULL, 'Seitan Barbecue', 'Feiner Seitan in Tamari Sojasauce mariniert und schonend verarbeitet. Der leckere Seitan hat einen angenehmen Biss und ist horizontal in 2 Scheiben trennbar. Es entsteht nach schonender Verarbeitung ein sehr schmackhaftes und verträgliches Produkt. Der leckere Seitan hat mit einem hohen Proteingehalt (22g) vergleichsweise wenige Kohlenhydrate und Zucker. It\'s barbecue! Ideal für asiatische Gerichte, oder als Burgerpaddy, oder gebraten als Ergänzung der Antipasti, oder zum Salat (gebraten), zum Füllen von veganen Dönern, oder zu ...', 'Casa Alpe Adria GmbH', 'Fattoria Vegetale', 'Deutschland', NULL, 'manager', '2023-07-04 09:26:24', 'System', '2023-07-31 00:02:43', 3092, NULL, 0, NULL, 0, 1.61, 'Weiling', 0, NULL, 0, NULL, 'Wasser, WEIZENGLUTEN* 22%, WEIZENMEHL*, Soja-Sauce* 8% (Wasser, SOJA*, WEIZEN*, Meersalz), Ingwer*\r\nenthält folgende allergene Zutaten: Soja', '2023-07-04 09:26:24', 270, 'VEGAN_VEGETARIAN', 'FRESH', NULL, NULL, 'VEGAN;VEGETARIAN', NULL, NULL),
