(3026, 'GUA LIMO mit Holunder und Minze (Weiling)', '4007892011035', 1, 1.49, 1, 1, NULL, 0.08, NULL, 'GUA LIMO mit Holunder und Minze', 'Gib mal GUA! Heißt es ab sofort bei Grillabenden, beim Fußball, in der Mittagspause mit Kollegen*innen oder abends in deiner Stammbar oder in deinem Lieblingsclub. Denn unsere drei neuen fruchtigen Bio-Limo-Sorten kommen in der nachhaltigen 0,33 Glasmehrwegflasche und massieren die Zunge ein bisschen anders, als das was man sonst so vom Limo-Sektor kennt. Klar, die Guave als Fahrgestell für leckere Limos verwendet ja auch nicht jeder. Besser gesagt: keiner. Nur wir. Und du denkst dir, ganz geil eigentlich, der Durst ist gelöscht und nach der scharfen Ingwer-Kurkuma schiebst du eine erfrischende Flasche Lemongras hinterher.', 'Widerker Beverages GmbH', 'GUA', 'Stuttgart, BaWü', NULL, 'manager', '2023-07-07 07:51:14', 'System', '2023-07-31 00:00:35', 3097, NULL, 0, NULL, 0, 0.89, 'Weiling', 0, NULL, 0, NULL, 'Wasser, weißes Guavenpüree* (10%) Agavendicksaft*, Kohlensäure, Holundersaft* (4%), Säuerungsmittel: Citronensäure, natürliches Pfefferminz-Extrakt*\r\n*aus kontrolliert ökologischer Erzeugung', '2023-07-08 14:21:22', NULL, 'LEMONADE', 'DRINKS', NULL, NULL, 'VEGAN;VEGETARIAN', NULL, NULL),
