(3028, 'Wheaty Dry-Aged Italian Style (Weiling)', '4032277011065', 0, 2.49, 1, 1, NULL, 0, NULL, 'Wheaty Dry-Aged Italian Style', 'Luftgetrocknet, mild im Geschmack und unglaublich zart in der Konsistenz. Fast unglaublich, dass es sich hierbei um einen veganen Aufschnitt handelt, der ohne Chemie und künstliche Aromen auskommt. Traditionell nach den hohen Wheaty Standards im Rahmen der Biorichtlinien im deutschen Familienbetrieb der TOPAS GmbH hergestellt. Genießen Sie unsere \"Dry-Aged Italian Style\" klassisch am Besten mit einer dezenten Pesto Unterlage auf einem frischen Ciabatta, oder als Vorspeise mit veganen Parmesansplittern, Olivenöl, Zitronensaft und frischem Rucola. Guten Appetit!', 'TOPAS GmbH', 'Wheaty', 'GERMANY', '5728aae2-6e9e-465c-8c98-be94e1fe2eee', 'manager', '2023-07-07 08:04:14', 'System', '2024-02-01 02:11:33', 3099, 2504, 0, NULL, 0, 1.49, 'Weiling', 0, NULL, 0, 61, '69 % Seitan* (Wasser, WEIZENeiweiß*), ölsäurereiches (High-Oleic) Sonnenblumenöl*, WEIZENmehl*, Rote Beete*, Kichererbsenmehl*, natives Olivenöl*, Kartoffelflocken*, Steinsalz, Hefeextrakt*, färbendes Lebensmittel (Konzentrat aus Rettich* und Karotte*), Gewürze*, Agavenpulver*, Antioxidationsmittel: Ascorbinsäure, Buchenholzrauch. *aus kontrolliert ökologischer Erzeugung', '2023-07-07 08:04:33', 363, 'VEGAN_VEGETARIAN', 'FRESH', 68, 22, 'VEGAN;VEGETARIAN', NULL, NULL),
(3029, 'Vegetarische Bolognese Sanchon (Weiling)', '4030917041304', 0, 3.29, 1, 1, NULL, 0, NULL, 'Vegetarische Bolognese Sanchon', 'Sanchon Tomatensauce Vegetarische Bolognese ist eine vegane, gluten- und sojafreie Neuinterpretation des Originals aus Italien. Hochwertige und liebevoll ausgewählte Zutaten verleihen dieser Tomatensauce die besondere Note. Als innovative Fleischalternative wird Erbsenprotein-Schnetzel verwendet.', 'Petersilchen GmbH', 'Sanchon', 'GERMANY', '3df8ad36-1703-4633-8812-7d57ae3b726e', 'manager', '2023-07-11 10:16:21', 'manager', '2023-07-11 10:16:39', 3100, 2505, 0, NULL, 0, 1.95, 'Weiling', 0, NULL, 0, 67, 'Tomatenmark* 47 % einfach konzentriert, Zwiebeln*, Erbsenprotein-Schnetzel* 5,2 % (Erbsenprotein*), Agavendicksaft*, Möhren*, SELLERIE*, Olivenöl*, Tamarinde*, Petersillie*, Oregano, Rosmarin*, Thymian*, Pfeffer*, Liebstöckel*, Wasser, Meersalz (Version: 01-30-04-21) *aus kontrolliert ökologischer Erzeugung', '2023-07-11 10:16:48', 622.08, 'CONVENIENCE_PRESERVES;OIL_VINEGAR_SAUCES', 'PANTRY', 519.9, 12, 'VEGAN;VEGETARIAN;PALMOILFREE', NULL, NULL),
