(3031, 'Kräuter Baguette (Weiling)', '4250073460027', 0, 2.49, 1, 1, NULL, 0, NULL, 'Kräuter Baguette', 'Das knusprige followfood Bio-Kräuterbaguette mit cremiger Bio-Kräuter-Margarine-Füllung lässt nicht nur vegane Herzen höher schlagen, sondern leistet auch noch einen großen Beitrag zum Schutz unserer Böden. Damit kannst auch du dem Klimawandel ein Baguette vorschieben. Alle Zutaten stammen aus ökologischer Landwirtschaft.', 'followfood GmbH', 'followfood', 'GERMANY', 'dc3a1a52-4afa-45ac-8a3f-93dac5b5879a', 'manager', '2023-07-11 10:31:32', 'System', '2023-12-02 02:09:30', 3101, 2506, 0, NULL, 0, 1.45, 'Weiling', 0, NULL, 0, 61, 'WEIZENBAGUETTE 80%:\nWEIZENMEHL*, Wasser, getrockneter WEIZENSAUERTEIG* 1,44 %¹, (WEIZENMEHL*, Wasser), Salz, Hefe, WEIZENGLUTEN*, WEIZENMALZMEHL*, ROGGENMEHL*, Stabilisator: Guarkernmehl*, Mehlbehandlungsmittel: Ascorbinsäure.\n\nMARGARINE-KRÄUTER-FÜLLUNG 20%:\nMargarine* 75%¹ (pflanzliche Fette (Shea*, Kokos*), Wasser, Emulgatoren: Lecithine*; Zitronensaftkonzentrat*, Salz), Kräuter* 4%¹ (Petersilie*, Schnittlauch*, Dill*), Zwiebeln*, Knoblauch*, Salz, Kartoffelfaser*, Säuerungsmittel: Citronensäure; Kartoffelstärke*, Gewürze*, Sonnenblumenöl*. *aus kontrolliert ökologischer Erzeugung', '2023-07-11 10:31:58', 803.7, 'CONVENIENCE_PASTRY_FROZEN', 'FROZEN', 185, 28.5, 'VEGAN;VEGETARIAN', NULL, NULL),
