(3045, 'Waschmittel Lavendel 30-95°C 10l (Weiling)', '4007547501102', 1, 41.99, 1, 1, NULL, 0, NULL, 'Waschmittel Lavendel 30-95°C 10l', 'Die besondere energiesparende Sonett-Methode des Verseifens, der Einsatz von Ölen und ätherischen Ölen aus kontrolliert biologischem Anbau und ein für Flüssigwaschmittel ausgesprochen günstiges Verhältnis von Preis zu Waschleistung, sind die hervorstechenden Merkmale dieses Produkts.\n\nBaustein 1 im Baukastensystem.\n\n• Mit Bio-Pflanzenölseife, ohne Enzyme, ohne Gentechnik\n• Hohe Waschkraft. Für bunte und weiße Wäsche geeignet. Im Baukastenprinzip mit Sonett Enthärter und Sonett Bleichkomplex\n• Zarter Duft von ätherischem Lavendelöl aus kontrolliert biologischem Anbau \n• 100 % biologisch abbaubar\n\nErhältlich: 120 ml, 2 Liter, 5 Liter, 10 Liter, 20 Liter', 'Sonett GmbH', 'SONETT', 'GERMANY', '657f55cf-9181-45ec-8f46-6b5b61eba6dc', 'manager', '2023-08-04 10:43:34', 'System', '2024-02-14 02:08:53', 3113, 2513, NULL, NULL, 0, 25.11, 'Weiling', 0, NULL, 0, NULL, NULL, '2023-08-04 10:44:10', 13882.8, 'CLEANING', 'DRUGSTORE', 10374, 30.9, 'VEGAN;VEGETARIAN', NULL, NULL),
(3046, 'Malzbier 24er (Weiling)', '4023216000110', 1, 1.19, 1, 1, NULL, 0.08, NULL, 'Malzbier 24er', 'Charakteristisch für Müllers Malz sind sein Wohlgeschmack und seine Bekömmlichkeit. Der Hopfen stammt aus biologischem Vertragsanbau und die zur Malzherstellung verwendete Gerste wird in Biolandbetrieben nach den Richtlinien von Bioland angebaut. Müllers Malz wird vor der Abfüllung gefiltert und auf natürlichem Wege durch Erhitzung auf 65° Celsius haltbar gemacht. \nAlkoholfreies Malzgetränk, für Kinder geeignet', 'Brauerei Pinkus Müller GmbH & Co. KG', 'Pinkus', 'Münster, NRW', 'c5aa820b-7934-421d-b848-653a63323881', 'manager', '2023-08-11 10:36:52', 'manager', '2023-08-11 12:18:47', 3114, 2515, 1, NULL, 0, 0.59, 'Weiling', 2, 1, 0, 63, 'Wasser, WEIZENmalz*, GERSTENmalz*, Zucker*, Kohlensäure, Hopfen* *aus kontrolliert ökologischer Erzeugung', '2023-08-11 12:18:47', 790.54, 'BEER', 'DRINKS', 600, 23.5, 'VEGAN;VEGETARIAN;ALKOHOLFREE', NULL, NULL),
