(3050, 'Schlagsahne 32 % (Weiling)', '4026367041575', 0, 1.79, 1, 1, NULL, 0, NULL, 'Schlagsahne 32 %', 'Die Upländer Bauernmolkerei wurde 1996 von 18 Bio-Bäuerinnen und Bio-Bauern der Milcherzeugergemeinschaft Hessen w.V. gegründet. Mittlerweile beliefern über 100 Bio-Betriebe aus der Region unsere Molkerei.\nWir produzieren hochwertige Bio-Milchprodukte nach den strengen Richtlinien des Bioland-Verbandes. Somit sind eine artgerechte Tierhaltung und die Fütterung der Tiere mit ökologisch angebauten Futtermitteln selbstverständlich. \nBesonderen Wert legt die Upländer Bauernmolkerei auf nachhaltig faire Milchpreise, damit unsere Bio-Bäuerinnen und Bio-Bauern auf einer stabilen Basis die Existenz ihrer Betriebe auch in Zukunft sichern können.\nÜbrigens: Die Bio-Bauern liefern nicht nur die Milch, sie verarbeiten und vermarkten sie auch in eigener Regie. Die Anteile an der Upländer Bauernmolkerei GmbH werden mehrheitlich von den Bio-Bauern gehalten.', 'Upländer Bauernmolkerei GmbH', 'Upländer Bauernmolkerei', 'GERMANY', 'ddaaf49f-6c78-4c91-8561-300878ad65a6', 'manager', '2023-08-11 12:32:56', 'manager', '2023-08-11 12:33:47', 3118, 2519, 1, NULL, 0, 1.06, 'Weiling', 0, NULL, 0, 63, 'SCHLAGSAHNE*', '2023-08-11 12:33:57', 540, 'DAIRY_PRODUCTS_EGGS', 'FRESH', 209, 9.6, 'VEGETARIAN', NULL, NULL),
(3051, 'Mandorino (Weiling)', '8057829684722', 0, 4.99, 1, 1, NULL, 0, NULL, 'Mandorino', 'Mandorino ist ein leichter und delikater Käseersatz, der vielseitig in der Küche verwendet werden kann. Hier sind einige Ideen zur Verwendung von Mandorino als Ersatz für Parmesan: Verfeinern Sie Gerichte: Streuen Sie geriebenen Mandorino über Pasta, Risotto oder Suppen, um ihnen einen würzigen Geschmack zu verleihen. Aperitifs und Snacks: Servieren Sie Mandorino in dünnen Scheiben oder gewürfelt als köstlichen Begleiter zu Oliven, Trockenfrüchten oder Crackern. Salate aufwerten: Geben Sie gehobelten Mandorino über grüne Salate, um ihnen zusätzlichen Geschmack zu verleihen. Fingerfood: Verwenden Sie Mandorino als Zutat für gefüllte Teigtaschen, Quiches oder Pizzen, um eine herzhafte Füllung zu erhalten. Beilagen: Streuen Sie geriebenen Mandorino über Gemüse, Kartoffelgratins oder überbackene Gerichte für eine knusprige Kruste und köstlichen Geschmack. Snacks und Fingerfood-Kreationen: Überbacken Sie Bruschetta oder Crostini mit Mandorino für eine geschmacksintensive Note. Experimentieren Sie mit Mandorino und entdecken Sie weitere Möglichkeiten, um Ihren Gerichten eine würzige und delikate Note zu verleihen.', 'Quasani società agricola ar.l.', 'Fattoria della mandorla', 'Italien', NULL, 'manager', '2023-08-22 10:36:53', 'manager', '2023-08-22 12:57:57', 3119, NULL, 0, NULL, 0, 3.15, 'Weiling', 0, NULL, 0, 102, 'Fior di Mandorla* 72 %, (Kokosöl*, Kichererbsenmehl*, Kartoffelflocken*, Mehl von geschälte MANDELN* 4 %, Maismehl*, Mehl von entfetteten,geschälten MANDELN* 2,6 %, italienisches Meersalz, Agavensirup*), MANDELemulsion* 23 % (Wasser,Kokosöl*, Mehl von entfetteten,geschälten MANDELN* 12,1 %), Agar-Agar* (Verdickungsmittel), natürliches Aroma aus Bio-Hefeextrakt*, italienisches Meersalz\r\n*aus kontrolliert ökologischer Erzeugung, Kann Spuren von Sesam, Erdnüssen, anderen Nüssen und Fragmente davon enthalten', '2023-08-22 12:57:57', 300, 'VEGAN_VEGETARIAN', 'FRESH', 200, 